, 밀가루(5g),\n계피가루(1g), 소금(0.1g), 꿀(2g),\n식용유(5g), 물(8g)',NULL,NULL,0,'411','53','15.7',NULL,'14.3',NULL,'8.5',0,'http://www.foodsafetykorea.go.kr/uploadimg/cook/10_01095_2.png'),(1000,'땅콩호박 타르트','aapl','땅콩호박(1/2개), 아몬드가루(13g),\n버터(15g), 박력분(35g), 요거트(10g),\n달걀(1/2개), 사과(1/2개), 전분(5g),\n소금(0.5g), 호두(5g)',NULL,NULL,0,'337','35.5','18.5',NULL,'7.2',NULL,'10.9',0,'http://www.foodsafetykorea.go.kr/uploadimg/cook/10_01096_2.png');
