INSERT INTO `recipe_manual` VALUES (1,'1. 손질된 새우를 끓는 물에 데쳐 건진다.a','MANUAL01'),(1,'2. 연두부, 달걀, 생크림, 설탕에 녹인 무염버터를 믹서에 넣고 간 뒤 새우(1)를 함께 섞어 그릇에 담는다.b','MANUAL02'),(1,'3. 시금치를 잘게 다져 혼합물 그릇(2)에 뿌리고 찜기에 넣고 중간 불에서 10분 정도 찐다.c','MANUAL03'),(1,'','MANUAL04'),(1,'','MANUAL05'),(1,'','MANUAL06'),(1,'','MANUAL07'),(1,'','MANUAL08'),(1,'','MANUAL09'),(1,'','MANUAL10'),(1,'','MANUAL11'),(1,'','MANUAL12'),(1,'','MANUAL13'),(1,'','MANUAL14'),(1,'','MANUAL15'),(1,'','MANUAL16'),(1,'','MANUAL17'),(1,'','MANUAL18'),(1,'','MANUAL19'),(1,'','MANUAL20'),(2,'1. 부추는 깨끗이 씻어 물기를 제거하고, 5cm 길이로 썰고 부추에 날콩가루를 넣고 고루 섞이도록 버무린다.','MANUAL01'),(2,'2. 찜기에 면보를 깔고 부추를 넣은 후 김이 오르게 쪄서 파랗게 익힌다.','MANUAL02'),(2,'3. 저염간장에 다진 대파, 다진 마늘, 고춧가루, 요리당 , 참기름, 참깨를 섞어 양념장을 만들고 찐 부추는 그릇에 담아낸다.','MANUAL03'),(2,'','MANUAL04'),(2,'','MANUAL05'),(2,'','MANUAL06'),(2,'','MANUAL07'),(2,'','MANUAL08'),(2,'','MANUAL09'),(2,'','MANUAL10'),(2,'','MANUAL11'),(2,'','MANUAL12'),(2,'','MANUAL13'),(2,'','MANUAL14'),(2,'','MANUAL15'),(2,'','MANUAL16'),(2,'','MANUAL17'),(2,'','MANUAL18'),(2,'','MANUAL19'),(2,'','MANUAL20'),(3,'1. 물기를 빼고 2cm 정도의 크기로 썰은 부추와 양파를 양념장에 섞어 양념속을 만든다.','MANUAL01'),(3,'2. 깨끗이 씻은 방울토마토는 꼭지를 떼고 윗부분에 칼로 십자모양으로 칼집을 낸다.','MANUAL02'),(3,'3. 칼집을 낸 방울토마토에 양념속을 사이사이에 넣어 버무린다.','MANUAL03'),(3,'','MANUAL04'),(3,'','MANUAL05'),(3,'','MANUAL06'),(3,'','MANUAL07'),(3,'','MANUAL08'),(3,'','MANUAL09'),(3,'','MANUAL10'),(3,'','MANUAL11'),(3,'','MANUAL12'),(3,'','MANUAL13'),(3,'','MANUAL14'),(3,'','MANUAL15'),(3,'','MANUAL16'),(3,'','MANUAL17'),(3,'','MANUAL18'),(3,'','MANUAL19'),(3,'','MANUAL20'),(4,'1. 사과, 순두부를 믹서에 넣고 곱게 갈아 소스를 만든다.','MANUAL01'),(4,'2. 오이는 소금으로 문질러 씻어 반을 갈라 씨를 제거하고 어슷썰기를 한다.','MANUAL02'),(4,'3. 썰어 놓은 오이에 순두부사과 소스를 넣고 버무린 후 다진 땅콩을 뿌려 마무리 한다.','MANUAL03'),(4,'','MANUAL04'),(4,'','MANUAL05'),(4,'','MANUAL06'),(4,'','MANUAL07'),(4,'','MANUAL08'),(4,'','MANUAL09'),(4,'','MANUAL10'),(4,'','MANUAL11'),(4,'','MANUAL12'),(4,'','MANUAL13'),(4,'','MANUAL14'),(4,'','MANUAL15'),(4,'','MANUAL16'),(4,'','MANUAL17'),(4,'','MANUAL18'),(4,'','MANUAL19'),(4,'','MANUAL20'),(5,'','MANUAL01'),(5,'2. 북어채를 잘게 손으로 찢어 찬물에 헹구어 준비한 후 양파, 표고버섯, 사과는 채 썰고 새우는 등쪽의 두세 마디에 꼬챙이를 넣어 내장을 뺀 후 헹군다.','MANUAL02'),(5,'3. 찬물에 북어채, 새우, 표고버섯, 양파를 넣고 20분 정도 끓인 후 사과를 넣어 북어의 씁쓸한 맛을 없앤다.','MANUAL03'),(5,'','MANUAL04'),(5,'5. 그릇에 담아낸다.','MANUAL05'),(5,'','MANUAL06'),(5,'','MANUAL07'),(5,'','MANUAL08'),(5,'','MANUAL09'),(5,'','MANUAL10'),(5,'','MANUAL11'),(5,'','MANUAL12'),(5,'','MANUAL13'),(5,'','MANUAL14'),(5,'','MANUAL15'),(5,'','MANUAL16'),(5,'','MANUAL17'),(5,'','MANUAL18'),(5,'','MANUAL19'),(5,'','MANUAL20'),(6,'','MANUAL01'),(6,'','MANUAL02'),(6,'3. 황태는 손질하여 물에 헹궈 건져 놓고 콩나물은 다듬어 씻고 청양고추는 어슷썰기 한다.','MANUAL03'),(6,'4. 냄비에 물을 붓고 황태와 무를 넣고 끓인 후 육수에서 물을 건져내고 저염 된장을 푼다.','MANUAL04'),(6,'5. 콩나물, 다진 마늘, 청양고추를 넣고 뚜껑을 덮어 김이 나게 끓\n여준다.','MANUAL05'),(6,'','MANUAL06'),(6,'','MANUAL07'),(6,'','MANUAL08'),(6,'','MANUAL09'),(6,'','MANUAL10'),(6,'','MANUAL11'),(6,'','MANUAL12'),(6,'','MANUAL13'),(6,'','MANUAL14'),(6,'','MANUAL15'),(6,'','MANUAL16'),(6,'','MANUAL17'),(6,'','MANUAL18'),(6,'','MANUAL19'),(6,'','MANUAL20'),(7,'1. 감자, 양파는 얇게 썰고 애느타리 버섯은 썰어 달궈진 팬에 굽는다.','MANUAL01'),(7,'2. 냄비에 물을 붓고 된장을 푼 뒤 감자, 양파, 두부를 넣어 재료가 투명해지게 끓인 후 된장국의 재료를 건져서 믹서에 넣어 갈고 된장국에 넣어 한번 더 끓인다.','MANUAL02'),(7,'3. 구운 애느타리버섯과 대파를 국에 넣어 끓인 후 그릇에 담는다.','MANUAL03'),(7,'','MANUAL04'),(7,'','MANUAL05'),(7,'','MANUAL06'),(7,'','MANUAL07'),(7,'','MANUAL08'),(7,'','MANUAL09'),(7,'','MANUAL10'),(7,'','MANUAL11'),(7,'','MANUAL12'),(7,'','MANUAL13'),(7,'','MANUAL14'),(7,'','MANUAL15'),(7,'','MANUAL16'),(7,'','MANUAL17'),(7,'','MANUAL18'),(7,'','MANUAL19'),(7,'','MANUAL20'),(8,'1. 찬물에 표고버섯,머리와 내장을 제거한 멸치,\n다시마, 양파를 넣어 중간 불에서 10분 정도\n끓여 멸치육수를 만든다.','MANUAL01'),(8,'2. 육수의 표고버섯 기둥, 멸치, 다시마, 양파를 건진 후 표고버섯은 편으로 썰고 청경채는 4cm 크기로 썬다.','MANUAL02'),(8,'3. 끓는 육수에 준비한 표고버섯과 청경채를 넣고 국간장으로 간을 한 후 마늘을 넣어 한소끔 끓인다.','MANUAL03'),(8,'','MANUAL04'),(8,'','MANUAL05'),(8,'','MANUAL06'),(8,'','MANUAL07'),(8,'','MANUAL08'),(8,'','MANUAL09'),(8,'','MANUAL10'),(8,'','MANUAL11'),(8,'','MANUAL12'),(8,'','MANUAL13'),(8,'','MANUAL14'),(8,'','MANUAL15'),(8,'','MANUAL16'),(8,'','MANUAL17'),(8,'','MANUAL18'),(8,'','MANUAL19'),(8,'','MANUAL20'),(9,'1. 올리브유, 식초, 설탕, 다진 마늘을 섞어 거품기로 충분히 저어주어 올리브마늘 드레싱을 만든다.','MANUAL01'),(9,'2. 치커리는 싱싱하게 찬물에 담갔다가 물기를 뺀 후 한입 크기로 자르고, 적양배추, 양파, 당근은 곱게채를 썬다.','MANUAL02'),(9,'3. 접시에 준비한 치커리, 적양배추, 양파, 당근을 담고 올리브마늘 드레싱을 뿌린다.','MANUAL03'),(9,'','MANUAL04'),(9,'','MANUAL05'),(9,'','MANUAL06'),(9,'','MANUAL07'),(9,'','MANUAL08'),(9,'','MANUAL09'),(9,'','MANUAL10'),(9,'','MANUAL11'),(9,'','MANUAL12'),(9,'','MANUAL13'),(9,'','MANUAL14'),(9,'','MANUAL15'),(9,'','MANUAL16'),(9,'','MANUAL17'),(9,'','MANUAL18'),(9,'','MANUAL19'),(9,'','MANUAL20'),(10,'1. 찬물이 담긴 냄비에 식초, 소금을 넣고 메추리알을 삶는다. 물이 끓어오르면 5분 정도 더 삶아 찬물에 헹군 후 껍질을 벗기고 반으로 자른다.','MANUAL01'),(10,'2. 딸기를 흐르는 물에 가볍게 씻어 꼭지를 제거한 후 물기를 빼고 반으로 자른다.','MANUAL02'),(10,'3. 양상추는 찬물에 담갔다가 물기를 빼고 한입 크기로 찢은 후 접시에 양상추, 딸기, 블루베리, 메추리알을 담고 플레인요거트를 끼얹는다.','MANUAL03'),(10,'','MANUAL04'),(10,'','MANUAL05'),(10,'','MANUAL06'),(10,'','MANUAL07'),(10,'','MANUAL08'),(10,'','MANUAL09'),(10,'','MANUAL10'),(10,'','MANUAL11'),(10,'','MANUAL12'),(10,'','MANUAL13'),(10,'','MANUAL14'),(10,'','MANUAL15'),(10,'','MANUAL16'),(10,'','MANUAL17'),(10,'','MANUAL18'),(10,'','MANUAL19'),(10,'','MANUAL20'),(11,'1. 시금치는 끓는 소금물에 데쳐 찬물에 헹구어 물기를 짜고 우유를 넣고 블렌더에 곱게 갈아 체에 거른다.','MANUAL01'),(11,'2. 껍질 벗긴 감자는 찜기에 넣어 20분 정도 삶고 꺼내서 으깨고, 아몬드는 잘게 다지며, 치커리는 곱게 다진다.','MANUAL02'),(11,'3. 으깬 감자, 다진 치커리, 시금치 우유소스, 설탕을 넣고 섞어 접시에 담고 아몬드, 크랜베리를 올리고 시금치우유 소스를 곁들인다.','MANUAL03'),(11,'','MANUAL04'),(11,'','MANUAL05'),(11,'','MANUAL06'),(11,'','MANUAL07'),(11,'','MANUAL08'),(11,'','MANUAL09'),(11,'','MANUAL10'),(11,'','MANUAL11'),(11,'','MANUAL12'),(11,'','MANUAL13'),(11,'','MANUAL14'),(11,'','MANUAL15'),(11,'','MANUAL16'),(11,'','MANUAL17'),(11,'','MANUAL18'),(11,'','MANUAL19'),(11,'','MANUAL20'),(12,'1. 곱게 다진 양파와 오이피클은 물기를 짠다.','MANUAL01'),(12,'2. 연두부에 다진 양파, 다진 오이피클, 올리브유, 머스터드, 후추, 꿀, 식초, 레몬즙을 넣어 두부타르타르 소스를 만든다.','MANUAL02'),(12,'3. 새송이버섯은 0.5cm 두께로 썰고 프라이팬에 노릇하게 구워준 후 접시에 새송이버섯과 치커리를 담고 소스를 곁들인다.','MANUAL03'),(12,'','MANUAL04'),(12,'','MANUAL05'),(12,'','MANUAL06'),(12,'','MANUAL07'),(12,'','MANUAL08'),(12,'','MANUAL09'),(12,'','MANUAL10'),(12,'','MANUAL11'),(12,'','MANUAL12'),(12,'','MANUAL13'),(12,'','MANUAL14'),(12,'','MANUAL15'),(12,'','MANUAL16'),(12,'','MANUAL17'),(12,'','MANUAL18'),(12,'','MANUAL19'),(12,'','MANUAL20'),(13,'1. 저염간장, 식초, 레몬즙, 설탕을 혼합하여 간장레몬 소스를 만든다.','MANUAL01'),(13,'2. 호박, 가지, 새송이버섯은 3cm 길이로 자른 후 얇은 편으로 채 썰고, 양파, 파프리카, 피망은 호박 길이로 썬다.','MANUAL02'),(13,'3. 가지, 호박, 새송이버섯, 양파, 파프리카, 피망에 올리브유를 바르고 달궈진 그릴 팬에 구운 후 접시에 담고 발사믹 크레타를 뿌리고 간장레몬 소스를 곁들인다.','MANUAL03'),(13,'','MANUAL04'),(13,'','MANUAL05'),(13,'','MANUAL06'),(13,'','MANUAL07'),(13,'','MANUAL08'),(13,'','MANUAL09'),(13,'','MANUAL10'),(13,'','MANUAL11'),(13,'','MANUAL12'),(13,'','MANUAL13'),(13,'','MANUAL14'),(13,'','MANUAL15'),(13,'','MANUAL16'),(13,'','MANUAL17'),(13,'','MANUAL18'),(13,'','MANUAL19'),(13,'','MANUAL20'),(14,'1. 두유에 플레인요거트와 레몬즙, 설탕을 넣고 잘 섞어 두유요거트 소스를 만든다.','MANUAL01'),(14,'2. 강낭콩은 물에 불린 후 콩과 물을 1:2.5로 넣고 20~25분 삶아 건지고 브로콜리와 컬리플라워는 한입 크기로 썰어 끓는 소금물에 살짝 데쳐 찬물에 헹궈 물기를 뺀다.','MANUAL02'),(14,'3. 접시에 데친 브로콜리와 컬리플라워, 삶은 강낭콩, 채썬 적양파, 다진 호두, 건포도를 담고 두유요거트 소스를 곁들여 낸다.','MANUAL03'),(14,'','MANUAL04'),(14,'','MANUAL05'),(14,'','MANUAL06'),(14,'','MANUAL07'),(14,'','MANUAL08'),(14,'','MANUAL09'),(14,'','MANUAL10'),(14,'','MANUAL11'),(14,'','MANUAL12'),(14,'','MANUAL13'),(14,'','MANUAL14'),(14,'','MANUAL15'),(14,'','MANUAL16'),(14,'','MANUAL17'),(14,'','MANUAL18'),(14,'','MANUAL19'),(14,'','MANUAL20'),(15,'1. 오렌지는 깨끗이 씻어 껍질을 벗긴다.','MANUAL01'),(15,'2. 당근은 깨끗이 씻어 작은 토막으로 썬다.','MANUAL02'),(15,'3. 당근, 오렌지, 물(50ml)을 믹서에 곱게 간다.','MANUAL03'),(15,'4. 믹서에 갈아낸 주스는 고운 체로 거른다.','MANUAL04'),(15,'5. 주스를 살얼음이 생길 만큼 시원하게 냉동한다.','MANUAL05'),(15,'6. 컵에 담아 마무리한다.','MANUAL06'),(15,'','MANUAL07'),(15,'','MANUAL08'),(15,'','MANUAL09'),(15,'','MANUAL10'),(15,'','MANUAL11'),(15,'','MANUAL12'),(15,'','MANUAL13'),(15,'','MANUAL14'),(15,'','MANUAL15'),(15,'','MANUAL16'),(15,'','MANUAL17'),(15,'','MANUAL18'),(15,'','MANUAL19'),(15,'','MANUAL20'),(16,'1. 잣, 아몬드, 해바라기씨, 호두, 호박씨는 다진다.','MANUAL01'),(16,'2. 끓는 물에 저염소금과 식초를 넣은 후 소면을 삶은 후 체에 건져 물기를\n뺀다.','MANUAL02'),(16,'3. 석류는 물 600g와 함께 믹서에 갈고 체에 걸러 즙을 낸다. 그릇에 면을 담고 차갑게 식힌 석류즙을 붓고 견과류, 채 썬 오이를 고명으로 올린다.','MANUAL03'),(16,'','MANUAL04'),(16,'','MANUAL05'),(16,'','MANUAL06'),(16,'','MANUAL07'),(16,'','MANUAL08'),(16,'','MANUAL09'),(16,'','MANUAL10'),(16,'','MANUAL11'),(16,'','MANUAL12'),(16,'','MANUAL13'),(16,'','MANUAL14'),(16,'','MANUAL15'),(16,'','MANUAL16'),(16,'','MANUAL17'),(16,'','MANUAL18'),(16,'','MANUAL19'),(16,'','MANUAL20'),(17,'1. 검은콩을 1시간 찬물에 담가 불린 후 삶아 익힌 후 불순물을 제거하고 흑임자, 생수, 삶은 콩, 호두를 믹서에 갈아 살엄음이 생기도록 냉동실에 넣는다.','MANUAL01'),(17,'2. 오이는 돌려 깎아 채 썰고, 토마토는 1/8크기로 썰고, 달걀은 삶아 반으로 자른다.','MANUAL02'),(17,'3. 실곤약은 끓는 물에 데치고 찬물에 헹궈 그릇에 담은 후 콩물을 담고 오이, 토마토, 달걀을 고명으로 올려 완성한다.','MANUAL03'),(17,'','MANUAL04'),(17,'','MANUAL05'),(17,'','MANUAL06'),(17,'','MANUAL07'),(17,'','MANUAL08'),(17,'','MANUAL09'),(17,'','MANUAL10'),(17,'','MANUAL11'),(17,'','MANUAL12'),(17,'','MANUAL13'),(17,'','MANUAL14'),(17,'','MANUAL15'),(17,'','MANUAL16'),(17,'','MANUAL17'),(17,'','MANUAL18'),(17,'','MANUAL19'),(17,'','MANUAL20'),(18,'1. 브로콜리, 숙주, 표고버섯, 닭 가슴살은 다지고 다진 닭 가슴살은 소금과 후추로 밑간 한다.','MANUAL01'),(18,'2. 다진 채소와 닭가슴살, 참기름, 저염간장을 섞어 만두소를 만든다.','MANUAL02'),(18,'3. 준비한 만두피에 만두소를 넣은 후 만두 모양으로 빚고 만두를 찜통에 넣어 찌고 그릇에 담는다.','MANUAL03'),(18,'','MANUAL04'),(18,'','MANUAL05'),(18,'','MANUAL06'),(18,'','MANUAL07'),(18,'','MANUAL08'),(18,'','MANUAL09'),(18,'','MANUAL10'),(18,'','MANUAL11'),(18,'','MANUAL12'),(18,'','MANUAL13'),(18,'','MANUAL14'),(18,'','MANUAL15'),(18,'','MANUAL16'),(18,'','MANUAL17'),(18,'','MANUAL18'),(18,'','MANUAL19'),(18,'','MANUAL20'),(19,'1. 함초, 노루궁뎅이버섯, 다시마, 파, 양파, 무를 물에 넣어 10분 끓이고 향이 강한 모시조개와 냉이를 넣고 30분  끓인 후 간장으로 색을 낸다.','MANUAL01'),(19,'2. 소면은 따로 삶는다.','MANUAL02'),(19,'3. 그릇에 삶은 소면을 담은 후 육수를 붓고 지단, 슬라이스한 청고추, 실고추를 올려 완성한다.','MANUAL03'),(19,'','MANUAL04'),(19,'','MANUAL05'),(19,'','MANUAL06'),(19,'','MANUAL07'),(19,'','MANUAL08'),(19,'','MANUAL09'),(19,'','MANUAL10'),(19,'','MANUAL11'),(19,'','MANUAL12'),(19,'','MANUAL13'),(19,'','MANUAL14'),(19,'','MANUAL15'),(19,'','MANUAL16'),(19,'','MANUAL17'),(19,'','MANUAL18'),(19,'','MANUAL19'),(19,'','MANUAL20'),(20,'1. 두부에 쌀뜨물을 넣고 갈아준다.','MANUAL01'),(20,'2. 돼지고기는 썰고 김치는 물에 씻어 양념을 제거하고 3×3cm로 썬다.','MANUAL02'),(20,'3. 냄비에 돼지고기와 김치를 함께 볶은 후, 망에 거른 된장과 1의 두부, 고춧가루, 청양고추, 홍고추를 넣어 끓이다가 대파를 넣어 완성한다.','MANUAL03'),(20,'','MANUAL04'),(20,'','MANUAL05'),(20,'','MANUAL06'),(20,'','MANUAL07'),(20,'','MANUAL08'),(20,'','MANUAL09'),(20,'','MANUAL10'),(20,'','MANUAL11'),(20,'','MANUAL12'),(20,'','MANUAL13'),(20,'','MANUAL14'),(20,'','MANUAL15'),(20,'','MANUAL16'),(20,'','MANUAL17'),(20,'','MANUAL18'),(20,'','MANUAL19'),(20,'','MANUAL20'),(21,'1. 김치, 베이컨, 스팸, 소시지, 양파, 두부, 무는 두께 0.5cm로 썬다.','MANUAL01'),(21,'2. 다시마와 물을 끓여 다시마물을 만든다.','MANUAL02'),(21,'3. 냄비에 소시지, 베이컨, 두부, 스팸, 무, 우민찌, 김치, 다시마물 300g을 넣어 끓인 후 저염된장, 양파, 대파, 다진 마늘, 떡국 떡을 넣고 재료가 다 익으면 홍고추와 청양고추를 넣어 완성한다.','MANUAL03'),(21,'','MANUAL04'),(21,'','MANUAL05'),(21,'','MANUAL06'),(21,'','MANUAL07'),(21,'','MANUAL08'),(21,'','MANUAL09'),(21,'','MANUAL10'),(21,'','MANUAL11'),(21,'','MANUAL12'),(21,'','MANUAL13'),(21,'','MANUAL14'),(21,'','MANUAL15'),(21,'','MANUAL16'),(21,'','MANUAL17'),(21,'','MANUAL18'),(21,'','MANUAL19'),(21,'','MANUAL20'),(22,'1. 감자는 믹서에 갈고 양배추는 채 썰고 고기, 당근, 청양고추, 두부는 다진다.','MANUAL01'),(22,'2. 준비해둔 재료를 모두 섞고 부침가루와 계란을 넣어 반죽한다.','MANUAL02'),(22,'3. 가열된 팬에 기름을 두르고 반죽을 부어 굽고 소스를 함께 곁들인다.','MANUAL03'),(22,'','MANUAL04'),(22,'','MANUAL05'),(22,'','MANUAL06'),(22,'','MANUAL07'),(22,'','MANUAL08'),(22,'','MANUAL09'),(22,'','MANUAL10'),(22,'','MANUAL11'),(22,'','MANUAL12'),(22,'','MANUAL13'),(22,'','MANUAL14'),(22,'','MANUAL15'),(22,'','MANUAL16'),(22,'','MANUAL17'),(22,'','MANUAL18'),(22,'','MANUAL19'),(22,'','MANUAL20'),(23,'1. 청양고추와 홍고추를 다져서 참기름에 살짝 볶은 후 볶은 고추에 마요네즈와 레몬즙을 넣어 소스를 만든다.','MANUAL01'),(23,'2. 돌나물은 손질하여 찬물에 담구고 새송이버섯은 달군 프라이팬에 참기름을 두르고 노릇\n하게 굽는다.','MANUAL02'),(23,'3. 돌나물은 물기를 빼고 구운 새송이버섯과 레몬마요네즈 소스를 넣고\n버무려 접시에 담는다.','MANUAL03'),(23,'','MANUAL04'),(23,'','MANUAL05'),(23,'','MANUAL06'),(23,'','MANUAL07'),(23,'','MANUAL08'),(23,'','MANUAL09'),(23,'','MANUAL10'),(23,'','MANUAL11'),(23,'','MANUAL12'),(23,'','MANUAL13'),(23,'','MANUAL14'),(23,'','MANUAL15'),(23,'','MANUAL16'),(23,'','MANUAL17'),(23,'','MANUAL18'),(23,'','MANUAL19'),(23,'','MANUAL20'),(24,'1. 배추를 소금물에 하루 동안 절인 후 물기를 빼고 석류는 즙을 낸다.','MANUAL01'),(24,'2. 무는 채 썰고, 쪽파와 미나리는 4cm로 자른다.','MANUAL02'),(24,'3. 무채, 미나리, 쪽파, 다진 마늘, 다진 생강, 새우젓국을 넣고 섞어 소를 만들고 절인 배추에 소를 넣고 오므려 싼다. 석류즙에 소를 채운 배추를 담가 완성한다.','MANUAL03'),(24,'','MANUAL04'),(24,'','MANUAL05'),(24,'','MANUAL06'),(24,'','MANUAL07'),(24,'','MANUAL08'),(24,'','MANUAL09'),(24,'','MANUAL10'),(24,'','MANUAL11'),(24,'','MANUAL12'),(24,'','MANUAL13'),(24,'','MANUAL14'),(24,'','MANUAL15'),(24,'','MANUAL16'),(24,'','MANUAL17'),(24,'','MANUAL18'),(24,'','MANUAL19'),(24,'','MANUAL20'),(25,'1. 발사믹 식초, 화이트와인, 다진 유자청 건더기를 넣고 졸여 소스를 만들고 대구를 손질하여 포를 뜬다.','MANUAL01'),(25,'2. 대파, 청파프리카, 홍파프리카, 황파프리카를 채 썬다.','MANUAL02'),(25,'3. 대구포에 밀가루를 묻혀 청파프리카, 홍파프리카, 황파프리카, 황금팽이버섯을 넣고 말아 미나리로 묶어 찐 후 소스를 뿌리고 썬 대파를 올려 완성한다.','MANUAL03'),(25,'','MANUAL04'),(25,'','MANUAL05'),(25,'','MANUAL06'),(25,'','MANUAL07'),(25,'','MANUAL08'),(25,'','MANUAL09'),(25,'','MANUAL10'),(25,'','MANUAL11'),(25,'','MANUAL12'),(25,'','MANUAL13'),(25,'','MANUAL14'),(25,'','MANUAL15'),(25,'','MANUAL16'),(25,'','MANUAL17'),(25,'','MANUAL18'),(25,'','MANUAL19'),(25,'','MANUAL20'),(26,'1. 황파프리카를 갈아 체에 내리고 멥쌀로 쌀풀을 만들어 황파프리카 즙을 섞고 물엿을 첨가하여 양념을 만든다.','MANUAL01'),(26,'2. 배추를 소금물에 절이고 절인 배추를 찬물로 씻어 소금기를 뺀다.','MANUAL02'),(26,'3. 소금기를 뺀 배추에 채썬 자색고구마, 무, 쪽파, 부추, 사과, 배를 놓고 양념을 부은 후 3일 동안 숙성시켜 완성한다.','MANUAL03'),(26,'','MANUAL04'),(26,'','MANUAL05'),(26,'','MANUAL06'),(26,'','MANUAL07'),(26,'','MANUAL08'),(26,'','MANUAL09'),(26,'','MANUAL10'),(26,'','MANUAL11'),(26,'','MANUAL12'),(26,'','MANUAL13'),(26,'','MANUAL14'),(26,'','MANUAL15'),(26,'','MANUAL16'),(26,'','MANUAL17'),(26,'','MANUAL18'),(26,'','MANUAL19'),(26,'','MANUAL20'),(27,'1. 양파와 마늘은 다져서 볶다가 토마토 과육과 설탕, 바질을 넣고 고추장을 섞어 토마토 소스를 만든다.','MANUAL01'),(27,'2. 가지, 양송이버섯, 애호박, 사과는 썰고 살라미는 데친다.','MANUAL02'),(27,'3. 오븐용 팬에 토마토 소스를 넓게 펴준 뒤 애호박, 가지, 양송이버섯, 살라미를 겹치게 넣고 180℃로 예열한 오븐에 넣고 30분 구워 완성한다','MANUAL03'),(27,'','MANUAL04'),(27,'','MANUAL05'),(27,'','MANUAL06'),(27,'','MANUAL07'),(27,'','MANUAL08'),(27,'','MANUAL09'),(27,'','MANUAL10'),(27,'','MANUAL11'),(27,'','MANUAL12'),(27,'','MANUAL13'),(27,'','MANUAL14'),(27,'','MANUAL15'),(27,'','MANUAL16'),(27,'','MANUAL17'),(27,'','MANUAL18'),(27,'','MANUAL19'),(27,'','MANUAL20'),(28,'1. 간장, 레몬즙, 설탕, 다진 홍고추를 섞어 드레싱을 만든다.','MANUAL01'),(28,'2. 민들레 잎은 4×4cm로 썰고, 비트는 채 썰고 물에 담가 색을 뺀다.','MANUAL02'),(28,'3. 오렌지는 씻어 껍질만 발라 채 썰고 민들레 잎, 비트, 오렌지 껍질을 섞어 접시에 담고 드레싱을 곁들인다.','MANUAL03'),(28,'','MANUAL04'),(28,'','MANUAL05'),(28,'','MANUAL06'),(28,'','MANUAL07'),(28,'','MANUAL08'),(28,'','MANUAL09'),(28,'','MANUAL10'),(28,'','MANUAL11'),(28,'','MANUAL12'),(28,'','MANUAL13'),(28,'','MANUAL14'),(28,'','MANUAL15'),(28,'','MANUAL16'),(28,'','MANUAL17'),(28,'','MANUAL18'),(28,'','MANUAL19'),(28,'','MANUAL20'),(29,'1. 올리브오일, 발사믹식초, 후춧가루를 섞어 차게 식혀 드레싱을 만든다.','MANUAL01'),(29,'2. 가지와 토마토는 5mm두께로 썰고 120도 오븐에 20분 구운 후 구운 가지는 물기를 제거한다.','MANUAL02'),(29,'3. 팬에 올리브오일을 두르고 약불에서 채 썬 마늘을 볶다가, 가지를 넣고 구운 후 접시에 토마토, 가지를 번갈아 담고 무순으로 장식하고 드레싱을 곁들인다.','MANUAL03'),(29,'','MANUAL04'),(29,'','MANUAL05'),(29,'','MANUAL06'),(29,'','MANUAL07'),(29,'','MANUAL08'),(29,'','MANUAL09'),(29,'','MANUAL10'),(29,'','MANUAL11'),(29,'','MANUAL12'),(29,'','MANUAL13'),(29,'','MANUAL14'),(29,'','MANUAL15'),(29,'','MANUAL16'),(29,'','MANUAL17'),(29,'','MANUAL18'),(29,'','MANUAL19'),(29,'','MANUAL20'),(30,'1. 끓는 물에 배춧잎을 데친다.','MANUAL01'),(30,'2. 당근, 호박, 표고버섯, 양파는\n입자있게 다진다.','MANUAL02'),(30,'3. 돼지고기를 썰어 불린 쌀, 다진 야채와\n함께 밥을 짓는다.','MANUAL03'),(30,'4. 데친 배춧잎에 지어놓은 밥을 올려\n돌돌만다.','MANUAL04'),(30,'5. 말아 놓은 배춧잎을 부추로 묶는다.','MANUAL05'),(30,'6. 찜통에 김이 오르면 ?번을 넣고 약 5분\n정도 찐다.','MANUAL06'),(30,'','MANUAL07'),(30,'','MANUAL08'),(30,'','MANUAL09'),(30,'','MANUAL10'),(30,'','MANUAL11'),(30,'','MANUAL12'),(30,'','MANUAL13'),(30,'','MANUAL14'),(30,'','MANUAL15'),(30,'','MANUAL16'),(30,'','MANUAL17'),(30,'','MANUAL18'),(30,'','MANUAL19'),(30,'','MANUAL20'),(31,'1. 대추는 돌려 깍아 씨를 제거 하고 곱게\n다진다.','MANUAL01'),(31,'2. 다진 소고기와 돼지고기에 대추와 소금\n후춧가루를 넣고 치댄다.','MANUAL02'),(31,'3. 애호박과 단호박, 파프리카는\n입자있게 썰어 ?에 넣고 잘 치댄다.','MANUAL03'),(31,'4. 양송이는 편으로 썰어 팬에 익히고,\n인삼을 뇌두를 자르고 깨끗이 씻어\n팬에 볶아 잘게 썰어 ?에 넣는다.','MANUAL04'),(31,'5. 재료가 골고루 섞인 떡갈비를 갈비\n모양으로 만든다.','MANUAL05'),(31,'6. 떡갈비를 팬에 굽고, 접시에 배춧잎을\n깔고 익힌 양송이를 올리고 떡갈비를\n담는다.','MANUAL06'),(31,'','MANUAL07'),(31,'','MANUAL08'),(31,'','MANUAL09'),(31,'','MANUAL10'),(31,'','MANUAL11'),(31,'','MANUAL12'),(31,'','MANUAL13'),(31,'','MANUAL14'),(31,'','MANUAL15'),(31,'','MANUAL16'),(31,'','MANUAL17'),(31,'','MANUAL18'),(31,'','MANUAL19'),(31,'','MANUAL20'),(32,'1. 닭을 깨끗이 손질하고, 부위별로\n자른다.','MANUAL01'),(32,'2. 냄비에 가시오가피, 대파, 다시마,\n마늘, 건새우를 넣고 은근히 끓인 후\n닭을 넣고 약 20분 정도 삶아 건진 뒤\n살을 찢어둔다.','MANUAL02'),(32,'3. 양파, 오이는 채썰고 식초, 설탕,\n소금을 넣고 초절임한다','MANUAL03'),(32,'4. 겨자가루에 30℃ 정도의 물을 넣고\n골고루 섞어 발효시키고, 설탕, 식초,\n소금을 넣고 겨자소스를 만든다','MANUAL04'),(32,'5. 흰곤약과 비트, 치자가루를 섞은 곤약,\n채썬 다시마를 접시에 담는다.','MANUAL05'),(32,'6. 양파, 오이 초절임과 닭살을 한쪽에\n담아 먹기 직전에 겨자소스를 올린다.','MANUAL06'),(32,'','MANUAL07'),(32,'','MANUAL08'),(32,'','MANUAL09'),(32,'','MANUAL10'),(32,'','MANUAL11'),(32,'','MANUAL12'),(32,'','MANUAL13'),(32,'','MANUAL14'),(32,'','MANUAL15'),(32,'','MANUAL16'),(32,'','MANUAL17'),(32,'','MANUAL18'),(32,'','MANUAL19'),(32,'','MANUAL20'),(33,'1. 찹쌀은 깨끗이 씻어 30분 정도 불린다','MANUAL01'),(33,'2. 불린 찹쌀은 냄비에 넣고 질게 밥을\n한다.','MANUAL02'),(33,'3. 닭가슴살은 넓게 펴서 소금,\n후춧가루를 뿌린다.','MANUAL03'),(33,'4. 호박잎과 미나리는 끓는 물에 살짝\n데치고, 대추는 돌려 깎아 씨를\n제거하고 인삼은 뇌두를 제거한 뒤\n채를 썰어둔다.','MANUAL04'),(33,'5. 데친 호박잎에 닭 가슴살을 올린다.','MANUAL05'),(33,'6. 닭 가슴살위에 찹쌀밥과 준비한 야채와\n대추를 올려 돌돌 말아 질게 된\n찹쌀밥에 넣고 약 20분 정도 더 쪄낸다.','MANUAL06'),(33,'','MANUAL07'),(33,'','MANUAL08'),(33,'','MANUAL09'),(33,'','MANUAL10'),(33,'','MANUAL11'),(33,'','MANUAL12'),(33,'','MANUAL13'),(33,'','MANUAL14'),(33,'','MANUAL15'),(33,'','MANUAL16'),(33,'','MANUAL17'),(33,'','MANUAL18'),(33,'','MANUAL19'),(33,'','MANUAL20'),(34,'1. 된장에 두부를 넣고 골고루 섞는다.','MANUAL01'),(34,'2. 표고버섯과 마늘은 함께 갈아둔다.','MANUAL02'),(34,'3. 미역은 충분히 불린다.','MANUAL03'),(34,'4. 냄비에 황태채와 갈아둔 표고버섯,\n마늘을 넣고 은근히 끓여 육수를\n만든다.','MANUAL04'),(34,'5. 곤약은 납작납작하게 썰어 끓는 물에\n데친다.','MANUAL05'),(34,'6. 육수에서 황태를 건져 두부된장과 함께\n갈아 육수에 붓고, 미역, 곤약,\n들깨가루를 넣고 약 20분 정도 끓인 후\n액젓으로 간을 한다.','MANUAL06'),(34,'','MANUAL07'),(34,'','MANUAL08'),(34,'','MANUAL09'),(34,'','MANUAL10'),(34,'','MANUAL11'),(34,'','MANUAL12'),(34,'','MANUAL13'),(34,'','MANUAL14'),(34,'','MANUAL15'),(34,'','MANUAL16'),(34,'','MANUAL17'),(34,'','MANUAL18'),(34,'','MANUAL19'),(34,'','MANUAL20'),(35,'1. 훈제오리 가슴살을 슬라이스한다.','MANUAL01'),(35,'2. 슬라이스한 훈제오리는 팬에 굽는다.','MANUAL02'),(35,'3. 양파는 채썰고 찬물에 담근 뒤 건진다.','MANUAL03'),(35,'4. 레디쉬는 채썰고 찬물에 담근 뒤\n건진다.','MANUAL04'),(35,'5. 먹기 직전에 발사믹소스를 만든다.','MANUAL05'),(35,'6. 접시에 훈제오리와 양파채, 레디쉬,\n블루베리를 담고 발사믹소스를\n올린다.','MANUAL06'),(35,'','MANUAL07'),(35,'','MANUAL08'),(35,'','MANUAL09'),(35,'','MANUAL10'),(35,'','MANUAL11'),(35,'','MANUAL12'),(35,'','MANUAL13'),(35,'','MANUAL14'),(35,'','MANUAL15'),(35,'','MANUAL16'),(35,'','MANUAL17'),(35,'','MANUAL18'),(35,'','MANUAL19'),(35,'','MANUAL20'),(36,'1. 훈제오리 가슴살은 올리브오일,\n로즈마리, 후춧가루로\n마리네이드한다.','MANUAL01'),(36,'2. 새송이버섯은 편으로 썰고 팬에\n굽는다.','MANUAL02'),(36,'3. 오렌지는 슬라이스로 썬다.','MANUAL03'),(36,'4. 땅콩과 파슬리는 입자있게 다진다.','MANUAL04'),(36,'5. 마리네이드한 오리 고기를 구워 접시에\n담는다.','MANUAL05'),(36,'6. 유자청에 땅콩, 파슬리가루를 넣고\n소스를 만들고, 구워진 오리고기\n사이에 오렌지 슬라이스를 넣고\n유자청소스를 올린다.','MANUAL06'),(36,'','MANUAL07'),(36,'','MANUAL08'),(36,'','MANUAL09'),(36,'','MANUAL10'),(36,'','MANUAL11'),(36,'','MANUAL12'),(36,'','MANUAL13'),(36,'','MANUAL14'),(36,'','MANUAL15'),(36,'','MANUAL16'),(36,'','MANUAL17'),(36,'','MANUAL18'),(36,'','MANUAL19'),(36,'','MANUAL20'),(37,'1. 전복은 수저로 떼어내어 소금으로 비벼\n깨끗이 씻는다.','MANUAL01'),(37,'2. 시금치는 데쳐 다지고, 새우는 껍질을\n벗겨 전복, 해초와 함께 다진다.','MANUAL02'),(37,'3. ?번을 잘 섞어 전복 껍질에 넣는다.','MANUAL03'),(37,'4. 찜통에 김이 오르면 속을 채운 전복\n껍질을 넣고 약 10분 정도 찐다.','MANUAL04'),(37,'5. 저염간장, 레몬, 설탕, 다진마늘을\n넣고 살짝 끓여 소스를 만든다.','MANUAL05'),(37,'6. 간장소스에 전분을 풀어 농도를\n맞추고, 전복찜에 여러번 바르고\n식용꽃을 올린다.','MANUAL06'),(37,'','MANUAL07'),(37,'','MANUAL08'),(37,'','MANUAL09'),(37,'','MANUAL10'),(37,'','MANUAL11'),(37,'','MANUAL12'),(37,'','MANUAL13'),(37,'','MANUAL14'),(37,'','MANUAL15'),(37,'','MANUAL16'),(37,'','MANUAL17'),(37,'','MANUAL18'),(37,'','MANUAL19'),(37,'','MANUAL20'),(38,'1. 검은콩은 깨끗이 씻어 약 12시간 정도\n충분히 불린다.','MANUAL01'),(38,'2. 불린 검은콩은 20분 정도 삶아 깨끗이\n씻는다.','MANUAL02'),(38,'3. 삶은 검은콩은 믹서기에 곱게 갈아\n차갑게 식힌다.','MANUAL03'),(38,'4. 오이는 씨를 제거하고 깨끗이 씻어\n채썬다.','MANUAL04'),(38,'5. 물을 끓여 메밀면을 삶고, 찬물에\n여러번 헹구어 건져 물기를 뺀다.','MANUAL05'),(38,'6. 메밀면을 그릇에 담고 차가운 콩 국물,\n땅콩, 잣, 오이, 방울토마토 및 통깨를\n올린다.','MANUAL06'),(38,'','MANUAL07'),(38,'','MANUAL08'),(38,'','MANUAL09'),(38,'','MANUAL10'),(38,'','MANUAL11'),(38,'','MANUAL12'),(38,'','MANUAL13'),(38,'','MANUAL14'),(38,'','MANUAL15'),(38,'','MANUAL16'),(38,'','MANUAL17'),(38,'','MANUAL18'),(38,'','MANUAL19'),(38,'','MANUAL20'),(39,'1. 어린잎은 찬물에 담근다.','MANUAL01'),(39,'2. 마는 껍질을 벗겨 동글동글하게 썬다','MANUAL02'),(39,'3. 썰어 놓은 마는 팬에 기름을 살짝\n두르고 앞뒤로 굽는다.','MANUAL03'),(39,'4. 참나물, 돈나물, 토마토, 레디쉬는\n먹기 좋은 크기로 썬다.','MANUAL04'),(39,'5. 겨자가루는 30℃ 물을 섞어 발효\n시킨다.','MANUAL05'),(39,'6. 저염간장에 식초, 설탕, 발효겨자를\n넣고 골고루 섞어 소스를 만들고,\n접시에 구운 마와 손질한 야채를 넣고\n만들어 놓은 소스와 어린잎을 올린다.','MANUAL06'),(39,'','MANUAL07'),(39,'','MANUAL08'),(39,'','MANUAL09'),(39,'','MANUAL10'),(39,'','MANUAL11'),(39,'','MANUAL12'),(39,'','MANUAL13'),(39,'','MANUAL14'),(39,'','MANUAL15'),(39,'','MANUAL16'),(39,'','MANUAL17'),(39,'','MANUAL18'),(39,'','MANUAL19'),(39,'','MANUAL20'),(40,'1. 육수 재료를 넣고 중간 불로 끓인 뒤\n체에 걸러 육수를 만든다.','MANUAL01'),(40,'2. 닭가슴살은 채 썬 뒤 물에 넣고\n삶는다.','MANUAL02'),(40,'3. 애호박은 반달 썰고, 미나리는 5㎝\n길이로 썰고, 청양고추는 잘게 썬 뒤\n찬물에 담가 씨를 빼고, 두부는 한입\n크기로 썰어 물에 담가둔다.','MANUAL03'),(40,'4. 김치를 한입 크기로 썬 뒤 참기름에\n볶다가 육수를 붓는다.','MANUAL04'),(40,'5. 두부, 애호박, 느타리버섯, 미나리,\n닭가슴살을 넣어 끓어오르면\n달걀물과 청양고추를 넣고 조금\n더 끓여 마무리한다.','MANUAL05'),(40,'','MANUAL06'),(40,'','MANUAL07'),(40,'','MANUAL08'),(40,'','MANUAL09'),(40,'','MANUAL10'),(40,'','MANUAL11'),(40,'','MANUAL12'),(40,'','MANUAL13'),(40,'','MANUAL14'),(40,'','MANUAL15'),(40,'','MANUAL16'),(40,'','MANUAL17'),(40,'','MANUAL18'),(40,'','MANUAL19'),(40,'','MANUAL20'),(41,'1. 대파, 마늘, 쇠고기를 물(300g)과\n함께 끓인 뒤 면포에 걸러 육수를\n만든다.','MANUAL01'),(41,'2. 콩나물, 김치를 물에 씻어 손질한다.','MANUAL02'),(41,'3. 두부는 물기를 빼고, 붉은 고추는\n다진 뒤 돼지고기와 섞어 반죽해\n동그랗게 빚어 완자를 만든다.','MANUAL03'),(41,'4. 김 오른 찜기에 완자를 넣어 찐다.','MANUAL04'),(41,'5. 육수를 끓이고 끓어오르면 김치,\n콩나물, 새우젓을 넣는다.','MANUAL05'),(41,'6. 한소끔 더 끓이다가 완자를 넣고\n조금 더 끓여 마무리한다.','MANUAL06'),(41,'','MANUAL07'),(41,'','MANUAL08'),(41,'','MANUAL09'),(41,'','MANUAL10'),(41,'','MANUAL11'),(41,'','MANUAL12'),(41,'','MANUAL13'),(41,'','MANUAL14'),(41,'','MANUAL15'),(41,'','MANUAL16'),(41,'','MANUAL17'),(41,'','MANUAL18'),(41,'','MANUAL19'),(41,'','MANUAL20'),(42,'1. 풋고추는 잘게 다진다.','MANUAL01'),(42,'2. 백김치는 먹기 좋은 크기로 썬다.','MANUAL02'),(42,'3. 냄비에 백김치를 볶다가 김치가\n익으면 참기름, 후춧가루,\n다진 마늘을 넣고 볶는다.','MANUAL03'),(42,'4. 물(200g)을 넣고 끓인다.','MANUAL04'),(42,'5. 물이 끓으면 콩비지와 간장,\n풋고추를 넣어 약한 불에서 15분\n정도 끓여 마무리한다.','MANUAL05'),(42,'','MANUAL06'),(42,'','MANUAL07'),(42,'','MANUAL08'),(42,'','MANUAL09'),(42,'','MANUAL10'),(42,'','MANUAL11'),(42,'','MANUAL12'),(42,'','MANUAL13'),(42,'','MANUAL14'),(42,'','MANUAL15'),(42,'','MANUAL16'),(42,'','MANUAL17'),(42,'','MANUAL18'),(42,'','MANUAL19'),(42,'','MANUAL20'),(43,'1. 육수 재료를 넣고 끓인 뒤 체로 걸러\n육수를 낸다.','MANUAL01'),(43,'2. 오징어 몸통은 큼지막하게 썰고\n다리는 얇게 썬다.','MANUAL02'),(43,'3. 두부와 버섯은 먹기 좋게 썰고,\n고추는 어슷하게 썰고, 고구마는\n먹기 좋은 크기로 썰고, 콩나물은\n다듬는다.','MANUAL03'),(43,'4. 김치는 먹기 좋은 크기로 썬 뒤\n냄비에 참기름을 두르고 볶다가\n고구마, 콩나물, 육수를 넣고 끓인다.','MANUAL04'),(43,'5. 자작하게 끓으면 오징어를 넣고\n끓이고, 오징어가 익으면 들깻가루를\n넣고 끓인다.','MANUAL05'),(43,'6. 두부, 팽이버섯, 쑥갓, 고구마,\n붉은 고추를 넣고 끓여 마무리한다.','MANUAL06'),(43,'','MANUAL07'),(43,'','MANUAL08'),(43,'','MANUAL09'),(43,'','MANUAL10'),(43,'','MANUAL11'),(43,'','MANUAL12'),(43,'','MANUAL13'),(43,'','MANUAL14'),(43,'','MANUAL15'),(43,'','MANUAL16'),(43,'','MANUAL17'),(43,'','MANUAL18'),(43,'','MANUAL19'),(43,'','MANUAL20'),(44,'1. 냄비에 육수 재료를 넣고 끓이다가 물이 끓어오르면 다시마를 건지고 조금 더 끓여 육수를 우려낸다.','MANUAL01'),(44,'2. 주꾸미는 내장과 입, 눈을 제거하고 4cm 크기로 잘라 준비한다.','MANUAL02'),(44,'3. 김치는 국물을 꽉 짜서 한입 크기로 썰고, 무는 편 썰고, 마늘은 다지고, 대파는 어슷 썰고, 양파는 굵게 채 썰고, 두부는 납작하게 썬다.','MANUAL03'),(44,'4. 냄비에 참기름을 두르고, 김치, 무, 양파가 투명해질 때까지 볶다가 육수를 붓고 끓으면 주꾸미, 다진 마늘을 넣어 더 끓인다.','MANUAL04'),(44,'5. 김칫국물과 배즙을 2:1로 섞은 뒤 찌개에 넣어 간을 맞춘다.','MANUAL05'),(44,'6. 두부, 팽이버섯을 넣고 한소끔 끓여 마무리한다','MANUAL06'),(44,'','MANUAL07'),(44,'','MANUAL08'),(44,'','MANUAL09'),(44,'','MANUAL10'),(44,'','MANUAL11'),(44,'','MANUAL12'),(44,'','MANUAL13'),(44,'','MANUAL14'),(44,'','MANUAL15'),(44,'','MANUAL16'),(44,'','MANUAL17'),(44,'','MANUAL18'),(44,'','MANUAL19'),(44,'','MANUAL20'),(45,'1. 다시마육수재료를 물에 넣고 끓여\n육수를 낸다.','MANUAL01'),(45,'2. 느타리버섯은 가닥가닥 떼고, 두부는\n썰고, 콩나물은 머리와 꼬리를 떼\n손질한다.','MANUAL02'),(45,'3. 배추와 미나리를 데친다.','MANUAL03'),(45,'4. 돼지고기, 쇠고기에 고기완자양념을\n넣어 반죽한 뒤 빚어 완자를 만든다.','MANUAL04'),(45,'5. 냄비에 모든 재료를 돌려 담은 뒤\n육수를 부어 끓인다.','MANUAL05'),(45,'','MANUAL06'),(45,'','MANUAL07'),(45,'','MANUAL08'),(45,'','MANUAL09'),(45,'','MANUAL10'),(45,'','MANUAL11'),(45,'','MANUAL12'),(45,'','MANUAL13'),(45,'','MANUAL14'),(45,'','MANUAL15'),(45,'','MANUAL16'),(45,'','MANUAL17'),(45,'','MANUAL18'),(45,'','MANUAL19'),(45,'','MANUAL20'),(46,'1. 통조림 햄은 한 번 데친 뒤 우유에\n담가두고, 실곤약은 식초를 넣은\n끓는 물에 살짝 데친다.','MANUAL01'),(46,'2. 양파는 굵게 채 썰고, 느타리버섯은\n찢고, 표고버섯은 모양대로 썰고,\n팽이버섯은 끝부분을 잘라내고,\n청양고추와 붉은 고추는 어슷 썬다.','MANUAL02'),(46,'3. 감자, 무, 두부는 0.5㎝ 두께로 썰고,\n애호박은 반달썰기 하고 깻잎은\n채 썰어 찬물에 담가 매운맛을\n제거한다.','MANUAL03'),(46,'4. 사골육수에 다시마를 넣어 끓인 후\n한 김 식힌다.','MANUAL04'),(46,'5. 다진 돼지고기에 다진 파, 다진 마늘,\n후춧가루, 소금을 섞어 완자를\n만들고 밀가루와 달걀물을 묻혀\n식용유(5g)를 두른 팬에 부친다.','MANUAL05'),(46,'6. 냄비에 재료를 보기 좋게 담고\n사골육수를 부은 뒤 끓이다가\n쑥갓과 들깻가루를 넣어 마무리한다.','MANUAL06'),(46,'','MANUAL07'),(46,'','MANUAL08'),(46,'','MANUAL09'),(46,'','MANUAL10'),(46,'','MANUAL11'),(46,'','MANUAL12'),(46,'','MANUAL13'),(46,'','MANUAL14'),(46,'','MANUAL15'),(46,'','MANUAL16'),(46,'','MANUAL17'),(46,'','MANUAL18'),(46,'','MANUAL19'),(46,'','MANUAL20'),(47,'1. 육수 재료를 넣고 20분간 끓여\n육수를 낸다.','MANUAL01'),(47,'2. 닭가슴살과 당근을 다져 모양을\n잡은 뒤 김 오른 찜기에 넣고 찐다.','MANUAL02'),(47,'3. 고추, 대파는 어슷 썰고, 쑥갓,\n표고버섯, 애호박, 김치는 먹기\n좋은 크기로 썰고, 팽이버섯은\n밑동을 잘라 손질한다.','MANUAL03'),(47,'4. 당면과 숙주는 뜨거운 물에 데쳐\n준비한다.','MANUAL04'),(47,'5. 양념장 재료를 섞은 뒤 육수(13g)를\n넣고 양념장을 만든다.','MANUAL05'),(47,'6. 준비한 재료를 담고 육수를 부은 뒤\n양념장을 넣고 끓여 마무리한다.','MANUAL06'),(47,'','MANUAL07'),(47,'','MANUAL08'),(47,'','MANUAL09'),(47,'','MANUAL10'),(47,'','MANUAL11'),(47,'','MANUAL12'),(47,'','MANUAL13'),(47,'','MANUAL14'),(47,'','MANUAL15'),(47,'','MANUAL16'),(47,'','MANUAL17'),(47,'','MANUAL18'),(47,'','MANUAL19'),(47,'','MANUAL20'),(48,'1. 통조림 햄을 썰어 끓는 물에 데친다.','MANUAL01'),(48,'2. 애호박은 반달모양으로 썰고, 두부는 도톰하게 썰고, 팽이버섯은 3등분하고, 청양고추는 어슷 썬다.','MANUAL02'),(48,'3. 김치는 씻어서 잘게 썬다.','MANUAL03'),(48,'4. 양념장을 만든다.','MANUAL04'),(48,'5. 냄비에 물과 다시마를 넣고 살짝 끓여 육수를 만든다.','MANUAL05'),(48,'6. 육수에 손질한 재료를 담고 양념장의 1/2 분량을 넣고 중간 불에 끓이다가 쑥갓과 남은 양념장을 넣고 약한 불에 조금 더 끓여 마무리한다.','MANUAL06'),(48,'','MANUAL07'),(48,'','MANUAL08'),(48,'','MANUAL09'),(48,'','MANUAL10'),(48,'','MANUAL11'),(48,'','MANUAL12'),(48,'','MANUAL13'),(48,'','MANUAL14'),(48,'','MANUAL15'),(48,'','MANUAL16'),(48,'','MANUAL17'),(48,'','MANUAL18'),(48,'','MANUAL19'),(48,'','MANUAL20'),(49,'1. 굴은 깨끗이 씻은 뒤 김 오른 찜기에\n찐다.','MANUAL01'),(49,'2. 굴을 쪄낸 물(250g)에 멸치,\n표고버섯 밑동을 넣고 끓인 뒤\n멸치와 표고버섯 밑동을 건져내\n육수를 만든다.','MANUAL02'),(49,'3. 느타리버섯은 밑동을 제거한 후\n씻어 세로로 찢고, 표고버섯은\n0.5㎝ 두께로 썬다.','MANUAL03'),(49,'4. 무는 나박 썰고 양파는 채 썰고,\n미나리는 3㎝ 길이로 썰고,\n대파와 고추는 송송 썬다.','MANUAL04'),(49,'5. 육수에 굴, 다진 마늘, 무, 양파,\n버섯을 넣고 끓인다.','MANUAL05'),(49,'6. 들깻가루와 순두부를 넣고 한소끔\n끓인 뒤 국간장과 소금으로 간을\n맞추고 대파, 붉은 고추, 미나리를\n올려 마무리한다.','MANUAL06'),(49,'','MANUAL07'),(49,'','MANUAL08'),(49,'','MANUAL09'),(49,'','MANUAL10'),(49,'','MANUAL11'),(49,'','MANUAL12'),(49,'','MANUAL13'),(49,'','MANUAL14'),(49,'','MANUAL15'),(49,'','MANUAL16'),(49,'','MANUAL17'),(49,'','MANUAL18'),(49,'','MANUAL19'),(49,'','MANUAL20'),(50,'1. 냄비에 육수 재료를 넣어 끓인다.','MANUAL01'),(50,'2. 콩을 충분히 불려 믹서기에 물을\n넣고 갈아 준비한다.','MANUAL02'),(50,'3. 느타리버섯은 찢고, 표고버섯은 먹기\n좋은 크기로 자르고, 애호박과\n양파는 깍둑 썰고, 대파와 고추는\n송송 썬다.','MANUAL03'),(50,'4. 바지락은 해감해 준비한다.','MANUAL04'),(50,'5. 육수에 콩, 느타리버섯, 표고버섯,\n애호박, 저염된장, 새우, 바지락을\n넣고 끊인다.','MANUAL05'),(50,'6. 순두부를 넣고 끊인 후 양파, 대파,\n붉은 고추, 풋고추를 넣고 한소끔\n끓여 마무리한다.','MANUAL06'),(50,'','MANUAL07'),(50,'','MANUAL08'),(50,'','MANUAL09'),(50,'','MANUAL10'),(50,'','MANUAL11'),(50,'','MANUAL12'),(50,'','MANUAL13'),(50,'','MANUAL14'),(50,'','MANUAL15'),(50,'','MANUAL16'),(50,'','MANUAL17'),(50,'','MANUAL18'),(50,'','MANUAL19'),(50,'','MANUAL20'),(51,'1. 표고버섯은 머리와 밑동을 분리하고, 머리 부분은 잘게 썬다.','MANUAL01'),(51,'2. 애호박, 감자, 양파는 한입 크기로 썰고, 미나리와 부추는 3cm 길이로 썰고, 대파와 청양고추는 송송 썬다.','MANUAL02'),(51,'3. 물에 다시마, 표고버섯 밑동을 넣고 끓으면 건더기를 건져 육수를 만든다.','MANUAL03'),(51,'4. 육수에 저염된장과 찹쌀가루를 풀어 한소끔 끓이고, 감자와 다진마늘을 넣어 끓인다.','MANUAL04'),(51,'5. 애호박과 표고버섯을 넣고, 순두부, 양파, 들깻가루, 저염국간장을 넣어 한소끔 끓인다.','MANUAL05'),(51,'6. 대파, 청양고추, 미나리, 부추를 듬뿍 올려 마무리한다.','MANUAL06'),(51,'','MANUAL07'),(51,'','MANUAL08'),(51,'','MANUAL09'),(51,'','MANUAL10'),(51,'','MANUAL11'),(51,'','MANUAL12'),(51,'','MANUAL13'),(51,'','MANUAL14'),(51,'','MANUAL15'),(51,'','MANUAL16'),(51,'','MANUAL17'),(51,'','MANUAL18'),(51,'','MANUAL19'),(51,'','MANUAL20'),(52,'1. 토란은 2×2㎝로 썬다.','MANUAL01'),(52,'2. 표고버섯은 채 썰고, 고추는\n어슷하게 썬다.','MANUAL02'),(52,'3. 냄비에 물(500ml)을 넣고 물이\n끓으면 백합을 넣고 끓여 육수를\n낸다.','MANUAL03'),(52,'4. 조개가 입을 벌리면 토란과\n들깻가루, 표고버섯을 넣고 끓인다.','MANUAL04'),(52,'5. 육수가 어느 정도 걸쭉해지면\n순두부를 넣고 끓인다.','MANUAL05'),(52,'6. 붉은 고추와 청양고추를 올려\n마무리한다.','MANUAL06'),(52,'','MANUAL07'),(52,'','MANUAL08'),(52,'','MANUAL09'),(52,'','MANUAL10'),(52,'','MANUAL11'),(52,'','MANUAL12'),(52,'','MANUAL13'),(52,'','MANUAL14'),(52,'','MANUAL15'),(52,'','MANUAL16'),(52,'','MANUAL17'),(52,'','MANUAL18'),(52,'','MANUAL19'),(52,'','MANUAL20'),(53,'1. 토마토홀과 토마토는 송송 다져주고, 마늘,\n양파를 냄비에서 볶은 후 믹서에 갈아 토마토\n스프를 만들어준다.','MANUAL01'),(53,'2. 만들어진 스프를 볶아서 신맛을 날려준다.','MANUAL02'),(53,'3. 먹물파스타면은 삶은 뒤 오일에 버무려주고\n볶아준다.','MANUAL03'),(53,'4. 양파, 애호박, 가지, 2가지색 파프리카를 먹기\n좋게 잘라 팬에 볶아준다.','MANUAL04'),(53,'5. 접시에 볶아진 채소와 파스타면을 서로 다시\n볶아준다.','MANUAL05'),(53,'6. 치즈를 곱게 다져주고 접시에 파스타면을\n올린 뒤, 토마토스프와 치즈가루를 뿌려 완성\n한다.','MANUAL06'),(53,'','MANUAL07'),(53,'','MANUAL08'),(53,'','MANUAL09'),(53,'','MANUAL10'),(53,'','MANUAL11'),(53,'','MANUAL12'),(53,'','MANUAL13'),(53,'','MANUAL14'),(53,'','MANUAL15'),(53,'','MANUAL16'),(53,'','MANUAL17'),(53,'','MANUAL18'),(53,'','MANUAL19'),(53,'','MANUAL20'),(54,'1. 양파, 당근, 오이는 채 썰어준다.','MANUAL01'),(54,'2. 열무 물김치와 탄산수, 어간장을 넣어 국수\n국물을 만들어준다.','MANUAL02'),(54,'3. 달걀은 삶아준다.','MANUAL03'),(54,'4. 실곤약은 삶을 때 레몬즙을 넣어서 곤약의\n특이한 냄새를 제거한다.','MANUAL04'),(54,'5. 물기를 제거한 곤약에 어간장을 넣어 밑간을\n해준다.','MANUAL05'),(54,'6. 그릇에 담고 국물을 부어주고, 채소와 달걀을\n곁들여 완성한다.','MANUAL06'),(54,'','MANUAL07'),(54,'','MANUAL08'),(54,'','MANUAL09'),(54,'','MANUAL10'),(54,'','MANUAL11'),(54,'','MANUAL12'),(54,'','MANUAL13'),(54,'','MANUAL14'),(54,'','MANUAL15'),(54,'','MANUAL16'),(54,'','MANUAL17'),(54,'','MANUAL18'),(54,'','MANUAL19'),(54,'','MANUAL20'),(55,'1. 오징어는 솔방울 모양으로 잘라준다.','MANUAL01'),(55,'2. 미니 파프리카, 양파, 청홍고추는 적당한\n크기로 잘라준다.','MANUAL02'),(55,'3. 다진마늘을 볶다가 오징어를 넣어 볶는다.','MANUAL03'),(55,'4. 홀토마토와 양념장 재료를 넣어 볶는다.','MANUAL04'),(55,'5. 팬을 약간 태우는 듯 해서 불맛과 매운맛을\n더해준다.','MANUAL05'),(55,'6. 접시에 담아주고 볶은 현미를 뿌려 완성한다.','MANUAL06'),(55,'','MANUAL07'),(55,'','MANUAL08'),(55,'','MANUAL09'),(55,'','MANUAL10'),(55,'','MANUAL11'),(55,'','MANUAL12'),(55,'','MANUAL13'),(55,'','MANUAL14'),(55,'','MANUAL15'),(55,'','MANUAL16'),(55,'','MANUAL17'),(55,'','MANUAL18'),(55,'','MANUAL19'),(55,'','MANUAL20'),(56,'1. 뚜껑을 만들 배의 윗동을 자르고, 수저로\n배 속을 판다.','MANUAL01'),(56,'2. 탄산수와 생강청을 미리 30분 전에 섞어준다.','MANUAL02'),(56,'3. 방울토마토를 먹기 좋게 잘라준 후 속을 파낸\n배에 후르츠 칵테일과 방울토마토를 넣어준다.','MANUAL03'),(56,'4. 과일로 채워진 배에 미리 만든 생강탄산수를\n부어준다.','MANUAL04'),(56,'5. 배를 뚜껑을 덮어 호일로 싼 후 팬에 구워준다.','MANUAL05'),(56,'','MANUAL06'),(56,'','MANUAL07'),(56,'','MANUAL08'),(56,'','MANUAL09'),(56,'','MANUAL10'),(56,'','MANUAL11'),(56,'','MANUAL12'),(56,'','MANUAL13'),(56,'','MANUAL14'),(56,'','MANUAL15'),(56,'','MANUAL16'),(56,'','MANUAL17'),(56,'','MANUAL18'),(56,'','MANUAL19'),(56,'','MANUAL20'),(57,'1. 쇠고기는 칼집을 살짝 넣어준 후 건 바질을\n뿌려 1시간 정도 숙성시킨다.','MANUAL01'),(57,'2. 감자는 껍질을 벗긴 후 먹기 좋게 잘라 뜨거운\n물에 70% 정도 익혀준다.','MANUAL02'),(57,'3. 익혀준 감자를 버터를 살짝 바른 후 팬에\n파슬리가루를 뿌려 구워준다.','MANUAL03'),(57,'4. 시금치는 데쳐내 물기를 제거하고 다진 양파와\n함께 버터에 볶아준다.','MANUAL04'),(57,'5. 사과는 사방 1cm 크기로 자른 후 레몬즙을\n살짝 뿌려준 후 버터에 볶아 소스를 만들어\n준다.','MANUAL05'),(57,'6. 숙성된 소고기를 팬에 구워주고 곁들이 채소와\n소스를 완성한다.','MANUAL06'),(57,'','MANUAL07'),(57,'','MANUAL08'),(57,'','MANUAL09'),(57,'','MANUAL10'),(57,'','MANUAL11'),(57,'','MANUAL12'),(57,'','MANUAL13'),(57,'','MANUAL14'),(57,'','MANUAL15'),(57,'','MANUAL16'),(57,'','MANUAL17'),(57,'','MANUAL18'),(57,'','MANUAL19'),(57,'','MANUAL20'),(58,'1. 오징어는 내장을 빼서 흐르는 물에 깨끗이\n씻은 후, 다리는 송송 다져주고 레몬즙을\n살짝 뿌려준다.','MANUAL01'),(58,'2. 강낭콩은 먼저 삶아준다.','MANUAL02'),(58,'3. 피망, 당근, 양파, 대파, 파프리카는 송송\n다져준다.','MANUAL03'),(58,'4. 잘라준 오징어다리는 다진마늘과 살짝\n볶아준다.','MANUAL04'),(58,'5. 볼에 귀리밥을 넣고 카레가루를 넣고 모든\n재료를 섞어 소 재료를 만든다.','MANUAL05'),(58,'6. 오징어 안쪽에 밀가루를 묻혀주고 소를 채워\n팬에 구워준다.','MANUAL06'),(58,'','MANUAL07'),(58,'','MANUAL08'),(58,'','MANUAL09'),(58,'','MANUAL10'),(58,'','MANUAL11'),(58,'','MANUAL12'),(58,'','MANUAL13'),(58,'','MANUAL14'),(58,'','MANUAL15'),(58,'','MANUAL16'),(58,'','MANUAL17'),(58,'','MANUAL18'),(58,'','MANUAL19'),(58,'','MANUAL20'),(59,'1. 소고기는 사방 2cm 정도의 크기로 잘라서\n물에서 80% 정도까지 익혀준 후 냉수에\n깨끗하게 세척해 준다.','MANUAL01'),(59,'2. 양파는 먹기 좋게 자르고 물 400g과 함께\n간장 물을 만들어준다.','MANUAL02'),(59,'3. 간장 물에 데쳐 놓은 소고기부터 졸여주기\n시작한다.','MANUAL03'),(59,'4. 메추리알을 넣고 함께 졸여준다.','MANUAL04'),(59,'5. 방울토마토, 양파, 마늘, 꽈리고추까지 넣고\n마지막으로 졸여준다.','MANUAL05'),(59,'','MANUAL06'),(59,'','MANUAL07'),(59,'','MANUAL08'),(59,'','MANUAL09'),(59,'','MANUAL10'),(59,'','MANUAL11'),(59,'','MANUAL12'),(59,'','MANUAL13'),(59,'','MANUAL14'),(59,'','MANUAL15'),(59,'','MANUAL16'),(59,'','MANUAL17'),(59,'','MANUAL18'),(59,'','MANUAL19'),(59,'','MANUAL20'),(60,'1. 당근, 양파, 샐러리는 사방 2cm 정도로\n잘라준다.','MANUAL01'),(60,'2. 레몬은 껍질을 아주 곱게 채 썰어준다.','MANUAL02'),(60,'3. 소고기는 사방 3cm 정도로 자르고 흰 후추를\n뿌려준다.','MANUAL03'),(60,'4. 홀토마토는 먹기 좋게 부수어 준 후 볶아준다.','MANUAL04'),(60,'5. 팬에 버터를 넣고 소고기부터 볶기 시작하다\n채소를 넣고 볶아준다. 이 때 두꺼운 채소부터\n볶아주는 것이 고기랑 익는 시간이 같아진다.','MANUAL05'),(60,'6. 마지막에 다져 놓은 홀토마토를 넣고 함초소금\n으로 간을 한 후 레몬껍질을 올려서 마무리\n한다.','MANUAL06'),(60,'','MANUAL07'),(60,'','MANUAL08'),(60,'','MANUAL09'),(60,'','MANUAL10'),(60,'','MANUAL11'),(60,'','MANUAL12'),(60,'','MANUAL13'),(60,'','MANUAL14'),(60,'','MANUAL15'),(60,'','MANUAL16'),(60,'','MANUAL17'),(60,'','MANUAL18'),(60,'','MANUAL19'),(60,'','MANUAL20'),(61,'1. 소스 재료를 이용해 맛 간장으로 만든 데리\n야끼소스를 만들어준다.','MANUAL01'),(61,'2. 참치는 손질해 수분을 빼준 후 흰 후추로\n밑간을 해준다.','MANUAL02'),(61,'3. 생강은 아주 곱게 채 썰어 냉수에 헹군다.','MANUAL03'),(61,'4. 대파도 아주 가늘게 채 썰어서 냉수에 담가\n매운맛을 빼준다.','MANUAL04'),(61,'5. 버터를 올린 팬에 삼치를 약불에서 구워준다.','MANUAL05'),(61,'6. 구워진 참치를 소스에 졸여주고 대파채를\n올린다. 삼치에 소스를 뿌리고 생강채를 올려\n완성한다.','MANUAL06'),(61,'','MANUAL07'),(61,'','MANUAL08'),(61,'','MANUAL09'),(61,'','MANUAL10'),(61,'','MANUAL11'),(61,'','MANUAL12'),(61,'','MANUAL13'),(61,'','MANUAL14'),(61,'','MANUAL15'),(61,'','MANUAL16'),(61,'','MANUAL17'),(61,'','MANUAL18'),(61,'','MANUAL19'),(61,'','MANUAL20'),(62,'1. 삼겹살은 길이로 잘라서 마늘기름, 통후추,\n로즈마리에 마리네이드 해준다.','MANUAL01'),(62,'2. 대파는 흰 부분만 잘라 구워주고, 꽈리고추도\n함께 구워준다.','MANUAL02'),(62,'3. 대파는 가늘게 채 썰어 물에 담가준다.','MANUAL03'),(62,'4. 물에 담가진 대파를 물기를 빼고 양념해준다.','MANUAL04'),(62,'5. 삼겹살을 꼬치에 끼워 굽고 구워진 채소,\n대파채와 함께 완성한다.','MANUAL05'),(62,'','MANUAL06'),(62,'','MANUAL07'),(62,'','MANUAL08'),(62,'','MANUAL09'),(62,'','MANUAL10'),(62,'','MANUAL11'),(62,'','MANUAL12'),(62,'','MANUAL13'),(62,'','MANUAL14'),(62,'','MANUAL15'),(62,'','MANUAL16'),(62,'','MANUAL17'),(62,'','MANUAL18'),(62,'','MANUAL19'),(62,'','MANUAL20'),(63,'1. 저염 된장을 물 300cc에 풀어준 뒤 건새우를\n담가 30분 정도 담가준 뒤 살짝 끓여준다.','MANUAL01'),(63,'2. 새우를 풀어준 된장 물을 체에 걸러준다.','MANUAL02'),(63,'3. 아욱은 뜨거운 물에 데쳐서 먹기 좋게 썬다.','MANUAL03'),(63,'4. 냄비에 밥과 된장 물을 풀어 끓인다.','MANUAL04'),(63,'5. 어느 정도 끓으면 칵테일새우와 건져 놓았던\n새우를 다시 넣어준다.','MANUAL05'),(63,'6. 불을 끄기 전에 아욱을 넣어 한 번 더 끓여준\n후 완성한다.','MANUAL06'),(63,'','MANUAL07'),(63,'','MANUAL08'),(63,'','MANUAL09'),(63,'','MANUAL10'),(63,'','MANUAL11'),(63,'','MANUAL12'),(63,'','MANUAL13'),(63,'','MANUAL14'),(63,'','MANUAL15'),(63,'','MANUAL16'),(63,'','MANUAL17'),(63,'','MANUAL18'),(63,'','MANUAL19'),(63,'','MANUAL20'),(64,'1. 감자를 슬라이스 하여 찜통에 찐 후 체에\n으깬다. 깻잎을 잘게 채 썰어서 냉수에 담가\n향을 빼준다.','MANUAL01'),(64,'2. 베이컨을 한 번 데쳐내 송송 썰어준 후 다진\n마늘과 볶아준다.','MANUAL02'),(64,'3. 으깬 감자와 깻잎을 다져서 반죽을 만들고\n엄지손가락 크기로 떼어 밀가루를 뿌리고,\n둥글게 빚은 후 포크로 자국을 내 뇨끼를 만든다.','MANUAL03'),(64,'4. 만들어진 뇨끼를 삶아 건져준다.','MANUAL04'),(64,'5. 팬에 버터를 넣고 다진양파, 다진마늘, 다진\n대파, 볶은 베이컨, 새송이, 흰후추를 볶다가\n우유와 생크림, 설탕을 넣고 끓여준다.','MANUAL05'),(64,'6. 뇨끼를 넣어 한 번 더 끓여준 뒤 완성한다.','MANUAL06'),(64,'','MANUAL07'),(64,'','MANUAL08'),(64,'','MANUAL09'),(64,'','MANUAL10'),(64,'','MANUAL11'),(64,'','MANUAL12'),(64,'','MANUAL13'),(64,'','MANUAL14'),(64,'','MANUAL15'),(64,'','MANUAL16'),(64,'','MANUAL17'),(64,'','MANUAL18'),(64,'','MANUAL19'),(64,'','MANUAL20'),(65,'1. 단호박은 껍질을 까고 작게 잘라주고, 양파도\n작게 잘라준다.','MANUAL01'),(65,'2. 브로콜리는 뜨거운 물에 데쳐내 준 후 송송\n잘라준다.','MANUAL02'),(65,'3. 찹쌀가루는 물 100g에 풀어준다.','MANUAL03'),(65,'4. 단호박과 양파는 물 300g에 삶아준다.','MANUAL04'),(65,'5. 단호박과 양파가 익으면 믹서에 갈아서 다시\n끓여준 뒤 찹쌀가루물을 넣어 끓여준다.','MANUAL05'),(65,'6. 호박죽이 끓어오르면 치즈가루를 넣어준 후\n볶은 현미랑 완성한다.','MANUAL06'),(65,'','MANUAL07'),(65,'','MANUAL08'),(65,'','MANUAL09'),(65,'','MANUAL10'),(65,'','MANUAL11'),(65,'','MANUAL12'),(65,'','MANUAL13'),(65,'','MANUAL14'),(65,'','MANUAL15'),(65,'','MANUAL16'),(65,'','MANUAL17'),(65,'','MANUAL18'),(65,'','MANUAL19'),(65,'','MANUAL20'),(66,'1. 팽이버섯을 송송 다진 후 라이스버거 재료로\n라이스버거를 만들어준다.','MANUAL01'),(66,'2. 만들어준 버거는 팬에 구워준다.','MANUAL02'),(66,'3. 토마토와 미나리를 먹기 좋게 잘라서 겉절이를\n만들어준다.','MANUAL03'),(66,'4. 떡갈비 재료로 떡 갈비를 만들어준다.','MANUAL04'),(66,'5. 만들어진 떡갈비를 구워준다.','MANUAL05'),(66,'6. 접시에 토마토 겉절이를 담고 라이스버거와\n떡갈비를 올려 완성한다.','MANUAL06'),(66,'','MANUAL07'),(66,'','MANUAL08'),(66,'','MANUAL09'),(66,'','MANUAL10'),(66,'','MANUAL11'),(66,'','MANUAL12'),(66,'','MANUAL13'),(66,'','MANUAL14'),(66,'','MANUAL15'),(66,'','MANUAL16'),(66,'','MANUAL17'),(66,'','MANUAL18'),(66,'','MANUAL19'),(66,'','MANUAL20'),(67,'1. 오이고추는 배를 갈라 씨를 제거하고 세척 후 절임물에 절여준다.','MANUAL01'),(67,'2. 영양부추, 연근은 송송 다지고 무는 채 썬다.','MANUAL02'),(67,'3. 손질한 부추와 연근, 무에 절임물을 조금 넣고 절인다.','MANUAL03'),(67,'4. 고춧가루, 생강청, 통깨를 절임채소에 섞어 소를 만든다.','MANUAL04'),(67,'5. 오이고추 속에 소를 채워 넣는다.','MANUAL05'),(67,'6. 오이고추를 그릇에 담고 남은 물을 부어 마무리한다.','MANUAL06'),(67,'','MANUAL07'),(67,'','MANUAL08'),(67,'','MANUAL09'),(67,'','MANUAL10'),(67,'','MANUAL11'),(67,'','MANUAL12'),(67,'','MANUAL13'),(67,'','MANUAL14'),(67,'','MANUAL15'),(67,'','MANUAL16'),(67,'','MANUAL17'),(67,'','MANUAL18'),(67,'','MANUAL19'),(67,'','MANUAL20'),(68,'1. 닭은 포를 떠서 생강즙과 정종을 섞어\n발라 놓는다.','MANUAL01'),(68,'2. 시금치는 살짝 데쳐 썰고, 당근, 양파,\n샐러리, 파프리카는 약 6Cm 길이로\n채를 썰어 절반은 닭고기말이에 사용\n하고, 절반은 곁들임채소로 사용한다.','MANUAL02'),(68,'3. 느타리는 끓는 물에 소금을 넣고 데쳐\n손으로 찢어놓고, 포를 뜬 닭가슴살에\n느타리와 썰어 놓은 채소를 넣어 말아\n주고, 육수를 끓여서 말아놓은 닭을\n넣고 익혀낸다.','MANUAL03'),(68,'4. 주꾸미와 새우는 끓는 물에 살짝 데치고,\n청경채는 반으로 썰어 살짝 데쳐 준비\n한다.','MANUAL04'),(68,'5. 튀김기름 온도가 180℃ 정도 되면\n누룽지를 넣고 튀겨 기름을 밭쳐 놓는다.','MANUAL05'),(68,'6. 닭을 넣은 육수(③)에 간장과 녹말,\n마늘, 소금, 후춧가루를 넣고 끓이다가,\n곁들임채소로 남겨 놓은 채소(②)와\n데쳐 놓은 해물 및 청경채를 넣고 한 번 더\n끓인 뒤 튀겨진 누룽지를 넣어 완성한다.','MANUAL06'),(68,'','MANUAL07'),(68,'','MANUAL08'),(68,'','MANUAL09'),(68,'','MANUAL10'),(68,'','MANUAL11'),(68,'','MANUAL12'),(68,'','MANUAL13'),(68,'','MANUAL14'),(68,'','MANUAL15'),(68,'','MANUAL16'),(68,'','MANUAL17'),(68,'','MANUAL18'),(68,'','MANUAL19'),(68,'','MANUAL20'),(69,'1. 광어는 포를 길게 떠서 소금과\n후춧가루에 밑간을 해 놓는다.','MANUAL01'),(69,'2. 아몬드와 호두는 입자있게 다져\n준비한다.','MANUAL02'),(69,'3. 밑간이 되어 있는 광어포에 밀가루와\n달걀물을 입힌다.','MANUAL03'),(69,'4. 달걀물을 입힌 광어살에 다시 다져\n놓은 견과류를 입혀 준다.','MANUAL04'),(69,'5. 팬에 올리브 오일을 넣고, 팬이 따끈해\n지면 광어 살을 조심스럽게 앞뒤로\n익혀 접시에 담는다.','MANUAL05'),(69,'6. 플레인요거트에 꿀과 레몬즙을 넣고\n골고루 섞어 광어스테이크소스를\n만들어 완성한다.','MANUAL06'),(69,'','MANUAL07'),(69,'','MANUAL08'),(69,'','MANUAL09'),(69,'','MANUAL10'),(69,'','MANUAL11'),(69,'','MANUAL12'),(69,'','MANUAL13'),(69,'','MANUAL14'),(69,'','MANUAL15'),(69,'','MANUAL16'),(69,'','MANUAL17'),(69,'','MANUAL18'),(69,'','MANUAL19'),(69,'','MANUAL20'),(70,'1. 감자는 껍질을 벗겨 삶는다.','MANUAL01'),(70,'2. 오이와 당근은 어슷썰기를 하고 양파는\n채를 썰어놓는다.','MANUAL02'),(70,'3. 썰어 놓은 채소에 소금과 물을 넣고\n살짝 절여, 물기를 짜놓는다.','MANUAL03'),(70,'4. 삶아 놓은 감자를 채에 내리고\n생크림을 넣어 섞는다.','MANUAL04'),(70,'5. 생크림을 넣은 감자에 절여 놓은 채소와\n모짜렐라치즈를 넣고 골고루 섞는다.','MANUAL05'),(70,'6. 섞여진 감자를 크로켓 모양을 만들어\n밀가루, 달걀물, 빵가루를 묻혀 튀김기름\n170~180℃ 온도에서 바삭하게 튀겨\n냅킨에 올려 기름을 제거하고, 접시에\n담아 완성한다.','MANUAL06'),(70,'','MANUAL07'),(70,'','MANUAL08'),(70,'','MANUAL09'),(70,'','MANUAL10'),(70,'','MANUAL11'),(70,'','MANUAL12'),(70,'','MANUAL13'),(70,'','MANUAL14'),(70,'','MANUAL15'),(70,'','MANUAL16'),(70,'','MANUAL17'),(70,'','MANUAL18'),(70,'','MANUAL19'),(70,'','MANUAL20'),(71,'1. 두부는 소창에 넣고, 짜서 물기를\n제거하고, 으깨어 놓는다.','MANUAL01'),(71,'2. 으깬 두부에 소금과 코코넛 밀크를\n넣고 골고루 섞는다.','MANUAL02'),(71,'3. 섞여진 두부를 김이 오른 찜통에 넣고\n약 5분 정도 찐다.','MANUAL03'),(71,'4. 당근과 양파는 사각지게 썰고,\n브로컬리는 데쳐 당근 크기로 썰어\n놓는다.','MANUAL04'),(71,'5. 돼지고기와 감자는 당근 크기로 썰어\n주고, 냄비에 버터를 녹여 돼지고기를\n먼저 볶다가 양파와 당근, 감자,\n브로컬리를 넣고 다시 볶아 준 뒤,\n쪄놓은 두부를 넣어 한 번 더 볶아준다.','MANUAL05'),(71,'6. 볶아지는 냄비(⑤)에 카레 가루를 넣고\n살짝 더 볶아준 뒤, 물을 넣고 자작하게\n끓여 완성한다.','MANUAL06'),(71,'','MANUAL07'),(71,'','MANUAL08'),(71,'','MANUAL09'),(71,'','MANUAL10'),(71,'','MANUAL11'),(71,'','MANUAL12'),(71,'','MANUAL13'),(71,'','MANUAL14'),(71,'','MANUAL15'),(71,'','MANUAL16'),(71,'','MANUAL17'),(71,'','MANUAL18'),(71,'','MANUAL19'),(71,'','MANUAL20'),(72,'1. 쌀은 불려 놓고, 마늘은 작게 다지고,\n양파는 새송이와 파프리카와 함께\n입자를 크게 다져 준비한다.','MANUAL01'),(72,'2. 소고기는 포를 넓게 떠서 소금과\n후춧가루를 뿌려 밑간을 해 놓는다.','MANUAL02'),(72,'3. 냄비에 버터를 넣고, 마늘과 양파를\n먼저 볶다가, 새송이와 파프리카를\n넣는다.','MANUAL03'),(72,'4. ③번에 다시 불린 쌀과 강화를 넣고,\n볶다가 불을 줄여, 쌀이 익을 때까지\n익혀 준다.','MANUAL04'),(72,'5. 쌀이 익으면, 밑간이 되어 있는\n소고기에 넣고 돌돌 말아 준비한다.','MANUAL05'),(72,'6. 하얀 된장에 생크림을 넣어 골고루 섞고,\n냄비에 육수를 넣고 생크림을 섞은 하얀\n된장을 넣어 끓으면, 말아놓은 소고기를\n넣고 은근히 졸여 완성한다.','MANUAL06'),(72,'','MANUAL07'),(72,'','MANUAL08'),(72,'','MANUAL09'),(72,'','MANUAL10'),(72,'','MANUAL11'),(72,'','MANUAL12'),(72,'','MANUAL13'),(72,'','MANUAL14'),(72,'','MANUAL15'),(72,'','MANUAL16'),(72,'','MANUAL17'),(72,'','MANUAL18'),(72,'','MANUAL19'),(72,'','MANUAL20'),(73,'1. 닭고기살은 작게 썰어 소금과 후춧\n가루를 살짝 뿌려 밑간을 하고 달걀을\n넣어 섞는다.','MANUAL01'),(73,'2. 달걀을 넣어 섞은 닭고기 살에 녹말\n가루를 넣어 골고루 묻힌다.','MANUAL02'),(73,'3. 국수는 각각 끓는 물에 살짝 데쳐 물기를\n빼놓는다.','MANUAL03'),(73,'4. 물기가 빠진 국수는 튀김기름 170℃\n온도에서 각각 작은 채에 그대로 살짝\n튀겨 둥지를 만든 후 기름을 냅킨에\n빼 놓는다.','MANUAL04'),(73,'5. 녹말가루를 묻힌 닭고기살도 튀김\n기름에 튀겨 기름을 빼 놓은 둥지국수\n위에 올린다.','MANUAL05'),(73,'6. 냄비에 레몬과 설탕을 넣고 물을 넣어\n끓이다가 레몬은 건져 내고, 마늘과\n생강, 연유, 식초, 녹말을 풀어 넣고\n살짝 한 번 더 끓여 녹말소스를 만들어,\n튀겨진 닭고기 위에 올려 완성한다.','MANUAL06'),(73,'','MANUAL07'),(73,'','MANUAL08'),(73,'','MANUAL09'),(73,'','MANUAL10'),(73,'','MANUAL11'),(73,'','MANUAL12'),(73,'','MANUAL13'),(73,'','MANUAL14'),(73,'','MANUAL15'),(73,'','MANUAL16'),(73,'','MANUAL17'),(73,'','MANUAL18'),(73,'','MANUAL19'),(73,'','MANUAL20'),(74,'1. 새우는 꼬리를 자르고 내장을 제거\n한다.','MANUAL01'),(74,'2. 스테이크 소고기는 소금과 로즈마리를\n뿌리고 후춧가루를 살짝 뿌려 놓는다.','MANUAL02'),(74,'3. 아스파라거스는 팬에 기름 없이\n굽는다.','MANUAL03'),(74,'4. 새송이와 가지는 길게 썰어 브로컬리와\n함께 기름 없이 팬에 살짝 구워 놓는다.','MANUAL04'),(74,'5. 팬에 버터를 살짝 넣고 새우를 굽고,\n스테이크를 구워 접시에 담는다.','MANUAL05'),(74,'6. 팬에 와인과 설탕을 넣고 끓이다가,\n당근, 양파와 토마토 마늘, 대파를 다져\n넣고 볶듯이 끓이다가 발사믹소스를\n넣고 한 번 더 졸인 소스를 스테이크\n위에 얹고, 브로컬리와 새송이, 가지,\n아스파라거스를 함께 놓아 완성한다.','MANUAL06'),(74,'','MANUAL07'),(74,'','MANUAL08'),(74,'','MANUAL09'),(74,'','MANUAL10'),(74,'','MANUAL11'),(74,'','MANUAL12'),(74,'','MANUAL13'),(74,'','MANUAL14'),(74,'','MANUAL15'),(74,'','MANUAL16'),(74,'','MANUAL17'),(74,'','MANUAL18'),(74,'','MANUAL19'),(74,'','MANUAL20'),(75,'1. 통 삼겹살에 함초와 소금, 후춧가루를\n뿌려 숙성을 시킨다.','MANUAL01'),(75,'2. 부추는 약 6cm 길이로 썰고, 양파는\n채를 썰어 놓고, 당근은 납작하게\n편으로 썰어 준비한다.','MANUAL02'),(75,'3. 연두부는 잘게 다져 놓는다.','MANUAL03'),(75,'4. 유자청에 쌈장과 설탕, 생크림을 넣어\n골고루 섞는다.','MANUAL04'),(75,'5. 골고루 섞은 유자청에 다져 놓은\n연두부를 넣어 섞어 냄비에 넣고, 썰어\n놓은 양파와 당근을 넣어 은근히 끓여\n소스를 만들어 놓는다.','MANUAL05'),(75,'6. 숙성시킨 통삼겹은 버터를 녹인 팬에\n살짝 구워 다시 오븐에서 20분 정도\n익힌 후 먹기 좋게 썰은 뒤, 접시에\n부추를 깔고 그 위에 구워진 삼겹을\n올리고 소스를 얹어 완성한다.','MANUAL06'),(75,'','MANUAL07'),(75,'','MANUAL08'),(75,'','MANUAL09'),(75,'','MANUAL10'),(75,'','MANUAL11'),(75,'','MANUAL12'),(75,'','MANUAL13'),(75,'','MANUAL14'),(75,'','MANUAL15'),(75,'','MANUAL16'),(75,'','MANUAL17'),(75,'','MANUAL18'),(75,'','MANUAL19'),(75,'','MANUAL20'),(76,'1. 돼지고기와 소고기를 섞어, 매실액을\n넣고 30분 정도 냉장고에서 숙성을\n시킨다.','MANUAL01'),(76,'2. 숙성된 돼지고기와 소고기에 다진마늘,\n로즈마리, 빵가루, 후춧가루를 넣고\n골고루 섞는다.','MANUAL02'),(76,'3. 파프리카는 반으로 잘라 그 안에 씨를\n수저를 이용해서 파낸다.','MANUAL03'),(76,'4. 속을 파낸 파프리카에 양념한 고기를\n넣고, 꼭꼭 눌러 두툼하게 잘라 구워\n접시에 담는다.','MANUAL04'),(76,'5. 양파는 입자있게 다져 팬에 기름을\n넣고 은근히 볶아 양파 향을 낸다.','MANUAL05'),(76,'6. 볶아진 팬(⑤)에 준비한 플레인요거트와\n설탕, 매실액을 넣고 끓이다가, 식초와\n녹말을 넣고 한 번 더 끓여 소스를\n완성한다. 햄버거스테이트(④)에 소스를\n얹고, 어린잎을 올려 완성한다.','MANUAL06'),(76,'','MANUAL07'),(76,'','MANUAL08'),(76,'','MANUAL09'),(76,'','MANUAL10'),(76,'','MANUAL11'),(76,'','MANUAL12'),(76,'','MANUAL13'),(76,'','MANUAL14'),(76,'','MANUAL15'),(76,'','MANUAL16'),(76,'','MANUAL17'),(76,'','MANUAL18'),(76,'','MANUAL19'),(76,'','MANUAL20'),(77,'1. 삼치는 반으로 잘라지지 않게 편으로\n떠서 소금을 살짝 뿌려 잠시 말려\n놓는다.','MANUAL01'),(77,'2. 손질을 한 삼치에 녹말가루를 입혀\n팬에 기름을 두르고 구워 접시에 담아\n놓는다.','MANUAL02'),(77,'3. 생강은 잘게 썰어, 물에 섞은 후\n거름종이에 걸러 생강즙을 만든다.','MANUAL03'),(77,'4. 유자청에 만들어 놓은 생강즙을 넣고\n섞는다.','MANUAL04'),(77,'5. 냄비에 레몬을 넣고, 물을 넣고 은근히\n끓인다.','MANUAL05'),(77,'6. 레몬을 끓인 물에 ④번을 넣고 졸여\n소스를 만든 후 접시에 담아 놓은 삼치\n위에 소스로 올려 완성한다.','MANUAL06'),(77,'','MANUAL07'),(77,'','MANUAL08'),(77,'','MANUAL09'),(77,'','MANUAL10'),(77,'','MANUAL11'),(77,'','MANUAL12'),(77,'','MANUAL13'),(77,'','MANUAL14'),(77,'','MANUAL15'),(77,'','MANUAL16'),(77,'','MANUAL17'),(77,'','MANUAL18'),(77,'','MANUAL19'),(77,'','MANUAL20'),(78,'1. 마늘은 곱게 다지고 양파, 당근,\n방울토마토는 입자있게 다진다.','MANUAL01'),(78,'2. 토마토는 씨와 껍질을 제거하고 채를\n썰어놓는다.','MANUAL02'),(78,'3. 브로컬리를 끓는 물에 데쳐 찬물에\n헹구어 작게 썰어 준비한다.','MANUAL03'),(78,'4. 펜네는 끓는 물에 약 10분 정도\n삶아 건진다.','MANUAL04'),(78,'5. 건져진 펜네는 올리브오일을 넣어\n무친 후 그릇에 담아놓는다.','MANUAL05'),(78,'6. 냄비에 오일을 넣고 마늘과 양파를\n볶다가 당근과 방울토마토를 넣어\n볶으면서 육수를 붓고 설탕과 소금,\n레몬즙, 월계수잎을 넣고 끓인 뒤\n월계수잎을 건져내고, 차갑게 식힌 후\n그릇에 담겨 있는 펜네에 토마토채(②)와\n브로컬리(③)를 함께 넣어 담아 완성\n한다.','MANUAL06'),(78,'','MANUAL07'),(78,'','MANUAL08'),(78,'','MANUAL09'),(78,'','MANUAL10'),(78,'','MANUAL11'),(78,'','MANUAL12'),(78,'','MANUAL13'),(78,'','MANUAL14'),(78,'','MANUAL15'),(78,'','MANUAL16'),(78,'','MANUAL17'),(78,'','MANUAL18'),(78,'','MANUAL19'),(78,'','MANUAL20'),(79,'1. 닭고기살은 끓는 물에 데쳐 손으로\n찢고, 느타리버섯도 데쳐 손으로 찢어\n준비한다.','MANUAL01'),(79,'2. 사과는 씨를 제거하고 약 6cm 길이로\n채를 썰고, 오이와 파프리카도 같은\n길이로 채를 썰어 놓는다.','MANUAL02'),(79,'3. 애호박은 반달로 썰어 식초에 살짝\n절여서 볶고, 양파는 채를 썰어 물에\n잠시 담가 놓는다.','MANUAL03'),(79,'4. 아몬드는 우유를 넣어 갈아 준비한다.','MANUAL04'),(79,'5. 머스터드에 올리고당을 넣어 잘 섞어\n준다.','MANUAL05'),(79,'6. 또띠아를 팬에 기름 없이 굽고, 그 안에\n닭고기 살과 느타리버섯, 오이, 사과,\n파프리카와 호박을 넣어 속이 보이도록\n말아놓고, ④번과 ⑤번은 섞어서 소스를\n만들어 완성한다.','MANUAL06'),(79,'','MANUAL07'),(79,'','MANUAL08'),(79,'','MANUAL09'),(79,'','MANUAL10'),(79,'','MANUAL11'),(79,'','MANUAL12'),(79,'','MANUAL13'),(79,'','MANUAL14'),(79,'','MANUAL15'),(79,'','MANUAL16'),(79,'','MANUAL17'),(79,'','MANUAL18'),(79,'','MANUAL19'),(79,'','MANUAL20'),(80,'1. 닭고기살은 소금과 후춧가루, 생강즙과\n정종을 뿌린 후 우유를 살짝 발라 숙성을\n시킨다.','MANUAL01'),(80,'2. 오이는 길게 껍질째 썰어 놓는다.','MANUAL02'),(80,'3. 토마토는 반으로 잘라 편으로 썰어\n준비한다.','MANUAL03'),(80,'4. 두부는 소창으로 물기를 꼭 짜 놓는다.','MANUAL04'),(80,'5. 물기를 제거 시킨 두부에 흑임자를\n넣고 골고루 섞은 뒤 냄비에 넣고\n우유와 함께 은근히 끓여 속을 만든다.','MANUAL05'),(80,'6. 팬에 토마토를 먼저 구워 접시에 담고,\n숙성된 닭고기를 구워 올린 뒤, 그 위에\n오이로 원형기둥을 만들고 구운\n닭고기를 다시 올려 완성한다.','MANUAL06'),(80,'','MANUAL07'),(80,'','MANUAL08'),(80,'','MANUAL09'),(80,'','MANUAL10'),(80,'','MANUAL11'),(80,'','MANUAL12'),(80,'','MANUAL13'),(80,'','MANUAL14'),(80,'','MANUAL15'),(80,'','MANUAL16'),(80,'','MANUAL17'),(80,'','MANUAL18'),(80,'','MANUAL19'),(80,'','MANUAL20'),(81,'1. 통오징어는 다리를 떼어내고 내장을\n제거시켜 통째로 깨끗이 씻어 준비\n한다.','MANUAL01'),(81,'2. 양파와 당근, 부추, 생강은 입자있게\n썰고, 견과류는 다져 준비한다.','MANUAL02'),(81,'3. 두부는 물기를 짠 후 수저로 으깨어\n놓는다.','MANUAL03'),(81,'4. 잘게 썰은 오징어 다리와 썰어 놓은\n채소, 견과류(②), 곱게 다진 대파와\n마늘, 그리고 소금과 녹말가루를 두부\n(③)와 함께 골고루 섞어 순대속을\n만든다.','MANUAL04'),(81,'5. 손질된 오징어 속 안에 준비한 속을\n채워 넣는다.','MANUAL05'),(81,'6. 오징어순대에 레몬즙과 정종, 생강즙을\n섞어 바른 뒤 찜통에 김이 오르면\n오징어순대를 넣어 약 10분 정도 쪄서\n완성한다.','MANUAL06'),(81,'','MANUAL07'),(81,'','MANUAL08'),(81,'','MANUAL09'),(81,'','MANUAL10'),(81,'','MANUAL11'),(81,'','MANUAL12'),(81,'','MANUAL13'),(81,'','MANUAL14'),(81,'','MANUAL15'),(81,'','MANUAL16'),(81,'','MANUAL17'),(81,'','MANUAL18'),(81,'','MANUAL19'),(81,'','MANUAL20'),(82,'1. 모시조개는 물에 소금을 넣고, 담그어\n해감을 한다.','MANUAL01'),(82,'2. 연어는 사각지게 썰어 준비한다.','MANUAL02'),(82,'3. 당근, 양파, 감자는 사각크기로 썰어\n놓고, 청피망은 채를 썰어 당근과\n비슷한 길이로 잘라둔다.','MANUAL03'),(82,'4. 냄비에 버터와 밀가루를 넣고 볶다가\n채소를 넣어 같이 볶는다.','MANUAL04'),(82,'5. 볶아지는 냄비에 모시조개와 육수를\n넣고 끓인다.','MANUAL05'),(82,'6. 거품을 걷어내고, 월계수 잎과 통후추,\n통마늘을 넣고 끓이다가 연어와\n생크림을 넣어 한 소큼 끓으면 완성한다.','MANUAL06'),(82,'','MANUAL07'),(82,'','MANUAL08'),(82,'','MANUAL09'),(82,'','MANUAL10'),(82,'','MANUAL11'),(82,'','MANUAL12'),(82,'','MANUAL13'),(82,'','MANUAL14'),(82,'','MANUAL15'),(82,'','MANUAL16'),(82,'','MANUAL17'),(82,'','MANUAL18'),(82,'','MANUAL19'),(82,'','MANUAL20'),(83,'1. 시금치와 브로콜리는 끓는 물에 소금을\n넣고 살짝 데친다.','MANUAL01'),(83,'2. 데친 시금치, 브로콜리와 바질을\n믹서에 갈아 준다.','MANUAL02'),(83,'3. 새우는 껍질을 벗겨 손질한다','MANUAL03'),(83,'4. 끓는 물에 스파게티를 10분 정도 삶아\n건진다.','MANUAL04'),(83,'5. 삶아진 스파게티는 팬에 올리브오일을\n넣고 볶는다.','MANUAL05'),(83,'6. 갈아 놓은 시금치소스에 생크림을 넣고\n한소끔 끓이면서 볶은 파스타를 넣은\n뒤 새우를 올린다','MANUAL06'),(83,'','MANUAL07'),(83,'','MANUAL08'),(83,'','MANUAL09'),(83,'','MANUAL10'),(83,'','MANUAL11'),(83,'','MANUAL12'),(83,'','MANUAL13'),(83,'','MANUAL14'),(83,'','MANUAL15'),(83,'','MANUAL16'),(83,'','MANUAL17'),(83,'','MANUAL18'),(83,'','MANUAL19'),(83,'','MANUAL20'),(84,'1. 광어는 비늘을 제거하고 포를 뜬다.','MANUAL01'),(84,'2. 손질된 광어에 레몬과 청주를 뿌려\n숙성 시킨다.','MANUAL02'),(84,'3. 저염간장에 레몬즙, 와사비,\n발사믹소스를 넣고 소스를 만든다.','MANUAL03'),(84,'4. 당근, 애호박은 쿠퍼로 동글동글하게\n깎는다.','MANUAL04'),(84,'5. 당근, 애호박, 콜리플라워는 김이 오른\n찜통에 5분 정도 쪄 낸다.','MANUAL05'),(84,'6. 가지와 파프리카는 팬에 굽고,\n숙성시킨 광어도 팬에 구워 접시에\n담고 쪄 낸 야채를 담은 뒤 소스를\n올린다.','MANUAL06'),(84,'','MANUAL07'),(84,'','MANUAL08'),(84,'','MANUAL09'),(84,'','MANUAL10'),(84,'','MANUAL11'),(84,'','MANUAL12'),(84,'','MANUAL13'),(84,'','MANUAL14'),(84,'','MANUAL15'),(84,'','MANUAL16'),(84,'','MANUAL17'),(84,'','MANUAL18'),(84,'','MANUAL19'),(84,'','MANUAL20'),(85,'1. 연근은 껍질을 벗긴다.','MANUAL01'),(85,'2. 껍질벗긴 연근은 얇게 썬다.','MANUAL02'),(85,'3. 물 200g에 식초 10g을 섞는다','MANUAL03'),(85,'4. 식촛물에 썬 연근을 담근다.','MANUAL04'),(85,'5. 연근을 체에 건져 물기를 뺀다.','MANUAL05'),(85,'6. 연근을 바삭하게 튀긴 뒤 천일염을\n살짝 뿌리고, 계피가루를 묻힌다.','MANUAL06'),(85,'','MANUAL07'),(85,'','MANUAL08'),(85,'','MANUAL09'),(85,'','MANUAL10'),(85,'','MANUAL11'),(85,'','MANUAL12'),(85,'','MANUAL13'),(85,'','MANUAL14'),(85,'','MANUAL15'),(85,'','MANUAL16'),(85,'','MANUAL17'),(85,'','MANUAL18'),(85,'','MANUAL19'),(85,'','MANUAL20'),(86,'1. 쌀은 깨끗이 씻어 30분 정도 불려 밥을\n짓는다.','MANUAL01'),(86,'2. 달걀을 풀어 소금을 넣고 지단을\n만들어 채썬다.','MANUAL02'),(86,'3. 도라지, 애호박, 양파, 홍고추는 채를\n썰어 소금에 살짝 절여 볶고, 청포묵은\n채를 썰어 참기름에 버무린다.','MANUAL03'),(86,'4. 돼지 안심은 소금, 후춧가루로 양념 한\n뒤 팬에 익힌다.','MANUAL04'),(86,'5. 찬물에 식초, 설탕, 소금을 넣고 채 썬\n오이를 넣어 냉국을 만든다.','MANUAL05'),(86,'6. 고추장에 고춧가루를 섞어 쌈밥장을\n만들고, 라이스페이퍼를 물에 담궈\n건져 밥과 준비한 야채, 달걀지단,\n쌈무, 쌈밥장을 올려 돌돌 말고 데친\n미나리로 묶는다.','MANUAL06'),(86,'','MANUAL07'),(86,'','MANUAL08'),(86,'','MANUAL09'),(86,'','MANUAL10'),(86,'','MANUAL11'),(86,'','MANUAL12'),(86,'','MANUAL13'),(86,'','MANUAL14'),(86,'','MANUAL15'),(86,'','MANUAL16'),(86,'','MANUAL17'),(86,'','MANUAL18'),(86,'','MANUAL19'),(86,'','MANUAL20'),(87,'1. 닭은 살을 발라 소금, 후춧가루로\n밑간을 한다.','MANUAL01'),(87,'2. 오곡을 불려 밥을 짓는다.','MANUAL02'),(87,'3. 오이, 아스파라거스, 당근, 양파는\n길이대로 채썬다.','MANUAL03'),(87,'4. 닭살에 지어 놓은 오곡밥을 넣는다','MANUAL04'),(87,'5. 오곡밥을 넣은 닭살에 카레가루를\n골고루 묻힌다.','MANUAL05'),(87,'6. 팬에 기름을 두르고 5번을 올려 은근히\n익혀 접시에 담고, 썰어 놓은 야채를\n닭살위에 담은 뒤 디종머스터드를\n올린다.','MANUAL06'),(87,'','MANUAL07'),(87,'','MANUAL08'),(87,'','MANUAL09'),(87,'','MANUAL10'),(87,'','MANUAL11'),(87,'','MANUAL12'),(87,'','MANUAL13'),(87,'','MANUAL14'),(87,'','MANUAL15'),(87,'','MANUAL16'),(87,'','MANUAL17'),(87,'','MANUAL18'),(87,'','MANUAL19'),(87,'','MANUAL20'),(88,'1. 광어는 비늘을 벗기고 포를 떠 소금,\n후춧가루를 뿌린다.','MANUAL01'),(88,'2. 콜리플라워는 팬에 볶는다.','MANUAL02'),(88,'3. 감자와 양파를 썰어 콜리플라워와 함께\n볶는다.','MANUAL03'),(88,'4. ?번에 우유를 넣는다.','MANUAL04'),(88,'5. ?를 믹서로 곱게 간 뒤, 끓인다.','MANUAL05'),(88,'6. 가지, 당근. 단호박은 둥근 모양으로\n만들어 팬에 시금치와 함께 익히고,\n광어도 팬에 구워 접시에 담아\n컬리플라워 소스를 올린다.','MANUAL06'),(88,'','MANUAL07'),(88,'','MANUAL08'),(88,'','MANUAL09'),(88,'','MANUAL10'),(88,'','MANUAL11'),(88,'','MANUAL12'),(88,'','MANUAL13'),(88,'','MANUAL14'),(88,'','MANUAL15'),(88,'','MANUAL16'),(88,'','MANUAL17'),(88,'','MANUAL18'),(88,'','MANUAL19'),(88,'','MANUAL20'),(89,'1. 다시마와 건새우를 넣고 은근히 끓여\n차갑게 식힌 뒤 육수를 만든다.','MANUAL01'),(89,'2. 차갑게 식힌 육수는 체에 걸려내고\n오미자를 넣고 소금으로 간을 한다.','MANUAL02'),(89,'3. 콜라비, 피망, 파프리카는 납작하게\n썬다.','MANUAL03'),(89,'4. 육수는 체에 거른다','MANUAL04'),(89,'5. 오미자를 넣고 소금으로 간을 한다.','MANUAL05'),(89,'6. 통에 썰어놓은 야채와 무화과를 담고\n?를 넣는다.','MANUAL06'),(89,'','MANUAL07'),(89,'','MANUAL08'),(89,'','MANUAL09'),(89,'','MANUAL10'),(89,'','MANUAL11'),(89,'','MANUAL12'),(89,'','MANUAL13'),(89,'','MANUAL14'),(89,'','MANUAL15'),(89,'','MANUAL16'),(89,'','MANUAL17'),(89,'','MANUAL18'),(89,'','MANUAL19'),(89,'','MANUAL20'),(90,'1. 닭가슴살은 포를 떠 소금과 후춧가루로\n밑간을 한다.','MANUAL01'),(90,'2. 새우는 껍질을 벗겨 손질한다.','MANUAL02'),(90,'3. 베이컨은 끓는 물에 데친다.','MANUAL03'),(90,'4. 마늘과 바질은 다진 뒤 버터에 섞는다.','MANUAL04'),(90,'5. 닭가슴살에 베이컨과 다진 버터를\n올린다.','MANUAL05'),(90,'6. 냄비에 마늘과 바질을 섞은 버터,\n치즈를 넣고 끓이다가 ?를 놓고\n졸인다.','MANUAL06'),(90,'','MANUAL07'),(90,'','MANUAL08'),(90,'','MANUAL09'),(90,'','MANUAL10'),(90,'','MANUAL11'),(90,'','MANUAL12'),(90,'','MANUAL13'),(90,'','MANUAL14'),(90,'','MANUAL15'),(90,'','MANUAL16'),(90,'','MANUAL17'),(90,'','MANUAL18'),(90,'','MANUAL19'),(90,'','MANUAL20'),(91,'1. 표고버섯은 따뜻한 물에 불린다.','MANUAL01'),(91,'2. 감자는 강판에 간다.','MANUAL02'),(91,'3. 고수는 잘게 다진다.','MANUAL03'),(91,'4. 당근은 곱게 다지고, 양파와 홍고추도\n다진다.','MANUAL04'),(91,'5. 감자에 다진 당근과 양파, 홍고추를\n섞는다.','MANUAL05'),(91,'6. 불린 표고버섯은 기둥을 자르고 바닥에\n녹말가루를 묻혀 ?번을 넣고 김이\n오른 찜통에 약 10분 정도 찐다.','MANUAL06'),(91,'','MANUAL07'),(91,'','MANUAL08'),(91,'','MANUAL09'),(91,'','MANUAL10'),(91,'','MANUAL11'),(91,'','MANUAL12'),(91,'','MANUAL13'),(91,'','MANUAL14'),(91,'','MANUAL15'),(91,'','MANUAL16'),(91,'','MANUAL17'),(91,'','MANUAL18'),(91,'','MANUAL19'),(91,'','MANUAL20'),(92,'1. 새우는 껍질을 벗겨 다진다.','MANUAL01'),(92,'2. 오징어는 소금으로 껍질을 벗겨\n다진다.','MANUAL02'),(92,'3. 애호박, 깻잎, 대추는 곱게 채썬다.','MANUAL03'),(92,'4. 채썬 애호박과 깻잎은 소금에 살짝\n절인 뒤 물기를 짠다.','MANUAL04'),(92,'5. 밀가루에 찹쌀가루, 애호박, 깻잎,\n대추채와 다진 새우, 오징어를 넣고\n팬에 기름을 둘러 전병을 만든 뒤 돌돌\n말아 썰어 접시에 담는다.','MANUAL05'),(92,'6. 저염간장과 식초, 설탕을 넣고 소스를\n만든다.','MANUAL06'),(92,'','MANUAL07'),(92,'','MANUAL08'),(92,'','MANUAL09'),(92,'','MANUAL10'),(92,'','MANUAL11'),(92,'','MANUAL12'),(92,'','MANUAL13'),(92,'','MANUAL14'),(92,'','MANUAL15'),(92,'','MANUAL16'),(92,'','MANUAL17'),(92,'','MANUAL18'),(92,'','MANUAL19'),(92,'','MANUAL20'),(93,'1. 닭다리는 기름기를 제거하고 냄비에 물 3컵 반을 부어 통마늘과 삶아 육수를 만든다.','MANUAL01'),(93,'2. 삶은 마늘을 체에 걸러 으깬 뒤 다시 육수에 넣는다.','MANUAL02'),(93,'3. 닭 육수 2컵 반에 찬밥을 넣고 밥알이 무르도록 끓인다.','MANUAL03'),(93,'4. 삶은 닭다리 살을 발라 잘게 찢어 넣는다.','MANUAL04'),(93,'5. 감자, 양파, 당근, 부추는 잘게 다진다.','MANUAL05'),(93,'6. 4에 5를 넣고 끓인 뒤 소금, 후춧가루로 간 한다.','MANUAL06'),(93,'','MANUAL07'),(93,'','MANUAL08'),(93,'','MANUAL09'),(93,'','MANUAL10'),(93,'','MANUAL11'),(93,'','MANUAL12'),(93,'','MANUAL13'),(93,'','MANUAL14'),(93,'','MANUAL15'),(93,'','MANUAL16'),(93,'','MANUAL17'),(93,'','MANUAL18'),(93,'','MANUAL19'),(93,'','MANUAL20'),(94,'1. 물 1컵 반에 국멸치와 건다시마를 넣어 멸치다시마국물을 만든다.','MANUAL01'),(94,'2. 국물을 우린 다시마는 채썬다.','MANUAL02'),(94,'3. 느타리버섯은 끓는 물에 데친 후 찢는다.','MANUAL03'),(94,'4. 감자와 두부는 3~4cm 가량으로 채를 썰고 홍고추와 대파는 어슷썬다.','MANUAL04'),(94,'5. 멸치다시마국물 1컵에 감자를 넣고 끓인 뒤 느타리버섯을 넣어 한소끔 끓이고 두부, 파, 다진 마늘, 홍고추를 넣고 소금으로 간 한다.','MANUAL05'),(94,'6. 채 썬 다시마를 고명으로 얹는다','MANUAL06'),(94,'','MANUAL07'),(94,'','MANUAL08'),(94,'','MANUAL09'),(94,'','MANUAL10'),(94,'','MANUAL11'),(94,'','MANUAL12'),(94,'','MANUAL13'),(94,'','MANUAL14'),(94,'','MANUAL15'),(94,'','MANUAL16'),(94,'','MANUAL17'),(94,'','MANUAL18'),(94,'','MANUAL19'),(94,'','MANUAL20'),(95,'1. 양념장 재료를 모두 섞어 냉장고에서 하루 숙성시킨다.','MANUAL01'),(95,'2. 민어는 비늘을 긁고 지느러미, 내장을 제거하여 흐르는 물에 씻어 5cm 길이로 토막 낸다.','MANUAL02'),(95,'3. 소고기는 채 썰어 다진 마늘, 후추로 밑간한다.','MANUAL03'),(95,'4. 무는 나박 썰기, 애호박은 반달 썰기, 애느타리는 한입 크기로 찢고 고추와 대파는 어슷 썬다.','MANUAL04'),(95,'5. 냄비에 참기름을 두르고 소고기를 볶다가 물 1컵 반과 무를 넣고 양념장을 풀어 끓인다.','MANUAL05'),(95,'6. 무가 반 정도 익으면 민어와 채소를 넣고 한소끔 끓인 뒤 어슷 썬 대파와 생강즙을 넣어 살짝 끓이고 소금 간하고 쑥갓을 넣는다.','MANUAL06'),(95,'','MANUAL07'),(95,'','MANUAL08'),(95,'','MANUAL09'),(95,'','MANUAL10'),(95,'','MANUAL11'),(95,'','MANUAL12'),(95,'','MANUAL13'),(95,'','MANUAL14'),(95,'','MANUAL15'),(95,'','MANUAL16'),(95,'','MANUAL17'),(95,'','MANUAL18'),(95,'','MANUAL19'),(95,'','MANUAL20'),(96,'1. 냄비에 육수 재료와 물(400g)을\n넣고 푹 끓인다.','MANUAL01'),(96,'2. 양송이버섯을 잘게 다진 뒤 버터에\n살짝 볶아 건져 한김 식힌 뒤\n닭다리살과 닭가슴살, 아몬드를 다져\n볶은 양송이버섯과 섞어 동그랗게\n빚어 밀가루옷을 입힌다.','MANUAL02'),(96,'3. 식용유(15g)를 두른 팬에서 겉을\n노릇하게 굽는다.','MANUAL03'),(96,'4. 육수(150g), 우유, 들깻가루를 끓여\n소스를 만든 뒤 아몬드 치킨볼과\n브로콜리를 넣고 졸인다.','MANUAL04'),(96,'5. 마늘은 편 썰어 낮은 온도의\n식용유에서 바삭하게 튀긴다.','MANUAL05'),(96,'6. 접시에 아몬드치킨볼을 담고\n튀긴 마늘을 얹어 마무리한다.','MANUAL06'),(96,'','MANUAL07'),(96,'','MANUAL08'),(96,'','MANUAL09'),(96,'','MANUAL10'),(96,'','MANUAL11'),(96,'','MANUAL12'),(96,'','MANUAL13'),(96,'','MANUAL14'),(96,'','MANUAL15'),(96,'','MANUAL16'),(96,'','MANUAL17'),(96,'','MANUAL18'),(96,'','MANUAL19'),(96,'','MANUAL20'),(97,'1. 현미와 쌀을 씻어 30분간 불린 뒤\n물기를 빼고, 다시마를\n우려낸 물(불린 쌀 동량)로 밥을 지어\n식힌 후 새우가루를 넣어 섞는다.','MANUAL01'),(97,'2. 양배추는 15~20분 정도 쪄서\n준비한다.','MANUAL02'),(97,'3. 얇게 저민 쇠고기를 팬에 올려\n익힌다.','MANUAL03'),(97,'4. 달래는 0.5㎝ 정도로 송송 썰어\n간장, 참기름에 버무린다.','MANUAL04'),(97,'5. 김발에 양배추, 고기, 밥 순서대로\n올려 돌돌 말아 양배추롤을 만든다.','MANUAL05'),(97,'6. 롤을 한입 크기로 썰어 담고\n달래 무침을 얹은 뒤 송송 썬\n붉은 고추를 올려 마무리한다.','MANUAL06'),(97,'','MANUAL07'),(97,'','MANUAL08'),(97,'','MANUAL09'),(97,'','MANUAL10'),(97,'','MANUAL11'),(97,'','MANUAL12'),(97,'','MANUAL13'),(97,'','MANUAL14'),(97,'','MANUAL15'),(97,'','MANUAL16'),(97,'','MANUAL17'),(97,'','MANUAL18'),(97,'','MANUAL19'),(97,'','MANUAL20'),(98,'1. 피망, 파프리카는 5㎝ 길이로 채\n썰고, 시금치는 갈아둔다.','MANUAL01'),(98,'2. 베이컨 위에 동태포를 올리고\n그 위에 피망과 파프리카를 올려\n돌돌 만다.','MANUAL02'),(98,'3. 저염버터에 생크림을 넣어서 농도를\n맞춘 후 갈아놓은 시금치를 넣어\n시금치소스를 만든다.','MANUAL03'),(98,'4. 달군 팬에 흰살생선베이컨말이를\n올려 완전히 익힌다.','MANUAL04'),(98,'5. 접시에 담아 시금치소스를\n곁들인 뒤 새싹채소로 장식하여\n마무리한다.','MANUAL05'),(98,'','MANUAL06'),(98,'','MANUAL07'),(98,'','MANUAL08'),(98,'','MANUAL09'),(98,'','MANUAL10'),(98,'','MANUAL11'),(98,'','MANUAL12'),(98,'','MANUAL13'),(98,'','MANUAL14'),(98,'','MANUAL15'),(98,'','MANUAL16'),(98,'','MANUAL17'),(98,'','MANUAL18'),(98,'','MANUAL19'),(98,'','MANUAL20'),(99,'1. 콩고기를 15분~20분 정도 물에\n불려 물기를 완전히 제거한 뒤\n저염간장양념으로 버무려 볶는다.','MANUAL01'),(99,'2. 아보카도, 바나나, 가지, 연근은\n깍둑 썰고, 방울토마토는 반을\n가른다.','MANUAL02'),(99,'3. 팬에 식용유(5g)를 둘러가며\n방울토마토, 가지, 연근을 각각\n볶아 건진다.','MANUAL03'),(99,'4. 만두피를 작은 체에 넣고\n바구니 모양으로 만들어 튀긴다.','MANUAL04'),(99,'5. 콩고기와 아보카도, 바나나,\n방울토마토, 가지, 연근을 튀긴\n만두피에 담은 뒤 허브오일드레싱을\n곁들여 마무리한다.','MANUAL05'),(99,'','MANUAL06'),(99,'','MANUAL07'),(99,'','MANUAL08'),(99,'','MANUAL09'),(99,'','MANUAL10'),(99,'','MANUAL11'),(99,'','MANUAL12'),(99,'','MANUAL13'),(99,'','MANUAL14'),(99,'','MANUAL15'),(99,'','MANUAL16'),(99,'','MANUAL17'),(99,'','MANUAL18'),(99,'','MANUAL19'),(99,'','MANUAL20'),(100,'1. 수박껍질은 흰 부분만 사용해\n작게 깍둑 썰고, 토마토는 껍질을\n벗겨 속씨를 제거해 작게 깍둑썬다.','MANUAL01'),(100,'2. 닭가슴살은 수비드해 익힌 뒤\n한입 크기로 썬다.','MANUAL02'),(100,'3. 감자, 가지, 양파, 피망,\n아스파라거스는 깍둑 썬 뒤\n닭가슴살과 함께 볶는다.','MANUAL03'),(100,'4. 팬에 복분자를 넣고 살짝 졸인 뒤\n레몬즙을 섞어 복분자소스를 만든다.','MANUAL04'),(100,'5. 접시에 퀴노아를 두른 후\n닭가슴살과 감자, 가지, 양파, 피망,\n아스파라거스를 올리면서 중간\n중간에 토마토와 수박,\n리코타치즈를 넣는다.','MANUAL05'),(100,'6. 맨 위에 퀴노아를 살짝 올려주고\n양상추, 플레인 요구르트,\n어린잎채소를 얹어 마무리한다.','MANUAL06'),(100,'','MANUAL07'),(100,'','MANUAL08'),(100,'','MANUAL09'),(100,'','MANUAL10'),(100,'','MANUAL11'),(100,'','MANUAL12'),(100,'','MANUAL13'),(100,'','MANUAL14'),(100,'','MANUAL15'),(100,'','MANUAL16'),(100,'','MANUAL17'),(100,'','MANUAL18'),(100,'','MANUAL19'),(100,'','MANUAL20'),(101,'1. 바나나를 반으로 잘라 반은 편 썰고\n반은 으깨고, 아보카도는 껍질과\n씨를 제거 한 후 ⅓은 편 썰고\n⅔는 으깬다.','MANUAL01'),(101,'2. 토마토는 끓는 물에 데쳐 껍질을\n제거하고 얇게 썬다.','MANUAL02'),(101,'3. 베이컨 2장은 채 썰고,\n1장은 구운 뒤 비슷한 크기로\n채 썬다.','MANUAL03'),(101,'4. 베이컨을 구운 기름에 편 썬 바나나,\n아보카도, 토마토를 넣고 바질가루를\n뿌려 굽는다.','MANUAL04'),(101,'5. 팬에 채 썬 베이컨과 다진 마늘,\n다진 양파를 볶은 후 휘핑크림,\n저염치즈를 넣고 볶다가 으깬\n아보카도, 바나나, 우유를 넣어\n농도를 맞추고 소금으로 간해\n바나나크림을 만든다.','MANUAL05'),(101,'6. 접시에 구운 바나나, 아보카도,\n토마토를 깔고 삶은 스파게티면을\n담은 후 바나나크림을 뿌리고\n베이컨을 올려 장식해 마무리한다.','MANUAL06'),(101,'','MANUAL07'),(101,'','MANUAL08'),(101,'','MANUAL09'),(101,'','MANUAL10'),(101,'','MANUAL11'),(101,'','MANUAL12'),(101,'','MANUAL13'),(101,'','MANUAL14'),(101,'','MANUAL15'),(101,'','MANUAL16'),(101,'','MANUAL17'),(101,'','MANUAL18'),(101,'','MANUAL19'),(101,'','MANUAL20'),(102,'1. 신선초, 참나물, 취나물, 적겨자는\n먹기 좋은 크기로 뜯고,\n깻잎은 한입 크기로 썬다.','MANUAL01'),(102,'2. 양파(8g)는 채 썰고, 파스타소스에\n들어갈 양파(15g)는 굵게 다지고,\n애호박도 양파와 비슷한 크기로\n굵게 다진다.','MANUAL02'),(102,'3. 오이는 돌려 깎은 뒤 채 썰고,\n고추도 얇게 채 썬다.','MANUAL03'),(102,'4. 끓는 물에 쌀파스타면을 넣고 5분간\n삶아 익힌 뒤 찬물에 헹궈 물기를\n뺀다.','MANUAL04'),(102,'5. 팬에 물(60g)을 붓고 물이 끓으면\n된장, 청국장, 다진 양파, 애호박,\n으깬 두부, 다진 마늘을 넣고\n1분 30초 정도 졸여 파스타소스를\n만든다.','MANUAL05'),(102,'6. 쌀파스타면 위에 소스를 얹은 뒤\n채소를 올리고 들기름을 뿌려\n마무리한다.','MANUAL06'),(102,'','MANUAL07'),(102,'','MANUAL08'),(102,'','MANUAL09'),(102,'','MANUAL10'),(102,'','MANUAL11'),(102,'','MANUAL12'),(102,'','MANUAL13'),(102,'','MANUAL14'),(102,'','MANUAL15'),(102,'','MANUAL16'),(102,'','MANUAL17'),(102,'','MANUAL18'),(102,'','MANUAL19'),(102,'','MANUAL20'),(103,'1. 감자는 한입 크기로 썰고, 양파와\n당근, 대파는 길게 채 썰고,\n청양고추는 다지고, 팽이버섯은\n깨끗이 씻어 준비한다.','MANUAL01'),(103,'2. 달걀은 노른자와 흰자를 분리해\n지단을 부쳐 채 썬다.','MANUAL02'),(103,'3. 당면은 찬물에 2시간 정도 불린다.','MANUAL03'),(103,'4. 물(300g)에 멸치를 넣어 육수를\n만든 후, 황태포를 넣어 다시\n한 번 진하게 육수를 우려낸다.','MANUAL04'),(103,'5. 육수에 감자, 당근, 양파, 당면을\n순서대로 넣고 끓인 후 불을 끄고\n팽이버섯을 얹어 잔열로 익힌다.','MANUAL05'),(103,'6. 다진 마늘, 청양고추, 저염간장, 소금,\n후춧가루를 넣어 간을 한 뒤 지단,\n쑥갓, 대파를 얹어 마무리한다.','MANUAL06'),(103,'','MANUAL07'),(103,'','MANUAL08'),(103,'','MANUAL09'),(103,'','MANUAL10'),(103,'','MANUAL11'),(103,'','MANUAL12'),(103,'','MANUAL13'),(103,'','MANUAL14'),(103,'','MANUAL15'),(103,'','MANUAL16'),(103,'','MANUAL17'),(103,'','MANUAL18'),(103,'','MANUAL19'),(103,'','MANUAL20'),(104,'1. 마늘 5g은 다지고, 나머지 마늘(15g)은\n편 썰어 노릇하게 튀긴다.','MANUAL01'),(104,'2. 깻잎은 채 썰고, 쪽파는 송송 썰고,\n파프리카는 주사위 모양으로 썰고,\n양파와 대파는 채 썰고,\n방울토마토는 반을 갈라 준비한다.','MANUAL02'),(104,'3. 닭가슴살은 어슷하게 납작 썰어\n이태리시즈닝에 재운 뒤 팬에 구워\n준비한다.','MANUAL03'),(104,'4. 다진 마늘, 양파, 대파를 팬에 넣고\n향을 내다 파프리카와 방울토마토,\n양념을 넣고 볶은 뒤 한 김 식혀\n믹서에 곱게 갈아 소스를 만든다.','MANUAL04'),(104,'5. 팬에 소스와 구운 닭가슴살을 넣어\n볶다가 삶은 라면을 넣고 재빠르게\n볶는다.','MANUAL05'),(104,'6. 튀긴 마늘과 깻잎, 쪽파를 올려\n마무리한다.','MANUAL06'),(104,'','MANUAL07'),(104,'','MANUAL08'),(104,'','MANUAL09'),(104,'','MANUAL10'),(104,'','MANUAL11'),(104,'','MANUAL12'),(104,'','MANUAL13'),(104,'','MANUAL14'),(104,'','MANUAL15'),(104,'','MANUAL16'),(104,'','MANUAL17'),(104,'','MANUAL18'),(104,'','MANUAL19'),(104,'','MANUAL20'),(105,'1. 양파와 청경채, 파프라카는 채 썰고,\n쪽파는 송송 썬다.','MANUAL01'),(105,'2. 라면은 삶아서 체에 밭쳐 물기를\n제거한다.','MANUAL02'),(105,'3. 팬에 식용유(5g)를 두르고 다진\n마늘을 볶아 향을 낸 뒤 돼지고기를\n볶는다.','MANUAL03'),(105,'4. 채 썬 양파와 청경채, 파프리카를\n함께 넣고 볶다가 고추기름, 설탕,\n두반장, 라면스프로 간을 해\n볶는다.','MANUAL04'),(105,'5. 면을 함께 볶은 후 송송 썬 쪽파를\n뿌려 마무리한다.','MANUAL05'),(105,'','MANUAL06'),(105,'','MANUAL07'),(105,'','MANUAL08'),(105,'','MANUAL09'),(105,'','MANUAL10'),(105,'','MANUAL11'),(105,'','MANUAL12'),(105,'','MANUAL13'),(105,'','MANUAL14'),(105,'','MANUAL15'),(105,'','MANUAL16'),(105,'','MANUAL17'),(105,'','MANUAL18'),(105,'','MANUAL19'),(105,'','MANUAL20'),(106,'1. 새우, 조개, 홍합은 손질한다.','MANUAL01'),(106,'2. 버섯은 먹기 좋은 크기로 썰고,\n양파는 채 썰고, 토마토는 씨를\n제거해 다진다.','MANUAL02'),(106,'3. 라면은 끓는 물에 데친 뒤 체에 밭쳐\n물기를 제거한다.','MANUAL03'),(106,'4. 냄비에 식용유(10g)를 두른 뒤\n새우와 조개, 홍합을 넣어 살짝 볶아\n건진다.','MANUAL04'),(106,'5. 같은 냄비에 토마토, 우유, 생크림을\n넣은 뒤 월계수잎과 정향을 넣고\n끓인다.','MANUAL05'),(106,'6. 끓으면 데친 라면, 새송이버섯, 홍합,\n새우, 조개, 양파를 넣고 끓여 다\n익으면 파르메산 치즈가루를\n뿌린 후 그 위에 파슬리가루를 뿌려\n마무리한다.','MANUAL06'),(106,'','MANUAL07'),(106,'','MANUAL08'),(106,'','MANUAL09'),(106,'','MANUAL10'),(106,'','MANUAL11'),(106,'','MANUAL12'),(106,'','MANUAL13'),(106,'','MANUAL14'),(106,'','MANUAL15'),(106,'','MANUAL16'),(106,'','MANUAL17'),(106,'','MANUAL18'),(106,'','MANUAL19'),(106,'','MANUAL20'),(107,'1. 라면을 살짝 익힌다.','MANUAL01'),(107,'2. 배와 파인애플을 한입 크기로\n썰고, 파프리카는 깍둑 썬다.','MANUAL02'),(107,'3. 팬에 쇠고기 양념장과 파인애플을\n넣어 끓이다가 채 썬 쇠고기를\n넣는다.','MANUAL03'),(107,'4. 레드와인을 넣고 알코올을 날린 뒤\n매실청을 넣고 조린다.','MANUAL04'),(107,'5. 라면과 파프리카, 배를 섞은 후\n라이스페이퍼에 올려 만다.','MANUAL05'),(107,'6. 달걀물을 묻힌 후 빵가루를 입혀\n튀긴 뒤 그릇에 어린잎채소와 함께\n담아 조린 쇠고기를 곁들여 마무리\n한다.','MANUAL06'),(107,'','MANUAL07'),(107,'','MANUAL08'),(107,'','MANUAL09'),(107,'','MANUAL10'),(107,'','MANUAL11'),(107,'','MANUAL12'),(107,'','MANUAL13'),(107,'','MANUAL14'),(107,'','MANUAL15'),(107,'','MANUAL16'),(107,'','MANUAL17'),(107,'','MANUAL18'),(107,'','MANUAL19'),(107,'','MANUAL20'),(108,'1. 돼지고기를 차가운 물로 헹구고\n냄비에 물(300g), 대파, 생강과 같이\n넣고 끓여 돼지고기가 익으면\n면포에 거른다.','MANUAL01'),(108,'2. 냄비에 물(300g)을 넣어 끓으면\n가다랑어포를 넣고 1분간 끓이고\n불을 꺼 가다랑어포가 가라앉으면\n면포에 거르고, 다시 물(300g)을\n넣어 면포에 걸러낸 가다랑어포를\n넣어 약한 불로 10분간 끓인 뒤\n가다랑어포가 가라앉으면 면포에\n거른다.','MANUAL02'),(108,'3. 돼지고기 육수와 가다랑어포 육수를\n섞은 뒤 200g을 따로 덜어\n조림양념을 넣고 끓이다가\n돼지고기를 넣고 조린다.','MANUAL03'),(108,'4. 라면은 삶아 찬물에 헹궈 건지고,\n쪽파는 송송 썬다.','MANUAL04'),(108,'5. 육수를 뜨겁게 끓인 뒤 그릇에\n라면사리와 함께 담고,\n돼지고기조림, 쪽파를 올리고 팬에\n남은 조림 소스를 끼얹어 마무리한다.','MANUAL05'),(108,'','MANUAL06'),(108,'','MANUAL07'),(108,'','MANUAL08'),(108,'','MANUAL09'),(108,'','MANUAL10'),(108,'','MANUAL11'),(108,'','MANUAL12'),(108,'','MANUAL13'),(108,'','MANUAL14'),(108,'','MANUAL15'),(108,'','MANUAL16'),(108,'','MANUAL17'),(108,'','MANUAL18'),(108,'','MANUAL19'),(108,'','MANUAL20'),(109,'1. 끓는 물(600g)에 라면을 넣어\n데친다.','MANUAL01'),(109,'2. 면은 찬물에 헹궈 물기를 뺀다.','MANUAL02'),(109,'3. 양상추, 케일, 파프리카는 얇게 채\n썰고, 비타민은 먹기 좋은 크기로\n자른다.','MANUAL03'),(109,'4. 유자드레싱을 고루 섞은 뒤 라면,\n채소를 버무려 마무리한다.','MANUAL04'),(109,'','MANUAL05'),(109,'','MANUAL06'),(109,'','MANUAL07'),(109,'','MANUAL08'),(109,'','MANUAL09'),(109,'','MANUAL10'),(109,'','MANUAL11'),(109,'','MANUAL12'),(109,'','MANUAL13'),(109,'','MANUAL14'),(109,'','MANUAL15'),(109,'','MANUAL16'),(109,'','MANUAL17'),(109,'','MANUAL18'),(109,'','MANUAL19'),(109,'','MANUAL20'),(110,'1. 주꾸미를 몸과 다리를 분리 후 잘 씻어준다.','MANUAL01'),(110,'2. 주꾸미 다리, 미나리, 양파, 당근을 다져준다.','MANUAL02'),(110,'3. 다진 채소를 계란, 다진마늘, 생강청에 양념\n한다.','MANUAL03'),(110,'4. 양념한 3을 주꾸미 머리 속에 넣어주고\n이쑤시개로 꽂아준다.','MANUAL04'),(110,'5. 찜기에 찐다. 찔 때 레몬즙을 뿌리면 더욱\n탱탱하다.','MANUAL05'),(110,'6. 소스를 만든 뒤 주꾸미를 함께 완성한다.','MANUAL06'),(110,'','MANUAL07'),(110,'','MANUAL08'),(110,'','MANUAL09'),(110,'','MANUAL10'),(110,'','MANUAL11'),(110,'','MANUAL12'),(110,'','MANUAL13'),(110,'','MANUAL14'),(110,'','MANUAL15'),(110,'','MANUAL16'),(110,'','MANUAL17'),(110,'','MANUAL18'),(110,'','MANUAL19'),(110,'','MANUAL20'),(111,'1. 무는 모양 틀로 자른다.','MANUAL01'),(111,'2. 무와 연근을 손질해 놓은 후 소금에 살짝\n절여준다.','MANUAL02'),(111,'3. 사과와 배는 먹기 좋게 잘라 레몬즙에 뿌려\n갈변을 막아준다.','MANUAL03'),(111,'4. 물에 청양고추를 넣어 끓여서 식힌다.','MANUAL04'),(111,'5. 식힌 물에 국물 재료를 넣어 국물을 만든다.','MANUAL05'),(111,'6. 만들어진 국물에 절여진 무, 연근, 사과, 배를\n넣어주어 완성한다. 24시간 이후부터 시원하게\n먹는다.','MANUAL06'),(111,'','MANUAL07'),(111,'','MANUAL08'),(111,'','MANUAL09'),(111,'','MANUAL10'),(111,'','MANUAL11'),(111,'','MANUAL12'),(111,'','MANUAL13'),(111,'','MANUAL14'),(111,'','MANUAL15'),(111,'','MANUAL16'),(111,'','MANUAL17'),(111,'','MANUAL18'),(111,'','MANUAL19'),(111,'','MANUAL20'),(112,'1. 다진마늘을 버터에 충분히 볶아준다.','MANUAL01'),(112,'2. 화이트와인을 뿌려주고 소스재료로 소스를\n만들어준다.','MANUAL02'),(112,'3. 찜기에 살짝 져 준다. 이때 80% 정도까지만\n익혀준다.','MANUAL03'),(112,'4. 쪄준 조기는 와인과 후추로 밑간을 해준 후\n전분을 발라준다.','MANUAL04'),(112,'5. 전분를 바른 조기에 허브크러스트를 두툼하게\n올려준다.','MANUAL05'),(112,'6. 팬에 기름을 두르고 조기를 한쪽부터 구운 뒤,\n뒤집어서 다시 구워주고 소스를 뿌려 완성한다.','MANUAL06'),(112,'','MANUAL07'),(112,'','MANUAL08'),(112,'','MANUAL09'),(112,'','MANUAL10'),(112,'','MANUAL11'),(112,'','MANUAL12'),(112,'','MANUAL13'),(112,'','MANUAL14'),(112,'','MANUAL15'),(112,'','MANUAL16'),(112,'','MANUAL17'),(112,'','MANUAL18'),(112,'','MANUAL19'),(112,'','MANUAL20'),(113,'1. 무, 청고추, 미나리, 대파는 먹기 좋게 썰어준다.','MANUAL01'),(113,'2. 돼지머리는 냉수에 데친다. 냉수일 때부터\n돼지머리를 넣어야 물이 끓어오르면 불순물이\n제거된다.','MANUAL02'),(113,'3. 일본 된장을 풀어 체에 걸러준다.','MANUAL03'),(113,'4. 돼지머리를 살짝 졸여준다.','MANUAL04'),(113,'5. 냄비에 국물을 끓여주다가 채소를 넣어 끓인다.','MANUAL05'),(113,'6. 국물에 우동면을 데쳐낸 뒤 완성한다.','MANUAL06'),(113,'','MANUAL07'),(113,'','MANUAL08'),(113,'','MANUAL09'),(113,'','MANUAL10'),(113,'','MANUAL11'),(113,'','MANUAL12'),(113,'','MANUAL13'),(113,'','MANUAL14'),(113,'','MANUAL15'),(113,'','MANUAL16'),(113,'','MANUAL17'),(113,'','MANUAL18'),(113,'','MANUAL19'),(113,'','MANUAL20'),(114,'1. 양파, 2가지색 파프리카, 청고추는 작은 깍두기\n모양으로 잘라준다.','MANUAL01'),(114,'2. 파인애플도 먹기 좋게 썰어준 뒤 레몬소금을\n살짝 뿌려준다.','MANUAL02'),(114,'3. 계란은 풀어서 팬에 스크램블을 만들어준다.','MANUAL03'),(114,'4. 마늘을 다진 후 마늘기름으로 칵테일 새우를\n볶아준다.','MANUAL04'),(114,'5. 볶아진 칵테일새우에 잘라준 채소를 넣어\n다시 볶아준다.','MANUAL05'),(114,'6. 여기에 밥을 넣어서 볶아주고 파인애플과\n맛간장, 통깨를 넣어서 볶아준다.','MANUAL06'),(114,'','MANUAL07'),(114,'','MANUAL08'),(114,'','MANUAL09'),(114,'','MANUAL10'),(114,'','MANUAL11'),(114,'','MANUAL12'),(114,'','MANUAL13'),(114,'','MANUAL14'),(114,'','MANUAL15'),(114,'','MANUAL16'),(114,'','MANUAL17'),(114,'','MANUAL18'),(114,'','MANUAL19'),(114,'','MANUAL20'),(115,'1. 양파는 채 썰어 물에 담가주고, 오이는 돌려\n깎기 해서 물에 담가준다.','MANUAL01'),(115,'2. 연근은 껍질을 까고 얇게 썰어서 식초 2방울을\n넣은 물에 데쳐준다.','MANUAL02'),(115,'3. 밤도 아주 얇게 썰어서 물에 담가준다.','MANUAL03'),(115,'4. 소스 재료를 모두 넣고 믹서에 간다.','MANUAL04'),(115,'5. 물에 데쳐낸 연근은 키친타월에 올려서 물기를\n완전히 제거한다.','MANUAL05'),(115,'6. 모든 재료를 넣고 소스에 버무려준다.','MANUAL06'),(115,'','MANUAL07'),(115,'','MANUAL08'),(115,'','MANUAL09'),(115,'','MANUAL10'),(115,'','MANUAL11'),(115,'','MANUAL12'),(115,'','MANUAL13'),(115,'','MANUAL14'),(115,'','MANUAL15'),(115,'','MANUAL16'),(115,'','MANUAL17'),(115,'','MANUAL18'),(115,'','MANUAL19'),(115,'','MANUAL20'),(116,'1. 코다리는 어간장, 청주, 흰후추, 생강청에\n살짝 재워준다.','MANUAL01'),(116,'2. 함초는 손질해 잘라준다.','MANUAL02'),(116,'3. 무는 소금에 살짝 절여서 수분과 염분을\n제거해준다.','MANUAL03'),(116,'4. 무와 함초를 고루 섞어준다.','MANUAL04'),(116,'5. 미나리와 콩나물은 손질해준 후 찜기에 깔고\n코다리를 쪄준다.','MANUAL05'),(116,'6. 소스를 만든 뒤 채소를 깔고 코다리를 올리고\n미나리, 콩나물을 올려 완성한다.','MANUAL06'),(116,'','MANUAL07'),(116,'','MANUAL08'),(116,'','MANUAL09'),(116,'','MANUAL10'),(116,'','MANUAL11'),(116,'','MANUAL12'),(116,'','MANUAL13'),(116,'','MANUAL14'),(116,'','MANUAL15'),(116,'','MANUAL16'),(116,'','MANUAL17'),(116,'','MANUAL18'),(116,'','MANUAL19'),(116,'','MANUAL20'),(117,'1. 두부는 물기를 꼭 짠 뒤 으깨어 전분, 계란과\n섞어준다.','MANUAL01'),(117,'2. 우엉, 인삼, 감자는 아주 곱게 채 썰어서 냉수에\n담가준다.','MANUAL02'),(117,'3. 볶아진 모든 채소를 각각 볶아서 한데 섞어\n준다.','MANUAL03'),(117,'4. 땅콩잼으로 소스를 만들어준다.','MANUAL04'),(117,'5. 김발을 깔고 비닐을 놓아 준 후 두부를 펴준다.','MANUAL05'),(117,'6. 볶아진 채소를 두부에 넣어주고 찜기에 쪄서\n식힌 뒤 한입 크기로 잘라준다.','MANUAL06'),(117,'','MANUAL07'),(117,'','MANUAL08'),(117,'','MANUAL09'),(117,'','MANUAL10'),(117,'','MANUAL11'),(117,'','MANUAL12'),(117,'','MANUAL13'),(117,'','MANUAL14'),(117,'','MANUAL15'),(117,'','MANUAL16'),(117,'','MANUAL17'),(117,'','MANUAL18'),(117,'','MANUAL19'),(117,'','MANUAL20'),(118,'1. 사과는 8조각으로 잘라 씨를 제거한다.','MANUAL01'),(118,'2. 청고추, 홍고추는 어슷하게 잘라준다.','MANUAL02'),(118,'3. 양파도 먹기 좋은 크기로 잘라준다.','MANUAL03'),(118,'4. 사과는 식초 물에 살짝 절여준다.','MANUAL04'),(118,'5. 양념장을 만든다.','MANUAL05'),(118,'6. 양념장에 준비된 재료를 모두 섞어 완성한다.','MANUAL06'),(118,'','MANUAL07'),(118,'','MANUAL08'),(118,'','MANUAL09'),(118,'','MANUAL10'),(118,'','MANUAL11'),(118,'','MANUAL12'),(118,'','MANUAL13'),(118,'','MANUAL14'),(118,'','MANUAL15'),(118,'','MANUAL16'),(118,'','MANUAL17'),(118,'','MANUAL18'),(118,'','MANUAL19'),(118,'','MANUAL20'),(119,'1. 주꾸미, 전복, 칵테일새우는 각각 물에 데쳐서\n준비한다.','MANUAL01'),(119,'2. 이때 데치고 남은 물을 국물에 이용해주고\n여기에 청주를 넣어준다.','MANUAL02'),(119,'3. 양파, 청고추, 홍고추는 먹기좋게 썰어준다.','MANUAL03'),(119,'4. 계란을 황백으로 부쳐서 먹기좋게 썰어준다.','MANUAL04'),(119,'5. 만들어진 국물에 거피한 들깨가루와 국물재료를\n넣어 끓여서 준비한다.','MANUAL05'),(119,'6. 준비된 재료를 냄비에 넣고 국물을 부어 끓여\n완성한다.','MANUAL06'),(119,'','MANUAL07'),(119,'','MANUAL08'),(119,'','MANUAL09'),(119,'','MANUAL10'),(119,'','MANUAL11'),(119,'','MANUAL12'),(119,'','MANUAL13'),(119,'','MANUAL14'),(119,'','MANUAL15'),(119,'','MANUAL16'),(119,'','MANUAL17'),(119,'','MANUAL18'),(119,'','MANUAL19'),(119,'','MANUAL20'),(120,'1. 참외는 껍질을 벗기고 반으로 잘라 속을\n파 준 후 먹기 좋게 잘라준다.','MANUAL01'),(120,'2. 청고추, 홍고추는 송송 잘라준다.','MANUAL02'),(120,'3. 양파와 미나리는 참외크기로 자르고, 대파는\n송송 자른다.','MANUAL03'),(120,'4. 참외, 양파를 저염 간장에 살짝 절여준다.','MANUAL04'),(120,'5. 절여진 채소에 고춧가루로 먼저 색을 입힌다.','MANUAL05'),(120,'6. 나머지 재료를 넣고 김치를 만든다.','MANUAL06'),(120,'','MANUAL07'),(120,'','MANUAL08'),(120,'','MANUAL09'),(120,'','MANUAL10'),(120,'','MANUAL11'),(120,'','MANUAL12'),(120,'','MANUAL13'),(120,'','MANUAL14'),(120,'','MANUAL15'),(120,'','MANUAL16'),(120,'','MANUAL17'),(120,'','MANUAL18'),(120,'','MANUAL19'),(120,'','MANUAL20'),(121,'1. 연어는 얇게 모양을 살려 슬라이스 한 후\n정종에 소금을 섞어 분무기에 넣어 냉장고에\n넣어둔다.','MANUAL01'),(121,'2. 건조된 방울토마토는 올리브오일과 후추로\n양념하여 사용한다.','MANUAL02'),(121,'3. 양상추는 먹기 좋은 크기로 뜯어 어린잎과\n함께 찬물에 담가 물기를 제거한 후 사용한다.','MANUAL03'),(121,'4. 유자청과 감식초는 함께 섞어 믹서에 갈아\n드레싱소스를 완성한다.','MANUAL04'),(121,'5. 양파는 모양을 살려 얇게 슬라이스 하여\n찬물에 담가 물기를 제거한 뒤 사용한다.','MANUAL05'),(121,'6. 샐러드 접시에 준비된 모든 채소를 담고,\n연어는 장미 모양으로 접어서 보기좋게 담아\n드레싱 소스를 곁들여 완성한다.','MANUAL06'),(121,'','MANUAL07'),(121,'','MANUAL08'),(121,'','MANUAL09'),(121,'','MANUAL10'),(121,'','MANUAL11'),(121,'','MANUAL12'),(121,'','MANUAL13'),(121,'','MANUAL14'),(121,'','MANUAL15'),(121,'','MANUAL16'),(121,'','MANUAL17'),(121,'','MANUAL18'),(121,'','MANUAL19'),(121,'','MANUAL20'),(122,'1. 콜라비는 껍질을 벗긴 후 저염간장에 30분\n정도 절여준다.','MANUAL01'),(122,'2. 우렁은 뜨거운 물에 데친 후 행군 뒤 물기를\n빼준다.','MANUAL02'),(122,'3. 미나리는 먹기 좋은 크기로 잘라준다.','MANUAL03'),(122,'4. 다진대파, 청홍고추, 양파는 송송 잘라준다.','MANUAL04'),(122,'5. 양념장에 콜라비부터 버무린 뒤 모든 재료를\n섞어서 완성한다.','MANUAL05'),(122,'','MANUAL06'),(122,'','MANUAL07'),(122,'','MANUAL08'),(122,'','MANUAL09'),(122,'','MANUAL10'),(122,'','MANUAL11'),(122,'','MANUAL12'),(122,'','MANUAL13'),(122,'','MANUAL14'),(122,'','MANUAL15'),(122,'','MANUAL16'),(122,'','MANUAL17'),(122,'','MANUAL18'),(122,'','MANUAL19'),(122,'','MANUAL20'),(123,'1. 코다리는 먹기 좋게 잘라서 물에 헹궈 물기를\n빼준다.','MANUAL01'),(123,'2. 감자와 무, 백일송이버섯, 미나리는 먹기 좋게\n썰어준다.','MANUAL02'),(123,'3. 양파, 청양고추도 먹기 좋게 썰어준다.','MANUAL03'),(123,'4. 냄비에 참기름을 넣어 코다리를 살짝 볶아준다.','MANUAL04'),(123,'5. 코다리를 볶은 냄비에 무, 감자, 국물 재료를\n넣고 충분히 끓인다.','MANUAL05'),(123,'6. 끓고 있는 국에 양파, 청양고추, 백일송이\n버섯을 올려 완성한다.','MANUAL06'),(123,'','MANUAL07'),(123,'','MANUAL08'),(123,'','MANUAL09'),(123,'','MANUAL10'),(123,'','MANUAL11'),(123,'','MANUAL12'),(123,'','MANUAL13'),(123,'','MANUAL14'),(123,'','MANUAL15'),(123,'','MANUAL16'),(123,'','MANUAL17'),(123,'','MANUAL18'),(123,'','MANUAL19'),(123,'','MANUAL20'),(124,'1. 연두부는 동글게 썰어 준비한다.','MANUAL01'),(124,'2. 호박은 갈라 씨를 제거 하고 껍질을\n벗겨 쪄서 작은 깍둑썰기로 썰어 준비\n한다.','MANUAL02'),(124,'3. 바나나와 파프리카 토마토는 호박과\n같은 크기의 작은 깍두기로 썰어 놓는다.','MANUAL03'),(124,'4. 닭고기살은 통후추를 넣고 약 20분 정도\n삶아 건져 작은 깍두기로 썰어 준비한다.','MANUAL04'),(124,'5. 마와 잣, 흑임자를 갈아 놓은 뒤 생크림,\n요거트, 식초, 올리브오일, 설탕을\n섞어 샐러드 소스를 만들어 놓는다.','MANUAL05'),(124,'6. 썰어 놓은 연두부 위에 호박 , 닭고기,\n토마토, 파프리카를 각각 올린 뒤 어린\n잎을 올리고 소스를 뿌려 완성한다.','MANUAL06'),(124,'','MANUAL07'),(124,'','MANUAL08'),(124,'','MANUAL09'),(124,'','MANUAL10'),(124,'','MANUAL11'),(124,'','MANUAL12'),(124,'','MANUAL13'),(124,'','MANUAL14'),(124,'','MANUAL15'),(124,'','MANUAL16'),(124,'','MANUAL17'),(124,'','MANUAL18'),(124,'','MANUAL19'),(124,'','MANUAL20'),(125,'1. 애호박은 반달 모양으로 썰어 준다.','MANUAL01'),(125,'2. 썰어 놓은 호박에 소금을 넣고 살짝\n절여 물기를 제거하고 준비한다.','MANUAL02'),(125,'3. 양파는 채를 썰고, 대파는 1/4로 자르고,\n홍고추는 어슷썰어 자연스럽게 씨를\n제거해 놓는다.','MANUAL03'),(125,'4. 팬에 들기름을 넣고, 마늘을 먼저\n볶는다.','MANUAL04'),(125,'5. 볶아진 팬에 건새우를 넣어 볶아준다.','MANUAL05'),(125,'6. 건새우가 볶아지면, 썰어 놓은 호박을\n넣어 볶다가 양파와 대파를 넣어\n볶으면서 들깨 가루와 넣어 살짝\n볶으면서 마지막에 썰어 놓은 홍고추를\n넣어 한 번만 더 볶아 완성한다.','MANUAL06'),(125,'','MANUAL07'),(125,'','MANUAL08'),(125,'','MANUAL09'),(125,'','MANUAL10'),(125,'','MANUAL11'),(125,'','MANUAL12'),(125,'','MANUAL13'),(125,'','MANUAL14'),(125,'','MANUAL15'),(125,'','MANUAL16'),(125,'','MANUAL17'),(125,'','MANUAL18'),(125,'','MANUAL19'),(125,'','MANUAL20'),(126,'1. 고구마는 찜통에 약 20분 정도 쪄서\n껍질을 벗겨 준비한다.','MANUAL01'),(126,'2. 뜨거운 고구마가 한김 빠지면, 곱게\n으깨 놓는다.','MANUAL02'),(126,'3. 으깨진 고구마에 바나나를 썰어\n요거트와 함께 넣는다.','MANUAL03'),(126,'4. 3번에 다시 연유를 넣어 골고루 섞는다.','MANUAL04'),(126,'5. 잣은 종이를 깔고 곱게 다져 준비한다.','MANUAL05'),(126,'6. 어린잎은 물에 담그어, 건져 물기를\n제거해 놓고, 으깬 고구마에 다진 잣을\n넣어 샐러드를 완성한다.','MANUAL06'),(126,'','MANUAL07'),(126,'','MANUAL08'),(126,'','MANUAL09'),(126,'','MANUAL10'),(126,'','MANUAL11'),(126,'','MANUAL12'),(126,'','MANUAL13'),(126,'','MANUAL14'),(126,'','MANUAL15'),(126,'','MANUAL16'),(126,'','MANUAL17'),(126,'','MANUAL18'),(126,'','MANUAL19'),(126,'','MANUAL20'),(127,'1. 새우는 껍질을 제거하고 소금과\n후춧가루를 넣어 밑간을 해놓는다.','MANUAL01'),(127,'2. 어린잎은 찬물에 담그어 놓는다.','MANUAL02'),(127,'3. 튀김가루에 달걀을 넣어 잘 섞어\n튀김반죽을 만들어 놓는다.','MANUAL03'),(127,'4. 밑간을 해 놓은 새우를 튀김반죽에\n넣어 옷을 입힌다.','MANUAL04'),(127,'5. 누룽지는 170℃의 온도 튀김 기름에\n튀겨내고, 튀김옷 입힌 새우도 튀겨낸다.','MANUAL05'),(127,'6. 냄비에 오렌지주스와 설탕, 식초를\n넣어 은근히 졸여 소스를 만들고,\n어린잎은 찬물에 건져 물기를 제거하고\n접시에 깔고 튀긴 누룽지와 튀긴 새우를\n올려 완성한다.','MANUAL06'),(127,'','MANUAL07'),(127,'','MANUAL08'),(127,'','MANUAL09'),(127,'','MANUAL10'),(127,'','MANUAL11'),(127,'','MANUAL12'),(127,'','MANUAL13'),(127,'','MANUAL14'),(127,'','MANUAL15'),(127,'','MANUAL16'),(127,'','MANUAL17'),(127,'','MANUAL18'),(127,'','MANUAL19'),(127,'','MANUAL20'),(128,'1. 백김치는 살짝 씻어 물기를 제거하고\n잘게 썰어 준비한다.','MANUAL01'),(128,'2. 양파와 마늘은 다지고 파는 채를 썰어\n놓는다.','MANUAL02'),(128,'3. 어린잎은 찬 물에 담그어 놓았다가,\n다시 소창에 건져 물기를 빼 놓는다.','MANUAL03'),(128,'4. 냄비에 물을 넣고, 양파와 파를 넣어\n끓이다가 준비한 쭈구미를 넣고\n부드럽게 데쳐 썰어 놓는다.','MANUAL04'),(128,'5. 식초와 간장, 설탕, 꿀, 레몬, 다진양파,\n다진마늘을 넣고 잘 섞어서 샐러드\n드레싱을 만든다.','MANUAL05'),(128,'6. 준비한 백김치(①)와 주꾸미(②)를\n섞은 후 양상추를 접시에 깔고, 그 위에\n섞어놓은 백김치와 주꾸미를 올리고,\n홍고추와 어린잎을 위에 장식으로 올린\n후 샐러드 소스를 뿌려 완성한다.','MANUAL06'),(128,'','MANUAL07'),(128,'','MANUAL08'),(128,'','MANUAL09'),(128,'','MANUAL10'),(128,'','MANUAL11'),(128,'','MANUAL12'),(128,'','MANUAL13'),(128,'','MANUAL14'),(128,'','MANUAL15'),(128,'','MANUAL16'),(128,'','MANUAL17'),(128,'','MANUAL18'),(128,'','MANUAL19'),(128,'','MANUAL20'),(129,'1. 닭고기살에 로즈마리를 뿌려 약 3시간\n이상 숙성을 시킨다.','MANUAL01'),(129,'2. 냄비에 물을 1/3쯤 넣고, 양파채를 썰어\n넣어 끓으면, 숙성된 닭고기살을 넣고\n약 20분 정도 삶아 건진다.','MANUAL02'),(129,'3. 삶아 건진 닭고기살을 한 김 빼고, 길게\n손으로 찢어 소금과 후춧가루에 살짝\n무치고, 오이와 파프리카는 씨를 제거\n하고 채를 썰고, 당근도 오이채의 길이에\n맞게 채를 썰어 준비해 놓는다.','MANUAL03'),(129,'4. 마늘을 다지고, 고춧가루와 설탕, 식초,\n레몬즙을 넣어 소스를 만든다.','MANUAL04'),(129,'5. 뜨거운 물에 라이스페이퍼를 살짝 넣어\n바로 건진다.','MANUAL05'),(129,'6. 건져 놓은 라이스페이퍼에 준비한\n닭고기살과 파프리카, 오이, 당근 넣고\n돌돌 말아, 녹말가루를 살짝 입혀, 팬에\n굴리듯 익혀 완성하고, 준비해 놓은\n소스와 함께 제공한다.','MANUAL06'),(129,'','MANUAL07'),(129,'','MANUAL08'),(129,'','MANUAL09'),(129,'','MANUAL10'),(129,'','MANUAL11'),(129,'','MANUAL12'),(129,'','MANUAL13'),(129,'','MANUAL14'),(129,'','MANUAL15'),(129,'','MANUAL16'),(129,'','MANUAL17'),(129,'','MANUAL18'),(129,'','MANUAL19'),(129,'','MANUAL20'),(130,'1. 닭고기살은 천일염과 후춧가루를 뿌려\n마리네이드를 해놓는다.','MANUAL01'),(130,'2. 양배추와 부추는 김이 오른 찜통에\n쪄서 식혀 놓는다.','MANUAL02'),(130,'3. 깻잎은 채를 썰고, 파프리카는 속을 제거\n하고 5cm 길이로 채를 썰고, 당근과\n양파도 같은 길이로 채를 썰어 놓는다.','MANUAL03'),(130,'4. 마리네이드를 해 놓은 닭고기살은 팬에\n기름을 두르고, 팬이 따끈해지면 앞뒤를\n돌려가며 정종을 살살 뿌려 닭고기살을\n굽고, 닭고기살이 익으면 살을 찢어 준비\n한다.','MANUAL04'),(130,'5. 요거트와 머스터드, 꿀 ,레몬즙, 설탕을\n넣고 고루 섞어 소스를 만들어 놓는다.','MANUAL05'),(130,'6. 쪄 놓은 양배추에 준비한 채소(③)와\n닭고기살(④)을 넣고, 돌돌 말아 쪄\n놓은 부추로 양배추를 묶어 완성하고,\n만들어 놓은 요거트 소스를 함께 제공\n한다.','MANUAL06'),(130,'','MANUAL07'),(130,'','MANUAL08'),(130,'','MANUAL09'),(130,'','MANUAL10'),(130,'','MANUAL11'),(130,'','MANUAL12'),(130,'','MANUAL13'),(130,'','MANUAL14'),(130,'','MANUAL15'),(130,'','MANUAL16'),(130,'','MANUAL17'),(130,'','MANUAL18'),(130,'','MANUAL19'),(130,'','MANUAL20'),(131,'1. 단호박은 1/8 등분으로 갈라 속을\n파내고 찜통에서 약 15~20분 정도\n충분히 쪄낸다.','MANUAL01'),(131,'2. 소고기는 채를 썰어 마늘, 간장, 설탕에\n양념을 하고 팬에 볶아서 식힌다.','MANUAL02'),(131,'3. 파프리카와 오이, 적양배추는 채를\n썰고, 무순은 물에 잠시 담그어 놓고,\n사과는 채를 썰어 설탕물에 잠시 담그어\n놓고, 팽이버섯은 밑둥만 잘라 한 줌\n집기 좋은 크기로 준비해 놓는다.','MANUAL03'),(131,'4. 다진마늘과 다진 양파 ,올리브오일,\n설탕, 식초, 소금을 넣고, 골고루 섞어\n소스를 만들어 놓는다.','MANUAL04'),(131,'5. 쪄 낸 단호박은 껍질을 벗기고 채에\n곱게 내려 밀가루와 물, 소금을 조금\n섞어 단호박 반죽을 만들어 놓는다.','MANUAL05'),(131,'6. 팬에 올리브 오일을 바르고, 만들어\n놓은 단호박 반죽을 한 국자씩 떠 넣어,\n밀전병을 만들고, 밀전병이 익으면,\n한 김 식혀, 그 안에 소고기 볶음과\n채소를 넣어 돌돌 말아 소스와 함께\n완성한다.','MANUAL06'),(131,'','MANUAL07'),(131,'','MANUAL08'),(131,'','MANUAL09'),(131,'','MANUAL10'),(131,'','MANUAL11'),(131,'','MANUAL12'),(131,'','MANUAL13'),(131,'','MANUAL14'),(131,'','MANUAL15'),(131,'','MANUAL16'),(131,'','MANUAL17'),(131,'','MANUAL18'),(131,'','MANUAL19'),(131,'','MANUAL20'),(132,'1. 생선살에 생강즙과 정종을 넣고 약 30분\n정도 숙성을 시켜 비릿한 맛 제거 및 생선\n살의 탱탱함을 살려준다.','MANUAL01'),(132,'2. 콩가루와 밀가루, 카레가루, 녹말가루,\n달걀을 넣고 골고루 섞어 튀김 반죽을\n만들어 놓는다.','MANUAL02'),(132,'3. 깻잎은 반으로 접어 채를 썰어 물에\n잠시 담그어 놓는다.','MANUAL03'),(132,'4. 깻잎(③)은 물기를 제거하고\n튀김반죽(②)을 골고루 입힌다.','MANUAL04'),(132,'5. 숙성시킨 생선살(①)에 녹말가루를\n살짝 입히고 튀김 반죽(②)을 골고루\n입힌 뒤, 튀김반죽을 입힌 깻잎(④)을\n얹어 튀김 기름 170℃ 온도에 넣어\n약 2분 정도 튀겨 기름을 자연스럽게\n빼 놓는다.','MANUAL05'),(132,'6. 마요네즈와 요구르트, 설탕, 식초를\n넣어 골고루 섞어 튀김소스를 만들고,\n튀김을 접시에 담아 양상추와 함께 얹어\n완성한다.','MANUAL06'),(132,'','MANUAL07'),(132,'','MANUAL08'),(132,'','MANUAL09'),(132,'','MANUAL10'),(132,'','MANUAL11'),(132,'','MANUAL12'),(132,'','MANUAL13'),(132,'','MANUAL14'),(132,'','MANUAL15'),(132,'','MANUAL16'),(132,'','MANUAL17'),(132,'','MANUAL18'),(132,'','MANUAL19'),(132,'','MANUAL20'),(133,'1. 썰어 놓은 삼겹살에 생갑즙과 정종을\n넣고 약 2시간 정도 숙성을 시켜 준비\n한다.','MANUAL01'),(133,'2. 가지는 씨가 적은 것으로 골라 반으로\n갈라 어슷썰어 놓는다.','MANUAL02'),(133,'3. 양파와 깻잎은 채를 썰고, 당근은\n직사각형으로 썰고, 대파는 송송 썰고,\n느타리는 손으로 찢어 준비한다.','MANUAL03'),(133,'4. 고춧가루과 다진마늘, 간장, 올리고당,\n후춧가루, 설탕을 넣고 골고루 섞어\n양념장을 만든다.','MANUAL04'),(133,'5. 숙성시켜 놓은 삼겹살에 만들어 놓은\n양념장을 넣고 골고루 무쳐 놓는다.','MANUAL05'),(133,'6. 팬에 기름을 살짝 둘러 양념한 고기(⑤)\n를 먼저 볶은 후 고기가 중간쯤 익으면,\n가지(②)와 썰어 놓은 채소(③)를 넣어\n볶다가 마지막에 참기름과 잣을 넣고\n한 번 더 볶은 후 통깨를 올려 완성한다.','MANUAL06'),(133,'','MANUAL07'),(133,'','MANUAL08'),(133,'','MANUAL09'),(133,'','MANUAL10'),(133,'','MANUAL11'),(133,'','MANUAL12'),(133,'','MANUAL13'),(133,'','MANUAL14'),(133,'','MANUAL15'),(133,'','MANUAL16'),(133,'','MANUAL17'),(133,'','MANUAL18'),(133,'','MANUAL19'),(133,'','MANUAL20'),(134,'1. 끓는 물에 식초 한 방울을 떨어 뜨려\n주꾸미를 데쳐 한김 식혀 먹기 좋게\n썰어놓는다.','MANUAL01'),(134,'2. 끓는 물에 식초 한 방울을 떨어 뜨려\n주꾸미를 데쳐 한김 식혀먹기 좋게\n썰어놓는다.','MANUAL02'),(134,'3. 양상추는 손으로 뜯어, 찬물에 담그어\n놓는다.','MANUAL03'),(134,'4. 미나리는 약 4cm 길이로 썰고, 홍고추는\n어슷 썰어 씨를 살짝 제거하고 피망은\n씨를 제거하고 미나리와 비슷한 길이로\n썰어놓는다.','MANUAL04'),(134,'5. 강판에 곱게 간 배즙과 무즙에 와사비,\n설탕, 다진마늘, 식초, 소금을 넣어\n샐러드소스를 만든다.','MANUAL05'),(134,'6. 만들어 놓은 샐러드소스와 함께 썰어\n놓은 주꾸미(②)와 채소(③, ④)를 넣어\n먹기 직전에 버무려 완성한다.','MANUAL06'),(134,'','MANUAL07'),(134,'','MANUAL08'),(134,'','MANUAL09'),(134,'','MANUAL10'),(134,'','MANUAL11'),(134,'','MANUAL12'),(134,'','MANUAL13'),(134,'','MANUAL14'),(134,'','MANUAL15'),(134,'','MANUAL16'),(134,'','MANUAL17'),(134,'','MANUAL18'),(134,'','MANUAL19'),(134,'','MANUAL20'),(135,'1. 닭가슴살에 칼을 1/3 쯤 넣고 양쪽으로\n포를 뜨고, 정종을 살짝 발라놓는다.','MANUAL01'),(135,'2. 포뜬 닭가슴살 위에 카레가루를 솔솔\n뿌려 숙성을 시킨다.','MANUAL02'),(135,'3. 현미쌀은 물에 충분히 불려, 물기를\n빼 놓고, 양배추와 적 양배추는 곱게\n채를 썰어 각각 찬물에 담그어 싱싱\n해 지면 건져 물기를 빼놓는다.','MANUAL03'),(135,'4. 냄비에 토마토소스를 끓이다가\n생크림을 넣고 살짝 한 번 더\n끓여놓는다.','MANUAL04'),(135,'5. 튀김기름에 온도가 약 170℃ 정도가\n되면, 불려 놓은 현미쌀의 물기를\n제거한 뒤 튀겨 기름을 제거해 놓는다.','MANUAL05'),(135,'6. 숙성된 닭가슴살(①)에 튀긴 현미쌀\n(⑤)을 앞뒤로 골고루 바르고 다시\n170℃ 온도의 튀김 기름에 약 3~5분\n정도 튀겨내고, 양배추와 적채를 깔고\n그 위에 튀겨진 닭가슴살을 올리고,\n토마토소스를 뿌려 완성한다.','MANUAL06'),(135,'','MANUAL07'),(135,'','MANUAL08'),(135,'','MANUAL09'),(135,'','MANUAL10'),(135,'','MANUAL11'),(135,'','MANUAL12'),(135,'','MANUAL13'),(135,'','MANUAL14'),(135,'','MANUAL15'),(135,'','MANUAL16'),(135,'','MANUAL17'),(135,'','MANUAL18'),(135,'','MANUAL19'),(135,'','MANUAL20'),(136,'1. 삼겹살에 소금, 후춧가루, 생강즙,\n정종을 넣고 약 30분 정도 숙성을 시킨다.','MANUAL01'),(136,'2. 조와 쌀은 물에 약 30분 정도 불려 밥을\n짓고, 밥이 다 익으면, 뚜껑을 열어 주걱\n으로 골고루 섞어 한 김을 빼 놓는다.','MANUAL02'),(136,'3. 파는 길게 채를 썰어 물에 담그어 파채가\n둥글게 말리도록 한다.','MANUAL03'),(136,'4. 설탕과 식초, 레몬, 소금, 고춧가루,\n매실액을 골고루 섞어 소스를 만들어\n놓는다.','MANUAL04'),(136,'5. 파프리카는 속을 제거하고 양파,\n당근, 파프리카를 양파와 같은 길이로\n채를 썰고, 새송이와 표고버섯은 살짝\n데쳐 채를 썰고, 깻잎도 채를 썰어\n놓는다.','MANUAL05'),(136,'6. 파프리카는 속을 제거하고 양파, 당근,\n파프리카를 양파와 같은 길이로 채를\n썰고, 새송이와 표고버섯은 살짝 데쳐\n채를 썰고, 깻잎도 채를 썰어 놓는다.','MANUAL06'),(136,'','MANUAL07'),(136,'','MANUAL08'),(136,'','MANUAL09'),(136,'','MANUAL10'),(136,'','MANUAL11'),(136,'','MANUAL12'),(136,'','MANUAL13'),(136,'','MANUAL14'),(136,'','MANUAL15'),(136,'','MANUAL16'),(136,'','MANUAL17'),(136,'','MANUAL18'),(136,'','MANUAL19'),(136,'','MANUAL20'),(137,'1. 미니버섯을 깨끗이 씻어 소금을 살짝\n뿌려 놓는다.','MANUAL01'),(137,'2. 녹말가루에 물을 반쯤 넣고, 가만히\n가라앉혀 윗물은 따라 버리고, 딱딱한\n된녹말을 만들어 놓는다.','MANUAL02'),(137,'3. 브로컬리는 끓는 물에 데쳐 작게 썰고,\n오이는 반달로 썰고, 당근은 은행잎\n모양으로 썰어 준비하고, 파프리카는\n속씨를 제거하고, 삼각지게 썰어 준비\n한다.','MANUAL03'),(137,'4. 간장과 홍초, 설탕을 넣어 골고루 섞어\n탕수육소스를 만들어 놓는다.','MANUAL04'),(137,'5. 소금을 뿌려 놓은 미니 버섯에 만들어\n놓은 된 녹말과 달걀흰자를 넣어 골고\n루 섞는다.','MANUAL05'),(137,'6. 튀김 기름의 온도가 170~180℃가\n되면, 녹말 입힌 미니버섯을 바삭 하게\n튀겨 주고, 다시 팬에 만들어 놓은\n탕수육소스를 바글바글 끓이다가,\n썰어 놓은 채소를 넣고 살짝 익힌 후,\n물녹말을 한 숟가락 정도 넣어 끓인 후\n튀겨진 미니버섯 위에 올려 완성해 준다.','MANUAL06'),(137,'','MANUAL07'),(137,'','MANUAL08'),(137,'','MANUAL09'),(137,'','MANUAL10'),(137,'','MANUAL11'),(137,'','MANUAL12'),(137,'','MANUAL13'),(137,'','MANUAL14'),(137,'','MANUAL15'),(137,'','MANUAL16'),(137,'','MANUAL17'),(137,'','MANUAL18'),(137,'','MANUAL19'),(137,'','MANUAL20'),(138,'1. 연어는 소금, 후춧가루, 레몬으로\n마리네이드 한다.','MANUAL01'),(138,'2. 양파, 마늘은 입자있게 다진다.','MANUAL02'),(138,'3. 토마토는 씨를 제거하고 입자있게\n썰고, 파프리카, 피망은 채 썬 뒤\n볶는다.','MANUAL03'),(138,'4. 화이트크림, 생크림을 골고루 섞어\n크림소스를 만든다.','MANUAL04'),(138,'5. 팬에 버터를 넣고 양파, 마늘을 볶다가\n만들어 놓은 크림소스를 넣고 졸인다.','MANUAL05'),(138,'6. 접시에 볶은 야채를 담고, 200℃\n오븐에서 10분 정도 구운 연어를 담은\n뒤 크림소스를 올린다.','MANUAL06'),(138,'','MANUAL07'),(138,'','MANUAL08'),(138,'','MANUAL09'),(138,'','MANUAL10'),(138,'','MANUAL11'),(138,'','MANUAL12'),(138,'','MANUAL13'),(138,'','MANUAL14'),(138,'','MANUAL15'),(138,'','MANUAL16'),(138,'','MANUAL17'),(138,'','MANUAL18'),(138,'','MANUAL19'),(138,'','MANUAL20'),(139,'1. 쌀은 깨끗이 씻어 30분 이상 불려 밥을\n지어 식힌다.','MANUAL01'),(139,'2. 옥수수콘은 체에 걸러 물기를 뺀다.','MANUAL02'),(139,'3. 양파, 애호박, 당근, 양파 및\n새송이버섯은 옥수수콘 크기로 썰고\n마늘은 다진다.','MANUAL03'),(139,'4. 팬에 기름을 두르고 야채를 먼저\n볶는다.','MANUAL04'),(139,'5. 볶은 야채에 식혀놓은 밥을 넣고\n볶다가 저염간장, 후춧가루로 간을\n하고 옥수수콘을 넣고 살짝 볶는다.','MANUAL05'),(139,'6. 팬에 기름을 자작하게 넣고,\n라이스페이퍼를 둥글게 넣고 튀겨\n그릇에 담은 뒤 볶음밥을 담는다','MANUAL06'),(139,'','MANUAL07'),(139,'','MANUAL08'),(139,'','MANUAL09'),(139,'','MANUAL10'),(139,'','MANUAL11'),(139,'','MANUAL12'),(139,'','MANUAL13'),(139,'','MANUAL14'),(139,'','MANUAL15'),(139,'','MANUAL16'),(139,'','MANUAL17'),(139,'','MANUAL18'),(139,'','MANUAL19'),(139,'','MANUAL20'),(140,'1. 연어는 끝을 뾰족하게 살려\n슬라이스한다.','MANUAL01'),(140,'2. 쌀은 깨끗이 씻어 30분 이상 불려 밥을\n지어 식힌다.','MANUAL02'),(140,'3. 냄비에 식초, 설탕, 소금 약간과 물을\n동량으로 넣고 끓인 뒤 식혀 촛물을\n만들어 밥에 넣고 골고루 섞는다.','MANUAL03'),(140,'4. 당근과 표고버섯은 입자있게 다져 살짝\n볶아 식혀놓은 초밥에 넣고 잘\n섞어준다.','MANUAL04'),(140,'5. 와사비 가루에 30℃정도의 물을 넣고\n섞은 뒤 발효 시키고, 초밥 형태를\n만들어 그 위에 와사비를 바르고\n연어를 올린 후 접시에 담는다','MANUAL05'),(140,'6. 새싹과 파슬리는 찬물에 담았다 건져\n물기를 빼고, 연어 초밥 옆에 올린다.','MANUAL06'),(140,'','MANUAL07'),(140,'','MANUAL08'),(140,'','MANUAL09'),(140,'','MANUAL10'),(140,'','MANUAL11'),(140,'','MANUAL12'),(140,'','MANUAL13'),(140,'','MANUAL14'),(140,'','MANUAL15'),(140,'','MANUAL16'),(140,'','MANUAL17'),(140,'','MANUAL18'),(140,'','MANUAL19'),(140,'','MANUAL20'),(141,'1. 찹쌀가루는 체에 내려 2등분한다.','MANUAL01'),(141,'2. 찹쌀가루는 오미자와 치자를 우린\n뜨거운 물로 익반죽하여 비닐봉투에\n담아 숙성시킨다','MANUAL02'),(141,'3. 대추는 씨를 발라내 곱게 다지고 귤병,\n유자청, 꿀을 섞어 원소병 소를 만든다.','MANUAL03'),(141,'4. 굴병과 꿀을 섞어 원소병 소를\n준비한다.','MANUAL04'),(141,'5. 익반죽을 지름 3cm 크기로 동그랗게\n만들고 안에 소를 넣어 다시 동그랗게\n만든다','MANUAL05'),(141,'6. 녹말가루를 입혀 끓는 물에 넣은 뒤\n떠오르면 건져 찬물에 헹궈 물기를\n빼고 그릇에 담아 꿀물을 붓고 잣을\n올린다.','MANUAL06'),(141,'','MANUAL07'),(141,'','MANUAL08'),(141,'','MANUAL09'),(141,'','MANUAL10'),(141,'','MANUAL11'),(141,'','MANUAL12'),(141,'','MANUAL13'),(141,'','MANUAL14'),(141,'','MANUAL15'),(141,'','MANUAL16'),(141,'','MANUAL17'),(141,'','MANUAL18'),(141,'','MANUAL19'),(141,'','MANUAL20'),(142,'1. 소고기는 넓게 펴서 소금, 후춧가루로\n밑간을 하고 굽는다.','MANUAL01'),(142,'2. 닭가슴살은 소금, 후춧가루로 밑간을\n하여 굽고 길이대로 썬다.','MANUAL02'),(142,'3. 미나리는 끓는 물에 넣고 데쳐 찬물에\n헹군다.','MANUAL03'),(142,'4. 홍고추는 씨를 제거 하고 길게 썰어\n준비한다.','MANUAL04'),(142,'5. 달걀은 황백으로 나눠 지단을 부쳐\n길게 썰어 놓는다','MANUAL05'),(142,'6. 밑간한 소고기와 닭살 에 찹쌀가루를\n뭍혀 홍고추와 달걀 황백지단을 넣어\n돌돌 말아 미나리로 띠를 둘러 팬에\n기름을 살짝 둘러 익힌다.','MANUAL06'),(142,'','MANUAL07'),(142,'','MANUAL08'),(142,'','MANUAL09'),(142,'','MANUAL10'),(142,'','MANUAL11'),(142,'','MANUAL12'),(142,'','MANUAL13'),(142,'','MANUAL14'),(142,'','MANUAL15'),(142,'','MANUAL16'),(142,'','MANUAL17'),(142,'','MANUAL18'),(142,'','MANUAL19'),(142,'','MANUAL20'),(143,'1. 쌀은 깨끗이 씻어 30분 정도 불린다','MANUAL01'),(143,'2. 전복은 수저로 떼어 내어 소금으로\n세척한다.','MANUAL02'),(143,'3. 준비된 전복에 버터를 두르고 굽는다','MANUAL03'),(143,'4. 당근. 양파 . 양송이는 입자 있게\n다진다.','MANUAL04'),(143,'5. 냄비에 올리브 오일을 넣고 불린 쌀을\n볶는다.','MANUAL05'),(143,'6. 쌀이 어느 정도 볶아지면 다져 놓은\n야채를 넣어 볶다가 우유를 넣어\n끓이고, 쌀이 퍼지면 구워 놓은 전복을\n넣어 다시 끓인다.','MANUAL06'),(143,'','MANUAL07'),(143,'','MANUAL08'),(143,'','MANUAL09'),(143,'','MANUAL10'),(143,'','MANUAL11'),(143,'','MANUAL12'),(143,'','MANUAL13'),(143,'','MANUAL14'),(143,'','MANUAL15'),(143,'','MANUAL16'),(143,'','MANUAL17'),(143,'','MANUAL18'),(143,'','MANUAL19'),(143,'','MANUAL20'),(144,'1. 참깨와 흑임자를 섞어 곱게 간다.','MANUAL01'),(144,'2. 갈아 놓은 참깨와 흑임자에 설탕과\n식초를 넣고 섞는다.','MANUAL02'),(144,'3. 2번에 우유와 마요네즈를 넣고 골고루\n섞어 참깨 흑임자 드레싱을 만든다.','MANUAL03'),(144,'4. 연두부는 동그랗게 자른다.','MANUAL04'),(144,'5. 파프리카는 채 썬다.','MANUAL05'),(144,'6. 접시에 드레싱, 연두부, 파프리카,\n무순, 날치알 순으로 올린다.','MANUAL06'),(144,'','MANUAL07'),(144,'','MANUAL08'),(144,'','MANUAL09'),(144,'','MANUAL10'),(144,'','MANUAL11'),(144,'','MANUAL12'),(144,'','MANUAL13'),(144,'','MANUAL14'),(144,'','MANUAL15'),(144,'','MANUAL16'),(144,'','MANUAL17'),(144,'','MANUAL18'),(144,'','MANUAL19'),(144,'','MANUAL20'),(145,'1. 냄비에 마늘과 대파를 넣고 끓이다가\n닭다리를 넣고 삶는다','MANUAL01'),(145,'2. 닭을 삶아 놓은 육수는 걸러 기름을\n제거 하고 차갑게 식힌다.','MANUAL02'),(145,'3. 삶아 놓은 닭고기는 결대로 찢는다.','MANUAL03'),(145,'4. 양파, 오이와 파프리카는 채썬다','MANUAL04'),(145,'5. 적채는 채를 썰어 찬물에 담궈 건져\n물기를 빼 놓는다.','MANUAL05'),(145,'6. 차갑게 걸러 놓은 닭 육수에 발효된\n겨자와 소금 .설탕, 식초를 넣어 육수\n간을 하고, 그릇에 닭살과 오이 적채,\n파프리카 양파를 올려 차가운 육수를\n넣어 완성한다.','MANUAL06'),(145,'','MANUAL07'),(145,'','MANUAL08'),(145,'','MANUAL09'