ANUAL16'),(148,'','MANUAL17'),(148,'','MANUAL18'),(148,'','MANUAL19'),(148,'','MANUAL20'),(149,'1. 새우는 껍질을 벗겨 다진다.','MANUAL01'),(149,'2. 오징어는 썰어서 다진다.','MANUAL02'),(149,'3. 양파, 샐러리, 마늘은 다져 팬에 볶아\n식힌다.','MANUAL03'),(149,'4. 토마토는 껍질을 벗겨 다진다.','MANUAL04'),(149,'5. 다진 토마토를 팬에 볶다가 다진\n새우와 오징어, 밥을 넣어 볶고, 3번을\n넣고 볶아 동그랗게 모양을 만든다','MANUAL05'),(149,'6. 동그란 밥에 레몬을 섞은 달걀노른자를\n묻히고 빵가루 옷을 입혀 팬에 기름을\n둘러 굴려가며 익힌 후 접시에 담고\n어린잎을 올린다.','MANUAL06'),(149,'','MANUAL07'),(149,'','MANUAL08'),(149,'','MANUAL09'),(149,'','MANUAL10'),(149,'','MANUAL11'),(149,'','MANUAL12'),(149,'','MANUAL13'),(149,'','MANUAL14'),(149,'','MANUAL15'),(149,'','MANUAL16'),(149,'','MANUAL17'),(149,'','MANUAL18'),(149,'','MANUAL19'),(149,'','MANUAL20'),(150,'1. 닭고기는 넓게 펴 소금, 후추로 밑간을\n한다.','MANUAL01'),(150,'2. 찹쌀은 깨끗이 씻어 밥을 짓는다','MANUAL02'),(150,'3. 인삼은 뇌두를 제거 하고 깨끗이 씻어\n길게 썬다.','MANUAL03'),(150,'4. 미나리는 데쳐 찬물에 헹구고, 대추는\n씨를 제거하고 채를 썬다.','MANUAL04'),(150,'5. 호박잎은 끓는 물에 데쳐 찬물에\n식힌다.','MANUAL05'),(150,'6. 데친 호박잎에 밑간한 닭고기와\n찹쌀밥을 올리고 그 위에 인삼, 데친\n미나리, 대추를 올려 돌돌 말아 찜통에\n찐 뒤 먹기 좋게 썬다.','MANUAL06'),(150,'','MANUAL07'),(150,'','MANUAL08'),(150,'','MANUAL09'),(150,'','MANUAL10'),(150,'','MANUAL11'),(150,'','MANUAL12'),(150,'','MANUAL13'),(150,'','MANUAL14'),(150,'','MANUAL15'),(150,'','MANUAL16'),(150,'','MANUAL17'),(150,'','MANUAL18'),(150,'','MANUAL19'),(150,'','MANUAL20'),(151,'1. 소고기는 홍두깨살로 준비해서\n0.3mm 두께로 썰고, 배는 껍질을 벗겨\n채 썰어 설탕을 뿌린다.','MANUAL01'),(151,'2. 끓는 물에 소금을 넣고 두릅을 데친 후\n찬물에 헹구어 건진다.','MANUAL02'),(151,'3. 소금과 설탕, 다진 마늘을 넣고 소고기\n육회 양념장을 만든다.','MANUAL03'),(151,'4. 삶은 달걀노른자와 크림치즈, 레몬을\n섞어 짤주머니에 담는다.','MANUAL04'),(151,'5. 숙성이 잘된 아보카도는 강판에 갈아\n준비한다.','MANUAL05'),(151,'6. 접시에 양념한 육회와 두릅을 담고 그\n위에 배를 올리고, 달걀크림과\n아보카도를 짜서 올린다','MANUAL06'),(151,'','MANUAL07'),(151,'','MANUAL08'),(151,'','MANUAL09'),(151,'','MANUAL10'),(151,'','MANUAL11'),(151,'','MANUAL12'),(151,'','MANUAL13'),(151,'','MANUAL14'),(151,'','MANUAL15'),(151,'','MANUAL16'),(151,'','MANUAL17'),(151,'','MANUAL18'),(151,'','MANUAL19'),(151,'','MANUAL20'),(152,'1. 닭은 깨끗이 씻고 포를 뜬다.','MANUAL01'),(152,'2. 닭고기는 15분 정도 삶아 식으면 곱게\n다져 다진 마늘, 대파, 저염간장을 넣고\n완자를 만든다.','MANUAL02'),(152,'3. 인삼은 뇌두를 제거하고 깨끗이\n씻는다.','MANUAL03'),(152,'4. 찹쌀은 약 30분 정도 충분히 불린다','MANUAL04'),(152,'5. 대추는 소금물에 깨끗이 씻고 씨를\n제거한다.','MANUAL05'),(152,'6. 믹서에 인삼과 대추, 불린 찹쌀, 물을\n정도 넣고 곱게 간 뒤, 냄비에 담아 죽을\n쑤다가 다 익으면 만들어 놓은 완자를\n넣고 한소끔 더 끓인다.','MANUAL06'),(152,'','MANUAL07'),(152,'','MANUAL08'),(152,'','MANUAL09'),(152,'','MANUAL10'),(152,'','MANUAL11'),(152,'','MANUAL12'),(152,'','MANUAL13'),(152,'','MANUAL14'),(152,'','MANUAL15'),(152,'','MANUAL16'),(152,'','MANUAL17'),(152,'','MANUAL18'),(152,'','MANUAL19'),(152,'','MANUAL20'),(153,'1. 새우는 내장을 제거하고 껍질을 벗겨 깨끗이 씻는다.','MANUAL01'),(153,'2. 찜기에 새우와 생강을 넣어 약 5분 정도 찐다.','MANUAL02'),(153,'3. 마늘은 납작 썰고, 당근과 양파, 파, 깻잎, 청고추, 대추는 굵게 다진다.','MANUAL03'),(153,'4. 숙주는 꼬리를 떼어 다듬고, 끓는 물에 살짝 데친다.','MANUAL04'),(153,'5. 팬에 식용유를 두른 뒤 손질한 채소를 넣어 볶는다.','MANUAL05'),(153,'6. 밥과 새우를 넣어 볶고, 저염간장을 넣어 볶아 마무리한다.','MANUAL06'),(153,'','MANUAL07'),(153,'','MANUAL08'),(153,'','MANUAL09'),(153,'','MANUAL10'),(153,'','MANUAL11'),(153,'','MANUAL12'),(153,'','MANUAL13'),(153,'','MANUAL14'),(153,'','MANUAL15'),(153,'','MANUAL16'),(153,'','MANUAL17'),(153,'','MANUAL18'),(153,'','MANUAL19'),(153,'','MANUAL20'),(154,'1. 토마토는 깨끗이 씻어 슬라이스한다.','MANUAL01'),(154,'2. 두부는 원형틀을 이용해서 토마토와\n같은 크기로 만들고 소금을 살짝 뿌린\n뒤 물기를 제거한다.','MANUAL02'),(154,'3. 팬에 올리브오일을 두르고 두부를 살짝\n굽는다.','MANUAL03'),(154,'4. 어린잎은 찬물에 담근다.','MANUAL04'),(154,'5. 발사믹소스에 설탕과 레몬즙을 넣고\n골고루 섞어 소스를 만든다.','MANUAL05'),(154,'6. 두부와 준비한 토마토를 접시에 돌려\n담고 어린잎을 위에 올린 뒤 먹기\n직전에 발사믹소스와 파마산치즈를\n뿌려 완성한다.','MANUAL06'),(154,'','MANUAL07'),(154,'','MANUAL08'),(154,'','MANUAL09'),(154,'','MANUAL10'),(154,'','MANUAL11'),(154,'','MANUAL12'),(154,'','MANUAL13'),(154,'','MANUAL14'),(154,'','MANUAL15'),(154,'','MANUAL16'),(154,'','MANUAL17'),(154,'','MANUAL18'),(154,'','MANUAL19'),(154,'','MANUAL20'),(155,'1. 쌀과 다시마를 넣고 쌀과 동량의\n물을 부어 밥을 고슬고슬하게\n짓는다.','MANUAL01'),(155,'2. 양파는 굵게 다지고, 쪽파와 고추는\n송송 썰고, 오징어와 주꾸미는 먹기\n좋은 크기로 썬다.','MANUAL02'),(155,'3. 달군 팬에 들기름을 두르고 다진\n마늘을 볶아 향을 낸다.','MANUAL03'),(155,'4. 미역을 넣고 볶다가 손질해둔\n오징어, 주꾸미, 새우살, 양파를 넣어\n볶는다.','MANUAL04'),(155,'5. 밥을 넣고 소금을 넣어 볶다가\n들깻가루를 넣어 볶는다.','MANUAL05'),(155,'6. 송송 썬 쪽파와 청양고추, 붉은\n고추를 넣어 조금 더 볶아\n마무리한다.','MANUAL06'),(155,'','MANUAL07'),(155,'','MANUAL08'),(155,'','MANUAL09'),(155,'','MANUAL10'),(155,'','MANUAL11'),(155,'','MANUAL12'),(155,'','MANUAL13'),(155,'','MANUAL14'),(155,'','MANUAL15'),(155,'','MANUAL16'),(155,'','MANUAL17'),(155,'','MANUAL18'),(155,'','MANUAL19'),(155,'','MANUAL20'),(156,'1. 쌀과 현미는 물에 깨끗이 씻어 불린\n후 밥을 고슬고슬하게 짓는다.','MANUAL01'),(156,'2. 감자, 고구마, 우엉, 양파, 당근,\n애호박, 연근은 작게 깍둑 썰고,\n마늘은 편 썬다.','MANUAL02'),(156,'3. 시금치와 참나물, 깻잎은 굵게 채\n썰고, 미나리는 2.5㎝ 길이로 썬다.','MANUAL03'),(156,'4. 물(50g)에 다시마를 우려내 육수를\n내고 청국장을 넣어 잘 푼 뒤\n들깻가루를 넣고 잘 저어주며 졸여\n청국장소스를 만든다.','MANUAL04'),(156,'5. 팬에 올리브유와 들기름을 두르고\n양파, 마늘을 약한 불에 볶다가\n감자, 고구마, 우엉, 연근, 당근,\n애호박을 넣고 같이 볶는다.','MANUAL05'),(156,'6. 밥과 청국장소스를 부어 80% 정도\n볶다가 시금치, 참나물, 미나리를\n넣고 한 번 더 볶고 채 썬 깻잎을\n올려 마무리한다.','MANUAL06'),(156,'','MANUAL07'),(156,'','MANUAL08'),(156,'','MANUAL09'),(156,'','MANUAL10'),(156,'','MANUAL11'),(156,'','MANUAL12'),(156,'','MANUAL13'),(156,'','MANUAL14'),(156,'','MANUAL15'),(156,'','MANUAL16'),(156,'','MANUAL17'),(156,'','MANUAL18'),(156,'','MANUAL19'),(156,'','MANUAL20'),(157,'1. 쌀은 씻어서 체에 건져 1시간 이상\n불린 후 동량의 물을 부어 밥을\n짓는다.','MANUAL01'),(157,'2. 아스파라거스, 새송이버섯은 작게\n깍둑 썰고, 무와 우엉, 미나리는\n다진다.','MANUAL02'),(157,'3. 식용유(10g)를 두른 팬을 중간 불로\n달궈 달걀을 넣고 스크램블로\n볶는다.','MANUAL03'),(157,'4. 문어, 새우살, 주꾸미는 끓는 물에\n살짝 데쳐 작게 자른다.','MANUAL04'),(157,'5. 식용유(15g)를 두른 팬을 중간 불로\n달궈 밥을 넣어 볶다가 문어, 새우살,\n주꾸미, 스크램블 에그를 넣고 조금\n더 볶는다.','MANUAL05'),(157,'6. 무와 우엉에 고추장과 참기름,\n물(40g)을 넣고 묽게 졸인 후 불을\n끄고 미나리를 넣고 섞어\n미나리볶음고추장을 만들어 밥에\n곁들여 마무리한다.','MANUAL06'),(157,'','MANUAL07'),(157,'','MANUAL08'),(157,'','MANUAL09'),(157,'','MANUAL10'),(157,'','MANUAL11'),(157,'','MANUAL12'),(157,'','MANUAL13'),(157,'','MANUAL14'),(157,'','MANUAL15'),(157,'','MANUAL16'),(157,'','MANUAL17'),(157,'','MANUAL18'),(157,'','MANUAL19'),(157,'','MANUAL20'),(158,'1. 감자, 양파, 당근, 피망은 볶음밥에\n넣을 분량은 잘게 다지고, 카레에\n넣을 분량은 한입 크기로 썬다.','MANUAL01'),(158,'2. 닭가슴살도 한입 크기로 잘라\n후춧가루로 밑간한다.','MANUAL02'),(158,'3. 팬에 식용유(15g)를 두른 뒤 잘게\n다진 감자, 양파, 당근, 피망을 넣고\n볶다가 밥을 넣고 같이 볶는다.','MANUAL03'),(158,'4. 식용유(15g)를 두른 팬에 닭고기를\n먼저 볶다가 한입 크기로 썬 감자,\n당근, 양파, 피망, 브로콜리를 넣고\n볶은 뒤 마지막에 방울토마토를\n넣는다.','MANUAL04'),(158,'5. 토마토페이스트을 넣고 볶다가\n파프리카가루를 넣어 향을 낸다.','MANUAL05'),(158,'6. 카레가루를 푼 물(300g)을 부어\n끓이다가 플레인 요구르트를 넣고\n농도를 맞춘 뒤 밥 위에 얹어\n마무리한다.','MANUAL06'),(158,'','MANUAL07'),(158,'','MANUAL08'),(158,'','MANUAL09'),(158,'','MANUAL10'),(158,'','MANUAL11'),(158,'','MANUAL12'),(158,'','MANUAL13'),(158,'','MANUAL14'),(158,'','MANUAL15'),(158,'','MANUAL16'),(158,'','MANUAL17'),(158,'','MANUAL18'),(158,'','MANUAL19'),(158,'','MANUAL20'),(159,'1. 현미로 밥을 지은 뒤 밥 밑간을 넣고\n섞는다.','MANUAL01'),(159,'2. 톳에 톳 무침양념을 넣고 버무린다.','MANUAL02'),(159,'3. 밥에 톳을 넣고 버무린다.','MANUAL03'),(159,'4. 밥을 먹기 좋은 크기로 둥글게 뭉친\n뒤 부순 생김을 골고루 묻힌다.','MANUAL04'),(159,'5. 주먹밥에 달걀물을 입힌 뒤 팬에\n구워 마무리한다.','MANUAL05'),(159,'','MANUAL06'),(159,'','MANUAL07'),(159,'','MANUAL08'),(159,'','MANUAL09'),(159,'','MANUAL10'),(159,'','MANUAL11'),(159,'','MANUAL12'),(159,'','MANUAL13'),(159,'','MANUAL14'),(159,'','MANUAL15'),(159,'','MANUAL16'),(159,'','MANUAL17'),(159,'','MANUAL18'),(159,'','MANUAL19'),(159,'','MANUAL20'),(160,'1. 칵테일새우는 잘게 다진다.','MANUAL01'),(160,'2. 다진 쇠고기에 후춧가루와\n참기름(3g)으로 밑간한 후 볶는다.','MANUAL02'),(160,'3. 찹쌀현미밥에 참기름(4g)을 넣어\n밑간하고 식힌 후 새우와 쇠고기를\n넣어 뭉쳐준다.','MANUAL03'),(160,'4. 마늘과 고추는 볶다가 식초와\n함초가루, 설탕, 물(30g)을 넣고 졸여\n소스를 만든다.','MANUAL04'),(160,'5. 밀가루는 반죽한 뒤 얇게 밀어\n삼각형으로 잘라 튀긴 후 기름을\n뺀다.','MANUAL05'),(160,'6. 위에 주먹밥을 올리고 파인애플을\n올린 후 소스를 곁들여 마무리한다.','MANUAL06'),(160,'','MANUAL07'),(160,'','MANUAL08'),(160,'','MANUAL09'),(160,'','MANUAL10'),(160,'','MANUAL11'),(160,'','MANUAL12'),(160,'','MANUAL13'),(160,'','MANUAL14'),(160,'','MANUAL15'),(160,'','MANUAL16'),(160,'','MANUAL17'),(160,'','MANUAL18'),(160,'','MANUAL19'),(160,'','MANUAL20'),(161,'1. 닭봉은 손질한 뒤 후춧가루를\n섞은 우유에 담가두었다가 구워\n준비한다.','MANUAL01'),(161,'2. 단호박, 새송이버섯은 구워서\n준비한다.','MANUAL02'),(161,'3. 소스를 만든다.','MANUAL03'),(161,'4. 가지, 주키니호박, 당근, 양파,\n시래기는 잘게 다진 뒤 볶는다.','MANUAL04'),(161,'5. 볶은 채소와 치즈를 참기름, 간장과\n함께 밥에 넣고 섞는다.','MANUAL05'),(161,'6. 구운 닭봉을 밥으로 감싼 뒤 구운\n단호박, 새송이버섯, 새싹채소와\n함께 담아 소스를 곁들여\n마무리한다.','MANUAL06'),(161,'','MANUAL07'),(161,'','MANUAL08'),(161,'','MANUAL09'),(161,'','MANUAL10'),(161,'','MANUAL11'),(161,'','MANUAL12'),(161,'','MANUAL13'),(161,'','MANUAL14'),(161,'','MANUAL15'),(161,'','MANUAL16'),(161,'','MANUAL17'),(161,'','MANUAL18'),(161,'','MANUAL19'),(161,'','MANUAL20'),(162,'1. 봄동과 깻잎은 데친 뒤 체에 밭쳐\n물기를 제거한다.','MANUAL01'),(162,'2. 데친 꼬막살은 물기를 제거하고\n다져 올리브유로 양념한 밥에\n참깨와 함께 버무린 후 한입 크기로\n주먹밥을 만든다.','MANUAL02'),(162,'3. 낙지 다리는 데쳐 찬물에 담가 식힌\n뒤 참기름(3g)에 양념하고, 두릅은\n데쳐 물기를 제거한 뒤 올리브유로\n양념한다.','MANUAL03'),(162,'4. 봄동에 꼬막밥을 넣고 만 뒤\n깻잎으로 싸고 데친 미나리로 묶어\n봄주먹밥을 만든다.','MANUAL04'),(162,'5. 냄비에 참기름(10g)을 두르고 양파,\n당근, 애호박을 넣고 볶은 뒤 물,\n된장, 고춧가루, 다진 마늘, 붉은\n고추, 청양고추를 넣고 끓이다가\n두부를 넣고 조려 두부강된장을\n만든다.','MANUAL05'),(162,'6. 봄주먹밥에 낙지와 두릅,\n두부강된장을 곁들여 마무리한다.','MANUAL06'),(162,'','MANUAL07'),(162,'','MANUAL08'),(162,'','MANUAL09'),(162,'','MANUAL10'),(162,'','MANUAL11'),(162,'','MANUAL12'),(162,'','MANUAL13'),(162,'','MANUAL14'),(162,'','MANUAL15'),(162,'','MANUAL16'),(162,'','MANUAL17'),(162,'','MANUAL18'),(162,'','MANUAL19'),(162,'','MANUAL20'),(163,'1. 쌀을 씻어 밥을 지은 뒤 밥 밑간을\n한다.','MANUAL01'),(163,'2. 양파, 피클, 삶은 달걀은 다진 뒤\n마요네즈에 섞어\n허브타르타르드레싱을 만든다.','MANUAL02'),(163,'3. 김 위에 양쪽으로 밥을 펴고\n허브타르타르드레싱을 위에\n올린 후 만다.','MANUAL03'),(163,'4. 깻잎장아찌를 바닥에 깔고 말아놓은\n롤을 올린 후 한 번 더 만다.','MANUAL04'),(163,'5. 머스타드소스를 만든다.','MANUAL05'),(163,'6. 한입 크기로 롤을 썬 뒤 새싹과\n소스를 곁들여 마무리한다.','MANUAL06'),(163,'','MANUAL07'),(163,'','MANUAL08'),(163,'','MANUAL09'),(163,'','MANUAL10'),(163,'','MANUAL11'),(163,'','MANUAL12'),(163,'','MANUAL13'),(163,'','MANUAL14'),(163,'','MANUAL15'),(163,'','MANUAL16'),(163,'','MANUAL17'),(163,'','MANUAL18'),(163,'','MANUAL19'),(163,'','MANUAL20'),(164,'1. 쌀을 물에 불린 뒤 완두콩을 함께\n넣고 밥을 짓는다.','MANUAL01'),(164,'2. 달걀을 풀어 체에 내린 뒤 지단을\n부치면서 반 정도 익었을 때 그 위에\n얇게 썬 주키니호박, 당근, 가지를\n올려 익힌다.','MANUAL02'),(164,'3. 참치를 참치밑간에 재운 뒤 겉만\n살짝 익힌다.','MANUAL03'),(164,'4. 김에 밥을 올리고, 뒤집어 참치를\n올려 만 뒤 그 위에 지단을 올려\n한 번 더 만다.','MANUAL04'),(164,'5. 사과드레싱을 만들고,\n토마토소스 재료를 간 뒤 체에\n거른다.','MANUAL05'),(164,'6. 참치비빔밥롤을 담은 뒤\n토마토소스를 곁들이고, 케일에\n사과드레싱을 뿌려 마무리한다.','MANUAL06'),(164,'','MANUAL07'),(164,'','MANUAL08'),(164,'','MANUAL09'),(164,'','MANUAL10'),(164,'','MANUAL11'),(164,'','MANUAL12'),(164,'','MANUAL13'),(164,'','MANUAL14'),(164,'','MANUAL15'),(164,'','MANUAL16'),(164,'','MANUAL17'),(164,'','MANUAL18'),(164,'','MANUAL19'),(164,'','MANUAL20'),(165,'1. 소스를 만든다.','MANUAL01'),(165,'2. 파프리카와 파인애플을 먹기 좋게\n썬다.','MANUAL02'),(165,'3. 스크램블 에그를 만든다.','MANUAL03'),(165,'4. 김발 위에 ⅔크기로 자른 김을 놓고\n밥을 고루 편 뒤 새싹채소,\n스크램블 에그, 파프리카, 기름 뺀\n참치, 파인애플을 올리고 소스를\n고르게 뿌린다.','MANUAL04'),(165,'5. 반으로 접어 먹기 좋게 썰어\n마무리한다.','MANUAL05'),(165,'','MANUAL06'),(165,'','MANUAL07'),(165,'','MANUAL08'),(165,'','MANUAL09'),(165,'','MANUAL10'),(165,'','MANUAL11'),(165,'','MANUAL12'),(165,'','MANUAL13'),(165,'','MANUAL14'),(165,'','MANUAL15'),(165,'','MANUAL16'),(165,'','MANUAL17'),(165,'','MANUAL18'),(165,'','MANUAL19'),(165,'','MANUAL20'),(166,'1. 당근, 피망, 양파를 잘게 다진 뒤\n기름에 살짝 볶아 밥에\n마요네즈(10g)와 함께 넣어 섞는다.','MANUAL01'),(166,'2. 통조림 연어는 기름기를 빼고,\n식초를 넣은 끓는 물에서 30초 정도\n데친다.','MANUAL02'),(166,'3. 데리야키소스와 마요네즈(10g)에\n연어를 넣고 버무려 양념한다.','MANUAL03'),(166,'4. 밥을 동그랗게 빚은 뒤 가운데에\n연어를 넣고 주먹밥을 만든다.','MANUAL04'),(166,'5. 달걀물과 빵가루를 입혀 160℃로\n예열한 기름에 바삭하게 튀긴다.','MANUAL05'),(166,'6. 연어주먹밥튀김을 담고\n어린잎채소를 곁들인 뒤\n오리엔탈소스를 곁들여 마무리한다.','MANUAL06'),(166,'','MANUAL07'),(166,'','MANUAL08'),(166,'','MANUAL09'),(166,'','MANUAL10'),(166,'','MANUAL11'),(166,'','MANUAL12'),(166,'','MANUAL13'),(166,'','MANUAL14'),(166,'','MANUAL15'),(166,'','MANUAL16'),(166,'','MANUAL17'),(166,'','MANUAL18'),(166,'','MANUAL19'),(166,'','MANUAL20'),(167,'1. 오징어 몸통 안쪽에 칼집을 내고\n끓는 물에 데친다.','MANUAL01'),(167,'2. 파프리카와 당근, 피망은 작게 다져\n볶은 뒤 밥에 넣어 섞는다.','MANUAL02'),(167,'3. 쇠고기는 참기름에 볶는다.','MANUAL03'),(167,'4. 달걀을 풀어 약한 불로 달군 팬에\n부은 뒤 김가루를 뿌려 지단을\n부치고, 바닥이 익으면 깻잎과\n밥을 올린다.','MANUAL04'),(167,'5. 데친 오징어, 볶은 쇠고기 순으로\n올려 만 뒤 랩으로 싼다.','MANUAL05'),(167,'6. 고추장과 매실청을 섞은 뒤 팬에\n넣고 약한 불에서 끓여 소스를\n만들고 한입 크기로 썬 김밥에\n구운 버섯을 함께 곁들여\n마무리한다.','MANUAL06'),(167,'','MANUAL07'),(167,'','MANUAL08'),(167,'','MANUAL09'),(167,'','MANUAL10'),(167,'','MANUAL11'),(167,'','MANUAL12'),(167,'','MANUAL13'),(167,'','MANUAL14'),(167,'','MANUAL15'),(167,'','MANUAL16'),(167,'','MANUAL17'),(167,'','MANUAL18'),(167,'','MANUAL19'),(167,'','MANUAL20'),(168,'1. 닭고기 삶는 재료를 물(100g)에 넣어\n끓이다가 닭가슴살을 넣고 삶아\n한입 크기로 썬다.','MANUAL01'),(168,'2. 양배추는 곱게 채 썰고, 청포묵은\n먹기 좋은 크기로 썬다.','MANUAL02'),(168,'3. 숙주는 끓는 물에 데쳐 물기를 뺀다','MANUAL03'),(168,'4. 비빔소스를 만든다.','MANUAL04'),(168,'5. 쌀에 물을 붓고 밥을 짓는다.','MANUAL05'),(168,'6. 밥 위에 닭가슴살, 양배추, 청포묵,\n숙주, 달걀지단, 무순을 담아\n마무리한다.','MANUAL06'),(168,'','MANUAL07'),(168,'','MANUAL08'),(168,'','MANUAL09'),(168,'','MANUAL10'),(168,'','MANUAL11'),(168,'','MANUAL12'),(168,'','MANUAL13'),(168,'','MANUAL14'),(168,'','MANUAL15'),(168,'','MANUAL16'),(168,'','MANUAL17'),(168,'','MANUAL18'),(168,'','MANUAL19'),(168,'','MANUAL20'),(169,'1. 조미된 족발은 뜨거운 맥주에 데쳐내 기름기를\n제거한다.','MANUAL01'),(169,'2. 고구마는 편으로 썰어 냉수에 헹궈 기름\n없는 팬에 구워준다.','MANUAL02'),(169,'3. 가지는 편으로 썰어서 수분을 제거한다.','MANUAL03'),(169,'4. 가지는 편으로 썰어 살짝 구워준다.','MANUAL04'),(169,'5. 백김치는 물에 헹궈서 손으로 꼭 짠 후 송송\n썰어서 양념을 해 무쳐준다.','MANUAL05'),(169,'6. 무쳐준 김치와 함께 구워진 채소와 족발수육을\n담아 완성한다.','MANUAL06'),(169,'','MANUAL07'),(169,'','MANUAL08'),(169,'','MANUAL09'),(169,'','MANUAL10'),(169,'','MANUAL11'),(169,'','MANUAL12'),(169,'','MANUAL13'),(169,'','MANUAL14'),(169,'','MANUAL15'),(169,'','MANUAL16'),(169,'','MANUAL17'),(169,'','MANUAL18'),(169,'','MANUAL19'),(169,'','MANUAL20'),(170,'1. 함초는 송송 다져준다.','MANUAL01'),(170,'2. 당근, 새송이, 샐러리, 양파를 송송 다져준다.','MANUAL02'),(170,'3. 볼에 소고기, 돼지고기, 다져 놓은 채소와\n다진마늘, 다진대파, 참기름을 넣고 반죽해준다.','MANUAL03'),(170,'4. 여기에 함초 다진 것을 넣고 다시 반죽해 준다.','MANUAL04'),(170,'5. 떡갈비 모양으로 만들어준 후 팬에 노릇하게\n구워준다.','MANUAL05'),(170,'6. 소스를 만들어 구워진 떡갈비를 졸여준다.','MANUAL06'),(170,'','MANUAL07'),(170,'','MANUAL08'),(170,'','MANUAL09'),(170,'','MANUAL10'),(170,'','MANUAL11'),(170,'','MANUAL12'),(170,'','MANUAL13'),(170,'','MANUAL14'),(170,'','MANUAL15'),(170,'','MANUAL16'),(170,'','MANUAL17'),(170,'','MANUAL18'),(170,'','MANUAL19'),(170,'','MANUAL20'),(171,'1. 모시조개는 볶은소금을 넣어서 해감시킨다.','MANUAL01'),(171,'2. 준비된 다시마물에 준비된 채소의 국물재료를\n넣고 국물을 만들어준다.','MANUAL02'),(171,'3. 만들어진 국물에 모시조개를 넣고 청주를\n부어서 국물을 만들어준다.','MANUAL03'),(171,'4. 쪽파는 송송 다지고 마늘은 곱게 다져주고\n청홍고추는 가늘게 채 썰어준다.','MANUAL04'),(171,'5. 면을 각각 삶아준다.','MANUAL05'),(171,'6. 삼색 면을 그릇에 담고 만들어진 국물을\n부워서 완성한다.','MANUAL06'),(171,'','MANUAL07'),(171,'','MANUAL08'),(171,'','MANUAL09'),(171,'','MANUAL10'),(171,'','MANUAL11'),(171,'','MANUAL12'),(171,'','MANUAL13'),(171,'','MANUAL14'),(171,'','MANUAL15'),(171,'','MANUAL16'),(171,'','MANUAL17'),(171,'','MANUAL18'),(171,'','MANUAL19'),(171,'','MANUAL20'),(172,'1. 당근, 청경채, 배추, 애호박, 팽이버섯은 먹기\n좋은 크기로 잘라준다.','MANUAL01'),(172,'2. 흑돼지고기, 저염된장, 후추를 넣어서 불순물을\n제거하면서 고기를 삶아준다.','MANUAL02'),(172,'3. 천연다시다로 육수를 만들어 체에 걸러준다.','MANUAL03'),(172,'4. 손질한 야채들과 청양고추를 잘라 함께 육수에\n데쳐 국물에 매운 맛을 낸다.','MANUAL04'),(172,'5. 곁들이장을 만들어 준다.','MANUAL05'),(172,'6. 냄비에 데쳐준 채소와 국물을 붓고 고기를\n먹기좋게 썰어 소스랑 완성한다.','MANUAL06'),(172,'','MANUAL07'),(172,'','MANUAL08'),(172,'','MANUAL09'),(172,'','MANUAL10'),(172,'','MANUAL11'),(172,'','MANUAL12'),(172,'','MANUAL13'),(172,'','MANUAL14'),(172,'','MANUAL15'),(172,'','MANUAL16'),(172,'','MANUAL17'),(172,'','MANUAL18'),(172,'','MANUAL19'),(172,'','MANUAL20'),(173,'1. 바지락은 해감을 시켜준 후 물에 넣어 바지락\n육수를 만들어준다.','MANUAL01'),(173,'2. 바지락살은 따로 떼어내어 다진소고기와\n다시 다져서 양념해 볶아준다.','MANUAL02'),(173,'3. 두부는 물기제거를 한 후 함초, 깻잎, 다진양파,\n를 넣어 치대어 두부볶음을 만들어준다.','MANUAL03'),(173,'4. 애호박은 채 썰어주고 양파, 오이, 당근, 표고도\n채 썰어 각각 볶아준다.','MANUAL04'),(173,'5. 볶은 바지락과 쌀을 넣어 밥을 한다.','MANUAL05'),(173,'6. 몰드에 밥과 각종 채소들을 올려주고 마지막에\n두부 스크램블을 올려 밥을 완성한다.','MANUAL06'),(173,'','MANUAL07'),(173,'','MANUAL08'),(173,'','MANUAL09'),(173,'','MANUAL10'),(173,'','MANUAL11'),(173,'','MANUAL12'),(173,'','MANUAL13'),(173,'','MANUAL14'),(173,'','MANUAL15'),(173,'','MANUAL16'),(173,'','MANUAL17'),(173,'','MANUAL18'),(173,'','MANUAL19'),(173,'','MANUAL20'),(174,'1. 뜨거운 물에 파스타면을 삶아낸 뒤 물기를\n빼준다.','MANUAL01'),(174,'2. 송송 썬 청양고추를 생들기름에 볶아주다\n면을 볶는다.','MANUAL02'),(174,'3. 볶아준 청양고추에 삶아진 면을 볶아준다.','MANUAL03'),(174,'4. 열무김치는 송송 썰어서 들기름에 살짝\n볶아준다.','MANUAL04'),(174,'5. 오이는 돌려깎기 해서 채 썰어주고 청고추,\n2가지색 파프리카, 당근도 채 썰어 각각 볶아\n준다.','MANUAL05'),(174,'6. 청양고추에 볶아진 파스타면을 볶은 채소와\n한 번 더 볶아 완성한다.','MANUAL06'),(174,'','MANUAL07'),(174,'','MANUAL08'),(174,'','MANUAL09'),(174,'','MANUAL10'),(174,'','MANUAL11'),(174,'','MANUAL12'),(174,'','MANUAL13'),(174,'','MANUAL14'),(174,'','MANUAL15'),(174,'','MANUAL16'),(174,'','MANUAL17'),(174,'','MANUAL18'),(174,'','MANUAL19'),(174,'','MANUAL20'),(175,'1. 갈비는 핏물을 빼주고 뜨거운 물에 80% 이상\n데쳐준 뒤 갈비와 감자를 물을 자작하게 넣고\n청주, 생강청을 넣고 푹 삶아준다.','MANUAL01'),(175,'2. 양파, 청고추, 홍고추는 먹기 좋게 썰어준다.','MANUAL02'),(175,'3. 마른미역줄기는 냉수에 행군 뒤 물기를 빼준다.','MANUAL03'),(175,'4. 양념장을 바글바글 끓여준다.','MANUAL04'),(175,'5. 끓고 있는 양념장에 삶아진 갈비, 감자, 당근\n순으로 끓이다 메추리알을 넣고 졸여준다.','MANUAL05'),(175,'6. 마지막에 미역줄기를 넣고 볶아주는 형식으로\n갈비찜을 완성한다.','MANUAL06'),(175,'','MANUAL07'),(175,'','MANUAL08'),(175,'','MANUAL09'),(175,'','MANUAL10'),(175,'','MANUAL11'),(175,'','MANUAL12'),(175,'','MANUAL13'),(175,'','MANUAL14'),(175,'','MANUAL15'),(175,'','MANUAL16'),(175,'','MANUAL17'),(175,'','MANUAL18'),(175,'','MANUAL19'),(175,'','MANUAL20'),(176,'1. 곤드레는 뜨거운 물에 데쳐낸 뒤 깨끗하게\n헹구고 송송 썰어준다.','MANUAL01'),(176,'2. 두부의 물기를 짜 준다.','MANUAL02'),(176,'3. 양념장 재료와 물기를 짠 두부로 양념장을\n만들어준다.','MANUAL03'),(176,'4. 느타리버섯은 뜨거운 물에 데쳐낸 후 수분을\n빼 가늘게 찢어준다.','MANUAL04'),(176,'5. 냄비에 참기름을 두르고 곤드레를 볶다가 쌀을\n넣고 밥을 해준다.','MANUAL05'),(176,'6. 뜸을 들일 때 느타리버섯을 올려주어 밥을\n완성한다.','MANUAL06'),(176,'','MANUAL07'),(176,'','MANUAL08'),(176,'','MANUAL09'),(176,'','MANUAL10'),(176,'','MANUAL11'),(176,'','MANUAL12'),(176,'','MANUAL13'),(176,'','MANUAL14'),(176,'','MANUAL15'),(176,'','MANUAL16'),(176,'','MANUAL17'),(176,'','MANUAL18'),(176,'','MANUAL19'),(176,'','MANUAL20'),(177,'1. 찹쌀은 불려주고 전복은 손질해 내장과 분리해\n준 뒤 청주를 넣어서 전복 내장을 믹서에\n갈아준다.','MANUAL01'),(177,'2. 전복 몸에 칼집을 내준 후 참기름을 두른 팬에\n구워준다.','MANUAL02'),(177,'3. 당근과 미역은 송송 잘라준다.','MANUAL03'),(177,'4. 전복내장을 먼저 참기름에 충분히 볶아준다.','MANUAL04'),(177,'5. 내장을 볶아주다가 불린 찹쌀을 넣고 충분히\n볶아준다.','MANUAL05'),(177,'6. 죽이 완성될 때 당근, 미역을 넣고 죽을 끓여\n주고 전복은 고명으로 올려준다.','MANUAL06'),(177,'','MANUAL07'),(177,'','MANUAL08'),(177,'','MANUAL09'),(177,'','MANUAL10'),(177,'','MANUAL11'),(177,'','MANUAL12'),(177,'','MANUAL13'),(177,'','MANUAL14'),(177,'','MANUAL15'),(177,'','MANUAL16'),(177,'','MANUAL17'),(177,'','MANUAL18'),(177,'','MANUAL19'),(177,'','MANUAL20'),(178,'1. 주꾸미는 세척해 물기를 빼준다.','MANUAL01'),(178,'2. 무와 단호박은 먹기 좋게 썰어준다.','MANUAL02'),(178,'3. 청고추, 미나리, 양파를 먹기 좋게 썰어준다.','MANUAL03'),(178,'4. 청양 고추를 어슷하게 썰고 마늘은 편으로 썰어\n국물을 끓여준다.','MANUAL04'),(178,'5. 국물이 만들어지면 무, 단호박을 넣고 끓여준다.','MANUAL05'),(178,'6. 국물에 대파를 넣어주고 모든 재료를 넣어\n완성한다.','MANUAL06'),(178,'','MANUAL07'),(178,'','MANUAL08'),(178,'','MANUAL09'),(178,'','MANUAL10'),(178,'','MANUAL11'),(178,'','MANUAL12'),(178,'','MANUAL13'),(178,'','MANUAL14'),(178,'','MANUAL15'),(178,'','MANUAL16'),(178,'','MANUAL17'),(178,'','MANUAL18'),(178,'','MANUAL19'),(178,'','MANUAL20'),(179,'1. 파프라카, 양파, 홍고추는 가늘게 채 썰어준다.','MANUAL01'),(179,'2. 함초는 세척 후 먹기 좋게 손질해 준다.','MANUAL02'),(179,'3. 무순을 물 속에 담가준다.','MANUAL03'),(179,'4. 편으로 썰어준 소고기에 채 썰어준 채소와\n함초를 꼭 싸 말아준다.','MANUAL04'),(179,'5. 마늘은 편으 로 썰 어 마늘기름에 한 번\n구워준다.','MANUAL05'),(179,'6. 구운 마늘을 깔고 말아준 고기를 굽는다.','MANUAL06'),(179,'','MANUAL07'),(179,'','MANUAL08'),(179,'','MANUAL09'),(179,'','MANUAL10'),(179,'','MANUAL11'),(179,'','MANUAL12'),(179,'','MANUAL13'),(179,'','MANUAL14'),(179,'','MANUAL15'),(179,'','MANUAL16'),(179,'','MANUAL17'),(179,'','MANUAL18'),(179,'','MANUAL19'),(179,'','MANUAL20'),(180,'1. 닭가슴살을 이용해 국물을 만든다.','MANUAL01'),(180,'2. 닭가슴살은 먹기 좋게 찢어 흰 후추, 버섯마늘\n소금으로 밑간을 해준다.','MANUAL02'),(180,'3. 콩나물은 머리를 떼어내고 데쳐준다.','MANUAL03'),(180,'4. 계란은 황백지단으로 부친 후 채 썰어준다.','MANUAL04'),(180,'5. 3종류의 묵은 먹기 좋은 크기로 썰어준다.','MANUAL05'),(180,'6. 그릇에 밥을 담고 콩나물을 올리고 3종류의\n묵을 올린 후 계란으로 고명해 완성한다.','MANUAL06'),(180,'','MANUAL07'),(180,'','MANUAL08'),(180,'','MANUAL09'),(180,'','MANUAL10'),(180,'','MANUAL11'),(180,'','MANUAL12'),(180,'','MANUAL13'),(180,'','MANUAL14'),(180,'','MANUAL15'),(180,'','MANUAL16'),(180,'','MANUAL17'),(180,'','MANUAL18'),(180,'','MANUAL19'),(180,'','MANUAL20'),(181,'1. 쌀을 깨끗하게 씻은 후에 쌀뜨물은 따로\n보관하고 불려준 쌀로 밥을 해주고 접시에\n펼쳐 식혀준다.','MANUAL01'),(181,'2. 우엉과 연근, 감자는 송송 다져준 후 아린 맛을\n빼기위해 물에 담가준다.','MANUAL02'),(181,'3. 우엉과 연근, 감자는 물기를 빼고 볶아준다.','MANUAL03'),(181,'4. 청고추, 양파, 당근은 송송 다져서 함께\n볶아준 뒤, 함초 소금을 이용해 1차 간을\n해준다.','MANUAL04'),(181,'5. 그 릇 에 모 든 재 료 를 넣 고 오 니 기 리 를\n만들어준다.','MANUAL05'),(181,'6. 그릇에 담아 완성한다.','MANUAL06'),(181,'','MANUAL07'),(181,'','MANUAL08'),(181,'','MANUAL09'),(181,'','MANUAL10'),(181,'','MANUAL11'),(181,'','MANUAL12'),(181,'','MANUAL13'),(181,'','MANUAL14'),(181,'','MANUAL15'),(181,'','MANUAL16'),(181,'','MANUAL17'),(181,'','MANUAL18'),(181,'','MANUAL19'),(181,'','MANUAL20'),(182,'1. 단 호박은 속을 파 준다.','MANUAL01'),(182,'2. 찹쌀은 물에 불려준다.','MANUAL02'),(182,'3. 밤은 먹기 좋게 잘라서 물에 담가준다.','MANUAL03'),(182,'4. 대추는 씨를 제거하고 먹기 좋게 잘라준다.','MANUAL04'),(182,'5. 양념장을 만들어 먼저 쌀과 밤을 재워준 후\n찰밥을 만든다.','MANUAL05'),(182,'6. 단호박 속에 찰밥을 넣어서 찜기에 쪄준다.','MANUAL06'),(182,'','MANUAL07'),(182,'','MANUAL08'),(182,'','MANUAL09'),(182,'','MANUAL10'),(182,'','MANUAL11'),(182,'','MANUAL12'),(182,'','MANUAL13'),(182,'','MANUAL14'),(182,'','MANUAL15'),(182,'','MANUAL16'),(182,'','MANUAL17'),(182,'','MANUAL18'),(182,'','MANUAL19'),(182,'','MANUAL20'),(183,'1. 망고는 손질 후 버터로 살짝 볶고 레드와인을\n넣고 졸이다가 믹서로 갈아주고 딸기잼으로\n간과 농도를 맞추어 레드와인 소스를 만든다.','MANUAL01'),(183,'2. 소 채끝살은 손질 후 만들어진 레드와인 소스에\n마리네이드 해준다.','MANUAL02'),(183,'3. 감자는 껍질을 제거 후 먹기 좋은 크기로 잘라서\n뜨거운 물에 데쳐내 버터에 볶아준다. 당근은\n먹기좋은 크기로 잘라 뜨거운 물에 데쳐 버터\n에 볶아주고, 시금치도 데친 후 수분을 제거하\n고 버터에 볶는다.','MANUAL03'),(183,'4. 마리네이드 한 고기를 구워준다.','MANUAL04'),(183,'5. 마리네이드 하고 남은 망고소스를 다시 팬에\n졸여 소스를 만든다.','MANUAL05'),(183,'6. 접시에 준비된 채소와 안심을 담고 소스를\n뿌려 완성한다.','MANUAL06'),(183,'','MANUAL07'),(183,'','MANUAL08'),(183,'','MANUAL09'),(183,'','MANUAL10'),(183,'','MANUAL11'),(183,'','MANUAL12'),(183,'','MANUAL13'),(183,'','MANUAL14'),(183,'','MANUAL15'),(183,'','MANUAL16'),(183,'','MANUAL17'),(183,'','MANUAL18'),(183,'','MANUAL19'),(183,'','MANUAL20'),(184,'1. 식빵은 가장 자리를 잘라 밀대를 이용\n하여 얇게 밀어 준비한다.','MANUAL01'),(184,'2. 감자는 삶은 뒤 곱게 으깨어 올리고당을\n넣고 골고루 섞는다.','MANUAL02'),(184,'3. 달걀은 약 13분 정도 삶아 껍질을\n벗기고, 반으로 갈라 썰어놓는다.','MANUAL03'),(184,'4. 당근과 양파 오이도 얇게 썰어놓는다.','MANUAL04'),(184,'5. 토마토는 포를 떠서 준비한다.','MANUAL05'),(184,'6. 으깬 감자(②)에 준비한 달걀(③)과\n채소(④)를 넣고 소금을 약간 넣은 뒤\n골고루 섞어, 밀어 놓은 식빵에 토마토,\n치즈, 양상추와 함께 넣어 돌돌 말아\n완성한다.','MANUAL06'),(184,'','MANUAL07'),(184,'','MANUAL08'),(184,'','MANUAL09'),(184,'','MANUAL10'),(184,'','MANUAL11'),(184,'','MANUAL12'),(184,'','MANUAL13'),(184,'','MANUAL14'),(184,'','MANUAL15'),(184,'','MANUAL16'),(184,'','MANUAL17'),(184,'','MANUAL18'),(184,'','MANUAL19'),(184,'','MANUAL20'),(185,'1. 황태는 가위로 약 3cm 길이로 잘라\n스프레이로 물기를 준다.','MANUAL01'),(185,'2. 밀가루를 세 군데로 나눠 각각 찹쌀\n가루와 녹말가루, 삼색 가루를 넣어\n세 가지의 색을 만든다.','MANUAL02'),(185,'3. 만들어 놓은 밀가루에 달걀을 넣어\n골고루 섞는다.','MANUAL03'),(185,'4. 튀김 반죽(③)에 황태(①)를 넣어\n섞은 후, 튀김 기름 170℃ 의 온도에서\n약 1분 정도 튀겨 기름을 빼 놓는다.','MANUAL04'),(185,'5. 파프리카는 속씨를 제거하고, 양파와\n당근, 오이, 파인애플과 함께 썰어 준비\n한다.','MANUAL05'),(185,'6. 저염간장에 설탕과 식초를 넣어 골고루\n섞은 후 냄비에서 바글바글 끓이다가\n물녹말을 넣고, 썰어놓은 채소를 넣어\n한 번 더 끓인 후 황태 탕수육(④)에\n곁들여 완성한다.','MANUAL06'),(185,'','MANUAL07'),(185,'','MANUAL08'),(185,'','MANUAL09'),(185,'','MANUAL10'),(185,'','MANUAL11'),(185,'','MANUAL12'),(185,'','MANUAL13'),(185,'','MANUAL14'),(185,'','MANUAL15'),(185,'','MANUAL16'),(185,'','MANUAL17'),(185,'','MANUAL18'),(185,'','MANUAL19'),(185,'','MANUAL20'),(186,'1. 소시지는 먹기 좋은 크기로 썰어 나무\n막대기에 꽂아놓는다.','MANUAL01'),(186,'2. 파프리카는 작게 다져 준비한다.','MANUAL02'),(186,'3. 으깬 감자를 준비된 밥과 함께 골고루\n섞는다.','MANUAL03'),(186,'4. 으깬 감자를 다시 준비된 밥과 함께\n소금을 조금 넣고 골고루 섞는다.','MANUAL04'),(186,'5. 밥과 감자가 잘 섞어지면, 다시 다져진\n파프리카를 넣고 섞어준다.','MANUAL05'),(186,'6. 막대기에 밀가루를 살짝 바르고, 소시\n지에 반죽(⑤)을 감싸듯 손으로 둥글게\n말아 밀가루와, 달걀물, 빵가루 순서로\n입혀 튀김 기름 170℃의 온도에서\n약 2분 정도 튀긴 후 기름을 제거하여\n완성한다.','MANUAL06'),(186,'','MANUAL07'),(186,'','MANUAL08'),(186,'','MANUAL09'),(186,'','MANUAL10'),(186,'','MANUAL11'),(186,'','MANUAL12'),(186,'','MANUAL13'),(186,'','MANUAL14'),(186,'','MANUAL15'),(186,'','MANUAL16'),(186,'','MANUAL17'),(186,'','MANUAL18'),(186,'','MANUAL19'),(186,'','MANUAL20'),(187,'1. 소등심은 소금과 후춧가루, 로즈마리를\n뿌려 약 30분 이상 숙성을 시킨다.','MANUAL01'),(187,'2. 애호박은 동그랗게 자르고, 양파는 형태\n그대로 떼어내고, 가지는 직사각형으로\n잘라 준비한다.','MANUAL02'),(187,'3. 파프리카는 속을 파내고 작은 사각으로\n자르고, 토마토는 씨를 제거하고\n네모지게 잘라 준비해 놓는다.','MANUAL03'),(187,'4. 사과는 껍질을 깨끗이 씻어 길쭉하게\n썰어놓는다.','MANUAL04'),(187,'5. 발사믹소스에 설탕과 마늘을 넣고 썰어\n놓은 사과채를 넣어 잘 섞은 후 바글바글\n끓여 소스를 만들어놓는다.','MANUAL05'),(187,'6. 팬이 따끈해지면, 호박과 양파, 가지를\n구워 내고, 팬에 소등심을 앞뒤로 구워\n먹기 좋은 크기로 자른 뒤 구워 놓은\n양파와 호박, 가지에 각각 올리고,\n끓여놓은 소스와 파프리카, 토마토를\n얹어 완성한다.','MANUAL06'),(187,'','MANUAL07'),(187,'','MANUAL08'),(187,'','MANUAL09'),(187,'','MANUAL10'),(187,'','MANUAL11'),(187,'','MANUAL12'),(187,'','MANUAL13'),(187,'','MANUAL14'),(187,'','MANUAL15'),(187,'','MANUAL16'),(187,'','MANUAL17'),(187,'','MANUAL18'),(187,'','MANUAL19'),(187,'','MANUAL20'),(188,'1. 당근은 채를 곱게 썰어 준비한다.','MANUAL01'),(188,'2. 달걀은 노란자와 흰자로 나눠 각각\n지단을 부쳐 약 5cm 길이로 채를\n썰어놓는다.','MANUAL02'),(188,'3. 시금치는 끓는 물에 소금을 넣고 파랗게\n데쳐 물기를 제거하고 무쳐놓는다.','MANUAL03'),(188,'4. 돼지고기는 마늘, 파, 설탕, 맛술, 간장,\n후춧가루, 통깨, 참기름을 넣고 30분간\n숙성시킨 뒤 팬에 볶아서 준비한다.','MANUAL04'),(188,'5. 고구마는 삶아 으깨고, 두부는 소창에\n물기를 짜고, 토마토와 양파, 견과류는\n입자있게 다져섞는다.','MANUAL05'),(188,'6. 라이스 페이퍼를 따뜻한 물에 담궜\n다가 바로 꺼내어 으깬 고구마(⑤)를\n먼저 깔고, 그 위에 준비한 재료(②,\n③, ④)를 올려 돌돌 말은 뒤 먹기 좋은\n크기로 썰어 완성한다.','MANUAL06'),(188,'','MANUAL07'),(188,'','MANUAL08'),(188,'','MANUAL09'),(188,'','MANUAL10'),(188,'','MANUAL11'),(188,'','MANUAL12'),(188,'','MANUAL13'),(188,'','MANUAL14'),(188,'','MANUAL15'),(188,'','MANUAL16'),(188,'','MANUAL17'),(188,'','MANUAL18'),(188,'','MANUAL19'),(188,'','MANUAL20'),(189,'1. 밀가루를 세 개로 나눠 호박가루와\n백년초가루, 시금치가루를 각각 넣고\n물, 식용유, 소금을 넣어 반죽 한 후\n비닐봉지에 담아 1~2시간 정도 숙성\n시킨다.','MANUAL01'),(189,'2. 양파, 마늘, 버섯들은 입자있게 다져\n준비한다.','MANUAL02'),(189,'3. 두부는 소창을 이용하여 물기를 짜낸다.','MANUAL03'),(189,'4. 새우는 껍질과 내장을 제거하고 다져,\n마늘을 넣고 골고루 섞어준다.','MANUAL04'),(189,'5. 다진 채소(②), 으깬 두부(③), 새우\n(④)를 넣고 섞어서 만두소를 만들어\n준다.','MANUAL05'),(189,'6. 숙성된 만두 반죽(①)을 얇게 밀어\n꽃 모양으로 찍어 만두소(⑤)를 넣은\n뒤, 반죽을 맞잡아 모양을 만든다.\n우유와 생크림을 끓인 뒤 만들어 놓은\n만두를 넣고 은근히 찜을 하듯이 익혀\n완성한다.','MANUAL06'),(189,'','MANUAL07'),(189,'','MANUAL08'),(189,'','MANUAL09'),(189,'','MANUAL10'),(189,'','MANUAL11'),(189,'','MANUAL12'),(189,'','MANUAL13'),(189,'','MANUAL14'),(189,'','MANUAL15'),(189,'','MANUAL16'),(189,'','MANUAL17'),(189,'','MANUAL18'),(189,'','MANUAL19'),(189,'','MANUAL20'),(190,'1. 소고기와 돼지고기에 찹쌀가루와 밥을\n넣고 골고루 섞는다.','MANUAL01'),(190,'2. 섞여진 고기(1)에 파와 후춧가루, 간장,\n맛술, 생크림을 넣고 다시 잘 섞어 30분\n이상 숙성을 시킨다.','MANUAL02'),(190,'3. 새송이버섯은 다지고, 시금치는 뜨거운\n물에 데쳐 물기를 제거하고 잘게 다지고,\n당근도 다져 준비한다.','MANUAL03'),(190,'4. 양파와 마늘은 다져서 볶아 준비해\n놓는다.','MANUAL04'),(190,'5. 떡볶이 떡은 뜨거운 물에 잠시 담그어\n부드러워지면 꺼내서 잘게 다진다.','MANUAL05'),(190,'6. 숙성된 고기(②)에 다진 채소(③)와 볶은\n마늘과 양파(④), 떡볶이떡(⑤)을 넣고\n섞이도록 치댄 후 작은 떡갈비 모양을\n만들어 팬에 기름을 두르고, 앞뒤를 돌려\n가며 익힌 후, 냄비에 간장과 올리고당을\n넣고 끓이다가, 익힌 떡갈비를 넣고 자작\n하게 졸여 완성한다.','MANUAL06'),(190,'','MANUAL07'),(190,'','MANUAL08'),(190,'','MANUAL09'),(190,'','MANUAL10'),(190,'','MANUAL11'),(190,'','MANUAL12'),(190,'','MANUAL13'),(190,'','MANUAL14'),(190,'','MANUAL15'),(190,'','MANUAL16'),(190,'','MANUAL17'),(190,'','MANUAL18'),(190,'','MANUAL19'),(190,'','MANUAL20'),(191,'1. 쌀은 깨끗이 씻어 약 30분 이상 불려\n물기를 빼고 절구에 빻아놓는다.','MANUAL01'),(191,'2. 냄비에 물을 넣고, 다시마와 건새우 반을\n넣고 끓여 간단한 육수를 만들어 놓는다.','MANUAL02'),(191,'3. 건새우 반은 다져서 따로 준비하고,\n양파와 당근은 입자있게 다지고, 버섯을\n편으로 썰어 준비한다.','MANUAL03'),(191,'4. 홍합은 끓는 물에 소금을 넣고 데쳐\n껍질을 제거해 놓는다.','MANUAL04'),(191,'5. 냄비에 참기름을 넣고 빻아 놓은 쌀을\n넣어 은근히 볶는다.','MANUAL05'),(191,'6. 볶은 쌀(⑤)에 육수(②)를 붓고\n끓이다가 양파, 당근, 버섯(③)과\n홍합(④)을 넣고 어우러지게 나무\n주걱으로 저어가면 끓이다가 죽이\n다 익을 때쯤 다져 놓은 건새우\n(③)를 넣고 한 번 더 끓인 후 완성\n한다.','MANUAL06'),(191,'','MANUAL07'),(191,'','MANUAL08'),(191,'','MANUAL09'),(191,'','MANUAL10'),(191,'','MANUAL11'),(191,'','MANUAL12'),(191,'','MANUAL13'),(191,'','MANUAL14'),(191,'','MANUAL15'),(191,'','MANUAL16'),(191,'','MANUAL17'),(191,'','MANUAL18'),(191,'','MANUAL19'),(191,'','MANUAL20'),(192,'1. 우유에 등심을 넣어 30분간 재워 놓은\n뒤, 후춧가루, 정종을 발라 1시간 이상\n숙성시킨다.','MANUAL01'),(192,'2. 방울토마토는 반으로 잘라 준비한다.','MANUAL02'),(192,'3. 양상추는 먹기 좋은 크기로 찢어 놓는다.','MANUAL03'),(192,'4. 피클은 입자 있게 다져 준비한다.','MANUAL04'),(192,'5. 숙성시킨 등심(①)은 물기를 제거하고,\n먹기 좋은 크기로 썰어 밀가루, 달걀물,\n빵가루 순으로 입혀, 튀김 기름\n170~180℃ 온도에 약 3분 정도 튀긴\n후 기름을 빼 놓는다.','MANUAL05'),(192,'6. 삶은 달걀은 다지고 피클(④)에\n마요네즈를 넣어 섞어 샐러드 소스를\n만들고, 접시에 양상추를 깔고 그 위에\n어린잎채소, 돈가스(⑤)와 방울토마토\n(②)를 올려 소스와 함께 완성한다.','MANUAL06'),(192,'','MANUAL07'),(192,'','MANUAL08'),(192,'','MANUAL09'),(192,'','MANUAL10'),(192,'','MANUAL11'),(192,'','MANUAL12'),(192,'','MANUAL13'),(192,'','MANUAL14'),(192,'','MANUAL15'),(192,'','MANUAL16'),(192,'','MANUAL17'),(192,'','MANUAL18'),(192,'','MANUAL19'),(192,'','MANUAL20'),(193,'1. 스파게티는 끓는 물에 소금을 넣고 약\n10분 정도 삶아 건져 올리브 오일에\n살짝 발라 준비한다.','MANUAL01'),(193,'2. 양송이는 껍질을 벗겨 편으로 썰어\n놓는다.','MANUAL02'),(193,'3. 마늘과 양파는 굵게 다져놓는다.','MANUAL03'),(193,'4. 조개는 끓는 물에 데쳐 해감을 씻고,\n삶은 물을 소창에 걸러 육수를 만들어\n놓는다.','MANUAL04'),(193,'5. 냄비에 버터를 넣고, 다진 마늘과\n양파를 넣어 볶다가 밀가루를 넣고\n은근히 볶는다.','MANUAL05'),(193,'6. 볶고 있는 채소(⑤)에 육수(④)를 부어\n한소끔 끓인 뒤, 우유와 생크림을 넣고\n다시 끓으면 새우와 삶은 조개를 넣고\n살짝 끓인 후, 삶아놓은 스파게티면\n(①)을 넣고 한 번 더 끓이고 그 위에\n파슬리 가루를 살짝 뿌려 완성한다.','MANUAL06'),(193,'','MANUAL07'),(193,'','MANUAL08'),(193,'','MANUAL09'),(193,'','MANUAL10'),(193,'','MANUAL11'),(193,'','MANUAL12'),(193,'','MANUAL13'),(193,'','MANUAL14'),(193,'','MANUAL15'),(193,'','MANUAL16'),(193,'','MANUAL17'),(193,'','MANUAL18'),(193,'','MANUAL19'),(193,'','MANUAL20'),(194,'1. 닭날개는 끝을 잘라 뒤로 뒤집어 봉을\n만든다.','MANUAL01'),(194,'2. 오렌지즙과 레몬즙을 짜서 섞어 주고,\n생강을 갈아 소창에 걸러 즙을 낸다.','MANUAL02'),(194,'3. 닭봉(①)에 생강즙, 오렌지 ․ 레몬즙\n(②)을 발라 숙성시킨 후 다시 카레\n가루를 입힌다.','MANUAL03'),(194,'4. 땅콩은 물기 없이 입자있게 다진다.','MANUAL04'),(194,'5. 양파를 입자있게 다져 다진 땅콩과\n마요네즈, 파슬리가루, 요거트를\n넣고 골고루 섞어 소스를 만들어\n놓는다.','MANUAL05'),(194,'6. 카레가루를 입힌 닭봉은 튀김기름\n170~180℃ 온도에서 약 3분 정도 튀겨\n기름을 빼고, 접시에 어린잎을 담고\n만들어 놓은 소스와 닭봉을 함께 제공\n하여 완성한다.','MANUAL06'),(194,'','MANUAL07'),(194,'','MANUAL08'),(194,'','MANUAL09'),(194,'','MANUAL10'),(194,'','MANUAL11'),(194,'','MANUAL12'),(194,'','MANUAL13'),(194,'','MANUAL14'),(194,'','MANUAL15'),(194,'','MANUAL16'),(194,'','MANUAL17'),(194,'','MANUAL18'),(194,'','MANUAL19'),(194,'','MANUAL20'),(195,'1. 보리는 깨끗이 씻어 물에 약 30분 이상\n불려 놓고, 당근, 양파, 마늘, 대파는\n입자있게 다져 준비한다.','MANUAL01'),(195,'2. 시금치는 끓는 물에 소금을 넣고 데친 후\n생크림을 넣고 함께 갈아서 준비한다.','MANUAL02'),(195,'3. 오징어는 껍질을 벗겨 안쪽에 칼집을\n내어 새우와 함께 데치고, 조개는 해감\n후 다시마를 넣고 삶은 뒤 소창에 걸러\n육수를 만들어 놓는다.','MANUAL03'),(195,'4. 냄비에 버터를 넣고, 다진 마늘과 양파\n당근을 볶다가 불린 보리를 넣어 다시\n볶는다.','MANUAL04'),(195,'5. 볶아지는 냄비에 조개 삶은 육수를\n넣어 끓인다.','MANUAL05'),(195,'6. 끓여지는 냄비에 데친 조개와 해물,\n치즈, 우유를 넣어 어우러지게 저어\n가며 졸이듯 끓이다가 마지막에\n시금치와 생크림 갈은 것(②)을\n넣고 살짝 끓인 후 파슬리 가루를\n살짝 뿌려 완성한다.','MANUAL06'),(195,'','MANUAL07'),(195,'','MANUAL08'),(195,'','MANUAL09'),(195,'','MANUAL10'),(195,'','MANUAL11'),(195,'','MANUAL12'),(195,'','MANUAL13'),(195,'','MANUAL14'),(195,'','MANUAL15'),(195,'','MANUAL16'),(195,'','MANUAL17'),(195,'','MANUAL18'),(195,'','MANUAL19'),(195,'','MANUAL20'),(196,'1. 소고기와 돼지고기를 섞어, 후춧가루,\n매실액, 맛술을 넣어 재워둔다.','MANUAL01'),(196,'2. 양파와 당근, 새송이, 대파는 입자있게\n다지고 마늘은 곱게 다져 준비한다.','MANUAL02'),(196,'3. 재워둔 고기(①)에 파, 마늘, 양파,\n당근, 새송이를 넣고 골고루 섞는다.','MANUAL03'),(196,'4. 떡은 잘게 썰어 뜨거운 물에 잠시\n담그어 놓는다.','MANUAL04'),(196,'5. 섞어 놓은 고기(③)에 불려 놓은 떡을\n섞는다.','MANUAL05'),(196,'6. 고기반죽(⑤)을 조금씩 떼어 둥글게\n완자를 빚고, 팬에 기름을 둘러 굴리듯이\n굽는다. 냄비에 간장과 올리고당을 넣고\n끓이다가 구운 완자와 참기름을 넣어\n은근히 졸인 뒤 통깨를 얹어 완성한다.','MANUAL06'),(196,'','MANUAL07'),(196,'','MANUAL08'),(196,'','MANUAL09'),(196,'','MANUAL10'),(196,'','MANUAL11'),(196,'','MANUAL12'),(196,'','MANUAL13'),(196,'','MANUAL14'),(196,'','MANUAL15'),(196,'','MANUAL16'),(196,'','MANUAL17'),(196,'','MANUAL18'),(196,'','MANUAL19'),(196,'','MANUAL20'),(197,'1. 닭살은 한 번 정도 펴서 후춧가루를\n뿌려 사각지게 썰어 준비한다.','MANUAL01'),(197,'2. 브로컬리는 살짝 데쳐 썰고, 양송이\n버섯은 껍질을 벗겨 두툼하게 썰어\n준비한다.','MANUAL02'),(197,'3. 파프리카와 토마토는 속씨를 제거하고\n사각으로 썰고, 당근, 양파, 표고버섯도\n사각지게 썰어 준비한다.','MANUAL03'),(197,'4. 스파게티는 끓는 물에 소금을 넣고 약\n10분 정도 삶아 건져 올리브 오일을\n살짝 발라 준비한다.','MANUAL04'),(197,'5. 팬에 올리브 오일을 두르고, 따끈해지\n면, 닭살을 먼저 볶는다.','MANUAL05'),(197,'6. 닭고기살(⑤)에 준비한 채소(②,③)를\n넣고 살짝 볶다가 토마토 페이스트를\n넣어 다시 볶은 후 육수와 토마토소스,\n케첩, 생크림을 넣고 끓인 후 삶아놓은\n스파게티(④)를 넣고 한 번 더 끓여\n완성한다.','MANUAL06'),(197,'','MANUAL07'),(197,'','MANUAL08'),(197,'','MANUAL09'),(197,'','MANUAL10'),(197,'','MANUAL11'),(197,'','MANUAL12'),(197,'','MANUAL13'),(197,'','MANUAL14'),(197,'','MANUAL15'),(197,'','MANUAL16'),(197,'','MANUAL17'),(197,'','MANUAL18'),(197,'','MANUAL19'),(197,'','MANUAL20'),(198,'1. 배추, 오이는 얇게 채 썬 뒤 소금물에\n담가 절인 후 물기를 꼭 짜고,\n표고버섯은 채 썬 뒤 참기름과\n간장을 넣어 양념하고, 피망과\n당근은 얇게 채 썬다.','MANUAL01'),(198,'2. 예열된 팬에 배추, 오이, 채 썬 피망,\n표고버섯 순으로 센 불에서 각각\n볶고, 당근은 물기를 제거한 뒤\n녹말가루를 묻혀 150℃로 예열한\n기름에 튀긴다.','MANUAL02'),(198,'3. 닭가슴살은 얇게 저민 후\n후춧가루로 밑간을 한 뒤 볶아놓은\n채소를 올려 말아 계만두를 만든다.','MANUAL03'),(198,'4. 찜기에 물과 마늘, 대파를 넣고\n육수를 내면서 예열하다가 김이\n오르면 말아놓은 계만두를 넣고\n약 8분 정도 찐다.','MANUAL04'),(198,'5. 빠금장에 휘핑크림과 우유, 다진\n청양고추, 후춧가루, 참깨를 넣고\n끓여 빠금장소스를 만든다.','MANUAL05'),(198,'6. 계만두에 튀긴 당근과 삶은\n메추리알을 곁들인 뒤 빠금장소스를\n곁들여 마무리한다.','MANUAL06'),(198,'','MANUAL07'),(198,'','MANUAL08'),(198,'','MANUAL09'),(198,'','MANUAL10'),(198,'','MANUAL11'),(198,'','MANUAL12'),(198,'','MANUAL13'),(198,'','MANUAL14'),(198,'','MANUAL15'),(198,'','MANUAL16'),(198,'','MANUAL17'),(198,'','MANUAL18'),(198,'','MANUAL19'),(198,'','MANUAL20'),(199,'1. 닭가슴살을 다져서 두부와 섞어준다.','MANUAL01'),(199,'2. 수삼과 파프리카를 채 썰고, 대추는\n돌려서 깎아준다.','MANUAL02'),(199,'3. 닭가슴살두부반죽을 얇게 편 후\n파프리카, 수삼, 대추를 올린 뒤\n풀리지 않게 종이포일로 만다.','MANUAL03'),(199,'4. 김 오른 찜기에 20분간 쪄준다.','MANUAL04'),(199,'5. 블루베리잼과 화이트와인을 졸인 뒤\n설탕을 넣고 블루베리소스를 만든다.','MANUAL05'),(199,'6. 쪄낸 삼계선을 2㎝두께로 잘라 담고 블루베리소스를 곁들여 마무리한다.','MANUAL06'),(199,'','MANUAL07'),(199,'','MANUAL08'),(199,'','MANUAL09'),(199,'','MANUAL10'),(199,'','MANUAL11'),(199,'','MANUAL12'),(199,'','MANUAL13'),(199,'','MANUAL14'),(199,'','MANUAL15'),(199,'','MANUAL16'),(199,'','MANUAL17'),(199,'','MANUAL18'),(199,'','MANUAL19'),(199,'','MANUAL20'),(200,'1. 소를 고루 치대 반죽한다.','MANUAL01'),(200,'2. 표고버섯은 밑동을 제거한 뒤\n안쪽에 밀가루→달걀물 순서로\n바른 뒤 반죽을 넣고 달걀물을\n한 번 더 발라준 뒤 김 오른 찜기에\n15분간 찐다.','MANUAL02'),(200,'3. 잣과 대추를 올리고 달걀물을 한 번\n더 바르고 3분간 더 찐다.','MANUAL03'),(200,'4. 오렌지소스 재료를 팬에 넣고\n조린다.','MANUAL04'),(200,'5. 단호박은 얇게 썰어 노릇하게\n굽는다.','MANUAL05'),(200,'6. 쇠고기표고찜에 오렌지소스를\n뿌리고 피클과 구운 단호박을\n곁들여 마무리한다.','MANUAL06'),(200,'','MANUAL07'),(200,'','MANUAL08'),(200,'','MANUAL09'),(200,'','MANUAL10'),(200,'','MANUAL11'),(200,'','MANUAL12'),(200,'','MANUAL13'),(200,'','MANUAL14'),(200,'','MANUAL15'),(200,'','MANUAL16'),(200,'','MANUAL17'),(200,'','MANUAL18'),(200,'','MANUAL19'),(200,'','MANUAL20'),(201,'1. 돼지고기와 쇠고기는 고기 밑간을\n넣고 반죽을 만든다.','MANUAL01'),(201,'2. 가지를 길고 얇게 썬다.','MANUAL02'),(201,'3. 깨끗이 씻은 떡을 가지로 돌돌 말고\n그 위에 고기를 말아 떡갈비를\n만들고 팬에서 겉면이 노릇해질\n때까지만 익힌 뒤 김 오른 찜기에\n넣어 10분~15분 정도 찐다.','MANUAL03'),(201,'4. 유자청과 간장을 섞고 팬에서\n농도를 맞춰주며 살짝 졸여\n유자소스를 만든다.','MANUAL04'),(201,'5. 연근은 모양대로 얇게 썰어 기름에\n튀겨 연근칩을 만든다.','MANUAL05'),(201,'6. 떡갈비에 유자소스를 바르고\n연근칩을 올려 마무리한다.','MANUAL06'),(201,'','MANUAL07'),(201,'','MANUAL08'),(201,'','MANUAL09'),(201,'','MANUAL10'),(201,'','MANUAL11'),(201,'','MANUAL12'),(201,'','MANUAL13'),(201,'','MANUAL14'),(201,'','MANUAL15'),(201,'','MANUAL16'),(201,'','MANUAL17'),(201,'','MANUAL18'),(201,'','MANUAL19'),(201,'','MANUAL20'),(202,'1. 두부는 두 덩어리로 잘라 넓게 편다.','MANUAL01'),(202,'2. 새우, 관자, 파프리카를 함께 갈아\n속을 만든다.','MANUAL02'),(202,'3. 완두콩과 두유, 꿀, 검은깨를 섞은 뒤\n갈아 완두콩드레싱을 만든다.','MANUAL03'),(202,'4. 두부 사이에 속을 넣은 뒤 먹기 편한\n크기로 자른다.','MANUAL04'),(202,'5. 두부샌드를 김 오른 찜기에서\n15분 정도 찐다.','MANUAL05'),(202,'6. 완두콩드레싱과 새싹채소를 올려\n마무리한다.','MANUAL06'),(202,'','MANUAL07'),(202,'','MANUAL08'),(202,'','MANUAL09'),(202,'','MANUAL10'),(202,'','MANUAL11'),(202,'','MANUAL12'),(202,'','MANUAL13'),(202,'','MANUAL14'),(202,'','MANUAL15'),(202,'','MANUAL16'),(202,'','MANUAL17'),(202,'','MANUAL18'),(202,'','MANUAL19'),(202,'','MANUAL20'),(203,'1. 돼지고기는 핏물을 제거하고\n된장육수에 살짝 데친다.','MANUAL01'),(203,'2. 데친 돼지고기에 양념장을 넣고\n재운다.','MANUAL02'),(203,'3. 단호박은 도톰하게 썰고, 죽순,\n양파는 채 썰고, 대파는 어슷 썰고,\n마른 표고버섯은 불린 뒤 먹기\n좋은 크기로 썬다.','MANUAL03'),(203,'4. 팬에 올리브유를 두르고 재운\n돼지고기와 된장육수(50g)를 넣고\n볶는다.','MANUAL04'),(203,'5. 반 정도 익었을 때 단호박과 죽순,\n양파, 대파, 표고버섯, 다진 마늘을\n넣고 볶는다.','MANUAL05'),(203,'6. 부순 참깨와 참기름을 넣어\n마무리한다.','MANUAL06'),(203,'','MANUAL07'),(203,'','MANUAL08'),(203,'','MANUAL09'),(203,'','MANUAL10'),(203,'','MANUAL11'),(203,'','MANUAL12'),(203,'','MANUAL13'),(203,'','MANUAL14'),(203,'','MANUAL15'),(203,'','MANUAL16'),(203,'','MANUAL17'),(203,'','MANUAL18'),(203,'','MANUAL19'),(203,'','MANUAL20'),(204,'1. 콩고기는 물에 담가 20분 정도 불린\n뒤 양념장 ½과 버무린다.','MANUAL01'),(204,'2. 양파, 당근은 채 썰고, 양배추와\n깻잎, 버섯은 한입 크기로 썬다.','MANUAL02'),(204,'3. 부추와 미나리는 양파와 비슷한\n길이로 썰고, 청양고추는 어슷 썬다.','MANUAL03'),(204,'4. 들기름을 두른 팬에 다진 파와 마늘,\n생강을 넣고 약한 불에 볶다가\n콩고기를 넣고 나머지 양념장을\n뿌려 볶는다.','MANUAL04'),(204,'5. 어느 정도 볶아지면 양파, 당근을\n넣고 볶다가 양배추를 넣고 볶는다.','MANUAL05'),(204,'6. 양배추가 익으면 먹기 좋게 손질한\n버섯을 넣고 살짝 볶아 마무리한다.','MANUAL06'),(204,'','MANUAL07'),(204,'','MANUAL08'),(204,'','MANUAL09'),(204,'','MANUAL10'),(204,'','MANUAL11'),(204,'','MANUAL12'),(204,'','MANUAL13'),(204,'','MANUAL14'),(204,'','MANUAL15'),(204,'','MANUAL16'),(204,'','MANUAL17'),(204,'','MANUAL18'),(204,'','MANUAL19'),(204,'','MANUAL20'),(205,'1. 차돌박이는 고기 밑간에 재워둔다.','MANUAL01'),(205,'2. 파프리카, 양파는 깨끗이 씻어 곱게\n채 썰고, 부추도 비슷한 길이로 썬다.','MANUAL02'),(205,'3. 해초는 깨끗이 손질하여\n해초 밑간에 재운다.','MANUAL03'),(205,'4. 3가지 소스를 만든다.','MANUAL04'),(205,'5. 차돌박이를 팬에 볶아 준비한다.','MANUAL05'),(205,'6. 볶은 차돌박이와 해초, 부추,\n파프리카, 양파를 접시에 담고\n삼색소스를 곁들여 마무리한다.','MANUAL06'),(205,'','MANUAL07'),(205,'','MANUAL08'),(205,'','MANUAL09'),(205,'','MANUAL10'),(205,'','MANUAL11'),(205,'','MANUAL12'),(205,'','MANUAL13'),(205,'','MANUAL14'),(205,'','MANUAL15'),(205,'','MANUAL16'),(205,'','MANUAL17'),(205,'','MANUAL18'),(205,'','MANUAL19'),(205,'','MANUAL20'),(206,'1. 오리고기에 고기 밑간을 해 재운다.','MANUAL01'),(206,'2. 가지, 양파, 파프리카, 새송이버섯, 브로콜리는 깍둑 썰고, 부추는 5㎝ 길이로 썰고, 방울토마토는 꼭지만 따서 씻은 뒤 2등분한다.','MANUAL02'),(206,'3. 토마토, 양파, 풋고추는 갈아둔다.','MANUAL03'),(206,'4. 팬에 기름을 두르고 다진 마늘을\n넣고 볶다가 고추장과 갈아놓은\n토마토, 양파, 풋고추와 물엿을 넣고\n볶으면서 농도를 맞춰\n토마토고추장소스를 만든다.','MANUAL04'),(206,'5. 오리고기와 가지, 양파, 파프리카, 새송이버섯, 브로콜리를 같이 볶다가 토마토고추장소스를 넣어준다.','MANUAL05'),(206,'6. 접시에 담은 뒤 부추와 방울토마토를 곁들여 마무리한다.','MANUAL06'),(206,'','MANUAL07'),(206,'','MANUAL08'),(206,'','MANUAL09'),(206,'','MANUAL10'),(206,'','MANUAL11'),(206,'','MANUAL12'),(206,'','MANUAL13'),(206,'','MANUAL14'),(206,'','MANUAL15'),(206,'','MANUAL16'),(206,'','MANUAL17'),(206,'','MANUAL18'),(206,'','MANUAL19'),(206,'','MANUAL20'),(207,'1. 양배추, 양파, 표고버섯, 양송이버섯,\n파프리카, 피망은 먹기 좋은 크기로\n깍둑 썰고, 대파는 어슷 썬다.','MANUAL01'),(207,'2. 마늘은 편 썰어 기름 두른 팬에\n투명해질 때까지 4~5분 정도\n볶는다.','MANUAL02'),(207,'3. 토마토는 김 오른 찜기에 찐 후\n껍질을 벗겨 양파와 함께 으깨가며\n볶는다.','MANUAL03'),(207,'4. 비트도 곱게 갈아 넣고 함께 볶는다.','MANUAL04'),(207,'5. 식용유를 두른 팬에 돼지고기를\n넣고 토마토비트소스와 함께 볶는다.','MANUAL05'),(207,'6. 양념을 넣어 간을 맞춘 후 양배추,\n표고버섯, 양송이버섯, 파프리카,\n피망, 대파를 넣고 살짝 볶아\n마무리한다.','MANUAL06'),(207,'','MANUAL07'),(207,'','MANUAL08'),(207,'','MANUAL09'),(207,'','MANUAL10'),(207,'','MANUAL11'),(207,'','MANUAL12'),(207,'','MANUAL13'),(207,'','MANUAL14'),(207,'','MANUAL15'),(207,'','MANUAL16'),(207,'','MANUAL17'),(207,'','MANUAL18'),(207,'','MANUAL19'),(207,'','MANUAL20'),(208,'1. 검은콩을 불려 삶는다.','MANUAL01'),(208,'2. 마늘은 편으로 썰고, 쪽파는 송송\n썬다.','MANUAL02'),(208,'3. 동태포는 물기를 제거한다.','MANUAL03'),(208,'4. 믹서에 피시볼반죽 재료를 넣어 간\n뒤 동그랗게 빚고 콩식용유(5g)를\n두른 팬에 굴려가며 익힌다.','MANUAL04'),(208,'5. 팬에 녹말가루를 제외한 소스\n재료를 넣고 끓이다가 피시볼을\n넣고 조리고, 녹말가루로 농도를\n맞춘 뒤 쪽파를 뿌려 마무리한다.','MANUAL05'),(208,'','MANUAL06'),(208,'','MANUAL07'),(208,'','MANUAL08'),(208,'','MANUAL09'),(208,'','MANUAL10'),(208,'','MANUAL11'),(208,'','MANUAL12'),(208,'','MANUAL13'),(208,'','MANUAL14'),(208,'','MANUAL15'),(208,'','MANUAL16'),(208,'','MANUAL17'),(208,'','MANUAL18'),(208,'','MANUAL19'),(208,'','MANUAL20'),(209,'1. 냄비에 닭육수 재료를 넣고 20분간\n끓여 면포에 거른다.','MANUAL01'),(209,'2. 대하를 흐르는 물에 잘 헹구고\n머리와 껍질을 제거한 뒤\n화이트와인에 재운다.','MANUAL02'),(209,'3. 시금치를 손질한 후 끓는 물에 살짝\n데친다.','MANUAL03'),(209,'4. 팬에 닭육수(100g)와 유자청과\n매실액을 넣고 끓이다가 잘 섞이면\n대하를 넣어 조린다.','MANUAL04'),(209,'5. 대하가 익어갈 때쯤 시금치를 넣고\n1분간 더 조린다.','MANUAL05'),(209,'6. 그릇에 시금치를 올리고 그 위에\n대하를 올린 후 아보카도와\n토마토를 먹기 좋게 썰어 얹어\n마무리한다.','MANUAL06'),(209,'','MANUAL07'),(209,'','MANUAL08'),(209,'','MANUAL09'),(209,'','MANUAL10'),(209,'','MANUAL11'),(209,'','MANUAL12'),(209,'','MANUAL13'),(209,'','MANUAL14'),(209,'','MANUAL15'),(209,'','MANUAL16'),(209,'','MANUAL17'),(209,'','MANUAL18'),(209,'','MANUAL19'),(209,'','MANUAL20'),(210,'1. 냄비에 고기 삶는 재료를 넣고\n끓으면 돼지고기를 넣어 익힌다.','MANUAL01'),(210,'2. 가지는 길이로 납작하게 썰고,\n김치는 씻어 5㎝ 길이로 채 썰고,\n피망, 양파도 같은 길이로 채 썰고,\n생강과 마늘은 편으로 썰어 준비한다.','MANUAL02'),(210,'3. 팬에 올리브유를 약간 두르고\n가지를 살짝 굽는다.','MANUAL03'),(210,'4. 김치, 피망을 가지에 넣고 돌돌 만다.','MANUAL04'),(210,'5. 팬에 올리브유, 마늘, 생강,\n삶은 고기를 넣고 육즙이 나오지\n않도록 고기 겉면을 익힌 뒤 채 썬\n양파, 마늘, 레몬, 레드와인,\n올리고당을 넣고 조린다.','MANUAL05'),(210,'6. 고기에 간이 배면 건져내 먹기\n좋은 크기로 썰어 마무리한다.','MANUAL06'),(210,'','MANUAL07'),(210,'','MANUAL08'),(210,'','MANUAL09'),(210,'','MANUAL10'),(210,'','MANUAL11'),(210,'','MANUAL12'),(210,'','MANUAL13'),(210,'','MANUAL14'),(210,'','MANUAL15'),(210,'','MANUAL16'),(210,'','MANUAL17'),(210,'','MANUAL18'),(210,'','MANUAL19'),(210,'','MANUAL20'),(211,'1. 함초는 세척 후 송송 잘라준다. 이때 물이\n안 나오게 잘라주는 것이 중요하다.','MANUAL01'),(211,'2. 찹쌀은 미리 30분전에 불려준다.','MANUAL02'),(211,'3. 불린 찹쌀의 물기를 빼고 물 50g을 넣고 죽을\n끓이다가 함초를 넣고 더 끓인다.','MANUAL03'),(211,'4. 여기에 우유를 넣고 약불에서 은근히 끓여준다.','MANUAL04'),(211,'5. 죽이 어느정도 완성되면 치즈가루를 뿌려준다.','MANUAL05'),(211,'6. 죽이 완성되면 그릇에 담아 완성한다.','MANUAL06'),(211,'','MANUAL07'),(211,'','MANUAL08'),(211,'','MANUAL09'),(211,'','MANUAL10'),(211,'','MANUAL11'),(211,'','MANUAL12'),(211,'','MANUAL13'),(211,'','MANUAL14'),(211,'','MANUAL15'),(211,'','MANUAL16'),(211,'','MANUAL17'),(211,'','MANUAL18'),(211,'','MANUAL19'),(211,'','MANUAL20'),(212,'1. 두부는 사방 1cm로 잘라주고, 무는 반은\n나박썰기 하고 반은 국물을 낸다.','MANUAL01'),(212,'2. 두부는 사방 1cm로 잘라주고, 무는 반은\n나박썰기 하고 반은 국물을 낸다.','MANUAL02'),(212,'3. 황태는 먹기 좋게 잘라준다.','MANUAL03'),(212,'4. 황태, 대파뿌리, 함초, 무를 넣고 국물을 만든다.','MANUAL04'),(212,'5. 만들어진 국물에 함초와 대파뿌리를 건져내고\n어간장으로 간을 해준다. 국물을 만들고 남은\n무는 나박썰기 해서 국에 넣어준다.','MANUAL05'),(212,'6. 마지막에 두부를 넣어 끓여주고 먹기 직전에\n청홍고추와 쪽파를 올려 완성한다.','MANUAL06'),(212,'','MANUAL07'),(212,'','MANUAL08'),(212,'','MANUAL09'),(212,'','MANUAL10'),(212,'','MANUAL11'),(212,'','MANUAL12'),(212,'','MANUAL13'),(212,'','MANUAL14'),(212,'','MANUAL15'),(212,'','MANUAL16'),(212,'','MANUAL17'),(212,'','MANUAL18'),(212,'','MANUAL19'),(212,'','MANUAL20'),(213,'1. 주꾸미는 먹기 좋게 잘라주고, 바지락살은 물에\n데쳐서 수분을 빼고 생강청으로 비린내를 제\n거한 뒤 볶아준다.','MANUAL01'),(213,'2. 소고기와 닭가슴살은 각각 양념해준다.','MANUAL02'),(213,'3. 양파, 청고추, 홍고추, 당근은 채 썰어 함께\n볶아준다.','MANUAL03'),(213,'4. 볶아 놓은 채소와 고기, 해산물은 양념장에\n버무린다.','MANUAL04'),(213,'5. 미나리와 배를 곱게 채 썰어 올려서 완성한다.','MANUAL05'),(213,'','MANUAL06'),(213,'','MANUAL07'),(213,'','MANUAL08'),(213,'','MANUAL09'),(213,'','MANUAL10'),(213,'','MANUAL11'),(213,'','MANUAL12'),(213,'','MANUAL13'),(213,'','MANUAL14'),(213,'','MANUAL15'),(213,'','MANUAL16'),(213,'','MANUAL17'),(213,'','MANUAL18'),(213,'','MANUAL19'),(213,'','MANUAL20'),(214,'1. 냉동고등어는 먹기 좋은 크기로 잘라 전분을\n묻혀 기름에 두 번 튀겨준다.','MANUAL01'),(214,'2. 애호박, 방울토마토, 사과는 적당한 크기로\n잘라준다.','MANUAL02'),(214,'3. 감자와 양파는 적당한 크기로 자른 뒤 물 1컵\n에 감자를 먼저 넣고 끓여주다 양파를 넣고\n끓여 단맛을 내준다.','MANUAL03'),(214,'4. 우유에 카레가루를 섞어 불려준 뒤 끓고 있는\n감자에 넣어준다.','MANUAL04'),(214,'5. 튀겨진 고등어를 키친타월을 이용해 기름을\n빼준다.','MANUAL05'),(214,'6. 카레가 완성되면 사과, 방울토마토, 꿀을\n넣어주고 튀겨 놓은 고등어에 뿌려 완성한다.','MANUAL06'),(214,'','MANUAL07'),(214,'','MANUAL08'),(214,'','MANUAL09'),(214,'','MANUAL10'),(214,'','MANUAL11'),(214,'','MANUAL12'),(214,'','MANUAL13'),(214,'','MANUAL14'),(214,'','MANUAL15'),(214,'','MANUAL16'),(214,'','MANUAL17'),(214,'','MANUAL18'),(214,'','MANUAL19'),(214,'','MANUAL20'),(215,'1. 모든 재료를 한데 섞어준다.','MANUAL01'),(215,'2. 소스를 만들어준다.','MANUAL02'),(215,'3. 준비된 틀에 비닐을 깔고 기름을 발라준다.','MANUAL03'),(215,'4. 소스가 끓어오르면 모든 재료를 넣어 버무려\n준다.','MANUAL04'),(215,'5. 준비된 용기에 만들어진 재료를 쏟아 다져준다.','MANUAL05'),(215,'6. 식으면 잘라서 완성한다.','MANUAL06'),(215,'','MANUAL07'),(215,'','MANUAL08'),(215,'','MANUAL09'),(215,'','MANUAL10'),(215,'','MANUAL11'),(215,'','MANUAL12'),(215,'','MANUAL13'),(215,'','MANUAL14'),(215,'','MANUAL15'),(215,'','MANUAL16'),(215,'','MANUAL17'),(215,'','MANUAL18'),(215,'','MANUAL19'),(215,'','MANUAL20'),(216,'1. 양파는 네 번 정도 칼집을 내어 준다.','MANUAL01'),(216,'2. 절임물을 만들고 절임 물에 칼집 낸 양파를\n하루(24시간) 정도 절여준다.','MANUAL02'),(216,'3. 절임물을 버리지 말고 절임물 반에 생강청,\n식초, 청양고추를 잘라서 섞어주고 국물을\n만든다.','MANUAL03'),(216,'4. 만들어진 국물에 절여진 양파를 담가준다.','MANUAL04'),(216,'5. 24시간 후부터 먹을 수가 있다.','MANUAL05'),(216,'','MANUAL06'),(216,'','MANUAL07'),(216,'','MANUAL08'),(216,'','MANUAL09'),(216,'','MANUAL10'),(216,'','MANUAL11'),(216,'','MANUAL12'),(216,'','MANUAL13'),(216,'','MANUAL14'),(216,'','MANUAL15'),(216,'','MANUAL16'),(216,'','MANUAL17'),(216,'','MANUAL18'),(216,'','MANUAL19'),(216,'','MANUAL20'),(217,'1. 관자 50g은 편으로 썰어준다.','MANUAL01'),(217,'2. 편으로 썰어준 관자를 다진마늘, 흰후추,\n버터에 볶아준다.','MANUAL02'),(217,'3. 남은 관자 50g은 국물을 만들어준다.','MANUAL03'),(217,'4. 브로콜리와 시금치는 뜨거운 물에 데쳐낸 후\n국물 낸 볶은관자와 브로콜리, 시금치는 믹서\n에 간다.','MANUAL04'),(217,'5. 팬에 넣고 끓이고 우유를 넣고 한 번 더 끓여\n준다.','MANUAL05'),(217,'6. 생크림과 파마산치즈로 농도를 맞춘 후 그릇에\n담고 마늘칩을 올려서 완성한다.','MANUAL06'),(217,'','MANUAL07'),(217,'','MANUAL08'),(217,'','MANUAL09'),(217,'','MANUAL10'),(217,'','MANUAL11'),(217,'','MANUAL12'),(217,'','MANUAL13'),(217,'','MANUAL14'),(217,'','MANUAL15'),(217,'','MANUAL16'),(217,'','MANUAL17'),(217,'','MANUAL18'),(217,'','MANUAL19'),(217,'','MANUAL20'),(218,'1. 실곤약은 세척해 물기를 빼준 뒤 레몬즙을 살짝 뿌려준다.','MANUAL01'),(218,'2. 당근, 양파, 홍고추, 청고추는 채 썰어 볶는다.','MANUAL02'),(218,'3. 오이는 돌려깎기 해주고 팽이와 영양부추는 적당한 크기로 잘라 각각 살짝 볶아 건진다.','MANUAL03'),(218,'4. 달걀은 황백지단으로 만들어 채 썰어준다.','MANUAL04'),(218,'5. 소스를 팬에 만들어 준 뒤 곤약을 볶아준다.','MANUAL05'),(218,'6. 볶은 곤약에 ②를 넣고 한 번 더 볶은 뒤 ③을 섞어 그릇에 담고, 지단채를 올리고 참기름, 통깨를 뿌려 마무리한다.','MANUAL06'),(218,'','MANUAL07'),(218,'','MANUAL08'),(218,'','MANUAL09'),(218,'','MANUAL10'),(218,'','MANUAL11'),(218,'','MANUAL12'),(218,'','MANUAL13'),(218,'','MANUAL14'),(218,'','MANUAL15'),(218,'','MANUAL16'),(218,'','MANUAL17'),(218,'','MANUAL18'),(218,'','MANUAL19'),(218,'','MANUAL20'),(219,'1. 닭가슴살은 송송 다져준 후 소금, 후추로\n밑간을 해준다.','MANUAL01'),(219,'2. 미역은 물에 불려준 후 송송 잘라준다.','MANUAL02'),(219,'3. 두부는 물기를 꼭 짜준다.','MANUAL03'),(219,'4. 청양고추, 대파, 당근은 송송 다져준다.','MANUAL04'),(219,'5. 소스를 만들어준다.','MANUAL05'),(219,'6. 준비된 재료에 계란으로 반죽해 한입 크기로\n전을 부쳐준다.','MANUAL06'),(219,'','MANUAL07'),(219,'','MANUAL08'),(219,'','MANUAL09'),(219,'','MANUAL10'),(219,'','MANUAL11'),(219,'','MANUAL12'),(219,'','MANUAL13'),(219,'','MANUAL14'),(219,'','MANUAL15'),(219,'','MANUAL16'),(219,'','MANUAL17'),(219,'','MANUAL18'),(219,'','MANUAL19'),(219,'','MANUAL20'),(220,'1. 당귀는 잎만 떼어 먹기 좋게 잘라서 물에\n담가준다.','MANUAL01'),(220,'2. 두가지묵은 먹기 좋게 길이로 잘라준다.','MANUAL02'),(220,'3. 양파, 파프리카, 알배추는 가늘게 채 썰어준다.','MANUAL03'),(220,'4. 소스를 만들어준다.','MANUAL04'),(220,'5. 모든 재료를 담고 소스에 통깨를 섞은 뒤\n샐러드에 뿌려 완성한다.','MANUAL05'),(220,'','MANUAL06'),(220,'','MANUAL07'),(220,'','MANUAL08'),(220,'','MANUAL09'),(220,'','MANUAL10'),(220,'','MANUAL11'),(220,'','MANUAL12'),(220,'','MANUAL13'),(220,'','MANUAL14'),(220,'','MANUAL15'),(220,'','MANUAL16'),(220,'','MANUAL17'),(220,'','MANUAL18'),(220,'','MANUAL19'),(220,'','MANUAL20'),(221,'1. 블루베리는 믹서에 갈아서 체에 내려준다.','MANUAL01'),(221,'2. 물에 끓여주면서 흰앙금과 설탕을 풀어준다.','MANUAL02'),(221,'3. 여기에 다시 한천가루를 넣어 끓여준다.','MANUAL03'),(221,'4. 여기에 블루베리를 넣어 끓인다.','MANUAL04'),(221,'5. 몰드에 넣어서 시원한 곳에서 식혀준다.','MANUAL05'),(221,'6. 접시에 완성한다.','MANUAL06'),(221,'','MANUAL07'),(221,'','MANUAL08'),(221,'','MANUAL09'),(221,'','MANUAL10'),(221,'','MANUAL11'),(221,'','MANUAL12'),(221,'','MANUAL13'),(221,'','MANUAL14'),(221,'','MANUAL15'),(221,'','MANUAL16'),(221,'','MANUAL17'),(221,'','MANUAL18'),(221,'','MANUAL19'),(221,'','MANUAL20'),(222,'1. 장어 살 쪽에 칼집을 내어 우유와 후추로\n마리네이드 해서 비린내를 제거한다.','MANUAL01'),(222,'2. 우엉, 인삼, 홍고추는 채 썰어 냉수에 담가둔다','MANUAL02'),(222,'3. 미나리, 팽이는 먹기 좋게 썰어준다.','MANUAL03'),(222,'4. 양파, 청고추는 가늘게 채 썰어준다.','MANUAL04'),(222,'5. 장어는 찜기에 쪄준다.','MANUAL05'),(222,'6. 모든 채소를 한데 섞어 샐러드소스로 버무려\n샐러드를 만들어주고 장어와 함께 완성한다.','MANUAL06'),(222,'','MANUAL07'),(222,'','MANUAL08'),(222,'','MANUAL09'),(222,'','MANUAL10'),(222,'','MANUAL11'),(222,'','MANUAL12'),(222,'','MANUAL13'),(222,'','MANUAL14'),(222,'','MANUAL15'),(222,'','MANUAL16'),(222,'','MANUAL17'),(222,'','MANUAL18'),(222,'','MANUAL19'),(222,'','MANUAL20'),(223,'1. 두부는 1cm 두께로 잘라 볶은소금을 뿌려\n수분을 제거한다.','MANUAL01'),(223,'2. 오이는 껍질 부분만 송송 썰어준다.','MANUAL02'),(223,'3. 당근, 양파는 송송 썰어준다.','MANUAL03'),(223,'4. 두부는 노릇하게 구워준다.','MANUAL04'),(223,'5. 오이, 당근, 양파를 소스에 버무려 샐러드를\n만들고 소스도 함께 만든다.','MANUAL05'),(223,'6. 두부를 한입 크기로 잘라준 후 슬라이스햄과\n샐러드를 올려 소스랑 함께 완성한다.','MANUAL06'),(223,'','MANUAL07'),(223,'','MANUAL08'),(223,'','MANUAL09'),(223,'','MANUAL10'),(223,'','MANUAL11'),(223,'','MANUAL12'),(223,'','MANUAL13'),(223,'','MANUAL14'),(223,'','MANUAL15'),(223,'','MANUAL16'),(223,'','MANUAL17'),(223,'','MANUAL18'),(223,'','MANUAL19'),(223,'','MANUAL20'),(224,'1. 다진 쇠고기는 양념장에 버무려주고 두부는\n으깨준다.','MANUAL01'),(224,'2. 애호박, 당근은 송송 다져준다.','MANUAL02'),(224,'3. 표고버섯은 불려준 뒤 채 썰어 참기름과\n버섯마늘소금에 살짝 무쳐서 볶아준다.','MANUAL03'),(224,'4. 양념된 소고기는 팬에 볶아준다.','MANUAL04'),(224,'5. 소고기를 볶아주던 팬에 밥과 표고를 넣고\n끓여주다 두부를 넣고 죽을 해준다.','MANUAL05'),(224,'6. 다진 애호박, 당근을 넣어서 끓여주고 불을\n끄기 전에 청국장과 흑임자를 넣어 죽을\n완성한다.','MANUAL06'),(224,'','MANUAL07'),(224,'','MANUAL08'),(224,'','MANUAL09'),(224,'','MANUAL10'),(224,'','MANUAL11'),(224,'','MANUAL12'),(224,'','MANUAL13'),(224,'','MANUAL14'),(224,'','MANUAL15'),(224,'','MANUAL16'),(224,'','MANUAL17'),(224,'','MANUAL18'),(224,'','MANUAL19'),(224,'','MANUAL20'),(225,'1. 증편은 팬에 구워준다.','MANUAL01'),(225,'2. 망고와 방울토마토는 먹기 좋게 잘라준다.','MANUAL02'),(225,'3. 모든 채소는 먹기 좋게 잘라서 물에 담근다.','MANUAL03'),(225,'4. 소스 재료를 섞어 소스를 만들고, 접시에 준비된\n채소를 담고 소스를 뿌려준 후 구운 떡과 망고\n를 올려 완성한다.','MANUAL04'),(225,'','MANUAL05'),(225,'','MANUAL06'),(225,'','MANUAL07'),(225,'','MANUAL08'),(225,'','MANUAL09'),(225,'','MANUAL10'),(225,'','MANUAL11'),(225,'','MANUAL12'),(225,'','MANUAL13'),(225,'','MANUAL14'),(225,'','MANUAL15'),(225,'','MANUAL16'),(225,'','MANUAL17'),(225,'','MANUAL18'),(225,'','MANUAL19'),(225,'','MANUAL20'),(226,'1. 판젤라틴을 얼음물에 담군 후 흐물흐물\n해질 때까지 불려 둔다.','MANUAL01'),(226,'2. 토마토는 물을 넣고 갈아 준비한다.','MANUAL02'),(226,'3. 갈아 놓은 토마토에 올리고당과\n레몬즙을 넣어 골고루 섞는다.','MANUAL03'),(226,'4. 레몬즙을 넣은 토마토를 은근히\n끓인다.','MANUAL04'),(226,'5. 끓고 있는 토마토에 불린 젤라틴을\n넣고 녹여주고, 젤라틴이 녹으면\n불을 끄고, 접시에 담아 냉장고에 약\n20분 정도 굳힌다.','MANUAL05'),(226,'6. 팬에 설탕을 넣고 설탕이 녹으면,\n블루베리를 넣어 은근히 졸여진 후\n굳어진 토마토젤리 위에 올려 완성한다.','MANUAL06'),(226,'','MANUAL07'),(226,'','MANUAL08'),(226,'','MANUAL09'),(226,'','MANUAL10'),(226,'','MANUAL11'),(226,'','MANUAL12'),(226,'','MANUAL13'),(226,'','MANUAL14'),(226,'','MANUAL15'),(226,'','MANUAL16'),(226,'','MANUAL17'),(226,'','MANUAL18'),(226,'','MANUAL19'),(226,'','MANUAL20'),(227,'1. 닭가슴살은 가운데 1/4 정도 깊은 칼집\n넣어 소금과 후추를 뿌려놓는다.','MANUAL01'),(227,'2. 느타리버섯은 찢고, 베이컨은 네모지게\n썰어놓는다.','MANUAL02'),(227,'3. 시금치는 살짝 데쳐 썰고, 양파와 대파는\n입자있게 썰어 준비한다.','MANUAL03'),(227,'4. 팬에 버터를 두르고, 시금치와 버섯을\n넣어 볶다가 굴소스를 넣고 다시 볶아\n준다.','MANUAL04'),(227,'5. 닭가슴살에 볶아 놓은 시금치와 버섯을\n넣어 팬에 올리브기름으로 구워 익힌다.','MANUAL05'),(227,'6. 냄비에 베이컨과 양파를 넣어 볶다가\n카레가루를 넣어 살짝 볶고, 다시 우유와\n생크림, 대파를 넣고 끓여 카레소스를\n만들고, 어린잎채소와 닭스테이크\n(⑤)를 접시에 담고 카레 소스를 올려\n완성한다.','MANUAL06'),(227,'','MANUAL07'),(227,'','MANUAL08'),(227,'','MANUAL09'),(227,'','MANUAL10'),(227,'','MANUAL11'),(227,'','MANUAL12'),(227,'','MANUAL13'),(227,'','MANUAL14'),(227,'','MANUAL15'),(227,'','MANUAL16'),(227,'','MANUAL17'),(227,'','MANUAL18'),(227,'','MANUAL19'),(227,'','MANUAL20'),(228,'1. 돼지고기에 생강즙과 소금, 후춧가루를\n넣어 숙성한다.','MANUAL01'),(228,'2. 숙성된 돼지고기에 간장과 정종, 설탕,\n파, 마늘, 양파, 참기름, 통깨 넣어\n골고루 양념한다.','MANUAL02'),(228,'3. 새송이, 가지, 표고, 홍피망을 편으로\n썰어 준비한다.','MANUAL03'),(228,'4. 된장에 마요네즈와 생크림, 다진\n땅콩을 섞어놓는다.','MANUAL04'),(228,'5. 새송이와 가지, 표고, 홍피망은 팬에서\n굽는다.','MANUAL05'),(228,'6. 팬이 따끈해지면 양념한 돼지고기를\n구워 접시에 담고 그 위에 된장 소스를\n올리고, 구워낸 채소를 다시 위에 올려\n완성한다.','MANUAL06'),(228,'','MANUAL07'),(228,'','MANUAL08'),(228,'','MANUAL09'),(228,'','MANUAL10'),(228,'','MANUAL11'),(228,'','MANUAL12'),(228,'','MANUAL13'),(228,'','MANUAL14'),(228,'','MANUAL15'),(228,'','MANUAL16'),(228,'','MANUAL17'),(228,'','MANUAL18'),(228,'','MANUAL19'),(228,'','MANUAL20'),(229,'1. 생선살은 가시를 발라내고 곱게 으깨어\n놓는다.','MANUAL01'),(229,'2. 으깬 생선살에 맛술 과 생강즙, 소금을\n넣어 골고루 치댄다.','MANUAL02'),(229,'3. 잘 치댄 생선살에 밀가루를 넣어 다시\n치대어 준다.','MANUAL03'),(229,'4. 양파와 당근, 샐러리, 마늘은 곱게\n다지고, 옥수수는 알맹이를 준비한다.','MANUAL04'),(229,'5. 생선살에 다진 채소와 어린이 치즈를\n다져 섞는다.','MANUAL05'),(229,'6. 채소를 다져 섞은 생선살을 동글동글\n하게 완자를 빚어 튀김기름에 약 150℃\n온도에서 은근히 5분 정도 튀겨 완성\n한다.','MANUAL06'),(229,'','MANUAL07'),(229,'','MANUAL08'),(229,'','MANUAL09'),(229,'','MANUAL10'),(229,'','MANUAL11'),(229,'','MANUAL12'),(229,'','MANUAL13'),(229,'','MANUAL14'),(229,'','MANUAL15'),(229,'','MANUAL16'),(229,'','MANUAL17'),(229,'','MANUAL18'),(229,'','MANUAL19'),(229,'','MANUAL20'),(230,'1. 보리는 깨끗이 씻어 물을 충분히 붓고\n약 30분 정도 불려 준비한다.','MANUAL01'),(230,'2. 주꾸미는 밀가루를 넣고 조물조물\n주물러 다시 깨끗이 씻어 준비한다.','MANUAL02'),(230,'3. 씻어놓은 주꾸미는 살짝 데쳐 입자\n있게 다져 놓는다.','MANUAL03'),(230,'4. 미나리와 당근, 양파는 입자있게\n다져 놓는다.','MANUAL04'),(230,'5. 냄비에 참기름을 두르고, 주꾸미를\n먼저 볶다가 불린 보리쌀을 넣고 다시\n볶은 뒤 썰어놓은 채소(④)를 넣는다.','MANUAL05'),(230,'6. 냄비에 육수를 넣고 나무주걱으로\n은근히 저어가면 끓이다가 죽이 어우러\n지면, 우유와 치즈, 간장을 살짝 넣고\n한 번 더 끓여 완성한다.','MANUAL06'),(230,'','MANUAL07'),(230,'','MANUAL08'),(230,'','MANUAL09'),(230,'','MANUAL10'),(230,'','MANUAL11'),(230,'','MANUAL12'),(230,'','MANUAL13'),(230,'','MANUAL14'),(230,'','MANUAL15'),(230,'','MANUAL16'),(230,'','MANUAL17'),(230,'','MANUAL18'),(230,'','MANUAL19'),(230,'','MANUAL20'),(231,'1. 삼겹살은 로즈마리를 뿌려\n숙성시킨다.','MANUAL01'),(231,'2. 고구마는 삶아 준비하고, 감자는 웨지\n감자형으로 썰어 익힌 후 기름에 튀겨\n놓는다.','MANUAL02'),(231,'3. 삶아진 고구마를 으깨어 생크림을 넣어\n골고루 섞는다.','MANUAL03'),(231,'4. 오렌지는 즙을 짜 놓는다.','MANUAL04'),(231,'5. 숙성된 삼겹살은 오븐에 굽고, 브로컬리는\n살짝 데쳐 올리브오일에 볶아놓는다.','MANUAL05'),(231,'6. 팬에 오렌지즙과 설탕, 정종, 소금을\n넣고 바글바글 졸인 후 와사비를 넣어\n소스를 만들고, 오븐에 구어진 삼겹살을\n잘라 접시에 담고 그 위에 소스를\n살짝 올리고, 한쪽에는 감자튀김(②),\n고구마무스(③), 브로컬리(⑤)를\n곁들여 완성한다.','MANUAL06'),(231,'','MANUAL07'),(231,'','MANUAL08'),(231,'','MANUAL09'),(231,'','MANUAL10'),(231,'','MANUAL11'),(231,'','MANUAL12'),(231,'','MANUAL13'),(231,'','MANUAL14'),(231,'','MANUAL15'),(231,'','MANUAL16'),(231,'','MANUAL17'),(231,'','MANUAL18'),(231,'','MANUAL19'),(231,'','MANUAL20'),(232,'1. 마늘과 양파를 입자있게 다져 팬에 볶아\n식혀 준비하고 파프리카는 다져 놓는다.','MANUAL01'),(232,'2. 다진 소고기에 준비한 채소(①)와\n빵가루, 후춧가루, 소금 넣고 골고루 치\n대어 소고기 볼을 만든 후 후라이팬에\n버터와 식용유를 두르고 소고기볼을\n속까지 익혀 준비한다.','MANUAL02'),(232,'3. 바나나는 작게 깍뚝 모양으로 썰고,\n게맛살은 약 3cm 길이로 찢어 준비\n한다.','MANUAL03'),(232,'4. 고구마는 껍질을 벗겨 삶아 채에 내려\n마요네즈와 매실액을 넣어 섞은 뒤\n바나나, 게맛살(③)을 골고루 섞어\n소스를 만든다.','MANUAL04'),(232,'5. 브로컬리는 작게 썰어 미니버섯과\n함께 팬에 살짝 구워 준비한다.','MANUAL05'),(232,'6. 익혀 놓은 소고기볼(②)을 접시에 담고\n그 위에 소스(④)를 얹은 뒤 브로컬리와\n미니버섯(⑤), 어린잎을 올려 완성한다.','MANUAL06'),(232,'','MANUAL07'),(232,'','MANUAL08'),(232,'','MANUAL09'),(232,'','MANUAL10'),(232,'','MANUAL11'),(232,'','MANUAL12'),(232,'','MANUAL13'),(232,'','MANUAL14'),(232,'','MANUAL15'),(232,'','MANUAL16'),(232,'','MANUAL17'),(232,'','MANUAL18'),(232,'','MANUAL19'),(232,'','MANUAL20'),(233,'1. 수삼은 뇌두를 제거하고 양파와\n대파, 마늘과 함께 다진다','MANUAL01'),(233,'2. 다진 소고기에 다진 재료(①)와 간장,\n후춧가루, 정종, 찹쌀가루를 넣어\n골고루 섞는다.','MANUAL02'),(233,'3. 대추는 씨를 제거하고 채를 썰어\n곁들임채소로 준비하고, 새송이는\n길이로 썰어 갈비뼈 모양으로 만들어\n놓는다.','MANUAL03'),(233,'4. 양념이 된 소고기(②)를 새송이(③)에\n감싸듯 타원형 모양으로 떡갈비를\n만든다.','MANUAL04'),(233,'5. 만들어 놓은 떡갈비를 팬에 은근히\n익힌다.','MANUAL05'),(233,'6. 간장과 올리고당, 설탕, 육수를 넣고\n섞어가며 바글바글 끓인 뒤, 익힌 떡갈\n비(⑤)를 넣고 살짝 졸인 후 접시에 담고,\n그 위에 통깨를 살짝 뿌리고, 대추채(③)와\n어린잎을 곁들임채소로 올려 완성한다.','MANUAL06'),(233,'','MANUAL07'),(233,'','MANUAL08'),(233,'','MANUAL09'),(233,'','MANUAL10'),(233,'','MANUAL11'),(233,'','MANUAL12'),(233,'','MANUAL13'),(233,'','MANUAL14'),(233,'','MANUAL15'),(233,'','MANUAL16'),(233,'','MANUAL17'),(233,'','MANUAL18'),(233,'','MANUAL19'),(233,'','MANUAL20'),(234,'1. 밀가루를 세등분하여 각각 백년초,\n뽕잎, 치자 가루를 넣고 물을 넣고\n반죽을 한 뒤 비닐봉투에 넣어 숙성을\n시킨다.','MANUAL01'),(234,'2. 두부는 소창에 물기를 짜고, 양파, 파,\n마늘은 다지고, 부추는 송송 썰어 준비\n하고, 숙주는 뜨거운 물에 데쳐 곱게\n다진다.','MANUAL02'),(234,'3. 오징어는 껍질을 벗겨 입자있게 다져\n놓는다.','MANUAL03'),(234,'4. 다진고기에 준비한 두부와 양파, 파,\n마늘, 부추, 숙주(②)와 오징어(③)를\n넣어 섞은 후 참기름과 후춧가루, 통깨를\n넣어 딤섬 속을 만든다.','MANUAL04'),(234,'5. 숙성된 밀가루 반죽을 꺼내 밀대를\n이용하여 넓게 밀어 준다.','MANUAL05'),(234,'6. 밀어 놓은 반죽을 사각으로 자른 후\n그 안에 딤섬 속을 넣어 미나리를 데쳐\n끈을 만들어 딤섬 위쪽을 묶은 후\n찜통에서 김이 오르면 약 10분 정도\n쪄서 완성한다.','MANUAL06'),(234,'','MANUAL07'),(234,'','MANUAL08'),(234,'','MANUAL09'),(234,'','MANUAL10'),(234,'','MANUAL11'),(234,'','MANUAL12'),(234,'','MANUAL13'),(234,'','MANUAL14'),(234,'','MANUAL15'),(234,'','MANUAL16'),(234,'','MANUAL17'),(234,'','MANUAL18'),(234,'','MANUAL19'),(234,'','MANUAL20'),(235,'1. 양파와 대파, 당근, 마늘은 입자있게\n다져 준비한다.','MANUAL01'),(235,'2. 팬에 기름을 두르고, 팬이 따끈해 지면\n준비한 채소(①)를 넣어 재빠르게 볶아\n식힌다.','MANUAL02'),(235,'3. 메추리알은 찬물에 넣어 소금을 넣고\n약 5분 정도 삶아 건져 찬물에 헹구어\n껍질을 제거시켜 놓는다.','MANUAL03'),(235,'4. 준비한 밥에 볶아 놓은 채소와 소금을\n넣어 골고루 섞은 후 준비한 메추리알을\n감싸 준다.','MANUAL04'),(235,'5. 밥으로 감싼 메추리알을 밀가루와\n녹말을 섞어 그 위에 굴리고, 다시\n달걀물에 굴린 후 빵가루를 입혀준다.','MANUAL05'),(235,'6. 튀김 기름이 약 170℃ 정도 되면,\n만들어 놓은 메추리알을 넣어 골고루\n색이 나도록 튀겨 완성하고, 칠리소소와\n함께 제공한다.','MANUAL06'),(235,'','MANUAL07'),(235,'','MANUAL08'),(235,'','MANUAL09'),(235,'','MANUAL10'),(235,'','MANUAL11'),(235,'','MANUAL12'),(235,'','MANUAL13'),(235,'','MANUAL14'),(235,'','MANUAL15'),(235,'','MANUAL16'),(235,'','MANUAL17'),(235,'','MANUAL18'),(235,'','MANUAL19'),(235,'','MANUAL20'),(236,'1. 가지는 약 10cm 길이로 길고, 납작하게\n썰어 준비한다.','MANUAL01'),(236,'2. 팬에 올리브 오일을 살짝 둘러 썰어놓은\n가지를 소금을 넣고 살짝 익힌다.','MANUAL02'),(236,'3. 토마토는 반은 토마토 형태로 납작하게\n썰어 놓는다.','MANUAL03'),(236,'4. 토마토반은 입자있게 다져 준비한다.','MANUAL04'),(236,'5. 다진 토마토를 준비한 토마토소스에\n섞어 살짝 어우러지게 끓여 준비한다.','MANUAL05'),(236,'6. 구운 가지위에 토마토와 모짜렐라치즈를\n올려 팬에 굽고, 별도로 팽이버섯에\n후춧가루를 뿌려 살짝 구워 접시에 담고,\n끓여 놓은 토마토소스를 올려 완성한다.','MANUAL06'),(236,'','MANUAL07'),(236,'','MANUAL08'),(236,'','MANUAL09'),(236,'','MANUAL10'),(236,'','MANUAL11'),(236,'','MANUAL12'),(236,'','MANUAL13'),(236,'','MANUAL14'),(236,'','MANUAL15'),(236,'','MANUAL16'),(236,'','MANUAL17'),(236,'','MANUAL18'),(236,'','MANUAL19'),(236,'','MANUAL20'),(237,'1. 마늘과 양파는 입자있게 다져 볶아서 준비한다.','MANUAL01'),(237,'2. 다진 소고기와 돼지고기에 볶아놓은 마늘과 양파를 넣고, 소금과 후춧가루, 달걀물, 빵가루, 녹말가루를 넣어 골고루 치대어 숙성시킨다.','MANUAL02'),(237,'3. 깻잎은 곱게 채를 썰어 찬물에 담가 싱싱해 지면 건져 숙성된 고기에 넣는다.','MANUAL03'),(237,'4. 깻잎을 넣은 고기를 지름 4cm 크기의 함박스테이크 형태를 만들어 팬에 올리브오일을 넣고 익힌다','MANUAL04'),(237,'5. 냄비에 마른고추와 대파, 마늘, 와인, 저염간장, 올리고당, 설탕을 넣어 끓이다가, 토마토(2/3 분량)를 다져넣고, 뭉근하게 졸여 체에 걸러 놓는다.','MANUAL05'),(237,'6. 남은 토마토는 원형을 살려 슬라이스하여 접시에 깔아준 뒤 익힌 함박스테이를 얹고 메추리알은 한 개씩 반숙 지단을 부쳐 익힌 함박스테이크 위에 올린다.','MANUAL06'),(237,'','MANUAL07'),(237,'','MANUAL08'),(237,'','MANUAL09'),(237,'','MANUAL10'),(237,'','MANUAL11'),(237,'','MANUAL12'),(237,'','MANUAL13'),(237,'','MANUAL14'),(237,'','MANUAL15'),(237,'','MANUAL16'),(237,'','MANUAL17'),(237,'','MANUAL18'),(237,'','MANUAL19'),(237,'','MANUAL20'),(238,'1. 스파게티는 약 10분 정도 삶아 건져\n찬물에 헹궈 물기를 빼고 올리브오일을\n발라 준비한다.','MANUAL01'),(238,'2. 소고기는 넓게 편으로 펴서 간장, 설탕,\n마늘을 넣어 양념을 한다.','MANUAL02'),(238,'3. 양념된 소고기를 팬에 구워 냅킨위에\n올려 기름을 빼놓는다.','MANUAL03'),(238,'4. 깻잎과 양파, 파프리카는 길게 채를\n썰어 준비한다.','MANUAL04'),(238,'5. 팬에 기름을 넣고 팬이 뜨거울 때\n양파를 넣어 재빠르게 볶아낸다.','MANUAL05'),(238,'6. 준비한 육수에 설탕과 식초, 저염간장을\n넣어 차갑게 냉장보관하고, 그릇에\n스파게티를 담고, 그 위에 볶은 양파와\n깻잎, 파프리카와 구운 고기를 올린 후\n차가운 육수를 부어 완성한다.','MANUAL06'),(238,'','MANUAL07'),(238,'','MANUAL08'),(238,'','MANUAL09'),(238,'','MANUAL10'),(238,'','MANUAL11'),(238,'','MANUAL12'),(238,'','MANUAL13'),(238,'','MANUAL14'),(238,'','MANUAL15'),(238,'','MANUAL16'),(238,'','MANUAL17'),(238,'','MANUAL18'),(238,'','MANUAL19'),(238,'','MANUAL20'),(239,'1. 사과와 배는 껍질을 베이킹파우더에\n깨끗이 씻어 납작하게 썰어 설탕물에\n담그어 색이 변하지 않게 준비한다.','MANUAL01'),(239,'2. 바나나는 동글하게 썰고, 키위는 껍질을\n제거하고 은행잎 모양으로 썰고,\n파인애플은 가운데 심을 제거하고\n사각형 모양으로 썰어놓는다.','MANUAL02'),(239,'3. 마는 껍질을 벗겨 동글하게 썰어 준비\n한다.','MANUAL03'),(239,'4. 마늘은 입자있게 다져, 팬에 식용유를\n두르고 살짝 볶는다.','MANUAL04'),(239,'5. 고춧가루에 볶은 마늘(④), 식초. 설탕,\n간장, 고춧가루를 넣고, 골고루 섞어\n양념장을 만든다.','MANUAL05'),(239,'6. 설탕물에 사과와 배를 건지고, 준비한\n과일과 마를 담은 후 먹기 직전에 만들어\n놓은 양념장을 넣어 버무려 완성한다.','MANUAL06'),(239,'','MANUAL07'),(239,'','MANUAL08'),(239,'','MANUAL09'),(239,'','MANUAL10'),(239,'','MANUAL11'),(239,'','MANUAL12'),(239,'','MANUAL13'),(239,'','MANUAL14'),(239,'','MANUAL15'),(239,'','MANUAL16'),(239,'','MANUAL17'),(239,'','MANUAL18'),(239,'','MANUAL19'),(239,'','MANUAL20'),(240,'1. 새송이와 느타리, 표고버섯은 먹기\n좋은 형태로 썰어 준비한다.','MANUAL01'),(240,'2. 썰어 놓은 버섯에 소금을 살짝 뿌려\n놓는다.','MANUAL02'),(240,'3. 소금 뿌린 버섯에 녹말가루와 달걀물을\n넣고 골고루 섞는다.','MANUAL03'),(240,'4. 오이, 당근, 양파, 키위는 작은 깍두기\n모양으로 썰어 준비한다.','MANUAL04'),(240,'5. 냄비에 저염간장에 설탕을 넣고 골고루\n섞어 끓이다가, 물녹말을 풀어 농도를\n맞추고 썰어놓은 오이, 당근, 양파를\n넣어 소스를 만든다.','MANUAL05'),(240,'6. 튀김기름의 온도가 약 170~180℃ 정도\n올라오면 녹말옷을 입힌 버섯(③)을\n재빠르게 튀겨 기름을 제거하고, 접시에\n담아 소스(⑤)를 얹고 키위를 올려 완성\n한다.','MANUAL06'),(240,'','MANUAL07'),(240,'','MANUAL08'),(240,'','MANUAL09'),(240,'','MANUAL10'),(240,'','MANUAL11'),(240,'','MANUAL12'),(240,'','MANUAL13'),(240,'','MANUAL14'),(240,'','MANUAL15'),(240,'','MANUAL16'),(240,'','MANUAL17'),(240,'','MANUAL18'),(240,'','MANUAL19'),(240,'','MANUAL20'),(241,'1. 연어는 주사위 모양으로 썬다.','MANUAL01'),(241,'2. 양파, 파프리카도 주사위 모양으로\n썬다.','MANUAL02'),(241,'3. 아보카도와 오렌지도 같은 형태로\n썬다.','MANUAL03'),(241,'4. 사워크림에 다진 양파를 섞어 소스를\n만든다.','MANUAL04'),(241,'5. 어린잎은 찬물에 담궈 싱싱하게 한다.','MANUAL05'),(241,'6. 원형 몰드에 연어를 넣고, 옆으로\n야채와 과일을 담고 그 위에\n사워크림소스와 어린잎을 올린다.','MANUAL06'),(241,'','MANUAL07'),(241,'','MANUAL08'),(241,'','MANUAL09'),(241,'','MANUAL10'),(241,'','MANUAL11'),(241,'','MANUAL12'),(241,'','MANUAL13'),(241,'','MANUAL14'),(241,'','MANUAL15'),(241,'','MANUAL16'),(241,'','MANUAL17'),(241,'','MANUAL18'),(241,'','MANUAL19'),(241,'','MANUAL20'),(242,'1. 돼지고기는 오렌지와 레몬,\n올리브오일로 마리네이드 한다.','MANUAL01'),(242,'2. 파프리카, 양송이버섯은 썰어서 팬에\n굽는다.','MANUAL02'),(242,'3. 머스터드와 꿀을 섞어 소스를 만든다.','MANUAL03'),(242,'4. 시금치는 끓는 물에 데친다.','MANUAL04'),(242,'5. 마늘은 편으로 썰고 팬에 굽는다.','MANUAL05'),(242,'6. 돼지고기를 팬에 구워 접시에 담고,\n구운 마늘, 파프리카, 양송이버섯,\n데친 시금치를 담고 그 위에\n머스터드소스를 올린다.','MANUAL06'),(242,'','MANUAL07'),(242,'','MANUAL08'),(242,'','MANUAL09'),(242,'','MANUAL10'),(242,'','MANUAL11'),(242,'','MANUAL12'),(242,'','MANUAL13'),(242,'','MANUAL14'),(242,'','MANUAL15'),(242,'','MANUAL16'),(242,'','MANUAL17'),(242,'','MANUAL18'),(242,'','MANUAL19'),(242,'','MANUAL20'),(243,'1. 갈비는 찬물에 담궈 핏물을 뺀다.','MANUAL01'),(243,'2. 끓은 물에 갈비를 데친다.','MANUAL02'),(243,'3. 찬물에 표고버섯, 파, 마늘, 양파 및\n인삼을 넣고 데친 갈비를 넣고 약 2시간\n정도 끓여 갈비탕을 만든다.','MANUAL03'),(243,'4. 저염간장에 설탕을 섞어 고기소스를\n만든다.','MANUAL04'),(243,'5. 당면은 뜨거운 물에 불려 갈비탕을\n먹기 직전에 넣는다.','MANUAL05'),(243,'6. 달걀은 황백으로 나눠 지단을 부쳐\n완성된 갈비탕 위에 대추와 함께 올려\n완성한다.','MANUAL06'),(243,'','MANUAL07'),(243,'','MANUAL08'),(243,'','MANUAL09'),(243,'','MANUAL10'),(243,'','MANUAL11'),(243,'','MANUAL12'),(243,'','MANUAL13'),(243,'','MANUAL14'),(243,'','MANUAL15'),(243,'','MANUAL16'),(243,'','MANUAL17'),(243,'','MANUAL18'),(243,'','MANUAL19'),(243,'','MANUAL20'),(244,'1. 고구마는 깨끗이 씻어 찜통에 쪄낸다','MANUAL01'),(244,'2. 뜨거운 고구마는 식기 전에 으깬다.','MANUAL02'),(244,'3. 화이트 초콜릿은 중탕으로 녹여 으깬\n고구마와 섞는다','MANUAL03'),(244,'4. 체리는 믹서에 곱게 간다.','MANUAL04'),(244,'5. 젤라틴은 물에 불려 중탕으로 녹이고\n갈아 놓은 체리에 섞어 굳힌다','MANUAL05'),(244,'6. 견과류와 라즈베리, 건포도는 다져서\n굳힌 체리젤리에 뿌리고 고구마 무스를\n젤리 주위에 두르고 애플민트를\n올린다.','MANUAL06'),(244,'','MANUAL07'),(244,'','MANUAL08'),(244,'','MANUAL09'),(244,'','MANUAL10'),(244,'','MANUAL11'),(244,'','MANUAL12'),(244,'','MANUAL13'),(244,'','MANUAL14'),(244,'','MANUAL15'),(244,'','MANUAL16'),(244,'','MANUAL17'),(244,'','MANUAL18'),(244,'','MANUAL19'),(244,'','MANUAL20'),(245,'1. 닭살에 소금, 후추로 밑간을 한다.','MANUAL01'),(245,'2. 밑간한 닭살에 카레가루를 골고루\n묻힌다.','MANUAL02'),(245,'3. 양파, 당근, 토마토, 샐러리는 주사위\n모양으로 자른다','MANUAL03'),(245,'4. 냄비에 양파, 당근, 토마토, 샐러리를\n볶다가 카레가루를 넣고 끓여\n카레소스를 만든다.','MANUAL04'),(245,'5. 팬에 기름을 두르고 닭살을 익힌다.','MANUAL05'),(245,'6. 그릇에 익힌 닭살을 담고 카레소스를\n올린다.','MANUAL06'),(245,'','MANUAL07'),(245,'','MANUAL08'),(245,'','MANUAL09'),(245,'','MANUAL10'),(245,'','MANUAL11'),(245,'','MANUAL12'),(245,'','MANUAL13'),(245,'','MANUAL14'),(245,'','MANUAL15'),(245,'','MANUAL16'),(245,'','MANUAL17'),(245,'','MANUAL18'),(245,'','MANUAL19'),(245,'','MANUAL20'),(246,'1. 미숫가루는 설탕을 넣고 체에 한 번\n거른다.','MANUAL01'),(246,'2. 달걀노른자에 설탕을 넣고 중탕으로\n익힌다.','MANUAL02'),(246,'3. 버터는 중탕으로 녹이고 검은콩은 불린\n뒤 삶아 통조림콩, 버터와 함께 간다.','MANUAL03'),(246,'4. 바나나는 곱게 으깨고 흑임자는 곱게\n간다.','MANUAL04'),(246,'5. 우유는 냄비에 넣고 따끈하게 데운다.','MANUAL05'),(246,'6. 데워진 우유에 미숫가루와 모든 재료를\n골고루 섞는다.','MANUAL06'),(246,'','MANUAL07'),(246,'','MANUAL08'),(246,'','MANUAL09'),(246,'','MANUAL10'),(246,'','MANUAL11'),(246,'','MANUAL12'),(246,'','MANUAL13'),(246,'','MANUAL14'),(246,'','MANUAL15'),(246,'','MANUAL16'),(246,'','MANUAL17'),(246,'','MANUAL18'),(246,'','MANUAL19'),(246,'','MANUAL20'),(247,'1. 냄비에 망고퓨레, 레몬, 설탕을 넣고\n은근히 끓인다.','MANUAL01'),(247,'2. 젤라틴은 찬물에 불린 뒤 중탕으로\n녹여 망고퓨레에 넣고 틀에 굳힌다.','MANUAL02'),(247,'3. 생크림은 차갑게 휘핑하여 요거트와\n섞는다.','MANUAL03'),(247,'4. 생크림을 섞은 요거트에 설탕,\n크림치즈를 섞는다','MANUAL04'),(247,'5. 냄비에 라즈베리, 설탕을 넣고 은근히\n끓인다.','MANUAL05'),(247,'6. 접시에 굳힌 망고무스에 담고 그 위에\n라즈베리 소스와 크림치즈 소스, 다진\n파스타치오를 올리고 애플민트로\n장식한다.','MANUAL06'),(247,'','MANUAL07'),(247,'','MANUAL08'),(247,'','MANUAL09'),(247,'','MANUAL10'),(247,'','MANUAL11'),(247,'','MANUAL12'),(247,'','MANUAL13'),(247,'','MANUAL14'),(247,'','MANUAL15'),(247,'','MANUAL16'),(247,'','MANUAL17'),(247,'','MANUAL18'),(247,'','MANUAL19'),(247,'','MANUAL20'),(248,'1. 토마토는 끓는 물에 살짝 데친다.','MANUAL01'),(248,'2. 데친 토마토를 믹서에 곱게 갈고\n설탕을 넣고 섞는다.','MANUAL02'),(248,'3. 줄기토마토는 윗부분을 잘라내고 속을\n파낸다.','MANUAL03'),(248,'4. 오이와 양파는 입자있게 썬다.','MANUAL04'),(248,'5. 팬에 올리브오일을 두르고 썰어 놓은\n오이와 양파를 살짝 볶는다.','MANUAL05'),(248,'6. 을 파낸 줄기토마토에 볶아 놓은\n야채와 ?번을 넣는다.','MANUAL06'),(248,'','MANUAL07'),(248,'','MANUAL08'),(248,'','MANUAL09'),(248,'','MANUAL10'),(248,'','MANUAL11'),(248,'','MANUAL12'),(248,'','MANUAL13'),(248,'','MANUAL14'),(248,'','MANUAL15'),(248,'','MANUAL16'),(248,'','MANUAL17'),(248,'','MANUAL18'),(248,'','MANUAL19'),(248,'','MANUAL20'),(249,'1. 훈제 연어는 넓게 썬다.','MANUAL01'),(249,'2. 당근, 오이, 파프리카, 양파, 샐러리는\n길게 썬다.','MANUAL02'),(249,'3. 주꾸미는 소금에 주물러 씻는다.','MANUAL03'),(249,'4. 손질한 주꾸미, 소라는 끓는 물에\n데치고 썰어준다.','MANUAL04'),(249,'5. 고추장에 식초, 설탕을 넣고\n초고추장소스를 만든다.','MANUAL05'),(249,'6. 훈제 연어에 야채와 주꾸미, 소라를\n넣고 돌돌 말아 접시에 담고\n초고추장소스를 올리고 완두콩으로\n장식한다.','MANUAL06'),(249,'','MANUAL07'),(249,'','MANUAL08'),(249,'','MANUAL09'),(249,'','MANUAL10'),(249,'','MANUAL11'),(249,'','MANUAL12'),(249,'','MANUAL13'),(249,'','MANUAL14'),(249,'','MANUAL15'),(249,'','MANUAL16'),(249,'','MANUAL17'),(249,'','MANUAL18'),(249,'','MANUAL19'),(249,'','MANUAL20'),(250,'1. 곶감은 씨를 발라낸다.','MANUAL01'),(250,'2. 생강과 계피를 넣고 끓여 수정과를\n만든 뒤 냉동한다.','MANUAL02'),(250,'3. 홍시는 믹서로 곱게 갈고 틀어 넣어\n굳힌다.','MANUAL03'),(250,'4. 생크림은 차갑게 휘핑한다.','MANUAL04'),(250,'5. 불려 놓은 젤라틴을 굳혀 콩가루를\n섞어 인절미를 만든다','MANUAL05'),(250,'6. 자몽을 껍질을 제거 후 갈아서 젤리를\n만들고, 접시에 굳혀놓은 홍시와\n아이스 수정과를 담는다','MANUAL06'),(250,'','MANUAL07'),(250,'','MANUAL08'),(250,'','MANUAL09'),(250,'','MANUAL10'),(250,'','MANUAL11'),(250,'','MANUAL12'),(250,'','MANUAL13'),(250,'','MANUAL14'),(250,'','MANUAL15'),(250,'','MANUAL16'),(250,'','MANUAL17'),(250,'','MANUAL18'),(250,'','MANUAL19'),(250,'','MANUAL20'),(251,'1. 닭 살을 곱게 다진다.','MANUAL01'),(251,'2. 다진 닭살에 소금, 후춧가루, 매실청 및\n다진 마늘을 넣고 골고루 양념한다.','MANUAL02'),(251,'3. 믹서에 양파, 마늘, 감자, 찹쌀가루를\n넣고 간다.','MANUAL03'),(251,'4. 갈아 놓은 감자에 양념된 닭살과\n달걀을 섞는다.','MANUAL04'),(251,'5. 4번을 잘 치대 떡갈비 모양으로 만든다.','MANUAL05'),(251,'6. 팬에 기름을 살짝 두르고 떡갈비를\n앞뒤로 구워 익힌다.','MANUAL06'),(251,'','MANUAL07'),(251,'','MANUAL08'),(251,'','MANUAL09'),(251,'','MANUAL10'),(251,'','MANUAL11'),(251,'','MANUAL12'),(251,'','MANUAL13'),(251,'','MANUAL14'),(251,'','MANUAL15'),(251,'','MANUAL16'),(251,'','MANUAL17'),(251,'','MANUAL18'),(251,'','MANUAL19'),(251,'','MANUAL20'),(252,'1. 현미는 깨끗이 씻어 30분 이상 충분히\n불린 뒤 밥을 짓는다','MANUAL01'),(252,'2. 두부는 끓는 물에 데쳐 물기를 빼고\n곱게 다져 된장, 생크림, 매실청을 넣고\n골고루 섞는다.','MANUAL02'),(252,'3. 데친 두부에 된장, 생크림 및 매실청을\n골고루 섞는다.','MANUAL03'),(252,'4. 아욱과 단호박은 각각 찐 후 식힌다.','MANUAL04'),(252,'5. 찐 아욱 위에 현미밥을 올리고\n두부소스, 날치알, 새싹 단호박을\n올린다.','MANUAL05'),(252,'6. 아욱에 올린 밥을 동그랗게 말아\n접시에 담는다.','MANUAL06'),(252,'','MANUAL07'),(252,'','MANUAL08'),(252,'','MANUAL09'),(252,'','MANUAL10'),(252,'','MANUAL11'),(252,'','MANUAL12'),(252,'','MANUAL13'),(252,'','MANUAL14'),(252,'','MANUAL15'),(252,'','MANUAL16'),(252,'','MANUAL17'),(252,'','MANUAL18'),(252,'','MANUAL19'),(252,'','MANUAL20'),(253,'1. 물에 다시마를 넣고 약 10분 정도 끓인\n뒤 걸러 육수를 만든다.','MANUAL01'),(253,'2. 달걀과 다시마 육수를 1:1로 섞고 체에\n거른다.','MANUAL02'),(253,'3. ?를 체에 내린다.','MANUAL03'),(253,'4. 달걀물에 매생이를 풀어둔다.','MANUAL04'),(253,'5. 매생이를 풀어 놓은 달걀물에 요리술을\n넣어 섞는다.','MANUAL05'),(253,'6. 쪄낸 다마고도후에 날치알을 올려\n완성한다.','MANUAL06'),(253,'','MANUAL07'),(253,'','MANUAL08'),(253,'','MANUAL09'),(253,'','MANUAL10'),(253,'','MANUAL11'),(253,'','MANUAL12'),(253,'','MANUAL13'),(253,'','MANUAL14'),(253,'','MANUAL15'),(253,'','MANUAL16'),(253,'','MANUAL17'),(253,'','MANUAL18'),(253,'','MANUAL19'),(253,'','MANUAL20'),(254,'1. 다시마, 건새우, 물을 약 20분 정도\n끓인 뒤 체에 걸러 육수를 만든다.','MANUAL01'),(254,'2. 단호박은 껍질을 벗기고, 속을 깨끗이\n파내 슬라이스 한다','MANUAL02'),(254,'3. 슬라이스한 단호박을 까나리액젓에\n20분 정도 절인 뒤 물로 씻는다.','MANUAL03'),(254,'4. 부추는 5cm 길이로 썰고, 양파는\n채썰고, 배는 껍질을 벗겨 슬라이스로\n썰어둔다.','MANUAL04'),(254,'5. 만들어 놓은 육수에 고춧가루, 매실액,\n다진마늘을 섞어 양념장을 만든다','MANUAL05'),(254,'6. 단호박, 배, 양파, 부추를 양념장에\n버무린다.','MANUAL06'),(254,'','MANUAL07'),(254,'','MANUAL08'),(254,'','MANUAL09'),(254,'','MANUAL10'),(254,'','MANUAL11'),(254,'','MANUAL12'),(254,'','MANUAL13'),(254,'','MANUAL14'),(254,'','MANUAL15'),(254,'','MANUAL16'),(254,'','MANUAL17'),(254,'','MANUAL18'),(254,'','MANUAL19'),(254,'','MANUAL20'),(255,'1. 닭가슴살을 소금과 후추로 밑간한다.','MANUAL01'),(255,'2. 토마토와 마늘은 입자있게 다진다','MANUAL02'),(255,'3. 다진 토마토와 마늘을 냄비에 담아\n볶다가 물과 오레가노를 넣고 끓여\n소스를 만든다.','MANUAL03'),(255,'4. 팬에 올리브오일을 두르고 밑간 한\n닭가슴살을 노릇노릇하게 굽는다.','MANUAL04'),(255,'5. 가지는 길게 썬다.','MANUAL05'),(255,'6. 가지에 치즈를 감싸 익히고, 구운 닭\n스테이크를 옆에 담고 소스를 옮긴다.','MANUAL06'),(255,'','MANUAL07'),(255,'','MANUAL08'),(255,'','MANUAL09'),(255,'','MANUAL10'),(255,'','MANUAL11'),(255,'','MANUAL12'),(255,'','MANUAL13'),(255,'','MANUAL14'),(255,'','MANUAL15'),(255,'','MANUAL16'),(255,'','MANUAL17'),(255,'','MANUAL18'),(255,'','MANUAL19'),(255,'','MANUAL20'),(256,'1. 그릇에 다진 마늘, 사과식초, 설탕, 물을 섞어 설탕이 녹을 때까지 저어 마늘 드레싱을 만든다.','MANUAL01'),(256,'2. 양상추는 찬물에 담갔다가 물기를 빼서 한입 크기로 찢고, 무순은 손질하여 물기를 빼고, 방\n울토마토는 꼭지를 떼고 반으로 자른다.','MANUAL02'),(256,'3. 키위는 껍질을 벗기고 둥근 모양으로 썰고 그릇에 양상추, 방울토마토, 키위, 아몬드, 땅콩을 넣고 마늘 드레싱에 버무려 접시에 담아 무순을 곁들인다.','MANUAL03'),(256,'','MANUAL04'),(256,'','MANUAL05'),(256,'','MANUAL06'),(256,'','MANUAL07'),(256,'','MANUAL08'),(256,'','MANUAL09'),(256,'','MANUAL10'),(256,'','MANUAL11'),(256,'','MANUAL12'),(256,'','MANUAL13'),(256,'','MANUAL14'),(256,'','MANUAL15'),(256,'','MANUAL16'),(256,'','MANUAL17'),(256,'','MANUAL18'),(256,'','MANUAL19'),(256,'','MANUAL20'),(257,'1. 돌나물은 손질하여 찬물에 담갔다가 물기를 빼고, 깻잎은 씻어 한 장씩 앞뒤로 물기를 닦고, 식용 꽃은 찬물에 담가 놓는다.','MANUAL01'),(257,'2. 튀김 팬에 올리브유(50g)를 붓고 예열해 깻잎을 넣어 바삭하고 투명하게 튀긴 뒤 건지고 팬에 남은 깻잎 기름은 따로 둔다.','MANUAL02'),(257,'3. 석류 원액에 물(100ml)과 레시틴가루를 넣어 블렌더로 섞어 석류 거품을 만든다.','MANUAL03'),(257,'4. 관자는 막을 제거한 뒤 찬물에 씻고, 잘게 칼집을 내 후춧가루를 뿌린다.','MANUAL04'),(257,'5. 달군 팬에 올리브유(10g)를 두르고 관자를 넣어 겉은 노릇하게 굽는다.','MANUAL05'),(257,'6. 접시에 튀긴 깻잎, 돌나물, 구운 관자, 깻잎 기름을 순서대로 담고, 석류 거품을 올려 마무리한다.','MANUAL06'),(257,'','MANUAL07'),(257,'','MANUAL08'),(257,'','MANUAL09'),(257,'','MANUAL10'),(257,'','MANUAL11'),(257,'','MANUAL12'),(257,'','MANUAL13'),(257,'','MANUAL14'),(257,'','MANUAL15'),(257,'','MANUAL16'),(257,'','MANUAL17'),(257,'','MANUAL18'),(257,'','MANUAL19'),(257,'','MANUAL20'),(258,'1. 두유, 마요네즈, 물엿, 식초, 설탕, 물을 잘 섞어서 두유 드레싱을 만든다.','MANUAL01'),(258,'2. 양상추, 치커리, 레드치커리는 찬물에 담갔다가 물기를 빼서 한입 크기로 찢고 방울토마토는 꼭지를 떼고 반으로 자른다.','MANUAL02'),(258,'3. 주황 파프리카는 얇게 채를 썰고 그릇에 양상추, 치커리, 레드치커리, 파프리카, 방울토마토를 담고 두유 드레싱을 곁들인다.','MANUAL03'),(258,'','MANUAL04'),(258,'','MANUAL05'),(258,'','MANUAL06'),(258,'','MANUAL07'),(258,'','MANUAL08'),(258,'','MANUAL09'),(258,'','MANUAL10'),(258,'','MANUAL11'),(258,'','MANUAL12'),(258,'','MANUAL13'),(258,'','MANUAL14'),(258,'','MANUAL15'),(258,'','MANUAL16'),(258,'','MANUAL17'),(258,'','MANUAL18'),(258,'','MANUAL19'),(258,'','MANUAL20'),(259,'1. 케일은 깨끗이 씻어 잎은한입 크기로 자르고 줄기는 잘게 다진다.a','MANUAL01'),(259,'2. 오미자물, 요리당, 식초를 섞는다.b','MANUAL02'),(259,'3. (1)의 케일의 다진 줄기를 넣어 드레싱을 만든다.c','MANUAL03'),(259,'4. 그릇에 케일을 담고 오미자 드레싱을 끼얹는다.d','MANUAL04'),(259,'','MANUAL05'),(259,'','MANUAL06'),(259,'','MANUAL07'),(259,'','MANUAL08'),(259,'','MANUAL09'),(259,'','MANUAL10'),(259,'','MANUAL11'),(259,'','MANUAL12'),(259,'','MANUAL13'),(259,'','MANUAL14'),(259,'','MANUAL15'),(259,'','MANUAL16'),(259,'','MANUAL17'),(259,'','MANUAL18'),(259,'','MANUAL19'),(259,'','MANUAL20'),(260,'1. 된장, 고추장, 사과즙, 깨, 다진 마늘, 참기름을 넣어 소스를 만든다.','MANUAL01'),(260,'2. 꼬막을 30분간 소금물에 해감시킨 후 끓는 물에 10분 데친다.','MANUAL02'),(260,'3. 달래, 깻잎, 파프리카를 5cm로 썰고 꼬막과 달래, 깻잎, 파프리카에 소스를 넣고 버무린다.','MANUAL03'),(260,'','MANUAL04'),(260,'','MANUAL05'),(260,'','MANUAL06'),(260,'','MANUAL07'),(260,'','MANUAL08'),(260,'','MANUAL09'),(260,'','MANUAL10'),(260,'','MANUAL11'),(260,'','MANUAL12'),(260,'','MANUAL13'),(260,'','MANUAL14'),(260,'','MANUAL15'),(260,'','MANUAL16'),(260,'','MANUAL17'),(260,'','MANUAL18'),(260,'','MANUAL19'),(260,'','MANUAL20'),(261,'1. 마늘, 양파, 배는 다지고 고추장, 와사비, 고춧가루, 올리고당, 사과식초와 함께 섞어 고추장 소스를 만든다.','MANUAL01'),(261,'2. 가지는 길게 자르고, 미나리는 잎을 떼고, 파프리카는 채 썬다.','MANUAL02'),(261,'3. 가지는 찌고, 미나리와 베이컨은 데친 후 베이컨, 가지, 파프리카 순으로 올려 말아준 뒤 미나리로 묶어 접시에 담고 소스를 뿌려 완성한다.','MANUAL03'),(261,'','MANUAL04'),(261,'','MANUAL05'),(261,'','MANUAL06'),(261,'','MANUAL07'),(261,'','MANUAL08'),(261,'','MANUAL09'),(261,'','MANUAL10'),(261,'','MANUAL11'),(261,'','MANUAL12'),(261,'','MANUAL13'),(261,'','MANUAL14'),(261,'','MANUAL15'),(261,'','MANUAL16'),(261,'','MANUAL17'),(261,'','MANUAL18'),(261,'','MANUAL19'),(261,'','MANUAL20'),(262,'1. 검정깨, 마요네즈, 청국장 가루를 섞어 소스를 만든다.','MANUAL01'),(262,'2. 팬에 식용유를 둘러 연어와 마늘종을 굽는다.','MANUAL02'),(262,'3. 마늘종을 접시에 깔고 연어를 올린 뒤 소스를 뿌리고 채썬 대추채를 얹어 장식한다.\n대추채를 얹어 장식한다.','MANUAL03'),(262,'','MANUAL04'),(262,'','MANUAL05'),(262,'','MANUAL06'),(262,'','MANUAL07'),(262,'','MANUAL08'),(262,'','MANUAL09'),(262,'','MANUAL10'),(262,'','MANUAL11'),(262,'','MANUAL12'),(262,'','MANUAL13'),(262,'','MANUAL14'),(262,'','MANUAL15'),(262,'','MANUAL16'),(262,'','MANUAL17'),(262,'','MANUAL18'),(262,'','MANUAL19'),(262,'','MANUAL20'),(263,'1. 곤약과 두부는 사방 1㎝ 크기로\n깍둑 썰고, 가지와 애호박은 조금\n더 작은 크기로 썰고, 꽈리고추는\n얇게 송송 썬다.','MANUAL01'),(263,'2. 곤약을 끓는 물에 식초를 한두 방울\n떨어뜨린 후 삶아 냄새를 제거한 후\n찬물에 식힌다.','MANUAL02'),(263,'3. 올리브유(10g)를 두른 팬에 두부를\n올려 살짝 굽는다.','MANUAL03'),(263,'4. 팬에 조림장을 넣은 후 약한 불에서\n저어가며 끓이다가 조림장이 고루\n섞이면 곤약과 두부, 가지, 애호박을\n모두 넣고 조린다.','MANUAL04'),(263,'5. 조림장이 반 이상 졸아들면\n꽈리고추를 넣고 조금 더 조려\n마무리한다.','MANUAL05'),(263,'','MANUAL06'),(263,'','MANUAL07'),(263,'','MANUAL08'),(263,'','MANUAL09'),(263,'','MANUAL10'),(263,'','MANUAL11'),(263,'','MANUAL12'),(263,'','MANUAL13'),(263,'','MANUAL14'),(263,'','MANUAL15'),(263,'','MANUAL16'),(263,'','MANUAL17'),(263,'','MANUAL18'),(263,'','MANUAL19'),(263,'','MANUAL20'),(264,'1. 미나리, 숙주는 적당한 길이로 썰고,\n양파는 채 썰고, 대파, 고추,\n아스파라거스는 어슷하게 썬다.','MANUAL01'),(264,'2. 해산물을 끓는 물에 데친다.','MANUAL02'),(264,'3. 해산물 데친 물에 육수 재료를 넣고\n끓인 뒤 체에 걸러 육수를 만든다.','MANUAL03'),(264,'4. 냄비에 데친 해산물과 미나리, 숙주,\n양파, 대파, 청양고추, 아스파라거스,\n붉은 고추를 얹은 뒤 육수를 넣어\n끓인다.','MANUAL04'),(264,'5. 녹말물을 넣어 농도를 맞춘 뒤 조려\n마무리한다.','MANUAL05'),(264,'','MANUAL06'),(264,'','MANUAL07'),(264,'','MANUAL08'),(264,'','MANUAL09'),(264,'','MANUAL10'),(264,'','MANUAL11'),(264,'','MANUAL12'),(264,'','MANUAL13'),(264,'','MANUAL14'),(264,'','MANUAL15'),(264,'','MANUAL16'),(264,'','MANUAL17'),(264,'','MANUAL18'),(264,'','MANUAL19'),(264,'','MANUAL20'),(265,'1. 고구마, 당근, 양파, 파프리카는 깍둑\n썰고, 양송이버섯은 4등분해 썰고,\n브로콜리는 먹기 좋게 썬다.','MANUAL01'),(265,'2. 가자미에 밀가루, 달걀물을 묻혀\n버터를 두른 팬에 바삭하게 굽는다.','MANUAL02'),(265,'3. 식용유를 두른 팬을 약한 불로\n달궈 다진 마늘을 볶다가\n토마토페이스트를 넣어 볶는다.','MANUAL03'),(265,'4. 당근, 양파, 고구마를 넣어 볶다가\n브로콜리와 치킨스톡, 카레가루,\n강황가루을 넣어 잘 섞어 끓인다.','MANUAL04'),(265,'5. 코코넛 밀크와 생크림, 파프리카,\n양송이버섯을 넣어 살짝 더 끓인다.','MANUAL05'),(265,'6. 구운 가자미와 청양고추를 넣고\n조려 마무리한다.','MANUAL06'),(265,'','MANUAL07'),(265,'','MANUAL08'),(265,'','MANUAL09'),(265,'','MANUAL10'),(265,'','MANUAL11'),(265,'','MANUAL12'),(265,'','MANUAL13'),(265,'','MANUAL14'),(265,'','MANUAL15'),(265,'','MANUAL16'),(265,'','MANUAL17'),(265,'','MANUAL18'),(265,'','MANUAL19'),(265,'','MANUAL20'),(266,'1. 양파와 셀러리, 당근, 사과, 버섯은\n잘게 다지고, 가지, 양파는 한입\n크기로 썰고, 토마토는 십자로\n칼집을 내고 살짝 데쳐 껍질을\n벗긴 뒤 씨를 제거해 다진다.','MANUAL01'),(266,'2. 단호박과 브로콜리는 한입 크기로\n썰어 데친다.','MANUAL02'),(266,'3. 닭가슴살은 칼집을 내 닭밑간양념한\n뒤 팬에 식용유(10g)를 둘러\n80%정도 익힌다.','MANUAL03'),(266,'4. 팬에 식용유를 두르고 다진 마늘을\n먼저 볶다가 양파와 셀러리, 당근을\n넣어 볶고, 양파가 투명하게 변하면\n사과와 버섯을 넣어 볶는다.','MANUAL04'),(266,'5. 토마토를 넣어 3분 정도 더 볶다가\n닭육수와 월계수잎을 넣어 5분 정도\n푹 끓인 뒤 한 김 식혀 오레가노와\n바질을 넣고 믹서기에 곱게 갈아\n타콤소스를 만든다.','MANUAL05'),(266,'6. 단호박과 브로콜리, 양파, 가지를\n센 불에서 빠르게 볶은 뒤 닭고기와\n타콤소스를 넣어 조리다가 닭고기가\n다 익으면 접시에 담고,\n파슬리가루를 뿌려 마무리.','MANUAL06'),(266,'','MANUAL07'),(266,'','MANUAL08'),(266,'','MANUAL09'),(266,'','MANUAL10'),(266,'','MANUAL11'),(266,'','MANUAL12'),(266,'','MANUAL13'),(266,'','MANUAL14'),(266,'','MANUAL15'),(266,'','MANUAL16'),(266,'','MANUAL17'),(266,'','MANUAL18'),(266,'','MANUAL19'),(266,'','MANUAL20'),(267,'1. 콩을 충분히 불린 후 냄비에 물과\n함께 넣고 삶는다.','MANUAL01'),(267,'2. 양파와 버섯은 곱게 다진다.','MANUAL02'),(267,'3. 토마토를 끓는 물에 데쳐 껍질을\n벗긴 뒤 으깨 팬에서 끓인다.','MANUAL03'),(267,'4. 양파와 버섯을 넣고 끓여 숨이\n죽으면 설탕과 후춧가루로 간을\n한다.','MANUAL04'),(267,'5. 삶은 콩을 넣고 조린 뒤\n파슬리가루를 뿌려 마무리한다.','MANUAL05'),(267,'','MANUAL06'),(267,'','MANUAL07'),(267,'','MANUAL08'),(267,'','MANUAL09'),(267,'','MANUAL10'),(267,'','MANUAL11'),(267,'','MANUAL12'),(267,'','MANUAL13'),(267,'','MANUAL14'),(267,'','MANUAL15'),(267,'','MANUAL16'),(267,'','MANUAL17'),(267,'','MANUAL18'),(267,'','MANUAL19'),(267,'','MANUAL20'),(268,'1. 고추는 어슷 썰고, 무, 당근, 양파,\n노란 파프리카, 두부는 납작하게\n썬다.','MANUAL01'),(268,'2. 토마토소스 재료를 믹서에 갈아\n토마토소스를 만든다.','MANUAL02'),(268,'3. 두부를 제외한 납작 썬 재료를\n식용유(5g)를 두른 팬에 볶다가 갈아\n놓은 토마토소스를 함께 넣어 볶아\n토마토채소소스를 만든다.','MANUAL03'),(268,'4. 냄비에 육수 재료를 넣고\n끓어오르면 다시마를 건진 뒤 다진\n마늘을 넣고 다시 끓어오르면\n콩나물과 관자를 건져내 따로 둔다.','MANUAL04'),(268,'5. 육수에 토마토채소소스를 넣어 끓인\n후, 마지막으로 두부를 넣어 약 2분\n정도 끓인다.','MANUAL05'),(268,'6. 그릇에 담고 덜어놓았던 콩나물과\n관자, 고추를 올려 마무리한다.','MANUAL06'),(268,'','MANUAL07'),(268,'','MANUAL08'),(268,'','MANUAL09'),(268,'','MANUAL10'),(268,'','MANUAL11'),(268,'','MANUAL12'),(268,'','MANUAL13'),(268,'','MANUAL14'),(268,'','MANUAL15'),(268,'','MANUAL16'),(268,'','MANUAL17'),(268,'','MANUAL18'),(268,'','MANUAL19'),(268,'','MANUAL20'),(269,'1. 느타리버섯, 양송이버섯, 표고버섯,\n두부, 애호박, 양파, 껍질 벗긴 밤은\n사방 1cm로 깍뚝 썰고, 호두는\n반으로 가른다.','MANUAL01'),(269,'2. 뚝배기에 들기름을 두르고 호두와\n밤을 살짝 볶은 후 두부를 제외한\n재료를 넣고 볶는다.','MANUAL02'),(269,'3. 멸치다시마육수를 넣고 끓인다.','MANUAL03'),(269,'4. 들깻가루와 두부를 넣고 걸쭉하게\n끓여 마무리한다.','MANUAL04'),(269,'','MANUAL05'),(269,'','MANUAL06'),(269,'','MANUAL07'),(269,'','MANUAL08'),(269,'','MANUAL09'),(269,'','MANUAL10'),(269,'','MANUAL11'),(269,'','MANUAL12'),(269,'','MANUAL13'),(269,'','MANUAL14'),(269,'','MANUAL15'),(269,'','MANUAL16'),(269,'','MANUAL17'),(269,'','MANUAL18'),(269,'','MANUAL19'),(269,'','MANUAL20'),(270,'1. 냄비에 다시마와 물(250g)을 넣고\n중간 불에서 끓여 끓어오르면\n다시마를 건진다.','MANUAL01'),(270,'2. 감자와 연근은 껍질을 벗겨 깍둑\n썰고 물에 헹궈 전분기를\n제거한다.','MANUAL02'),(270,'3. 마른 미역은 미지근한 물에 담가\n불린 후 손으로 바락바락 주물러\n한입 크기로 썬다.','MANUAL03'),(270,'4. 찹쌀가루에 물(25g)과 소금(0.1g)을\n넣고 반죽해 작은 새알심을 만든다.','MANUAL04'),(270,'5. 냄비에 들기름을 두르고 미역과\n다진 마늘을 넣고 볶다가\n다시마물과 감자, 연근을 넣고\n끓인다.','MANUAL05'),(270,'6. 감자가 익을 때쯤 새알심을 넣어\n익힌 후 들깻가루를 넣고\n국간장으로 간을 해 마무리한다.','MANUAL06'),(270,'','MANUAL07'),(270,'','MANUAL08'),(270,'','MANUAL09'),(270,'','MANUAL10'),(270,'','MANUAL11'),(270,'','MANUAL12'),(270,'','MANUAL13'),(270,'','MANUAL14'),(270,'','MANUAL15'),(270,'','MANUAL16'),(270,'','MANUAL17'),(270,'','MANUAL18'),(270,'','MANUAL19'),(270,'','MANUAL20'),(271,'1. 대구는 비늘과 내장을 제거하고\n흐르는 물에 씻어 비린 향을 없앤다.','MANUAL01'),(271,'2. 미나리는 6cm 길이로 썰고,\n청양고추, 붉은 고추는 어슷하게\n썰고, 콩나물, 쑥갓을 씻어 준비한다.','MANUAL02'),(271,'3. 쑥가루와 밀가루를 섞고 물(15g)을\n조금씩 넣어가며 매끈해지도록\n반죽한 뒤 30분~1시간 정도\n숙성시킨다.','MANUAL03'),(271,'4. 냄비에 육수 재료를 넣어 10분간\n끓여 육수를 만든다.','MANUAL04'),(271,'5. 다진 마늘과 생강을 넣고 향이\n우러나면 대구를 넣은 뒤 대구가\n어느 정도 익으면 콩나물을 넣고,\n끓어오르면 수제비 반죽을 떼어\n넣는다.','MANUAL05'),(271,'6. 청양고추, 붉은 고추를 넣고 한소끔\n더 끓이다가 미나리와 쑥갓을\n얹은 뒤 바로 불을 꺼 마무리한다.','MANUAL06'),(271,'','MANUAL07'),(271,'','MANUAL08'),(271,'','MANUAL09'),(271,'','MANUAL10'),(271,'','MANUAL11'),(271,'','MANUAL12'),(271,'','MANUAL13'),(271,'','MANUAL14'),(271,'','MANUAL15'),(271,'','MANUAL16'),(271,'','MANUAL17'),(271,'','MANUAL18'),(271,'','MANUAL19'),(271,'','MANUAL20'),(272,'1. 육수를 끓인 양지는 건져 얇게 썬다.','MANUAL01'),(272,'2. 버섯은 잘게 찢고, 애호박은\n반달모양으로 납작 썰고, 고추와\n대파는 어슷하게 썬다.','MANUAL02'),(272,'3. 방울토마토에 열십자로 칼집을 넣고\n끓는 물에 데쳐 껍질을 벗긴다.','MANUAL03'),(272,'4. 냄비에 식용유(10g)를 두른 뒤\n다진 마늘을 넣고 볶아 향을 낸 뒤\n방울토마토를 넣고 볶는다.','MANUAL04'),(272,'5. 육수(300g), 콩나물, 쇠고기,\n느타리버섯, 애호박을 넣고 국간장과\n소금으로 간해 끓인다.','MANUAL05'),(272,'6. 어슷 썬 청양고추와 대파를 넣어\n마무리한다.','MANUAL06'),(272,'','MANUAL07'),(272,'','MANUAL08'),(272,'','MANUAL09'),(272,'','MANUAL10'),(272,'','MANUAL11'),(272,'','MANUAL12'),(272,'','MANUAL13'),(272,'','MANUAL14'),(272,'','MANUAL15'),(272,'','MANUAL16'),(272,'','MANUAL17'),(272,'','MANUAL18'),(272,'','MANUAL19'),(272,'','MANUAL20'),(273,'1. 냄비에 육수 재료를 넣고 10분 정도\n끓여 체에 걸러 육수를 만든다.','MANUAL01'),(273,'2. 양파는 채 썰고, 고추는 어슷 썰고,\n토마토는 잘게 다진다.','MANUAL02'),(273,'3. 돼지고기는 1.5cm 크기로 깍둑썰기\n하고, 핏물을 제거한다.','MANUAL03'),(273,'4. 냄비에 육수를 붓고 다진 토마토와\n다진 마늘, 바질가루를 넣고 끓인다.','MANUAL04'),(273,'5. 걸쭉해지면 설탕과 돼지고기를 넣고,\n고기가 익으면 채 썬 양파, 어슷\n썬 청양고추와 꼭지를 딴\n방울토마토를 넣는다.','MANUAL05'),(273,'6. 방울토마토의 껍질이 벗겨질 때까지\n끓이고 후춧가루를 넣어 마무리한다.','MANUAL06'),(273,'','MANUAL07'),(273,'','MANUAL08'),(273,'','MANUAL09'),(273,'','MANUAL10'),(273,'','MANUAL11'),(273,'','MANUAL12'),(273,'','MANUAL13'),(273,'','MANUAL14'),(273,'','MANUAL15'),(273,'','MANUAL16'),(273,'','MANUAL17'),(273,'','MANUAL18'),(273,'','MANUAL19'),(273,'','MANUAL20'),(274,'1. 쇠고기는 핏물을 제거한 뒤 양파,\n마늘을 넣고 물(300g)을 부어 1시간\n이상 끓인 뒤 면포에 걸러 육수를\n만든다.','MANUAL01'),(274,'2. 삶은 쇠고기는 건져내 결 반대\n방향으로 썬다.','MANUAL02'),(274,'3. 배추, 무, 느타리버섯, 표고버섯은\n먹기 좋은 크기로 썬다.','MANUAL03'),(274,'4. 전복은 깨끗이 손질한다.','MANUAL04'),(274,'5. 육수를 끓인 뒤 끓어오르면 무를\n넣어 반투명해지면 배추, 버섯,\n전복을 넣는다.','MANUAL05'),(274,'6. 전복이 익으면 쇠고기를 넣고\n저염간장으로 간을 해 마무리한다.','MANUAL06'),(274,'','MANUAL07'),(274,'','MANUAL08'),(274,'','MANUAL09'),(274,'','MANUAL10'),(274,'','MANUAL11'),(274,'','MANUAL12'),(274,'','MANUAL13'),(274,'','MANUAL14'),(274,'','MANUAL15'),(274,'','MANUAL16'),(274,'','MANUAL17'),(274,'','MANUAL18'),(274,'','MANUAL19'),(274,'','MANUAL20'),(275,'1. 김치를 씻은 뒤 줄기부분은 한입\n크기로 썰고, 잎은 따로 두고,\n토마토, 양파도 비슷한 크기로 썬다.','MANUAL01'),(275,'2. 오징어는 칼집을 넣고, 홍합,\n바지락, 주꾸미와 함께 살짝 데친 뒤\n식용유(10g) 두른 팬에 볶는다.','MANUAL02'),(275,'3. 새우, 부추, 불린 당면과 무말랭이는\n다진 뒤 녹말가루와 달걀을 넣어\n반죽해 김치주머니 소를 만든다.','MANUAL03'),(275,'4. 김치 잎에 소를 넣고 주머니\n모양으로 감싸 데친 미나리로\n묶는다.','MANUAL04'),(275,'5. 김치와 채소를 볶아 냄비에 담은 뒤\n해산물과 김치주머니를 넣고\n끓이다가 끓어오르면 쑥갓,\n느타리버섯, 팽이버섯, 고추를 올려\n마무리한다.','MANUAL05'),(275,'','MANUAL06'),(275,'','MANUAL07'),(275,'','MANUAL08'),(275,'','MANUAL09'),(275,'','MANUAL10'),(275,'','MANUAL11'),(275,'','MANUAL12'),(275,'','MANUAL13'),(275,'','MANUAL14'),(275,'','MANUAL15'),(275,'','MANUAL16'),(275,'','MANUAL17'),(275,'','MANUAL18'),(275,'','MANUAL19'),(275,'','MANUAL20'),(276,'1. 새송이버섯은 굵게 채썬 후 달군 프라이팬에 기름을 두르고 노릇하게 볶는다.a','MANUAL01'),(276,'2. 소스 팬에 두유, 생크림, 청양고추, 후추를 넣고 약한 불에 뭉근하게 졸인다.b','MANUAL02'),(276,'3. 볶은 새송이버섯을 소스에 넣고 고루 섞어 가며 조금 더 볶아 접시에 담은 후 새싹채소를 함께 곁들인다.c','MANUAL03'),(276,'','MANUAL04'),(276,'','MANUAL05'),(276,'','MANUAL06'),(276,'','MANUAL07'),(276,'','MANUAL08'),(276,'','MANUAL09'),(276,'','MANUAL10'),(276,'','MANUAL11'),(276,'','MANUAL12'),(276,'','MANUAL13'),(276,'','MANUAL14'),(276,'','MANUAL15'),(276,'','MANUAL16'),(276,'','MANUAL17'),(276,'','MANUAL18'),(276,'','MANUAL19'),(276,'','MANUAL20'),(277,'1. 파프리카는 씨를 빼고 버섯 크기와 비슷하게 썬다.a','MANUAL01'),(277,'2. 달구어진 팬에 카놀라유를 두르고 백일송이 버섯을 볶는다.b','MANUAL02'),(277,'3. 버섯이 살짝 숨이 죽으면 파프리카를 넣어 함께 볶아 접시에 담는다.c','MANUAL03'),(277,'','MANUAL04'),(277,'','MANUAL05'),(277,'','MANUAL06'),(277,'','MANUAL07'),(277,'','MANUAL08'),(277,'','MANUAL09'),(277,'','MANUAL10'),(277,'','MANUAL11'),(277,'','MANUAL12'),(277,'','MANUAL13'),(277,'','MANUAL14'),(277,'','MANUAL15'),(277,'','MANUAL16'),(277,'','MANUAL17'),(277,'','MANUAL18'),(277,'','MANUAL19'),(277,'','MANUAL20'),(278,'1. 가지는 꼭지를 떼어 편으로 썬다.','MANUAL01'),(278,'2. 새송이버섯은 길게 편으로 썰고, 표고버섯은 기둥을 떼고 납작하게 썬다.','MANUAL02'),(278,'3. 가지와 버섯은 끓는 물에 각각 데친 후 찬물에 식힌다.','MANUAL03'),(278,'4. 땅콩소스 재료를 섞어 땅콩소스를 만든다.','MANUAL04'),(278,'5. 데친 가지와 버섯은 물기를 제거해 그릇에 담고, 땅콩소스를 곁들여 마무리한다.','MANUAL05'),(278,'','MANUAL06'),(278,'','MANUAL07'),(278,'','MANUAL08'),(278,'','MANUAL09'),(278,'','MANUAL10'),(278,'','MANUAL11'),(278,'','MANUAL12'),(278,'','MANUAL13'),(278,'','MANUAL14'),(278,'','MANUAL15'),(278,'','MANUAL16'),(278,'','MANUAL17'),(278,'','MANUAL18'),(278,'','MANUAL19'),(278,'','MANUAL20'),(279,'1. 유자청, 레몬즙, 카놀라유, 흰 후추를 넣어 유자 드레싱을 만든다.','MANUAL01'),(279,'2. 실곤약은 끓는 물에 데치고 찬물에 헹궈 물기를 빼준다. 오이, 사과, 당근, 빨강 파프리카는 4cm 길이로 가늘게 채 썬다.','MANUAL02'),(279,'3. 실곤약, 오이, 사과, 당근, 빨강 파프리카에 유자 드레싱을 섞어 버무린다.c','MANUAL03'),(279,'','MANUAL04'),(279,'','MANUAL05'),(279,'','MANUAL06'),(279,'','MANUAL07'),(279,'','MANUAL08'),(279,'','MANUAL09'),(279,'','MANUAL10'),(279,'','MANUAL11'),(279,'','MANUAL12'),(279,'','MANUAL13'),(279,'','MANUAL14'),(279,'','MANUAL15'),(279,'','MANUAL16'),(279,'','MANUAL17'),(279,'','MANUAL18'),(279,'','MANUAL19'),(279,'','MANUAL20'),(280,'1. 냄비에 육수 재료를 넣고 10분간\n끓여 건진다.','MANUAL01'),(280,'2. 마늘은 다지고, 양파는 채 썰고,\n애호박은 반달모양으로 납작하게\n썬다.','MANUAL02'),(280,'3. 단배추는 5cm로 썰고, 대파는\n어슷 썰고, 두부는 0.5cm 두께로\n썬다.','MANUAL03'),(280,'4. 된장에 표고버섯가루, 날콩가루,\n육수(50g)를 넣어 섞는다.','MANUAL04'),(280,'5. 육수에 된장을 풀고 다진 마늘, 호박,\n양파, 단배추 순으로 넣어가며\n끓인다.','MANUAL05'),(280,'6. 끓으면 마른 새우, 대파를 넣어 살짝\n더 끓여 마무리한다.','MANUAL06'),(280,'','MANUAL07'),(280,'','MANUAL08'),(280,'','MANUAL09'),(280,'','MANUAL10'),(280,'','MANUAL11'),(280,'','MANUAL12'),(280,'','MANUAL13'),(280,'','MANUAL14'),(280,'','MANUAL15'),(280,'','MANUAL16'),(280,'','MANUAL17'),(280,'','MANUAL18'),(280,'','MANUAL19'),(280,'','MANUAL20'),(281,'1. 보리를 김 오른 찜기에 넣고 쪄서\n저염된장과 섞은 뒤 재워\n보리된장을 만든다.','MANUAL01'),(281,'2. 검은콩은 삶아서 간다.','MANUAL02'),(281,'3. 검은콩 삶은 물(200g)에 바지락,\n멸치, 다시마를 넣고 끓여 육수를\n만든다.','MANUAL03'),(281,'4. 애호박, 양파, 검은콩두부,\n표고버섯은 깍둑 썰고, 붉은 고추,\n청양고추, 대파는 어슷하게 썬다.','MANUAL04'),(281,'5. 육수에 보리된장을 풀고 호박, 양파,\n표고버섯을 넣고 끓인다.','MANUAL05'),(281,'6. 갈아놓은 검은콩을 넣어 농도를\n맞춘 후 검은콩두부, 대파, 고추를\n넣고 한소끔 끓여 마무리한다.','MANUAL06'),(281,'','MANUAL07'),(281,'','MANUAL08'),(281,'','MANUAL09'),(281,'','MANUAL10'),(281,'','MANUAL11'),(281,'','MANUAL12'),(281,'','MANUAL13'),(281,'','MANUAL14'),(281,'','MANUAL15'),(281,'','MANUAL16'),(281,'','MANUAL17'),(281,'','MANUAL18'),(281,'','MANUAL19'),(281,'','MANUAL20'),(282,'1. 냄비에 육수 재료를 넣고 10분간\n끓여 체로 건진다.','MANUAL01'),(282,'2. 단호박은 전자레인지에 2분간 넣고\n익힌 후 껍질을 벗겨 으깬다.','MANUAL02'),(282,'3. 배추와 새송이버섯을 먹기 좋은\n크기로 썰고 홍고추는 어슷 썬다.','MANUAL03'),(282,'4. 육수에 단호박을 넣어 잘 풀어준다.','MANUAL04'),(282,'5. 육수에 된장을 풀어 끓인다.','MANUAL05'),(282,'6. 배추와 새송이버섯을 넣어 익힌 후\n홍고추를 넣고 마무리한다.','MANUAL06'),(282,'','MANUAL07'),(282,'','MANUAL08'),(282,'','MANUAL09'),(282,'','MANUAL10'),(282,'','MANUAL11'),(282,'','MANUAL12'),(282,'','MANUAL13'),(282,'','MANUAL14'),(282,'','MANUAL15'),(282,'','MANUAL16'),(282,'','MANUAL17'),(282,'','MANUAL18'),(282,'','MANUAL19'),(282,'','MANUAL20'),(283,'1. 냄비에 육수 재료를 넣어 20분간\n끓인 뒤 불을 끄고 가다랑어포를\n넣어 10분간 우려 체에 걸러\n차갑게 식힌다.','MANUAL01'),(283,'2. 된장양념을 만든다.','MANUAL02'),(283,'3. 오이와 깻잎은 채 썬다.','MANUAL03'),(283,'4. 식힌 육수에 된장양념을 푼다.','MANUAL04'),(283,'5. 채 썬 오이와 깻잎을 올려\n마무리한다.','MANUAL05'),(283,'','MANUAL06'),(283,'','MANUAL07'),(283,'','MANUAL08'),(283,'','MANUAL09'),(283,'','MANUAL10'),(283,'','MANUAL11'),(283,'','MANUAL12'),(283,'','MANUAL13'),(283,'','MANUAL14'),(283,'','MANUAL15'),(283,'','MANUAL16'),(283,'','MANUAL17'),(283,'','MANUAL18'),(283,'','MANUAL19'),(283,'','MANUAL20'),(284,'1. 냄비에 무, 돼지고기, 다시마를 넣고\n끓이다가 끓어오르면 다시마를\n건지고 청주와 보리새우를 넣어\n약한 불로 끓여 고기가 익으면 체에\n거른다.','MANUAL01'),(284,'2. 숙주는 끝을 다듬고, 느타리버섯은\n결대로 찢고, 양파는 채 썰고, 대파와\n청양고추는 어슷 썰고, 무는\n납작하게 썬다.','MANUAL02'),(284,'3. 얼갈이배추는 밑동을 잘라 3cm\n간격으로 썰어 데친 뒤 찬물로 헹궈\n물기를 짠다.','MANUAL03'),(284,'4. 양념장을 만든 뒤 찢은 고기와\n얼갈이배추를 넣어 버무린다.','MANUAL04'),(284,'5. 육수에 무, 양념에 버무린 고기와\n얼갈이배추, 숙주, 느타리버섯, 대파,\n청양고추 순으로 넣어가며 푹 끓여\n마무리한다.','MANUAL05'),(284,'','MANUAL06'),(284,'','MANUAL07'),(284,'','MANUAL08'),(284,'','MANUAL09'),(284,'','MANUAL10'),(284,'','MANUAL11'),(284,'','MANUAL12'),(284,'','MANUAL13'),(284,'','MANUAL14'),(284,'','MANUAL15'),(284,'','MANUAL16'),(284,'','MANUAL17'),(284,'','MANUAL18'),(284,'','MANUAL19'),(284,'','MANUAL20'),(285,'1. 찬물에 육수 재료를 넣어 육수를\n우린다.','MANUAL01'),(285,'2. 육수에 미소된장을 풀어 차갑게\n식힌다.','MANUAL02'),(285,'3. 묵은 먹기 좋은 크기로 썬다.','MANUAL03'),(285,'4. 미니양배추는 반 자르고, 적양파,\n양파, 오이, 래디시, 당근,\n아스파라거스, 파프리카는 채 썰고,\n고추는 어슷 썰어 준비한다.','MANUAL04'),(285,'5. 달걀은 지단으로 부쳐 채 썰고,\n목이버섯은 물에 불린다.','MANUAL05'),(285,'6. 육수에 묵을 넣고 색을 맞춰 고명을\n올린 뒤 들깻가루, 참깨, 검은깨를\n얹어 마무리한다.','MANUAL06'),(285,'','MANUAL07'),(285,'','MANUAL08'),(285,'','MANUAL09'),(285,'','MANUAL10'),(285,'','MANUAL11'),(285,'','MANUAL12'),(285,'','MANUAL13'),(285,'','MANUAL14'),(285,'','MANUAL15'),(285,'','MANUAL16'),(285,'','MANUAL17'),(285,'','MANUAL18'),(285,'','MANUAL19'),(285,'','MANUAL20'),(286,'1. 물(600g)에 육수 재료를 넣고 15분간\n센 불에 끓인 후 10분간 약한 불로\n끓여 육수를 만든다.','MANUAL01'),(286,'2. 우삼겹을 펼쳐 깔고 그 위에 깻잎,\n느타리버섯, 팽이버섯 순으로\n올린다.','MANUAL02'),(286,'3. 돌돌 말고 쪽파로 묶어 고정시킨다.','MANUAL03'),(286,'4. 육수에 저염된장을 풀고 다진\n마늘을 넣은 뒤 청양고추와 돌돌 만\n고기를 넣고 약한 불에 살짝 익힌다.','MANUAL04'),(286,'5. 그릇에 담은 뒤 붉은 고추를 올려\n마무리한다.','MANUAL05'),(286,'','MANUAL06'),(286,'','MANUAL07'),(286,'','MANUAL08'),(286,'','MANUAL09'),(286,'','MANUAL10'),(286,'','MANUAL11'),(286,'','MANUAL12'),(286,'','MANUAL13'),(286,'','MANUAL14'),(286,'','MANUAL15'),(286,'','MANUAL16'),(286,'','MANUAL17'),(286,'','MANUAL18'),(286,'','MANUAL19'),(286,'','MANUAL20'),(287,'1. 감자는 깍둑 썰고, 애호박은\n모양대로 썰고, 쪽파, 양파, 부추는\n잘게 다진다.','MANUAL01'),(287,'2. 두부는 으깨 물기를 제거하고,\n대파는 송송 썰고, 고추는 어슷 썰고,\n표고버섯은 먹기 좋은 크기로 썬다.','MANUAL02'),(287,'3. 당면, 숙주는 끓는 물에 데친 뒤\n다지고, 브로콜리는 끓는 물에 살짝\n데친다.','MANUAL03'),(287,'4. 볼에 돼지고기, 다진 마늘, 쪽파,\n양파, 부추, 숙주, 당면, 두부를 넣은\n뒤 녹말가루를 섞어 반죽해 동글\n납작하게 빚어 완자를 만들어\n팬에 노릇하게 굽는다.','MANUAL04'),(287,'5. 물(300g)에 된장을 풀고 애호박과\n감자, 표고버섯을 넣고 끓이다가\n날콩가루를 넣은 뒤 청양고추,\n완자를 넣고 조금 더 끓인다.','MANUAL05'),(287,'6. 그릇에 브로콜리를 담고 국물을\n부은 뒤 채 썬 대파와 고추를 얹어\n마무리한다.','MANUAL06'),(287,'','MANUAL07'),(287,'','MANUAL08'),(287,'','MANUAL09'),(287,'','MANUAL10'),(287,'','MANUAL11'),(287,'','MANUAL12'),(287,'','MANUAL13'),(287,'','MANUAL14'),(287,'','MANUAL15'),(287,'','MANUAL16'),(287,'','MANUAL17'),(287,'','MANUAL18'),(287,'','MANUAL19'),(287,'','MANUAL20'),(288,'1. 콩은 삶아서 표고버섯과 함께\n물(30g)을 넣고 간다.','MANUAL01'),(288,'2. 저염된장, 날콩가루, 갈아 놓은 콩과\n표고버섯을 섞어 저염재래된장을\n만든다.','MANUAL02'),(288,'3. 냄비에 육수 재료를 끓여낸 뒤\n건진다.','MANUAL03'),(288,'4. 산나물과 애호박, 양파는 먹기 좋게\n썰고, 청양고추와 대파는 어슷하게\n썬다.','MANUAL04'),(288,'5. 저염재래된장을 육수에 풀고\n곤드레나물, 고구마순, 취나물을\n넣고 끓여 반 이상 익으면 애호박,\n양파를 넣는다.','MANUAL05'),(288,'6. 순두부, 양념, 청양고추, 대파를 넣고\n마무리한다.','MANUAL06'),(288,'','MANUAL07'),(288,'','MANUAL08'),(288,'','MANUAL09'),(288,'','MANUAL10'),(288,'','MANUAL11'),(288,'','MANUAL12'),(288,'','MANUAL13'),(288,'','MANUAL14'),(288,'','MANUAL15'),(288,'','MANUAL16'),(288,'','MANUAL17'),(288,'','MANUAL18'),(288,'','MANUAL19'),(288,'','MANUAL20'),(289,'1. 버섯은 밑동을 제거해 먹기 좋게\n손질하고, 양파는 채 썰고, 대파와\n청양고추는 어슷 썬다.','MANUAL01'),(289,'2. 토마토는 아주 잘게 다진다.','MANUAL02'),(289,'3. 된장양념을 만든다.','MANUAL03'),(289,'4. 냄비에 육수 재료를 넣고 15분간\n끓인 뒤 체로 건더기를 건지고,\n된장양념을 체에 내리면서 푼다.','MANUAL04'),(289,'5. 버섯을 넣고 끓으면 토마토, 다진\n마늘, 고춧가루, 들깻가루, 채 썬\n양파를 넣고 끓인다.','MANUAL05'),(289,'6. 송송 썬 대파와 청양고추를 넣고\n조금 더 끓여 마무리한다.','MANUAL06'),(289,'','MANUAL07'),(289,'','MANUAL08'),(289,'','MANUAL09'),(289,'','MANUAL10'),(289,'','MANUAL11'),(289,'','MANUAL12'),(289,'','MANUAL13'),(289,'','MANUAL14'),(289,'','MANUAL15'),(289,'','MANUAL16'),(289,'','MANUAL17'),(289,'','MANUAL18'),(289,'','MANUAL19'),(289,'','MANUAL20'),(290,'1. 새송이버섯, 닭가슴살, 양파, 마늘,\n부추는 잘게 다지고, 두부도 곱게\n다진 뒤 물기를 제거한 후 간장을\n넣고 함께 섞어 동그랗게 빚은 뒤\n녹말가루와 밀가루를 섞어\n반죽을 굴린다.','MANUAL01'),(290,'2. 차가운 물에 넣었다 뺀 뒤 가루에\n굴리기를 2~3회 반복해 겉에\n만두피가 코팅되면 끓는 물에 살짝\n데친다.','MANUAL02'),(290,'3. 고추는 어슷 썰고, 팽이버섯, 애호박,\n두부는 먹기 좋게 썬다.','MANUAL03'),(290,'4. 냄비에 저염된장을 제외한 육수\n재료와 물을 넣고 끓어오르면\n저염된장을 체에 내려 풀고 면포에\n거른다.','MANUAL04'),(290,'5. 육수에 굴림만두와 애호박,\n팽이버섯을 넣고 끓인다.','MANUAL05'),(290,'6. 굴림만두가 적당히 익으면 두부를\n넣고 끓인 뒤 고추 고명을 얹어\n마무리한다.','MANUAL06'),(290,'','MANUAL07'),(290,'','MANUAL08'),(290,'','MANUAL09'),(290,'','MANUAL10'),(290,'','MANUAL11'),(290,'','MANUAL12'),(290,'','MANUAL13'),(290,'','MANUAL14'),(290,'','MANUAL15'),(290,'','MANUAL16'),(290,'','MANUAL17'),(290,'','MANUAL18'),(290,'','MANUAL19'),(290,'','MANUAL20'),(291,'1. 물(250g)에 멸치를 넣고 육수를\n낸다.','MANUAL01'),(291,'2. 바지락은 해감해 준비하고 주꾸미는\n손질한다.','MANUAL02'),(291,'3. 마른 미역과 마른 표고버섯은 물에\n불린다.','MANUAL03'),(291,'4. 육수에 된장을 풀고, 바지락과\n주꾸미를 넣어 끓인다.','MANUAL04'),(291,'5. 해물이 어느 정도 익으면 미역,\n표고버섯을 넣고 끓인다.','MANUAL05'),(291,'6. 끓어오르면 순두부를 넣고 콩가루를\n넣어 더 끓이다가 송송 썬 대파를\n올려 마무리한다.','MANUAL06'),(291,'','MANUAL07'),(291,'','MANUAL08'),(291,'','MANUAL09'),(291,'','MANUAL10'),(291,'','MANUAL11'),(291,'','MANUAL12'),(291,'','MANUAL13'),(291,'','MANUAL14'),(291,'','MANUAL15'),(291,'','MANUAL16'),(291,'','MANUAL17'),(291,'','MANUAL18'),(291,'','MANUAL19'),(291,'','MANUAL20'),(292,'1. 곤약을 식촛물에 살짝 데친 뒤\n나머지 반죽 재료와 함께 믹서에\n넣고 갈아 치댄다.','MANUAL01'),(292,'2. 스테이크 반죽을 동글납작하게 빚고\n팬에 식용유를 살짝 둘러 구운 뒤\n140℃로 달군 오븐에서 30분간\n굽는다.','MANUAL02'),(292,'3. 새송이버섯, 가지, 브로콜리, 양파,\n파프리카, 방울토마토, 아스파라거스는\n올리브유에 구워 준비한다.','MANUAL03'),(292,'4. 팬에 유자청과 저염간장, 물을 넣고\n끓여 유자청간장소스를 만든다.','MANUAL04'),(292,'5. 접시에 곤약함박스테이크를 담고\n어린잎채소를 올리고, 구운 채소와\n유자청간장소스를 곁들여\n마무리한다.','MANUAL05'),(292,'','MANUAL06'),(292,'','MANUAL07'),(292,'','MANUAL08'),(292,'','MANUAL09'),(292,'','MANUAL10'),(292,'','MANUAL11'),(292,'','MANUAL12'),(292,'','MANUAL13'),(292,'','MANUAL14'),(292,'','MANUAL15'),(292,'','MANUAL16'),(292,'','MANUAL17'),(292,'','MANUAL18'),(292,'','MANUAL19'),(292,'','MANUAL20'),(293,'1. 두부가 잠길 정도로 물을 부어\n5~7분 정도 삶는다.a','MANUAL01'),(293,'2. 삶은 두부와 플레인요거트, 검은깨\n를 믹서에 넣고 간 다음 냉장고에\n1시간 정도 보관한다.b','MANUAL02'),(293,'3. 차가워진 스프를 그릇에 담고 그\n위에 청국장가루를 얹는다.c','MANUAL03'),(293,'','MANUAL04'),(293,'','MANUAL05'),(293,'','MANUAL06'),(293,'','MANUAL07'),(293,'','MANUAL08'),(293,'','MANUAL09'),(293,'','MANUAL10'),(293,'','MANUAL11'),(293,'','MANUAL12'),(293,'','MANUAL13'),(293,'','MANUAL14'),(293,'','MANUAL15'),(293,'','MANUAL16'),(293,'','MANUAL17'),(293,'','MANUAL18'),(293,'','MANUAL19'),(293,'','MANUAL20'),(294,'1. 고구마와 단호박을 찜기에 10~20분 동안 익힌 후 껍질을 제거하고 으깨어 체에 거른\n다.','MANUAL01'),(294,'2. 냄비에 고구마, 단호박, 우유, 설탕을 넣고 잘 저어주며 끓인다.','MANUAL02'),(294,'3. 스프의 농도를 보면서 물을 조금씩 넣어가며 걸쭉하게 끓여준다.','MANUAL03'),(294,'','MANUAL04'),(294,'','MANUAL05'),(294,'','MANUAL06'),(294,'','MANUAL07'),(294,'','MANUAL08'),(294,'','MANUAL09'),(294,'','MANUAL10'),(294,'','MANUAL11'),(294,'','MANUAL12'),(294,'','MANUAL13'),(294,'','MANUAL14'),(294,'','MANUAL15'),(294,'','MANUAL16'),(294,'','MANUAL17'),(294,'','MANUAL18'),(294,'','MANUAL19'),(294,'','MANUAL20'),(295,'1. 시금치는 뚜껑을 열고 데친 후, 물기를 뺀다.','MANUAL01'),(295,'2. 마, 시금치, 두유를 함께 갈아 체에 거른다.','MANUAL02'),(295,'3. 가열된 팬에 버터를 두르고 약불에서 2와 밥을 넣어 밥의 색을 입히고 소금, 후추가루로 간을 한다.','MANUAL03'),(295,'','MANUAL04'),(295,'','MANUAL05'),(295,'','MANUAL06'),(295,'','MANUAL07'),(295,'','MANUAL08'),(295,'','MANUAL09'),(295,'','MANUAL10'),(295,'','MANUAL11'),(295,'','MANUAL12'),(295,'','MANUAL13'),(295,'','MANUAL14'),(295,'','MANUAL15'),(295,'','MANUAL16'),(295,'','MANUAL17'),(295,'','MANUAL18'),(295,'','MANUAL19'),(295,'','MANUAL20'),(296,'1. 당근과 표고버섯, 고사리는 5cm로 채 썰고, 애호박도 돌려 깎아 5cm로\n채 썬다.','MANUAL01'),(296,'2. 우렁은 3등분으로 자른 후 1의 재료와 함께 들기름에 볶고 달걀은 황백으로 나누어 지단을 부쳐 채 썬다.','MANUAL02'),(296,'3. 북어는 갈아 북어보푸라기를 만든다. 그릇에 밥을 담고 준비된 재료를 담고 베이비채소, 식용꽃, 북어보푸라기를 올려 완성한다.','MANUAL03'),(296,'','MANUAL04'),(296,'','MANUAL05'),(296,'','MANUAL06'),(296,'','MANUAL07'),(296,'','MANUAL08'),(296,'','MANUAL09'),(296,'','MANUAL10'),(296,'','MANUAL11'),(296,'','MANUAL12'),(296,'','MANUAL13'),(296,'','MANUAL14'),(296,'','MANUAL15'),(296,'','MANUAL16'),(296,'','MANUAL17'),(296,'','MANUAL18'),(296,'','MANUAL19'),(296,'','MANUAL20'),(297,'1. 현미와 찹쌀은 씻어서 물에 불리고 물에 뒤포리와 다시마, 간장 1큰술을 넣어 육수를 만든다.','MANUAL01'),(297,'2. 무, 표고버섯, 근대는 채 썰고 팬에 올리브 오일을 두른 후 채 썬 무와 표고버섯을 볶다가 참기름을 넣는다.','MANUAL02'),(297,'3. 불린 현미와 찹쌀에 육수를 넣고 볶은 무와 표고버섯을 올려 밥을 짓고 채 썬 근대를 올려 완성한다.','MANUAL03'),(297,'','MANUAL04'),(297,'','MANUAL05'),(297,'','MANUAL06'),(297,'','MANUAL07'),(297,'','MANUAL08'),(297,'','MANUAL09'),(297,'','MANUAL10'),(297,'','MANUAL11'),(297,'','MANUAL12'),(297,'','MANUAL13'),(297,'','MANUAL14'),(297,'','MANUAL15'),(297,'','MANUAL16'),(297,'','MANUAL17'),(297,'','MANUAL18'),(297,'','MANUAL19'),(297,'','MANUAL20'),(298,'1. 베이컨과, 소시지를 다진 후 끓는 물에 데쳐 팬에 볶고 다진 김치는 물에 행군 후 고추가루를 넣어 볶는다.','MANUAL01'),(298,'2. 시금치는 데친 후 다져 참기름과 다진 마늘을 넣어 무치고 달걀은 부쳐서 다진다.','MANUAL02'),(298,'3. 김은 참기름을 발라 구워 길게 자르고 밥과 준비된 재료를 층층히 쌓아 완성한다.','MANUAL03'),(298,'','MANUAL04'),(298,'','MANUAL05'),(298,'','MANUAL06'),(298,'','MANUAL07'),(298,'','MANUAL08'),(298,'','MANUAL09'),(298,'','MANUAL10'),(298,'','MANUAL11'),(298,'','MANUAL12'),(298,'','MANUAL13'),(298,'','MANUAL14'),(298,'','MANUAL15'),(298,'','MANUAL16'),(298,'','MANUAL17'),(298,'','MANUAL18'),(298,'','MANUAL19'),(298,'','MANUAL20'),(299,'1. 팬에 레드와인, 레몬즙, 설탕을 넣고 졸여 드레싱을 만든다.','MANUAL01'),(299,'2. 청경채와 두릅은 끓는 물에 데쳐 식히고 레몬은 부채꼴 모양으로 썰고 가지는 어슷하게 썰어 석쇠에 굽는다.','MANUAL02'),(299,'3. 슬라이스연어에 크림치즈를 넣고 말아준 후 접시에 연어, 가지, 레몬, 두릅, 청경채를 담고 드레싱을 뿌려 완성한다.','MANUAL03'),(299,'','MANUAL04'),(299,'','MANUAL05'),(299,'','MANUAL06'),(299,'','MANUAL07'),(299,'','MANUAL08'),(299,'','MANUAL09'),(299,'','MANUAL10'),(299,'','MANUAL11'),(299,'','MANUAL12'),(299,'','MANUAL13'),(299,'','MANUAL14'),(299,'','MANUAL15'),(299,'','MANUAL16'),(299,'','MANUAL17'),(299,'','MANUAL18'),(299,'','MANUAL19'),(299,'','MANUAL20'),(300,'1. 바나나는 껍질을 벗겨 2등분한다.','MANUAL01'),(300,'2. 가열된 팬에 기름을 두르지 않고 바나나를 굽는다.','MANUAL02'),(300,'3. 구워진 바나나의 겉면에 설탕을 뿌리고 가열된 팬에 구운 후 완성된 바나나를 접시에 담고, 다진 호두를 뿌린다.','MANUAL03'),(300,'','MANUAL04'),(300,'','MANUAL05'),(300,'','MANUAL06'),(300,'','MANUAL07'),(300,'','MANUAL08'),(300,'','MANUAL09'),(300,'','MANUAL10'),(300,'','MANUAL11'),(300,'','MANUAL12'),(300,'','MANUAL13'),(300,'','MANUAL14'),(300,'','MANUAL15'),(300,'','MANUAL16'),(300,'','MANUAL17'),(300,'','MANUAL18'),(300,'','MANUAL19'),(300,'','MANUAL20'),(301,'1. 망고와 우유를 섞어 믹서에 갈아 팬에 넣고 끓인다.','MANUAL01'),(301,'2. 딸기와 키위는 0.5×0.5×0.5cm로 썰고 젤라틴은 녹여서 매실원액과 섞는다.','MANUAL02'),(301,'3. 딸기, 키위를 젤라틴과 섞어서 틀에 넣어 굳히고 위에 망고소스를 뿌려 완성한다.','MANUAL03'),(301,'','MANUAL04'),(301,'','MANUAL05'),(301,'','MANUAL06'),(301,'','MANUAL07'),(301,'','MANUAL08'),(301,'','MANUAL09'),(301,'','MANUAL10'),(301,'','MANUAL11'),(301,'','MANUAL12'),(301,'','MANUAL13'),(301,'','MANUAL14'),(301,'','MANUAL15'),(301,'','MANUAL16'),(301,'','MANUAL17'),(301,'','MANUAL18'),(301,'','MANUAL19'),(301,'','MANUAL20'),(302,'1. 단호박은 삶아 으깬다.','MANUAL01'),(302,'2. 양파, 석박지, 파프리카, 가지는 깍둑\n썰고, 두부는 으깬다.','MANUAL02'),(302,'3. 팬에 다진 마늘, 양파, 석박지를 넣어\n볶다가 두부를 넣고 수분이 없어질\n때까지 볶다가 가지, 파프리카도\n넣어 볶는다','MANUAL03'),(302,'4. 밥과 저염된장, 후춧가루를 넣고\n볶다가 들기름을 넣어 한 번 더\n볶는다.','MANUAL04'),(302,'5. 그릇에 담고 으깬 단호박과\n세발나물을 곁들여 마무리한다.','MANUAL05'),(302,'','MANUAL06'),(302,'','MANUAL07'),(302,'','MANUAL08'),(302,'','MANUAL09'),(302,'','MANUAL10'),(302,'','MANUAL11'),(302,'','MANUAL12'),(302,'','MANUAL13'),(302,'','MANUAL14'),(302,'','MANUAL15'),(302,'','MANUAL16'),(302,'','MANUAL17'),(302,'','MANUAL18'),(302,'','MANUAL19'),(302,'','MANUAL20'),(303,'1. 쌀은 30분 정도 불린 뒤 동량의 물에 강황가루를 풀어 완두콩과 함께\n넣어 밥을 짓는다.','MANUAL01'),(303,'2. 닭고기를 깨끗이 씻은 후 끓는 물에\n살짝 데쳐 기름기를 제거한 뒤 작게\n썰어 대추, 수삼과 함께 맛술에 재워\n잡냄새를 없앤다.','MANUAL02'),(303,'3. 양파와 당근은 작게 깍둑 썬다.','MANUAL03'),(303,'4. 팬에 기름을 두른 후 재워둔\n닭고기와 당근, 양파를 볶는다','MANUAL04'),(303,'5. 강황밥을 넣고 같이 볶아\n마무리한다.','MANUAL05'),(303,'','MANUAL06'),(303,'','MANUAL07'),(303,'','MANUAL08'),(303,'','MANUAL09'),(303,'','MANUAL10'),(303,'','MANUAL11'),(303,'','MANUAL12'),(303,'','MANUAL13'),(303,'','MANUAL14'),(303,'','MANUAL15'),(303,'','MANUAL16'),(303,'','MANUAL17'),(303,'','MANUAL18'),(303,'','MANUAL19'),(303,'','MANUAL20'),(304,'1. 냄비에 육수 재료를 넣고 10분간\n끓여 건더기를 건진다.','MANUAL01'),(304,'2. 애호박은 돌려 깎아 채 썰고, 양파도\n채 썰고, 청양고추와 대파는\n어슷 썬다.','MANUAL02'),(304,'3. 토마토는 200g은 잘게 다지고,\n100g은 두툼하게 썬다.','MANUAL03'),(304,'4. 육수에 라면스프와 라면을 넣고\n살짝 익힌 뒤 양파, 애호박, 다진\n토마토를 넣고 끓인다.','MANUAL04'),(304,'5. 면이 다 익으면 두툼하게 썬\n토마토를 넣고 10초간 더 끓인다.','MANUAL05'),(304,'6. 대파와 청양고추를 올려 마무리한다.','MANUAL06'),(304,'','MANUAL07'),(304,'','MANUAL08'),(304,'','MANUAL09'),(304,'','MANUAL10'),(304,'','MANUAL11'),(304,'','MANUAL12'),(304,'','MANUAL13'),(304,'','MANUAL14'),(304,'','MANUAL15'),(304,'','MANUAL16'),(304,'','MANUAL17'),(304,'','MANUAL18'),(304,'','MANUAL19'),(304,'','MANUAL20'),(305,'1. 소스를 만든다.','MANUAL01'),(305,'2. 양상추와 치커리는 굵은 줄기\n부분을 빼고 먹기 좋은 크기로 잘게\n찢는다.','MANUAL02'),(305,'3. 라면 끓는 물에서 4분간 삶고 체에\n건져 찬물에 헹군다.','MANUAL03'),(305,'4. 닭가슴살을 먹기 좋은 크기로 찢어\n면과 함께 섞는다.','MANUAL04'),(305,'5. 그릇에 채소와 면을 담고,\n방울토마토도 먹기 좋게 잘라\n담는다.','MANUAL05'),(305,'6. 소스와 파슬리가루를 뿌려\n마무리한다.','MANUAL06'),(305,'','MANUAL07'),(305,'','MANUAL08'),(305,'','MANUAL09'),(305,'','MANUAL10'),(305,'','MANUAL11'),(305,'','MANUAL12'),(305,'','MANUAL13'),(305,'','MANUAL14'),(305,'','MANUAL15'),(305,'','MANUAL16'),(305,'','MANUAL17'),(305,'','MANUAL18'),(305,'','MANUAL19'),(305,'','MANUAL20'),(306,'1. 검은깨를 곱게 부숴 빵가루와 섞어\n마른 팬에서 볶는다.','MANUAL01'),(306,'2. 라면을 삶아 건져 물기를 제거 한 뒤\n달걀물→녹말가루 순서대로 묻힌다.','MANUAL02'),(306,'3. 다진 쇠고기에 다진 땅콩을 넣어\n반죽해 적당한 크기로 빚는다.','MANUAL03'),(306,'4. 반죽을 라면으로 감싸 달걀물→\n빵가루 순으로 입혀 튀긴다.','MANUAL04'),(306,'5. 통계피와 생강을 물(200g)에 넣고\n끓여 우려낸 뒤 건더기를 건지고\n나머지 소스 재료를 넣고 살짝\n조린다.','MANUAL05'),(306,'6. 발사믹드레싱을 만들어\n어린잎채소에 뿌리고, 방울토마토는\n반으로 썰어 라면 크로켓과 함께\n그릇에 담아 마무리한다.','MANUAL06'),(306,'','MANUAL07'),(306,'','MANUAL08'),(306,'','MANUAL09'),(306,'','MANUAL10'),(306,'','MANUAL11'),(306,'','MANUAL12'),(306,'','MANUAL13'),(306,'','MANUAL14'),(306,'','MANUAL15'),(306,'','MANUAL16'),(306,'','MANUAL17'),(306,'','MANUAL18'),(306,'','MANUAL19'),(306,'','MANUAL20'),(307,'1. 두부는 사방 3cm 길이와 두께로 잘라 허브\n소금을 뿌려 수분을 완전히 빼고 속을 파서\n밀가루를 묻힌다.','MANUAL01'),(307,'2. 소 재료를 골고루 양념해 속을 파준 두부에\n채워준다.','MANUAL02'),(307,'3. 채워진 두부를 김을 두른 뒤 팬에 은근하게\n구워준다.','MANUAL03'),(307,'4. 고구마, 단호박, 아스파라거스를 편으로\n썰어 준다.','MANUAL04'),(307,'5. 마늘과 토마토를 각각 다진 후 오일에 볶다가\n레드와인을 넣어 졸인다. 불을 끄기 직전에\n버터를 넣어 소스를 만든다.','MANUAL05'),(307,'6. 채소를 각각 구워주고 구워진 두부스테이크를\n담고 레드와인 소스를 뿌려 완성한다.','MANUAL06'),(307,'','MANUAL07'),(307,'','MANUAL08'),(307,'','MANUAL09'),(307,'','MANUAL10'),(307,'','MANUAL11'),(307,'','MANUAL12'),(307,'','MANUAL13'),(307,'','MANUAL14'),(307,'','MANUAL15'),(307,'','MANUAL16'),(307,'','MANUAL17'),(307,'','MANUAL18'),(307,'','MANUAL19'),(307,'','MANUAL20'),(308,'1. 영양부추, 시금치는 먹기 좋게 잘라 물에\n담가준다.','MANUAL01'),(308,'2. 단호박은 삶아서 체에 내려준다.','MANUAL02'),(308,'3. 토마토는 곱게 다져주고 시금치도 데친 후\n단호박, 연두부와 섞어준다.','MANUAL03'),(308,'4. 연어를 포를 떠서 만들어진 단호박과 연두부를\n연어에 돌돌 말아 냉동실에 살짝 얼려준다.','MANUAL04'),(308,'5. 소스재료로 소스를 만든다.','MANUAL05'),(308,'6. 접시에 준비된 채소를 깔고 연어를 올리고\n소스를 올려 완성한다.','MANUAL06'),(308,'','MANUAL07'),(308,'','MANUAL08'),(308,'','MANUAL09'),(308,'','MANUAL10'),(308,'','MANUAL11'),(308,'','MANUAL12'),(308,'','MANUAL13'),(308,'','MANUAL14'),(308,'','MANUAL15'),(308,'','MANUAL16'),(308,'','MANUAL17'),(308,'','MANUAL18'),(308,'','MANUAL19'),(308,'','MANUAL20'),(309,'1. 브로콜리는 데쳐낸 후 송송 다져준다.','MANUAL01'),(309,'2. 감자는 삶아준 후 체에 내려준다.','MANUAL02'),(309,'3. 멜론은 씨를 제거하고 껍질을 벗긴 후 믹서에\n갈아 체에 내려준다.','MANUAL03'),(309,'4. 체에 내린 감자와 브로콜리 그리고 멜론즙을\n함께 섞어준다.','MANUAL04'),(309,'5. 설탕으로 간을 해주고 볼에 담고 요거트로\n장식을 해 완성한다.','MANUAL05'),(309,'','MANUAL06'),(309,'','MANUAL07'),(309,'','MANUAL08'),(309,'','MANUAL09'),(309,'','MANUAL10'),(309,'','MANUAL11'),(309,'','MANUAL12'),(309,'','MANUAL13'),(309,'','MANUAL14'),(309,'','MANUAL15'),(309,'','MANUAL16'),(309,'','MANUAL17'),(309,'','MANUAL18'),(309,'','MANUAL19'),(309,'','MANUAL20'),(310,'1. 통삼겹살은 어간장, 마늘기름, 로즈마리,\n통후추에 재워준다.','MANUAL01'),(310,'2. 양송이, 피망, 파프리카는 먹기 좋게 썰어서\n마늘기름에 구워준다.','MANUAL02'),(310,'3. 고구마는 먹기 좋게 잘라 기름 없이 구워준다.','MANUAL03'),(310,'4. 재워 놓은 통삼겹은 작은 크기로 잘라서\n건고추를 넣어 물에 데쳐낸다.','MANUAL04'),(310,'5. 모든 재료를 꼬치에 끼워서 살짝 구워준다.','MANUAL05'),(310,'6. 레몬껍질을 채 썰어서 소스를 만들어주고\n꼬치와 함께 완성한다.','MANUAL06'),(310,'','MANUAL07'),(310,'','MANUAL08'),(310,'','MANUAL09'),(310,'','MANUAL10'),(310,'','MANUAL11'),(310,'','MANUAL12'),(310,'','MANUAL13'),(310,'','MANUAL14'),(310,'','MANUAL15'),(310,'','MANUAL16'),(310,'','MANUAL17'),(310,'','MANUAL18'),(310,'','MANUAL19'),(310,'','MANUAL20'),(311,'1. 곤약은 세척 후 물기를 빼준다.','MANUAL01'),(311,'2. 사과는 가늘게 채 썰어 레몬에 살짝 담가 주고,\n다진양파도 레몬즙에 살짝 담가준다.','MANUAL02'),(311,'3. 팬에 다진양파를 버터에 볶다가 나머지 볶음\n재료를 넣고 볶음양념을 만들어준다.','MANUAL03'),(311,'4. 볶음양념에 곤약 을 넣 어 고들고들하게\n볶아준다.','MANUAL04'),(311,'5. 사과를 물기를 완전히 제거하고 소스재료를\n섞어 곁들이 소스를 만들어준다.','MANUAL05'),(311,'6. 볶음곤약을 그릇에 담고 그라놀라를 뿌려서\n완성한다.','MANUAL06'),(311,'','MANUAL07'),(311,'','MANUAL08'),(311,'','MANUAL09'),(311,'','MANUAL10'),(311,'','MANUAL11'),(311,'','MANUAL12'),(311,'','MANUAL13'),(311,'','MANUAL14'),(311,'','MANUAL15'),(311,'','MANUAL16'),(311,'','MANUAL17'),(311,'','MANUAL18'),(311,'','MANUAL19'),(311,'','MANUAL20'),(312,'1. 찹쌀은 30분 정도, 찰보리는 1시간 이상\n불려주고 보리쌀은 한번 쪄 준다.','MANUAL01'),(312,'2. 표고버섯은 물에 데친다. 이때 표고버섯 불린\n물은 버리지 않고 짜투리 채소와 함께 채소\n국물을 만들어준다.','MANUAL02'),(312,'3. 불린 표고버섯, 청피망, 홍피망, 양파, 오리\n가슴살은 작은 정사각형으로 잘라주고 청양\n고추는 다져준다.','MANUAL03'),(312,'4. 다진 청양고추와 다진마늘은 볶아주고 다시\n여기에 다진채소와 가슴살을 볶아준다.','MANUAL04'),(312,'5. 찹쌀과 보리쌀을 넣어 만들어진 채소국물에\n끓여주다 생크림과 우유를 넣어 죽 형태로\n만든다.','MANUAL05'),(312,'6. 여기에 볶아진 재료를 넣고 소금으로 간을\n하고 말린 토마토를 올려 완성한다.','MANUAL06'),(312,'','MANUAL07'),(312,'','MANUAL08'),(312,'','MANUAL09'),(312,'','MANUAL10'),(312,'','MANUAL11'),(312,'','MANUAL12'),(312,'','MANUAL13'),(312,'','MANUAL14'),(312,'','MANUAL15'),(312,'','MANUAL16'),(312,'','MANUAL17'),(312,'','MANUAL18'),(312,'','MANUAL19'),(312,'','MANUAL20'),(313,'1. 귀리는 불려준 뒤 닭육수에 삶아준다.','MANUAL01'),(313,'2. 브로콜리는 잘 손질하여 잘게 썰어 놓는다.','MANUAL02'),(313,'3. 양파는 채 썰어 버터로 볶다가 1의 브로콜리와\n귀리, 아몬드슬라이스를 넣고 같이 볶아준다.','MANUAL03'),(313,'4. 어느 정도 볶아지면 우유를 넣고 다시 한 번\n볶아준다.','MANUAL04'),(313,'5. 닭육수를 넣고 귀리가 익을 때 까지 푹 익힌 후\n믹서에 갈아 체에 걸러준다.','MANUAL05'),(313,'6. 마지막으로 생크림을 넣고 농도를 조절하고\n녹차가루를 올려 완성한다.','MANUAL06'),(313,'','MANUAL07'),(313,'','MANUAL08'),(313,'','MANUAL09'),(313,'','MANUAL10'),(313,'','MANUAL11'),(313,'','MANUAL12'),(313,'','MANUAL13'),(313,'','MANUAL14'),(313,'','MANUAL15'),(313,'','MANUAL16'),(313,'','MANUAL17'),(313,'','MANUAL18'),(313,'','MANUAL19'),(313,'','MANUAL20'),(314,'1. 소고기에 물을 넣어 육수를 뽑아준 후 천연\n조미료로 간을 해준다.','MANUAL01'),(314,'2. 소고기는 곱게 다져준 뒤 볶아준다.','MANUAL02'),(314,'3. 감자를 삶아서 체에 내려준다.','MANUAL03'),(314,'4. 계란을 풀고 소고기 다진 것과 게맛살, 물을\n넣고 섞은 뒤 찜기에 쪄준다.','MANUAL04'),(314,'5. 부추와 브로콜리는 뜨거운 물에 데쳐 먹기\n좋게 잘라주고, 방울토마토와 미니파프리카도\n먹기 좋게 잘라준다.','MANUAL05'),(314,'6. 매실청과 올리브오일, 후추로 드레싱을 만들어\n준비된 채소를 섞어준 뒤 그릇에 담는다.','MANUAL06'),(314,'','MANUAL07'),(314,'','MANUAL08'),(314,'','MANUAL09'),(314,'','MANUAL10'),(314,'','MANUAL11'),(314,'','MANUAL12'),(314,'','MANUAL13'),(314,'','MANUAL14'),(314,'','MANUAL15'),(314,'','MANUAL16'),(314,'','MANUAL17'),(314,'','MANUAL18'),(314,'','MANUAL19'),(314,'','MANUAL20'),(315,'1. 미나리는 데친 후 먹기 좋은 크기로 잘라서\n밥을 해준다.','MANUAL01'),(315,'2. 닭가슴살에 밥을 넣고 말아서 오븐에 굽는다.','MANUAL02'),(315,'3. 무는 물에 익히고 고춧가루와 무조림 재료를\n넣어 졸여준다.','MANUAL03'),(315,'4. 청경채는 데친 후 팬에 살짝 볶아준다.','MANUAL04'),(315,'5. 소스를 만들어준다.','MANUAL05'),(315,'6. 접시에 무조림을 깔고 닭가슴살 구이를 올리고\n청경채와 함께 소스를 뿌려 완성한다.','MANUAL06'),(315,'','MANUAL07'),(315,'','MANUAL08'),(315,'','MANUAL09'),(315,'','MANUAL10'),(315,'','MANUAL11'),(315,'','MANUAL12'),(315,'','MANUAL13'),(315,'','MANUAL14'),(315,'','MANUAL15'),(315,'','MANUAL16'),(315,'','MANUAL17'),(315,'','MANUAL18'),(315,'','MANUAL19'),(315,'','MANUAL20'),(316,'1. 먼저 영양부추를 뺀 재료로 양념장을 30분\n전에 만들어준다.','MANUAL01'),(316,'2. 쌀은 30분전에 불려주고 고구마는 껍질째\n작은 깍두기 모양으로 잘라 냉수에 담가준다.','MANUAL02'),(316,'3. 닭육수에 강황가루를 풀어주고 쌀과 고구마를\n고루 섞어 밥을 해준다.','MANUAL03'),(316,'4. 만들어진 양념장에 영양부추를 한입 크기로\n잘라 최종 양념장을 만들어준다.','MANUAL04'),(316,'5. 그릇에 강황고구마밥을 담아주고 양념장과\n함께 완성한다.','MANUAL05'),(316,'','MANUAL06'),(316,'','MANUAL07'),(316,'','MANUAL08'),(316,'','MANUAL09'),(316,'','MANUAL10'),(316,'','MANUAL11'),(316,'','MANUAL12'),(316,'','MANUAL13'),(316,'','MANUAL14'),(316,'','MANUAL15'),(316,'','MANUAL16'),(316,'','MANUAL17'),(316,'','MANUAL18'),(316,'','MANUAL19'),(316,'','MANUAL20'),(317,'1. 바지락은 볶은 소금에 담가 해감을 시켜준다.','MANUAL01'),(317,'2. 물 400g에 저염 된장과 바지락을 넣어 국물을\n만들어준다.','MANUAL02'),(317,'3. 시금치 는 데 친 후 물기를 제거해 송송\n다져준다.','MANUAL03'),(317,'4. 당근, 양파와 청홍고추는 채 썰고 애호박과\n감자는 반달모양으로 썰어준다.','MANUAL04'),(317,'5. 다진 시금치와 밀가루를 이용해 완자를\n만들어준다.','MANUAL05'),(317,'6. 만들어진 국물에 옹심이를 넣어 끓여주고\n나머지 채소를 넣어 완성한다.','MANUAL06'),(317,'','MANUAL07'),(317,'','MANUAL08'),(317,'','MANUAL09'),(317,'','MANUAL10'),(317,'','MANUAL11'),(317,'','MANUAL12'),(317,'','MANUAL13'),(317,'','MANUAL14'),(317,'','MANUAL15'),(317,'','MANUAL16'),(317,'','MANUAL17'),(317,'','MANUAL18'),(317,'','MANUAL19'),(317,'','MANUAL20'),(318,'1. 두부를 2.5×2.5×1cm 정도로 잘라 물기를 빼고 후추를 뿌린 후 전분가루를 골고루 묻혀\n식용유를 둘러 프라이팬에 갈색이 나도록 양면을 굽는다.','MANUAL01'),(318,'2. 프라이팬에 간장, 올리고당, 생강즙, 물을 넣어 끓여 불고기 양념을 만든 후 양념을 구운 두부에 넣고 졸인다.','MANUAL02'),(318,'3. 그릇에 두부를 담고 위에 흑임자를 뿌린다.','MANUAL03'),(318,'','MANUAL04'),(318,'','MANUAL05'),(318,'','MANUAL06'),(318,'','MANUAL07'),(318,'','MANUAL08'),(318,'','MANUAL09'),(318,'','MANUAL10'),(318,'','MANUAL11'),(318,'','MANUAL12'),(318,'','MANUAL13'),(318,'','MANUAL14'),(318,'','MANUAL15'),(318,'','MANUAL16'),(318,'','MANUAL17'),(318,'','MANUAL18'),(318,'','MANUAL19'),(318,'','MANUAL20'),(319,'1. 매생이는 씻어 체에 거른다.','MANUAL01'),(319,'2. 물 250g에 다시마, 멸치, 보리된장을 넣어 육수를 만든다.','MANUAL02'),(319,'3. 육수가 끓으면 매생이, 홍합, 순두부를 넣어 끓인 후 고추를 고명으로 올려 완성한다.','MANUAL03'),(319,'','MANUAL04'),(319,'','MANUAL05'),(319,'','MANUAL06'),(319,'','MANUAL07'),(319,'','MANUAL08'),(319,'','MANUAL09'),(319,'','MANUAL10'),(319,'','MANUAL11'),(319,'','MANUAL12'),(319,'','MANUAL13'),(319,'','MANUAL14'),(319,'','MANUAL15'),(319,'','MANUAL16'),(319,'','MANUAL17'),(319,'','MANUAL18'),(319,'','MANUAL19'),(319,'','MANUAL20'),(320,'1. 겨자분말은 물에 섞은 후, 뜨거운 물 3g에 중탕하여 발효시킨 후 설탕과 식초를 넣어 겨자 소스를 만들고 당근, 무, 양파는 0.1×5cm로 채 썬다.','MANUAL01'),(320,'2. 부추는 3cm 길이로 썬다.','MANUAL02'),(320,'3. 오이 고추는 길게 칼집을 넣어 씨를 제거한 다음 4cm로 썰고 당근, 무, 양파, 부추를 겨자냉채소스와 버무려 오이고추의 속을 채워 완성한다.','MANUAL03'),(320,'','MANUAL04'),(320,'','MANUAL05'),(320,'','MANUAL06'),(320,'','MANUAL07'),(320,'','MANUAL08'),(320,'','MANUAL09'),(320,'','MANUAL10'),(320,'','MANUAL11'),(320,'','MANUAL12'),(320,'','MANUAL13'),(320,'','MANUAL14'),(320,'','MANUAL15'),(320,'','MANUAL16'),(320,'','MANUAL17'),(320,'','MANUAL18'),(320,'','MANUAL19'),(320,'','MANUAL20'),(321,'1. 실치는 끓는 물에 데친다.','MANUAL01'),(321,'2. 오이는 반달 모양으로 슬라이스하고 식초에 절인 후 물기를 제거하고 매실액을 넣는다.','MANUAL02'),(321,'3. 데쳐낸 실치와 오이를 함께 버무려 완성한다.','MANUAL03'),(321,'','MANUAL04'),(321,'','MANUAL05'),(321,'','MANUAL06'),(321,'','MANUAL07'),(321,'','MANUAL08'),(321,'','MANUAL09'),(321,'','MANUAL10'),(321,'','MANUAL11'),(321,'','MANUAL12'),(321,'','MANUAL13'),(321,'','MANUAL14'),(321,'','MANUAL15'),(321,'','MANUAL16'),(321,'','MANUAL17'),(321,'','MANUAL18'),(321,'','MANUAL19'),(321,'','MANUAL20'),(322,'1. 비트는 강판에 갈아 비트 물을 만든다.','MANUAL01'),(322,'2. 무는 채 썰고 비트 물에 채 썬 무를 넣어 색을 들인다.','MANUAL02'),(322,'3. 초절이 소스를 만든 후 색을 입힌 무를 소스에 넣어 재우고 절인 무를 건져 그릇에 담고 0.5cm로 썬 쪽파를 올린다.','MANUAL03'),(322,'','MANUAL04'),(322,'','MANUAL05'),(322,'','MANUAL06'),(322,'','MANUAL07'),(322,'','MANUAL08'),(322,'','MANUAL09'),(322,'','MANUAL10'),(322,'','MANUAL11'),(322,'','MANUAL12'),(322,'','MANUAL13'),(322,'','MANUAL14'),(322,'','MANUAL15'),(322,'','MANUAL16'),(322,'','MANUAL17'),(322,'','MANUAL18'),(322,'','MANUAL19'),(322,'','MANUAL20'),(323,'1. 귤은 껍질을 까서 믹서에 갈아 체에 내린다.','MANUAL01'),(323,'2. 배추는 3×3cm로 썰어 소금에 절인 후 체에 받치고 미나리, 홍고추는 길이 3cm로 썬다.','MANUAL02'),(323,'3. 귤즙에 고춧가루, 생강즙, 다진 마늘을 넣고 김치 국물을 만들고 배추, 미나리, 홍고추에 김치 국물을 부어 실온에 2일 숙성시킨다.','MANUAL03'),(323,'','MANUAL04'),(323,'','MANUAL05'),(323,'','MANUAL06'),(323,'','MANUAL07'),(323,'','MANUAL08'),(323,'','MANUAL09'),(323,'','MANUAL10'),(323,'','MANUAL11'),(323,'','MANUAL12'),(323,'','MANUAL13'),(323,'','MANUAL14'),(323,'','MANUAL15'),(323,'','MANUAL16'),(323,'','MANUAL17'),(323,'','MANUAL18'),(323,'','MANUAL19'),(323,'','MANUAL20'),(324,'1. 찬물에 다시마를 넣고 끓여 건져\n내고 불을 끈 후 가다랑어포를\n넣어 우려 육수를 만든다.','MANUAL01'),(324,'2. 두부, 가지는 깍둑 썰고, 표고버섯,\n양파는 채 썰고, 달걀은 곱게 푼다.','MANUAL02'),(324,'3. 두부, 가지는 물기를 제거한 뒤\n후춧가루로 밑간하고 녹말가루를\n얇게 입혀 식용유를 두른 팬에서\n구워 건진다.','MANUAL03'),(324,'4. 육수(1컵)에 청주, 설탕, 간장을 넣고\n표고버섯, 양파를 넣고 조려 덮밥\n소스를 만든다.','MANUAL04'),(324,'5. 달걀물을 붓고 익을 때까지 저은 후\n녹말물을 넣어 되직하게 끓인다.','MANUAL05'),(324,'6. 밥을 그릇에 담고 덮밥소스를\n곁들인 후 두부, 가지, 가다랑어포를\n얹어 마무리한다.','MANUAL06'),(324,'','MANUAL07'),(324,'','MANUAL08'),(324,'','MANUAL09'),(324,'','MANUAL10'),(324,'','MANUAL11'),(324,'','MANUAL12'),(324,'','MANUAL13'),(324,'','MANUAL14'),(324,'','MANUAL15'),(324,'','MANUAL16'),(324,'','MANUAL17'),(324,'','MANUAL18'),(324,'','MANUAL19'),(324,'','MANUAL20'),(325,'1. 현미는 1시간 정도, 멥쌀은 30분 정도 각각 불린 뒤 섞는다.','MANUAL01'),(325,'2. 쑥갓과 달래는 줄기부분과 잎으로 나누어 1㎝ 길이로 썬다.','MANUAL02'),(325,'3. 쑥갓과 달래의 줄기부분은 불린 쌀과 함께 냄비에 넣고 밥물을 맞춰 센 불에서 끓어오르면 중약 불로 줄여 밥을 15분간 짓는다.','MANUAL03'),(325,'4. 약한 불로 줄여 밥을 뜸 들인다.','MANUAL04'),(325,'5. 다시마육수를 제외한 두부 양념장 재료를 믹서에 곱게 갈아 다시마 육수, 남겨둔 나물의 잎을 팬에 넣어 끓여 두부장을 만든다','MANUAL05'),(325,'6. 나물밥에 두부장을 곁들여 마무리한다.','MANUAL06'),(325,'','MANUAL07'),(325,'','MANUAL08'),(325,'','MANUAL09'),(325,'','MANUAL10'),(325,'','MANUAL11'),(325,'','MANUAL12'),(325,'','MANUAL13'),(325,'','MANUAL14'),(325,'','MANUAL15'),(325,'','MANUAL16'),(325,'','MANUAL17'),(325,'','MANUAL18'),(325,'','MANUAL19'),(325,'','MANUAL20'),(326,'1. 가지는 어슷 썰고, 토마토는 반\n자른다.','MANUAL01'),(326,'2. 연어는 파슬리와 올리브유에 재운다.','MANUAL02'),(326,'3. 마늘은 노릇하게 굽는다.','MANUAL03'),(326,'4. 재운 연어와 가지, 토마토는 180℃로\n예열한 오븐에 10분 정도 굽는다.','MANUAL04'),(326,'5. 사과는 잘게 다져 유자청과\n레몬즙을 넣고 살짝 볶아 소스를\n만든다.','MANUAL05'),(326,'6. 연어, 가지, 토마토, 구운 마늘을\n담고 소스를 얹어 마무리한다.','MANUAL06'),(326,'','MANUAL07'),(326,'','MANUAL08'),(326,'','MANUAL09'),(326,'','MANUAL10'),(326,'','MANUAL11'),(326,'','MANUAL12'),(326,'','MANUAL13'),(326,'','MANUAL14'),(326,'','MANUAL15'),(326,'','MANUAL16'),(326,'','MANUAL17'),(326,'','MANUAL18'),(326,'','MANUAL19'),(326,'','MANUAL20'),(327,'1. 동태는 맛술과 저염된장에 담가\n재운다.','MANUAL01'),(327,'2. 마늘은 얇게 편으로 썬 후\n식용유(15g)에 노릇하게 튀긴다.','MANUAL02'),(327,'3. 재운 동태는 흐르는 물에 살짝 헹궈\n짠맛을 제거한 뒤 물기를 최대한\n제거한다.','MANUAL03'),(327,'4. 식용유(15g)를 두른 팬에 동태살을\n얹어 부서지지 않게 굽는다.','MANUAL04'),(327,'5. 갈릭칩을 올려 마무리한다.','MANUAL05'),(327,'','MANUAL06'),(327,'','MANUAL07'),(327,'','MANUAL08'),(327,'','MANUAL09'),(327,'','MANUAL10'),(327,'','MANUAL11'),(327,'','MANUAL12'),(327,'','MANUAL13'),(327,'','MANUAL14'),(327,'','MANUAL15'),(327,'','MANUAL16'),(327,'','MANUAL17'),(327,'','MANUAL18'),(327,'','MANUAL19'),(327,'','MANUAL20'),(328,'1. 두부는 물기를 없앤 뒤 체에 밭쳐\n으깬 뒤 칼등으로 한 번 더 으깬다.','MANUAL01'),(328,'2. 고구마는 삶아 껍질을 벗겨 으깬다.','MANUAL02'),(328,'3. 마늘, 대파, 양파는 잘게 다진 뒤\n식용유(5g)를 두른 팬에서 살짝 볶아\n키친타월에 밭쳐 물기를 제거하며\n식힌다.','MANUAL03'),(328,'4. 볶은 채소, 두부, 고구마,\n다진 견과류, 찹쌀가루를 섞은 뒤\n반죽해 둥글 납작하게 모양을\n빚고, 식용유(15g)를 두른 팬에서\n앞뒤로 노릇하게 굽는다.','MANUAL04'),(328,'5. 양송이버섯은 채 썬다.','MANUAL05'),(328,'6. 다시마육수에 청국장, 유자청,\n녹말가루, 양송이버섯을 넣고 조린\n청국장소스를 곁들여 마무리한다.','MANUAL06'),(328,'','MANUAL07'),(328,'','MANUAL08'),(328,'','MANUAL09'),(328,'','MANUAL10'),(328,'','MANUAL11'),(328,'','MANUAL12'),(328,'','MANUAL13'),(328,'','MANUAL14'),(328,'','MANUAL15'),(328,'','MANUAL16'),(328,'','MANUAL17'),(328,'','MANUAL18'),(328,'','MANUAL19'),(328,'','MANUAL20'),(329,'1. 고구마를 삶아 껍질을 벗겨 으깬 뒤\n우유와 섞어 고구마무스를 만든다.','MANUAL01'),(329,'2. 백김치와 비트를 작게 썬 뒤\n백김치에 물이 들도록 절여 놓는다.','MANUAL02'),(329,'3. 닭가슴살을 한입 크기로 썬 후\n칼등으로 두드린 뒤 후춧가루로\n밑간한다.','MANUAL03'),(329,'4. 식용유(15g)를 두른 팬에 닭가슴살을\n올려 굽는다.','MANUAL04'),(329,'5. 구운 닭가슴살 위에 고구마무스,\n비트에 절인 백김치, 새싹을 얹는다.','MANUAL05'),(329,'6. 그릇에 닭가슴살카나페를 넣은 후\n바나나식초를 곁들여 마무리한다.','MANUAL06'),(329,'','MANUAL07'),(329,'','MANUAL08'),(329,'','MANUAL09'),(329,'','MANUAL10'),(329,'','MANUAL11'),(329,'','MANUAL12'),(329,'','MANUAL13'),(329,'','MANUAL14'),(329,'','MANUAL15'),(329,'','MANUAL16'),(329,'','MANUAL17'),(329,'','MANUAL18'),(329,'','MANUAL19'),(329,'','MANUAL20'),(330,'1. 껍질을 벗긴 배, 사과를 믹서기에\n갈아 레몬즙과 꿀을 넣고\n배사과소스를 만든다.','MANUAL01'),(330,'2. 돼지고기와 파인애플은 깍둑 썬다.','MANUAL02'),(330,'3. 브로콜리는 약 2~3cm 크기로 자른\n후 끓는 물에 살짝 데친다.','MANUAL03'),(330,'4. 식용유(5g)를 두른 팬에 돼지고기를\n한 번 먼저 굽는다.','MANUAL04'),(330,'5. 꼬치에 방울토마토, 구운 돼지고기,\n파인애플, 브로콜리 순서로 끼운 후\n굽는다.','MANUAL05'),(330,'6. 노릇하게 구운 꼬치구이에\n배사과소스를 얹어 마무리한다.','MANUAL06'),(330,'','MANUAL07'),(330,'','MANUAL08'),(330,'','MANUAL09'),(330,'','MANUAL10'),(330,'','MANUAL11'),(330,'','MANUAL12'),(330,'','MANUAL13'),(330,'','MANUAL14'),(330,'','MANUAL15'),(330,'','MANUAL16'),(330,'','MANUAL17'),(330,'','MANUAL18'),(330,'','MANUAL19'),(330,'','MANUAL20'),(331,'1. 꽁치는 머리와 꼬리를 떼어 내고\n포 뜨듯이 길게 살만 발라내 잔뼈를\n발라 쌀뜨물에 담갔다 건져 물기를\n제거한다.','MANUAL01'),(331,'2. 오렌지를 간 뒤 레몬즙과 설탕,\n소금을 섞어 오렌지소스를 만든다.','MANUAL02'),(331,'3. 마늘종은 꽁치 폭에 맞춰 썰고,\n양파와 파프리카도 채 썬다.','MANUAL03'),(331,'4. 수분을 제거한 꽁치에 밀가루를\n묻혀 깻잎→마늘종→양파→\n파프리카 순으로 올려 돌돌 말아\n꼬치로 꽂아 고정한다.','MANUAL04'),(331,'5. 밀가루를 묻히고 달군 팬에\n앞뒤가 노릇노릇하게 익힌다.','MANUAL05'),(331,'6. 소스를 팬에 넣고 끓이다가 꽁치\n꼬치를 넣고 졸인 뒤 그릇에 무순,\n새싹과 함께 담아 마무리한다.','MANUAL06'),(331,'','MANUAL07'),(331,'','MANUAL08'),(331,'','MANUAL09'),(331,'','MANUAL10'),(331,'','MANUAL11'),(331,'','MANUAL12'),(331,'','MANUAL13'),(331,'','MANUAL14'),(331,'','MANUAL15'),(331,'','MANUAL16'),(331,'','MANUAL17'),(331,'','MANUAL18'),(331,'','MANUAL19'),(331,'','MANUAL20'),(332,'1. 연근은 얇게 3㎜ 정도의 두께로 썰어\n홍초물에 담가 절인다.','MANUAL01'),(332,'2. 미나리는 연근과 비슷한 길이로\n썬다.','MANUAL02'),(332,'3. 오렌지는 껍질은 얇게 벗겨 채 썰고,\n과육부분은 반달 모양으로 2조각\n썬다.','MANUAL03'),(332,'4. 과육을 오렌지주스와 섞은 뒤 갈아\n오렌지소스를 만든다.','MANUAL04'),(332,'5. 팬에 차돌박이를 펼친 뒤\n오렌지소스를 조금씩 넣으며 익힌다.','MANUAL05'),(332,'6. 그릇에 연근초절임, 미나리,\n어린잎채소, 차돌박이 순서로\n담은 뒤 오렌지 껍질과\n오렌지소스를 얹어 마무리한다.','MANUAL06'),(332,'','MANUAL07'),(332,'','MANUAL08'),(332,'','MANUAL09'),(332,'','MANUAL10'),(332,'','MANUAL11'),(332,'','MANUAL12'),(332,'','MANUAL13'),(332,'','MANUAL14'),(332,'','MANUAL15'),(332,'','MANUAL16'),(332,'','MANUAL17'),(332,'','MANUAL18'),(332,'','MANUAL19'),(332,'','MANUAL20'),(333,'1. 아귀는 얇게 포를 뜬다.','MANUAL01'),(333,'2. 새우를 다져 아귀포 안에 채워 넣은\n뒤 데친 미나리로 묶는다.','MANUAL02'),(333,'3. 냄비에 간장소스, 아귀,\n아귀찜양념을 넣고 약한 불에서\n끓인다.','MANUAL03'),(333,'4. 아귀가 익으면 고추를 어슷 썰어\n올린 뒤 살짝 더 익힌다.','MANUAL04'),(333,'5. 콩나물은 끓는 물에 데친 뒤 참기름,\n참깨를 넣고 무친다.','MANUAL05'),(333,'6. 아귀찜에 콩나물무침을 곁들여\n마무리한다.','MANUAL06'),(333,'','MANUAL07'),(333,'','MANUAL08'),(333,'','MANUAL09'),(333,'','MANUAL10'),(333,'','MANUAL11'),(333,'','MANUAL12'),(333,'','MANUAL13'),(333,'','MANUAL14'),(333,'','MANUAL15'),(333,'','MANUAL16'),(333,'','MANUAL17'),(333,'','MANUAL18'),(333,'','MANUAL19'),(333,'','MANUAL20'),(334,'1. 통삼겹살은 속을 판 뒤 땅콩, 아몬드,\n말린 자두, 호두로 채운 뒤\n돼지고기 밑간에 재워 놓는다.','MANUAL01'),(334,'2. 통삼겹살을 김 오른 찜기에 넣어\n찐다.','MANUAL02'),(334,'3. 물기를 뺀 새우젓과 편 썬\n마늘을 기름에 튀긴다.','MANUAL03'),(334,'4. 소스 재료를 끓인다.','MANUAL04'),(334,'5. 파프리카는 채 썰고, 부추는 먹기\n좋은 크기로 썰어 들기름과\n고춧가루에 버무린다.','MANUAL05'),(334,'6. 통삼겹살을 먹기 좋은 크기로 썰어\n부추, 파프리카 위에 놓고 튀긴\n새우젓과 마늘을 올린 뒤 소스를\n곁들여 마무리한다.','MANUAL06'),(334,'','MANUAL07'),(334,'','MANUAL08'),(334,'','MANUAL09'),(334,'','MANUAL10'),(334,'','MANUAL11'),(334,'','MANUAL12'),(334,'','MANUAL13'),(334,'','MANUAL14'),(334,'','MANUAL15'),(334,'','MANUAL16'),(334,'','MANUAL17'),(334,'','MANUAL18'),(334,'','MANUAL19'),(334,'','MANUAL20'),(335,'1. 닭가슴살은 곱게 다진다.','MANUAL01'),(335,'2. 당근은 채 썰어서 단촛물에 5분 정도 절이고, 시금치는 데쳐서 물기를 제거하고, 마른 표고버섯은 불린 뒤 곱게 채를 썰어 간장과 참기름에 버무린다.','MANUAL02'),(335,'3. 종이포일에 다진 가슴살을 올리고 그 위에 시금치, 당근, 표고버섯과 견과류를 올려 말아준다','MANUAL03'),(335,'4. 김 오른 찜기에 넣어서 25분간 찐다.','MANUAL04'),(335,'5. 겨자소스를 만든다.','MANUAL05'),(335,'6. 닭가슴살말이에 겨자소스를 곁들여\n마무리한다.','MANUAL06'),(335,'','MANUAL07'),(335,'','MANUAL08'),(335,'','MANUAL09'),(335,'','MANUAL10'),(335,'','MANUAL11'),(335,'','MANUAL12'),(335,'','MANUAL13'),(335,'','MANUAL14'),(335,'','MANUAL15'),(335,'','MANUAL16'),(335,'','MANUAL17'),(335,'','MANUAL18'),(335,'','MANUAL19'),(335,'','MANUAL20'),(336,'1. 두부는 으깨어 면포에 물기를 짜고,\n불린 표고버섯도 물기를 꼭 짠 뒤\n다지고, 닭가슴살은 곱게 다진다.','MANUAL01'),(336,'2. 두부, 표고버섯, 닭가슴살에\n반죽양념을 넣어 치댄다.','MANUAL02'),(336,'3. 톳은 데쳐서 송송 썬다.','MANUAL03'),(336,'4. 쿠킹포일에 참기름을 바르고 반죽을\n펼친 뒤 깻잎을 얹고 그 위에 톳을\n올려 김밥 말듯이 만다.','MANUAL04'),(336,'5. 쿠킹 포일에 구멍을 내고 김이 오른\n찜통에 10-15분 정도 찐다.','MANUAL05'),(336,'6. 두부말이가 식으면 적당한 크기로\n썬 뒤 레몬소스를 살짝 뿌려\n마무리한다.','MANUAL06'),(336,'','MANUAL07'),(336,'','MANUAL08'),(336,'','MANUAL09'),(336,'','MANUAL10'),(336,'','MANUAL11'),(336,'','MANUAL12'),(336,'','MANUAL13'),(336,'','MANUAL14'),(336,'','MANUAL15'),(336,'','MANUAL16'),(336,'','MANUAL17'),(336,'','MANUAL18'),(336,'','MANUAL19'),(336,'','MANUAL20'),(337,'1. 레몬소스를 만들어 약한 불에\n졸인다.','MANUAL01'),(337,'2. 미나리는 4cm 간격으로 썬 뒤\n잎 부분을 레몬소스에 버무려\n놓는다.','MANUAL02'),(337,'3. 즙을 짜고 남은 레몬은 얇게 썰어\n준비한다.','MANUAL03'),(337,'4. 명태는 손질한 뒤 후춧가루를 뿌려\n밑간한다.','MANUAL04'),(337,'5. 김 오른 찜기에 면포를 깔고 명태를\n올린 뒤 미나리줄기와 얇게 썬\n레몬을 올려서 중간 불에서 10분,\n약한 불에서 10분 정도 찐다.','MANUAL05'),(337,'6. 명태가 다 익으면 레몬소스에\n버무린 미나리 잎과 남은\n레몬소스를 끼얹어 마무리한다.','MANUAL06'),(337,'','MANUAL07'),(337,'','MANUAL08'),(337,'','MANUAL09'),(337,'','MANUAL10'),(337,'','MANUAL11'),(337,'','MANUAL12'),(337,'','MANUAL13'),(337,'','MANUAL14'),(337,'','MANUAL15'),(337,'','MANUAL16'),(337,'','MANUAL17'),(337,'','MANUAL18'),(337,'','MANUAL19'),(337,'','MANUAL20'),(338,'1. 소 불고기는 양념장을 버무려 팬에 볶아준다.','MANUAL01'),(338,'2. 청고추, 홍고추는 가늘게 채 썰어준다.','MANUAL02'),(338,'3. 양파는 채 썰고 쪽파도 한입 크기로 잘라준다.','MANUAL03'),(338,'4. 팽이도 먹기 좋은 크기로 잘라준다.','MANUAL04'),(338,'5. 계란물을 풀어준다.','MANUAL05'),(338,'6. 채소를 각각 볶아주다가 볶은 불고기에 섞어\n주고 계란물을 풀어서 밥에 올려서 통깨를\n뿌려 완성한다.','MANUAL06'),(338,'','MANUAL07'),(338,'','MANUAL08'),(338,'','MANUAL09'),(338,'','MANUAL10'),(338,'','MANUAL11'),(338,'','MANUAL12'),(338,'','MANUAL13'),(338,'','MANUAL14'),(338,'','MANUAL15'),(338,'','MANUAL16'),(338,'','MANUAL17'),(338,'','MANUAL18'),(338,'','MANUAL19'),(338,'','MANUAL20'),(339,'1. 사과와 적양배추는 먹기 좋은 크기로 잘라준다.','MANUAL01'),(339,'2. 감자를 작은 깍두기 모양으로 자르고 영양부추는\n송송 잘라주어 청국장 리조또를 만들어준다.','MANUAL02'),(339,'3. 준비된 곁들이 채소를 올리브오일에 볶아준다.','MANUAL03'),(339,'4. 준비된 통삼겹은 물에 한번 80% 이상 데쳐준 후\n조림장 재료에 물 200g을 넣고 은근히 졸여서\n익혀준다.','MANUAL04'),(339,'5. 조림장에 졸여지는 통삼겹에 장이 한 큰술\n남을 정도까지 졸여준다.','MANUAL05'),(339,'6. 접시에 곁들이 채소와 청국장 리조또를 함께\n올려 셋팅한다.','MANUAL06'),(339,'','MANUAL07'),(339,'','MANUAL08'),(339,'','MANUAL09'),(339,'','MANUAL10'),(339,'','MANUAL11'),(339,'','MANUAL12'),(339,'','MANUAL13'),(339,'','MANUAL14'),(339,'','MANUAL15'),(339,'','MANUAL16'),(339,'','MANUAL17'),(339,'','MANUAL18'),(339,'','MANUAL19'),(339,'','MANUAL20'),(340,'1. 두유와 두부를 믹서에 생수 100g을 넣고\n갈아준다.','MANUAL01'),(340,'2. 애호박은 돌려깎기 해서 채 썰어주고 양파,\n홍고추, 청고추도 가늘게 채 썰어준다.','MANUAL02'),(340,'3. 백일송이는 가늘게 찢어 볶아준다.','MANUAL03'),(340,'4. 애호박, 당근, 청고추, 홍고추를 각각 볶아준다.','MANUAL04'),(340,'5. 메밀면을 삶아서 준비한다.','MANUAL05'),(340,'6. 볼에 메밀면을 담고 고명을 올려준 후 믹서\n에 갈은 두부두유를 뿌려 완성한다.','MANUAL06'),(340,'','MANUAL07'),(340,'','MANUAL08'),(340,'','MANUAL09'),(340,'','MANUAL10'),(340,'','MANUAL11'),(340,'','MANUAL12'),(340,'','MANUAL13'),(340,'','MANUAL14'),(340,'','MANUAL15'),(340,'','MANUAL16'),(340,'','MANUAL17'),(340,'','MANUAL18'),(340,'','MANUAL19'),(340,'','MANUAL20'),(341,'1. 자숙새우와 소라살은 한번 데친 후 소라살은\n먹기 좋게 잘라준다.','MANUAL01'),(341,'2. 전복은 껍질을 벗기지 말고 세척해 준다.','MANUAL02'),(341,'3. 양파, 홍피망, 대파는 먹기 좋게 잘라준다.','MANUAL03'),(341,'4. 청고추, 홍고추도 먹기 좋게 잘라준다.','MANUAL04'),(341,'5. 데친 물 200g에 양념장을 만들어 멕시코\n고추를 담가 숙성시켜준 뒤 양념장에 알마늘을\n넣어 끓여준다.','MANUAL05'),(341,'6. 만들어진 양념장에 소라, 전복, 자숙새우,\n준비된 채소 순으로 넣어 모듬해물찜을 완성\n한다.','MANUAL06'),(341,'','MANUAL07'),(341,'','MANUAL08'),(341,'','MANUAL09'),(341,'','MANUAL10'),(341,'','MANUAL11'),(341,'','MANUAL12'),(341,'','MANUAL13'),(341,'','MANUAL14'),(341,'','MANUAL15'),(341,'','MANUAL16'),(341,'','MANUAL17'),(341,'','MANUAL18'),(341,'','MANUAL19'),(341,'','MANUAL20'),(342,'1. 백미와 귀리는 세척해 백미는 30분, 귀리는\n1시간 정도 불려준다.','MANUAL01'),(342,'2. 귀리를 먼저 물을 넣어 볶아 충분히 익혀준다.','MANUAL02'),(342,'3. 귀리가 어느 정도 익을 때 쯤 쌀을 섞어 한 번\n더 볶아준다.','MANUAL03'),(342,'4. 귀뢰와 쌀이 익어갈 때 쌀의 물 1배를 넣고\n밥을 해 준다.','MANUAL04'),(342,'5. 불을 끄고 크린베리를 바로 넣어서 뚜껑을\n덮어 5분 후에 밥을 완성한다.','MANUAL05'),(342,'','MANUAL06'),(342,'','MANUAL07'),(342,'','MANUAL08'),(342,'','MANUAL09'),(342,'','MANUAL10'),(342,'','MANUAL11'),(342,'','MANUAL12'),(342,'','MANUAL13'),(342,'','MANUAL14'),(342,'','MANUAL15'),(342,'','MANUAL16'),(342,'','MANUAL17'),(342,'','MANUAL18'),(342,'','MANUAL19'),(342,'','MANUAL20'),(343,'1. 브로콜리는 먹기 좋게 잘라서 데쳐준다.','MANUAL01'),(343,'2. 건조체리는 손질해 씨를 제거하고 송송 다져서\n먹기 좋게 잘라준다.','MANUAL02'),(343,'3. 라이스페이퍼를 뜨거운 물에 데쳐내 체리를\n말아 체리 만두를 만든다.','MANUAL03'),(343,'4. 만들어진 체리 만두를 팬에 살짝 구워서\n라이스페이퍼를 고소하게 만든다.','MANUAL04'),(343,'5. 블루베리, 딸기, 바나나, 검은콩두유와 우유를\n한데 섞어 믹서에 갈아준다.','MANUAL05'),(343,'6. 갈아둔 스프를 담고 브로콜리와 체리 만두를\n올리고 먹기 전에 볶은 현미를 올려준다.','MANUAL06'),(343,'','MANUAL07'),(343,'','MANUAL08'),(343,'','MANUAL09'),(343,'','MANUAL10'),(343,'','MANUAL11'),(343,'','MANUAL12'),(343,'','MANUAL13'),(343,'','MANUAL14'),(343,'','MANUAL15'),(343,'','MANUAL16'),(343,'','MANUAL17'),(343,'','MANUAL18'),(343,'','MANUAL19'),(343,'','MANUAL20'),(344,'1. 마늘과 흑임자 참깨를 다져서 소스를 만든다.','MANUAL01'),(344,'2. 영양부추는 5cm 길이로 잘라주고 알배추는\n채 썰어 냉수에 담가둔다.','MANUAL02'),(344,'3. 방울토마토는 먹기 좋게 자르고 적양배추,\n양파를 채 썬다.','MANUAL03'),(344,'4. 두부는 기름에 구워서 크루통을 만든다.','MANUAL04'),(344,'5. 준비된 채소를 물기를 빼고 접시에 담아\n두부크루통을 올린 뒤 소스와 함께 셋팅한다.','MANUAL05'),(344,'','MANUAL06'),(344,'','MANUAL07'),(344,'','MANUAL08'),(344,'','MANUAL09'),(344,'','MANUAL10'),(344,'','MANUAL11'),(344,'','MANUAL12'),(344,'','MANUAL13'),(344,'','MANUAL14'),(344,'','MANUAL15'),(344,'','MANUAL16'),(344,'','MANUAL17'),(344,'','MANUAL18'),(344,'','MANUAL19'),(344,'','MANUAL20'),(345,'1. 닭육수에 브로콜리, 양송이를 넣고 끓인다.','MANUAL01'),(345,'2. 생크림을 넣고 갈아준 후 함초소금으로 간을\n해준다.','MANUAL02'),(345,'3. 다진 청양고추와 버터를 섞어 청양고추버터를\n만들어준다.','MANUAL03'),(345,'4. 토마토를 믹서에 갈아 설탕과 팬에 섞어서\n토마토 시럽을 만들어준다.','MANUAL04'),(345,'5. 바게트에 토마토시럽을 발라주고 청양고추\n버터를 발라 140도 오븐에서 2분간 구워준다.','MANUAL05'),(345,'6. 그릇에 브로콜리스프를 담아주고 청양고추\n버터 바게트를 곁들여 완성한다.','MANUAL06'),(345,'','MANUAL07'),(345,'','MANUAL08'),(345,'','MANUAL09'),(345,'','MANUAL10'),(345,'','MANUAL11'),(345,'','MANUAL12'),(345,'','MANUAL13'),(345,'','MANUAL14'),(345,'','MANUAL15'),(345,'','MANUAL16'),(345,'','MANUAL17'),(345,'','MANUAL18'),(345,'','MANUAL19'),(345,'','MANUAL20'),(346,'1. 닭가슴살은 데친 후 가늘게 찢어준다.','MANUAL01'),(346,'2. 달걀은 황백지단을 부쳐서 다이아몬드 모양\n으로 잘라준다.','MANUAL02'),(346,'3. 오이, 피망, 파프리카도 마름모로 잘라준다.','MANUAL03'),(346,'4. 시금치는 살짝 데쳐서 수분을 짜서 한입\n크기로 잘라준다.','MANUAL04'),(346,'5. 소스 재료를 믹서에 갈아 소스를 만들어준다.','MANUAL05'),(346,'6. 대추는 돌려깎기 해서 잘라주고 준비된 모든\n재료를 섞어 샐러드를 만들고 대추채를 올려\n완성한다.','MANUAL06'),(346,'','MANUAL07'),(346,'','MANUAL08'),(346,'','MANUAL09'),(346,'','MANUAL10'),(346,'','MANUAL11'),(346,'','MANUAL12'),(346,'','MANUAL13'),(346,'','MANUAL14'),(346,'','MANUAL15'),(346,'','MANUAL16'),(346,'','MANUAL17'),(346,'','MANUAL18'),(346,'','MANUAL19'),(346,'','MANUAL20'),(347,'1. 방울토마토를 뜨거운 물에 넣어 껍질을 벗겨주면 더욱 부드럽게 섭취할 수 있다.','MANUAL01'),(347,'2. 시금치와 알배추는 한입 크기로 잘라준 뒤 뜨거운 물에 살짝 익혀준다.','MANUAL02'),(347,'3. 닭육수에 미소된장을 풀어 체에 걸러준다.','MANUAL03'),(347,'4. 체에 거른 된장국에 팽이버섯을 넣고 살짝 끓여준다.','MANUAL04'),(347,'5. 그릇에 토마토, 시금치, 알배추를 담는다.','MANUAL05'),(347,'6. 끓인 된장국을 붓고 완성한다.','MANUAL06'),(347,'','MANUAL07'),(347,'','MANUAL08'),(347,'','MANUAL09'),(347,'','MANUAL10'),(347,'','MANUAL11'),(347,'','MANUAL12'),(347,'','MANUAL13'),(347,'','MANUAL14'),(347,'','MANUAL15'),(347,'','MANUAL16'),(347,'','MANUAL17'),(347,'','MANUAL18'),(347,'','MANUAL19'),(347,'','MANUAL20'),(348,'1. 찹쌀은 미리 불려준다.','MANUAL01'),(348,'2. 매생이는 물에 담가 짠기와 이물질을 빼준다.','MANUAL02'),(348,'3. 단호박은 작은 사각형으로 잘라 멸치육수에\n데쳐준다.','MANUAL03'),(348,'4. 밤은 곱게 다져주어 고명으로 사용한다.','MANUAL04'),(348,'5. 우유와 육수를 섞은 뒤 찹쌀을 끓여준다.','MANUAL05'),(348,'6. 죽이 어느 정도 완성되면 데쳐낸 호박과\n매생이를 넣어 범벅을 만들어준다.','MANUAL06'),(348,'','MANUAL07'),(348,'','MANUAL08'),(348,'','MANUAL09'),(348,'','MANUAL10'),(348,'','MANUAL11'),(348,'','MANUAL12'),(348,'','MANUAL13'),(348,'','MANUAL14'),(348,'','MANUAL15'),(348,'','MANUAL16'),(348,'','MANUAL17'),(348,'','MANUAL18'),(348,'','MANUAL19'),(348,'','MANUAL20'),(349,'1. 구이소스 재료를 이용해 소스를 만든다.','MANUAL01'),(349,'2. 통삼겹은 닭육수에 삶아 냉수에 헹궈 물기를\n빼준다.','MANUAL02'),(349,'3. 통삼겹에 만들어진 소스를 발라 준 뒤 10분\n정도 숙성시켜준다.','MANUAL03'),(349,'4. 샐러드재료는 곱게 채 썰고 냉수에 담가\n각각의 맛을 중화시켜준다.','MANUAL04'),(349,'5. 샐러드소스를 만들어 샐러드를 버무려준다.','MANUAL05'),(349,'6. 양념에 재워진 통삼겹을 구워주고 샐러드를\n담아 완성한다.','MANUAL06'),(349,'','MANUAL07'),(349,'','MANUAL08'),(349,'','MANUAL09'),(349,'','MANUAL10'),(349,'','MANUAL11'),(349,'','MANUAL12'),(349,'','MANUAL13'),(349,'','MANUAL14'),(349,'','MANUAL15'),(349,'','MANUAL16'),(349,'','MANUAL17'),(349,'','MANUAL18'),(349,'','MANUAL19'),(349,'','MANUAL20'),(350,'1. 닭은 손질해 주고 흰 후추와 올리브오일로\n밑간을 해준다.','MANUAL01'),(350,'2. 시금치는 데친 후 수분을 제거해 먹기 좋게\n잘라주고, 양파는 송송 다져준다. 준비된\n채소를 마늘과 버터에 볶아주다 생크림을 넣어\n살짝 졸여준다.','MANUAL02'),(350,'3. 콜리플라워, 브로콜리는 뜨거운 물에 데친 후\n방울토마토와 함께 팬에 구워준다.','MANUAL03'),(350,'4. 버터에 꿀을 넣고 졸이다가 카라멜 효과를\n주고 오렌지주스와 레몬즙을 넣고 갈색소스를\n만든다.','MANUAL04'),(350,'5. 닭가슴살을 포를 떠준 후 졸여준 채소를\n채워준다.','MANUAL05'),(350,'6. 닭가슴살을 팬에 구워주고 접시에 구운 채소\n와 소스를 뿌려준다.','MANUAL06'),(350,'','MANUAL07'),(350,'','MANUAL08'),(350,'','MANUAL09'),(350,'','MANUAL10'),(350,'','MANUAL11'),(350,'','MANUAL12'),(350,'','MANUAL13'),(350,'','MANUAL14'),(350,'','MANUAL15'),(350,'','MANUAL16'),(350,'','MANUAL17'),(350,'','MANUAL18'),(350,'','MANUAL19'),(350,'','MANUAL20'),(351,'1. 쌀은 30분전에 불려준다.','MANUAL01'),(351,'2. 단호박은 찐 후 체에 내려준다.','MANUAL02'),(351,'3. 생 표고버섯은 뜨거운 물에 데친 후 아주\n가늘게 채를 썰어준다.','MANUAL03'),(351,'4. 반은 채 썰어서 참기름으로 간을 해 준다.','MANUAL04'),(351,'5. 팬에 표고를 먼저 볶아주다가 불린 쌀을\n넣어 볶고 볶은소금으로 간을 해준다.','MANUAL05'),(351,'6. 볶아주던 쌀에 우유를 넣어가면서 계속 볶아\n주고 단호박과 치즈를 넣어 완성한다.','MANUAL06'),(351,'','MANUAL07'),(351,'','MANUAL08'),(351,'','MANUAL09'),(351,'','MANUAL10'),(351,'','MANUAL11'),(351,'','MANUAL12'),(351,'','MANUAL13'),(351,'','MANUAL14'),(351,'','MANUAL15'),(351,'','MANUAL16'),(351,'','MANUAL17'),(351,'','MANUAL18'),(351,'','MANUAL19'),(351,'','MANUAL20'),(352,'1. 가지는 길이로 포를 떠 준다. 이때 필러를\n이용하면 간편하게 할 수가 있다.','MANUAL01'),(352,'2. 감자는 채 썰어 냉수에 담가 전분기를 완전히\n빼준다.','MANUAL02'),(352,'3. 파프리카, 양파, 청고추는 감자와 같은 길이로\n채 썰어준다.','MANUAL03'),(352,'4. 소스를 만들어준다.','MANUAL04'),(352,'5. 가지를 기름 없이 구워준다.','MANUAL05'),(352,'6. 구운 가지를 펴 놓고 준비된 채소를 말아서\n가지말이를 만들고, 마늘튀김을 올려 소스랑\n완성한 뒤 파마산치즈를 다져서 먹기 직전에\n뿌려준다.','MANUAL06'),(352,'','MANUAL07'),(352,'','MANUAL08'),(352,'','MANUAL09'),(352,'','MANUAL10'),(352,'','MANUAL11'),(352,'','MANUAL12'),(352,'','MANUAL13'),(352,'','MANUAL14'),(352,'','MANUAL15'),(352,'','MANUAL16'),(352,'','MANUAL17'),(352,'','MANUAL18'),(352,'','MANUAL19'),(352,'','MANUAL20'),(353,'1. 등갈비는 찬물에 약 2시간 이상 담그어\n핏물을 빼고, 월계수잎과 생강, 통훗추를\n넣고 약 1시간 삶아 건져 놓는다.','MANUAL01'),(353,'2. 적양배추와 당근, 양파를 채를 썰어\n찬물에 담그어 놓는다.','MANUAL02'),(353,'3. 유자청에 밤을 다져넣고 사과즙,\n생크림, 설탕, 소금, 식초를 넣어\n골고루 섞어 소스를 만든다.','MANUAL03'),(353,'4. 물에 담그어 놓은 채소는 채에 올려\n물기를 빼 놓는다.','MANUAL04'),(353,'5. 팬에 기름을 두르고 다진마늘을 볶아\n마늘기름을 만들어 놓는다.','MANUAL05'),(353,'6. 마늘기름으로 삶아 놓은 등갈비를\n노릇노릇 하게 굽고, 접시에 담아\n물기를 빼 놓은 채소를 담고 유자소스를\n올려 완성한다.','MANUAL06'),(353,'','MANUAL07'),(353,'','MANUAL08'),(353,'','MANUAL09'),(353,'','MANUAL10'),(353,'','MANUAL11'),(353,'','MANUAL12'),(353,'','MANUAL13'),(353,'','MANUAL14'),(353,'','MANUAL15'),(353,'','MANUAL16'),(353,'','MANUAL17'),(353,'','MANUAL18'),(353,'','MANUAL19'),(353,'','MANUAL20'),(354,'1. 뜨거운 물에 실곤약을 넣고, 약 20초\n정도 삶아 건진다.','MANUAL01'),(354,'2. 양파와 청 피망, 홍고추는 약 5cm\n길이로 채를 썰고, 홍고추 몇 개는\n어슷썰어 놓는다.','MANUAL02'),(354,'3. 굴소스에 다진 마늘과 액젓을 넣고\n섞는다.','MANUAL03'),(354,'4. 냄비에 소스(③)을 넣고 바글바글 끓여\n팟타야소스를 만들어 놓는다.','MANUAL04'),(354,'5. 소고기는 만들어 놓은 팟타야소스에\n볶는다.','MANUAL05'),(354,'6. 팬에 기름을 두르고, 채소를 먼저\n볶다가 실곤약을 넣고 살짝 볶은 후\n팟타야소스를 넣어 다시 볶다가 접시에\n담고, 숙주와 고기를 올려 완성한다.','MANUAL06'),(354,'','MANUAL07'),(354,'','MANUAL08'),(354,'','MANUAL09'),(354,'','MANUAL10'),(354,'','MANUAL11'),(354,'','MANUAL12'),(354,'','MANUAL13'),(354,'','MANUAL14'),(354,'','MANUAL15'),(354,'','MANUAL16'),(354,'','MANUAL17'),(354,'','MANUAL18'),(354,'','MANUAL19'),(354,'','MANUAL20'),(355,'1. 닭고기살은 넓게 펴서, 약 10분 정도\n우유에 담그어 놓는다.','MANUAL01'),(355,'2. 수수와 쌀은 깨끗이 씻어 찬물에 약 30분\n정도 불려 밥을 지어 놓는다.','MANUAL02'),(355,'3. 파프리카는 가운데 씨를 제거하고 채를\n썰고, 당근과 양파도 파프리카 길이로\n채를 썰고, 애호박은 껍질 부분만 돌려\n깎아 채를 썰어 준비한다.','MANUAL03'),(355,'4. 팬에 기름을 살짝 둘러 준비한 채소(③)에\n소금을 넣고 볶아 놓는다.','MANUAL04'),(355,'5. 우유에서 닭고기를 건져 후춧가루를\n살짝 뿌린 후 잡곡밥(②)과 볶아 놓은\n채소(④)를 넣어 돌돌 말아 준다.','MANUAL05'),(355,'6. 토마토는 입자있게 다져 다진 마늘과\n함께 볶다가 케첩과 육수를 넣고 끓인\n뒤 말아놓은 닭고기를 넣고 은근히\n졸이듯 익혀 완성한다.','MANUAL06'),(355,'','MANUAL07'),(355,'','MANUAL08'),(355,'','MANUAL09'),(355,'','MANUAL10'),(355,'','MANUAL11'),(355,'','MANUAL12'),(355,'','MANUAL13'),(355,'','MANUAL14'),(355,'','MANUAL15'),(355,'','MANUAL16'),(355,'','MANUAL17'),(355,'','MANUAL18'),(355,'','MANUAL19'),(355,'','MANUAL20'),(356,'1. 밀가루는 세 군데로 나눠 각각 뽕잎\n가루와 호박가루, 백년초가루를\n넣고 올리브오일을 넣어 반죽을\n하고, 비닐봉투에 넣어 숙성시킨다.','MANUAL01'),(356,'2. 닭은 작게 토막을 내어 생강과 정종,\n소금, 후춧가루를 뿌려 숙성시킨다.','MANUAL02'),(356,'3. 파프리카와 피망은 속을 파내고 작은\n깍두기 모양으로 썰고, 깻잎은 잘게\n썰어둔다.','MANUAL03'),(356,'4. 숙성된 밀가루를 각각 꺼내 밀대로\n밀어, 파스타 굵기로 썰어 면을 데쳐\n접시에 담아 놓는다.','MANUAL04'),(356,'5. 숙성한 닭(②)은 녹말가루와 달걀을\n섞은 반죽을 입혀 170℃의 튀김기름에\n두 번 튀겨 기름을 제거한다.','MANUAL05'),(356,'6. 파스타면(④) 위에 튀긴 닭(⑤)을\n올리고 냄비에 크림소스를 끓이다가\n설탕을 넣고, 다시 끓으면 파프리카와\n피망, 깻잎(③)을 넣고, 한 번 더 끓인 후\n깐풍파스타에 올려 완성한다.','MANUAL06'),(356,'','MANUAL07'),(356,'','MANUAL08'),(356,'','MANUAL09'),(356,'','MANUAL10'),(356,'','MANUAL11'),(356,'','MANUAL12'),(356,'','MANUAL13'),(356,'','MANUAL14'),(356,'','MANUAL15'),(356,'','MANUAL16'),(356,'','MANUAL17'),(356,'','MANUAL18'),(356,'','MANUAL19'),(356,'','MANUAL20'),(357,'1. 닭은 깨끗이 씻어 여러 번 토막을 낸다.','MANUAL01'),(357,'2. 토막 낸 닭을 카레가루와 녹말가루에\n버무려 놓는다.','MANUAL02'),(357,'3. 양파와 당근, 파프리카, 오이는 크기를\n작은 깍두기 모양으로 썰어 준비한다.','MANUAL03'),(357,'4. 팬에 식용유를 두르고 다진마늘를 살짝\n볶은 뒤 저염간장에 레몬즙과 설탕, 꿀,\n볶은 마늘을 넣어 섞는다.','MANUAL04'),(357,'5. 요거트에 썰어 놓은 양파와 당근,\n파프리카, 오이, 케첩을 넣어 섞어준다.','MANUAL05'),(357,'6. 튀김기름 온도가 170℃가 되면 버무려\n놓은 닭(②)을 넣고 두 번 튀겨, 기름을\n제거하고, ④번 소스에 살짝 버무려\n접시에 담아, 준비한 요거트소스(⑤)를\n올려 완성한다.','MANUAL06'),(357,'','MANUAL07'),(357,'','MANUAL08'),(357,'','MANUAL09'),(357,'','MANUAL10'),(357,'','MANUAL11'),(357,'','MANUAL12'),(357,'','MANUAL13'),(357,'','MANUAL14'),(357,'','MANUAL15'),(357,'','MANUAL16'),(357,'','MANUAL17'),(357,'','MANUAL18'),(357,'','MANUAL19'),(357,'','MANUAL20'),(358,'1. 소고기는 포를 두툼하게 떠서, 소금과\n후춧가루를 뿌려 숙성을 시킨다.','MANUAL01'),(358,'2. 인삼은 뇌두를 잘라 씻어 약 2cm\n두께로 썰고, 파인애플과 파프리카도\n두툼하게 썰고, 표고버섯과 대파,\n토마토를 썰어 준비하고, 베이컨도\n2cm 길이로 썰어 준비한다.','MANUAL02'),(358,'3. 팬에 기름 없이 파인애플과 파프리카를\n먼저 굽는다.','MANUAL03'),(358,'4. 잘라놓은 인삼은 올리브오일을 살짝\n넣고 굽는다.','MANUAL04'),(358,'5. 마늘은 썰어 굽고, 준비한 재료를\n꼬치에 차례로 꽂아 프라이팬 또는\n직화로 구워 담는다.','MANUAL05'),(358,'6. 유자청에 저염간장과 레몬, 설탕을\n넣고 골고루 섞어 구워 놓은 소고기\n꼬지에 올려 완성한다.','MANUAL06'),(358,'','MANUAL07'),(358,'','MANUAL08'),(358,'','MANUAL09'),(358,'','MANUAL10'),(358,'','MANUAL11'),(358,'','MANUAL12'),(358,'','MANUAL13'),(358,'','MANUAL14'),(358,'','MANUAL15'),(358,'','MANUAL16'),(358,'','MANUAL17'),(358,'','MANUAL18'),(358,'','MANUAL19'),(358,'','MANUAL20'),(359,'1. 다시마는 깨끗이 씻어 찬물에 넣고\n은근히 끓여 다시마 육수를 만들어\n생강즙과 저염간장을 넣어 약한 불에서\n졸여 볶음 간장을 만들어 놓는다.','MANUAL01'),(359,'2. 황태는 강판에 갈아 곱게 가루를 만들어\n놓는다.','MANUAL02'),(359,'3. 새우는 씻어놓고, 오징어는 소금을\n이용하여 껍질을 벗기고, 안쪽에 사선\n으로 칼집을 넣어 모양을 만들어 살짝\n데쳐 준비한다.','MANUAL03'),(359,'4. 양파와 마늘은 입자있게 다지고, 대파는\n5cm 길이로 썰어놓고, 표고버섯과\n양배추도 채를 썰고, 숙주는 다듬어\n놓는다.','MANUAL04'),(359,'5. 라면은 끓는 물에 데쳐 준비한다.','MANUAL05'),(359,'6. 팬에 올리브오일을 넣어 따근해지면,\n오징어와 새우를 넣어 볶다가, 다시\n숙주와 마요네즈, 설탕, ①번 소스와\n채소를 넣어 센 불에서 재빠르게 볶고,\n다시 면을 넣어 볶아 완성한다.','MANUAL06'),(359,'','MANUAL07'),(359,'','MANUAL08'),(359,'','MANUAL09'),(359,'','MANUAL10'),(359,'','MANUAL11'),(359,'','MANUAL12'),(359,'','MANUAL13'),(359,'','MANUAL14'),(359,'','MANUAL15'),(359,'','MANUAL16'),(359,'','MANUAL17'),(359,'','MANUAL18'),(359,'','MANUAL19'),(359,'','MANUAL20'),(360,'1. 쌀은 물에 불려 밥을 짓고, 가지는 길게\n썰어 팬에 구워 놓는다.','MANUAL01'),(360,'2. 양파와 마늘은 잘게 다져 준비한다.','MANUAL02'),(360,'3. 토마토는 입자있게 다져 놓는다.','MANUAL03'),(360,'4. 새우는 정종을 넣어 데쳐 껍질을 벗겨\n준비한다.','MANUAL04'),(360,'5. 팬에 올리브 오일을 넣고 양파와 마늘을\n먼저 볶는다.','MANUAL05'),(360,'6. 볶아지는 양파와 마늘에 토마토소스와\n케첩을 넣어 볶다가 토마토와 설탕을\n넣어 볶다가 졸이고, 밥을 그릇에 담고,\n구운 가지와 새우를 올린 후 졸여 놓은\n토마토소스를 위에 올린 후 어린잎을\n살짝 올려 완성한다.','MANUAL06'),(360,'','MANUAL07'),(360,'','MANUAL08'),(360,'','MANUAL09'),(360,'','MANUAL10'),(360,'','MANUAL11'),(360,'','MANUAL12'),(360,'','MANUAL13'),(360,'','MANUAL14'),(360,'','MANUAL15'),(360,'','MANUAL16'),(360,'','MANUAL17'),(360,'','MANUAL18'),(360,'','MANUAL19'),(360,'','MANUAL20'),(361,'1. 양송이는 껍질을 벗겨 형태 그대로\n썰고, 표고버섯은 기둥을 제거하고\n편으로 썰어놓는다.','MANUAL01'),(361,'2. 팬에 버터를 살짝 넣고 썰어놓은\n버섯을 소금을 살짝 뿌려 볶아 준비한다.','MANUAL02'),(361,'3. 냄비에 버터와 밀가루를 넣고, 은근히\n볶아 화이트루를 만든다.','MANUAL03'),(361,'4. 화이트 루에 우유를 조금씩 넣고 뭉치지\n않게 풀어 끓이다가 다시 생크림을 넣고\n한 소큼 끓여 놓는다.','MANUAL04'),(361,'5. 스파게티는 끓는 물에 약 10분 정도\n삶아 건져 올리브 오일에 볶아 접시에\n담는다.','MANUAL05'),(361,'6. 끓여 놓은 크림소스에 볶아진 버섯과\n후춧가루를 넣고 한 소큼 더 끓여\n스파게티를 담은 접시에 넣고 완성한다.','MANUAL06'),(361,'','MANUAL07'),(361,'','MANUAL08'),(361,'','MANUAL09'),(361,'','MANUAL10'),(361,'','MANUAL11'),(361,'','MANUAL12'),(361,'','MANUAL13'),(361,'','MANUAL14'),(361,'','MANUAL15'),(361,'','MANUAL16'),(361,'','MANUAL17'),(361,'','MANUAL18'),(361,'','MANUAL19'),(361,'','MANUAL20'),(362,'1. 동치미에 배를 갈아 넣고, 설탕과\n식초를 넣어 양념을 한 후 냉장고에\n보관한다.','MANUAL01'),(362,'2. 양파는 채를 썰고, 오이와 당근은 편으로\n썰어 소금물에 살짝 절여 준비한다.','MANUAL02'),(362,'3. 다진 소고기는 다진 대파와 다진 마늘,\n매실액, 참기름, 통깨, 후춧가루, 정종,\n설탕, 간장을 넣어 양념을 한다.','MANUAL03'),(362,'4. 양념을 한 소고기를 잘 치대어 둥글게\n떡갈비를 만들어 냉장고에서 숙성을\n시킨다.','MANUAL04'),(362,'5. 숙성된 떡갈비를 팬에 기름을 살짝\n둘러 은근히 익혀, 냅킨에 올려 기름을\n빼놓는다.','MANUAL05'),(362,'6. 끓는 물에 국수를 삶아 찬물에 여러 번\n헹구어 건져 그릇에 담고, 그 위에\n떡갈비를 올리고, 차게 보관한 동치미\n국물을 부은 뒤 곁들임채소로 오이와\n당근, 양파를 얹어 완성한다.','MANUAL06'),(362,'','MANUAL07'),(362,'','MANUAL08'),(362,'','MANUAL09'),(362,'','MANUAL10'),(362,'','MANUAL11'),(362,'','MANUAL12'),(362,'','MANUAL13'),(362,'','MANUAL14'),(362,'','MANUAL15'),(362,'','MANUAL16'),(362,'','MANUAL17'),(362,'','MANUAL18'),(362,'','MANUAL19'),(362,'','MANUAL20'),(363,'1. 닭고기에 물을 자작하게 넣고\n월계수잎과 통후추, 정종을 넣고\n약 20분 정도 삶아 식혀 찢어놓는다.','MANUAL01'),(363,'2. 브로컬리는 끓는 물에 소금을 넣고,\n데쳐 작게 썰어놓고, 양상추는 물에\n담그어 놓았다가 먹기 좋게 손으로\n찢어 놓는다.','MANUAL02'),(363,'3. 파프리카는 속씨를 제거하고, 작은\n깍둑썰기를 하고, 당근은 5cm 길이로\n납작하게 썰어놓는다.','MANUAL03'),(363,'4. 브로컬리는 끓는 물에 소금을 넣고 데쳐\n작게 썰어놓고, 양상추는 물에 담그어\n놓았다가 먹기 좋게 손으로 찢어 놓는다.','MANUAL04'),(363,'5. 발사믹 식초에 설탕과 올리브 오일을\n넣고 골고루 섞어 소스를 만들어\n놓는다.','MANUAL05'),(363,'6. 찢어 놓은 닭고기살과 백김치를 넣고,\n준비한 채소를 넣어 먹기 직전에 소스를\n올려 완성한다.','MANUAL06'),(363,'','MANUAL07'),(363,'','MANUAL08'),(363,'','MANUAL09'),(363,'','MANUAL10'),(363,'','MANUAL11'),(363,'','MANUAL12'),(363,'','MANUAL13'),(363,'','MANUAL14'),(363,'','MANUAL15'),(363,'','MANUAL16'),(363,'','MANUAL17'),(363,'','MANUAL18'),(363,'','MANUAL19'),(363,'','MANUAL20'),(364,'1. 단호박은 잘라 씨를 제거하고 껍질을\n벗겨 김이 오른 찜통에서 약 20분 정도\n찐다.','MANUAL01'),(364,'2. 찐 단호박이 한 김 식으면, 채에 곱게\n내려 준비하고, 스파게티는 소금을\n넣고 삶아 건져놓는다.','MANUAL02'),(364,'3. 베이컨은 입자있게 썰고, 양송이버섯은\n껍질을 벗겨 다지고, 양파도 입자있게\n다진다.','MANUAL03'),(364,'4. 팬에 버터를 녹인 뒤 다진 마늘을 먼저\n넣고 은근히 볶아 향을 만든다.','MANUAL04'),(364,'5. 볶은 마늘(④)에 베이컨과 양송이,\n양파를 넣고 다시 볶는다.','MANUAL05'),(364,'6. 볶은 채소(⑤)에 육수를 붓고 끓이다가\n으깬 단호박(②), 생크림, 우유를 넣어\n한소끔 끓인 뒤 삶아놓은 스파게티면\n(②)을 넣고 다시 한 번 더 끓여 완성\n한다.','MANUAL06'),(364,'','MANUAL07'),(364,'','MANUAL08'),(364,'','MANUAL09'),(364,'','MANUAL10'),(364,'','MANUAL11'),(364,'','MANUAL12'),(364,'','MANUAL13'),(364,'','MANUAL14'),(364,'','MANUAL15'),(364,'','MANUAL16'),(364,'','MANUAL17'),(364,'','MANUAL18'),(364,'','MANUAL19'),(364,'','MANUAL20'),(365,'1. 흑임자는 곱게 갈아 밀가루와 우유를\n넣고 반죽을 해서 비닐에 넣어 숙성\n시킨다.','MANUAL01'),(365,'2. 닭가슴살은 삶아 건져 후춧가루를\n살짝 넣고, 입자있게 다진다.','MANUAL02'),(365,'3. 입자있게 다진 닭가슴살을 마늘과 함께\n팬에서 볶아놓는다.','MANUAL03'),(365,'4. 마와 바나나는 강판에 갈고, 캐슈넛과\n잣은 입자있게 다진 뒤 냄비에 마,\n바나나, 캐슈넛, 잣, 머스터드를 넣어\n섞은 뒤, 우유를 넣고 살짝 끓여 편수\n육수를 만들어 놓는다.','MANUAL04'),(365,'5. 부추와 양파, 파는 입자있게 썰어, 볶아\n놓은 닭가슴살(③)에 섞어 편수 속을\n만들어 놓는다.','MANUAL05'),(365,'6. 숙성시킨 밀가루 반죽(①)은 얇게\n밀어 사각형으로 썰어 그 안에 속을\n채워 넣고, 찜통에 약 5분 정도 쪄\n접시에 담고, 그 위에 편수 육수를\n올려 완성한다.','MANUAL06'),(365,'','MANUAL07'),(365,'','MANUAL08'),(365,'','MANUAL09'),(365,'','MANUAL10'),(365,'','MANUAL11'),(365,'','MANUAL12'),(365,'','MANUAL13'),(365,'','MANUAL14'),(365,'','MANUAL15'),(365,'','MANUAL16'),(365,'','MANUAL17'),(365,'','MANUAL18'),(365,'','MANUAL19'),(365,'','MANUAL20'),(366,'1. 끓는 물에 바지락을 넣고, 바지락이\n입을 벌릴 때 까지 삶는다.','MANUAL01'),(366,'2. 삶아진 바지락을 채에 밭쳐 바지락\n국물을 만들어 놓는다.','MANUAL02'),(366,'3. 브로컬리는 끓는 물에 소금을 조금\n넣어 데쳐 찬물에 헹구어 잘라놓고,\n마늘은 편으로 썰고, 파프리카는 채를\n썰고, 청양고추는 어슷썰어 놓는다.','MANUAL03'),(366,'4. 팬에 올리브 오일을 조금 넣고 마늘과\n청양고추를 먼저 볶는다.','MANUAL04'),(366,'5. 볶아지는 팬에 바지락과 브로컬리를\n넣고 볶는다.','MANUAL05'),(366,'6. 볶아지는 팬에 바지락 국물을 넣어\n졸이다가 실곤약과 파프리카, 후춧\n가루를 넣고, 한 번 더 졸여 완성한다.','MANUAL06'),(366,'','MANUAL07'),(366,'','MANUAL08'),(366,'','MANUAL09'),(366,'','MANUAL10'),(366,'','MANUAL11'),(366,'','MANUAL12'),(366,'','MANUAL13'),(366,'','MANUAL14'),(366,'','MANUAL15'),(366,'','MANUAL16'),(366,'','MANUAL17'),(366,'','MANUAL18'),(366,'','MANUAL19'),(366,'','MANUAL20'),(367,'1. 두부는 김이 오르는 찜통에 소금을\n넣고 약 5분 정도 쪄 놓는다.','MANUAL01'),(367,'2. 황태는 강판에 갈아 보프리를 만들어\n놓는다.','MANUAL02'),(367,'3. 홍합은 끓는 육수에 데쳐 육수는 따로\n걸러 놓고, 홍합은 살만 꺼내 따로 준비\n한다.','MANUAL03'),(367,'4. 냄비에 버터를 녹이고, 두부와 홍합을\n으깨어 볶는다.','MANUAL04'),(367,'5. 볶아지는 냄비에 만들어 놓은 육수와\n생크림을 넣고, 골고루 섞어 가면서\n볶는다.','MANUAL05'),(367,'6. 두부가 육수에 볶아지면, 마지막에\n황태보프라기를 넣고, 달걀과 참기름\n통깨를 넣어 살짝 익혀 완성한다.','MANUAL06'),(367,'','MANUAL07'),(367,'','MANUAL08'),(367,'','MANUAL09'),(367,'','MANUAL10'),(367,'','MANUAL11'),(367,'','MANUAL12'),(367,'','MANUAL13'),(367,'','MANUAL14'),(367,'','MANUAL15'),(367,'','MANUAL16'),(367,'','MANUAL17'),(367,'','MANUAL18'),(367,'','MANUAL19'),(367,'','MANUAL20'),(368,'1. 애호박은 길게 반으로 자른다.','MANUAL01'),(368,'2. 자른 애호박에 칼집을 넣는다.','MANUAL02'),(368,'3. 깻잎은 잘게 썰고, 양파는 곱게 다지고\n피망, 파프리카는 입자있게 썬다.','MANUAL03'),(368,'4. 저염간장에 다진 양파와 매실액을 넣고\n잘 섞어 양념장을 만든다.','MANUAL04'),(368,'5. 양념장에 피망, 파프리카, 깻잎을\n섞는다.','MANUAL05'),(368,'6. ?번을 칼집낸 호박 가운데 넣고 찜통\n에서 5분 정도 쪄 낸 뒤 그릇에 담아 저\n염간장소스를 한번 더 올린다.','MANUAL06'),(368,'','MANUAL07'),(368,'','MANUAL08'),(368,'','MANUAL09'),(368,'','MANUAL10'),(368,'','MANUAL11'),(368,'','MANUAL12'),(368,'','MANUAL13'),(368,'','MANUAL14'),(368,'','MANUAL15'),(368,'','MANUAL16'),(368,'','MANUAL17'),(368,'','MANUAL18'),(368,'','MANUAL19'),(368,'','MANUAL20'),(369,'1. 계피가루와 대추를 삶아 건지고, 삶은\n물은 따로 준비한다.','MANUAL01'),(369,'2. 밀가루에 대추와 계피 삶은 물을 넣고\n전병 반죽을 한다.','MANUAL02'),(369,'3. 팬에 기름을 살짝 두르고 전병반죽을\n작은 국자로 떠넣고 전병을 만든다.','MANUAL03'),(369,'4. 달걀은 황백으로 나눠 지단을 부쳐\n채를 썬다.','MANUAL04'),(369,'5. 오이, 당근, 양파 및 표고버섯은 채를\n썰어 소금에 살짝 절여 팬에 볶아 따로\n준비한다.','MANUAL05'),(369,'6. 소고기는 채를 썰어 저염간장으로 양념\n하고 팬에 볶은 후, 만들어 놓은 전병에\n볶은 야채와 소고기를 올려 돌돌 말아\n접시에 담고 그 위에 잣을 올리고\n녹차를 만든다.','MANUAL06'),(369,'','MANUAL07'),(369,'','MANUAL08'),(369,'','MANUAL09'),(369,'','MANUAL10'),(369,'','MANUAL11'),(369,'','MANUAL12'),(369,'','MANUAL13'),(369,'','MANUAL14'),(369,'','MANUAL15'),(369,'','MANUAL16'),(369,'','MANUAL17'),(369,'','MANUAL18'),(369,'','MANUAL19'),(369,'','MANUAL20'),(370,'1. 새우와 흰살생선, 우둔살은 쪄낸 후 한\n김 식힌다.','MANUAL01'),(370,'2. 쪄낸 새우와 흰살 생선, 우둔살을 곱게\n다진다.','MANUAL02'),(370,'3. ?번에 녹말과 달걀물을 넣고 소금을\n조금 넣고 골고루 섞어 숙성시킨다.','MANUAL03'),(370,'4. 고구마와 단호박은 찜통에 찐다.','MANUAL04'),(370,'5. 찐 고구마와 단호박을 곱게 갈아\n된장을 섞는다.','MANUAL05'),(370,'6. 숙성된 반죽으로 해물완자를 빚고,\n된장을 섞은 단호박, 고구마를\n끓이면서 해물 완자를 넣어준다','MANUAL06'),(370,'','MANUAL07'),(370,'','MANUAL08'),(370,'','MANUAL09'),(370,'','MANUAL10'),(370,'','MANUAL11'),(370,'','MANUAL12'),(370,'','MANUAL13'),(370,'','MANUAL14'),(370,'','MANUAL15'),(370,'','MANUAL16'),(370,'','MANUAL17'),(370,'','MANUAL18'),(370,'','MANUAL19'),(370,'','MANUAL20'),(371,'1. 닭가슴살은 포를 떠 넓게 편다.','MANUAL01'),(371,'2. 포 뜬 닭가슴살에 소금, 후춧가루로\n밑간을 한다.','MANUAL02'),(371,'3. 당면은 따뜻한 물에 불려 건진 뒤 3cm\n길이로 썬다.','MANUAL03'),(371,'4. 부추는 송송 썰고 당근은 곱게 채썬다.','MANUAL04'),(371,'5. 당면, 당근, 부추는 골고루 섞어\n저염간장으로 간을 한다.','MANUAL05'),(371,'6. 밑간이 된 닭가슴살에 ?번을 넣고\n돌돌 말아 김이 오른 찜통에서 약 10분\n정도 찐 뒤 한 김 식혀 썬다.','MANUAL06'),(371,'','MANUAL07'),(371,'','MANUAL08'),(371,'','MANUAL09'),(371,'','MANUAL10'),(371,'','MANUAL11'),(371,'','MANUAL12'),(371,'','MANUAL13'),(371,'','MANUAL14'),(371,'','MANUAL15'),(371,'','MANUAL16'),(371,'','MANUAL17'),(371,'','MANUAL18'),(371,'','MANUAL19'),(371,'','MANUAL20'),(372,'1. 통 도라지는 껍질을 벗긴다','MANUAL01'),(372,'2. 껍질을 벗긴 도라지는 잘라 소금에\n살짝 절여 쓴맛을 뺀다.','MANUAL02'),(372,'3. 청·홍고추와 양파는 채썬다.','MANUAL03'),(372,'4. 썰어 놓은 청. 홍고추와 양파는 차가운\n물에 담군 뒤 체에 밭쳐 물기를 뺀다.','MANUAL04'),(372,'5. 라임쥬스, 흑임자와 유자청을 골고루\n섞어 소스를 만들고 도라지와 야채를\n넣어 버물려 접시에 담는다','MANUAL05'),(372,'6. 홍고추는 반으로 잘라 장식한다.','MANUAL06'),(372,'','MANUAL07'),(372,'','MANUAL08'),(372,'','MANUAL09'),(372,'','MANUAL10'),(372,'','MANUAL11'),(372,'','MANUAL12'),(372,'','MANUAL13'),(372,'','MANUAL14'),(372,'','MANUAL15'),(372,'','MANUAL16'),(372,'','MANUAL17'),(372,'','MANUAL18'),(372,'','MANUAL19'),(372,'','MANUAL20'),(373,'1. 다시마 우린 물에 가다랑어포를 넣고 10분간 담갔다가 체에 거르고, 쌀로 밥을 짓는다.','MANUAL01'),(373,'2. 돼지고기는 소금과 후춧가루로 밑간을 한 뒤 굽는다.','MANUAL02'),(373,'3. 양파, 표고버섯, 팽이버섯은 채 썰고, 쪽파는 버섯 길이로 썬다.','MANUAL03'),(373,'4. 육수에 저염간장을 넣어 한소끔 끓이다가 양파와 버섯을 넣고 끓인다.','MANUAL04'),(373,'5. 다시 한 번 끓어오르면 쪽파와 달걀을 고루 풀어 넣고 젓지 말고 그대로 끓인다.','MANUAL05'),(373,'6. 그릇에 밥을 담고, 돼지고기와 숙주를 올린 뒤 뜨거운 육수를 부어 마무리한다.','MANUAL06'),(373,'','MANUAL07'),(373,'','MANUAL08'),(373,'','MANUAL09'),(373,'','MANUAL10'),(373,'','MANUAL11'),(373,'','MANUAL12'),(373,'','MANUAL13'),(373,'','MANUAL14'),(373,'','MANUAL15'),(373,'','MANUAL16'),(373,'','MANUAL17'),(373,'','MANUAL18'),(373,'','MANUAL19'),(373,'','MANUAL20'),(374,'1. 새우, 양파, 당근, 새송이버섯은\n입자있게 다진다.','MANUAL01'),(374,'2. 두부는 곱게 으깬다.','MANUAL02'),(374,'3. ?번과 으깬 두부, 소금, 달걀을 골고루\n섞는다.','MANUAL03'),(374,'4. 파인애플을 넣어 곱게 갈아\n올리브오일을 섞어 소스를 만든다.','MANUAL04'),(374,'5. 으깬 두부를 원형으로 만든다.','MANUAL05'),(374,'6. 팬에 기름을 두르고 두부와 토마토를\n굽고, 접시에 케일을 깔고 그 위에\n두부와 토마토를 올린 뒤\n파인애플소스를 올린다.','MANUAL06'),(374,'','MANUAL07'),(374,'','MANUAL08'),(374,'','MANUAL09'),(374,'','MANUAL10'),(374,'','MANUAL11'),(374,'','MANUAL12'),(374,'','MANUAL13'),(374,'','MANUAL14'),(374,'','MANUAL15'),(374,'','MANUAL16'),(374,'','MANUAL17'),(374,'','MANUAL18'),(374,'','MANUAL19'),(374,'','MANUAL20'),(375,'1. 곤약은 얇게 썬다.','MANUAL01'),(375,'2. 끓는 물에 식초를 한두 방울 넣고, 썰어\n놓은 곤약을 데친다.','MANUAL02'),(375,'3. 표고는 불려서 채를 썬다.','MANUAL03'),(375,'4. 마늘을 다져서 냄비에 볶는다.','MANUAL04'),(375,'5. 냄비에 표고버섯과 새송이버섯을 넣고\n함께 볶는다.','MANUAL05'),(375,'6. 냄비에 들깨가루와 사골육수를 넣고\n끓인 뒤 데친 곤약을 넣은 뒤 한소끔 더\n끓인다.','MANUAL06'),(375,'','MANUAL07'),(375,'','MANUAL08'),(375,'','MANUAL09'),(375,'','MANUAL10'),(375,'','MANUAL11'),(375,'','MANUAL12'),(375,'','MANUAL13'),(375,'','MANUAL14'),(375,'','MANUAL15'),(375,'','MANUAL16'),(375,'','MANUAL17'),(375,'','MANUAL18'),(375,'','MANUAL19'),(375,'','MANUAL20'),(376,'1. 물 한 컵에 설탕, 식초, 소금,\n피클링스파이스를 넣고 식촛물을\n만든다.','MANUAL01'),(376,'2. 배는 스쿱으로 동그랗게 판다.','MANUAL02'),(376,'3. 토마토는 1/6등분으로 썬다.','MANUAL03'),(376,'4. 마와 우엉은 슬라이스 한다.','MANUAL04'),(376,'5. 썰어 놓은 마와 우엉을 식촛물에\n담근다.','MANUAL05'),(376,'6. 와인에 먹물, 설탕을 넣고 섞어\n식촛물에 넣고 배, 토마토, 새싹을\n넣는다.','MANUAL06'),(376,'','MANUAL07'),(376,'','MANUAL08'),(376,'','MANUAL09'),(376,'','MANUAL10'),(376,'','MANUAL11'),(376,'','MANUAL12'),(376,'','MANUAL13'),(376,'','MANUAL14'),(376,'','MANUAL15'),(376,'','MANUAL16'),(376,'','MANUAL17'),(376,'','MANUAL18'),(376,'','MANUAL19'),(376,'','MANUAL20'),(377,'1. 고등어는 길게 포를 뜬다.','MANUAL01'),(377,'2. 새우는 껍질을 벗겨 손질한다.','MANUAL02'),(377,'3. 새송이와 당근은 채썬다','MANUAL03'),(377,'4. 미나리는 끓는 물에 살짝 데친다.','MANUAL04'),(377,'5. 묵은지는 흐르는 물에 헹군 뒤,\n묵은지에 고등어를 넣고 새우, 새송이,\n당근, 가지를 넣고 돌돌 말아 미나리로\n묶은 뒤 찐다.','MANUAL05'),(377,'6. 양상추, 오이, 깻잎, 파프리카를\n채썰고 땅콩가루를 버무려 함께\n담아낸다.','MANUAL06'),(377,'','MANUAL07'),(377,'','MANUAL08'),(377,'','MANUAL09'),(377,'','MANUAL10'),(377,'','MANUAL11'),(377,'','MANUAL12'),(377,'','MANUAL13'),(377,'','MANUAL14'),(377,'','MANUAL15'),(377,'','MANUAL16'),(377,'','MANUAL17'),(377,'','MANUAL18'),(377,'','MANUAL19'),(377,'','MANUAL20'),(378,'1. 버섯은 채썬다.','MANUAL01'),(378,'2. 끓는 물에 채썰어 놓은 버섯을\n데쳐낸다.','MANUAL02'),(378,'3. 다시마는 물에 담궈 다시마 물을\n만들어 식초와 설탕 저염간장을 넣고\n골고루 섞어 소스를 만들어 놓는다.','MANUAL03'),(378,'4. 미나리는 끓는 물에 소금을 넣고\n데친다.','MANUAL04'),(378,'5. 배추는 끓는 물에 양배추와 함께 데쳐\n찬물에 헹구고 양배추는 채 썬다.','MANUAL05'),(378,'6. 김발에 데친 배추를 놓고 표고버섯,\n만송이버섯, 미나리, 양배추 채를 넣고\n돌돌 말아 먹기 좋게 썰어 접시에 담은\n뒤 소스를 담는다.','MANUAL06'),(378,'','MANUAL07'),(378,'','MANUAL08'),(378,'','MANUAL09'),(378,'','MANUAL10'),(378,'','MANUAL11'),(378,'','MANUAL12'),(378,'','MANUAL13'),(378,'','MANUAL14'),(378,'','MANUAL15'),(378,'','MANUAL16'),(378,'','MANUAL17'),(378,'','MANUAL18'),(378,'','MANUAL19'),(378,'','MANUAL20'),(379,'1. 끓는 물에 문어를 넣고 약 10분 정도\n삶아 건진다.','MANUAL01'),(379,'2. 라임은 얇게 썬다.','MANUAL02'),(379,'3. 삶은 문어를 얇게 저미고 라임을 한 장\n한 장 넣고 숙성 시킨다.','MANUAL03'),(379,'4. 양파, 오이는 채썬다.','MANUAL04'),(379,'5. 배와 토마토는 주사위 모양으로 썬다.','MANUAL05'),(379,'6. 유자청, 레몬, 올리브오일, 소금으로\n소스를 만들고, 접시에 문어와 라임을\n담고 그 옆에 썰어 놓은 야채와 과일을\n올려 소스를 올린다.','MANUAL06'),(379,'','MANUAL07'),(379,'','MANUAL08'),(379,'','MANUAL09'),(379,'','MANUAL10'),(379,'','MANUAL11'),(379,'','MANUAL12'),(379,'','MANUAL13'),(379,'','MANUAL14'),(379,'','MANUAL15'),(379,'','MANUAL16'),(379,'','MANUAL17'),(379,'','MANUAL18'),(379,'','MANUAL19'),(379,'','MANUAL20'),(380,'1. 쌀은 깨끗이 씻어 30분 정도 불린 뒤\n고슬고슬하게 밥을 짓는다.','MANUAL01'),(380,'2. 취나물과 참나물은 끓는 물에 소금을\n넣고 데쳐 헹군다.','MANUAL02'),(380,'3. 곤드레나물은 충분히 불려 삶아\n헹군다.','MANUAL03'),(380,'4. 유부는 끓는 물에 살짝 데쳐 기름기를\n제거 하고 반으로 자른다.','MANUAL04'),(380,'5. 식초, 설탕, 소금을 섞어 촛물을\n만든다.','MANUAL05'),(380,'6. 촛물을 밥에 섞고 준비한 나물을 다져\n골고루 섞고 데친 유부에 넣고 초밥을\n만들어 접시에 담은 뒤 나물과\n토마토를 올린다.','MANUAL06'),(380,'','MANUAL07'),(380,'','MANUAL08'),(380,'','MANUAL09'),(380,'','MANUAL10'),(380,'','MANUAL11'),(380,'','MANUAL12'),(380,'','MANUAL13'),(380,'','MANUAL14'),(380,'','MANUAL15'),(380,'','MANUAL16'),(380,'','MANUAL17'),(380,'','MANUAL18'),(380,'','MANUAL19'),(380,'','MANUAL20'),(381,'1. 훈제연어는 길게 손질한다','MANUAL01'),(381,'2. 아보카도는 길게 채 썬다.','MANUAL02'),(381,'3. 양파, 당근, 새송이버섯도 길게 채\n썬다.','MANUAL03'),(381,'4. 감자는 삶아 체에 내려 소금과\n사워크림을 넣고 잘 섞어서 틀에\n담는다.','MANUAL04'),(381,'5. 팬에 양파, 당근, 새송이버섯을 각각\n볶는다.','MANUAL05'),(381,'6. 사워크림과 레몬즙을 섞어 소스를\n만들고 훈제 연어에 준비된 야채를\n넣고 돌돌 말아 먹기 좋게 썰어 접시에\n담고, 한쪽에 감자를 담은 뒤\n사워소스를 올린다.','MANUAL06'),(381,'','MANUAL07'),(381,'','MANUAL08'),(381,'','MANUAL09'),(381,'','MANUAL10'),(381,'','MANUAL11'),(381,'','MANUAL12'),(381,'','MANUAL13'),(381,'','MANUAL14'),(381,'','MANUAL15'),(381,'','MANUAL16'),(381,'','MANUAL17'),(381,'','MANUAL18'),(381,'','MANUAL19'),(381,'','MANUAL20'),(382,'1. 끓는 물에 파스타를 넣고 약 10분 정도\n삶아 건져 올리브오일을 살짝 바른다.','MANUAL01'),(382,'2. 쥬키니 호박은 채썰어 소금에 절인 뒤\n볶는다.','MANUAL02'),(382,'3. 닭가슴살은 마늘을 넣고 삶은 뒤 먹기\n좋게 찢는다.','MANUAL03'),(382,'4. 사과와 비트, 레몬을 믹서에 갈아\n소스를 만든다.','MANUAL04'),(382,'5. 소스에 꿀을 넣어 맛을 내고 차갑게\n보관한다.','MANUAL05'),(382,'6. 팬에 삶아 놓은 파스타를 넣고 볶다가\n닭살과 호박채, 시금치를 넣고 볶은 뒤\n접시에 담고 차갑게 보관한 소스를\n올린다.','MANUAL06'),(382,'','MANUAL07'),(382,'','MANUAL08'),(382,'','MANUAL09'),(382,'','MANUAL10'),(382,'','MANUAL11'),(382,'','MANUAL12'),(382,'','MANUAL13'),(382,'','MANUAL14'),(382,'','MANUAL15'),(382,'','MANUAL16'),(382,'','MANUAL17'),(382,'','MANUAL18'),(382,'','MANUAL19'),(382,'','MANUAL20'),(383,'1. 새우는 껍질을 벗겨 손질한다.','MANUAL01'),(383,'2. 보리는 깨끗이 씻어 불린다.','MANUAL02'),(383,'3. 불린 보리와 새우에 5배 정도 물을 넣고\n죽을 쑨다.','MANUAL03'),(383,'4. 고등어는 포를 뜬다.','MANUAL04'),(383,'5. 포 뜬 고등어에 생강, 레몬, 막걸리를\n넣고 비린맛을 제거한다.','MANUAL05'),(383,'6. 비트에 설탕, 식초, 소금을 넣고 피클을\n만들고, 보리죽이 끓으면 포 뜬\n고등어를 넣고 은근히 익힌다.','MANUAL06'),(383,'','MANUAL07'),(383,'','MANUAL08'),(383,'','MANUAL09'),(383,'','MANUAL10'),(383,'','MANUAL11'),(383,'','MANUAL12'),(383,'','MANUAL13'),(383,'','MANUAL14'),(383,'','MANUAL15'),(383,'','MANUAL16'),(383,'','MANUAL17'),(383,'','MANUAL18'),(383,'','MANUAL19'),(383,'','MANUAL20'),(384,'1. 냄비에 다시마와 무를 넣고 끓이다가\n가쓰오부시를 넣고 불을 꺼 진한\n육수를 만든다.','MANUAL01'),(384,'2. 육수에 식초, 설탕, 소금을 넣고 촛물을\n만든다.','MANUAL02'),(384,'3. 참치는 불에 타다끼 한 뒤 두툼하게\n썬다.','MANUAL03'),(384,'4. 파프리카는 직화로 겉만 태워 참치\n크기로 썬다.','MANUAL04'),(384,'5. 아스파라거스와 표고버섯은 살짝 데쳐\n편으로 썬다.','MANUAL05'),(384,'6. 육수에 달걀을 풀어 두툼하게 지단을\n부쳐 썰고, 밥에 촛물을 넣고 골고루\n섞어 초밥을 만든 뒤 와사비, 참치,\n달걀, 표고버섯, 파프리카 순으로 올려\n김으로 띠를 두른다.','MANUAL06'),(384,'','MANUAL07'),(384,'','MANUAL08'),(384,'','MANUAL09'),(384,'','MANUAL10'),(384,'','MANUAL11'),(384,'','MANUAL12'),(384,'','MANUAL13'),(384,'','MANUAL14'),(384,'','MANUAL15'),(384,'','MANUAL16'),(384,'','MANUAL17'),(384,'','MANUAL18'),(384,'','MANUAL19'),(384,'','MANUAL20'),(385,'1. 새송이버섯과 파프리카는 가늘게 채썬다.','MANUAL01'),(385,'2. 채선 야채는 팬에 기름을 두르고 살짝 볶아낸다.','MANUAL02'),(385,'3. 찹쌀가루, 물, 소금을 섞어 찹쌀 반죽을 만든다.','MANUAL03'),(385,'4. 팬에 기름을 두르고 반죽을 한 스푼씩 떠 넣어 동그랗게 부친다.','MANUAL04'),(385,'5. 소스 재료를 모두 넣어 믹서에 간다.','MANUAL05'),(385,'6. 채소볶음을 잣소스에 무쳐 찹쌀전병 위에 한 스푼씩 올려낸다.','MANUAL06'),(385,'','MANUAL07'),(385,'','MANUAL08'),(385,'','MANUAL09'),(385,'','MANUAL10'),(385,'','MANUAL11'),(385,'','MANUAL12'),(385,'','MANUAL13'),(385,'','MANUAL14'),(385,'','MANUAL15'),(385,'','MANUAL16'),(385,'','MANUAL17'),(385,'','MANUAL18'),(385,'','MANUAL19'),(385,'','MANUAL20'),(386,'1. 얼갈이는 깨끗이 씻어 한입 크기로 뜯는다.','MANUAL01'),(386,'2. 더덕은 껍질을 벗긴다.','MANUAL02'),(386,'3. 껍질 벗긴 더덕은 굵게 채 썰어 소금물에 담가둔다.','MANUAL03'),(386,'4. 양념장 재료를 모두 섞어 양념장을 만든다.','MANUAL04'),(386,'5. 더덕을 건져 물기를 제거한다.','MANUAL05'),(386,'6. 더덕과 얼갈이 배추에 양념장을 넣고 가볍게 버무린다.','MANUAL06'),(386,'','MANUAL07'),(386,'','MANUAL08'),(386,'','MANUAL09'),(386,'','MANUAL10'),(386,'','MANUAL11'),(386,'','MANUAL12'),(386,'','MANUAL13'),(386,'','MANUAL14'),(386,'','MANUAL15'),(386,'','MANUAL16'),(386,'','MANUAL17'),(386,'','MANUAL18'),(386,'','MANUAL19'),(386,'','MANUAL20'),(387,'1. 사과와 배는 사방 2cm 네모로 썰고, 밤도 얇게 썰어준다.','MANUAL01'),(387,'2. 1을 설탕물(물 1컵 + 설탕 2.5g)에 담근다.','MANUAL02'),(387,'3. 대추, 곶감은 굵게 채 썰고 호두, 땅콩은 굵게 다진다.','MANUAL03'),(387,'4. 분량의 재료를 섞어 겨자소스 만든다.','MANUAL04'),(387,'5. 과일을 체에 받쳐 물기를 빼고 소스에 버무린다.','MANUAL05'),(387,'6. 한입 크기로 자른 양상추에 샐러드를 올려낸다.','MANUAL06'),(387,'','MANUAL07'),(387,'','MANUAL08'),(387,'','MANUAL09'),(387,'','MANUAL10'),(387,'','MANUAL11'),(387,'','MANUAL12'),(387,'','MANUAL13'),(387,'','MANUAL14'),(387,'','MANUAL15'),(387,'','MANUAL16'),(387,'','MANUAL17'),(387,'','MANUAL18'),(387,'','MANUAL19'),(387,'','MANUAL20'),(388,'1. 콜라비, 당근, 오이는 나박 썬다.','MANUAL01'),(388,'2. 고추는 둥글게 썰고 실파는 3cm 길이로 썬다.','MANUAL02'),(388,'3. 콜라비를 소금에 살짝 절인다.','MANUAL03'),(388,'4. 물에 찹쌀을 풀어 찹쌀풀을 쑤어 식힌다.','MANUAL04'),(388,'5. 찹쌀풀에 배와 적양파를 갈아 넣어 국물을 만든다.','MANUAL05'),(388,'6. 국물에 소금을 넣어 간을 맞추고 썰어놓은 채소에 부어 용기에 담아 익혀 먹는다.','MANUAL06'),(388,'','MANUAL07'),(388,'','MANUAL08'),(388,'','MANUAL09'),(388,'','MANUAL10'),(388,'','MANUAL11'),(388,'','MANUAL12'),(388,'','MANUAL13'),(388,'','MANUAL14'),(388,'','MANUAL15'),(388,'','MANUAL16'),(388,'','MANUAL17'),(388,'','MANUAL18'),(388,'','MANUAL19'),(388,'','MANUAL20'),(389,'1. 고구마를 전자렌지에서 익힌다.','MANUAL01'),(389,'2. 전자레인지 마지막 1분이 남았을 때 컵에 우유를 따라 함께 데운다.','MANUAL02'),(389,'3. 거품기로 살짝 저어 거품을 낸다.','MANUAL03'),(389,'4. 고구마의 껍질을 벗겨 작게 잘라 우유, 요거트, 호두, 올리고당을 넣고 믹서에 간다.','MANUAL04'),(389,'5. 거품기로 살짝 저어 거품을 낸다.','MANUAL05'),(389,'6. 잔에 따르고 계피가루를 뿌린다.','MANUAL06'),(389,'','MANUAL07'),(389,'','MANUAL08'),(389,'','MANUAL09'),(389,'','MANUAL10'),(389,'','MANUAL11'),(389,'','MANUAL12'),(389,'','MANUAL13'),(389,'','MANUAL14'),(389,'','MANUAL15'),(389,'','MANUAL16'),(389,'','MANUAL17'),(389,'','MANUAL18'),(389,'','MANUAL19'),(389,'','MANUAL20'),(390,'1. 홍시의 껍질을 벗긴다.','MANUAL01'),(390,'2. 껍질 벗긴 홍시에 꿀과 물을 넣어 믹서에 간다.','MANUAL02'),(390,'3. 곶감을 갈라 씨를 뺀다.','MANUAL03'),(390,'4. 씨를 빼낸 곶감에 호두를 넣어 만다.','MANUAL04'),(390,'5. 곶감말이를 0.5cm 두게로 썬다.','MANUAL05'),(390,'6. 홍시 간 것에 곶감말이를 띄워 낸다.','MANUAL06'),(390,'','MANUAL07'),(390,'','MANUAL08'),(390,'','MANUAL09'),(390,'','MANUAL10'),(390,'','MANUAL11'),(390,'','MANUAL12'),(390,'','MANUAL13'),(390,'','MANUAL14'),(390,'','MANUAL15'),(390,'','MANUAL16'),(390,'','MANUAL17'),(390,'','MANUAL18'),(390,'','MANUAL19'),(390,'','MANUAL20'),(391,'1. 오징어 몸통을 가르고 껍질을 벗긴 후 씻어서 물기를 제거 한다.','MANUAL01'),(391,'2. 오징어 안쪽에 대각선으로 0.3cm 간격의 칼집을 넣고 반대방향으로도 칼집을 넣는다.','MANUAL02'),(391,'3. 오이와 파프리카는 0.4cm 폭으로 길게 썬다.','MANUAL03'),(391,'4. 오징어의 칼집을 넣지 않은 부분에 오이와 파프리카를 얹고 김밥처럼 말아 실로 엮은 후 찜통에 넣고 찐다.','MANUAL04'),(391,'5. 치킨양념소스는 다진 마늘과 다진 양파를 팬에 기름을 두르지 않고 살짝 구워 향을 낸 후 고추장, 토마토케첩, 물엿을 넣고 소스를 만든다.','MANUAL05'),(391,'6. 익은 오징어 말이는 2~3cm 길이로 썰고 5의 소스를 곁들인다.','MANUAL06'),(391,'','MANUAL07'),(391,'','MANUAL08'),(391,'','MANUAL09'),(391,'','MANUAL10'),(391,'','MANUAL11'),(391,'','MANUAL12'),(391,'','MANUAL13'),(391,'','MANUAL14'),(391,'','MANUAL15'),(391,'','MANUAL16'),(391,'','MANUAL17'),(391,'','MANUAL18'),(391,'','MANUAL19'),(391,'','MANUAL20'),(392,'1. 감자는 익기 쉽도록 토막 내고 완두콩과 옥수수알과 함께 김이 오른 찜통에 10~15분간 찐다.','MANUAL01'),(392,'2. 찐 감자를 으깬다.','MANUAL02'),(392,'3. 달걀은 삶아 흰자는 굵게 다지고 노른자는 체에 곱게 내린다.','MANUAL03'),(392,'4. 파프리카는 옥수수알 크기로 썬다.','MANUAL04'),(392,'5. 2에 완두콩, 옥수수, 파프리카, 달걀 흰자를 넣어 섞는다.','MANUAL05'),(392,'6. 마요네즈, 호상요구르트, 달걀노른자, 소금을 넣어 샐러드드레싱을 만들어 5와 곁들인다.','MANUAL06'),(392,'','MANUAL07'),(392,'','MANUAL08'),(392,'','MANUAL09'),(392,'','MANUAL10'),(392,'','MANUAL11'),(392,'','MANUAL12'),(392,'','MANUAL13'),(392,'','MANUAL14'),(392,'','MANUAL15'),(392,'','MANUAL16'),(392,'','MANUAL17'),(392,'','MANUAL18'),(392,'','MANUAL19'),(392,'','MANUAL20'),(393,'1. 물 1컵 반에 홍합, 국멸치, 건다시마, 양파를 넣고 멸치다시마국물 1컵을 내고 다시마는 건져 채 썬다.','MANUAL01'),(393,'2. 감자는 껍질을 벗겨 찜통에 찐 후 으깬다.','MANUAL02'),(393,'3. 2의 재료에 쌀가루, 달걀노른자, 현미유, 소금을 넣고 반죽하여 구슬크기의 옹심이를 10개 정도 만든다.','MANUAL03'),(393,'4. 호박은 돌려깍기하여 2cm 가량으로 채 썰고 파, 홍고추, 청고추는 어슷썰기 한다.','MANUAL04'),(393,'5. 멸치다시마국물이 끓으면 옹심이를 넣고 익어서 떠오르면 홍합, 호박, 다진 파, 다진 마늘, 다시마를 넣고 국간장으로 간을 한다.','MANUAL05'),(393,'6. 홍고추와 청고추로 장식한다.','MANUAL06'),(393,'','MANUAL07'),(393,'','MANUAL08'),(393,'','MANUAL09'),(393,'','MANUAL10'),(393,'','MANUAL11'),(393,'','MANUAL12'),(393,'','MANUAL13'),(393,'','MANUAL14'),(393,'','MANUAL15'),(393,'','MANUAL16'),(393,'','MANUAL17'),(393,'','MANUAL18'),(393,'','MANUAL19'),(393,'','MANUAL20'),(394,'1. 배추김치는 속을 털어낸다.','MANUAL01'),(394,'2. 1의 김치를 다진 다음 물기를 짠다.','MANUAL02'),(394,'3. 당근, 양파, 파는 잘게 다진다.','MANUAL03'),(394,'4. 달걀은 흰자와 노른자를 체에 거른다.','MANUAL04'),(394,'5. 달걀에 물 반컵을 넣고 잘 저은 후 1,2의 재료와 찬밥을 섞고 새우젓으로 간을 한다.','MANUAL05'),(394,'6. 5를 찜통에 넣고 찐다.','MANUAL06'),(394,'','MANUAL07'),(394,'','MANUAL08'),(394,'','MANUAL09'),(394,'','MANUAL10'),(394,'','MANUAL11'),(394,'','MANUAL12'),(394,'','MANUAL13'),(394,'','MANUAL14'),(394,'','MANUAL15'),(394,'','MANUAL16'),(394,'','MANUAL17'),(394,'','MANUAL18'),(394,'','MANUAL19'),(394,'','MANUAL20'),(395,'1. 떡볶이떡은 반으로 잘라 끓는 물에 데쳐 건진다.','MANUAL01'),(395,'2. 꼬막은 씻어 떡을 데친 끓는 물(잔열)에 살짝 삶아 건진 후 식으면 꼬막살을 뺀다.','MANUAL02'),(395,'3. 꼬치에 데친 떡과 꼬막살을 번갈아 가며 꽂는다.','MANUAL03'),(395,'4. 파와 양파는 다진다.','MANUAL04'),(395,'5. 고추장, 양파, 파, 다진 마늘, 조청, 간장, 고춧가루, 참기름을 넣어 고추장양념을 만든다.','MANUAL05'),(395,'6. 팬에 현미유를 조금 두르고 고추장양념을 볶다가 3의 꼬막떡꼬치에 고추장양념을 입힌 후 통깨를 뿌린다.','MANUAL06'),(395,'','MANUAL07'),(395,'','MANUAL08'),(395,'','MANUAL09'),(395,'','MANUAL10'),(395,'','MANUAL11'),(395,'','MANUAL12'),(395,'','MANUAL13'),(395,'','MANUAL14'),(395,'','MANUAL15'),(395,'','MANUAL16'),(395,'','MANUAL17'),(395,'','MANUAL18'),(395,'','MANUAL19'),(395,'','MANUAL20'),(396,'1. 물파래는 씻어 체에 걸러 물기를 제거하고 잘게 썬다.','MANUAL01'),(396,'2. 물에 5시간정도 불린 노란콩은 물 반컵을 넣고 약 10분가량 삶아 건져 믹서에 곱게 간다.','MANUAL02'),(396,'3. 파는 다지고 홍고추는 어슷썰기 한다.','MANUAL03'),(396,'4. 밀가루에 1,2와 물 20g을 넣어 반죽을 한다.','MANUAL04'),(396,'5. 팬에 현미유를 두르고 반죽을 떠서 지름 8cm 가량의 크기로 동그랗게 부치면서 윗면에 홍고추로 장식한다.','MANUAL05'),(396,'6. 간장, 파, 식초, 통깨를 넣고 초간장을 만들어 물파래콩전과 곁들인다.','MANUAL06'),(396,'','MANUAL07'),(396,'','MANUAL08'),(396,'','MANUAL09'),(396,'','MANUAL10'),(396,'','MANUAL11'),(396,'','MANUAL12'),(396,'','MANUAL13'),(396,'','MANUAL14'),(396,'','MANUAL15'),(396,'','MANUAL16'),(396,'','MANUAL17'),(396,'','MANUAL18'),(396,'','MANUAL19'),(396,'','MANUAL20'),(397,'1. 카스텔라는 반으로 잘라준 후 꿀을 발라준다.','MANUAL01'),(397,'2. 견과류는 먹기 좋게 잘라준다.','MANUAL02'),(397,'3. 자른 카스텔라 위에 꿀을 발라준다.','MANUAL03'),(397,'4. 바른 카스텔라 위에 자른 견과류를 뿌려준다.','MANUAL04'),(397,'5. 브로콜리를 뺀 해독주스 재료를 끓이다 마지막에\n브로콜리를 넣어 살짝 끓여준 뒤 믹서에 간다.','MANUAL05'),(397,'6. 접시에 담고 요거트를 뿌리고 체리와 애플민트를\n올려준다.','MANUAL06'),(397,'','MANUAL07'),(397,'','MANUAL08'),(397,'','MANUAL09'),(397,'','MANUAL10'),(397,'','MANUAL11'),(397,'','MANUAL12'),(397,'','MANUAL13'),(397,'','MANUAL14'),(397,'','MANUAL15'),(397,'','MANUAL16'),(397,'','MANUAL17'),(397,'','MANUAL18'),(397,'','MANUAL19'),(397,'','MANUAL20'),(398,'1. 토마토는 먹기 좋은 크기로 잘라준다.','MANUAL01'),(398,'2. 청고추, 홍고추, 양파는 채 썰고 부추는 먹기\n좋게 잘라준다.','MANUAL02'),(398,'3. 바나나, 배, 젓갈을 갈아 준 뒤 고춧가루와\n섞어준다.','MANUAL03'),(398,'4. 만들어진 국물에 나머지 재료를 넣고 최종\n김치 국물을 만들어준다.','MANUAL04'),(398,'5. 국물에 영양부추만 뺀 재료를 넣고 버무려준다.','MANUAL05'),(398,'6. 마지막에 영양부추를 넣어 김치를 완성한다.','MANUAL06'),(398,'','MANUAL07'),(398,'','MANUAL08'),(398,'','MANUAL09'),(398,'','MANUAL10'),(398,'','MANUAL11'),(398,'','MANUAL12'),(398,'','MANUAL13'),(398,'','MANUAL14'),(398,'','MANUAL15'),(398,'','MANUAL16'),(398,'','MANUAL17'),(398,'','MANUAL18'),(398,'','MANUAL19'),(398,'','MANUAL20'),(399,'1. 닭가슴살은 먹기 좋은 크기로 잘라서 우유에\n재워준 뒤 뜨거운 물에 데쳐준다.','MANUAL01'),(399,'2. 방울토마토는 반으로 자르고, 양파는 먹기 좋은\n크기로 잘라준다.','MANUAL02'),(399,'3. 감자, 당근, 브로콜리는 먹기 좋은 크기로\n잘라 뜨거운 물에 순서대로 데쳐준다.','MANUAL03'),(399,'4. 모든 재료를 올리브유에 볶아준다.','MANUAL04'),(399,'5. 토마토페이스트와 닭가슴살을 데쳐낸 물을\n섞어 끓여준다.','MANUAL05'),(399,'6. 끓고 있는 국물 50g에 밀가루를 섞어 농도를\n맞추어 준다.','MANUAL06'),(399,'','MANUAL07'),(399,'','MANUAL08'),(399,'','MANUAL09'),(399,'','MANUAL10'),(399,'','MANUAL11'),(399,'','MANUAL12'),(399,'','MANUAL13'),(399,'','MANUAL14'),(399,'','MANUAL15'),(399,'','MANUAL16'),(399,'','MANUAL17'),(399,'','MANUAL18'),(399,'','MANUAL19'),(399,'','MANUAL20'),(400,'1. 가지는 먹기 좋은 크기로 잘라서 간편 어간장에\n절여준다.','MANUAL01'),(400,'2. 다진 대파, 청홍고추, 양파는 송송 잘라준다.','MANUAL02'),(400,'3. 절여진 가지를 꼭 짜서 수분을 제거해준다.','MANUAL03'),(400,'4. 양념장에 가지와 준비된 채소를 버무려 준다.','MANUAL04'),(400,'5. 완성된 가지김치는 2시간 정도 후에 숙성시켜\n완성한다.','MANUAL05'),(400,'','MANUAL06'),(400,'','MANUAL07'),(400,'','MANUAL08'),(400,'','MANUAL09'),(400,'','MANUAL10'),(400,'','MANUAL11'),(400,'','MANUAL12'),(400,'','MANUAL13'),(400,'','MANUAL14'),(400,'','MANUAL15'),(400,'','MANUAL16'),(400,'','MANUAL17'),(400,'','MANUAL18'),(400,'','MANUAL19'),(400,'','MANUAL20'),(401,'1. 함초와 쪽파는 1cm 길이로 자른다. 청고추,\n홍고추, 무는 한입 크기로 잘라주고 마늘은\n편으로 썰어준다.','MANUAL01'),(401,'2. 물 1컵에 찹쌀가루를 풀어서 풀을 쑨다.','MANUAL02'),(401,'3. 물 2컵에 함초, 편마늘을 넣고 국물을 만든다.','MANUAL03'),(401,'4. 이 물로 무를 절여준다. 이때 무를 절였던 물을\n버리지 말고 찹쌀 풀과 섞어 국물을 만들어\n준다.','MANUAL04'),(401,'5. 만들어진 국물과 찹쌀 풀을 섞어 체에 내려\n준다.','MANUAL05'),(401,'6. 모든 재료를 한데 섞어서 저염 동치미를\n완성한다.','MANUAL06'),(401,'','MANUAL07'),(401,'','MANUAL08'),(401,'','MANUAL09'),(401,'','MANUAL10'),(401,'','MANUAL11'),(401,'','MANUAL12'),(401,'','MANUAL13'),(401,'','MANUAL14'),(401,'','MANUAL15'),(401,'','MANUAL16'),(401,'','MANUAL17'),(401,'','MANUAL18'),(401,'','MANUAL19'),(401,'','MANUAL20'),(402,'1. 장어는 생강청에 20분 정도 재워준다.','MANUAL01'),(402,'2. 생강, 양파는 아주 가늘게 채 썰어서 냉수에\n담가 매운맛을 빼준다.','MANUAL02'),(402,'3. 소스 재료로 소스를 만들어준다.','MANUAL03'),(402,'4. 채 썬 양파와 생강채를 냄비에 깔고 장어를\n수분 없이 쪄준다.','MANUAL04'),(402,'5. 쪄낸 장어는 접시에 올리고 양파, 생강채를\n올려 소스와 함께 완성한다.','MANUAL05'),(402,'','MANUAL06'),(402,'','MANUAL07'),(402,'','MANUAL08'),(402,'','MANUAL09'),(402,'','MANUAL10'),(402,'','MANUAL11'),(402,'','MANUAL12'),(402,'','MANUAL13'),(402,'','MANUAL14'),(402,'','MANUAL15'),(402,'','MANUAL16'),(402,'','MANUAL17'),(402,'','MANUAL18'),(402,'','MANUAL19'),(402,'','MANUAL20'),(403,'1. 쌀은 세척 후 울금물에 불려준다.','MANUAL01'),(403,'2. 두부를 으깨서 수분을 빼준다.','MANUAL02'),(403,'3. 쌈장을 맛장으로 만들어준다.','MANUAL03'),(403,'4. 건조 미역줄기는 세척해 불린다. 이때 불리고\n나온 물을 이용해 밥을 한다.','MANUAL04'),(403,'5. 올리브오일로 쌀을 볶아주다 미역줄기를\n넣고 밥을 한다.','MANUAL05'),(403,'6. 두부 맛장과 함께 곁들여 완성한다.','MANUAL06'),(403,'','MANUAL07'),(403,'','MANUAL08'),(403,'','MANUAL09'),(403,'','MANUAL10'),(403,'','MANUAL11'),(403,'','MANUAL12'),(403,'','MANUAL13'),(403,'','MANUAL14'),(403,'','MANUAL15'),(403,'','MANUAL16'),(403,'','MANUAL17'),(403,'','MANUAL18'),(403,'','MANUAL19'),(403,'','MANUAL20'),(404,'1. 두부는 물기를 꼭 짜준 후 으깬다.','MANUAL01'),(404,'2. 미역줄기는 불린 후 먹기 좋게 자른다.','MANUAL02'),(404,'3. 양념장을 만들어준다.','MANUAL03'),(404,'4. 준비된 견과류를 송송 다져준다.','MANUAL04'),(404,'5. 불린 미역줄기에 소스를 섞어 재워준다.','MANUAL05'),(404,'6. 불린 미역줄기에 두부를 넣어 섞어준다.','MANUAL06'),(404,'','MANUAL07'),(404,'','MANUAL08'),(404,'','MANUAL09'),(404,'','MANUAL10'),(404,'','MANUAL11'),(404,'','MANUAL12'),(404,'','MANUAL13'),(404,'','MANUAL14'),(404,'','MANUAL15'),(404,'','MANUAL16'),(404,'','MANUAL17'),(404,'','MANUAL18'),(404,'','MANUAL19'),(404,'','MANUAL20'),(405,'1. 국물 재료로 국을 끓여준 뒤 체에 걸러주고\n양지는 찢어준다.','MANUAL01'),(405,'2. 무와 양파는 굵은 채로 썬다.','MANUAL02'),(405,'3. 대파의 흰 부분은 어슷하게 썰고 파란 부분은\n굵게 썰어준다.','MANUAL03'),(405,'4. 고사리는 뜨거운 물에 데친 후 먹기 좋은\n크기로 잘라서 고사리 양념장에 양념한다.','MANUAL04'),(405,'5. 청양고추를 썰어서 볶은 후 국물을 미리\n끓여 놓은 국물에 붓는다.','MANUAL05'),(405,'6. 만들어진 국물에 모든 재료를 넣고 한 번\n끓여 완성한다.','MANUAL06'),(405,'','MANUAL07'),(405,'','MANUAL08'),(405,'','MANUAL09'),(405,'','MANUAL10'),(405,'','MANUAL11'),(405,'','MANUAL12'),(405,'','MANUAL13'),(405,'','MANUAL14'),(405,'','MANUAL15'),(405,'','MANUAL16'),(405,'','MANUAL17'),(405,'','MANUAL18'),(405,'','MANUAL19'),(405,'','MANUAL20'),(406,'1. 더덕은 손질해 어슷하게 잘라 소금물에 살짝\n담가준다.','MANUAL01'),(406,'2. 사과는 먹기 좋게 썰어서 레몬즙에 살짝\n뿌려준다.','MANUAL02'),(406,'3. 주꾸미는 레몬즙을 넣어 살짝 데쳐준다.','MANUAL03'),(406,'4. 청고추, 홍고추는 씨를 제거하고 사과처럼\n잘라주고. 양파도 잘라준다.','MANUAL04'),(406,'5. 소스를 만들어준다.','MANUAL05'),(406,'6. 모든 채소와 주꾸미를 섞어 소스랑 한데\n버무려 완성한다.','MANUAL06'),(406,'','MANUAL07'),(406,'','MANUAL08'),(406,'','MANUAL09'),(406,'','MANUAL10'),(406,'','MANUAL11'),(406,'','MANUAL12'),(406,'','MANUAL13'),(406,'','MANUAL14'),(406,'','MANUAL15'),(406,'','MANUAL16'),(406,'','MANUAL17'),(406,'','MANUAL18'),(406,'','MANUAL19'),(406,'','MANUAL20'),(407,'1. 전복은 손질해 잘라주고 전복내장과 소주를\n넣어서 믹서에 간다.','MANUAL01'),(407,'2. 참기름과 마늘기름을 섞어서 불린 쌀을 볶는다.','MANUAL02'),(407,'3. 연근, 당근, 단호박은 작은 깍두기 모양으로\n잘라 각각 볶아준다.','MANUAL03'),(407,'4. 전복은 작은 깍두기 모양으로 잘라서 칵테일새우,\n바지락살, 다진마늘, 청주를 넣어 살짝 볶아준다.','MANUAL04'),(407,'5. 냄비에 갈아준 전복내장을 만들어준 기름에\n볶아주다 쌀을 넣고 볶고, 나머지 채소를\n넣어 볶는다.','MANUAL05'),(407,'6. 마지막으로 새우, 바지락을 넣고 볶아 완성한다.','MANUAL06'),(407,'','MANUAL07'),(407,'','MANUAL08'),(407,'','MANUAL09'),(407,'','MANUAL10'),(407,'','MANUAL11'),(407,'','MANUAL12'),(407,'','MANUAL13'),(407,'','MANUAL14'),(407,'','MANUAL15'),(407,'','MANUAL16'),(407,'','MANUAL17'),(407,'','MANUAL18'),(407,'','MANUAL19'),(407,'','MANUAL20'),(408,'1. 감자는 껍질을 벗겨서 1개를 채 썰고 물에\n담가둔다.','MANUAL01'),(408,'2. 감자 1개는 강판에 갈아서 즙과 건지를 따로\n분리해준다.','MANUAL02'),(408,'3. 양파를 곱게 채 썰어주고 볼에 강판에 간 건지와\n채 썬 감자, 채 썬 양파를 섞어 반죽을 만들어\n준다.','MANUAL03'),(408,'4. 소스를 만들어준다.','MANUAL04'),(408,'5. 팬에 한입 크기로 전을 부쳐준다.','MANUAL05'),(408,'6. 루콜라를 물에 살짝 헹궈주고 전과 함께\n접시에 셋팅한다.','MANUAL06'),(408,'','MANUAL07'),(408,'','MANUAL08'),(408,'','MANUAL09'),(408,'','MANUAL10'),(408,'','MANUAL11'),(408,'','MANUAL12'),(408,'','MANUAL13'),(408,'','MANUAL14'),(408,'','MANUAL15'),(408,'','MANUAL16'),(408,'','MANUAL17'),(408,'','MANUAL18'),(408,'','MANUAL19'),(408,'','MANUAL20'),(409,'1. 두부는 먹기 좋은 크기로 잘라서 팬에 바삭\n하게 구워준다.','MANUAL01'),(409,'2. 구워진 두부는 기름을 빼고 채 썰어준다.','MANUAL02'),(409,'3. 방울토마토는 작은 사각형으로 잘라주고,\n치커리는 먹기좋게 잘라준다.','MANUAL03'),(409,'4. 표고버섯와 홍고추, 노란파프리카는 가늘게\n채 썰어 볶아준다.','MANUAL04'),(409,'5. 소스를 만들어준다. 잘라준 토마토는 먹기\n직전에 소스와 섞어준다.','MANUAL05'),(409,'6. 접시에 치커리를 깔고 볶아진 두부와 채소를\n올려 완성한다.','MANUAL06'),(409,'','MANUAL07'),(409,'','MANUAL08'),(409,'','MANUAL09'),(409,'','MANUAL10'),(409,'','MANUAL11'),(409,'','MANUAL12'),(409,'','MANUAL13'),(409,'','MANUAL14'),(409,'','MANUAL15'),(409,'','MANUAL16'),(409,'','MANUAL17'),(409,'','MANUAL18'),(409,'','MANUAL19'),(409,'','MANUAL20'),(410,'1. 물과 식초가 포함된 물에 담가서 쓴맛을\n빼준다.','MANUAL01'),(410,'2. 물에 절여진 더덕은 키친타월을 이용해 물기를\n완전히 빼준다.','MANUAL02'),(410,'3. 양파, 청고추, 홍고추도 어슷하게 썰어준다.','MANUAL03'),(410,'4. 비트를 편으로 썰어서 국물을 만들어준다.','MANUAL04'),(410,'5. 그릇에 더덕부터 30분 정도 담가 물을 살짝\n들여준다.','MANUAL05'),(410,'6. 나머지 재료도 함께 담가 간을 배게 한 뒤 24\n시간 후부터 먹을 수가 있다.','MANUAL06'),(410,'','MANUAL07'),(410,'','MANUAL08'),(410,'','MANUAL09'),(410,'','MANUAL10'),(410,'','MANUAL11'),(410,'','MANUAL12'),(410,'','MANUAL13'),(410,'','MANUAL14'),(410,'','MANUAL15'),(410,'','MANUAL16'),(410,'','MANUAL17'),(410,'','MANUAL18'),(410,'','MANUAL19'),(410,'','MANUAL20'),(411,'1. 연어에 로즈마리를 위에 올려\n마리네이드를 한다.','MANUAL01'),(411,'2. 마리네이드를 해놓은 연어에 레몬즙을\n뿌린다.','MANUAL02'),(411,'3. 당근, 양파는 썰고 마늘과 토마토는\n다져 준비한다.','MANUAL03'),(411,'4. 냄비에 버터를 두르고, 채소(③)를\n볶다가 밀가루를 넣고 볶으면서 다시\n토마토소스를 넣어 볶다가 육수와\n월계수잎을 넣어 끓인다.','MANUAL04'),(411,'5. 소스가 자작 하게 끓고 있을 때, 우유를\n넣고 한 소끔 끓여준다.','MANUAL05'),(411,'6. 팬에 올리브 오일을 두르고, 연어\n(①)를 올려 앞뒤로 구어 접시에\n담고, 토마토소스를 올려 완성한다.','MANUAL06'),(411,'','MANUAL07'),(411,'','MANUAL08'),(411,'','MANUAL09'),(411,'','MANUAL10'),(411,'','MANUAL11'),(411,'','MANUAL12'),(411,'','MANUAL13'),(411,'','MANUAL14'),(411,'','MANUAL15'),(411,'','MANUAL16'),(411,'','MANUAL17'),(411,'','MANUAL18'),(411,'','MANUAL19'),(411,'','MANUAL20'),(412,'1. 밀가루에 소금과 녹말가루를 넣고\n반죽을 한다.','MANUAL01'),(412,'2. 냄비에 건새우와 머리와 내장을 제거한\n멸치, 다시마, 무, 마늘, 양파를 넣고\n약30분 정도 끓여 체에 걸러 육수를\n만들어 놓는다.','MANUAL02'),(412,'3. 호박은 반달모양으로 썰고, 느타리는\n손으로 찢고, 양파와 대파는 길게 썰어\n준비한다.','MANUAL03'),(412,'4. 새우는 요지를 이용하여 새우등의\n내장을 제거하고, 홍합은 족사를 때어\n내고 솔을 이용하여 껍질을 깨끗이\n씻어낸 후 흐르는 물에 깨끗하게\n행구고, 미더덕은 깨끗이 씻어 놓는다.','MANUAL04'),(412,'5. 반죽을 해 놓은 밀가루에 덧 밀가루를\n뿌려가며 얇게 밀어준다.','MANUAL05'),(412,'6. 얇게 밀어 놓은 밀가루를 칼로 썰어\n덧밀가루를 털어내고, 만들어 놓은\n육수에 칼국수를 넣고, 준비한 채소\n(③)와 해물(④)을 넣고 간장으로 간을\n맞추어 완성한다.','MANUAL06'),(412,'','MANUAL07'),(412,'','MANUAL08'),(412,'','MANUAL09'),(412,'','MANUAL10'),(412,'','MANUAL11'),(412,'','MANUAL12'),(412,'','MANUAL13'),(412,'','MANUAL14'),(412,'','MANUAL15'),(412,'','MANUAL16'),(412,'','MANUAL17'),(412,'','MANUAL18'),(412,'','MANUAL19'),(412,'','MANUAL20'),(413,'1. 양파와 양송이, 표고버섯, 느타리버섯은\n작게 썰어 준비해 놓는다.','MANUAL01'),(413,'2. 멸치와 새우, 마늘을 냄비에 담고,\n물을 약 500㎖ 정도 붓고 끓여 육수를\n만든다.','MANUAL02'),(413,'3. 냄비에 버터를 넣고, 양파와 버섯을\n넣어 볶는다.','MANUAL03'),(413,'4. ③번의 냄비에 불린 쌀을 넣고 은근히\n볶는다.','MANUAL04'),(413,'5. 볶아지는 냄비에 만들어 놓은 육수를\n조금 넣는다.','MANUAL05'),(413,'6. 육수를 넣고 다시 은근히 볶으면서\n뚜껑을 덮어 충분히 익힌 후, 마지막에\n생크림과 소금을 넣고 완성한다.','MANUAL06'),(413,'','MANUAL07'),(413,'','MANUAL08'),(413,'','MANUAL09'),(413,'','MANUAL10'),(413,'','MANUAL11'),(413,'','MANUAL12'),(413,'','MANUAL13'),(413,'','MANUAL14'),(413,'','MANUAL15'),(413,'','MANUAL16'),(413,'','MANUAL17'),(413,'','MANUAL18'),(413,'','MANUAL19'),(413,'','MANUAL20'),(414,'1. 시금치는 끓는 물에 소금을 넣고 데쳐\n찬물에 식힌 후 곱게 갈아 준비한다.','MANUAL01'),(414,'2. 당근즙, 시금치즙, 들깨가루를 각각\n준비한 뒤, 밀가루와 녹말가루를\n세 개로 나눠 각각의 즙을 넣어 반죽 후\n숙성시킨다.','MANUAL02'),(414,'3. 호박은 채를 썰어 소금에 살짝 절여\n물기를 제거하고, 부추는 송송 썰고,\n숙주는 데쳐 물기를 제거하고 다지고,\n두부는 면포에 물기를 꼭 짜서 준비한다.','MANUAL03'),(414,'4. 달걀은 노란자와 흰자를 나눠 각각\n지단을 붙여 준비한다. 냄비에 멸치와\n다시마, 건새우, 양파를 넣고 약30분\n정도 끓여 체에 걸러 육수를 만들어\n놓는다.','MANUAL04'),(414,'5. 소고기는 곱게 다져, 파 , 마늘, 참기름,\n후춧가루를 넣어 양념을 해 놓는다.','MANUAL05'),(414,'6. 준비한 채소(③)와 고기(⑤)를 섞어\n만두속을 만들고, 숙성된 밀가루\n반죽(②)을 밀어 만든 만두피에 만두\n속을 넣어 만두를 만든다. 준비한 육수\n(④)에 삼색 만두를 넣어 끓여 담고 그\n위에 달걀지단을 올려 완성한다.','MANUAL06'),(414,'','MANUAL07'),(414,'','MANUAL08'),(414,'','MANUAL09'),(414,'','MANUAL10'),(414,'','MANUAL11'),(414,'','MANUAL12'),(414,'','MANUAL13'),(414,'','MANUAL14'),(414,'','MANUAL15'),(414,'','MANUAL16'),(414,'','MANUAL17'),(414,'','MANUAL18'),(414,'','MANUAL19'),(414,'','MANUAL20'),(415,'1. 청포묵은 4cm 길이로 썰어 참기름과\n소금에 살짝 무쳐 준비한다.','MANUAL01'),(415,'2. 달걀은 황백으로 나누어 각각 소금을\n조금씩 넣어 섞어 지단을 부친다.','MANUAL02'),(415,'3. 오이는 돌려 깎아 채 썰고 당근도 오이\n길이로 채 썰고 고사리는 길에 맞게\n다듬고, 표고버섯도 채를 썰어 준비한다.','MANUAL03'),(415,'4. 소고기는 채를 썰어 파, 마늘, 참기름,\n후춧가루를 넣어 양념한다.','MANUAL04'),(415,'5. 팬에 기름을 두르고, 준비한 곁들임\n채소(③)와 다진 소고기를 재료별로\n따로 볶아 준비한다.','MANUAL05'),(415,'6. 고추장에 콩가루를 섞고, 볶아진 소고기를\n넣어 다시 볶아 고추장 소스를 준비하고,\n쌀밥을 그릇에 담은 후 청포묵(①), 볶아\n놓은 채소와 소고기(⑤)를 올리고,\n마지막에 고추장소스를 올려 완성한다.','MANUAL06'),(415,'','MANUAL07'),(415,'','MANUAL08'),(415,'','MANUAL09'),(415,'','MANUAL10'),(415,'','MANUAL11'),(415,'','MANUAL12'),(415,'','MANUAL13'),(415,'','MANUAL14'),(415,'','MANUAL15'),(415,'','MANUAL16'),(415,'','MANUAL17'),(415,'','MANUAL18'),(415,'','MANUAL19'),(415,'','MANUAL20'),(416,'1. 닭가슴살을 넓게 펴서 소금과\n후춧가루, 정종으로 밑간을 한다.','MANUAL01'),(416,'2. 대추는 돌려깎아 채를 썰고, 인삼은\n세로 방향으로 반으로 가르고, 밤은\n껍질을 벗겨 납작하게 썰고, 표고와\n새송이 버섯은 뜨거운 물에 담그어\n불린 후 채를 썰어 준비한다.','MANUAL02'),(416,'3. 숙성된 닭가슴살(①)에 썰어놓은\n재료(②)를 얹어 놓는다.','MANUAL03'),(416,'4. 닭 가슴살을 돌돌 말아 놓는다.','MANUAL04'),(416,'5. 냄비에 육수를 붓고, 육수가 끓으면\n말아 놓은 닭가슴살을 넣는다.','MANUAL05'),(416,'6. 뚜껑을 덮고, 약 15분 정도 은근히\n찐 뒤, 닭가슴살이 익으면 불을 끄고\n먹기 좋은 크기로 썰어서 접시에 담는다.','MANUAL06'),(416,'','MANUAL07'),(416,'','MANUAL08'),(416,'','MANUAL09'),(416,'','MANUAL10'),(416,'','MANUAL11'),(416,'','MANUAL12'),(416,'','MANUAL13'),(416,'','MANUAL14'),(416,'','MANUAL15'),(416,'','MANUAL16'),(416,'','MANUAL17'),(416,'','MANUAL18'),(416,'','MANUAL19'),(416,'','MANUAL20'),(417,'1. 양배추는 깨끗이 씻어 찜기에 김이\n오르면 쪄서 식혀 준비한다.','MANUAL01'),(417,'2. 느타리, 표고 ,팽이버섯, 당근, 오이는\n약 5cm 길이로 채를 썰어 준비한다.','MANUAL02'),(417,'3. 소고기도 가늘게 채를 썰어 준비하고,\n파, 마늘, 참기름, 설탕을 넣어 양념을\n한다.','MANUAL03'),(417,'4. 팬에 준비한 채소에 소량의 소금을\n넣어 먼저 볶다가 양념한 소고기를\n넣고 재빠르게 볶아 식혀 준비한다.','MANUAL04'),(417,'5. 쪄 놓은 양배추를 김발 위에 올려 넣고,\n볶아놓은 채소와 소고기를 넣는다.','MANUAL05'),(417,'6. 김발을 이용하여 양배추를 돌돌 말고,\n미나리를 데쳐 끈으로 묶어 접시에\n올리고, 간장과 맛술, 참기름을 섞은\n간장소스를 만들어 담는다.','MANUAL06'),(417,'','MANUAL07'),(417,'','MANUAL08'),(417,'','MANUAL09'),(417,'','MANUAL10'),(417,'','MANUAL11'),(417,'','MANUAL12'),(417,'','MANUAL13'),(417,'','MANUAL14'),(417,'','MANUAL15'),(417,'','MANUAL16'),(417,'','MANUAL17'),(417,'','MANUAL18'),(417,'','MANUAL19'),(417,'','MANUAL20'),(418,'1. 단호박은 칼로 잘라, 수저를 이용하여\n호박씨를 제거한다.','MANUAL01'),(418,'2. 손질이 된 단호박은 면보를 깔고,\n김이 오른 찜통에서 약 15분 정도\n쪄 준비한다.','MANUAL02'),(418,'3. 다진 소고기는 파, 마늘, 양파, 참기름,\n간장, 후춧가루, 매실액을 넣고 양념을\n한다.','MANUAL03'),(418,'4. 3번에 양념된 소고기에 찹쌀가루를\n넣고 골고루 섞는다.','MANUAL04'),(418,'5. 쪄 놓은 호박에 양념된 소고기를 넣고\n모양을 잡아 준다.','MANUAL05'),(418,'6. 육수가 한 소큼 끓으면 만들어 놓은\n단호박떡갈비(⑤)를 넣어 약 20분 정도\n은근히 쪄서 잣을 올려 완성한다.','MANUAL06'),(418,'','MANUAL07'),(418,'','MANUAL08'),(418,'','MANUAL09'),(418,'','MANUAL10'),(418,'','MANUAL11'),(418,'','MANUAL12'),(418,'','MANUAL13'),(418,'','MANUAL14'),(418,'','MANUAL15'),(418,'','MANUAL16'),(418,'','MANUAL17'),(418,'','MANUAL18'),(418,'','MANUAL19'),(418,'','MANUAL20'),(419,'1. 냄비에 무와 양지육, 마늘을 넣고\n은근히 끓여 육수를 만들어 놓는다.','MANUAL01'),(419,'2. 배추와 미나리는 면보를 깔고 찜통에서\n약 10분 정도 쪄서 식혀놓는다.','MANUAL02'),(419,'3. 두부는 면보에 넣어 손으로 물기를\n짜 놓는다.','MANUAL03'),(419,'4. 부추는 송송 썰고, 표고, 느타리버섯은\n잘게 다지고, 소고기도 다져 놓고, 저염\n간장과 파, 마늘, 참기름, 후춧가루,\n통깨를 넣고 잘 섞어서 만두속을 만들\n어 놓는다.','MANUAL04'),(419,'5. 쪄놓은 배추를 한 장 펴놓고, 그 위에\n만들어 놓은 만두속을 넣어 양 쪽을\n접어 말아준다.','MANUAL05'),(419,'6. 말아놓은 배추만두를 쪄 놓은 미나리\n끈으로 묶은 후, 만들어 놓은 육수가\n끓으면 배추만두를 넣고 간장으로\n간을 한 뒤 한 번 더 끓여서 완성한다.','MANUAL06'),(419,'','MANUAL07'),(419,'','MANUAL08'),(419,'','MANUAL09'),(419,'','MANUAL10'),(419,'','MANUAL11'),(419,'','MANUAL12'),(419,'','MANUAL13'),(419,'','MANUAL14'),(419,'','MANUAL15'),(419,'','MANUAL16'),(419,'','MANUAL17'),(419,'','MANUAL18'),(419,'','MANUAL19'),(419,'','MANUAL20'),(420,'1. 홍합은 끓는 물에 살짝 데쳐 준비하고,\n조개는 소금물에 담그어 해감을 해\n놓는다.','MANUAL01'),(420,'2. 표고는 기둥을 제거하고 편으로 썰고,\n양파는 채를 썰고, 홍파프리카와\n피망은 씨를 제거한 뒤 5~6cm 길이로\n채를 썰어 놓는다.','MANUAL02'),(420,'3. 새우는 요지를 이용하여 등에 있는\n내장을 제거해 놓고 오징어는 피망과\n비슷한 크기로 채를 썰어 놓는다.','MANUAL03'),(420,'4. 스파게티면은 끓은 물에 소금을 넣고\n약 10분 정도 삶아 건져 올리브오일을\n살짝 발라 준비한다.','MANUAL04'),(420,'5. 팬에 올리브 오일을 두르고, 편 마늘을\n넣어 먼저 볶아 향을 만든다.','MANUAL05'),(420,'6. 마늘의 향이 나오면, 스파게티면을\n넣어 볶다가 카레가루를 넣고, 다시\n볶으면서 준비한 해물과 채소를 넣어\n볶아 완성한다.','MANUAL06'),(420,'','MANUAL07'),(420,'','MANUAL08'),(420,'','MANUAL09'),(420,'','MANUAL10'),(420,'','MANUAL11'),(420,'','MANUAL12'),(420,'','MANUAL13'),(420,'','MANUAL14'),(420,'','MANUAL15'),(420,'','MANUAL16'),(420,'','MANUAL17'),(420,'','MANUAL18'),(420,'','MANUAL19'),(420,'','MANUAL20'),(421,'1. 닭가슴살에 로즈마리, 후춧가루를\n넣고, 15분 정도 우유에 담그어 놓는다.','MANUAL01'),(421,'2. 당근과 감자는 사각으로 깎아 양 모서리를\n칼로 다시 다듬어 주사위 모양으로\n둥그스럼하게 만들어 준비한다.','MANUAL02'),(421,'3. 냄비에 물이 끓으면, 브로컬리와 깎아\n놓은 당근과 감자를 데쳐 준비한다.','MANUAL03'),(421,'4. 양송이는 껍질을 제거하고 모양 그대로\n편으로 썰어 준비하고, 토마토와 마늘은\n잘게 다져 냄비에 버터를 두르고 볶다가\n케첩을 넣어준다.','MANUAL04'),(421,'5. 볶아지는 4번에 썰어 놓은 양송이와\n생크림을 넣고, 다시 살짝 한 번 더\n볶아준다.','MANUAL05'),(421,'6. 팬에 버터를 녹이고, 재워놓은 닭가슴살\n(①)을 속이 익도록 노릇노릇 하게 익혀\n접시에 담고, 만들어 놓은 감자와 당근,\n브로컬리로 장식을 하고, 소스를 함께\n올려 완성한다.','MANUAL06'),(421,'','MANUAL07'),(421,'','MANUAL08'),(421,'','MANUAL09'),(421,'','MANUAL10'),(421,'','MANUAL11'),(421,'','MANUAL12'),(421,'','MANUAL13'),(421,'','MANUAL14'),(421,'','MANUAL15'),(421,'','MANUAL16'),(421,'','MANUAL17'),(421,'','MANUAL18'),(421,'','MANUAL19'),(421,'','MANUAL20'),(422,'1. 준비한 새우의 반은 껍질을 벗겨\n내장을 제거하고 곱게 다진다.','MANUAL01'),(422,'2. 나머지 새우는 내장을 제거하고 껍질을\n벗겨, 2/3 정도 반으로 갈라 소금, 후추로\n밑간을 해 놓는다.','MANUAL02'),(422,'3. 다진 새우는 소고기와 섞어, 마늘을\n넣고 양념이 충분히 스며들도록 준비해\n놓는다.','MANUAL03'),(422,'4. 브로컬리는 데쳐 식힌 후 다지고, 당근과\n양파도 다져 소금에 살짝 절여 물기를\n제거해 놓는다.','MANUAL04'),(422,'5. 양념된 재료(③)에 준비해 놓은 채소\n(④)를 넣고, 녹말가루와 달걀을 풀어\n골고루 섞는다.','MANUAL05'),(422,'6. 반으로 갈라 준비한 새우에 녹말가루를\n살짝 뿌리고, 섞어놓은 재료(⑤)를\n완자를 빚어 새우에 올려 주고, 찜기에서\n약 10분 정도 쪄서 완성한다.','MANUAL06'),(422,'','MANUAL07'),(422,'','MANUAL08'),(422,'','MANUAL09'),(422,'','MANUAL10'),(422,'','MANUAL11'),(422,'','MANUAL12'),(422,'','MANUAL13'),(422,'','MANUAL14'),(422,'','MANUAL15'),(422,'','MANUAL16'),(422,'','MANUAL17'),(422,'','MANUAL18'),(422,'','MANUAL19'),(422,'','MANUAL20'),(423,'1. 쌈채는 먹기 좋게 손으로 뜯어 놓는다.','MANUAL01'),(423,'2. 뜯어 놓은 쌈채를 물에 담그어 싱싱하게\n준비해 놓는다.','MANUAL02'),(423,'3. 두부는 면보에 넣어 손으로 짜서 물기를\n제거하고 준비한다.','MANUAL03'),(423,'4. 된장에 생크림을 넣어 골고루 섞어\n짠 맛을 줄여준다.','MANUAL04'),(423,'5. 으깬 두부에 된장을 넣어 섞어준다.','MANUAL05'),(423,'6. 물에 담그어 놓은 채소를 체에 건져,\n물기를 털어내고, 만들어 놓은 된장\n소스에 넣어 무친다.','MANUAL06'),(423,'','MANUAL07'),(423,'','MANUAL08'),(423,'','MANUAL09'),(423,'','MANUAL10'),(423,'','MANUAL11'),(423,'','MANUAL12'),(423,'','MANUAL13'),(423,'','MANUAL14'),(423,'','MANUAL15'),(423,'','MANUAL16'),(423,'','MANUAL17'),(423,'','MANUAL18'),(423,'','MANUAL19'),(423,'','MANUAL20'),(424,'1. 귀리는 깨끗이 씻어 물에 불린다.','MANUAL01'),(424,'2. 쌀도 씻어 따로 불려 놓는다.','MANUAL02'),(424,'3. 양파와 부추는 송송 썰어 준비한다.','MANUAL03'),(424,'4. 냄비에 참기름을 넣고, 소고기를 먼저\n볶는다.','MANUAL04'),(424,'5. 볶아지는 냄비에 다시 불린 귀리와\n쌀을 넣어 볶아준다.','MANUAL05'),(424,'6. 충분히 귀리가 볶아지면 물을 넣고\n끓이다가, 썰어 놓은 채소를 넣고, 죽이\n어우러지게 끓인 뒤 달걀을 풀어 넣고\n다시 저어가면 끓여주고, 죽 위에\n흑임자를 올려 완성한다.','MANUAL06'),(424,'','MANUAL07'),(424,'','MANUAL08'),(424,'','MANUAL09'),(424,'','MANUAL10'),(424,'','MANUAL11'),(424,'','MANUAL12'),(424,'','MANUAL13'),(424,'','MANUAL14'),(424,'','MANUAL15'),(424,'','MANUAL16'),(424,'','MANUAL17'),(424,'','MANUAL18'),(424,'','MANUAL19'),(424,'','MANUAL20'),(425,'1. 청포묵을 약 6~7cm 길이로 썰어\n맛소금과 참기름에 살짝 버무려 놓는다.','MANUAL01'),(425,'2. 소고기는 채를 썰어 간장과 설탕,\n참기름에 볶아놓고 미나리는 데쳐\n찬물에 식혀 5~6cm 길이로 썰고,\n숙주는 머리와 꼬리를 떼어 내고,\n뜨거운 물에 데쳐 식혀 준비한다.','MANUAL02'),(425,'3. 홍파프리카는 씨를 제거하고 약 6cm\n길이로 썰어 놓는다.','MANUAL03'),(425,'4. 달걀은 황백으로 나눠 각각 지단을\n부쳐 채를 썰어 놓는다.','MANUAL04'),(425,'5. 김은 살짝 구어 봉투에 넣고 부수어\n김가루를 만들어 놓는다.','MANUAL05'),(425,'6. 저염간장에 설탕과 식초를 넣어 골고루\n섞어 탕평채 양념장을 만들고, 접시에\n준비한 청포묵을 담고, 그 위에 채소와\n고기를 올리고, 맨 위에 달걀지단과\n김가루를 올린 후 양념장을 끼얹어 완성\n한다.','MANUAL06'),(425,'','MANUAL07'),(425,'','MANUAL08'),(425,'','MANUAL09'),(425,'','MANUAL10'),(425,'','MANUAL11'),(425,'','MANUAL12'),(425,'','MANUAL13'),(425,'','MANUAL14'),(425,'','MANUAL15'),(425,'','MANUAL16'),(425,'','MANUAL17'),(425,'','MANUAL18'),(425,'','MANUAL19'),(425,'','MANUAL20'),(426,'1. 새우는 껍질을 제거하고 포를 뜬 뒤 삶아 익힌다.','MANUAL01'),(426,'2. 전복은 수저로 떼어내 소금으로 씻고\n달군 팬에 굽는다.','MANUAL02'),(426,'3. 연어는 포를 뜬다.','MANUAL03'),(426,'4. 겨자가루에 30℃ 정도의 물을 넣고\n골고루 섞어 발효시키고, 설탕, 식초를\n넣고 겨자소스를 만든다.','MANUAL04'),(426,'5. 고추장에 요구르트를 넣고\n고추장소스를 만든다','MANUAL05'),(426,'6. 접시에 익힌 새우, 전복, 연어를 담은 뒤\n겨자소스와 고추장소스를 올리고\n어린잎으로 장식한다.','MANUAL06'),(426,'','MANUAL07'),(426,'','MANUAL08'),(426,'','MANUAL09'),(426,'','MANUAL10'),(426,'','MANUAL11'),(426,'','MANUAL12'),(426,'','MANUAL13'),(426,'','MANUAL14'),(426,'','MANUAL15'),(426,'','MANUAL16'),(426,'','MANUAL17'),(426,'','MANUAL18'),(426,'','MANUAL19'),(426,'','MANUAL20'),(427,'1. 토마토는 윗부분을 자르고 속을\n파낸다.','MANUAL01'),(427,'2. 오이는 소금에 깨끗이 씻는다.','MANUAL02'),(427,'3. 소금을 팬에 볶은 후 배추를 절인다.','MANUAL03'),(427,'4. 절인 배추에 오이와 무를 넣고\n돌돌만다.','MANUAL04'),(427,'5. ?를 속을 파낸 토마토 안에 넣는다.','MANUAL05'),(427,'6. ?번을 통에 담아 소금 국물을 붓고\n양파와 마늘 생강을 넣는다.','MANUAL06'),(427,'','MANUAL07'),(427,'','MANUAL08'),(427,'','MANUAL09'),(427,'','MANUAL10'),(427,'','MANUAL11'),(427,'','MANUAL12'),(427,'','MANUAL13'),(427,'','MANUAL14'),(427,'','MANUAL15'),(427,'','MANUAL16'),(427,'','MANUAL17'),(427,'','MANUAL18'),(427,'','MANUAL19'),(427,'','MANUAL20'),(428,'1. 닭고기는 잘게 썰어 후춧가루로 밑간을\n한다.','MANUAL01'),(428,'2. 밑간한 닭고기를 달걀과 섞은 뒤\n전분을 넣고 골고루 묻힌다.','MANUAL02'),(428,'3. 감자는 껍질을 벗기고 곱게 채 썰어\n찬물에 담궈 전분을 뺀다.','MANUAL03'),(428,'4. 감자를 건져 물기를 빼고, 전분을 묻혀\n둥지모양을 만들어 튀긴다.','MANUAL04'),(428,'5. 레몬과 설탕을 넣고 끓인다.','MANUAL05'),(428,'6. 감자를 둥지모양으로 튀기고 그 위에\n튀긴 닭고기를 올리고 어린잎으로\n장식한 뒤 레몬소스를 올린다.','MANUAL06'),(428,'','MANUAL07'),(428,'','MANUAL08'),(428,'','MANUAL09'),(428,'','MANUAL10'),(428,'','MANUAL11'),(428,'','MANUAL12'),(428,'','MANUAL13'),(428,'','MANUAL14'),(428,'','MANUAL15'),(428,'','MANUAL16'),(428,'','MANUAL17'),(428,'','MANUAL18'),(428,'','MANUAL19'),(428,'','MANUAL20'),(429,'1. 찹쌀은 깨끗이 씻어 물에 약 30분 간\n충분히 불린다.','MANUAL01'),(429,'2. 부추, 홍고추, 양파 및 당근을 잘게\n다진다.','MANUAL02'),(429,'3. 마늘은 곱게 다진다.','MANUAL03'),(429,'4. 냄비에 기름을 두르고 마늘을 볶다가\n불린 찹쌀을 넣고 볶는다.','MANUAL04'),(429,'5. 어느 정도 볶아지면 사골육수와\n들깨가루를 넣고 은근히 끓인다.','MANUAL05'),(429,'6. 찹쌀이 어느 정도 익으면 홍고추와\n부추를 넣고 살짝 끓인다','MANUAL06'),(429,'','MANUAL07'),(429,'','MANUAL08'),(429,'','MANUAL09'),(429,'','MANUAL10'),(429,'','MANUAL11'),(429,'','MANUAL12'),(429,'','MANUAL13'),(429,'','MANUAL14'),(429,'','MANUAL15'),(429,'','MANUAL16'),(429,'','MANUAL17'),(429,'','MANUAL18'),(429,'','MANUAL19'),(429,'','MANUAL20'),(430,'1. 콩가루에 꿀을 넣고 반죽한다.','MANUAL01'),(430,'2. 섞어 놓은 콩가루 반죽은 고운 천으로\n감싸 숙성을 시킨다.','MANUAL02'),(430,'3. 레몬은 즙을 짠다.','MANUAL03'),(430,'4. 생크림에 설탕과 레몬즙을 넣고 휘핑해\n레몬크림을 만든다','MANUAL04'),(430,'5. 콩다식 판에 숙성된 콩반죽을 넣고\n모양을 만든다.','MANUAL05'),(430,'6. 콩다식에 레몬크림을 올리고\n레몬제스트로 장식한다.','MANUAL06'),(430,'','MANUAL07'),(430,'','MANUAL08'),(430,'','MANUAL09'),(430,'','MANUAL10'),(430,'','MANUAL11'),(430,'','MANUAL12'),(430,'','MANUAL13'),(430,'','MANUAL14'),(430,'','MANUAL15'),(430,'','MANUAL16'),(430,'','MANUAL17'),(430,'','MANUAL18'),(430,'','MANUAL19'),(430,'','MANUAL20'),(431,'1. 양상추, 부추를 데친다.','MANUAL01'),(431,'2. 양송이버섯은 얇게 슬라이스하고 팬에\n기름을 살짝 두르고 굽는다.','MANUAL02'),(431,'3. 전복은 수저로 떼어 소금으로 씻고\n일정한 크기로 썰어 팬에 굽는다.','MANUAL03'),(431,'4. 닭고기는 일정한 크기로 썬 뒤 삶고,\n소고기도 일정한 크기로 썰어 양념 한\n뒤 볶는다.','MANUAL04'),(431,'5. 토마토, 양파, 당근은 잘게 썰고, 쌀은\n깨끗이 씻어 불려 야채를 넣고 밥을\n짓는다.','MANUAL05'),(431,'6. 쪄낸 양배추에 볶은 고기, 삶은 닭고기,\n구운 전복, 밥을 넣고 돌돌 말아 부추로\n묶어 접시에 담고, 한쪽에 구운 버섯을\n담는다.','MANUAL06'),(431,'','MANUAL07'),(431,'','MANUAL08'),(431,'','MANUAL09'),(431,'','MANUAL10'),(431,'','MANUAL11'),(431,'','MANUAL12'),(431,'','MANUAL13'),(431,'','MANUAL14'),(431,'','MANUAL15'),(431,'','MANUAL16'),(431,'','MANUAL17'),(431,'','MANUAL18'),(431,'','MANUAL19'),(431,'','MANUAL20'),(432,'1. 돼지고기 안심을 요리망치로 얇게\n두드려 펴고 후춧가루로 밑간한다.','MANUAL01'),(432,'2. 목이버섯은 불려 잘게 썰고 양파와\n마늘은 입자있게 다진다','MANUAL02'),(432,'3. 당면은 따뜻한 물에 충분히 불려 썰고\n애호박, 당근, 표고버섯은 잘게 썬다.','MANUAL03'),(432,'4. 팬에 기름을 두르고 다진 양파와\n마늘을 볶는다.','MANUAL04'),(432,'5. 4번에 매실액과 잘게 자른 애호박,\n당근, 표고버섯, 목이버섯, 당면을\n넣고 볶아 만두소를 만든다.','MANUAL05'),(432,'6. 돼지고기는 넓게 펴서 만두소를 넣고\n주머니를 만들어 실로 묶고 토마토와\n함께 오븐에 굽는다.','MANUAL06'),(432,'','MANUAL07'),(432,'','MANUAL08'),(432,'','MANUAL09'),(432,'','MANUAL10'),(432,'','MANUAL11'),(432,'','MANUAL12'),(432,'','MANUAL13'),(432,'','MANUAL14'),(432,'','MANUAL15'),(432,'','MANUAL16'),(432,'','MANUAL17'),(432,'','MANUAL18'),(432,'','MANUAL19'),(432,'','MANUAL20'),(433,'1. 닭날개에 칼집을 넣고 뒤집어\n튤립모양의 봉을 만든다.','MANUAL01'),(433,'2. 닭날개에 소금, 후춧가루로 밑간을\n한다.','MANUAL02'),(433,'3. 파슬리는 곱게 다져 가루를 만든다','MANUAL03'),(433,'4. 양파, 마늘은 즙을 내서 튀김가루,\n파슬리 가루와 함께 골고루 섞어\n튀김반죽을 만든다.','MANUAL04'),(433,'5. 어린잎은 찬물에 담궈 건져 놓는다.','MANUAL05'),(433,'6. 튀긴 닭날개의 기름을 빼고 레몬과\n어린잎으로 장식한다.','MANUAL06'),(433,'','MANUAL07'),(433,'','MANUAL08'),(433,'','MANUAL09'),(433,'','MANUAL10'),(433,'','MANUAL11'),(433,'','MANUAL12'),(433,'','MANUAL13'),(433,'','MANUAL14'),(433,'','MANUAL15'),(433,'','MANUAL16'),(433,'','MANUAL17'),(433,'','MANUAL18'),(433,'','MANUAL19'),(433,'','MANUAL20'),(434,'1. 푸실리는 뜨거운 물에 약 10분 정도\n삶아 건져 올리브오일을 살짝 바른다.','MANUAL01'),(434,'2. 머윗대는 살짝 데친 후 찬물에 헹궈\n껍질을 벗긴다.','MANUAL02'),(434,'3. 껍질 벗긴 머윗대는 푸실리 크기로\n자른다.','MANUAL03'),(434,'4. 양파, 마늘은 입자있게 다진다.','MANUAL04'),(434,'5. 팬에 올리브오일을 두르고 다진 마늘과\n양파를 볶다가 화이트와인을 넣고\n볶는다.','MANUAL05'),(434,'6. 5번에 생크림, 소금을 넣고 믹서에 간\n뒤 푸실리와 머윗대를 넣고 한소끔\n끓인다.','MANUAL06'),(434,'','MANUAL07'),(434,'','MANUAL08'),(434,'','MANUAL09'),(434,'','MANUAL10'),(434,'','MANUAL11'),(434,'','MANUAL12'),(434,'','MANUAL13'),(434,'','MANUAL14'),(434,'','MANUAL15'),(434,'','MANUAL16'),(434,'','MANUAL17'),(434,'','MANUAL18'),(434,'','MANUAL19'),(434,'','MANUAL20'),(435,'1. 대추는 돌려 깎아 씨를 제거하고 곱게\n다지고 팬에 볶는다.','MANUAL01'),(435,'2. 소고기, 돼지고기, 양파 및 마늘을\n다진다.','MANUAL02'),(435,'3. 배춧잎, 파프리카, 새송이버섯, 당근은\n입자있게 다진다.','MANUAL03'),(435,'4. 다진 소고기, 돼지고기, 양파, 마늘,\n대추, 배춧잎, 파프리카, 새송이버섯,\n당근 및 양파에 소금, 후춧가루를 섞어\n잘 치대어 스테이크 모양으로 만든다','MANUAL04'),(435,'5. 팬에 기름을 살짝 두르고, 스테이크\n고기를 충분히 익혀 접시에 담고,\n단호박은 껍질을 벗겨 팬에 구워\n담는다.','MANUAL05'),(435,'6. 배는 갈아 저염간장과 설탕을 넣고 잘\n저어 소스를 만들고 익혀 놓은\n스테이크에 올려 완성한다.','MANUAL06'),(435,'','MANUAL07'),(435,'','MANUAL08'),(435,'','MANUAL09'),(435,'','MANUAL10'),(435,'','MANUAL11'),(435,'','MANUAL12'),(435,'','MANUAL13'),(435,'','MANUAL14'),(435,'','MANUAL15'),(435,'','MANUAL16'),(435,'','MANUAL17'),(435,'','MANUAL18'),(435,'','MANUAL19'),(435,'','MANUAL20'),(436,'1. 대파, 무, 다시마를 물에 넣고 끓여\n육수를 만든다.','MANUAL01'),(436,'2. 육수에 가쓰오부시를 넣고 10분 정도\n가라앉힌 뒤 거른다.','MANUAL02'),(436,'3. 새우는 껍질을 벗겨 깨끗이 씻고\n바지락은 주물러 씻는다.','MANUAL03'),(436,'4. 손질한 새우와 바지락을 곱게 다진다.','MANUAL04'),(436,'5. 다진 새우와 바지락에 달걀흰자와\n전분을 넣고 골고루 섞어 완자를\n만들어 후라이팬에 살짝 굴려 모양이\n풀리지 않게 한다','MANUAL05'),(436,'6. 준비된 육수에 완자를 넣고 완전히\n익히고 그릇에 담은 뒤 어슷썬\n홍고추와 풋고추를 위에 올린다.','MANUAL06'),(436,'','MANUAL07'),(436,'','MANUAL08'),(436,'','MANUAL09'),(436,'','MANUAL10'),(436,'','MANUAL11'),(436,'','MANUAL12'),(436,'','MANUAL13'),(436,'','MANUAL14'),(436,'','MANUAL15'),(436,'','MANUAL16'),(436,'','MANUAL17'),(436,'','MANUAL18'),(436,'','MANUAL19'),(436,'','MANUAL20'),(437,'1. 닭가슴살에 소금, 후춧가루로\n밑간하고 랩으로 말아 50℃ 정도의\n물에서 천천히 익힌다.','MANUAL01'),(437,'2. 달걀은 황백 지단을 만들어 채를 썰고,\n표고버섯, 당근, 오이, 파프리카 및\n고구마도 채를 썰어 팬에 볶는다.','MANUAL02'),(437,'3. 미나리는 끓는 물에 소금을 넣고 살짝\n데친 뒤 찬물에 헹군다','MANUAL03'),(437,'4. 취나물은 끓는 물에 소금을 넣고 살짝\n데친 뒤 찬물에 헹구어 넓게 펴 놓는다.','MANUAL04'),(437,'5. 누룽지는 손으로 잘라 기름에 튀긴다.','MANUAL05'),(437,'6. 취나물에 익힌 닭가슴살과 볶은 야채를\n돌돌 말아 미나리를 감고 먹기 좋은\n크기로 썰어 접시에 담은 뒤 튀긴\n누룽지를 올린다.','MANUAL06'),(437,'','MANUAL07'),(437,'','MANUAL08'),(437,'','MANUAL09'),(437,'','MANUAL10'),(437,'','MANUAL11'),(437,'','MANUAL12'),(437,'','MANUAL13'),(437,'','MANUAL14'),(437,'','MANUAL15'),(437,'','MANUAL16'),(437,'','MANUAL17'),(437,'','MANUAL18'),(437,'','MANUAL19'),(437,'','MANUAL20'),(438,'1. 닭가슴살은 포를 떠 후춧가루로 밑간을\n한다.','MANUAL01'),(438,'2. 인삼은 뇌두를 제거하고 깨끗이 씻어\n절반은 다지고, 양파와 마늘도 다진다.','MANUAL02'),(438,'3. 나머지 인삼은 채썰고, 대파, 깻잎도\n채를 썰어 물에 담군다.','MANUAL03'),(438,'4. 다진 양파, 마늘을 볶다가 생크림을\n넣고 은근히 졸인 뒤 오렌지, 레몬즙을\n넣고 소스를 만든다.','MANUAL04'),(438,'5. 닭가슴살에 밀가루에 찬물, 달걀을\n넣고 튀김옷을 만들어 입힌다.','MANUAL05'),(438,'6. 팬에 기름을 넉넉히 넣고 지지듯이\n닭가슴살을 튀겨 접시에 담고\n인삼소스를 뿌린 뒤, 그 위에 깻잎과\n대파, 인삼채를 올린다.','MANUAL06'),(438,'','MANUAL07'),(438,'','MANUAL08'),(438,'','MANUAL09'),(438,'','MANUAL10'),(438,'','MANUAL11'),(438,'','MANUAL12'),(438,'','MANUAL13'),(438,'','MANUAL14'),(438,'','MANUAL15'),(438,'','MANUAL16'),(438,'','MANUAL17'),(438,'','MANUAL18'),(438,'','MANUAL19'),(438,'','MANUAL20'),(439,'1. 닭은 살을 발라 소금, 후춧가루로\n밑간을 하고 닭뼈는 삶아 육수를\n만든다.','MANUAL01'),(439,'2. 인삼은 뇌두를 제거하고 깨끗이 씻어\n채 썰고, 대추도 씨를 제거 한 후 채\n썬다.','MANUAL02'),(439,'3. 양파, 대파, 당근은 채썰고, 찹쌀은\n깨끗이 씻어 충분히 불린 뒤 함께\n볶는다.','MANUAL03'),(439,'4. 충분히 볶아지면 육수를 자작하게 넣고\n익힌다.','MANUAL04'),(439,'5. 랩에 닭살을 놓고 찹쌀과 인삼채,\n대추채를 올려 돌돌 만다.','MANUAL05'),(439,'6. 마늘, 생강, 월계수잎 및 통후추를 넣고\n끓인 물에 김이 올라오면 말아놓은\n닭살을 찜통에서 20분 정도 찌고 한 김\n식으면 썰어 접시에 담는다.','MANUAL06'),(439,'','MANUAL07'),(439,'','MANUAL08'),(439,'','MANUAL09'),(439,'','MANUAL10'),(439,'','MANUAL11'),(439,'','MANUAL12'),(439,'','MANUAL13'),(439,'','MANUAL14'),(439,'','MANUAL15'),(439,'','MANUAL16'),(439,'','MANUAL17'),(439,'','MANUAL18'),(439,'','MANUAL19'),(439,'','MANUAL20'),(440,'1. 새우는 내장을 제거 하고 껍질을 벗겨\n깨끗이 씻는다.','MANUAL01'),(440,'2. 다진 새우에 전분, 후춧가루, 달걀흰자\n및 요리술을 섞는다.','MANUAL02'),(440,'3. 반죽새우를 잘 치대어 완자로 만든 후\n치킨 육수에 넣고 끓인다','MANUAL03'),(440,'4. 청경채는 깨끗이 씻어 반으로 길게\n가른다.','MANUAL04'),(440,'5. 달걀은 황백으로 나눠 지단을 부쳐\n마름모꼴로 썬다.','MANUAL05'),(440,'6. 완자가 익으면 물 녹말을 한 수저 넣고\n청경채를 넣고 한소끔 끓인 뒤 그릇에\n담고 황백지단을 올린다.','MANUAL06'),(440,'','MANUAL07'),(440,'','MANUAL08'),(440,'','MANUAL09'),(440,'','MANUAL10'),(440,'','MANUAL11'),(440,'','MANUAL12'),(440,'','MANUAL13'),(440,'','MANUAL14'),(440,'','MANUAL15'),(440,'','MANUAL16'),(440,'','MANUAL17'),(440,'','MANUAL18'),(440,'','MANUAL19'),(440,'','MANUAL20'),(441,'1. 아스파라거스는 깨끗이 씻어 5cm\n길이로 썬다.','MANUAL01'),(441,'2. 당근을 아스파라거스 크기로 썬다.','MANUAL02'),(441,'3. 무도 아스파라거스 크기로 썬다.','MANUAL03'),(441,'4. 식초, 설탕을 동량으로 섞는다.','MANUAL04'),(441,'5. 식초 설탕물이 끓으면 통에 뜨거울 때\n붓고, 떠오르지 않도록 눌러 담는다.','MANUAL05'),(441,'6. 약 7일 정도 숙성한다.','MANUAL06'),(441,'','MANUAL07'),(441,'','MANUAL08'),(441,'','MANUAL09'),(441,'','MANUAL10'),(441,'','MANUAL11'),(441,'','MANUAL12'),(441,'','MANUAL13'),(441,'','MANUAL14'),(441,'','MANUAL15'),(441,'','MANUAL16'),(441,'','MANUAL17'),(441,'','MANUAL18'),(441,'','MANUAL19'),(441,'','MANUAL20'),(442,'1. 비트는 껍질을 벗겨 채 썬다.','MANUAL01'),(442,'2. 양파를 얇게 채 썬 후 물에 담근 뒤 건져\n물기를 뺀다.','MANUAL02'),(442,'3. 비트와 오렌지에 절여진 연어를 얇게\n슬라이스한다.','MANUAL03'),(442,'4. 식용꽃과 새싹은 물에 담궈 싱싱함을\n살리고 건져 물기를 뺀다.','MANUAL04'),(442,'5. 새싹과 양파를 접시에 깔고 그 위에\n연어를 올린다.','MANUAL05'),(442,'6. 올리브오일, 식초, 소금 및 설탕을 잘\n섞어서 만든 드레싱을 올리고\n식용꽃으로 장식한다','MANUAL06'),(442,'','MANUAL07'),(442,'','MANUAL08'),(442,'','MANUAL09'),(442,'','MANUAL10'),(442,'','MANUAL11'),(442,'','MANUAL12'),(442,'','MANUAL13'),(442,'','MANUAL14'),(442,'','MANUAL15'),(442,'','MANUAL16'),(442,'','MANUAL17'),(442,'','MANUAL18'),(442,'','MANUAL19'),(442,'','MANUAL20'),(443,'1. 가지는 반 갈라 4등분하여 찜통에 5분간 찐 후 한 김 식혀준다.','MANUAL01'),(443,'2. 식은 가지를 새끼손가락 굵기로 찢는다.','MANUAL02'),(443,'3. 다진 고추, 실파, 마늘, 국간장을 넣어 양념장을 만든다.','MANUAL03'),(443,'4. 찐 가지에 양념장을 넣고 조물조물 무친다.','MANUAL04'),(443,'5. 차게 한 다시마국물 반컵에 식초, 죽염을 넣어 간한다.','MANUAL05'),(443,'6. 유리 그릇에 무친 가지를 담고 5를 부은 뒤 얼음을 띄우고 통깨를 뿌린다.','MANUAL06'),(443,'','MANUAL07'),(443,'','MANUAL08'),(443,'','MANUAL09'),(443,'','MANUAL10'),(443,'','MANUAL11'),(443,'','MANUAL12'),(443,'','MANUAL13'),(443,'','MANUAL14'),(443,'','MANUAL15'),(443,'','MANUAL16'),(443,'','MANUAL17'),(443,'','MANUAL18'),(443,'','MANUAL19'),(443,'','MANUAL20'),(444,'1. 닭은 찬물에 담가 핏물을 제거하고 끓는 물에 넣고 데쳐 기름을 뺀다.','MANUAL01'),(444,'2. 당면과 표고버섯은 각각 물에 담가 불리고 버섯 불린 물은 따로 받아둔다.','MANUAL02'),(444,'3. 표고버섯, 감자, 양파, 당근은 한입 크기로 썰고 수삼과 대파는 어슷 썬다.','MANUAL03'),(444,'4. 냄비에 닭과 양념, 버섯, 감자, 양파, 당근, 건고추, 버섯 불린 물 3/4컵을 넣고 조린다.','MANUAL04'),(444,'5. 닭이 반쯤 익었을 때 수삼을 넣고 계속 조린다.','MANUAL05'),(444,'6. 닭이 다 익으면 당면, 대파, 다진 마늘을 넣고 살짝 끓여 담아낸다.','MANUAL06'),(444,'','MANUAL07'),(444,'','MANUAL08'),(444,'','MANUAL09'),(444,'','MANUAL10'),(444,'','MANUAL11'),(444,'','MANUAL12'),(444,'','MANUAL13'),(444,'','MANUAL14'),(444,'','MANUAL15'),(444,'','MANUAL16'),(444,'','MANUAL17'),(444,'','MANUAL18'),(444,'','MANUAL19'),(444,'','MANUAL20'),(445,'1. 키친타월을 이용해 돼지고기의 핏물을 뺀다.','MANUAL01'),(445,'2. 돼지고기에 칼집을 내준다.','MANUAL02'),(445,'3. 칼집 낸 돼지고기에 올리브유, 후추를 뿌려 재워둔다.','MANUAL03'),(445,'4. 수박의 씨를 빼고 살만 발라 믹서에 간다.','MANUAL04'),(445,'5. 소스 재료를 모두 섞어 약불에서 살짝 졸여 식힌다.','MANUAL05'),(445,'6. 재워 놓은 고기에 소스를 끼얹어 팬에 굽는다.','MANUAL06'),(445,'','MANUAL07'),(445,'','MANUAL08'),(445,'','MANUAL09'),(445,'','MANUAL10'),(445,'','MANUAL11'),(445,'','MANUAL12'),(445,'','MANUAL13'),(445,'','MANUAL14'),(445,'','MANUAL15'),(445,'','MANUAL16'),(445,'','MANUAL17'),(445,'','MANUAL18'),(445,'','MANUAL19'),(445,'','MANUAL20'),(446,'1. 병어에 칼집을 내어 소금을 뿌린다.','MANUAL01'),(446,'2. 무는 두툼하게 썰고 양파는 굵게 채 썰고 고추와 대파는 어슷 썬다.','MANUAL02'),(446,'3. 양념장 재료를 모두 섞어 양념장을 만든다.','MANUAL03'),(446,'4. 양념장의 ¼만 남기고 나머지 양념장을 물 반컵에 풀어 무를 넣어 끓인다.','MANUAL04'),(446,'5. 무에 간이 배면 양파와 병어를 넣고 남은 양념장을 넣어 졸여준다.','MANUAL05'),(446,'6. 고추와 대파를 넣어 마무리한다.','MANUAL06'),(446,'','MANUAL07'),(446,'','MANUAL08'),(446,'','MANUAL09'),(446,'','MANUAL10'),(446,'','MANUAL11'),(446,'','MANUAL12'),(446,'','MANUAL13'),(446,'','MANUAL14'),(446,'','MANUAL15'),(446,'','MANUAL16'),(446,'','MANUAL17'),(446,'','MANUAL18'),(446,'','MANUAL19'),(446,'','MANUAL20'),(447,'1. 쇠비름을 씻는다.','MANUAL01'),(447,'2. 씻은 쇠비름을 소금물에 담가 살짝 절인다.','MANUAL02'),(447,'3. 절여논 쇠비름을 헹구어 체에 건진다.','MANUAL03'),(447,'4. 양념 재료를 모두 섞어 양념장을 만든다.','MANUAL04'),(447,'5. 쇠비름에 양념장을 넣어 살짝 무쳐낸다.','MANUAL05'),(447,'6. 그릇에 담아 완성한다.','MANUAL06'),(447,'','MANUAL07'),(447,'','MANUAL08'),(447,'','MANUAL09'),(447,'','MANUAL10'),(447,'','MANUAL11'),(447,'','MANUAL12'),(447,'','MANUAL13'),(447,'','MANUAL14'),(447,'','MANUAL15'),(447,'','MANUAL16'),(447,'','MANUAL17'),(447,'','MANUAL18'),(447,'','MANUAL19'),(447,'','MANUAL20'),(448,'1. 단호박을 반 갈라 씨를 빼고 8등분 한다.','MANUAL01'),(448,'2. 김이 오른 찜통에 단호박을 찐다.','MANUAL02'),(448,'3. 찐 단호박을 껍질을 벗겨 으깨고 호두는 잘게 다진다.','MANUAL03'),(448,'4. 으깬 단호박에 다진 호두와 꿀 넣고 섞는다.','MANUAL04'),(448,'5. 깻잎 뒷면에 4 를 한 숟가락 올리고 양끝을 오무려 돌돌 만다.','MANUAL05'),(448,'6. 찹쌀가루에 물 한 큰술을 섞은 튀김옷을 골고루 입혀 바삭하게 튀겨낸다.','MANUAL06'),(448,'','MANUAL07'),(448,'','MANUAL08'),(448,'','MANUAL09'),(448,'','MANUAL10'),(448,'','MANUAL11'),(448,'','MANUAL12'),(448,'','MANUAL13'),(448,'','MANUAL14'),(448,'','MANUAL15'),(448,'','MANUAL16'),(448,'','MANUAL17'),(448,'','MANUAL18'),(448,'','MANUAL19'),(448,'','MANUAL20'),(449,'1. 머위대를 잘라 데쳐서 껍질을 벗긴다.','MANUAL01'),(449,'2. 데친 머위대를 찬물에 1~2 시간 담가 쓴맛을 제거한다.','MANUAL02'),(449,'3. 양념을 넣어 머위대를 무친다.','MANUAL03'),(449,'4. 팬에 들기름을 두르고 양념한 머위대를 볶는다.','MANUAL04'),(449,'5. 물 반컵을 넣고 국물이 자박하도록 푹 끓여낸다.','MANUAL05'),(449,'6. 완성된 머위나물을 식혀서 냉장고에 차게 보관하였다가 먹는다.','MANUAL06'),(449,'','MANUAL07'),(449,'','MANUAL08'),(449,'','MANUAL09'),(449,'','MANUAL10'),(449,'','MANUAL11'),(449,'','MANUAL12'),(449,'','MANUAL13'),(449,'','MANUAL14'),(449,'','MANUAL15'),(449,'','MANUAL16'),(449,'','MANUAL17'),(449,'','MANUAL18'),(449,'','MANUAL19'),(449,'','MANUAL20'),(450,'1. 수박껍질의 녹색부분을 제거하고 얄팍하게 채 썬다.','MANUAL01'),(450,'2. 채 썬 수박껍질에 소금을 뿌려 살짝 절여 물기를 짠다.','MANUAL02'),(450,'3. 고추는 길이로 2등분하여 씨를 뺀다.','MANUAL03'),(450,'4. 씨를 뺀 고추는 굵게 채 썬다.','MANUAL04'),(450,'5. 팬에 기름을 두르고 수박껍질과 고추를 넣어 살짝 볶는다.','MANUAL05'),(450,'6. 소금으로 간을 맞추고 마무리한다.','MANUAL06'),(450,'','MANUAL07'),(450,'','MANUAL08'),(450,'','MANUAL09'),(450,'','MANUAL10'),(450,'','MANUAL11'),(450,'','MANUAL12'),(450,'','MANUAL13'),(450,'','MANUAL14'),(450,'','MANUAL15'),(450,'','MANUAL16'),(450,'','MANUAL17'),(450,'','MANUAL18'),(450,'','MANUAL19'),(450,'','MANUAL20'),(451,'1. 오미자를 헹궈 따뜻한 물에 담가 12시간 우린다.','MANUAL01'),(451,'2. 우려낸 오미자물을 면보에 거른다.','MANUAL02'),(451,'3. 오미자 국물 1컵에 올리고당을 넣어 감미한다.','MANUAL03'),(451,'4. 우무를 곱게 채 썰거나 모양 틀로 찍어낸다.','MANUAL04'),(451,'5. 오미자 국물을 살짝 얼려 믹서에 갈아 슬러쉬를 만든다.','MANUAL05'),(451,'6. 오미자 슬러쉬에 우무를 올린다.','MANUAL06'),(451,'','MANUAL07'),(451,'','MANUAL08'),(451,'','MANUAL09'),(451,'','MANUAL10'),(451,'','MANUAL11'),(451,'','MANUAL12'),(451,'','MANUAL13'),(451,'','MANUAL14'),(451,'','MANUAL15'),(451,'','MANUAL16'),(451,'','MANUAL17'),(451,'','MANUAL18'),(451,'','MANUAL19'),(451,'','MANUAL20'),(452,'1. 포도를 씻는다.','MANUAL01'),(452,'2. 포도 껍질을 까고, 포도알을 떼어 낸다.','MANUAL02'),(452,'3. 포도알은 뚜껑이 있는 통에 담아 냉동고에 얼린다.','MANUAL03'),(452,'4. 얼린 포도알에 오미자액과 호상요구르트를 넣고 믹서에 갈아 스무디를 만든다.','MANUAL04'),(452,'5. 호두는 칼로 굵게 다진다.','MANUAL05'),(452,'6. 다진 호두는 스무디 위에 뿌린다.','MANUAL06'),(452,'','MANUAL07'),(452,'','MANUAL08'),(452,'','MANUAL09'),(452,'','MANUAL10'),(452,'','MANUAL11'),(452,'','MANUAL12'),(452,'','MANUAL13'),(452,'','MANUAL14'),(452,'','MANUAL15'),(452,'','MANUAL16'),(452,'','MANUAL17'),(452,'','MANUAL18'),(452,'','MANUAL19'),(452,'','MANUAL20'),(453,'1. 물 2컵에 건다시마를 넣어 다시마국물을 1컵 반 정도를 낸다.','MANUAL01'),(453,'2. 우린 다시마와 전복살은 잘게 다진다.','MANUAL02'),(453,'3. 표고버섯, 양송이버섯, 당근은 0.5~0.7cm 주사위모양으로 썬다.','MANUAL03'),(453,'4. 쌀은 씻어 2와 3을 넣고 다시마국물 1컵 반을 부어 30분 정도 불린 후 밥을 짓는다.','MANUAL04'),(453,'5. 부추와 실파는 다지고 참기름, 다진 마늘, 통깨, 다시마국물, 간장을 넣어 양념장을 만든다.','MANUAL05'),(453,'6. 전복영양밥과에 부추양념장을 곁들인다.','MANUAL06'),(453,'','MANUAL07'),(453,'','MANUAL08'),(453,'','MANUAL09'),(453,'','MANUAL10'),(453,'','MANUAL11'),(453,'','MANUAL12'),(453,'','MANUAL13'),(453,'','MANUAL14'),(453,'','MANUAL15'),(453,'','MANUAL16'),(453,'','MANUAL17'),(453,'','MANUAL18'),(453,'','MANUAL19'),(453,'','MANUAL20'),(454,'1. 물 2/3컵에 국멸치와 건다시마를 넣고 끓여 국물을 내면서 이 열로 근대를 삼발이에 놓고 찐다.','MANUAL01'),(454,'2. 국물 우린 다시마를 잘게 썰어 쌀, 현미, 보리쌀과 함께 잡곡밥을 짓는다.','MANUAL02'),(454,'3. 잔멸치는 기름을 두르지 않고 팬에 살짝 볶아 다지고 견과류도 칼로 다진다.','MANUAL03'),(454,'4. 양파와 파를 다진다.','MANUAL04'),(454,'5. 고추장, 된장, 견과류, 양파, 다진 마늘, 매실액, 파, 멸치다시마국물을 섞어 멸치견과류쌈장을 만든다.','MANUAL05'),(454,'6. 근대위에 밥을 약 30g(1숟가락)정도 올리고 멸치견과류쌈장 5g 가량 넣어 근대잎으로 싼다.','MANUAL06'),(454,'','MANUAL07'),(454,'','MANUAL08'),(454,'','MANUAL09'),(454,'','MANUAL10'),(454,'','MANUAL11'),(454,'','MANUAL12'),(454,'','MANUAL13'),(454,'','MANUAL14'),(454,'','MANUAL15'),(454,'','MANUAL16'),(454,'','MANUAL17'),(454,'','MANUAL18'),(454,'','MANUAL19'),(454,'','MANUAL20'),(455,'1. 장어는 한입 크기로 잘라서 흰 후추와 청주를\n뿌려 재워준다.','MANUAL01'),(455,'2. 깻잎은 채를 썰어서 냉수에 담가 물기를\n빼준다.','MANUAL02'),(455,'3. 생강, 마늘은 편으로 썰어주고 양파, 청고추,\n홍고추는 어슷하게 잘라준다.','MANUAL03'),(455,'4. 참기름을 뺀 양념장 재료에 편마늘과 다진대파를\n넣어서 양념장을 만들어준다.','MANUAL04'),(455,'5. 만들어진 양념장 1/2에 장어를 넣고 졸여준다.','MANUAL05'),(455,'6. 나머지 양념장에 준비된 채소를 넣어 볶아주다\n졸인 장어를 넣어 졸여주고 깻잎을 깔고\n완성한다.','MANUAL06'),(455,'','MANUAL07'),(455,'','MANUAL08'),(455,'','MANUAL09'),(455,'','MANUAL10'),(455,'','MANUAL11'),(455,'','MANUAL12'),(455,'','MANUAL13'),(455,'','MANUAL14'),(455,'','MANUAL15'),(455,'','MANUAL16'),(455,'','MANUAL17'),(455,'','MANUAL18'),(455,'','MANUAL19'),(455,'','MANUAL20'),(456,'1. 통삼겹에 건로즈마리와 로즈마리, 올리브유를\n넣고 마리네이드 해준다.','MANUAL01'),(456,'2. 양파는 먹기 좋게 썰어 식초, 설탕, 로즈마리에\n살짝 버무려준다.','MANUAL02'),(456,'3. 양파, 2가지색 미니파프리카는 송송 다져서\n설탕, 식초에 담가 꼭 짜서 수분을 빼준다.','MANUAL03'),(456,'4. 당근은 먹기 좋은 크기로 잘라서 버터에 살짝\n볶아주다 백일송이 버섯도 함께 볶아준다.','MANUAL04'),(456,'5. 재워 놓은 통삼겹은 플레인요구르트에 다시\n30분 정도 더 재워준 후 소스에 졸여준다.','MANUAL05'),(456,'6. 감자를 쪄서 버터에 매쉬포테이토를 만들어\n담아주고, 구운 통삼겹과 준비된 채소와 볶은\n현미를 올려 완성한다.','MANUAL06'),(456,'','MANUAL07'),(456,'','MANUAL08'),(456,'','MANUAL09'),(456,'','MANUAL10'),(456,'','MANUAL11'),(456,'','MANUAL12'),(456,'','MANUAL13'),(456,'','MANUAL14'),(456,'','MANUAL15'),(456,'','MANUAL16'),(456,'','MANUAL17'),(456,'','MANUAL18'),(456,'','MANUAL19'),(456,'','MANUAL20'),(457,'1. 삼치는 세척 후 전분가루로 옷을 입혀준다.','MANUAL01'),(457,'2. 일본된장과 청주를 섞어 구이소스를 만들어 삼치를 재운다.','MANUAL02'),(457,'3. 청고추와 홍고추는 곱게 다지고 치커리는 적당하게 잘라서 물에 담가준다.','MANUAL03'),(457,'4. 유자청, 다진마늘, 다진 청고추와 홍고추를 섞어 곁들임소스를 만든다.','MANUAL04'),(457,'5. 재워두었던 삼치를 굽는다.','MANUAL05'),(457,'6. 접시에 구운 삼치와 치커리를 올리고 치커리를 올리고 곁들임소스를 뿌려 완성한다.','MANUAL06'),(457,'','MANUAL07'),(457,'','MANUAL08'),(457,'','MANUAL09'),(457,'','MANUAL10'),(457,'','MANUAL11'),(457,'','MANUAL12'),(457,'','MANUAL13'),(457,'','MANUAL14'),(457,'','MANUAL15'),(457,'','MANUAL16'),(457,'','MANUAL17'),(457,'','MANUAL18'),(457,'','MANUAL19'),(457,'','MANUAL20'),(458,'1. 전복은 내장과 분리해 손질한다.','MANUAL01'),(458,'2. 내장은 칼로 다진다.','MANUAL02'),(458,'3. 당근과 전복살은 송송 잘라준다.','MANUAL03'),(458,'4. 전복 껍질과 다시마를 넣어 물 300g에 국물을\n만들어준다.','MANUAL04'),(458,'5. 만들어진 국물에 미역을 넣고 끓여준다.','MANUAL05'),(458,'6. 다진 내장과 불린 찹쌀을 참기름에 볶다가\n끓인 미역국을 넣고 더 끓여 죽을 만든다.\n다진 당근, 흑임자로 마무리 완성한다.','MANUAL06'),(458,'','MANUAL07'),(458,'','MANUAL08'),(458,'','MANUAL09'),(458,'','MANUAL10'),(458,'','MANUAL11'),(458,'','MANUAL12'),(458,'','MANUAL13'),(458,'','MANUAL14'),(458,'','MANUAL15'),(458,'','MANUAL16'),(458,'','MANUAL17'),(458,'','MANUAL18'),(458,'','MANUAL19'),(458,'','MANUAL20'),(459,'1. 단호박, 감자는 가늘게 채 썰어 기름에 바싹\n튀겨준다','MANUAL01'),(459,'2. 불고기에 다진 양파를 섞어 양념장에 버무려\n준다.','MANUAL02'),(459,'3. 양념된 불고기는 완자로 만들어 밀가루, 계란,\n빵가루 순으로 묻혀서 기름에 튀겨준다.','MANUAL03'),(459,'4. 소스를 만들어준다','MANUAL04'),(459,'5. 튀겨진 소고기 볼을 기름에 한 번 더 튀겨준다.','MANUAL05'),(459,'6. 접시에 으깬 감자와 불고기볼 그리고 튀김을\n올리고 소스와 바질을 올려 완성한다','MANUAL06'),(459,'','MANUAL07'),(459,'','MANUAL08'),(459,'','MANUAL09'),(459,'','MANUAL10'),(459,'','MANUAL11'),(459,'','MANUAL12'),(459,'','MANUAL13'),(459,'','MANUAL14'),(459,'','MANUAL15'),(459,'','MANUAL16'),(459,'','MANUAL17'),(459,'','MANUAL18'),(459,'','MANUAL19'),(459,'','MANUAL20'),(460,'1. 당근은 모양틀로 잘라서 편으로 썰어준다.','MANUAL01'),(460,'2. 연 근 은 껍 질 을 벗 겨 서 식 초 물 에 살 짝\n담가준다.','MANUAL02'),(460,'3. 청고추, 홍고추, 미나리는 먹기 좋게 썰어준다.','MANUAL03'),(460,'4. 마늘은 편으로 썰어서 물 400g에 끓여주다\n불을 끄고 치자가루를 넣어 국물을 만들어준다.','MANUAL04'),(460,'5. 국물에 연근을 담가 색을 들인다.','MANUAL05'),(460,'6. 여기에 생강청, 식초, 설탕, 볶은소금과 준비된\n채소를 넣어 치자 연근물김치를 완성한다.','MANUAL06'),(460,'','MANUAL07'),(460,'','MANUAL08'),(460,'','MANUAL09'),(460,'','MANUAL10'),(460,'','MANUAL11'),(460,'','MANUAL12'),(460,'','MANUAL13'),(460,'','MANUAL14'),(460,'','MANUAL15'),(460,'','MANUAL16'),(460,'','MANUAL17'),(460,'','MANUAL18'),(460,'','MANUAL19'),(460,'','MANUAL20'),(461,'1. 훈제연어를 살포시 포를 뜬다.','MANUAL01'),(461,'2. 양파와 피클은 곱게 다져 준비한다.','MANUAL02'),(461,'3. 포를 떠 놓은 훈제 연어에 살짝 후춧\n가루를 뿌리고, 양파와 피클을 넣어\n말아준다.','MANUAL03'),(461,'4. 오렌지는 껍질과 과육을 분리해서 썰어\n준비한다.','MANUAL04'),(461,'5. 냄비에 오렌지주스와 설탕과 레몬,\n분리시킨 오렌지를 넣고 끓여준다.','MANUAL05'),(461,'6. 끓고 있는 오렌지소스에 물녹말과 스위\n트칠리소스를 넣고 한 소큼만 끓인 후\n말아 놓은 훈제 연어롤을 접시에 담고,\n어린잎을 한쪽에 놓아주고, 오렌지\n소스를 함께 올려 완성한다.','MANUAL06'),(461,'','MANUAL07'),(461,'','MANUAL08'),(461,'','MANUAL09'),(461,'','MANUAL10'),(461,'','MANUAL11'),(461,'','MANUAL12'),(461,'','MANUAL13'),(461,'','MANUAL14'),(461,'','MANUAL15'),(461,'','MANUAL16'),(461,'','MANUAL17'),(461,'','MANUAL18'),(461,'','MANUAL19'),(461,'','MANUAL20'),(462,'1. 우유에 닭가슴살을 넣어 약20분 정도\n재워 놓는다.','MANUAL01'),(462,'2. 양송이버섯은 껍질을 벗기고, 양파와\n캐슈넛과 각각 다져 준비한다.','MANUAL02'),(462,'3. 우유에 재워놓은 닭가슴살은 소금,\n후춧가루를 뿌려 밀가루와 달걀물,\n빵가루 순서로 입혀 기름에 튀기듯이\n익혀 기름을 빼놓는다.','MANUAL03'),(462,'4. 팬에 버터를 넣고, 버터가 녹으면,\n양송이와 양파를 넣고 볶는다.','MANUAL04'),(462,'5. 볶아지는 채소에 크림소스를 넣어\n은근히 볶는다.','MANUAL05'),(462,'6. 소스가 볶아지면, 마지막에 다져 놓은\n캐슈넛과 생크림, 모짜렐라치즈를\n넣고 한 번 더 익힌 후, 접시에 어린잎과,\n닭가슴살을 놓고, 크림소스를 곁들여\n완성한다.','MANUAL06'),(462,'','MANUAL07'),(462,'','MANUAL08'),(462,'','MANUAL09'),(462,'','MANUAL10'),(462,'','MANUAL11'),(462,'','MANUAL12'),(462,'','MANUAL13'),(462,'','MANUAL14'),(462,'','MANUAL15'),(462,'','MANUAL16'),(462,'','MANUAL17'),(462,'','MANUAL18'),(462,'','MANUAL19'),(462,'','MANUAL20'),(463,'1. 등심은 넓게 펴서 소금과 후춧가루를\n뿌려 준비한다.','MANUAL01'),(463,'2. 파프리카와 파인애플은 속을 제거하고\n약 7cm 길이로 썰어놓는다.','MANUAL02'),(463,'3. 시금치는 끓는 물에 데쳐 찬물에 헹구어\n준비한다.','MANUAL03'),(463,'4. 밑간을 해 놓은 등심에 준비한 파프리카와\n시금치 파인애플을 넣는다.','MANUAL04'),(463,'5. 채소와 파인애플을 넣은 등심에 치즈를\n넣고 돌돌말아 밀가루, 달걀물, 빵가루\n순서로 입혀 튀김기름 170~180℃에서\n약 3분 정도 튀겨 기름을 빼 놓는다.','MANUAL05'),(463,'6. 냄비에 칠리소소와 물, 설탕을 넣고\n바글바글 끓이다가 물녹말을 넣고\n한 번 더 끓인 후, 튀겨놓은 등심채소\n롤에 함께 뿌려 완성한다.','MANUAL06'),(463,'','MANUAL07'),(463,'','MANUAL08'),(463,'','MANUAL09'),(463,'','MANUAL10'),(463,'','MANUAL11'),(463,'','MANUAL12'),(463,'','MANUAL13'),(463,'','MANUAL14'),(463,'','MANUAL15'),(463,'','MANUAL16'),(463,'','MANUAL17'),(463,'','MANUAL18'),(463,'','MANUAL19'),(463,'','MANUAL20'),(464,'1. 유부는 1/4 정도를 잘라 준비한다.','MANUAL01'),(464,'2. 잘라진 유부는 끓는 물에 약 20초 정도\n데쳐 물기를 짜 놓는다.','MANUAL02'),(464,'3. 새우는 내장과 껍질을 제거 하고 곱게\n으깨 준비한다.','MANUAL03'),(464,'4. 배추와 미나리는 끓는 물에 데치고,\n표고버섯은 뜨거운 물에 불려 준비\n한다.','MANUAL04'),(464,'5. 데친 배추와 표고버섯을 입자있게\n다지고, 양파와 당근도 입자있게 다져\n준비한다.','MANUAL05'),(464,'6. 두부는 물기를 짜 놓은 후 새우(③)와\n다진 야채(⑤), 마늘, 소금, 후춧가루\n를 넣고 골고루 섞는다. 유부(②)에\n속을 넣고 미나리로 묶은 후, 끓는\n육수에 유부주머니를 넣고 간장으로\n간을 하여 완성한다.','MANUAL06'),(464,'','MANUAL07'),(464,'','MANUAL08'),(464,'','MANUAL09'),(464,'','MANUAL10'),(464,'','MANUAL11'),(464,'','MANUAL12'),(464,'','MANUAL13'),(464,'','MANUAL14'),(464,'','MANUAL15'),(464,'','MANUAL16'),(464,'','MANUAL17'),(464,'','MANUAL18'),(464,'','MANUAL19'),(464,'','MANUAL20'),(465,'1. 찹쌀과 현미는 깨끗이 씻어 30분 이상\n충분히 불려 밥을 지어, 둥글둥글하게\n패티를 만들어 놓는다.','MANUAL01'),(465,'2. 마늘과 양파는 곱게 다져 볶아 준비\n한다.','MANUAL02'),(465,'3. 다진고기에 볶은 양파와 마늘, 빵가루,\n생크림, 으깬두부, 소금, 후춧가루를\n넣어 골고루 섞는다.','MANUAL03'),(465,'4. 섞어진 소고기를 둥글게 패티를 만들어\n놓는다.','MANUAL04'),(465,'5. 토마토는 편으로 썰어 준비한다.','MANUAL05'),(465,'6. 팬에 올리브 오일과 버터를 넣고 팬이\n따끈하게 달궈지면, 밥패티를 먼저\n굽고, 소고기 패티를 구운 후, 밥패티에\n마요네즈를 살짝 바르고, 치즈와\n토마토를 올리고, 구운 소고기패티를\n올려 다시 밥패티를 덮어 완성한다.','MANUAL06'),(465,'','MANUAL07'),(465,'','MANUAL08'),(465,'','MANUAL09'),(465,'','MANUAL10'),(465,'','MANUAL11'),(465,'','MANUAL12'),(465,'','MANUAL13'),(465,'','MANUAL14'),(465,'','MANUAL15'),(465,'','MANUAL16'),(465,'','MANUAL17'),(465,'','MANUAL18'),(465,'','MANUAL19'),(465,'','MANUAL20'),(466,'1. 당근, 양파, 호박, 버섯은 입자있게\n다지고, 파인애플은 작은 깍뚝썰기로\n썰어 준비한다.','MANUAL01'),(466,'2. 닭고기살은 작게 썰어 팬에 저염간장과\n양파, 다진마늘, 올리고당을 넣어\n볶으면서 졸인다.','MANUAL02'),(466,'3. 팬에 버터를 녹인 후 준비한 밥을\n넣고 볶는다.','MANUAL03'),(466,'4. 볶은밥(③)에 썰어놓은 채소(①)를\n넣고, 다시 볶아준다.','MANUAL04'),(466,'5. 밥과 채소가 볶아지면, 닭고기살(②)을\n넣고, 토마토 페스트와 토마토를\n다져넣고 볶는다.','MANUAL05'),(466,'6. 파프리카의 속을 파내고, 그 안에\n볶아진 밥(⑤)을 넣고, 달걀물을\n씌우고 모짜렐라치즈를 뿌려 치즈가\n녹을 때까지 팬에 뚜껑을 덮어\n약불에서 익힌 후 파슬리가루를\n올려 완성한다.','MANUAL06'),(466,'','MANUAL07'),(466,'','MANUAL08'),(466,'','MANUAL09'),(466,'','MANUAL10'),(466,'','MANUAL11'),(466,'','MANUAL12'),(466,'','MANUAL13'),(466,'','MANUAL14'),(466,'','MANUAL15'),(466,'','MANUAL16'),(466,'','MANUAL17'),(466,'','MANUAL18'),(466,'','MANUAL19'),(466,'','MANUAL20'),(467,'1. 돼지등심을 넓게 피고 소금과 후춧가루\n올리브오일을 발라 숙성시킨다.','MANUAL01'),(467,'2. 우유를 끓이다가 레몬즙을 넣고 몽글\n거리면, 소창에 걸러 리코타치즈를\n만든다.','MANUAL02'),(467,'3. 양파와 토마토, 마늘, 사과는 입자있게\n다져 케첩을 섞어준다.','MANUAL03'),(467,'4. 숙성시킨 등심에 리코타치즈를\n올려준다.','MANUAL04'),(467,'5. 리코타치즈를 올린 등심에 다시 모짜렐\n라치즈를 넣고 등심을 다시 위에 올려,\n밀가루와 달걀물, 빵가루 순서로 입힌\n뒤 튀김온도 170~180℃에 약 3분 정도\n튀겨 기름을 빼 놓는다.','MANUAL05'),(467,'6. 냄비에 준비해 놓은 소스(③)를 넣고\n볶다가 돈가스 소스를 넣고 다시 한 번 더\n끓인 후 튀겨놓은 리코타돈가스(⑤)에\n곁들여 완성한다.','MANUAL06'),(467,'','MANUAL07'),(467,'','MANUAL08'),(467,'','MANUAL09'),(467,'','MANUAL10'),(467,'','MANUAL11'),(467,'','MANUAL12'),(467,'','MANUAL13'),(467,'','MANUAL14'),(467,'','MANUAL15'),(467,'','MANUAL16'),(467,'','MANUAL17'),(467,'','MANUAL18'),(467,'','MANUAL19'),(467,'','MANUAL20'),(468,'1. 보쌈용 삼겹살을 깨끗이 씻어 생강채와\n양파채, 월계수잎, 통후추와 소주를\n넣고 약 1시간 정도 숙성을 시킨다.','MANUAL01'),(468,'2. 찜통에 물과 된장, 편마늘을 넣고 숙성된\n삼겹살을 올려 약 50분 정도 찜을 하다가\n부추를 올려 1분 정도 더 찜을 한다.','MANUAL02'),(468,'3. 부추는 약 6cm 길이로 썰어 준비한다.','MANUAL03'),(468,'4. 홍고추는 반으로 갈라 씨를 제거하고,\n채를 썰어 놓는다.','MANUAL04'),(468,'5. 냄비에 간장과 물, 설탕, 올리고당,\n통후추, 생강을 넣고 은근히 끓인다.','MANUAL05'),(468,'6. 소스가 은근히 끓고 있을 때 채로 생강과\n통후추를 걸러내고, 물녹말을 풀어 한\n소큼 더 끓인 후, 찜통에서 쪄 나온 부추와\n삼겹살을 썰어 접시에 담고, 그 위에\n소스와 홍고추를 올려 완성한다.','MANUAL06'),(468,'','MANUAL07'),(468,'','MANUAL08'),(468,'','MANUAL09'),(468,'','MANUAL10'),(468,'','MANUAL11'),(468,'','MANUAL12'),(468,'','MANUAL13'),(468,'','MANUAL14'),(468,'','MANUAL15'),(468,'','MANUAL16'),(468,'','MANUAL17'),(468,'','MANUAL18'),(468,'','MANUAL19'),(468,'','MANUAL20'),(469,'1. 깨끗이 씻은 쌀에 물을 2배 정도 넣고\n약 30분 정도 충분히 불려 준비한다.','MANUAL01'),(469,'2. 전복은 수저를 이용하여 껍질에서\n떼어내어 내장을 분리해 놓는다.','MANUAL02'),(469,'3. 내장을 제거한 전복은 깨끗이 씻어,\n썰어 놓는다.','MANUAL03'),(469,'4. 새우살은 꼬리를 제거하고 입자있게\n썰어 놓는다.','MANUAL04'),(469,'5. 양송이는 껍질을 벗겨 입자있게\n썰고, 당근도 양송이 크기에 맞게\n썰어 놓는다.','MANUAL05'),(469,'6. 냄비에 참기름을 두르고, 전복을 은근히\n볶다가, 다시 불린 쌀을 넣고 볶은 뒤\n물을 넣고 약 20분 정도 끓인다. 죽이\n끓으면 새우와 양송이, 당근을 넣고\n은근히 저어가면서 다시 20분 정도\n더 끓여, 죽이 어우러지면 잣을 올리고\n저염간장을 함께 제공한다.','MANUAL06'),(469,'','MANUAL07'),(469,'','MANUAL08'),(469,'','MANUAL09'),(469,'','MANUAL10'),(469,'','MANUAL11'),(469,'','MANUAL12'),(469,'','MANUAL13'),(469,'','MANUAL14'),(469,'','MANUAL15'),(469,'','MANUAL16'),(469,'','MANUAL17'),(469,'','MANUAL18'),(469,'','MANUAL19'),(469,'','MANUAL20'),(470,'1. 오징어는 껍질을 벗겨 안 쪽으로 칼집을\n넣어 무늬를 만들어 놓는다.','MANUAL01'),(470,'2. 끓는 물에 소금을 넣고 미나리를 데쳐\n찬물에 헹구고, 바로 오징어를 데쳐\n준비한다.','MANUAL02'),(470,'3. 준비한 토마토 반은 굵게 다지고, 반은\n썰어서 접시에 돌려 담아놓는다.','MANUAL03'),(470,'4. 다진 토마토와 고추장, 식초, 생강즙,\n올리고당을 골고루 섞어 양념장을\n만든다.','MANUAL04'),(470,'5. 당근, 양파, 대파, 청 ․ 홍고추를 썰어\n놓는다.','MANUAL05'),(470,'6. 만들어 놓은 양념장에 데친 오징어와\n채소를 넣어 무친 후 토마토를 돌려\n담은 접시에 담아 통깨를 올려 완성한다.','MANUAL06'),(470,'','MANUAL07'),(470,'','MANUAL08'),(470,'','MANUAL09'),(470,'','MANUAL10'),(470,'','MANUAL11'),(470,'','MANUAL12'),(470,'','MANUAL13'),(470,'','MANUAL14'),(470,'','MANUAL15'),(470,'','MANUAL16'),(470,'','MANUAL17'),(470,'','MANUAL18'),(470,'','MANUAL19'),(470,'','MANUAL20'),(471,'1. 밀가루에 녹말가루와 식용유, 소금,\n달걀, 물을 넣고 반죽을 한다.','MANUAL01'),(471,'2. 반죽된 밀가루를 비닐에 넣고 숙성을\n시킨다.','MANUAL02'),(471,'3. 냄비에 건새우와 머리 ․ 내장을 제거한\n멸치, 양파, 다시마, 무, 통마늘을 넣고\n끓인 육수를 소창에 걸러 놓는다.','MANUAL03'),(471,'4. 호박은 반달로 썰고, 홍고추는 어슷\n썰어 준비한다.','MANUAL04'),(471,'5. 만들어 놓은 육수에 들깨 가루를 넣어\n끓인다.','MANUAL05'),(471,'6. 숙성된 밀가루(②)를 얇게 밀어 칼국수로\n만든 뒤 준비한 육수(⑤)를 한소끔 끓인\n후 칼국수와 호박을 넣어 끓이다가 다시\n홍고추를 넣고 한 번 더 끓여 완성한다.','MANUAL06'),(471,'','MANUAL07'),(471,'','MANUAL08'),(471,'','MANUAL09'),(471,'','MANUAL10'),(471,'','MANUAL11'),(471,'','MANUAL12'),(471,'','MANUAL13'),(471,'','MANUAL14'),(471,'','MANUAL15'),(471,'','MANUAL16'),(471,'','MANUAL17'),(471,'','MANUAL18'),(471,'','MANUAL19'),(471,'','MANUAL20'),(472,'1. 배는 껍질을 벗겨 배즙을 갈아 준비한다.','MANUAL01'),(472,'2. 소고기에 배즙과 정종을 넣어 버무려 숙성시킨다.','MANUAL02'),(472,'3. 양배추와 양파, 깻잎, 표고버섯은 채 썰고 대파와 당근은 납작하게 5cm 길이로 썰고 청·홍고추는 어슷 썰어 준비한다.','MANUAL03'),(472,'4. 간장과 올리고당, 참기름, 다진마늘, 후춧가루를 넣어 소스를 만든다.','MANUAL04'),(472,'5. 만든 소스를 소불고기에 넣어 2차 숙성을 시킨다.','MANUAL05'),(472,'6. 팬에 고기를 볶고 별도로 채소를 볶은 뒤 씨를 빼고 얇게 썬 대추와 통깨를 얹어 접시에 함께 담아 완성한다.','MANUAL06'),(472,'','MANUAL07'),(472,'','MANUAL08'),(472,'','MANUAL09'),(472,'','MANUAL10'),(472,'','MANUAL11'),(472,'','MANUAL12'),(472,'','MANUAL13'),(472,'','MANUAL14'),(472,'','MANUAL15'),(472,'','MANUAL16'),(472,'','MANUAL17'),(472,'','MANUAL18'),(472,'','MANUAL19'),(472,'','MANUAL20'),(473,'1. 멸치, 건새우, 무, 양파, 마늘을 넣고\n육수를 만들어 소창에 걸러 준비한다.','MANUAL01'),(473,'2. 홍합은 끓는 물에 살짝 데쳐 놓는다.','MANUAL02'),(473,'3. 숙주는 씻어 놓고 청경채는 반으로\n자르고 청 ․ 홍고추는 어슷썰어 준비\n한다.','MANUAL03'),(473,'4. 만들어 놓은 육수에 고춧가루와\n굴소스를 넣어 끓인다.','MANUAL04'),(473,'5. 달걀은 풀어 준비한다.','MANUAL05'),(473,'6. 육수(④)가 끓으면 라면을 넣고, 다시\n한 번 더 끓으면 홍합을 넣어 끓이다가,\n불을 줄인 뒤 달걀을 넣어 줄알을 치고,\n청경채와 숙주, 홍고추와 대파를 넣고\n살짝 끓은 뒤 그릇에 담아 완성한다.','MANUAL06'),(473,'','MANUAL07'),(473,'','MANUAL08'),(473,'','MANUAL09'),(473,'','MANUAL10'),(473,'','MANUAL11'),(473,'','MANUAL12'),(473,'','MANUAL13'),(473,'','MANUAL14'),(473,'','MANUAL15'),(473,'','MANUAL16'),(473,'','MANUAL17'),(473,'','MANUAL18'),(473,'','MANUAL19'),(473,'','MANUAL20'),(474,'1. 곤약은 끓는 물에 넣어 데친다.','MANUAL01'),(474,'2. 데친 곤약은 찬물에 헹구어 채에 받쳐\n물기를 빼 놓는다.','MANUAL02'),(474,'3. 무는 얇게 썰어 식초, 소금, 설탕에 넣어\n김치를 만든다.','MANUAL03'),(474,'4. 파프리카는 5cm 길이로 썰고, 배와\n오이도 같은 길이로 얇게 썬 뒤 오이는\n살짝 절인다.','MANUAL04'),(474,'5. 달걀은 삶아 껍질을 벗겨, 실로 잘라\n놓는다.','MANUAL05'),(474,'6. 동치미 국물에 배즙 , 홍초, 설탕 , 겨자,\n식초를 넣어 섞는다. 그릇에 곤약국수를\n담고, 무김치(③)와 준비한 채소(④)를\n올리고, 삶은 달걀(⑤)을 얹고, 국물을\n살며시 넣어 완성한다.','MANUAL06'),(474,'','MANUAL07'),(474,'','MANUAL08'),(474,'','MANUAL09'),(474,'','MANUAL10'),(474,'','MANUAL11'),(474,'','MANUAL12'),(474,'','MANUAL13'),(474,'','MANUAL14'),(474,'','MANUAL15'),(474,'','MANUAL16'),(474,'','MANUAL17'),(474,'','MANUAL18'),(474,'','MANUAL19'),(474,'','MANUAL20'),(475,'1. 돼지갈비는 물에 담그어 핏물을 충분히\n제거한다.','MANUAL01'),(475,'2. 홍고추는 어슷썰어 냄비에 볶는다.','MANUAL02'),(475,'3. 핏물을 제거한 돼지갈비를 홍고추와\n함께 넣어 볶아준다.','MANUAL03'),(475,'4. 배는 강판에 갈고, 파, 마늘, 생강은\n다진 뒤 간장과 올리고당, 설탕,\n후춧가루, 소주와 함께 넣고 골고루\n섞어서 양념장을 만든다.','MANUAL04'),(475,'5. 사과, 대추, 밤, 오이, 양파, 당근, 무는\n사각 깍둑 썰기로 준비한다.','MANUAL05'),(475,'6. 볶아진 갈비(③)에 양념장(④)과 물을\n넣고 은근히 갈비를 졸이다가, 국물이\n자작하게 남으면, 손질한 과일과 채소\n등(⑤)을 참기름과 함께 넣고, 한 번 더\n졸여 완성한다.','MANUAL06'),(475,'','MANUAL07'),(475,'','MANUAL08'),(475,'','MANUAL09'),(475,'','MANUAL10'),(475,'','MANUAL11'),(475,'','MANUAL12'),(475,'','MANUAL13'),(475,'','MANUAL14'),(475,'','MANUAL15'),(475,'','MANUAL16'),(475,'','MANUAL17'),(475,'','MANUAL18'),(475,'','MANUAL19'),(475,'','MANUAL20'),(476,'1. 닭은 먹기 좋은 크기로 잘라 준비한다.','MANUAL01'),(476,'2. 토막 낸 닭 에 생강즙과 소주를 넣어\n숙성한다.','MANUAL02'),(476,'3. 양파, 당근은 얇게 썰고, 양배추는 깍뚝\n썰고, 깻잎은 4등분하여 잘라놓는다.','MANUAL03'),(476,'4. 작은 깍둑썰기로 자른 토마토와\n고구마에 토마토소스, 마늘, 고춧가루,\n고추장, 매실청을 넣어 골고루 섞는다.','MANUAL04'),(476,'5. 닭을 먼저 냄비에 볶는다.','MANUAL05'),(476,'6. 볶아지는 닭에 만들어 놓은 소스를\n넣고, 볶다가 준비한 채소를 넣어 한 번\n더 볶아 완성한다.','MANUAL06'),(476,'','MANUAL07'),(476,'','MANUAL08'),(476,'','MANUAL09'),(476,'','MANUAL10'),(476,'','MANUAL11'),(476,'','MANUAL12'),(476,'','MANUAL13'),(476,'','MANUAL14'),(476,'','MANUAL15'),(476,'','MANUAL16'),(476,'','MANUAL17'),(476,'','MANUAL18'),(476,'','MANUAL19'),(476,'','MANUAL20'),(477,'1. 골뱅이는 뜨거운 물에 살짝 데친 뒤\n물기를 빼고 4등분으로 썬다.','MANUAL01'),(477,'2. 양파와 깻잎은 채썰고, 당근은 양파랑\n같은 길이로 얇게 저미고, 고추와\n대파는 어슷썰고, 양배추는 1~2cm\n두께로 썬다.','MANUAL02'),(477,'3. 사과와 배는 채를 썰고 황도와 바나나,\n파인애플은 작게 깍둑썰기 한다.','MANUAL03'),(477,'4. 고추장에 고춧가루, 다진 마늘, 케첩,\n설탕, 식초, 매실액, 생강즙, 참기름을\n골고루 섞어 양념장을 만든다.','MANUAL04'),(477,'5. 양념장에 준비한 골뱅이(①), 채소(②),\n과일(③)을 넣고 고루 섞은 뒤 통깨를\n얹어 완성한다.','MANUAL05'),(477,'','MANUAL06'),(477,'','MANUAL07'),(477,'','MANUAL08'),(477,'','MANUAL09'),(477,'','MANUAL10'),(477,'','MANUAL11'),(477,'','MANUAL12'),(477,'','MANUAL13'),(477,'','MANUAL14'),(477,'','MANUAL15'),(477,'','MANUAL16'),(477,'','MANUAL17'),(477,'','MANUAL18'),(477,'','MANUAL19'),(477,'','MANUAL20'),(478,'1. 표고버섯은 뜨거운 물에 약 1시간 정도\n불려 다지듯이 썬다.','MANUAL01'),(478,'2. 마는 껍질을 벗겨 썰어서 갈아주고,\n연근은 껍질을 벗겨 팬에 굽는다.','MANUAL02'),(478,'3. 애호박은 반달모양으로 썰어 끓는 물에\n감자와 함께 데친다.','MANUAL03'),(478,'4. 소고기와 돼지고기는 곱게 다져\n저염간장, 설탕, 다진마늘 및 간 마를\n넣고 골고루 치대어 떡갈비를 만들고,\n팬에 기름을 두르고 앞뒤로 굽는다','MANUAL04'),(478,'5. 깻잎은 저염간장에 살짝 절인다','MANUAL05'),(478,'6. 구워 놓은 떡갈비와 깻잎, 표고버섯,\n연근, 애호박 및 감자를 접시에 담고 간\n마와 두유를 섞어 자작하게 끓여 만든\n소스를 그 밑에 담아 완성한다','MANUAL06'),(478,'','MANUAL07'),(478,'','MANUAL08'),(478,'','MANUAL09'),(478,'','MANUAL10'),(478,'','MANUAL11'),(478,'','MANUAL12'),(478,'','MANUAL13'),(478,'','MANUAL14'),(478,'','MANUAL15'),(478,'','MANUAL16'),(478,'','MANUAL17'),(478,'','MANUAL18'),(478,'','MANUAL19'),(478,'','MANUAL20'),(479,'1. 떡볶이떡은 잘게 다진다.','MANUAL01'),(479,'2. 현미, 흑미, 백미 및 조는 깨끗이 씻어\n물에 불린다.','MANUAL02'),(479,'3. 소고기와 돼지고기에 소금, 다진 마늘,\n설탕 및 참기름을 넣고 양념한다','MANUAL03'),(479,'4. 당근과 호박은 잘게 다진다','MANUAL04'),(479,'5. 달걀은 황백으로 나눠 지단을 부친다.','MANUAL05'),(479,'6. 불린 쌀로 밥을 짓고, 밥과 3번과 4번을\n섞어 미니 떡갈비를 만들어 팬에\n기름을 두르고 익힌 뒤 황백지단으로\n장식한다.','MANUAL06'),(479,'','MANUAL07'),(479,'','MANUAL08'),(479,'','MANUAL09'),(479,'','MANUAL10'),(479,'','MANUAL11'),(479,'','MANUAL12'),(479,'','MANUAL13'),(479,'','MANUAL14'),(479,'','MANUAL15'),(479,'','MANUAL16'),(479,'','MANUAL17'),(479,'','MANUAL18'),(479,'','MANUAL19'),(479,'','MANUAL20'),(480,'1. 연어는 깍둑 썰기한다.','MANUAL01'),(480,'2. 냄비에 우유를 넣고 은근히 끓이다가\n레몬즙과 소금을 넣고 뭉글거리게\n한다.','MANUAL02'),(480,'3. 뭉글거리는 우유를 체에 걸러\n리코타치즈를 만든다','MANUAL03'),(480,'4. 토마토, 아보카도, 오이 및 파인애플은\n주사위 모양으로 썬다.','MANUAL04'),(480,'5. 어린잎은 찬물에 담궈 싱싱해지면\n물에서 건져 놓는다','MANUAL05'),(480,'6. 오렌지와 파인애플은 즙을 만들어\n리코타치즈와 섞어 소스를 만들고,\n연어와 야채를 담은 뒤 그 위에 소스를\n올린다.','MANUAL06'),(480,'','MANUAL07'),(480,'','MANUAL08'),(480,'','MANUAL09'),(480,'','MANUAL10'),(480,'','MANUAL11'),(480,'','MANUAL12'),(480,'','MANUAL13'),(480,'','MANUAL14'),(480,'','MANUAL15'),(480,'','MANUAL16'),(480,'','MANUAL17'),(480,'','MANUAL18'),(480,'','MANUAL19'),(480,'','MANUAL20'),(481,'1. 아몬드는 곱게 갈아 체에 내려\n준비한다.','MANUAL01'),(481,'2. 달걀흰자로 머랭을 만들어 짤주머니로\n짜준 후 20분 정도 말리고 오븐에\n13분간 구워 마카롱을 만든다.','MANUAL02'),(481,'3. 냄비에 설탕, 물엿, 소금을 넣고\n끓인다.','MANUAL03'),(481,'4. 달걀노른자, 설탕, 우유 및 생크림을\n끓이다가 망고퓨레를 넣고 섞는다','MANUAL04'),(481,'5. 판젤라틴은 물에 불려 중탕으로 녹여\n4에 섞고, 차갑게 휘핑한 생크림을\n넣는다.','MANUAL05'),(481,'6. 5를 틀에 굳힌 후, 접시에 담고\n마카롱으로 장식한다.','MANUAL06'),(481,'','MANUAL07'),(481,'','MANUAL08'),(481,'','MANUAL09'),(481,'','MANUAL10'),(481,'','MANUAL11'),(481,'','MANUAL12'),(481,'','MANUAL13'),(481,'','MANUAL14'),(481,'','MANUAL15'),(481,'','MANUAL16'),(481,'','MANUAL17'),(481,'','MANUAL18'),(481,'','MANUAL19'),(481,'','MANUAL20'),(482,'1. 감자는 삶아 껍질을 벗긴다','MANUAL01'),(482,'2. 새우와 관자는 끓는 물에 레몬즙을\n넣고 삶아 건져 껍질을 벗긴다.','MANUAL02'),(482,'3. 오이, 당근, 단호박은 껍질을 벗겨\n슬라이스 썬다.','MANUAL03'),(482,'4. 데친 관자는 토치로 한 번 더 익혀 썬다','MANUAL04'),(482,'5. 믹서에 간 망고와 레몬에 설탕, 소금을\n약간 넣고 소스를 만든다.','MANUAL05'),(482,'6. 토마토는 먹기 좋은 크기로 자르고,\n접시에 준비한 야채와 해산물을 담고,\n소스는 먹기 직전에 올린다','MANUAL06'),(482,'','MANUAL07'),(482,'','MANUAL08'),(482,'','MANUAL09'),(482,'','MANUAL10'),(482,'','MANUAL11'),(482,'','MANUAL12'),(482,'','MANUAL13'),(482,'','MANUAL14'),(482,'','MANUAL15'),(482,'','MANUAL16'),(482,'','MANUAL17'),(482,'','MANUAL18'),(482,'','MANUAL19'),(482,'','MANUAL20'),(483,'1. 닭은 살만 발라낸다.','MANUAL01'),(483,'2. 준비한 닭살에 소금, 후춧가루,\n올리브오일을 발라 마리네이드 한다','MANUAL02'),(483,'3. 양파와 버섯은 입자있게 다진다.','MANUAL03'),(483,'4. 냄비에 버터를 넣고 녹인다.','MANUAL04'),(483,'5. 녹인 버터에 다져 놓은 야채를 볶다가\n발사믹소스를 넣고 바글바글 끓여\n소스를 만든다.','MANUAL05'),(483,'6. 팬에 버터와 기름을 넣고 중불에서\n마리네이드한 닭살을 익혀 스테이크를\n만들고, 미니양배추를 팬에 굴려가며\n익혀 접시에 담은 뒤 소스를 올린다','MANUAL06'),(483,'','MANUAL07'),(483,'','MANUAL08'),(483,'','MANUAL09'),(483,'','MANUAL10'),(483,'','MANUAL11'),(483,'','MANUAL12'),(483,'','MANUAL13'),(483,'','MANUAL14'),(483,'','MANUAL15'),(483,'','MANUAL16'),(483,'','MANUAL17'),(483,'','MANUAL18'),(483,'','MANUAL19'),(483,'','MANUAL20'),(484,'1. 미역은 찬물에 충분히 불린다.','MANUAL01'),(484,'2. 새우는 껍질을 벗겨 관자 한 개와 다져\n완자를 만든다.','MANUAL02'),(484,'3. 나머지 관자 한 개는 썰어 팬에 굽는다','MANUAL03'),(484,'4. 버섯, 토마토, 블랙올리브는 곱게\n다진다.','MANUAL04'),(484,'5. 시금치와 미역은 끓는 물에 데쳐 잘게\n썬다.','MANUAL05'),(484,'6. 마늘을 다져 우유와 함께 끓이다가\n썰어 놓은 미역과 시금치, 새우완자를\n넣고 한소끔 끓인다.','MANUAL06'),(484,'','MANUAL07'),(484,'','MANUAL08'),(484,'','MANUAL09'),(484,'','MANUAL10'),(484,'','MANUAL11'),(484,'','MANUAL12'),(484,'','MANUAL13'),(484,'','MANUAL14'),(484,'','MANUAL15'),(484,'','MANUAL16'),(484,'','MANUAL17'),(484,'','MANUAL18'),(484,'','MANUAL19'),(484,'','MANUAL20'),(485,'1. 감자는 껍질을 벗겨 슬라이스로 썰어\n찬물에 담궈 전분을 빼고 건져 물기를\n제거한다.','MANUAL01'),(485,'2. 토마토, 양파, 새송이버섯. 표고버섯은\n입자있게 다지고, 당근은 샤또\n모양으로 썰어 준비한다.','MANUAL02'),(485,'3. 오리 가슴살은 소금, 후춧가루로\n밑간을 한다.','MANUAL03'),(485,'4. 팬에 올리브오일을 두르고\n마리네이드한 오리 가슴살을 넣고 구워\n기름이 빠지면 접시에 담는다.','MANUAL04'),(485,'5. 오리 가슴살을 구운 팬에\n아스파라거스, 당근, 감자를 구워\n접시에 담는다.','MANUAL05'),(485,'6. 냄비 또는 팬에 다진 야채를 넣고\n볶다가 발사믹소스를 넣고 졸여 소스를\n만들고, 접시에 담아 놓은 오리\n스테이크에 올린다.','MANUAL06'),(485,'','MANUAL07'),(485,'','MANUAL08'),(485,'','MANUAL09'),(485,'','MANUAL10'),(485,'','MANUAL11'),(485,'','MANUAL12'),(485,'','MANUAL13'),(485,'','MANUAL14'),(485,'','MANUAL15'),(485,'','MANUAL16'),(485,'','MANUAL17'),(485,'','MANUAL18'),(485,'','MANUAL19'),(485,'','MANUAL20'),(486,'1. 감자는 삶아 껍질을 벗긴다.','MANUAL01'),(486,'2. 아스파라거스는 2등분 하고,\n방울토마토와 함께 끓는 물에 살짝\n데친다.','MANUAL02'),(486,'3. 닭고기에 소금, 후추, 배즙을 넣고 숙성\n시킨다.','MANUAL03'),(486,'4. 저염간장에 다진 마늘, 설탕, 후춧가루,\n참기름을 넣고 양념장을 만들어 3번에\n묻혀 굽는다','MANUAL04'),(486,'5. 흑미는 충분히 불려 밥을 짓는다','MANUAL05'),(486,'6. 깻잎은 간장, 식초, 설탕에 절여\n흑미밥과 너비아니 구이를 넣고 돌돌\n말아 쌈밥을 만든다','MANUAL06'),(486,'','MANUAL07'),(486,'','MANUAL08'),(486,'','MANUAL09'),(486,'','MANUAL10'),(486,'','MANUAL11'),(486,'','MANUAL12'),(486,'','MANUAL13'),(486,'','MANUAL14'),(486,'','MANUAL15'),(486,'','MANUAL16'),(486,'','MANUAL17'),(486,'','MANUAL18'),(486,'','MANUAL19'),(486,'','MANUAL20'),(487,'1. 쌀가루와 밀가루를 섞어 체에 내린다.','MANUAL01'),(487,'2. 냄비에 막걸리를 붓고 끓인다','MANUAL02'),(487,'3. 끓인 막걸리를 체 친 쌀가루와\n밀가루에 섞어 반죽을 만들고 치대어\n숙성시킨다.','MANUAL03'),(487,'4. 배는 1/8등분으로 썰어 양쪽모서리를\n돌려 깎아 통후추를 꽂는다.','MANUAL04'),(487,'5. 1을 넓게 펴서 주먹밥을 얹고 감싼다.','MANUAL05'),(487,'6. 숙성시킨 반죽을 둥그렇게 빚어 팬에\n굽고, 다 익으면 접시에 담은 뒤 꿀을\n위에 올린다.','MANUAL06'),(487,'','MANUAL07'),(487,'','MANUAL08'),(487,'','MANUAL09'),(487,'','MANUAL10'),(487,'','MANUAL11'),(487,'','MANUAL12'),(487,'','MANUAL13'),(487,'','MANUAL14'),(487,'','MANUAL15'),(487,'','MANUAL16'),(487,'','MANUAL17'),(487,'','MANUAL18'),(487,'','MANUAL19'),(487,'','MANUAL20'),(488,'1. 배춧잎을 물에 담궈 싱싱하게 한다','MANUAL01'),(488,'2. 레몬은 슬라이스로 썬다.','MANUAL02'),(488,'3. 레몬, 고추장, 설탕 및 매실액을 넣고\n양념장을 만든다.','MANUAL03'),(488,'4. 파프리카는 작은 사각형 모양으로\n자른다.','MANUAL04'),(488,'5. 관자는 끓는 물에 소금을 넣고 데친다.','MANUAL05'),(488,'6. 관자는 프라이팬에 구운 뒤 잘게 썰어\n파프리카와 섞어 배춧잎에 올리고, 그\n위에 파슬리와 만들어 놓은 양념장을\n먹기 직전에 올린다.','MANUAL06'),(488,'','MANUAL07'),(488,'','MANUAL08'),(488,'','MANUAL09'),(488,'','MANUAL10'),(488,'','MANUAL11'),(488,'','MANUAL12'),(488,'','MANUAL13'),(488,'','MANUAL14'),(488,'','MANUAL15'),(488,'','MANUAL16'),(488,'','MANUAL17'),(488,'','MANUAL18'),(488,'','MANUAL19'),(488,'','MANUAL20'),(489,'1. 밀가루에 버터, 달걀을 넣고 골고루\n반죽한 뒤 비닐봉투에 넣고\n숙성시킨다.','MANUAL01'),(489,'2. 안심과 두부는 잘게 썬다','MANUAL02'),(489,'3. 단호박은 씨를 제거하고 삶아 다진다','MANUAL03'),(489,'4. 양파, 당근, 마늘은 곱게 다져 안심,\n두부와 섞고 소금을 약간 넣는다.','MANUAL04'),(489,'5. 야채를 섞은 안심과 두부는 다진\n단호박을 섞어 깻잎으로 먼저 감싼다.','MANUAL05'),(489,'6. 숙성된 반죽을 밀대로 밀어 5번을 감싼\n뒤 오븐에 넣고 25분 정도 굽는다.','MANUAL06'),(489,'','MANUAL07'),(489,'','MANUAL08'),(489,'','MANUAL09'),(489,'','MANUAL10'),(489,'','MANUAL11'),(489,'','MANUAL12'),(489,'','MANUAL13'),(489,'','MANUAL14'),(489,'','MANUAL15'),(489,'','MANUAL16'),(489,'','MANUAL17'),(489,'','MANUAL18'),(489,'','MANUAL19'),(489,'','MANUAL20'),(490,'1. 닭가슴살은 곱게 다진다','MANUAL01'),(490,'2. 시금치와 브로콜리는 끓는 물에 데쳐\n찬물에 헹구고 토마토와 함께 입자있게\n다져 다진 닭가슴살과 섞는다.','MANUAL02'),(490,'3. 닭가슴살에 치즈를 섞는다.','MANUAL03'),(490,'4. 고구마는 찜통에 넣고 쪄서 체에\n내린다.','MANUAL04'),(490,'5. 냄비에 물, 복분자, 고구마를 넣고\n끓인다.','MANUAL05'),(490,'6. 5번에 전분을 넣고 걸죽하게 소스를\n완성하고, 아스파라거스와 버섯은\n팬에 구워 쪄낸 닭테린 옆에 담은 뒤\n소스를 올린다.','MANUAL06'),(490,'','MANUAL07'),(490,'','MANUAL08'),(490,'','MANUAL09'),(490,'','MANUAL10'),(490,'','MANUAL11'),(490,'','MANUAL12'),(490,'','MANUAL13'),(490,'','MANUAL14'),(490,'','MANUAL15'),(490,'','MANUAL16'),(490,'','MANUAL17'),(490,'','MANUAL18'),(490,'','MANUAL19'),(490,'','MANUAL20'),(491,'1. 양파, 오이피클, 고추피클은 입자있게\n다진다.','MANUAL01'),(491,'2. 다진 양파와 피클에 마요네즈를 넣고\n골고루 섞어 소스를 만든다.','MANUAL02'),(491,'3. 마요네즈소스에 꿀을 넣고 섞는다','MANUAL03'),(491,'4. 관자의 앞뒤에 버터를 바른다.','MANUAL04'),(491,'5. 관자에는 버터를 발라 팬에 구워\n접시에 담는다.','MANUAL05'),(491,'6. 비트, 양파, 데친 시금치를 넣고 갈아서\n소스를 만들고 관자에 마요네즈소스와\n시금치소스를 올린다','MANUAL06'),(491,'','MANUAL07'),(491,'','MANUAL08'),(491,'','MANUAL09'),(491,'','MANUAL10'),(491,'','MANUAL11'),(491,'','MANUAL12'),(491,'','MANUAL13'),(491,'','MANUAL14'),(491,'','MANUAL15'),(491,'','MANUAL16'),(491,'','MANUAL17'),(491,'','MANUAL18'),(491,'','MANUAL19'),(491,'','MANUAL20'),(492,'1. 훈제 연어는 슬라이스로 썰어서\n굽는다.','MANUAL01'),(492,'2. 사과는 채썬다.','MANUAL02'),(492,'3. 판젤라티은 찬물에 담궈 불린 후\n중탕해서 녹인다.','MANUAL03'),(492,'4. 석류주스를 끓인 뒤 중탕한 젤라틴을\n넣고 굳혀 접시에 담는다.','MANUAL04'),(492,'5. 애호박은 껍질을 벗겨 끓는 물에\n소금을 넣고 살짝 데치고, 새우는 살짝\n데쳐 껍질을 벗겨 포를 뜬 뒤 다시\n굽는다.','MANUAL05'),(492,'6. 석류주스 젤리가 담긴 접시에 새우와\n애호박을 담고 소스를 올린 뒤 연어와\n사과, 호박을 올려 담는다.','MANUAL06'),(492,'','MANUAL07'),(492,'','MANUAL08'),(492,'','MANUAL09'),(492,'','MANUAL10'),(492,'','MANUAL11'),(492,'','MANUAL12'),(492,'','MANUAL13'),(492,'','MANUAL14'),(492,'','MANUAL15'),(492,'','MANUAL16'),(492,'','MANUAL17'),(492,'','MANUAL18'),(492,'','MANUAL19'),(492,'','MANUAL20'),(493,'1. 엿기름은 물을 넣고 주물럭거린다','MANUAL01'),(493,'2. 엿기름에 맑은 물이 생기면 채에\n걸러내어 밥을 넣고 3시간 정도 발효를\n시켜 밥알이 떠오르면 설탕을 넣고\n끓인다.','MANUAL02'),(493,'3. 한천은 물을 넣고 불린다','MANUAL03'),(493,'4. 식혜에 불린 한천을 넣고 틀에 담아\n굳힌다.','MANUAL04'),(493,'5. 미숫가루에 밀가루, 버터, 설탕을 섞고\n살짝 끓여 잼을 만든다.','MANUAL05'),(493,'6. 찹쌀가루에 뜨거운 막걸리와 백년초를\n넣고 익반죽 후 찜통에 쪄서\n수박모양의 증편을 만들고 식혜, 양갱,\n버터 잼과 함께 담는다.','MANUAL06'),(493,'','MANUAL07'),(493,'','MANUAL08'),(493,'','MANUAL09'),(493,'','MANUAL10'),(493,'','MANUAL11'),(493,'','MANUAL12'),(493,'','MANUAL13'),(493,'','MANUAL14'),(493,'','MANUAL15'),(493,'','MANUAL16'),(493,'','MANUAL17'),(493,'','MANUAL18'),(493,'','MANUAL19'),(493,'','MANUAL20'),(494,'1. 물 1컵 반에 국멸치와 건다시마를 넣고 멸치다시마국물 1컵을 낸다.','MANUAL01'),(494,'2. 호박잎은 줄기를 꺾으며 잡아당겨 실 같은 껍질을 벗기고 씻는다.','MANUAL02'),(494,'3. 멸치다시마국물 1컵에 된장을 풀고 씻은 다슬기살을 함께 넣어 중불에서 5분정도 국물을 우려낸다.','MANUAL03'),(494,'4. 국물낸 다슬기는 건져 달걀물과 함께 섞는다.','MANUAL04'),(494,'5. 부추는 1cm 가량의 크기로 썰고 대파는 어슷썰기 한다.','MANUAL05'),(494,'6. 국물이 끓어 오르면 호박잎과 부추, 파, 다진 마늘을 넣고 마지막으로 달걀물을 입힌 다슬기를 살포시 넣는다.','MANUAL06'),(494,'','MANUAL07'),(494,'','MANUAL08'),(494,'','MANUAL09'),(494,'','MANUAL10'),(494,'','MANUAL11'),(494,'','MANUAL12'),(494,'','MANUAL13'),(494,'','MANUAL14'),(494,'','MANUAL15'),(494,'','MANUAL16'),(494,'','MANUAL17'),(494,'','MANUAL18'),(494,'','MANUAL19'),(494,'','MANUAL20'),(495,'1. 양배추는 씻어 잎을 넓게 뗀 후 7×12cm 가량의 크기로 자른다.','MANUAL01'),(495,'2. 자른 양배추는 김이 오른 찜통에 5분 정도 찐다.','MANUAL02'),(495,'3. 당근, 양파, 표고버섯은 곱게 다지고 두부는 으깨 면보에 짠다','MANUAL03'),(495,'4. 다진 돼지고기에 파, 다진 마늘, 참기름, 설탕, 소금, 후춧가루를 넣고 양념을 한 후 2의 재료와 섞는다.','MANUAL04'),(495,'5. 찐 양배추에 밀가루를 뿌리고 3의 재료를 놓고 돌돌 감아 찜통에 찐다.','MANUAL05'),(495,'6. 소스는 다진 양파와 마늘을 먼저 볶아 향을 낸 후 토마토케첩, 간장, 매실액을 넣어 만든다.','MANUAL06'),(495,'','MANUAL07'),(495,'','MANUAL08'),(495,'','MANUAL09'),(495,'','MANUAL10'),(495,'','MANUAL11'),(495,'','MANUAL12'),(495,'','MANUAL13'),(495,'','MANUAL14'),(495,'','MANUAL15'),(495,'','MANUAL16'),(495,'','MANUAL17'),(495,'','MANUAL18'),(495,'','MANUAL19'),(495,'','MANUAL20'),(496,'1. 당근, 적채, 깻잎, 양배추는 씻어 4~5cm 가량으로 채 썬다.','MANUAL01'),(496,'2. 수박의 과육과 흰부분의 껍질은 4~5cm 가량으로 채 썬다.','MANUAL02'),(496,'3. 소면은 끓는 물에 넣고 끓어오르면 소량의 찬물을 붓고 다시 한 번 끓이고 속까지 익으면 재빨리 찬물에 헹구어 채반에 건진다.','MANUAL03'),(496,'4. 달걀은 황백지단을 부쳐 채 썬다.','MANUAL04'),(496,'5. 수박과 양파를 강판에 갈고 고추장, 고춧가루, 참기름, 다진 파, 다진 마늘, 식초, 매실액, 통깨를 넣어 수박고추장양념소스를 만든다.','MANUAL05'),(496,'6. 소면에 수박고추장양념소스를 넣어 비비고 지단을 올린다.','MANUAL06'),(496,'','MANUAL07'),(496,'','MANUAL08'),(496,'','MANUAL09'),(496,'','MANUAL10'),(496,'','MANUAL11'),(496,'','MANUAL12'),(496,'','MANUAL13'),(496,'','MANUAL14'),(496,'','MANUAL15'),(496,'','MANUAL16'),(496,'','MANUAL17'),(496,'','MANUAL18'),(496,'','MANUAL19'),(496,'','MANUAL20'),(497,'1. 오징어는 내장을 제거하고 깨끗하고 씻어낸다.','MANUAL01'),(497,'2. 부추, 감자, 당근, 양파는 2cm 가량으로 곱게 채 썬다.','MANUAL02'),(497,'3. 부침가루와 미숫가루를 3 : 1의 비율로 섞는다.','MANUAL03'),(497,'4.  1, 2, 3에 물을 넣어 반죽하고 소금으로 간을 한다.','MANUAL04'),(497,'5. 팬에 현미유를 두르고 3의 반죽을 둥글게 떠 넣어 노릇노릇하게 지진다.','MANUAL05'),(497,'6. 그릇에 담아 완성한다.','MANUAL06'),(497,'','MANUAL07'),(497,'','MANUAL08'),(497,'','MANUAL09'),(497,'','MANUAL10'),(497,'','MANUAL11'),(497,'','MANUAL12'),(497,'','MANUAL13'),(497,'','MANUAL14'),(497,'','MANUAL15'),(497,'','MANUAL16'),(497,'','MANUAL17'),(497,'','MANUAL18'),(497,'','MANUAL19'),(497,'','MANUAL20'),(498,'1. 양파는 갈고 애호박과 풋고추는 잘게 다진다.','MANUAL01'),(498,'2. 물 1/2컵에 고추장을 풀고 우리밀가루를 넣어 골고루 섞는다.','MANUAL02'),(498,'3. 1의 재료를 2에 넣어 반죽한다.','MANUAL03'),(498,'4. 팬에 현미유를 두르고 3의 재료를 얇게 부친다.','MANUAL04'),(498,'5. 밥에 참기름과 흑임자, 소금을 넣고 양념을 한다.','MANUAL05'),(498,'6. 애호박장떡에 양념한 밥을 얇게 펴놓고 돌돌 말아 2~3cm 가량의 길이로 자른다.','MANUAL06'),(498,'','MANUAL07'),(498,'','MANUAL08'),(498,'','MANUAL09'),(498,'','MANUAL10'),(498,'','MANUAL11'),(498,'','MANUAL12'),(498,'','MANUAL13'),(498,'','MANUAL14'),(498,'','MANUAL15'),(498,'','MANUAL16'),(498,'','MANUAL17'),(498,'','MANUAL18'),(498,'','MANUAL19'),(498,'','MANUAL20'),(499,'1. 쌀은 불린 후 밥을 짓는다.','MANUAL01'),(499,'2. 고사리는 끓는 물에 삶고, 잘게 썬 파프리카는 고사리 삶는 물에 살짝 데친다.','MANUAL02'),(499,'3. 고사리 삶는 중간에 취나물을 넣어 함께 데친다.','MANUAL03'),(499,'4. 고사리와 취나물은 잘게 썬다 .','MANUAL04'),(499,'5. 파프리카, 고사리, 취나물에 참기름, 마늘, 소금, 통깨를 넣고 양념을 한다.','MANUAL05'),(499,'6. 밥에 참기름, 통깨, 소금을 넣어 양념한 후 4의 재료를 섞어 주먹밥을 만든다.','MANUAL06'),(499,'','MANUAL07'),(499,'','MANUAL08'),(499,'','MANUAL09'),(499,'','MANUAL10'),(499,'','MANUAL11'),(499,'','MANUAL12'),(499,'','MANUAL13'),(499,'','MANUAL14'),(499,'','MANUAL15'),(499,'','MANUAL16'),(499,'','MANUAL17'),(499,'','MANUAL18'),(499,'','MANUAL19'),(499,'','MANUAL20'),(500,'1. 두부는 5cm× 1.5cm× 1cm 크기로 썬다.','MANUAL01'),(500,'2. 썰어논 두부는 기름을 두르지 않고 팬에 노릇노릇 굽는다 .','MANUAL02'),(500,'3. 달래는 2cm 가량의 크기로 썬다 .','MANUAL03'),(500,'4. 배추김치는 물기를 적당히 짜고 2cm 가량으로 가늘게 채썬다 .','MANUAL04'),(500,'5. 홍피망은 2cm 가량으로 가늘게 채썰고 3, 4와 파, 마늘, 설탕, 참기름, 통깨, 고춧가루, 소금을 넣고 조물조물 무친다.','MANUAL05'),(500,'6. 두부위에 5의 김치달래무침을 곁들인다.','MANUAL06'),(500,'','MANUAL07'),(500,'','MANUAL08'),(500,'','MANUAL09'),(500,'','MANUAL10'),(500,'','MANUAL11'),(500,'','MANUAL12'),(500,'','MANUAL13'),(500,'','MANUAL14'),(500,'','MANUAL15'),(500,'','MANUAL16'),(500,'','MANUAL17'),(500,'','MANUAL18'),(500,'','MANUAL19'),(500,'','MANUAL20'),(501,'1. 닭가슴살을 삶는 뜨거운 물에 데친다.','MANUAL01'),(501,'2. 닭가슴살 데친물에 브로콜리도 살짝 데친다.','MANUAL02'),(501,'3. 닭가슴살은 고기결을 따라 잘게 찢는다.','MANUAL03'),(501,'4. 양상추는 손으로 잘게 찢고 적채, 파프리카는 2cm가량으로 채 썰고 방울토마토는 반으로 자른다.','MANUAL04'),(501,'5. 딸기를 강판에 갈아 호상요구르트와 호두, 소금을 넣어 드레싱을 만든다.','MANUAL05'),(501,'6. 2, 3의 재료를 접시에 담아 딸기드레싱과 곁들인다.','MANUAL06'),(501,'','MANUAL07'),(501,'','MANUAL08'),(501,'','MANUAL09'),(501,'','MANUAL10'),(501,'','MANUAL11'),(501,'','MANUAL12'),(501,'','MANUAL13'),(501,'','MANUAL14'),(501,'','MANUAL15'),(501,'','MANUAL16'),(501,'','MANUAL17'),(501,'','MANUAL18'),(501,'','MANUAL19'),(501,'','MANUAL20'),(502,'1. 쑥을 잘게 썬다.','MANUAL01'),(502,'2. 당근을 잘게 다진다.','MANUAL02'),(502,'3. 호두를 칼로 부순다.','MANUAL03'),(502,'4. 달걀을 그릇에 깨뜨려 넣고 소금을 넣어 섞은 후 1,2,3의 재료를 섞는다 .','MANUAL04'),(502,'5. 달군 팬에 기름을 두르고 달걀물을 부어 반숙이 되면 말아서 두툼하게 만든 뒤 약한 불에서 아래, 위, 양옆으로 뒤집어가며 속까지 익힌다 .','MANUAL05'),(502,'6. 한입 크기로 썰어 그릇에 담는다.','MANUAL06'),(502,'','MANUAL07'),(502,'','MANUAL08'),(502,'','MANUAL09'),(502,'','MANUAL10'),(502,'','MANUAL11'),(502,'','MANUAL12'),(502,'','MANUAL13'),(502,'','MANUAL14'),(502,'','MANUAL15'),(502,'','MANUAL16'),(502,'','MANUAL17'),(502,'','MANUAL18'),(502,'','MANUAL19'),(502,'','MANUAL20'),(503,'1. 무청을 찬물에 담궈 잡냄새를 제거한다.','MANUAL01'),(503,'2. 무청의 물기를 짠다.','MANUAL02'),(503,'3.  물기를 뺀 무청은 적당한 크기로 송송 썰어준다.','MANUAL03'),(503,'4. 무청에 된장, 다진 마늘, 생강즙을 넣어 조물조물 무친다.','MANUAL04'),(503,'5. 팬에 포도씨유를 두르고 양념한 무청을 넣고 볶는다.','MANUAL05'),(503,'6. 밥을 넣고 함께 볶다가 생크림과 버터를 넣고 맛이 어우러지도록 잠시 더 볶아 완성한다.','MANUAL06'),(503,'','MANUAL07'),(503,'','MANUAL08'),(503,'','MANUAL09'),(503,'','MANUAL10'),(503,'','MANUAL11'),(503,'','MANUAL12'),(503,'','MANUAL13'),(503,'','MANUAL14'),(503,'','MANUAL15'),(503,'','MANUAL16'),(503,'','MANUAL17'),(503,'','MANUAL18'),(503,'','MANUAL19'),(503,'','MANUAL20'),(504,'1. 가자미를 찜통에 찐다 .','MANUAL01'),(504,'2. 양파를 곱게 다진다.','MANUAL02'),(504,'3. 가자미살을 발라내고 양파 다진 것과 마요네즈와 섞는다.','MANUAL03'),(504,'4. 딸기와 참다래는 먹기 좋은 크기로 자른다.','MANUAL04'),(504,'5. 식빵은 동그란 틀로 찍는다.','MANUAL05'),(504,'6. 식빵위에 2의 재료를 바르고 크래커를 올린 뒤 2의 재료를 다시 바르고 참다래를, 딸기를 올린다.','MANUAL06'),(504,'','MANUAL07'),(504,'','MANUAL08'),(504,'','MANUAL09'),(504,'','MANUAL10'),(504,'','MANUAL11'),(504,'','MANUAL12'),(504,'','MANUAL13'),(504,'','MANUAL14'),(504,'','MANUAL15'),(504,'','MANUAL16'),(504,'','MANUAL17'),(504,'','MANUAL18'),(504,'','MANUAL19'),(504,'','MANUAL20'),(505,'1. 꽃게는 손질하여 먹기 좋은 크기로 자른다.','MANUAL01'),(505,'2. 물 1컵에 건다시마와 꽃게를 넣고 끓여 육수 ⅔컵을 만든다.','MANUAL02'),(505,'3. 양배추와 토마토는 씻어 1cm×1cm 크기로 썬다.','MANUAL03'),(505,'4. 파는 씻어 어슷썰기 한다.','MANUAL04'),(505,'5. 육수 낸 꽃게는 건져 살을 발라낸다.','MANUAL05'),(505,'6. 육수에 된장을 풀고 양배추와 토마토를 넣고 한소끔 끓인 후 발라놓은 꽃게 살과 파, 다진 마늘을 넣어 완성한다.','MANUAL06'),(505,'','MANUAL07'),(505,'','MANUAL08'),(505,'','MANUAL09'),(505,'','MANUAL10'),(505,'','MANUAL11'),(505,'','MANUAL12'),(505,'','MANUAL13'),(505,'','MANUAL14'),(505,'','MANUAL15'),(505,'','MANUAL16'),(505,'','MANUAL17'),(505,'','MANUAL18'),(505,'','MANUAL19'),(505,'','MANUAL20'),(506,'1. 우엉은 껍질을 벗긴다.','MANUAL01'),(506,'2. 껍질을 벗긴 우엉은 4cm 길이로 가늘게 채 썬다.','MANUAL02'),(506,'3. 냄비에 물과 우엉을 넣어 3~5분간 삶는다.','MANUAL03'),(506,'4. 삶은 우엉을 체에 건진다.','MANUAL04'),(506,'5. 파를 어슷 썬다.','MANUAL05'),(506,'6. 삶은 우엉, 손질한 파, 양념 재료를 넣고 골고루 무쳐 마무리한다.','MANUAL06'),(506,'','MANUAL07'),(506,'','MANUAL08'),(506,'','MANUAL09'),(506,'','MANUAL10'),(506,'','MANUAL11'),(506,'','MANUAL12'),(506,'','MANUAL13'),(506,'','MANUAL14'),(506,'','MANUAL15'),(506,'','MANUAL16'),(506,'','MANUAL17'),(506,'','MANUAL18'),(506,'','MANUAL19'),(506,'','MANUAL20'),(507,'1. 칼등으로 두부를 으깨 면보에 싸서 물기를 짜낸다.','MANUAL01'),(507,'2. 새우, 부추, 표고버섯은 잘게 다진다.','MANUAL02'),(507,'3. 두부에 다진 새우, 부추, 표고버섯, 소금, 후추를 넣어 소를 만든다.','MANUAL03'),(507,'4. 만두피에 소를 10g씩을 올리고 새우 꼬리를 밖으로 나오게 넣고 오므린다.','MANUAL04'),(507,'5. 찜기에 젖은 면보를 깔고 만두를 넣어 7분 간 찐다.','MANUAL05'),(507,'6.  양념장과 함께 곁들여 낸다.','MANUAL06'),(507,'','MANUAL07'),(507,'','MANUAL08'),(507,'','MANUAL09'),(507,'','MANUAL10'),(507,'','MANUAL11'),(507,'','MANUAL12'),(507,'','MANUAL13'),(507,'','MANUAL14'),(507,'','MANUAL15'),(507,'','MANUAL16'),(507,'','MANUAL17'),(507,'','MANUAL18'),(507,'','MANUAL19'),(507,'','MANUAL20'),(508,'1. 양파와 파는 다져 준비한다.','MANUAL01'),(508,'2. 무는 채를 썰어 놓는다.','MANUAL02'),(508,'3. 시금치는 끓는 물에 소금을 넣고 데쳐,\n우유와 함께 갈아 준비한다.','MANUAL03'),(508,'4. 마는 강판에 갈아 시금치 우유(③)에\n섞는다.','MANUAL04'),(508,'5. 다져 놓은 양파와 파는 냄비에 버터를\n넣고 볶는다.','MANUAL05'),(508,'6. 볶아지는 채소(⑤)에 무(②)와 육수를\n붓고 끓여서 무가 익으면 충분히 식힌\n뒤, 준비한 우유(④)와 함께 믹서에\n갈고, 생크림을 올려 완성한다.','MANUAL06'),(508,'','MANUAL07'),(508,'','MANUAL08'),(508,'','MANUAL09'),(508,'','MANUAL10'),(508,'','MANUAL11'),(508,'','MANUAL12'),(508,'','MANUAL13'),(508,'','MANUAL14'),(508,'','MANUAL15'),(508,'','MANUAL16'),(508,'','MANUAL17'),(508,'','MANUAL18'),(508,'','MANUAL19'),(508,'','MANUAL20'),(509,'1. 현미쌀은 깨끗이 씻어 약 30분 이상\n충분히 불린다.','MANUAL01'),(509,'2. 단호박은 껍질을 벗겨 먹기 좋게 썰어\n불린 현미 쌀과 함께 밥을 짓는다.','MANUAL02'),(509,'3. 양송이와 양파는 다져, 냄비에 볶다가\n우유와 설탕, 호박가루를 넣는다.','MANUAL03'),(509,'4. 끓고 있는 냄비에 단호박 현미밥(②)을\n넣고 끓인다.','MANUAL04'),(509,'5. 밥이 어느 정도 어우러지면, 생크림과\n요거트를 섞어 한 번 더 젓는다.','MANUAL05'),(509,'6. 만들어진 리조또(⑤) 위에 캐슈넛과\n아몬드, 어린잎 채소를 올려 함께\n완성한다.','MANUAL06'),(509,'','MANUAL07'),(509,'','MANUAL08'),(509,'','MANUAL09'),(509,'','MANUAL10'),(509,'','MANUAL11'),(509,'','MANUAL12'),(509,'','MANUAL13'),(509,'','MANUAL14'),(509,'','MANUAL15'),(509,'','MANUAL16'),(509,'','MANUAL17'),(509,'','MANUAL18'),(509,'','MANUAL19'),(509,'','MANUAL20'),(510,'1. 떡볶이는 뜨거운 물에 담그어 놓는다.','MANUAL01'),(510,'2. 토마토, 사과는 입자 있게 다진다.','MANUAL02'),(510,'3. 떡볶이떡은 뜨거운 물에 담그어\n놓는다.','MANUAL03'),(510,'4. 고추장과 케첩, 올리고당, 다진 마늘을\n골고루 섞는다.','MANUAL04'),(510,'5. 냄비에 버터를 녹인 뒤 토마토와 사과\n(②), 소스(④)를 넣고 볶아준다.','MANUAL05'),(510,'6. 볶고 있는 소스(⑤)에 떡볶이 떡(①)과\n썰어놓은 채소와 어묵(③)을 넣고,\n육수를 부어 끓이다가 대파를 넣고\n한 번 더 끓여 완성한다.','MANUAL06'),(510,'','MANUAL07'),(510,'','MANUAL08'),(510,'','MANUAL09'),(510,'','MANUAL10'),(510,'','MANUAL11'),(510,'','MANUAL12'),(510,'','MANUAL13'),(510,'','MANUAL14'),(510,'','MANUAL15'),(510,'','MANUAL16'),(510,'','MANUAL17'),(510,'','MANUAL18'),(510,'','MANUAL19'),(510,'','MANUAL20'),(511,'1. 소고기는 깍뚝썰어 준비한다.','MANUAL01'),(511,'2. 깍뚝썰은 소고기에 소금, 후추, 올리브\n오일을 넣어 숙성시킨다.','MANUAL02'),(511,'3. 브로컬리는 살짝 데쳐 썰고 ,양파,\n당근, 토마토, 파프리카도 같은 크기로\n썰어 준비한다.','MANUAL03'),(511,'4. 포도주스에 올리고당과 칠리소스 넣어\n은근히 졸여 소스를 만들어 놓는다.','MANUAL04'),(511,'5. 팬에 식용유를 두르고 채소를 먼저\n볶는다.','MANUAL05'),(511,'6. 채소를 볶은 팬에 다시 숙성된 소고기를\n익히고, 볶아놓은 채소를 넣고 소스를\n넣어 살짝 더 졸여 완성한다.','MANUAL06'),(511,'','MANUAL07'),(511,'','MANUAL08'),(511,'','MANUAL09'),(511,'','MANUAL10'),(511,'','MANUAL11'),(511,'','MANUAL12'),(511,'','MANUAL13'),(511,'','MANUAL14'),(511,'','MANUAL15'),(511,'','MANUAL16'),(511,'','MANUAL17'),(511,'','MANUAL18'),(511,'','MANUAL19'),(511,'','MANUAL20'),(512,'1. 닭살은 삶아 입자있게 썰고, 양송이도\n껍질을 벗겨 입자있게 썰어 준비한다.','MANUAL01'),(512,'2. 떡볶이떡과 양파도 입자있게 썰어\n놓는다.','MANUAL02'),(512,'3. 당근은 소금을 넣고 삶아 꼬마 당근을\n만들어 장식을 준비한다.','MANUAL03'),(512,'4. 냄비에 버터를 두르고 양파를 먼저\n볶는다.','MANUAL04'),(512,'5. 볶아지는 냄비에 닭살과 떡볶이떡,\n양파를 넣어 다시 볶는다.','MANUAL05'),(512,'6. ⑤번에 밥을 넣고 육수와 우유, 생크림을\n넣어 볶으면서 치즈를 넣고 한 번 더 고실\n하게 볶아 완성하고 삶은 당근은 꼬마\n당근을 만들어 장식으로 올려 준다.','MANUAL06'),(512,'','MANUAL07'),(512,'','MANUAL08'),(512,'','MANUAL09'),(512,'','MANUAL10'),(512,'','MANUAL11'),(512,'','MANUAL12'),(512,'','MANUAL13'),(512,'','MANUAL14'),(512,'','MANUAL15'),(512,'','MANUAL16'),(512,'','MANUAL17'),(512,'','MANUAL18'),(512,'','MANUAL19'),(512,'','MANUAL20'),(513,'1. 새우는 내장을 제거하고, 오징어는\n껍질을 벗겨 안쪽으로 칼집을 넣은 뒤\n준비한 새우, 오징어, 조개살을 살짝\n데친다.','MANUAL01'),(513,'2. 양배추와 파프리카를 길쭉하게 썰고\n당근, 양파는 채를 썰어 준비한다.','MANUAL02'),(513,'3. 굴소스와 칠리소스를 섞어 소스를\n만들어 놓는다.','MANUAL03'),(513,'4. 우동은 끓는 물에 한 번 데쳐 준비한다.','MANUAL04'),(513,'5. 팬에 버터를 둘러 해물을 먼저 볶다가\n만들어 놓은 소스를 넣는다.','MANUAL05'),(513,'6. 5번에 채소를 넣어 살짝 볶다가 데친\n우동을 넣고 한 번 더 볶은 후 접시에\n담고 그 위에 가쯔오부시를 올려\n완성한다.','MANUAL06'),(513,'','MANUAL07'),(513,'','MANUAL08'),(513,'','MANUAL09'),(513,'','MANUAL10'),(513,'','MANUAL11'),(513,'','MANUAL12'),(513,'','MANUAL13'),(513,'','MANUAL14'),(513,'','MANUAL15'),(513,'','MANUAL16'),(513,'','MANUAL17'),(513,'','MANUAL18'),(513,'','MANUAL19'),(513,'','MANUAL20'),(514,'1. 닭다리살은 뼈를 발라 일정 크기로\n자른 뒤 우유에 재워둔다.','MANUAL01'),(514,'2. 재워둔 닭다리살에 소금과 후춧가루를\n뿌려놓는다.','MANUAL02'),(514,'3. 단호박은 속을 파서 잘라 삶아\n준비한다.','MANUAL03'),(514,'4. 떡볶이떡은 뜨거운 물에 살짝 불리고,\n대파는 단호박 크기로 잘라 준비한다.','MANUAL04'),(514,'5. 고추장과 다진마늘, 다진양파, 케첩,\n올리고당을 넣고, 골고루 섞어 양념장을\n만들어 놓는다.','MANUAL05'),(514,'6. 꼬치에 준비한 닭다리살과 단호박, 양파,\n떡볶이떡, 대파를 꽂아 은근히 초벌로\n굽고, 다시 만들어 놓은 양념장을 발라\n구워 완성한다.','MANUAL06'),(514,'','MANUAL07'),(514,'','MANUAL08'),(514,'','MANUAL09'),(514,'','MANUAL10'),(514,'','MANUAL11'),(514,'','MANUAL12'),(514,'','MANUAL13'),(514,'','MANUAL14'),(514,'','MANUAL15'),(514,'','MANUAL16'),(514,'','MANUAL17'),(514,'','MANUAL18'),(514,'','MANUAL19'),(514,'','MANUAL20'),(515,'1. 콩나물은 꼬리를 떼어 준비한다.','MANUAL01'),(515,'2. 표고버섯을 길이로 썰고 떡은 입자있게\n다져 놓고 배는 갈아놓는다.','MANUAL02'),(515,'3. 김치 물에 충분히 씻어 물기를 제거하고\n송송 썰어 준비한다.','MANUAL03'),(515,'4. 냄비에 불린 쌀과 콩나물, 표고버섯을\n넣고 밥을 짓는다.','MANUAL04'),(515,'5. 다진 소고기에 간장과 갈아놓은 배,\n맛술, 파, 마늘, 참기름, 통깨로 양념을\n하여 30분 이상 재워둔 뒤 썰어 놓은\n김치, 다진 떡을 넣고 골고루 치대어\n섞는다.','MANUAL05'),(515,'6. 팬에 기름을 넣고 따끈해지면 떡갈비\n(⑤)를 넣어 익힌 후, 콩나물밥(④)\n위에 올리고, 브로컬리는 살짝 데쳐\n장식으로 올려 완성한다.','MANUAL06'),(515,'','MANUAL07'),(515,'','MANUAL08'),(515,'','MANUAL09'),(515,'','MANUAL10'),(515,'','MANUAL11'),(515,'','MANUAL12'),(515,'','MANUAL13'),(515,'','MANUAL14'),(515,'','MANUAL15'),(515,'','MANUAL16'),(515,'','MANUAL17'),(515,'','MANUAL18'),(515,'','MANUAL19'),(515,'','MANUAL20'),(516,'1. 펜네는 10분정도 삶아 데치고, 떡볶이\n떡은 뜨거운 물에 살짝 불려 놓는다.','MANUAL01'),(516,'2. 양파는 채를 썰어 준비한다.','MANUAL02'),(516,'3. 냄비에 버터를 넣고 밀가루를 넣어\n볶는다.','MANUAL03'),(516,'4. 볶아지는 밀가루에 준비한 육수를\n넣는다.','MANUAL04'),(516,'5. 육수가 은근히 끓으면 우유와 생크림\n넣어준다.','MANUAL05'),(516,'6. 끓고 있는 냄비에 떡볶이떡, 삶은 펜네와\n양파를 넣어 끓인 후 모짜렐라치즈를\n넣고 치즈가 녹으면 파슬리가루를\n살짝 뿌려 완성한다.','MANUAL06'),(516,'','MANUAL07'),(516,'','MANUAL08'),(516,'','MANUAL09'),(516,'','MANUAL10'),(516,'','MANUAL11'),(516,'','MANUAL12'),(516,'','MANUAL13'),(516,'','MANUAL14'),(516,'','MANUAL15'),(516,'','MANUAL16'),(516,'','MANUAL17'),(516,'','MANUAL18'),(516,'','MANUAL19'),(516,'','MANUAL20'),(517,'1. 돼지목살에 생강즙과 로즈마리, 소금,\n후춧가루를 뿌려 숙성시킨다.','MANUAL01'),(517,'2. 양파와 마늘, 샐러리는 입자있게\n다진다.','MANUAL02'),(517,'3. 칠리소스와 케첩, 포도주스를 섞는다.','MANUAL03'),(517,'4. 브로컬리는 살짝 데쳐, 작게 썰고,\n당근과 적채 채를 썰어 준비한다.','MANUAL04'),(517,'5. 냄비에 버터를 넣고, 양파와 마늘을\n넣어 볶는다.','MANUAL05'),(517,'6. 볶은 냄비(⑤)에 샐러리를 넣고 포도\n주스(③)와 채소(④)를 넣고 자작하게\n졸인 후 팬에 버터를 살짝 바르고, 팬이\n따끈해 지면 숙성한 목살을 넣어 익힌다.\n목살이 익혀지면, 자작하게 졸인 소스에\n넣어 다시 한 번 더 졸여 완성한다.','MANUAL06'),(517,'','MANUAL07'),(517,'','MANUAL08'),(517,'','MANUAL09'),(517,'','MANUAL10'),(517,'','MANUAL11'),(517,'','MANUAL12'),(517,'','MANUAL13'),(517,'','MANUAL14'),(517,'','MANUAL15'),(517,'','MANUAL16'),(517,'','MANUAL17'),(517,'','MANUAL18'),(517,'','MANUAL19'),(517,'','MANUAL20'),(518,'1. 닭고기살은 곱게 다져 준비한다.','MANUAL01'),(518,'2. 대추는 씨를 빼고 다진다.','MANUAL02'),(518,'3. 당근과 양파, 표고버섯, 마늘은 다진다.','MANUAL03'),(518,'4. 삶은 브로컬리는 우유와 함께 갈아\n놓는다.','MANUAL04'),(518,'5. 닭고기살에 대추(②)와 채소(③), 소금,\n후춧가루, 참기름을 넣어 골고루 섞는다.','MANUAL05'),(518,'6. 섞여진 닭고기살(⑤)을 동글동글 하게\n완자를 지어 살짝 데쳐내고, 냄비에\n버터와 밀가루를 넣어 볶다가, 육수를\n넣고 끓인 뒤 우유와 브로컬리 갈은 것\n(④)과 생크림을 넣어 한 소큼 끓여 완성\n한다.','MANUAL06'),(518,'','MANUAL07'),(518,'','MANUAL08'),(518,'','MANUAL09'),(518,'','MANUAL10'),(518,'','MANUAL11'),(518,'','MANUAL12'),(518,'','MANUAL13'),(518,'','MANUAL14'),(518,'','MANUAL15'),(518,'','MANUAL16'),(518,'','MANUAL17'),(518,'','MANUAL18'),(518,'','MANUAL19'),(518,'','MANUAL20'),(519,'1. 돼지고기등심은 자근자근 두들겨\n소금과 후추를 뿌려 숙성시킨다.','MANUAL01'),(519,'2. 깻잎, 당근, 피망, 양파는 채를 썰어\n준비한다.','MANUAL02'),(519,'3. 숙성된 돼지고기(①)에 썰어놓은 채소\n(②)와 치즈를 넣어 말아준다.','MANUAL03'),(519,'4. 마요네즈에 두부를 으깨어 넣고\n생크림과 요구르트, 설탕, 머스터드를\n넣어 골고루 섞어준다.','MANUAL04'),(519,'5. 어린잎은 찬물에 잠시 담그어 놓았다가\n채에 건져 물기를 제거한다.','MANUAL05'),(519,'6. 말아놓은 등심에 밀가루, 달걀물,\n빵가루 순서로 입혀 튀김기름\n170~180℃의 온도에 약 3분 정도\n튀겨 기름을 빼 놓고, 튀김소스(④)와\n어린잎(⑤)을 접시에 담아 완성한다.','MANUAL06'),(519,'','MANUAL07'),(519,'','MANUAL08'),(519,'','MANUAL09'),(519,'','MANUAL10'),(519,'','MANUAL11'),(519,'','MANUAL12'),(519,'','MANUAL13'),(519,'','MANUAL14'),(519,'','MANUAL15'),(519,'','MANUAL16'),(519,'','MANUAL17'),(519,'','MANUAL18'),(519,'','MANUAL19'),(519,'','MANUAL20'),(520,'1. 다진 소고기에 다진마늘, 소금,\n후춧가루, 맛술을 넣고 잘 섞어\n숙성을 시킨다.','MANUAL01'),(520,'2. 미니 단호박을 반으로 잘라 속을 파낸\n뒤 약 15분 정도 쪄서 호박 속을 긁는다.','MANUAL02'),(520,'3. 긁어 놓은 호박 속에 생크림을 넣어\n골고루 섞는다.','MANUAL03'),(520,'4. 양송이와 양파, 당근, 베이컨, 햄은\n사각지게 썰고, 피망과 파프리카는\n속을 제거하고 사각지게 썰어 놓는다.','MANUAL04'),(520,'5. 재워놓은 소고기(①)와 베이컨, 햄을\n올리브기름에 볶다가 썰어 놓은 채소를\n넣어 함께 볶아 준비한다.','MANUAL05'),(520,'6. 속 파낸 단호박(②)에 준비해둔 호박속\n(③)과 볶아놓은 햄과 채소(⑤)를 담고,\n모짜렐라치즈를 올려 오븐에 약 5분\n정도 구운 뒤 파슬리가루를 살짝 뿌려\n완성한다.','MANUAL06'),(520,'','MANUAL07'),(520,'','MANUAL08'),(520,'','MANUAL09'),(520,'','MANUAL10'),(520,'','MANUAL11'),(520,'','MANUAL12'),(520,'','MANUAL13'),(520,'','MANUAL14'),(520,'','MANUAL15'),(520,'','MANUAL16'),(520,'','MANUAL17'),(520,'','MANUAL18'),(520,'','MANUAL19'),(520,'','MANUAL20'),(521,'1. L.A 갈비는 물에 담그어 핏물과 갈비\n톱밥을 제거시켜 놓는다.','MANUAL01'),(521,'2. 강판에 배와 양파를 곱게 갈아 준비\n한다.','MANUAL02'),(521,'3. 핏물을 제거한 갈비에 배즙과 양파즙을\n넣어 숙성시킨다.','MANUAL03'),(521,'4. 냄비에 저염간장과 월계수잎, 통후추,\n올리고당, 정종, 설탕, 물, 매실액을\n넣어 은근히 약 30분 정도 끓여 식힌다.','MANUAL04'),(521,'5. 끓여 식힌 간장에 파, 마늘, 참기름,\n통깨를 넣는다.','MANUAL05'),(521,'6. 숙성시킨 L.A 갈비에 만들어 놓은\n양념을 넣고 다시 하루 정도 더 숙성\n후 팬에 구워 완성한다.','MANUAL06'),(521,'','MANUAL07'),(521,'','MANUAL08'),(521,'','MANUAL09'),(521,'','MANUAL10'),(521,'','MANUAL11'),(521,'','MANUAL12'),(521,'','MANUAL13'),(521,'','MANUAL14'),(521,'','MANUAL15'),(521,'','MANUAL16'),(521,'','MANUAL17'),(521,'','MANUAL18'),(521,'','MANUAL19'),(521,'','MANUAL20'),(522,'1. 닭살을 깎뚝 썰어 소금, 후춧가루,\n밀가루 넣어 살살 털어 준비해 놓는다.','MANUAL01'),(522,'2. 마늘과 토마토, 양파는 입자있게 다져\n놓는다.','MANUAL02'),(522,'3. 양송이는 껍질을 벗겨 다져 준비한다.','MANUAL03'),(522,'4. 냄비에 버터 넣고, 다진 마늘과 양파를\n볶는다.','MANUAL04'),(522,'5. 볶아지는 냄비에 밀가루 뭍힌 닭살을\n넣어 살짝 볶는다.','MANUAL05'),(522,'6. ⑤번에 양송이와 다진 토마토, 토마토\n소스, 올리고당, 굴소스를 넣고 살짝\n볶다가 육수를 넣어 끓인 후 다시 우유를\n넣고 은근히 끓이고, 스파게티는 약\n10분 정도 삶아 건져 접시에 담아, 끓인\n소스를 붓고, 위에 모짜렐라치즈를 올려\n오븐에 약 5분 정도 구어 완성한다.','MANUAL06'),(522,'','MANUAL07'),(522,'','MANUAL08'),(522,'','MANUAL09'),(522,'','MANUAL10'),(522,'','MANUAL11'),(522,'','MANUAL12'),(522,'','MANUAL13'),(522,'','MANUAL14'),(522,'','MANUAL15'),(522,'','MANUAL16'),(522,'','MANUAL17'),(522,'','MANUAL18'),(522,'','MANUAL19'),(522,'','MANUAL20'),(523,'1. 소고기와 돼지고기는 곱게 다진다.','MANUAL01'),(523,'2. 양파는 곱게 다진다.','MANUAL02'),(523,'3. 다진 고기에 양파, 달걀, 찹쌀가루,\n소금, 후춧가루를 넣고 잘 치댄다.','MANUAL03'),(523,'4. 토마토는 씨를 제거하고 곱게 다져\n?에 섞는다.','MANUAL04'),(523,'5. 순두부는 곱게 체에 내린다','MANUAL05'),(523,'6. ?에 유자청을 섞고, 구워놓은\n스테크에 올린다.','MANUAL06'),(523,'','MANUAL07'),(523,'','MANUAL08'),(523,'','MANUAL09'),(523,'','MANUAL10'),(523,'','MANUAL11'),(523,'','MANUAL12'),(523,'','MANUAL13'),(523,'','MANUAL14'),(523,'','MANUAL15'),(523,'','MANUAL16'),(523,'','MANUAL17'),(523,'','MANUAL18'),(523,'','MANUAL19'),(523,'','MANUAL20'),(524,'1. 잡곡은 깨끗이 씻어 충분히 불린 뒤\n밥을 짓는다.','MANUAL01'),(524,'2. 호박, 청피망, 홍피망, 양파,\n표고버섯은 입자있게 다지고 부추는\n송송 썰고 마늘은 다진다.','MANUAL02'),(524,'3. 팬에 기름을 두르고 썰어놓은 야채를\n살짝 볶다가 잡곡밥을 넣고 볶는다.','MANUAL03'),(524,'4. 된장에 생크림과 로즈마리를 넣고\n믹서에 간다.','MANUAL04'),(524,'5. ?에 생크림과 로즈마리를 넣어\n끓인다.','MANUAL05'),(524,'6. 달걀은 풀어 체에 내려 넓게 지단을\n부쳐 에 넣고 오므라이스로 말아 담고\n된장 소스를 올린다.','MANUAL06'),(524,'','MANUAL07'),(524,'','MANUAL08'),(524,'','MANUAL09'),(524,'','MANUAL10'),(524,'','MANUAL11'),(524,'','MANUAL12'),(524,'','MANUAL13'),(524,'','MANUAL14'),(524,'','MANUAL15'),(524,'','MANUAL16'),(524,'','MANUAL17'),(524,'','MANUAL18'),(524,'','MANUAL19'),(524,'','MANUAL20'),(525,'1. 동량의 물과 저염간장에 대파, 양파,\n마늘을 넣고 은근히 졸인다.','MANUAL01'),(525,'2. 마늘이 익을 정도로 끓으면 체에\n거른다.','MANUAL02'),(525,'3. 부추는 길게 썰고, 양파는 채썬다','MANUAL03'),(525,'4. 두릅은 데친 후 찬물에 헹군다.','MANUAL04'),(525,'5. 졸인 간장에 요리술을 넣고 다시\n졸인다.','MANUAL05'),(525,'6. 고기를 구운 뒤 준비한 야채와 두릅을\n넣고 돌돌 말아 간장에 졸인다.','MANUAL06'),(525,'','MANUAL07'),(525,'','MANUAL08'),(525,'','MANUAL09'),(525,'','MANUAL10'),(525,'','MANUAL11'),(525,'','MANUAL12'),(525,'','MANUAL13'),(525,'','MANUAL14'),(525,'','MANUAL15'),(525,'','MANUAL16'),(525,'','MANUAL17'),(525,'','MANUAL18'),(525,'','MANUAL19'),(525,'','MANUAL20'),(526,'1. 쌀과 강황쌀은 깨끗이 씻어 30분 정도\n불린 뒤 밥을 짓는다.','MANUAL01'),(526,'2. 고사리는 불린 뒤 삶고 잘게 썰어\n저염간장에 볶는다.','MANUAL02'),(526,'3. 두부, 당근은 채썰고, 애호박은\n반달모양으로 썰어 볶는다.','MANUAL03'),(526,'4. 숙주는 꼬리를 떼고 살짝 데친다.','MANUAL04'),(526,'5. 호박잎은 끓는 물에 데친다.','MANUAL05'),(526,'6. 고추장, 올리고당, 갈은 파인애플을\n섞어 소스를 만들고, 데친 호박잎에\n볶은 강황밥과 두부, 야채를 넣고\n고추장소스를 넣고 둥글게 말아\n완성한다.','MANUAL06'),(526,'','MANUAL07'),(526,'','MANUAL08'),(526,'','MANUAL09'),(526,'','MANUAL10'),(526,'','MANUAL11'),(526,'','MANUAL12'),(526,'','MANUAL13'),(526,'','MANUAL14'),(526,'','MANUAL15'),(526,'','MANUAL16'),(526,'','MANUAL17'),(526,'','MANUAL18'),(526,'','MANUAL19'),(526,'','MANUAL20'),(527,'1. 곤약은 5cm 길이로 썰어 가운데\n칼집을 넣고 매작과 모양으로 만들어\n뜨거운 물에 살짝 데친다.','MANUAL01'),(527,'2. 양배추, 적양배추는 채 썰고 배, 양파,\n파프리카는 굵은 채를 썬다.','MANUAL02'),(527,'3. 두부는 얼려 수분을 뺀다','MANUAL03'),(527,'4. 얼린 두부는 3cm 주사위 모양으로\n썬다.','MANUAL04'),(527,'5. 토마토는 슬라이스 한다.','MANUAL05'),(527,'6. 저염 간장에 설탕과 식초를 섞어\n소스를 만들고, 곤약과 두부를 볶다가\n야채를 넣어 한 번 더 볶은 뒤 소스를\n뿌린다.,','MANUAL06'),(527,'','MANUAL07'),(527,'','MANUAL08'),(527,'','MANUAL09'),(527,'','MANUAL10'),(527,'','MANUAL11'),(527,'','MANUAL12'),(527,'','MANUAL13'),(527,'','MANUAL14'),(527,'','MANUAL15'),(527,'','MANUAL16'),(527,'','MANUAL17'),(527,'','MANUAL18'),(527,'','MANUAL19'),(527,'','MANUAL20'),(528,'1. 스파게티면은 10분 삶아 건진다.','MANUAL01'),(528,'2. 팬에 올리브오일을 넣고 삶은\n스파게티를 볶는다.','MANUAL02'),(528,'3. 베이컨은 끓는 물에 살짝 데친다.','MANUAL03'),(528,'4. 양파, 브로컬리, 홍보추, 베이컨은\n썰고, 견과류는 다진다.','MANUAL04'),(528,'5. 팬에 올리브오일을 넣고 ④를 볶는다.','MANUAL05'),(528,'6. 야채가 볶아지면 두유를 넣고 끓이다가\n스파게티, 치즈를 넣고 끓인 뒤 그릇에\n담고 견과류를 올린다','MANUAL06'),(528,'','MANUAL07'),(528,'','MANUAL08'),(528,'','MANUAL09'),(528,'','MANUAL10'),(528,'','MANUAL11'),(528,'','MANUAL12'),(528,'','MANUAL13'),(528,'','MANUAL14'),(528,'','MANUAL15'),(528,'','MANUAL16'),(528,'','MANUAL17'),(528,'','MANUAL18'),(528,'','MANUAL19'),(528,'','MANUAL20'),(529,'1. 토마토는 슬라이스 한다.','MANUAL01'),(529,'2. 홀토마토와 양파는 곱게 다진다.','MANUAL02'),(529,'3. 가지와 애호박은 둥글게 썬다.','MANUAL03'),(529,'4. 팬에 가지와 애호박을 굽는다','MANUAL04'),(529,'5. 냄비에 다진 토마토를 넣고 볶다가\n다진 양파, 월계수잎을 넣고 볶아\n은근히 끓여서 소스를 만든다.','MANUAL05'),(529,'6. 파슬리는 곱게 다져 준비하고 접시에\n토마토, 가지, 애호박을 돌려담고 그\n위에 토마토소스를 올린 뒤 다진\n파슬리를 올린다.','MANUAL06'),(529,'','MANUAL07'),(529,'','MANUAL08'),(529,'','MANUAL09'),(529,'','MANUAL10'),(529,'','MANUAL11'),(529,'','MANUAL12'),(529,'','MANUAL13'),(529,'','MANUAL14'),(529,'','MANUAL15'),(529,'','MANUAL16'),(529,'','MANUAL17'),(529,'','MANUAL18'),(529,'','MANUAL19'),(529,'','MANUAL20'),(530,'1. 새우는 껍질을 제거하고 데쳐 편썬다.','MANUAL01'),(530,'2. 양파, 파프리카는 채썬다.','MANUAL02'),(530,'3. 땅콩은 갈아서 블루베리와 섞어 소스를\n만든다.','MANUAL03'),(530,'4. 라이스페이퍼는 물에 적신 뒤 건진다.','MANUAL04'),(530,'5. 라이스페이퍼에 깻잎을 올린다.','MANUAL05'),(530,'6. ?위에 새우, 파프리카, 양파, 베이컨,\n아스파라거스를 넣고 돌돌 말아 땅콩소\n스를 곁들인다.','MANUAL06'),(530,'','MANUAL07'),(530,'','MANUAL08'),(530,'','MANUAL09'),(530,'','MANUAL10'),(530,'','MANUAL11'),(530,'','MANUAL12'),(530,'','MANUAL13'),(530,'','MANUAL14'),(530,'','MANUAL15'),(530,'','MANUAL16'),(530,'','MANUAL17'),(530,'','MANUAL18'),(530,'','MANUAL19'),(530,'','MANUAL20'),(531,'1. 단호박, 고구마는 껍질을 벗겨 삶는다.','MANUAL01'),(531,'2. 고구마는 삶아 체에 내린다.','MANUAL02'),(531,'3. 완두콩은 삶아 간다.','MANUAL03'),(531,'4. 데친 브로컬리와 우유를 믹서에 넣어\n간다.','MANUAL04'),(531,'5. 냄비에 버터와 밀가루를 넣고 볶아\n화이트 루를 만든다.','MANUAL05'),(531,'6. 고구마와 단호박에 우유를 넣어\n끓이다가 화이트 루, 완두콩, 생크림을\n넣고 끓인 뒤 오렌지즙 한 방울을\n떨어뜨리고 식빵을 작게 잘라 올린다.','MANUAL06'),(531,'','MANUAL07'),(531,'','MANUAL08'),(531,'','MANUAL09'),(531,'','MANUAL10'),(531,'','MANUAL11'),(531,'','MANUAL12'),(531,'','MANUAL13'),(531,'','MANUAL14'),(531,'','MANUAL15'),(531,'','MANUAL16'),(531,'','MANUAL17'),(531,'','MANUAL18'),(531,'','MANUAL19'),(531,'','MANUAL20'),(532,'1. 두부는 3X4cm 크기로 썰어 소금을\n살짝 뿌려둔다.','MANUAL01'),(532,'2. 소금을 뿌려 놓은 두부는 물기를\n제거하고 밀가루를 골고루 묻힌다.','MANUAL02'),(532,'3. 팬에 기름을 두르고 두부를 앞뒤로\n노릇노릇하게 구워 접시에 담는다.','MANUAL03'),(532,'4. 매실액에 간장과 설탕을 넣고 골고루\n섞어 소스를 만든다.','MANUAL04'),(532,'5. 홍피망, 파프리카, 적채, 양파, 깻잎은\n곱게 채썬다.','MANUAL05'),(532,'6. 썰어 놓은 야채를 각각 물에 담궜다\n건져 두부 옆에 담고 소스를 뿌리고\n흑임자를 올린다.','MANUAL06'),(532,'','MANUAL07'),(532,'','MANUAL08'),(532,'','MANUAL09'),(532,'','MANUAL10'),(532,'','MANUAL11'),(532,'','MANUAL12'),(532,'','MANUAL13'),(532,'','MANUAL14'),(532,'','MANUAL15'),(532,'','MANUAL16'),(532,'','MANUAL17'),(532,'','MANUAL18'),(532,'','MANUAL19'),(532,'','MANUAL20'),(533,'1. 등갈비는 찬물에 담궈 핏물을 빼고\n끓는 물에 데친다.','MANUAL01'),(533,'2. 새송이버섯은 길쭉하게 슬라이스로\n썰어둔다.','MANUAL02'),(533,'3. 당근, 양파, 대파는 큼직하게 썰어,\n뜨거운 물에 담군다.','MANUAL03'),(533,'4. 담궈 놓은 야채를 걸러 야채물을\n만든다.','MANUAL04'),(533,'5. 냄비에 야채물을 넣고 저염간장과\n올리고당, 다진마늘, 후춧가루를\n섞는다.','MANUAL05'),(533,'6. 야채간장에 등갈비를 넣고 은근히\n졸이다가, 썰어놓은 야채와\n새송이버섯을 넣고 윤기나게 졸인다.','MANUAL06'),(533,'','MANUAL07'),(533,'','MANUAL08'),(533,'','MANUAL09'),(533,'','MANUAL10'),(533,'','MANUAL11'),(533,'','MANUAL12'),(533,'','MANUAL13'),(533,'','MANUAL14'),(533,'','MANUAL15'),(533,'','MANUAL16'),(533,'','MANUAL17'),(533,'','MANUAL18'),(533,'','MANUAL19'),(533,'','MANUAL20'),(534,'1. 뼈갈비는 찬물에 담궈 핏물을 뺀다.','MANUAL01'),(534,'2. 핏물을 뺀 뼈갈비를 건져 냄비에 넣고\n끓여 육수를 만든다','MANUAL02'),(534,'3. 쑥은 데치고, 당근, 감자는 한입크기로\n썰고, 홍고추, 청양고추는 어슷썬다.','MANUAL03'),(534,'4. 데친 쑥은 곱게 다진다.','MANUAL04'),(534,'5. 찹쌀가루에 다진 쑥을 넣고 뜨거운\n물로 익반죽 한 뒤 비닐에 담아\n숙성시킨다.','MANUAL05'),(534,'6. 숙성된 찹쌀반죽을 작게 잘라 가운데를\n비벼 조랭이 쑥 떡을 만들고, 끓인\n육수에 준비 한 야채와 함께 한소끔\n끓인다.','MANUAL06'),(534,'','MANUAL07'),(534,'','MANUAL08'),(534,'','MANUAL09'),(534,'','MANUAL10'),(534,'','MANUAL11'),(534,'','MANUAL12'),(534,'','MANUAL13'),(534,'','MANUAL14'),(534,'','MANUAL15'),(534,'','MANUAL16'),(534,'','MANUAL17'),(534,'','MANUAL18'),(534,'','MANUAL19'),(534,'','MANUAL20'),(535,'1. 호박잎은 끓는 물에 데친다.','MANUAL01'),(535,'2. 다시마는 물에 넣고 불린다.','MANUAL02'),(535,'3. 불린 다시마는 채썬다.','MANUAL03'),(535,'4. 파프리카, 양파, 오이, 두부는 채썬다.','MANUAL04'),(535,'5. 고추장에 준비한 다시마물을 섞고,\n설탕과 식초를 넣어 소스를 만든다.','MANUAL05'),(535,'6. 소고기는 소금, 후춧가루로 밑간을\n한뒤 구워 썰고, 호박잎에 소고기와\n갖은 야채를 올려 돌돌말아 접시에\n담고 고추장 소스를 올린다.','MANUAL06'),(535,'','MANUAL07'),(535,'','MANUAL08'),(535,'','MANUAL09'),(535,'','MANUAL10'),(535,'','MANUAL11'),(535,'','MANUAL12'),(535,'','MANUAL13'),(535,'','MANUAL14'),(535,'','MANUAL15'),(535,'','MANUAL16'),(535,'','MANUAL17'),(535,'','MANUAL18'),(535,'','MANUAL19'),(535,'','MANUAL20'),(536,'1. 돼지고기 등심은 곱게 다진다.','MANUAL01'),(536,'2. 두부는 꼭 짜서 물기를 제거하고,\n시금치는 데친 후 다진다.','MANUAL02'),(536,'3. 두부와 다진 등심에 시금치, 소금,\n후춧가루, 다진마늘 및 달걀을 넣고\n골고루 잘 섞는다.','MANUAL03'),(536,'4. 양배추는 김이 오른 찜통에서 약 5분\n정도 찐다.','MANUAL04'),(536,'5. 김발에 양배추를 넓게 편다.','MANUAL05'),(536,'6. 양배추 위에 ?을 넣고 돌돌말아 한 번\n더 찐다.','MANUAL06'),(536,'','MANUAL07'),(536,'','MANUAL08'),(536,'','MANUAL09'),(536,'','MANUAL10'),(536,'','MANUAL11'),(536,'','MANUAL12'),(536,'','MANUAL13'),(536,'','MANUAL14'),(536,'','MANUAL15'),(536,'','MANUAL16'),(536,'','MANUAL17'),(536,'','MANUAL18'),(536,'','MANUAL19'),(536,'','MANUAL20'),(537,'1. 물에 다시마를 넣고 끓인다.','MANUAL01'),(537,'2. 끓여 놓은 다시마 육수에 마늘,\n저염간장, 가쓰오부시를 넣고 살짝\n끓인 뒤 걸러서 소스를 만든다.','MANUAL02'),(537,'3. 양배추는 찜통에 찐다.','MANUAL03'),(537,'4. 돼지고기는 저염간장과 후춧가루를\n뿌려 볶고 식힌다','MANUAL04'),(537,'5. 파프리카, 사과, 당근은 굵게 채썬다.','MANUAL05'),(537,'6. 쪄낸 양배추에 깻잎과 썰어놓은 야채를\n올려 둥그렇게 말아 준비한 소스에\n살짝 적신다.','MANUAL06'),(537,'','MANUAL07'),(537,'','MANUAL08'),(537,'','MANUAL09'),(537,'','MANUAL10'),(537,'','MANUAL11'),(537,'','MANUAL12'),(537,'','MANUAL13'),(537,'','MANUAL14'),(537,'','MANUAL15'),(537,'','MANUAL16'),(537,'','MANUAL17'),(537,'','MANUAL18'),(537,'','MANUAL19'),(537,'','MANUAL20'),(538,'1. 연어는 깍둑썰기한다.','MANUAL01'),(538,'2. 썰어 놓은 연어는 후춧가루와 레몬으로\n마리네이드한다.','MANUAL02'),(538,'3. 어린잎은 찬물에 담궈둔다','MANUAL03'),(538,'4. 담궈 놓은 어린잎을 체에 받쳐 물기를\n뺀다.','MANUAL04'),(538,'5. 레몬과 올리브오일을 섞는다.','MANUAL05'),(538,'6. ?번에 발사믹소스를 넣고 연어 샐러드\n양념을 만들고, 접시에 연어와 물기를\n뺀 어린잎을 담는다.','MANUAL06'),(538,'','MANUAL07'),(538,'','MANUAL08'),(538,'','MANUAL09'),(538,'','MANUAL10'),(538,'','MANUAL11'),(538,'','MANUAL12'),(538,'','MANUAL13'),(538,'','MANUAL14'),(538,'','MANUAL15'),(538,'','MANUAL16'),(538,'','MANUAL17'),(538,'','MANUAL18'),(538,'','MANUAL19'),(538,'','MANUAL20'),(539,'1. 소고기는 소금과 후춧가루로\n양념한다.','MANUAL01'),(539,'2. 부추는 5cm 길이로 썰고 양배추는\n채썬다.','MANUAL02'),(539,'3. 오렌지는 껍질째 썬다.','MANUAL03'),(539,'4. 썰어 놓은 오렌지와 레몬, 양파를 갈아\n드레싱을 만든다.','MANUAL04'),(539,'5. 견과류는 입자있게 다진다.','MANUAL05'),(539,'6. 부추와 양배추를 준비한 드레싱에\n버무려 접시에 담고, 양념된 소고기는\n팬에 구워 먹기 좋게 썰어 담는다.','MANUAL06'),(539,'','MANUAL07'),(539,'','MANUAL08'),(539,'','MANUAL09'),(539,'','MANUAL10'),(539,'','MANUAL11'),(539,'','MANUAL12'),(539,'','MANUAL13'),(539,'','MANUAL14'),(539,'','MANUAL15'),(539,'','MANUAL16'),(539,'','MANUAL17'),(539,'','MANUAL18'),(539,'','MANUAL19'),(539,'','MANUAL20'),(540,'1. 양파와 파는 씻어 곱게 다진다.','MANUAL01'),(540,'2. 감자와 마는 껍질을 벗긴 후 씻는다.','MANUAL02'),(540,'3. 2를 강판에 간다.','MANUAL03'),(540,'4. 1과 3을 섞은 후 찹쌀가루를 넣어 반죽한다.','MANUAL04'),(540,'5. 현미유를 두른 팬에 반죽을 떠서 지름 8cm 크기로 동그랗게 부친다.','MANUAL05'),(540,'6. 간장, 파, 식초, 통깨를 넣고 간장양념장을 만들어 곁들인다.','MANUAL06'),(540,'','MANUAL07'),(540,'','MANUAL08'),(540,'','MANUAL09'),(540,'','MANUAL10'),(540,'','MANUAL11'),(540,'','MANUAL12'),(540,'','MANUAL13'),(540,'','MANUAL14'),(540,'','MANUAL15'),(540,'','MANUAL16'),(540,'','MANUAL17'),(540,'','MANUAL18'),(540,'','MANUAL19'),(540,'','MANUAL20'),(541,'1. 토란은 감자칼로 껍질을 벗겨 3~4 등분한다.','MANUAL01'),(541,'2. 소고기와 배추는 5mm 너비로 썰고 대파는 어슷 썬다.','MANUAL02'),(541,'3. 토란을 연한 소금물(물 1컵 + 소금 1g)에 담근다.','MANUAL03'),(541,'4. 참기름에 소고기와 다진 마늘을 볶다가 향이 우러나면 고춧가루를 넣고 잠시 더 볶는다.','MANUAL04'),(541,'5. 볶은 고기에 물을 붓고 된장을 풀어 넣는다.','MANUAL05'),(541,'6. 국물이 끓으면 배추, 토란, 대파를 넣고 한소끔 끓인다.','MANUAL06'),(541,'','MANUAL07'),(541,'','MANUAL08'),(541,'','MANUAL09'),(541,'','MANUAL10'),(541,'','MANUAL11'),(541,'','MANUAL12'),(541,'','MANUAL13'),(541,'','MANUAL14'),(541,'','MANUAL15'),(541,'','MANUAL16'),(541,'','MANUAL17'),(541,'','MANUAL18'),(541,'','MANUAL19'),(541,'','MANUAL20'),(542,'1. 갈치는 비늘을 벗기고 손질한 후 토막내어 3~4회 칼집을 넣는다.','MANUAL01'),(542,'2. 파는 다진다.','MANUAL02'),(542,'3. 고추장, 양파, 파, 다진 마늘, 간장, 매실액, 고춧가루, 다진 생강, 후춧가루를 섞어 양념장을 만든다.','MANUAL03'),(542,'4. 팬에 현미유를 두르고 갈치를 앞뒤로 애벌구이 한다.','MANUAL04'),(542,'5. 애벌구이된 갈치 위에 고추장양념을 발라 구운다.','MANUAL05'),(542,'6. 통깨를 뿌려 마무리한다.','MANUAL06'),(542,'','MANUAL07'),(542,'','MANUAL08'),(542,'','MANUAL09'),(542,'','MANUAL10'),(542,'','MANUAL11'),(542,'','MANUAL12'),(542,'','MANUAL13'),(542,'','MANUAL14'),(542,'','MANUAL15'),(542,'','MANUAL16'),(542,'','MANUAL17'),(542,'','MANUAL18'),(542,'','MANUAL19'),(542,'','MANUAL20'),(543,'1. 단호박을 깨끗이 씻는다.','MANUAL01'),(543,'2. 단호박은 익기 쉽도록 토막 내어 찐다.','MANUAL02'),(543,'3. 찐 단호박은 뜨거울 때 으깬다.','MANUAL03'),(543,'4. 2의 재료에 우유, 달걀노른자, 꿀을 넣어 잘 섞는다.','MANUAL04'),(543,'5. 김이 오른 찜통에 넣고 10~15분간 찐다.','MANUAL05'),(543,'6. 냉장고에 넣어 식힌후 차갑게 먹는다.','MANUAL06'),(543,'','MANUAL07'),(543,'','MANUAL08'),(543,'','MANUAL09'),(543,'','MANUAL10'),(543,'','MANUAL11'),(543,'','MANUAL12'),(543,'','MANUAL13'),(543,'','MANUAL14'),(543,'','MANUAL15'),(543,'','MANUAL16'),(543,'','MANUAL17'),(543,'','MANUAL18'),(543,'','MANUAL19'),(543,'','MANUAL20'),(544,'1. 고등어의 내장을 제거한다.','MANUAL01'),(544,'2. 내장을 제거한 고등어를 길이로 반을 갈라 각각 2등분 한다.','MANUAL02'),(544,'3. 양념장 재료를 모두 섞어 양념장을 만든다.','MANUAL03'),(544,'4. 고등어에 양념장을 발라 30분 이상 재운다.','MANUAL04'),(544,'5. 고등어의 양념장을 가볍게 긁어낸다.','MANUAL05'),(544,'6.  팬에 기름을 두르고 양파 속껍질과 얇게 썬 양파 위에 고등어를 올려 굽는다.','MANUAL06'),(544,'','MANUAL07'),(544,'','MANUAL08'),(544,'','MANUAL09'),(544,'','MANUAL10'),(544,'','MANUAL11'),(544,'','MANUAL12'),(544,'','MANUAL13'),(544,'','MANUAL14'),(544,'','MANUAL15'),(544,'','MANUAL16'),(544,'','MANUAL17'),(544,'','MANUAL18'),(544,'','MANUAL19'),(544,'','MANUAL20'),(545,'1. 낙지는 밀가루를 넣고 주물러 씻는다.','MANUAL01'),(545,'2. 씻은 낙지를 5cm 길이로 썬다','MANUAL02'),(545,'3. 마늘은 편으로, 양파는 사방 3cm, 브로콜리는 한입 크기로 썬다.','MANUAL03'),(545,'4. 팬에 올리브유를 넣고 마늘을 볶아 향을 낸다.','MANUAL04'),(545,'5. 양파와 방울토마토를 넣고 약한 불에서 토마토가 물러질 때까지 천천히 익힌다.','MANUAL05'),(545,'6. 브로콜리와 낙지를 넣고 볶은 뒤 소금으로 간하고 접시에 담아낸다.','MANUAL06'),(545,'','MANUAL07'),(545,'','MANUAL08'),(545,'','MANUAL09'),(545,'','MANUAL10'),(545,'','MANUAL11'),(545,'','MANUAL12'),(545,'','MANUAL13'),(545,'','MANUAL14'),(545,'','MANUAL15'),(545,'','MANUAL16'),(545,'','MANUAL17'),(545,'','MANUAL18'),(545,'','MANUAL19'),(545,'','MANUAL20'),(546,'1. 돌나물은 먹기 좋은 크기로 자른다.','MANUAL01'),(546,'2. 오이와 파프리카는 4~5cm 가량의 크기로 채 썬다.','MANUAL02'),(546,'3. 주꾸미는 끓는 물에 데친다.','MANUAL03'),(546,'4. 데친 주꾸미 4~5cm 가량의 크기로 썬다.','MANUAL04'),(546,'5. 고추장, 식초, 매실액, 파, 마늘, 통깨, 고춧가루를 넣고 고추장양념을 만든다.','MANUAL05'),(546,'6. 접시에 1,2,4를 담고 5의 고추장양념을 곁들인다.','MANUAL06'),(546,'','MANUAL07'),(546,'','MANUAL08'),(546,'','MANUAL09'),(546,'','MANUAL10'),(546,'','MANUAL11'),(546,'','MANUAL12'),(546,'','MANUAL13'),(546,'','MANUAL14'),(546,'','MANUAL15'),(546,'','MANUAL16'),(546,'','MANUAL17'),(546,'','MANUAL18'),(546,'','MANUAL19'),(546,'','MANUAL20'),(547,'1. 돼지고기를 0.5cm 두께로 썰어 칼집을 넣어 소금, 후추로 밑간한다.','MANUAL01'),(547,'2. 사과와 양파는 얇게 채 썬다.','MANUAL02'),(547,'3. 토마토는 4등분하여 물을 넣고 믹서에 간다.','MANUAL03'),(547,'4. 팬에 버터와 올리브유를 두르고 사과와 양파를 볶다가 토마토를 넣고 약불에서 사과가 무를 때 까지 천천히 익힌 뒤 레몬즙을 넣는다.','MANUAL04'),(547,'5. 팬에 올리브유를 두르고 고기를 앞뒤로 노릇하게 굽는다.','MANUAL05'),(547,'6. 고기를 한입 크기로 잘라 사과소스를 얹어 낸다.','MANUAL06'),(547,'','MANUAL07'),(547,'','MANUAL08'),(547,'','MANUAL09'),(547,'','MANUAL10'),(547,'','MANUAL11'),(547,'','MANUAL12'),(547,'','MANUAL13'),(547,'','MANUAL14'),(547,'','MANUAL15'),(547,'','MANUAL16'),(547,'','MANUAL17'),(547,'','MANUAL18'),(547,'','MANUAL19'),(547,'','MANUAL20'),(548,'1. 물 1컵 반에 국멸치와 건다시마를 넣고 멸치다시마국물 1컵 정도를 내고 다시마는 미리 건져 채 썬다.','MANUAL01'),(548,'2. 건도토리묵은 물에 불려 5cm 길이로 썬다.','MANUAL02'),(548,'3. 표고버섯은 5cm 길이로 채 썰고 느타리버섯은 5cm 길이로 가늘게 찢는다.','MANUAL03'),(548,'4. 파는 씻어 어슷썰기 한다.','MANUAL04'),(548,'5. 멸치다시마국물 1컵에 도토리묵, 표고버섯, 느타리버섯을 넣고 한소끔 끓인다.','MANUAL05'),(548,'6. 5에 들깨가루, 파, 다진 마늘, 다시마를 넣고 국간장과 소금으로 간을 한다.','MANUAL06'),(548,'','MANUAL07'),(548,'','MANUAL08'),(548,'','MANUAL09'),(548,'','MANUAL10'),(548,'','MANUAL11'),(548,'','MANUAL12'),(548,'','MANUAL13'),(548,'','MANUAL14'),(548,'','MANUAL15'),(548,'','MANUAL16'),(548,'','MANUAL17'),(548,'','MANUAL18'),(548,'','MANUAL19'),(548,'','MANUAL20'),(549,'1. 무는 씻어 1cm× 4cm × 0.3cm 크기로 나박썰기 한다.','MANUAL01'),(549,'2. 새우는 등 쪽의 내장을 제거한다.','MANUAL02'),(549,'3. 내장을 제거한 새우는 소금물에 살살 흔들어 씻는다.','MANUAL03'),(549,'4. 김이 오른 찜통에 무와 새우를 넣고 함께 찐다.','MANUAL04'),(549,'5. 찐 새우는 껍질을 벗기고 반으로 가른다.','MANUAL05'),(549,'6. 무에 파, 다진 마늘, 고춧가루, 간장, 설탕, 참기름, 통깨를 넣고 무친 뒤 5의 새우를 넣고 버무린다.','MANUAL06'),(549,'','MANUAL07'),(549,'','MANUAL08'),(549,'','MANUAL09'),(549,'','MANUAL10'),(549,'','MANUAL11'),(549,'','MANUAL12'),(549,'','MANUAL13'),(549,'','MANUAL14'),(549,'','MANUAL15'),(549,'','MANUAL16'),(549,'','MANUAL17'),(549,'','MANUAL18'),(549,'','MANUAL19'),(549,'','MANUAL20'),(550,'1. 조기의 비늘과 지느러미를 제거하고 앞뒤 3~4회 칼집을 내어 양념이 잘 배도록 손질한다','MANUAL01'),(550,'2. 고사리는 4cm 가량으로 자른다.','MANUAL02'),(550,'3.  자른 고사리는 국간장, 참기름, 마늘을 넣고 무친다','MANUAL03'),(550,'4. 양파, 홍고추, 청고추는 잘게 썬다','MANUAL04'),(550,'5. 양념된 고사리는 냄비에 넣는다','MANUAL05'),(550,'6. 5의 냄비에 물을 붓고 조기, 양파, 홍고추, 청고추, 생강, 마늘, 국간장, 통깨, 참기름을 넣고 찐다','MANUAL06'),(550,'','MANUAL07'),(550,'','MANUAL08'),(550,'','MANUAL09'),(550,'','MANUAL10'),(550,'','MANUAL11'),(550,'','MANUAL12'),(550,'','MANUAL13'),(550,'','MANUAL14'),(550,'','MANUAL15'),(550,'','MANUAL16'),(550,'','MANUAL17'),(550,'','MANUAL18'),(550,'','MANUAL19'),(550,'','MANUAL20'),(551,'1. 표고버섯의 기둥을 떼 낸다.','MANUAL01'),(551,'2. 버섯 기둥과 양파, 대파는 다진다.','MANUAL02'),(551,'3. 말린 고추는 으깨준다.','MANUAL03'),(551,'4. 고기에 2, 3과 나머지 양념을 넣어 잘 치댄다.','MANUAL04'),(551,'5. 표고버섯에 양념한 고기를 채운다.','MANUAL05'),(551,'6. 찜기에 젖은 면보를 깔고 10분간 쪄 낸다.','MANUAL06'),(551,'','MANUAL07'),(551,'','MANUAL08'),(551,'','MANUAL09'),(551,'','MANUAL10'),(551,'','MANUAL11'),(551,'','MANUAL12'),(551,'','MANUAL13'),(551,'','MANUAL14'),(551,'','MANUAL15'),(551,'','MANUAL16'),(551,'','MANUAL17'),(551,'','MANUAL18'),(551,'','MANUAL19'),(551,'','MANUAL20'),(552,'1. 냄비에 물 2컵을 넣고 돼지고기, 양파, 파, 통마늘, 생강, 후춧가루를 넣고 삶는다.','MANUAL01'),(552,'2. 삶은 돼지고기는 2cm × 3cm × 0.3cm 가량의 크기로 썬다.','MANUAL02'),(552,'3. 참나물은 먹기 좋은 크기로 자른다.','MANUAL03'),(552,'4. 양파는 다져준다.','MANUAL04'),(552,'5.  다진양파, 설탕, 간장, 고춧가루, 올리브유, 식초, 마늘, 통깨를 넣어 샐러드드레싱을 만든다.','MANUAL05'),(552,'6. 2의 돼지고기와 3의 참나물을 그릇에 담고 샐러드드레싱을 곁들인다.','MANUAL06'),(552,'','MANUAL07'),(552,'','MANUAL08'),(552,'','MANUAL09'),(552,'','MANUAL10'),(552,'','MANUAL11'),(552,'','MANUAL12'),(552,'','MANUAL13'),(552,'','MANUAL14'),(552,'','MANUAL15'),(552,'','MANUAL16'),(552,'','MANUAL17'),(552,'','MANUAL18'),(552,'','MANUAL19'),(552,'','MANUAL20'),(553,'1. 연근은 껍질을 벗겨 0.2 cm 길이로 얇게 썰어 물 반컵에 식초를 넣은 후 10분정도 담갔다가 물기를 제거한다.','MANUAL01'),(553,'2. 배추, 사과, 배는 씻어 4~5cm 길이로 채썬다.','MANUAL02'),(553,'3. 땅콩과 호두는 칼로 굵게 다진다.','MANUAL03'),(553,'4. 연근은 팬에 현미유를 두르고 노릇노릇하게 구어 연근칩을 만든다.','MANUAL04'),(553,'5. 홍시, 호상요구르트, 3배 식초, 소금을 섞어 홍시드레싱을 만든다.','MANUAL05'),(553,'6. 그릇에 배추, 사과, 배, 연근칩, 땅콩, 호두를 넣고 버무린 뒤 홍시드레싱을 곁들인다.','MANUAL06'),(553,'','MANUAL07'),(553,'','MANUAL08'),(553,'','MANUAL09'),(553,'','MANUAL10'),(553,'','MANUAL11'),(553,'','MANUAL12'),(553,'','MANUAL13'),(553,'','MANUAL14'),(553,'','MANUAL15'),(553,'','MANUAL16'),(553,'','MANUAL17'),(553,'','MANUAL18'),(553,'','MANUAL19'),(553,'','MANUAL20'),(554,'1. 실곤약은 세척해 레몬즙을 뿌려 물기를 빼준다.','MANUAL01'),(554,'2. 오이는 채 썰어준다.','MANUAL02'),(554,'3. 당근, 양파를 채 썰어서 냉수에 담가준다.','MANUAL03'),(554,'4. 열무김치국물과 물200g에 섞어서 국물을\n만들어준다','MANUAL04'),(554,'5. 달걀은 쪄서 반만 잘라 준비해준다.','MANUAL05'),(554,'6. 그릇에 곤약. 열무, 준비된 채소를 넣고 마지막에\n국물을 넣어 완성한다','MANUAL06'),(554,'','MANUAL07'),(554,'','MANUAL08'),(554,'','MANUAL09'),(554,'','MANUAL10'),(554,'','MANUAL11'),(554,'','MANUAL12'),(554,'','MANUAL13'),(554,'','MANUAL14'),(554,'','MANUAL15'),(554,'','MANUAL16'),(554,'','MANUAL17'),(554,'','MANUAL18'),(554,'','MANUAL19'),(554,'','MANUAL20'),(555,'1. 장어는 손질해 우유에 담가 이물질을 빼준다.','MANUAL01'),(555,'2. 더덕과 우엉은 가늘게 채 썰어 냉수에 담가\n준다.','MANUAL02'),(555,'3. 생강은 채 썰어 냉수에 담가준다.','MANUAL03'),(555,'4. 조림장을 만들어 더덕, 우엉, 생강을 각각\n볶아 섞어준다.','MANUAL04'),(555,'5. 맛간장과 발사믹식초를 졸이다가 장어를\n볶아준다.','MANUAL05'),(555,'6. 곁들이 김치를 준비하고 졸여진 뿌리채소와\n장어를 섞어 완성한다.','MANUAL06'),(555,'','MANUAL07'),(555,'','MANUAL08'),(555,'','MANUAL09'),(555,'','MANUAL10'),(555,'','MANUAL11'),(555,'','MANUAL12'),(555,'','MANUAL13'),(555,'','MANUAL14'),(555,'','MANUAL15'),(555,'','MANUAL16'),(555,'','MANUAL17'),(555,'','MANUAL18'),(555,'','MANUAL19'),(555,'','MANUAL20'),(556,'1. 망고를 먹기 좋은 크기로 자르고 소스재료로\n소스를 만들어준다.','MANUAL01'),(556,'2. 호두를 곱게 다져준다.','MANUAL02'),(556,'3. 안심에 만들어진 소스를 발라주고 곱게 다진\n호두가루를 발라준다.','MANUAL03'),(556,'4. 감자, 당근, 아스파라거스는 먹기 좋은 크기로\n잘라서 버터에 볶아준다.','MANUAL04'),(556,'5. 호두를 발라준 안심을 구워준다.','MANUAL05'),(556,'6. 남은 망고소스를 다시 졸여서 구워진 안심\n위에 뿌려주고 볶은 채소랑 완성한다.','MANUAL06'),(556,'','MANUAL07'),(556,'','MANUAL08'),(556,'','MANUAL09'),(556,'','MANUAL10'),(556,'','MANUAL11'),(556,'','MANUAL12'),(556,'','MANUAL13'),(556,'','MANUAL14'),(556,'','MANUAL15'),(556,'','MANUAL16'),(556,'','MANUAL17'),(556,'','MANUAL18'),(556,'','MANUAL19'),(556,'','MANUAL20'),(557,'1. 토마토홀과 토마토는 송송 다져준다.','MANUAL01'),(557,'2. 다진양파, 다진마늘과 다진토마토를 섞어\n소스를 볶아서 신맛을 날려준다.','MANUAL02'),(557,'3. 푸실리는 삶아 오일에 버무려주고 볶아준다.','MANUAL03'),(557,'4. 양파, 애호박, 가지, 파프리카를 먹기 좋게\n잘라 팬에 볶아준다.','MANUAL04'),(557,'5. 접시에 볶아진 채소와 파스타면을 서로 다시\n볶아준다.','MANUAL05'),(557,'6. 접시에 푸슬리를 올려 셋팅하고 토마토소스를\n뿌려주고 치즈가루를 뿌려 완성한다.','MANUAL06'),(557,'','MANUAL07'),(557,'','MANUAL08'),(557,'','MANUAL09'),(557,'','MANUAL10'),(557,'','MANUAL11'),(557,'','MANUAL12'),(557,'','MANUAL13'),(557,'','MANUAL14'),(557,'','MANUAL15'),(557,'','MANUAL16'),(557,'','MANUAL17'),(557,'','MANUAL18'),(557,'','MANUAL19'),(557,'','MANUAL20'),(558,'1. 토마토 페이스트는 신맛이 날아가도록 볶아\n준다.','MANUAL01'),(558,'2. 피망, 파프리카와 양파 , 애호박은 작은\n사각형으로 잘라준다.','MANUAL02'),(558,'3. 잘라준 채소를 올리브오일에 볶은 뒤 볶아진\n페이스트에 함께 볶아준다.','MANUAL03'),(558,'4. 가지는 어슷하고 도톰하게 잘라준다.','MANUAL04'),(558,'5. 가지를 팬에 구워준다.','MANUAL05'),(558,'6. 팬에 구운 가지를 올려주고 볶아진 채소를\n올려주고 다진 치즈를 뿌려서 완성한다.','MANUAL06'),(558,'','MANUAL07'),(558,'','MANUAL08'),(558,'','MANUAL09'),(558,'','MANUAL10'),(558,'','MANUAL11'),(558,'','MANUAL12'),(558,'','MANUAL13'),(558,'','MANUAL14'),(558,'','MANUAL15'),(558,'','MANUAL16'),(558,'','MANUAL17'),(558,'','MANUAL18'),(558,'','MANUAL19'),(558,'','MANUAL20'),(559,'1. 쪽갈비는 물에 와인을 넣어 80% 이상을 삶아\n냉수에 헹군다. 데쳐낸 쪽갈비를 올리브오일\n과 로즈마리와 통후추를 뿌려서 구워준다.','MANUAL01'),(559,'2. 소스를 만들어준다.','MANUAL02'),(559,'3. 레몬껍질은 채 썰어준다.','MANUAL03'),(559,'4. 방울토마토는 먹기 좋게 자르고 양파도 먹기\n좋게 잘라 팬에 구워준다.','MANUAL04'),(559,'5. 쪽갈비를 레몬껍질과 함께 굽는다.','MANUAL05'),(559,'6. 구워진 채소에 함께 쪽갈비를 굽고 소스와\n함께 완성한다.','MANUAL06'),(559,'','MANUAL07'),(559,'','MANUAL08'),(559,'','MANUAL09'),(559,'','MANUAL10'),(559,'','MANUAL11'),(559,'','MANUAL12'),(559,'','MANUAL13'),(559,'','MANUAL14'),(559,'','MANUAL15'),(559,'','MANUAL16'),(559,'','MANUAL17'),(559,'','MANUAL18'),(559,'','MANUAL19'),(559,'','MANUAL20'),(560,'1. 베이컨은 뜨거운 물에 살짝 데쳐준다.','MANUAL01'),(560,'2. 배춧잎 위에 깻잎 2장을 양쪽으로 깔고, 그\n사이에 베이컨을 얹는 방식으로 반복하여\n겹겹이 올려준 후 먹기 좋게 잘라준다.','MANUAL02'),(560,'3. 냄비 바닥에 끓인 무와 청경채, 숙주나물을\n깔아준다.','MANUAL03'),(560,'4. 2가지 소스를 만들어준다.','MANUAL04'),(560,'5. 가운데 부분은 백일송이버섯으로 채워주고\n먹기 직전에 만든 육수를 부어 끓여주고\n소스와 함께 완성한다.','MANUAL05'),(560,'','MANUAL06'),(560,'','MANUAL07'),(560,'','MANUAL08'),(560,'','MANUAL09'),(560,'','MANUAL10'),(560,'','MANUAL11'),(560,'','MANUAL12'),(560,'','MANUAL13'),(560,'','MANUAL14'),(560,'','MANUAL15'),(560,'','MANUAL16'),(560,'','MANUAL17'),(560,'','MANUAL18'),(560,'','MANUAL19'),(560,'','MANUAL20'),(561,'1. 실 곤약은 세척 후에 물기를 빼준다.','MANUAL01'),(561,'2. 새우와 브로콜리는 데쳐 냉수에 헹궈 준비한다.','MANUAL02'),(561,'3. 드라이 토마토는 물에 데쳐 준 후 송송 다져\n준 후 올리브 오일에 버무려주고 생 바질은\n데친 후 송송 다져준다.','MANUAL03'),(561,'4. 볼에 실 곤약을 바질 페이스트에 버무려준다.','MANUAL04'),(561,'5. 다져 놓은 채소와 새우, 브로콜리를 섞어\n버무려준다.','MANUAL05'),(561,'6. 마지막에 파마산 가루를 뿌려 완성한다.','MANUAL06'),(561,'','MANUAL07'),(561,'','MANUAL08'),(561,'','MANUAL09'),(561,'','MANUAL10'),(561,'','MANUAL11'),(561,'','MANUAL12'),(561,'','MANUAL13'),(561,'','MANUAL14'),(561,'','MANUAL15'),(561,'','MANUAL16'),(561,'','MANUAL17'),(561,'','MANUAL18'),(561,'','MANUAL19'),(561,'','MANUAL20'),(562,'1. 명란은 껍질을 벗겨 송송 다져준다.','MANUAL01'),(562,'2. 달걀을 풀어서 채에 내려주고 후추로 간을\n해준다.','MANUAL02'),(562,'3. 달걀에 명란과 생크림을 넣어 섞어준다.','MANUAL03'),(562,'4. 시금치는 데쳐서 수분을 제거 후 송송 다져\n주고 토마토는 작은 사각형으로 잘라준다.','MANUAL04'),(562,'5. 팬에 기름을 두르고 달걀을 부어 반 정도\n익혀준다.','MANUAL05'),(562,'6. 달걀이 반 정도 익었을 때 토마토와 시금치를\n넣어 뚜껑을 덮어 익혀 완성한다.','MANUAL06'),(562,'','MANUAL07'),(562,'','MANUAL08'),(562,'','MANUAL09'),(562,'','MANUAL10'),(562,'','MANUAL11'),(562,'','MANUAL12'),(562,'','MANUAL13'),(562,'','MANUAL14'),(562,'','MANUAL15'),(562,'','MANUAL16'),(562,'','MANUAL17'),(562,'','MANUAL18'),(562,'','MANUAL19'),(562,'','MANUAL20'),(563,'1. 양송이는 꼭지를 제거하고 밀가루를 살짝\n묻혀준다.','MANUAL01'),(563,'2. 청양고추를 송송 다진다.','MANUAL02'),(563,'3. 청양고추, 다진 돼지고기, 계란을 함께 버무려\n준다.','MANUAL03'),(563,'4. 양송이 소에 양념된 돼지고기를 채워준다.','MANUAL04'),(563,'5. 소스를 만들어준다.','MANUAL05'),(563,'6. 팬에 양송이를 구워준 후 로즈마리를 올려주고\n소스와 함께 낸다.','MANUAL06'),(563,'','MANUAL07'),(563,'','MANUAL08'),(563,'','MANUAL09'),(563,'','MANUAL10'),(563,'','MANUAL11'),(563,'','MANUAL12'),(563,'','MANUAL13'),(563,'','MANUAL14'),(563,'','MANUAL15'),(563,'','MANUAL16'),(563,'','MANUAL17'),(563,'','MANUAL18'),(563,'','MANUAL19'),(563,'','MANUAL20'),(564,'1. 함초는 먹기 좋게 썰어준다.','MANUAL01'),(564,'2. 알 배추, 무, 양파도 먹기 좋게 썬다.','MANUAL02'),(564,'3. 오렌지주스와 유자청을 넣어 국물을 만든다.','MANUAL03'),(564,'4. 볼에 함초, 알배추, 무를 넣어 섞고 어간장을\n넣어 살짝 절여준다.','MANUAL04'),(564,'5. 절여진 재료에 국물을 부어준다.','MANUAL05'),(564,'6. 3시간 정도 후부터 먹을 수가 있다.','MANUAL06'),(564,'','MANUAL07'),(564,'','MANUAL08'),(564,'','MANUAL09'),(564,'','MANUAL10'),(564,'','MANUAL11'),(564,'','MANUAL12'),(564,'','MANUAL13'),(564,'','MANUAL14'),(564,'','MANUAL15'),(564,'','MANUAL16'),(564,'','MANUAL17'),(564,'','MANUAL18'),(564,'','MANUAL19'),(564,'','MANUAL20'),(565,'1. 연어는 불려준 다시마에 싸주어 24시간 염지\n시켜준다.','MANUAL01'),(565,'2. 잎 녹차는 물에 불려준다.','MANUAL02'),(565,'3. 뒤 수분을 빼주고 팬에 올려서 연어를 약불\n에서 구워내 준다.','MANUAL03'),(565,'4. 브로콜리, 호두도 먹기 좋게 잘라준다.','MANUAL04'),(565,'5. 귀리와 쌀은 1시간정도 불려준다.','MANUAL05'),(565,'6. 닭 육수와 미소된장을 넣어 볶아주다가 불린\n쌀을 넣어 볶아주어 리조또를 완성하고 접시에\n리조또를 담고 구운 연어를 올려 완성한다.','MANUAL06'),(565,'','MANUAL07'),(565,'','MANUAL08'),(565,'','MANUAL09'),(565,'','MANUAL10'),(565,'','MANUAL11'),(565,'','MANUAL12'),(565,'','MANUAL13'),(565,'','MANUAL14'),(565,'','MANUAL15'),(565,'','MANUAL16'),(565,'','MANUAL17'),(565,'','MANUAL18'),(565,'','MANUAL19'),(565,'','MANUAL20'),(566,'1. 닭가슴살과 단호박은 사방 2.5cm 크기로\n잘라준다.','MANUAL01'),(566,'2. 양파 2가지, 색파프리카, 대파는 닭 크기와\n비슷하게 잘라준다.','MANUAL02'),(566,'3. 닭가슴살과 소라살은 통후추, 올리브오일에\n재워준다.','MANUAL03'),(566,'4. 소스를 만들어준다.','MANUAL04'),(566,'5. 모든 재료를 꼬치에 꽂는다.','MANUAL05'),(566,'6. 꼬치를 팬에 구워주면서 소스를 발라준다.','MANUAL06'),(566,'','MANUAL07'),(566,'','MANUAL08'),(566,'','MANUAL09'),(566,'','MANUAL10'),(566,'','MANUAL11'),(566,'','MANUAL12'),(566,'','MANUAL13'),(566,'','MANUAL14'),(566,'','MANUAL15'),(566,'','MANUAL16'),(566,'','MANUAL17'),(566,'','MANUAL18'),(566,'','MANUAL19'),(566,'','MANUAL20'),(567,'1. 닭날개를 멕시코고추와 고추가루에 설탕,\n다진마늘, 후추를 넣어 밑간을 해준다.','MANUAL01'),(567,'2. 감자는 먹기 좋게 썰어 뜨거운 물에 70%\n정도 익혀준다.','MANUAL02'),(567,'3. 감자는 데쳐 낸 후 버터에 볶아준다.','MANUAL03'),(567,'4. 브로콜리는 데치고, 사과와 토마토는 잘게\n잘라준다.','MANUAL04'),(567,'5. 냄비에 다진마늘과 다진양파를 볶아주다\n토마토를 넣어 소스를 만들어준다.','MANUAL05'),(567,'6. 닭날개를 팬에 구워주고 감자와 샐러드를\n곁들여 완성한다.','MANUAL06'),(567,'','MANUAL07'),(567,'','MANUAL08'),(567,'','MANUAL09'),(567,'','MANUAL10'),(567,'','MANUAL11'),(567,'','MANUAL12'),(567,'','MANUAL13'),(567,'','MANUAL14'),(567,'','MANUAL15'),(567,'','MANUAL16'),(567,'','MANUAL17'),(567,'','MANUAL18'),(567,'','MANUAL19'),(567,'','MANUAL20'),(568,'1. 카레가루를 물에 풀어서 30분 정도 숙성\n시켜준다.','MANUAL01'),(568,'2. 닭가슴살은 사방 1cm 크기로 잘라주고,\n칵테일새우도 세척해 준비한다.','MANUAL02'),(568,'3. 알 마 늘 , 감자는 사 방 1 c m 길이로 잘라\n물 400g에 먼저 익혀준다.','MANUAL03'),(568,'4. 방울토마토, 애호박은 사방 1cm 크기로\n썰어준다.','MANUAL04'),(568,'5. 끓고 있는 냄비에 풀어 놓은 카레가루를 섞어\n다시 끓여준다.','MANUAL05'),(568,'6. 양파는 사방 1cm 길이로 잘라주고 끓고 있는\n카레에 양파, 방울토마토, 애호박을 넣고\n끓여 완성한다.','MANUAL06'),(568,'','MANUAL07'),(568,'','MANUAL08'),(568,'','MANUAL09'),(568,'','MANUAL10'),(568,'','MANUAL11'),(568,'','MANUAL12'),(568,'','MANUAL13'),(568,'','MANUAL14'),(568,'','MANUAL15'),(568,'','MANUAL16'),(568,'','MANUAL17'),(568,'','MANUAL18'),(568,'','MANUAL19'),(568,'','MANUAL20'),(569,'1. 닭가슴살, 두부, 소금을 믹서에 간다.','MANUAL01'),(569,'2. 1에 간 마늘과 소금, 참기름을 섞는다.','MANUAL02'),(569,'3. 반죽 1/3은 비트물, 1/3은 시금치물을 넣어 색을 입힌다.','MANUAL03'),(569,'4. 틀에 반죽을 층층이 쌓아 모양을 만든 뒤 오븐에 찐다.','MANUAL04'),(569,'5. 흑임자가루, 플레인요거트, 식초, 설탕을 섞어 드레싱을 만든다.','MANUAL05'),(569,'6. 접시에 담고 소스와 베이비채소를 얹는다.','MANUAL06'),(569,'','MANUAL07'),(569,'','MANUAL08'),(569,'','MANUAL09'),(569,'','MANUAL10'),(569,'','MANUAL11'),(569,'','MANUAL12'),(569,'','MANUAL13'),(569,'','MANUAL14'),(569,'','MANUAL15'),(569,'','MANUAL16'),(569,'','MANUAL17'),(569,'','MANUAL18'),(569,'','MANUAL19'),(569,'','MANUAL20'),(570,'1. 단호박을 잘게 다진다.','MANUAL01'),(570,'2. 마를 0.3cm 두께로 썰어 뜨거운 물에 데친다.','MANUAL02'),(570,'3. 잘게 다진 단호박에 밀가루와 찹쌀가루, 물, 소금을 넣어 반죽한다.','MANUAL03'),(570,'4. 프라이팬에 식용유를 두르고 반죽을 두른다.','MANUAL04'),(570,'5. 두른 반죽 가운데 마를 올려 부친다.','MANUAL05'),(570,'6. 먹기 좋게 담은 후 건대추를 고명으로 올린다.','MANUAL06'),(570,'','MANUAL07'),(570,'','MANUAL08'),(570,'','MANUAL09'),(570,'','MANUAL10'),(570,'','MANUAL11'),(570,'','MANUAL12'),(570,'','MANUAL13'),(570,'','MANUAL14'),(570,'','MANUAL15'),(570,'','MANUAL16'),(570,'','MANUAL17'),(570,'','MANUAL18'),(570,'','MANUAL19'),(570,'','MANUAL20'),(571,'1. 완두콩을 삶아 건진다.','MANUAL01'),(571,'2. 감자는 삶은 뒤 건져 껍질을 벗긴다.','MANUAL02'),(571,'3. 감자가 뜨거울 때 곱게 으깬다.','MANUAL03'),(571,'4. 당근을 잘게 다진다.','MANUAL04'),(571,'5. 으깬 감자와 완두콩, 당근을 섞는다.','MANUAL05'),(571,'6. 플레인요거트를 섞어 마무리한다.','MANUAL06'),(571,'','MANUAL07'),(571,'','MANUAL08'),(571,'','MANUAL09'),(571,'','MANUAL10'),(571,'','MANUAL11'),(571,'','MANUAL12'),(571,'','MANUAL13'),(571,'','MANUAL14'),(571,'','MANUAL15'),(571,'','MANUAL16'),(571,'','MANUAL17'),(571,'','MANUAL18'),(571,'','MANUAL19'),(571,'','MANUAL20'),(572,'1. 당근, 오이, 표고버섯은 5cm 길이로 가늘게 채썬다.','MANUAL01'),(572,'2. 당근, 오이, 표고버섯은 각각 살짝 볶아내어 식혀둔다.','MANUAL02'),(572,'3. 쇠고기는 간장, 설탕, 마늘, 참기름을 넣어 밑간하여 볶아낸다.','MANUAL03'),(572,'4. 달걀은 얇게 지단을 부쳐 5cm 길이로 썬다.','MANUAL04'),(572,'5. 연겨자, 식초, 마늘, 설탕, 깨를 넣어 소스를 만든다.','MANUAL05'),(572,'6. 모든 재료를 소스에 버무린 다음 무쌈과 함께 낸다.','MANUAL06'),(572,'','MANUAL07'),(572,'','MANUAL08'),(572,'','MANUAL09'),(572,'','MANUAL10'),(572,'','MANUAL11'),(572,'','MANUAL12'),(572,'','MANUAL13'),(572,'','MANUAL14'),(572,'','MANUAL15'),(572,'','MANUAL16'),(572,'','MANUAL17'),(572,'','MANUAL18'),(572,'','MANUAL19'),(572,'','MANUAL20'),(573,'1. 통마늘과 견과류들은 먹기 좋은 크기로 자른다.','MANUAL01'),(573,'2. 흑마늘 진액과 간장, 물엿, 물을 넣어 흑마늘 소스를 만든다.','MANUAL02'),(573,'3. 대두유를 두르고 마늘을 팬에 노릇하게 구워준다.','MANUAL03'),(573,'4. 구워진 마늘에 각종 견과류를 넣어 볶는다.','MANUAL04'),(573,'5. 소스를 넣어 조린다.','MANUAL05'),(573,'6. 그릇에 담고 깨를 뿌려 마무리한다.','MANUAL06'),(573,'','MANUAL07'),(573,'','MANUAL08'),(573,'','MANUAL09'),(573,'','MANUAL10'),(573,'','MANUAL11'),(573,'','MANUAL12'),(573,'','MANUAL13'),(573,'','MANUAL14'),(573,'','MANUAL15'),(573,'','MANUAL16'),(573,'','MANUAL17'),(573,'','MANUAL18'),(573,'','MANUAL19'),(573,'','MANUAL20'),(574,'1. (속재료) 고구마는 쪄서 으깬 후 생크림을 넣어 부드러운 무스를 만든다.\n 양파와 김치는 다지고, 기름 두른 팬에 양파를 볶아 단맛을 낸 다음 김치를 볶아 볶음 김치를 만든다.','MANUAL01'),(574,'2. 반죽재료를 모두 넣고 1단으로 믹싱한 후 올리브유를 넣고 최종단계 직전까지 믹싱한다.','MANUAL02'),(574,'3. 1차 발효 후에 반죽을 각 100g씩 총 3개로 분할하여 둥글리기 한 후 랩을 덮어 중간발효(10분)를 해준다.','MANUAL03'),(574,'4. 반죽에 고구마 무스 ,볶음김치을 넣어 싼 후 고구마 모양으로 만들어 준다.\n★이음새가 벌어지면 구우면서 반죽이 터져지니 꼼꼼히 붙여주세요.','MANUAL04'),(574,'5. 팬닝 후 2차 발효(30분)를 한다.','MANUAL05'),(574,'6. 윗불 160℃, 아랫불 180℃에서 15분 굽는다.','MANUAL06'),(574,'','MANUAL07'),(574,'','MANUAL08'),(574,'','MANUAL09'),(574,'','MANUAL10'),(574,'','MANUAL11'),(574,'','MANUAL12'),(574,'','MANUAL13'),(574,'','MANUAL14'),(574,'','MANUAL15'),(574,'','MANUAL16'),(574,'','MANUAL17'),(574,'','MANUAL18'),(574,'','MANUAL19'),(574,'','MANUAL20'),(575,'1. 끓는 물에 한 입 크기로 썬 브로콜리를 데친다.','MANUAL01'),(575,'2. 팬에 아몬드슬라이스, 캐슈넛을 굽는다.','MANUAL02'),(575,'3. 팬에 무염버터를 녹인다.','MANUAL03'),(575,'4. 버터가 녹으면 브로콜리를 넣어 불향이 나도록 볶는다.','MANUAL04'),(575,'5. 구운 견과류를 넣어 볶다가 소금으로 간한다.','MANUAL05'),(575,'6. 그릇에 담아 마무리한다.','MANUAL06'),(575,'','MANUAL07'),(575,'','MANUAL08'),(575,'','MANUAL09'),(575,'','MANUAL10'),(575,'','MANUAL11'),(575,'','MANUAL12'),(575,'','MANUAL13'),(575,'','MANUAL14'),(575,'','MANUAL15'),(575,'','MANUAL16'),(575,'','MANUAL17'),(575,'','MANUAL18'),(575,'','MANUAL19'),(575,'','MANUAL20'),(576,'1. 양상추와 그린치커리, 라디치오는 먹기 좋은 크기로 찢고, 고추는 잘게 다진다.','MANUAL01'),(576,'2. 대파와 생강, 마늘은 곱게 다지고, 팬에 식용유를 두른 뒤 볶는다.','MANUAL02'),(576,'3. 소스 재료를 넣어 약한 불에서 5분 정도 끓인다.','MANUAL03'),(576,'4. 소스를 식힌 뒤 잘게 썬 고추를 섞는다.','MANUAL04'),(576,'5. 닭다리살에 옥수수전분을 묻히고, 팬에 식용유를 두른 뒤 노릇하게 굽는다.','MANUAL05'),(576,'6. 그릇에 손질한 채소를 깔고, 구운 닭다리살을 올린 뒤 소스와 무순을 올려 마무리한다.','MANUAL06'),(576,'','MANUAL07'),(576,'','MANUAL08'),(576,'','MANUAL09'),(576,'','MANUAL10'),(576,'','MANUAL11'),(576,'','MANUAL12'),(576,'','MANUAL13'),(576,'','MANUAL14'),(576,'','MANUAL15'),(576,'','MANUAL16'),(576,'','MANUAL17'),(576,'','MANUAL18'),(576,'','MANUAL19'),(576,'','MANUAL20'),(577,'1. (속재료) 단호박은 쪄서 먹기 좋은 크기로 썰어둔다.','MANUAL01'),(577,'2. 통밀가루와 강력분, 전립분, 물, 소금을 섞어 5℃에서 반나절동안 1차 발효를 시킨다.','MANUAL02'),(577,'3. 반죽을 썰어 모양을 잡고, 중간발효를 15분동안 한다.','MANUAL03'),(577,'4. 반죽 가운데에 썰은 단호박과 참깨를 넣고 가볍게 접어서 말아 면포에 올린다.','MANUAL04'),(577,'5. 굽기 전에 쿠프(칼집내기)를 한다.','MANUAL05'),(577,'6. 230℃ 로 예열한 오븐에 넣고 스팀 후 210℃에서 25분 굽는다.','MANUAL06'),(577,'','MANUAL07'),(577,'','MANUAL08'),(577,'','MANUAL09'),(577,'','MANUAL10'),(577,'','MANUAL11'),(577,'','MANUAL12'),(577,'','MANUAL13'),(577,'','MANUAL14'),(577,'','MANUAL15'),(577,'','MANUAL16'),(577,'','MANUAL17'),(577,'','MANUAL18'),(577,'','MANUAL19'),(577,'','MANUAL20'),(578,'1. 체 친 강력분, 박력분, 미숫가루, 베이킹파우더와 버터를 카드를 이용해 잘게 잘라 섞는다.\n★ 자르듯이 섞어야 글루텐이 생기는 것을 최소화 해, 바삭한 질감을 얻을 수 있어요.','MANUAL01'),(578,'2. 계란과 우유를 섞어 넣고 카드로 잘라 주듯이 섞는다.','MANUAL02'),(578,'3. 가루가 약간 보일 때쯤 건크랜베리와 호두를 넣어 같이 반죽한다.','MANUAL03'),(578,'4. 뭉쳐진 반죽을 비닐에 싸서 냉장고에서 1시간 이상 휴지시킨다.','MANUAL04'),(578,'5. 휴지시킨 반죽을 밀대로 밀어주고 여러 겹 쌓이도록 3접절이를 5회 정도 해준 후 카드로 일정하게 자른다.','MANUAL05'),(578,'6. 오븐팬에 놓고 겉면 코팅을 위해 계란물을 얇게 발라준 후 180℃로 예열된 오븐에서 20분 정도 굽는다.','MANUAL06'),(578,'','MANUAL07'),(578,'','MANUAL08'),(578,'','MANUAL09'),(578,'','MANUAL10'),(578,'','MANUAL11'),(578,'','MANUAL12'),(578,'','MANUAL13'),(578,'','MANUAL14'),(578,'','MANUAL15'),(578,'','MANUAL16'),(578,'','MANUAL17'),(578,'','MANUAL18'),(578,'','MANUAL19'),(578,'','MANUAL20'),(579,'1. (속재료) 고구마를 삶아서 껍질을 제거하고 우유를 넣어가며 으깨서 부드러운 무스 상태로 만든다.\n★ 고구마를 물에 삶으면 수분이 많아 우유량을 조절해야 해요.','MANUAL01'),(579,'2. 버터를 제외한 모든 반죽 재료를 넣고 클린업 단계까지 믹싱하다가 버터를 넣어 최종단계까지 믹싱한다.','MANUAL02'),(579,'3. 반죽은 처음 부피의 2배 정도 되도록 1차 발효하여 50g씩 분할하여 둥글리기 한 다음 중간 발효(10-15분)한다.','MANUAL03'),(579,'4. 중간 발효가 끝난 반죽은 납작하게 펴고 만들어 놓은 고구마무스를 넣어 동그란 모양으로 일정하게 만든 후 팬닝한다.','MANUAL04'),(579,'5. 팬닝된 반죽을 호떡처럼 윗면을 살짝 눌러준다.','MANUAL05'),(579,'6. 190℃에서 15분 정도 굽는다.','MANUAL06'),(579,'','MANUAL07'),(579,'','MANUAL08'),(579,'','MANUAL09'),(579,'','MANUAL10'),(579,'','MANUAL11'),(579,'','MANUAL12'),(579,'','MANUAL13'),(579,'','MANUAL14'),(579,'','MANUAL15'),(579,'','MANUAL16'),(579,'','MANUAL17'),(579,'','MANUAL18'),(579,'','MANUAL19'),(579,'','MANUAL20'),(580,'1. (속재료) 물에 불린 검은 콩을 30-40분 정도 삶은 다음 콩과 물을 분리시켜 식힌다. 식은 검은콩에 우유, 계란, 소금을 넣고 믹서에 갈고 끓여 검은콩 크림을 만든다. 이때 검은콩 물로 농도를 맞춘다.','MANUAL01'),(580,'2. 호두, 크랜베리를 제외한 모든 재료를 섞어 한 덩어리가 되면 호두와 크랜베리를 넣어 밖으로 빠져 나오지 않게 잘 넣어가며 반죽한다.','MANUAL02'),(580,'3. 처음 부피의 2배 정도 부풀게 1차 발효를 하고 발효가 끝나면 반죽을 6개로 분할하여 둥글리기하여 중간 발효한다.','MANUAL03'),(580,'4. 중간 발효한 반죽을 공기를 빼주고 양끝을 접어 바게트 모양으로 만들어 주고 팬에 3개씩 팬닝한다.','MANUAL04'),(580,'5. \"윗불 180℃, 아랫불 160℃에서 약 20-30분정도 구워 준 뒤 냉각팬에 옮겨 식힌다.\n★팬에 크기에 따라 2회로 나눠 구워요.\"','MANUAL05'),(580,'6. 식은 빵을 반으로 갈라 검은콩크림을 넣는다.','MANUAL06'),(580,'','MANUAL07'),(580,'','MANUAL08'),(580,'','MANUAL09'),(580,'','MANUAL10'),(580,'','MANUAL11'),(580,'','MANUAL12'),(580,'','MANUAL13'),(580,'','MANUAL14'),(580,'','MANUAL15'),(580,'','MANUAL16'),(580,'','MANUAL17'),(580,'','MANUAL18'),(580,'','MANUAL19'),(580,'','MANUAL20'),(581,'1. 오이는 껍질을 제거한 뒤 큼직하게 썰고, 셀러리는 필러로 겉껍질을 벗겨 큼직하게 썬다.','MANUAL01'),(581,'2. 손질한 오이와 셀러리에 양념을 넣어 믹서에 곱게 간다.','MANUAL02'),(581,'3. 면포에 간 오이와 셀러리를 부은 뒤 즙만 짠다.','MANUAL03'),(581,'4. 오이셀러리 즙을 밀폐 용기에 넣어 냉동실에서 3시간 이상 얼린다.','MANUAL04'),(581,'5. 요거트에 얼린 오이소르베를 얹고 과일을 곁들인다.','MANUAL05'),(581,'','MANUAL06'),(581,'','MANUAL07'),(581,'','MANUAL08'),(581,'','MANUAL09'),(581,'','MANUAL10'),(581,'','MANUAL11'),(581,'','MANUAL12'),(581,'','MANUAL13'),(581,'','MANUAL14'),(581,'','MANUAL15'),(581,'','MANUAL16'),(581,'','MANUAL17'),(581,'','MANUAL18'),(581,'','MANUAL19'),(581,'','MANUAL20'),(582,'1. 냄비에 우유(370㎖)를 넣어 센 불로 올린 뒤 가장자리가 끓어오르면 레몬즙(20g)을 넣어 몽글해질 때까지 젓는다.','MANUAL01'),(582,'2. 물에 적신 면포에 끓인 우유를 넣고 물기를 제거해 리코타치즈를 만든다.','MANUAL02'),(582,'3. 냄비에 발사믹식초(10g), 레몬즙(1g)을 넣어 2분간 끓이다가 올리브유(10g)를 넣어 섞은 뒤 불을 꺼 발사믹 드레싱을 만든다.','MANUAL03'),(582,'4. 방울토마토는 반으로 썰고, 굳힌 리코타치즈는 한입 크기로 만든다.','MANUAL04'),(582,'5. 그릇에 방울토마토와 리코타치즈를 올리고 발사믹 드레싱을 뿌린다.','MANUAL05'),(582,'','MANUAL06'),(582,'','MANUAL07'),(582,'','MANUAL08'),(582,'','MANUAL09'),(582,'','MANUAL10'),(582,'','MANUAL11'),(582,'','MANUAL12'),(582,'','MANUAL13'),(582,'','MANUAL14'),(582,'','MANUAL15'),(582,'','MANUAL16'),(582,'','MANUAL17'),(582,'','MANUAL18'),(582,'','MANUAL19'),(582,'','MANUAL20'),(583,'1. 방울토마토는 3등분하고, 깻잎과 양파는 곱게 다진다.','MANUAL01'),(583,'2. 연두부와 두부를 크림 형태가 될 때까지 으깬다.','MANUAL02'),(583,'3. 다진 깻잎과 양파에 깻잎 드레싱 재료를 넣어 고루 섞는다.','MANUAL03'),(583,'4. 중간 불로 달군 팬에 다진 마늘을 볶아 마늘 플레이크를 만든다.','MANUAL04'),(583,'5. 그릇에 연두부 크림과 방울토마토, 치즈를 올린다.','MANUAL05'),(583,'6. 깻잎 드레싱을 뿌리고 마늘 플레이크를 올려 마무리한다.','MANUAL06'),(583,'','MANUAL07'),(583,'','MANUAL08'),(583,'','MANUAL09'),(583,'','MANUAL10'),(583,'','MANUAL11'),(583,'','MANUAL12'),(583,'','MANUAL13'),(583,'','MANUAL14'),(583,'','MANUAL15'),(583,'','MANUAL16'),(583,'','MANUAL17'),(583,'','MANUAL18'),(583,'','MANUAL19'),(583,'','MANUAL20'),(584,'1. 믹서에 사과와 사과주스를 넣고 곱게 간 뒤 플레인 요거트를 섞어 사과드레싱을 만든다.','MANUAL01'),(584,'2. 연두부는 9cm 크기로 썬 뒤 중앙 부분을 파낸다.','MANUAL02'),(584,'3. 방울토마토와 스트링치즈는 굵게 다진 뒤 사과드레싱에 버무린다.','MANUAL03'),(584,'4. 버무려진 방울토마토와 스트링치즈로 연두부 속을 채운 뒤 사과드레싱을 올린다.','MANUAL04'),(584,'5. 그릇에 발사믹 식초를 바른 뒤 속 채운 연두부를 올리고 어린잎채소를 곁들인다.','MANUAL05'),(584,'','MANUAL06'),(584,'','MANUAL07'),(584,'','MANUAL08'),(584,'','MANUAL09'),(584,'','MANUAL10'),(584,'','MANUAL11'),(584,'','MANUAL12'),(584,'','MANUAL13'),(584,'','MANUAL14'),(584,'','MANUAL15'),(584,'','MANUAL16'),(584,'','MANUAL17'),(584,'','MANUAL18'),(584,'','MANUAL19'),(584,'','MANUAL20'),(585,'1. 냄비에 물(3컵)과 양념을 넣어 5분간 끓이고, 삼겹살을 넣어 중간 불로 15분간 끓인다.','MANUAL01'),(585,'2. 참외(½개)는 껍질과 씨를 제거한 뒤 곱게 다진다.','MANUAL02'),(585,'3. 다진 참외에 견과류와 저염쌈장 재료를 넣어 고루 섞는다.','MANUAL03'),(585,'4. 영양부추는 한입 크기로 자르고, 참외(½개)는 씨를 제거한다.','MANUAL04'),(585,'5. 그릇에 영양부추를 깔고, 삼겹살을 가지런히 올린다.','MANUAL05'),(585,'6. 씨를 제거한 참외에 참외 저염쌈장을 담아 마무리한다.','MANUAL06'),(585,'','MANUAL07'),(585,'','MANUAL08'),(585,'','MANUAL09'),(585,'','MANUAL10'),(585,'','MANUAL11'),(585,'','MANUAL12'),(585,'','MANUAL13'),(585,'','MANUAL14'),(585,'','MANUAL15'),(585,'','MANUAL16'),(585,'','MANUAL17'),(585,'','MANUAL18'),(585,'','MANUAL19'),(585,'','MANUAL20'),(586,'1. 양파는 3mm 두께로 채 썰고, 마늘은 납작 썰고, 대파와 청양고추는 어슷 썬다.','MANUAL01'),(586,'2. 다진 돼지고기에 고추장과 후춧가루 (0.3Ts)를 넣어 고루 섞은 뒤 10분간 재운다.','MANUAL02'),(586,'3. 중간 불로 달군 팬에 올리브유(3Ts)를 두르고, 다진 돼지고기와 고춧가루를 넣어 돼지고기의 겉면이 하얗게 변할 때까지 볶는다.','MANUAL03'),(586,'4. 올리브유(7Ts)에 납작 썬 마늘, 대파, 양파, 건새우, 후춧가루(0.3Ts)를 넣고 마늘이 노릇해질 때까지 볶는다.','MANUAL04'),(586,'5. 두부면과 닭육수(½컵)를 넣은 뒤 육수가 졸아들 때까지 볶고, 후춧가루(0.2Ts)와 청양고추를 넣어 1분간 볶는다.','MANUAL05'),(586,'6. 그릇에 담고 볶은 돼지고기와 식초에 재운 양파를 곁들여 마무리한다.','MANUAL06'),(586,'','MANUAL07'),(586,'','MANUAL08'),(586,'','MANUAL09'),(586,'','MANUAL10'),(586,'','MANUAL11'),(586,'','MANUAL12'),(586,'','MANUAL13'),(586,'','MANUAL14'),(586,'','MANUAL15'),(586,'','MANUAL16'),(586,'','MANUAL17'),(586,'','MANUAL18'),(586,'','MANUAL19'),(586,'','MANUAL20'),(587,'1. 양파는 얇게 채 썰고, 단호박은 껍질과 씨를 제거한 뒤 큼직하게 썰고, 말린 자두는 굵게 다지고, 청상추는 깨끗하게 씻는다.','MANUAL01'),(587,'2. 종이포일 위에 단호박을 올리고, 식용유(1Ts)를 두른 뒤 180℃로 예열한 오븐에서 15분간 구워 꺼내고, 삶은 달걀의 노른자는 체에 거르고, 흰자는 곱게 다진다.','MANUAL02'),(587,'3. 중간 불로 달군 팬에 식용유(2Ts)를 두르고, 화이트와인을 조금씩 넣으며 양파가 갈색이 될 때까지 볶아 양파잼을 만든다.','MANUAL03'),(587,'4. 구운 단호박은 한 김 식힌 뒤 체에 곱게 거르고, 달걀노른자, 흰자, 우유, 꿀, 소금, 후춧가루를 넣어 고루 섞어 단호박샐러드를 만든다.','MANUAL04'),(587,'5. 약한 불로 달군 마른 팬에 아몬드 슬라이스를 넣어 노릇하게 볶는다.','MANUAL05'),(587,'6. 식빵(1장)에 단호박샐러드, 청상추, 슬라이스 체더치즈를 올리고, 다른 식빵(1장)에 양파잼을 넉넉하게 바른 뒤 덮고, 삼각형으로 잘라 마무리한다.','MANUAL06'),(587,'','MANUAL07'),(587,'','MANUAL08'),(587,'','MANUAL09'),(587,'','MANUAL10'),(587,'','MANUAL11'),(587,'','MANUAL12'),(587,'','MANUAL13'),(587,'','MANUAL14'),(587,'','MANUAL15'),(587,'','MANUAL16'),(587,'','MANUAL17'),(587,'','MANUAL18'),(587,'','MANUAL19'),(587,'','MANUAL20'),(588,'1. (속재료) 시금치, 다진 마늘, 볶은 참깨, 올리브유, 소금, 후추를 블랜더로 갈아 시금치 페스토를 만들고 크림치즈와 섞는다.','MANUAL01'),(588,'2. 물, 계란, 소금, 올리브유, 사과종, 드라이 이스트와 체 친 가루류를 넣고 한 덩이가 되도록 반죽한 뒤 시금치를 작게 잘라 넣어 섞는다.','MANUAL02'),(588,'3. 매끈한 반죽이 되면 8등분 하여 둥글리기를 하고 15분간 중간 발효한다.','MANUAL03'),(588,'4. 중간 발효가 끝난 반죽을 납작하게 펴고 안에 시금치 필링을 넣어 잘 봉합한 뒤 팬에 놓고 살짝 눌러준다.','MANUAL04'),(588,'5. \"중앙에 말린 방울토마토를 얹어 30분간 2차 발효 한다.\n★방울토마토를 반으로 잘라 100℃ 오븐에 1시간 구워 사용했어요.\"','MANUAL05'),(588,'6. 180℃로 예열한 오븐에 15분간 굽는다.','MANUAL06'),(588,'','MANUAL07'),(588,'','MANUAL08'),(588,'','MANUAL09'),(588,'','MANUAL10'),(588,'','MANUAL11'),(588,'','MANUAL12'),(588,'','MANUAL13'),(588,'','MANUAL14'),(588,'','MANUAL15'),(588,'','MANUAL16'),(588,'','MANUAL17'),(588,'','MANUAL18'),(588,'','MANUAL19'),(588,'','MANUAL20'),(589,'1. 무말랭이를 물에 불린다.','MANUAL01'),(589,'2. 식초, 설탕, 피클링스파이스, 물을 넣고 끓인다.','MANUAL02'),(589,'3. 끓인 물을 식힌다.','MANUAL03'),(589,'4. 레몬, 당근, 오이를 적당한 크기로 자른다.','MANUAL04'),(589,'5. 4를 3에 넣어 하루 이상 숙성시킨다.','MANUAL05'),(589,'6. 보기 좋게 담는다.','MANUAL06'),(589,'','MANUAL07'),(589,'','MANUAL08'),(589,'','MANUAL09'),(589,'','MANUAL10'),(589,'','MANUAL11'),(589,'','MANUAL12'),(589,'','MANUAL13'),(589,'','MANUAL14'),(589,'','MANUAL15'),(589,'','MANUAL16'),(589,'','MANUAL17'),(589,'','MANUAL18'),(589,'','MANUAL19'),(589,'','MANUAL20'),(590,'1. 양배추와 양파, 적파프리카, 청피망을 깨끗이 씻는다.','MANUAL01'),(590,'2. 양배추와 양파를 잘게 썬다.','MANUAL02'),(590,'3. 적파프리카와 청피망은 씨를 제거하고 잘게 썬다.','MANUAL03'),(590,'4. 마요네즈드레싱 재료를 고루 섞는다.','MANUAL04'),(590,'5. 볼에 썰어둔 채소를 담는다.','MANUAL05'),(590,'6. 마요네즈드레싱을 넣고 버무려 마무리한다.','MANUAL06'),(590,'','MANUAL07'),(590,'','MANUAL08'),(590,'','MANUAL09'),(590,'','MANUAL10'),(590,'','MANUAL11'),(590,'','MANUAL12'),(590,'','MANUAL13'),(590,'','MANUAL14'),(590,'','MANUAL15'),(590,'','MANUAL16'),(590,'','MANUAL17'),(590,'','MANUAL18'),(590,'','MANUAL19'),(590,'','MANUAL20'),(591,'1. 다시 육수를 만들어 준다.','MANUAL01'),(591,'2. 건미역은 불려 잘게 썰어준다.','MANUAL02'),(591,'3. 마는 껍질을 제거한 후 깍둑 썰기하여 준비한다.','MANUAL03'),(591,'4. 참기름을 두르고 미역과 마늘을 볶다가 육수를 부어 끓인다.','MANUAL04'),(591,'5. 끓어오른 미역국에 마를 넣어 익혀준다.','MANUAL05'),(591,'6. 들깨가루를 넣어 한소끔 끓여낸다.','MANUAL06'),(591,'','MANUAL07'),(591,'','MANUAL08'),(591,'','MANUAL09'),(591,'','MANUAL10'),(591,'','MANUAL11'),(591,'','MANUAL12'),(591,'','MANUAL13'),(591,'','MANUAL14'),(591,'','MANUAL15'),(591,'','MANUAL16'),(591,'','MANUAL17'),(591,'','MANUAL18'),(591,'','MANUAL19'),(591,'','MANUAL20'),(592,'1. 물에 다시마, 청양고추, 대파, 한 입 크기로 썬 무를 넣고 끓인다.','MANUAL01'),(592,'2. 육수가 끓으면 청양고추와 다시마를 건진다.','MANUAL02'),(592,'3. 해감한 바지락을 넣고 끓인다.','MANUAL03'),(592,'4. 팽이버섯은 밑동을 자른 뒤 적당히 가르고, 홍고추는 어슷 썰고, 쑥갓은 먹기 좋은 크기로 썬다.','MANUAL04'),(592,'5. 국에 팽이버섯을 넣고 끓인다.','MANUAL05'),(592,'6. 홍고추와 쑥갓을 넣고 마무리한다.','MANUAL06'),(592,'','MANUAL07'),(592,'','MANUAL08'),(592,'','MANUAL09'),(592,'','MANUAL10'),(592,'','MANUAL11'),(592,'','MANUAL12'),(592,'','MANUAL13'),(592,'','MANUAL14'),(592,'','MANUAL15'),(592,'','MANUAL16'),(592,'','MANUAL17'),(592,'','MANUAL18'),(592,'','MANUAL19'),(592,'','MANUAL20'),(593,'1. 배추는 연한 잎으로 골라 한 장씩 떼어 길게 갈라놓는다.','MANUAL01'),(593,'2. 배추에 소금을 뿌려 절인다.','MANUAL02'),(593,'3. 쪽파는 4cm 길이로 썰고, 마늘과 생강은 다진다.','MANUAL03'),(593,'4. 고춧가루에 홍시를 으깨서 나머지 양념을 섞는다.','MANUAL04'),(593,'5. 물기를 제거한 배추에 고춧가루 양념을 넣고 무친다.','MANUAL05'),(593,'6. 쪽파, 통깨, 참기름을 넣고 마무리한다.','MANUAL06'),(593,'','MANUAL07'),(593,'','MANUAL08'),(593,'','MANUAL09'),(593,'','MANUAL10'),(593,'','MANUAL11'),(593,'','MANUAL12'),(593,'','MANUAL13'),(593,'','MANUAL14'),(593,'','MANUAL15'),(593,'','MANUAL16'),(593,'','MANUAL17'),(593,'','MANUAL18'),(593,'','MANUAL19'),(593,'','MANUAL20'),(594,'1. 감자는 슬라이스하고, 양파는 채 썬다.','MANUAL01'),(594,'2. 끓는 물(5컵)에 감자를 넣어 7분간 삶아 건진다.','MANUAL02'),(594,'3. 중간 불로 달군 팬에 버터를 두른 뒤 양파를 넣어 3~5분간 볶아 꺼낸다.','MANUAL03'),(594,'4. 믹서에 삶은 감자와 양파, 우유를 넣어 곱게 간다.','MANUAL04'),(594,'5. 냄비에 믹서에 간 재료들을 넣어 약한 불로 3분간 끓여 농도를 맞춘다.','MANUAL05'),(594,'6. 소금과 후춧가루로 간을 맞춘 뒤 시판 크루통과 파슬리가루를 올린다.','MANUAL06'),(594,'','MANUAL07'),(594,'','MANUAL08'),(594,'','MANUAL09'),(594,'','MANUAL10'),(594,'','MANUAL11'),(594,'','MANUAL12'),(594,'','MANUAL13'),(594,'','MANUAL14'),(594,'','MANUAL15'),(594,'','MANUAL16'),(594,'','MANUAL17'),(594,'','MANUAL18'),(594,'','MANUAL19'),(594,'','MANUAL20'),(595,'1. 돼지고기, 두부, 아삭이고추는 잘게 다지고, 가지는 어슷하게 4등분해 가운데 칼집을 넣는다.','MANUAL01'),(595,'2. 다진 돼지고기는 밑간한 뒤 다진 두부, 고추를 넣어 섞는다.','MANUAL02'),(595,'3. 칼집을 넣은 가지에 밑간한 돼지고기를 채운 뒤 튀김가루를 묻힌다.','MANUAL03'),(595,'4. 튀김가루를 묻힌 가지는 180℃로 예열한 식용유(100㎖)에 7~8분간 두 번 튀긴다.','MANUAL04'),(595,'5. 냄비에 가지소스 재료와 물(100㎖)을 넣어 4분간 끓인다.','MANUAL05'),(595,'6. 그릇에 튀긴 가지를 얹고 가지소스를 뿌린다.','MANUAL06'),(595,'','MANUAL07'),(595,'','MANUAL08'),(595,'','MANUAL09'),(595,'','MANUAL10'),(595,'','MANUAL11'),(595,'','MANUAL12'),(595,'','MANUAL13'),(595,'','MANUAL14'),(595,'','MANUAL15'),(595,'','MANUAL16'),(595,'','MANUAL17'),(595,'','MANUAL18'),(595,'','MANUAL19'),(595,'','MANUAL20'),(596,'1. 토마토는 꼭지를 제거하고, 열십자로 칼집을 낸 뒤 끓는 물에 30초간 데쳐 건지고, 껍질을 제거해 한입 크기로 썬다.','MANUAL01'),(596,'2. 참외는 깨끗하게 씻어 2등분해 씨를 제거한 뒤 한입 크기로 썰고, 오이와 양파는 한입 크기로 썰고, 마늘은 꼭지를 제거한 뒤 4등분한다.','MANUAL02'),(596,'3. 애호박은 스파이럴라이저로 썰고, 끓는 물에 30초간 데쳐 건진 뒤 한 김 식히고, 레몬즙(1Ts), 올리브유(2Ts), 소금(0.1Ts)에 버무린다.','MANUAL03'),(596,'4. 믹서에 토마토, 오이, 참외, 양파, 마늘, 바질잎(3장), 페페론치노, 차가운 물(½컵)을 넣어 곱게 갈아 토마토소스를 만든다.','MANUAL04'),(596,'5. 저염 간장, 식초, 꿀, 올리브유(3Ts), 소금(0.3Ts)을 넣어 한 번 더 곱게 간다.','MANUAL05'),(596,'6. 그릇에 애호박면과 토마토소스를 담고, 바질잎(1장)과 블랙올리브 파우더를 뿌려 마무리한다.','MANUAL06'),(596,'','MANUAL07'),(596,'','MANUAL08'),(596,'','MANUAL09'),(596,'','MANUAL10'),(596,'','MANUAL11'),(596,'','MANUAL12'),(596,'','MANUAL13'),(596,'','MANUAL14'),(596,'','MANUAL15'),(596,'','MANUAL16'),(596,'','MANUAL17'),(596,'','MANUAL18'),(596,'','MANUAL19'),(596,'','MANUAL20'),(597,'1. 김치는 깨끗하게 씻어 찬물에 30분간 담근 뒤 건져내고, 물기를 꼭 짠 뒤 윗동을 약간 자른다.','MANUAL01'),(597,'2. 오이와 파프리카는 5cm 길이로 채 썰고, 깻잎과 무순은 깨끗하게 씻어 물기를 빼고, 크래미는 낱낱이 가른다.','MANUAL02'),(597,'3. 새우는 껍질을 벗기고, 끓는 물에 익을 때까지 데쳤다 건져 길게 2등분한다.','MANUAL03'),(597,'4. 약한 불로 달군 팬에 식용유를 두르고, 달걀물을 부어 지단을 부친다.','MANUAL04'),(597,'5. 김발에 김치를 한 장씩 겹쳐 넓게 펼친다.','MANUAL05'),(597,'6. 김치 위에 지단, 손질한 채소, 새우를 올리고, 돌돌 말아 한입 크기로 썰어 마무리한다.','MANUAL06'),(597,'','MANUAL07'),(597,'','MANUAL08'),(597,'','MANUAL09'),(597,'','MANUAL10'),(597,'','MANUAL11'),(597,'','MANUAL12'),(597,'','MANUAL13'),(597,'','MANUAL14'),(597,'','MANUAL15'),(597,'','MANUAL16'),(597,'','MANUAL17'),(597,'','MANUAL18'),(597,'','MANUAL19'),(597,'','MANUAL20'),(598,'1. 양배추, 어묵, 파프리카를 길게 썰고 부추는 한번 데친다.','MANUAL01'),(598,'2. 팬에 식용유를 살짝 두르고 어묵을 볶아 꺼내고, 같은 팬에 소고기 양지를 구워 준비한다.','MANUAL02'),(598,'3. 냄비에 물과 누들 떡볶이 떡을 넣어 끓이고 떡이 익으면 건져낸다.','MANUAL03'),(598,'4. 떡볶이양념파우더를 넣고 조려서 떡볶이 소스를 만든다.','MANUAL04'),(598,'5. 쌈두부를 깔고 조리한 소고기 양지, 떡과 손질한 어묵, 파프리카, 양배추를 올린 후 싸서 데친 부추로 묶는다.','MANUAL05'),(598,'6. 떡볶이 소스를 곁들여 마무리한다.','MANUAL06'),(598,'','MANUAL07'),(598,'','MANUAL08'),(598,'','MANUAL09'),(598,'','MANUAL10'),(598,'','MANUAL11'),(598,'','MANUAL12'),(598,'','MANUAL13'),(598,'','MANUAL14'),(598,'','MANUAL15'),(598,'','MANUAL16'),(598,'','MANUAL17'),(598,'','MANUAL18'),(598,'','MANUAL19'),(598,'','MANUAL20'),(599,'1. 당근, 양파, 깻잎은 깨끗이 씻고, 오이, 양배추, 사과는 채 썬다.','MANUAL01'),(599,'2. 리코타 치즈, 연두부, 다진 레몬청 과육을 섞어 소스를 만들고 양배추, 사과와 함께 버무려 두부 리코타 샐러드를 만든다.','MANUAL02'),(599,'3. 메밀면을 4분간 삶아 물기를 제거한 후 참기름, 간장을 넣어 버무린다.','MANUAL03'),(599,'4. 족발은 전자레인지에 1분간 돌리고 채 썰어 준비한다.','MANUAL04'),(599,'5. 김을 깔고 양념한 메밀면 → 깻잎 → 오이 → 당근 → 양파 → 두부 리코타 샐러드 → 족발 순서로 올려 말아 김밥을 만든다.','MANUAL05'),(599,'6. 김밥을 먹기 좋은 크기로 썰고 달걀지단을 올려 마무리한다.','MANUAL06'),(599,'','MANUAL07'),(599,'','MANUAL08'),(599,'','MANUAL09'),(599,'','MANUAL10'),(599,'','MANUAL11'),(599,'','MANUAL12'),(599,'','MANUAL13'),(599,'','MANUAL14'),(599,'','MANUAL15'),(599,'','MANUAL16'),(599,'','MANUAL17'),(599,'','MANUAL18'),(599,'','MANUAL19'),(599,'','MANUAL20'),(600,'1. 토마토(100g)와 무, 당근, 마늘, 양파는 작게 썰고, 연어는 길게 2장으로 포를 뜬다.','MANUAL01'),(600,'2. 믹서에 토마토(250g)를 넣어 간 뒤 체에 걸러 월계수잎과 함께 3분간 졸인다.','MANUAL02'),(600,'3. 졸인 토마토에 작게 썬 토마토와 무, 당근, 마늘, 양파, 소금을 넣어 1분간 볶다가 물(250㎖)을 넣고 5분간 끓인다.','MANUAL03'),(600,'4. 끓는 물(800㎖)에 메밀면을 넣어 4분간 삶아 찬물에 헹군 뒤 포 뜬 연어에 돌돌만다.','MANUAL04'),(600,'5. 면포 깐 찜기에 김이 오르면 메밀면을 감싼 연어를 넣어 3분간 찐다.','MANUAL05'),(600,'6. 그릇에 토마토채소스프와 연어소바찜을 담아 마무리한다.','MANUAL06'),(600,'','MANUAL07'),(600,'','MANUAL08'),(600,'','MANUAL09'),(600,'','MANUAL10'),(600,'','MANUAL11'),(600,'','MANUAL12'),(600,'','MANUAL13'),(600,'','MANUAL14'),(600,'','MANUAL15'),(600,'','MANUAL16'),(600,'','MANUAL17'),(600,'','MANUAL18'),(600,'','MANUAL19'),(600,'','MANUAL20'),(601,'1. 끓는 물(500㎖)에 참나물 줄기를 1분간 데쳐 건진 뒤 찬물에 헹군다.','MANUAL01'),(601,'2. 무는 둥근 모양을 살려 얇게 썰고, 참나물 잎은 얇게 채 썰고, 레몬은 강판에 갈아 제스트를 만든다.','MANUAL02'),(601,'3. 냄비에 절임물 재료와 물(40㎖)을 넣어 2분간 끓인 뒤 손질한 무를 넣어 30분간 절인다.','MANUAL03'),(601,'4. 믹서에 김칫국물 재료를 넣어 간 뒤 고운체에 거른다.','MANUAL04'),(601,'5. 절인 무에 채 썬 참나물 잎을 올려 돌돌 말고 데친 참나물 줄기로 묶는다.','MANUAL05'),(601,'6. 그릇에 무말이와 김칫국물을 담은 뒤 레몬 제스트를 뿌린다.','MANUAL06'),(601,'','MANUAL07'),(601,'','MANUAL08'),(601,'','MANUAL09'),(601,'','MANUAL10'),(601,'','MANUAL11'),(601,'','MANUAL12'),(601,'','MANUAL13'),(601,'','MANUAL14'),(601,'','MANUAL15'),(601,'','MANUAL16'),(601,'','MANUAL17'),(601,'','MANUAL18'),(601,'','MANUAL19'),(601,'','MANUAL20'),(602,'1. 소고기를 먹기 좋은 크기로 썬다.','MANUAL01'),(602,'2. 무를 한입 크기로 썬다.','MANUAL02'),(602,'3. 냄비에 참기름을 두르고 고기의 핏기가 없어질 때 까지 볶는다.','MANUAL03'),(602,'4. 고기가 익으면 무를 넣고 투명해질 때 까지 볶는다.','MANUAL04'),(602,'5. 중불에서 물을 붓고 끓으면 느타리버섯을 넣는다.','MANUAL05'),(602,'6. 숙주나물과 파를 넣고 한소끔 끓이고 저염간장과 고춧가루를 넣는다.','MANUAL06'),(602,'','MANUAL07'),(602,'','MANUAL08'),(602,'','MANUAL09'),(602,'','MANUAL10'),(602,'','MANUAL11'),(602,'','MANUAL12'),(602,'','MANUAL13'),(602,'','MANUAL14'),(602,'','MANUAL15'),(602,'','MANUAL16'),(602,'','MANUAL17'),(602,'','MANUAL18'),(602,'','MANUAL19'),(602,'','MANUAL20'),(603,'1. 락교는 물에 헹군다.','MANUAL01'),(603,'2. 락교의 물기를 제거한다.','MANUAL02'),(603,'3. 쪽파는 송송 썬다.','MANUAL03'),(603,'4. 마늘은 곱게 다진다.','MANUAL04'),(603,'5. 양념장을 만든다.','MANUAL05'),(603,'6. 락교와 쪽파, 다진마늘에 양념장을 골고루 버무려 마무리한다.','MANUAL06'),(603,'','MANUAL07'),(603,'','MANUAL08'),(603,'','MANUAL09'),(603,'','MANUAL10'),(603,'','MANUAL11'),(603,'','MANUAL12'),(603,'','MANUAL13'),(603,'','MANUAL14'),(603,'','MANUAL15'),(603,'','MANUAL16'),(603,'','MANUAL17'),(603,'','MANUAL18'),(603,'','MANUAL19'),(603,'','MANUAL20'),(604,'1. 쌀, 현미, 현미찹쌀은 물에 불린 뒤 고슬고슬하게 밥을 짓는다.','MANUAL01'),(604,'2. 분량의 식초, 설탕, 다시마, 레몬, 미향을 넣고 초밥용 배합초를 만들어 밥과 섞는다.','MANUAL02'),(604,'3. 우엉은 0.5cm 두께로 슬라이스 한 뒤 끓는 물에 데쳐 팬에 굽는다.','MANUAL03'),(604,'4. 애호박, 파프리카는 초밥 크기로 썰어 소금물에 절인 뒤 팬에 굽는다.','MANUAL04'),(604,'5. 밥을 초밥모양으로 길쭉하게 만든 뒤 파프리카, 우엉, 버섯, 애호박을 올려 초밥을 만든다.','MANUAL05'),(604,'6. 길게 썬 파래김으로 채소가 고정되도록 밥을 감싼다.','MANUAL06'),(604,'','MANUAL07'),(604,'','MANUAL08'),(604,'','MANUAL09'),(604,'','MANUAL10'),(604,'','MANUAL11'),(604,'','MANUAL12'),(604,'','MANUAL13'),(604,'','MANUAL14'),(604,'','MANUAL15'),(604,'','MANUAL16'),(604,'','MANUAL17'),(604,'','MANUAL18'),(604,'','MANUAL19'),(604,'','MANUAL20'),(605,'1. 국멸치, 건다시마로 육수를 낸다.','MANUAL01'),(605,'2. 꽃게는 먹기 좋은 크기로 손질하고, 바지락은 해감하여 준비한다.','MANUAL02'),(605,'3. 무는 나박썰기, 양파는 사각썰기, 애호박은 반달썰기, 파는 어슷썰기 한다.','MANUAL03'),(605,'4. 콩나물은 거두절미 한다.','MANUAL04'),(605,'5. 육수에 무, 꽃게, 바지락을 넣고 한소끔 끓인다.','MANUAL05'),(605,'6. 콩나물, 양파, 애호박 대파를 넣고 끓이다 간을 맞춰 마무리한다.','MANUAL06'),(605,'','MANUAL07'),(605,'','MANUAL08'),(605,'','MANUAL09'),(605,'','MANUAL10'),(605,'','MANUAL11'),(605,'','MANUAL12'),(605,'','MANUAL13'),(605,'','MANUAL14'),(605,'','MANUAL15'),(605,'','MANUAL16'),(605,'','MANUAL17'),(605,'','MANUAL18'),(605,'','MANUAL19'),(605,'','MANUAL20'),(606,'1. 다시마, 양파와 물을 넣고 육수를 만든다.','MANUAL01'),(606,'2. 새뱅이는 불순문을 제거하여 세척하고, 밀가루에 물을 넣어 손수제비 반죽을 한다.','MANUAL02'),(606,'3. 무와 호박은 나박썰기, 고추와 파는 어슷썰기, 마늘은 다진다.','MANUAL03'),(606,'4. 들기름 두른 냄비에 무, 고추장, 고춧가루를 볶다가 육수를 부워 끓인다.','MANUAL04'),(606,'5. 새뱅이와 호박, 고추 마늘을 넣어 끓인다.','MANUAL05'),(606,'6. 손수제비와 파를 넣고 간을 맞추고 마지막에 쑥갓을 올린다.','MANUAL06'),(606,'','MANUAL07'),(606,'','MANUAL08'),(606,'','MANUAL09'),(606,'','MANUAL10'),(606,'','MANUAL11'),(606,'','MANUAL12'),(606,'','MANUAL13'),(606,'','MANUAL14'),(606,'','MANUAL15'),(606,'','MANUAL16'),(606,'','MANUAL17'),(606,'','MANUAL18'),(606,'','MANUAL19'),(606,'','MANUAL20'),(607,'1. 물과 육수 재료를 넣고 끓여 육수를 만든다.','MANUAL01'),(607,'2. 끓인 육수를 체에 거른다.','MANUAL02'),(607,'3. 건미역과 황태를 물에 불린 후, 먹기 좋은 크기로 썬다.','MANUAL03'),(607,'4. 냄비에 참기름을 두르고 미역과 황태를 넣어 볶는다.','MANUAL04'),(607,'5. 냄비에 육수를 넣고 끓인다','MANUAL05'),(607,'6. 다진마늘과 저염국간장으로 간을 맞춰 마무리한다.','MANUAL06'),(607,'','MANUAL07'),(607,'','MANUAL08'),(607,'','MANUAL09'),(607,'','MANUAL10'),(607,'','MANUAL11'),(607,'','MANUAL12'),(607,'','MANUAL13'),(607,'','MANUAL14'),(607,'','MANUAL15'),(607,'','MANUAL16'),(607,'','MANUAL17'),(607,'','MANUAL18'),(607,'','MANUAL19'),(607,'','MANUAL20'),(608,'1. 닭과 가지는 먹기 좋은 사이즈로 토막 낸다.','MANUAL01'),(608,'2. 다진파, 다진 마늘, 맛술, 참기름, 올리고당에 닭을 재운다.','MANUAL02'),(608,'3. 매실엑기스, 간장, 식초, 다진마늘, 미림, 물을 섞어 소스를 만든다.','MANUAL03'),(608,'4. 가지와 닭은 오븐에 구워준다.','MANUAL04'),(608,'5. 구워진 닭과 가지를 매실소스에 버무린다.','MANUAL05'),(608,'6. 팬에 소스 묻은 닭과 가지를 볶아 낸다.','MANUAL06'),(608,'','MANUAL07'),(608,'','MANUAL08'),(608,'','MANUAL09'),(608,'','MANUAL10'),(608,'','MANUAL11'),(608,'','MANUAL12'),(608,'','MANUAL13'),(608,'','MANUAL14'),(608,'','MANUAL15'),(608,'','MANUAL16'),(608,'','MANUAL17'),(608,'','MANUAL18'),(608,'','MANUAL19'),(608,'','MANUAL20'),(609,'1. (속재료) 홍시는 껍질을 제거하고 체에 거른 다음 냄비에 레몬즙을 넣고 졸여서 잼을 만든다.','MANUAL01'),(609,'2. 강력분, 소금, 인스던트 이스트를 먼저 섞다가 달걀, 포도씨유, 미지근하게 데운 우유를 넣어 가며 반죽한다.\n★ 액체 온도가 60℃가 넘어가면 이스트가 죽을 수 있어 조심해 주세요.','MANUAL02'),(609,'3. 완성된 반죽을 1~2시간동안 실온에서 1차 발효 시킨 후, 세 덩어리로 나누어 15분 정도 2차 발효한다.','MANUAL03'),(609,'4. 반죽을 60g씩 8개의 덩어리로 만들어 밀대를 사용하여 피자도우처럼 얇게 편다.','MANUAL04'),(609,'5. 얇게 핀 반죽 위에 홍시 잼을 바르고 그 위에 핀 반죽을 올리는 걸 반복한 후 맨 위에 홍시 잼을 바르지 않은 반죽을 올리고 소량의 포도씨유를 바른 큐브식빵 틀에 담는다.','MANUAL05'),(609,'6. \"180도로 예열한 오븐에 식빵 틀을 넣고 40분정도 굽는다.\n★ 윗 면의 색이 많이 나면 종이 호일을 덮고 속까지 익혀요.\"','MANUAL06'),(609,'','MANUAL07'),(609,'','MANUAL08'),(609,'','MANUAL09'),(609,'','MANUAL10'),(609,'','MANUAL11'),(609,'','MANUAL12'),(609,'','MANUAL13'),(609,'','MANUAL14'),(609,'','MANUAL15'),(609,'','MANUAL16'),(609,'','MANUAL17'),(609,'','MANUAL18'),(609,'','MANUAL19'),(609,'','MANUAL20'),(610,'1. (속재료) 찐 고구마에 우유, 다진 아몬드, 크랜베리를 넣어 섞는다.\n★ 고구마를 물에 삶으면 수분이 많아 우유량을 조절해야 해요.','MANUAL01'),(610,'2. (비스킷) 버터를 부드럽게 만들어 준 다음 볶은 콩가루와 소금을 넣고 섞다가 계란을 조금씩 넣어 분리되지 않게 반죽한다. 여기에 체 친 박력 쌀가루와 베이킹파우더를 넣어 섞어준 뒤 냉장고에 30분간 휴지시킨다.','MANUAL02'),(610,'3. 코코넛 오일을 제외한 반죽 재료를 모두 반죽하다가 한 덩어리가 되면 코코넛 오일을 넣어 부드러워질 때까지 반죽한 다음 반죽의 크기가 두배가 될 때까지 발효한다. (약 1시간)','MANUAL03'),(610,'4. 1차 발효 반죽은 30g씩 분할해 둥글리기 하고 중간 발효 (약 15분)한 다음 반죽 속 가스를 빼고 ①의 속재료를 40g씩 넣어 감싼다.','MANUAL04'),(610,'5. 20g씩 비스킷을 분할해 비닐 위에 얇게 민 다음 비닐을 이용해 빵 반죽 위에 덮어준다.\n★반죽이 비닐에 달라 붙으면 덧가루를 조금 뿌려요.','MANUAL05'),(610,'6. 팬닝 후 2차 발효(약15분)를 하고 윗불 180℃ , 아랫불 160℃ 로 예열된 오븐에서 20분 굽는다.','MANUAL06'),(610,'','MANUAL07'),(610,'','MANUAL08'),(610,'','MANUAL09'),(610,'','MANUAL10'),(610,'','MANUAL11'),(610,'','MANUAL12'),(610,'','MANUAL13'),(610,'','MANUAL14'),(610,'','MANUAL15'),(610,'','MANUAL16'),(610,'','MANUAL17'),(610,'','MANUAL18'),(610,'','MANUAL19'),(610,'','MANUAL20'),(611,'1. 냉동 곤약에 칼집을 낸 뒤 냄비에 조림 양념과 물(40㎖)을 함께 넣고 5분간 조린다.','MANUAL01'),(611,'2. 팬에 채 썬 양파와 납작 썬 마늘을 넣어 3분간 볶다가 토마토 페이스트(30g)를 넣어 3분간 볶는다.','MANUAL02'),(611,'3. 채소 육수(100㎖), 간장(10g), 설탕(3g), 발사믹식초(5g)를 넣어 3분간 끓인 뒤 체에 밭쳐 건더기를 걸러 내 소스를 만든다.','MANUAL03'),(611,'4. 중간 불로 달군 마른 팬에 아몬드와 땅콩을 5분간 볶은 뒤 잘게 다진다.','MANUAL04'),(611,'5. 조린 곤약에 통밀가루(45g)와 물(40㎖)을 섞은 반죽을 입힌 뒤 잘게 다진 견과류를 묻힌다.','MANUAL05'),(611,'6. 중간 불로 달군 팬에 식용유(5㎖)를 두른 뒤 견과류를 묻힌 곤약을 넣어 앞뒤로 3~5분간 굽고, 그릇에 곤약가스를 올리고 ③의 소스를 곁들인다.','MANUAL06'),(611,'','MANUAL07'),(611,'','MANUAL08'),(611,'','MANUAL09'),(611,'','MANUAL10'),(611,'','MANUAL11'),(611,'','MANUAL12'),(611,'','MANUAL13'),(611,'','MANUAL14'),(611,'','MANUAL15'),(611,'','MANUAL16'),(611,'','MANUAL17'),(611,'','MANUAL18'),(611,'','MANUAL19'),(611,'','MANUAL20'),(612,'1. 양파는 5mm 두께로 채 썰고, 청양고추는 어슷 썬 뒤 씨를 제거하고, 관자는 깨끗하게 헹군 뒤 후춧가루로 밑간한다.','MANUAL01'),(612,'2. 두부에 우유와 생크림을 넣어 고루 섞어 두부크림을 만든다.','MANUAL02'),(612,'3. 중간 불로 달군 팬에 식용유(1.5Ts)를 두른 뒤 관자를 넣어 불투명해질 때까지 구워 꺼낸다.','MANUAL03'),(612,'4. 같은 팬에 식용유(0.5Ts)를 두른 뒤 다진 마늘과 양파를 넣어 볶다가 새우, 모시조개, 청양고추를 넣어 볶는다.','MANUAL04'),(612,'5. 물(100ml)을 넣어 조개가 입을 벌릴 때까지 끓이고, 두부크림을 넣어 끓어오르면 관자를 넣어 3분간 익힌다.','MANUAL05'),(612,'6. 그릇에 담아 바질을 올리고, 그라나파다노 치즈를 뿌려 마무리한다.','MANUAL06'),(612,'','MANUAL07'),(612,'','MANUAL08'),(612,'','MANUAL09'),(612,'','MANUAL10'),(612,'','MANUAL11'),(612,'','MANUAL12'),(612,'','MANUAL13'),(612,'','MANUAL14'),(612,'','MANUAL15'),(612,'','MANUAL16'),(612,'','MANUAL17'),(612,'','MANUAL18'),(612,'','MANUAL19'),(612,'','MANUAL20'),(613,'1. 물에 다시팩을 넣고 20분간 중불에 끓여 육수를 만들고, 오징어는 껍질을 벗겨 솔방울 모양으로 썰고 홍합은 수염을 제거하고 새우는 몸통의 껍질을 벗긴다.','MANUAL01'),(613,'2. 토마토는 껍질을 벗겨 5×5mm 크기로 썰고, 알배추, 표고버섯, 청양고추, 양파, 우목심, 깻잎은 채 썰고 청경채는 어슷 썬다.','MANUAL02'),(613,'3. 팬에 토마토 페이스트를 볶다가 토마토를 넣고 끓이고 고춧가루, 다시마 육수(200ml)를 넣고 살짝 끓여 토마토 소스를 만든다.','MANUAL03'),(613,'4. 팬에 식용유를 두르고 대파, 편 마늘을 볶고, 우목심, 새우, 오징어, 홍합, 알배추, 양파, 표고버섯, 건고추를 넣어 볶다가 후추로 간하고, 간장을 넣는다.','MANUAL04'),(613,'5. 토마토 소스를 함께 넣어 5분간 끓인다.','MANUAL05'),(613,'6. 청경채, 팽이버섯, 숙주를 넣어 살짝 볶고, 깻잎과 누룽지를 올려 마무리한다.','MANUAL06'),(613,'','MANUAL07'),(613,'','MANUAL08'),(613,'','MANUAL09'),(613,'','MANUAL10'),(613,'','MANUAL11'),(613,'','MANUAL12'),(613,'','MANUAL13'),(613,'','MANUAL14'),(613,'','MANUAL15'),(613,'','MANUAL16'),(613,'','MANUAL17'),(613,'','MANUAL18'),(613,'','MANUAL19'),(613,'','MANUAL20'),(614,'1. 토마토를 데쳐 껍질을 벗겨낸 뒤 잘게 썬다.','MANUAL01'),(614,'2. 마늘과 양파를 잘게 다진 뒤 썰어둔 토마토, 고추장, 꿀, 식초와 골고루 섞는다.','MANUAL02'),(614,'3. 도라지는 껍질을 벗긴 뒤 물에 담궈 쓴맛을 제거하고 길이 5cm, 두께 0.5cm로 찢는다.','MANUAL03'),(614,'4. 시금치는 뿌리를 잘라내고 2~4등분으로 나눈다.','MANUAL04'),(614,'5. 고사리는 깨끗하게 씻은 뒤 물에 불린다.','MANUAL05'),(614,'6. 끓는 물에 소금을 넣고 도라지, 시금치, 고사리 순으로 데친 뒤 찬물에 헹궈 물기를 짜고 양념장을 곁들인다.','MANUAL06'),(614,'','MANUAL07'),(614,'','MANUAL08'),(614,'','MANUAL09'),(614,'','MANUAL10'),(614,'','MANUAL11'),(614,'','MANUAL12'),(614,'','MANUAL13'),(614,'','MANUAL14'),(614,'','MANUAL15'),(614,'','MANUAL16'),(614,'','MANUAL17'),(614,'','MANUAL18'),(614,'','MANUAL19'),(614,'','MANUAL20'),(615,'1. 강력분, 소금, 이스트, 물을 넣어 만든 반죽을 3등분 하여 각각 당근, 참나물, 연근을 다져 넣어 섞어준다.','MANUAL01'),(615,'2. 반죽에 글루텐이 형성되면 각각 식용유와 버터를 넣어 섞고, 연근을 넣은 반죽에는 마지막에 견과류를 넣어 섞는다.\n★다른 반죽보다 향이 없는 연근 반죽에 견과류를 넣어 맛을 냈어요.','MANUAL02'),(615,'3. 반죽이 완료되면 3-40분 정도 1차 발효를 한다.','MANUAL03'),(615,'4. 1차 발효 후 30g씩 무게를 달아 둥글리기하고 중간 발효 후 길게 밀어 편다.','MANUAL04'),(615,'5. 20분 정도 2차 발효를 한다.','MANUAL05'),(615,'6. 아랫불 160, 윗불 180℃ 오븐에서 18분 동안 굽는다.','MANUAL06'),(615,'','MANUAL07'),(615,'','MANUAL08'),(615,'','MANUAL09'),(615,'','MANUAL10'),(615,'','MANUAL11'),(615,'','MANUAL12'),(615,'','MANUAL13'),(615,'','MANUAL14'),(615,'','MANUAL15'),(615,'','MANUAL16'),(615,'','MANUAL17'),(615,'','MANUAL18'),(615,'','MANUAL19'),(615,'','MANUAL20'),(616,'1. 끓는 물(800㎖)에 양배추와 시금치를 넣어 데친 뒤 찬물에 헹궈 체에 밭쳐 물기를 제거한다.','MANUAL01'),(616,'2. 데친 시금치와 오이, 당근은 얇게 채 썬다.','MANUAL02'),(616,'3. 데친 양배추를 깔고 위에 채 썬 재료를 올려 돌돌 말아준다.','MANUAL03'),(616,'4. 양념장을 만든다.','MANUAL04'),(616,'5. 양배추말이를 한입 크기로 썰어 그릇에 담은 뒤 양념장을 곁들인다.','MANUAL05'),(616,'','MANUAL06'),(616,'','MANUAL07'),(616,'','MANUAL08'),(616,'','MANUAL09'),(616,'','MANUAL10'),(616,'','MANUAL11'),(616,'','MANUAL12'),(616,'','MANUAL13'),(616,'','MANUAL14'),(616,'','MANUAL15'),(616,'','MANUAL16'),(616,'','MANUAL17'),(616,'','MANUAL18'),(616,'','MANUAL19'),(616,'','MANUAL20'),(617,'1. 콜리플라워는 송이 부분만 떼어내고, 고구마와 양파는 한입 크기로 썬다.','MANUAL01'),(617,'2. 양고기는 한입 크기로 썰어 밑간한 뒤 15분간 재운다.','MANUAL02'),(617,'3. 재워둔 고기에 손질한 채소와 마늘을 넣어 고루 버무리고, 중간 불로 달군 팬에 올려 고구마가 약간 익을 때까지 볶는다.','MANUAL03'),(617,'4. 양념을 넣어 재료와 고루 섞는다.','MANUAL04'),(617,'5. 단호박은 전자레인지에 5분간 돌리고, 익으면 윗부분을 약간 잘라낸 뒤 씨를 제거하고, 양고기와 볶은 재료를 단호박 속에 채운다.','MANUAL05'),(617,'6. 찜기에 넣어 25분간 쪄낸 뒤 8등분하여 마무리한다.','MANUAL06'),(617,'','MANUAL07'),(617,'','MANUAL08'),(617,'','MANUAL09'),(617,'','MANUAL10'),(617,'','MANUAL11'),(617,'','MANUAL12'),(617,'','MANUAL13'),(617,'','MANUAL14'),(617,'','MANUAL15'),(617,'','MANUAL16'),(617,'','MANUAL17'),(617,'','MANUAL18'),(617,'','MANUAL19'),(617,'','MANUAL20'),(618,'1. 단호박, 팽이버섯, 새송이버섯, 느타리버섯, 쌈추, 적근대, 배추, 숙주와 소고기를 3cm 크기로 자른다.','MANUAL01'),(618,'2. 팬에 식용유(20g)를 두르고 중간 불에 손질한 채소와 소고기를 차례대로 볶는다.','MANUAL02'),(618,'3. 볼에 달걀을 풀고 소금, 우유를 넣고 섞어 달걀물을 만든다.','MANUAL03'),(618,'4. 타르트 틀에 식용유(6g)를 바르고 볶은 채소, 소고기를 올리고 ③을 넣는다.','MANUAL04'),(618,'5. 140도로 예열한 오븐에 25분 정도 구워 프리타타를 만든다.','MANUAL05'),(618,'6. 프리타타 위에 새싹채소와 리코타 치즈를 올린 후 올리브유를 두르고 마무리한다.','MANUAL06'),(618,'','MANUAL07'),(618,'','MANUAL08'),(618,'','MANUAL09'),(618,'','MANUAL10'),(618,'','MANUAL11'),(618,'','MANUAL12'),(618,'','MANUAL13'),(618,'','MANUAL14'),(618,'','MANUAL15'),(618,'','MANUAL16'),(618,'','MANUAL17'),(618,'','MANUAL18'),(618,'','MANUAL19'),(618,'','MANUAL20'),(619,'1. 냄비에 물, 무, 대파를 넣고 끓으면 불을 끄고 가다랑어포를 넣고, 30분 후에 체로 걸러 육수를 만든다.','MANUAL01'),(619,'2. 애호박, 가지, 표고버섯은 두께 5mm 크기로 썬다. 시래기는 굵게 다진다.','MANUAL02'),(619,'3. 고등어는 흐르는 물에 씻은 후 키친타월로 물기를 제거하고, 180도로 예열한 팬에 식용유를 두르고 고등어를 껍질부터 앞뒤로 10분 동안 굽는다.','MANUAL03'),(619,'4. 고등어를 구운 팬에 남은 기름을 이용해 시래기를 볶고, 토마토 홀을 넣고 주걱으로 으깬다.','MANUAL04'),(619,'5. 육수(500g)와 양념장, 구운 고등어, 손질한 애호박, 가지, 표고버섯을 넣고 중간 불에서 조린다.','MANUAL05'),(619,'6. 청양고추, 두부면을 넣고 2분 정도 더 조리한 후 불을 끄고 접시에 담고, 바질 잎을 올려 마무리한다.','MANUAL06'),(619,'','MANUAL07'),(619,'','MANUAL08'),(619,'','MANUAL09'),(619,'','MANUAL10'),(619,'','MANUAL11'),(619,'','MANUAL12'),(619,'','MANUAL13'),(619,'','MANUAL14'),(619,'','MANUAL15'),(619,'','MANUAL16'),(619,'','MANUAL17'),(619,'','MANUAL18'),(619,'','MANUAL19'),(619,'','MANUAL20'),(620,'1. 홍시를 반으로 가르고 껍질을 벗긴다.','MANUAL01'),(620,'2. 씨를 제거한 뒤 3등분으로 썬다.','MANUAL02'),(620,'3. 배는 1/4로 나눠 껍질을 벗긴다.','MANUAL03'),(620,'4. 믹서에 배, 홍시를 넣고 간다.','MANUAL04'),(620,'5. 4를 냉동실에서 살짝 얼린다.','MANUAL05'),(620,'6. 반쯤 얼었을 때 탄산수와 사이다를 섞는다.','MANUAL06'),(620,'','MANUAL07'),(620,'','MANUAL08'),(620,'','MANUAL09'),(620,'','MANUAL10'),(620,'','MANUAL11'),(620,'','MANUAL12'),(620,'','MANUAL13'),(620,'','MANUAL14'),(620,'','MANUAL15'),(620,'','MANUAL16'),(620,'','MANUAL17'),(620,'','MANUAL18'),(620,'','MANUAL19'),(620,'','MANUAL20'),(621,'1. 쌀뜨물과 국멸치로 육수를 우리고 멸치를 건져낸다.','MANUAL01'),(621,'2. 무는 나박썰기, 대파는 어슷썰기, 마늘은 다진다.','MANUAL02'),(621,'3. 묵은지는 물에 헹구어 짠맛을 빼주고 기름에 살짝 볶는다.','MANUAL03'),(621,'4. 멸치육수에 묵은지, 낙지, 고춧가루, 무, 마늘을 넣고 끓인다.','MANUAL04'),(621,'5. 콩나물을 넣고 국간장으로 간을 하여 끓인다.','MANUAL05'),(621,'6. 대파를 얹어 마무리한다.','MANUAL06'),(621,'','MANUAL07'),(621,'','MANUAL08'),(621,'','MANUAL09'),(621,'','MANUAL10'),(621,'','MANUAL11'),(621,'','MANUAL12'),(621,'','MANUAL13'),(621,'','MANUAL14'),(621,'','MANUAL15'),(621,'','MANUAL16'),(621,'','MANUAL17'),(621,'','MANUAL18'),(621,'','MANUAL19'),(621,'','MANUAL20'),(622,'1. (속재료) 삶은 밤고구마와 바나나를 섞은 앙금을 35g씩 둥글리기 해주고 여유분 바나나는 0.5두께로 슬라이스한다.','MANUAL01'),(622,'2. (버터크림) 삶은 자색고구마와 밤고구마를 으깬 후 물을 넣어 반죽하다가 박력분, 달걀 1개를 풀어 잘 섞어 준 후 버터를 넣고 덩어리가 생기지 않게 섞어 짤주머니에 담는다.','MANUAL02'),(622,'3. 체에 내린 강력분과 박력분에 소금,이스트를 넣어 섞어주고 밤고구마 130g, 바나나 180g, 달걀 1개를 섞어 반죽이 한 덩이가 되면 무염버터 30g을 넣어 치댄다.','MANUAL03'),(622,'4. 반죽이 2배가 되도록 1차 발효 후 50g 분할해 둥글리기 해서 10분 정도 중간 발효한다.','MANUAL04'),(622,'5. 반죽에 앙금과 바나나슬라이스를 넣어 동그랗게 모양을 만들어 2차 발효 시키고 굽기 전에 고구마 버터크림을 올려준다.\n★이음새가 벌어지면 구우면서 반죽이 터져지니 꼼꼼히 붙여주세요.','MANUAL05'),(622,'6. 윗불 180℃ 아랫불 160℃로 예열된 오븐에서 20분 구워낸다.','MANUAL06'),(622,'','MANUAL07'),(622,'','MANUAL08'),(622,'','MANUAL09'),(622,'','MANUAL10'),(622,'','MANUAL11'),(622,'','MANUAL12'),(622,'','MANUAL13'),(622,'','MANUAL14'),(622,'','MANUAL15'),(622,'','MANUAL16'),(622,'','MANUAL17'),(622,'','MANUAL18'),(622,'','MANUAL19'),(622,'','MANUAL20'),(623,'1. (소스) 소스에 들어가는 재료는 전부 다진 후 기름 두른 팬에 양파를 먼저 볶다가 남은 재료를 넣고 볶아 준 뒤 물을 넣고 끓여 조린다.','MANUAL01'),(623,'2. 반죽 재료를 넣고 27℃ 최종단계 까지 믹싱한 후 1차 발효는 고온발효로 27℃에서 1시간 발효한다.','MANUAL02'),(623,'3. 150g씩 분할하여 모양을 성형한 후 면포 위에 팬닝한다.\n★반죽이 많이 질어요. 손에 묻으면 덧밀가루를 뿌려가며 진행하세요.','MANUAL03'),(623,'4. 2차 발효는 온도는 30℃, 수분은 75%에서 60분간 발효한 후 오븐팬에 팬닝한다.','MANUAL04'),(623,'5. 반죽 위에 만들어 놓은 토마토 소스를 바르고 스팀 160℃/230℃에서 13분간 굽는다.','MANUAL05'),(623,'6. 치즈를 올리고 4분간 구워낸다.','MANUAL06'),(623,'','MANUAL07'),(623,'','MANUAL08'),(623,'','MANUAL09'),(623,'','MANUAL10'),(623,'','MANUAL11'),(623,'','MANUAL12'),(623,'','MANUAL13'),(623,'','MANUAL14'),(623,'','MANUAL15'),(623,'','MANUAL16'),(623,'','MANUAL17'),(623,'','MANUAL18'),(623,'','MANUAL19'),(623,'','MANUAL20'),(624,'1. 양파(30g)는 다지고, 나머지 양파와 감자, 당근, 닭가슴살은 한입 크기로 썬다.','MANUAL01'),(624,'2. 닭가슴살은 밑간해 고루 버무려 재운다.','MANUAL02'),(624,'3. 끓는 물에 토마토를 넣어 20초간 데쳐 건진 뒤 껍질을 벗겨 8등분한다.','MANUAL03'),(624,'4. 중간 불로 달군 팬에 올리브유(10g)를 두른 뒤 다진 양파와 올리고당, 다진 마늘, 카레가루를 넣어 2분간 볶다가 손질한 토마토를 넣고 으깨듯 볶는다.','MANUAL04'),(624,'5. 손질한 채소와 밑간한 닭가슴살을 넣고 2분간 볶은 뒤 코코넛워터와 우유를 부어 끓인다.','MANUAL05'),(624,'6. 그릇에 현미밥을 담고 카레를 부은 뒤 요거트소스와 파슬리가루(0.5g)를 올려 마무리한다.','MANUAL06'),(624,'','MANUAL07'),(624,'','MANUAL08'),(624,'','MANUAL09'),(624,'','MANUAL10'),(624,'','MANUAL11'),(624,'','MANUAL12'),(624,'','MANUAL13'),(624,'','MANUAL14'),(624,'','MANUAL15'),(624,'','MANUAL16'),(624,'','MANUAL17'),(624,'','MANUAL18'),(624,'','MANUAL19'),(624,'','MANUAL20'),(625,'1. 단호박은 3mm 정도 윗부분을 도려내 씨를 제거한 뒤 전자레인지에 5분간 돌려 익힌다.','MANUAL01'),(625,'2. 단호박 씨를 제거한 뒤 속(50g)을 파서 덜어놓는다.','MANUAL02'),(625,'3. 달걀은 곱게 풀어 체에 내린 뒤 맛술, 우유, 모차렐라치즈(20g), 덜어 놓은 호박과 함께 믹서에 넣어 간다.','MANUAL03'),(625,'4. 속을 파낸 단호박에 간 재료를 넣은 뒤 뚜껑을 닫고 전자레인지에 8분간 돌려 익힌다.','MANUAL04'),(625,'5. 뚜껑을 열고 모차렐라치즈(10g)를 올려 전자레인지에 3분간 돌려 녹인다.','MANUAL05'),(625,'6. 단호박을 6~7등분해 그릇에 담고 꿀과 그라나파다노치즈, 아몬드 플레이크, 파슬리가루를 뿌린다.','MANUAL06'),(625,'','MANUAL07'),(625,'','MANUAL08'),(625,'','MANUAL09'),(625,'','MANUAL10'),(625,'','MANUAL11'),(625,'','MANUAL12'),(625,'','MANUAL13'),(625,'','MANUAL14'),(625,'','MANUAL15'),(625,'','MANUAL16'),(625,'','MANUAL17'),(625,'','MANUAL18'),(625,'','MANUAL19'),(625,'','MANUAL20'),(626,'1. 양파는 도톰하게 채 썰고, 양송이버섯은 모양대로 썰고, 마늘은 납작 썰고, 토마토는 6~8등분한다.','MANUAL01'),(626,'2. 채소 육수(6컵)에 탈리아텔레를 넣고 13분간 삶아 건진다.','MANUAL02'),(626,'3. 중간 불로 달군 팬에 올리브유를 두른 뒤 납작 썬 마늘을 노릇하게 익히고, 양파와 양송이버섯을 넣어 3분간 볶는다.','MANUAL03'),(626,'4. 면수(1컵), 강황가루, 고운 고춧가루를 넣어 고루 섞고, 토마토를 넣어 볶다가 식물성 생크림과 두유를 넣어 끓어 오르면 말린 토마토를 넣고 1분간 끓인다.','MANUAL04'),(626,'5. 삶은 탈리아텔레를 넣고, 소스가 면에 잘 배어들게 고루 볶은 뒤 후춧가루를 뿌린다.','MANUAL05'),(626,'6. 그릇에 담고 다진 파슬리와 핑크 페퍼를 뿌리고, 바질잎과 바게트를 곁들여 마무리한다.','MANUAL06'),(626,'','MANUAL07'),(626,'','MANUAL08'),(626,'','MANUAL09'),(626,'','MANUAL10'),(626,'','MANUAL11'),(626,'','MANUAL12'),(626,'','MANUAL13'),(626,'','MANUAL14'),(626,'','MANUAL15'),(626,'','MANUAL16'),(626,'','MANUAL17'),(626,'','MANUAL18'),(626,'','MANUAL19'),(626,'','MANUAL20'),(627,'1. 껍질 벗긴 토마토는 주사위 모양으로 썰고, 양파, 배추, 청경채, 숙주는 잘게 썬다.','MANUAL01'),(627,'2. 팬에 소고기 양지를 구운 뒤 꺼내고, 같은 팬에 식용유를 두르고 다진 마늘과 손질한 채소를 넣고 물기가 없어질 때까지 볶는다.','MANUAL02'),(627,'3. ②에 소고기 다짐육을 넣어 볶다가 손질한 완숙 토마토, 월계수 잎, 화이트 와인, 오레가노를 넣어 끓이고 소금, 후추로 간하여 소스를 만든다.','MANUAL03'),(627,'4. 당면은 6cm 길이로 잘라 끓는 물에 7분간 삶아 ③에 넣는다.','MANUAL04'),(627,'5. 쌈두부 → 구운 소고기 양지 → 소스 → 모차렐라 치즈 순으로 켜켜이 올리고 180도로 예열한 오븐에 8분간 익힌다.','MANUAL05'),(627,'6. 깻잎을 돌돌 말아 채 썰어 올려 마무리한다.','MANUAL06'),(627,'','MANUAL07'),(627,'','MANUAL08'),(627,'','MANUAL09'),(627,'','MANUAL10'),(627,'','MANUAL11'),(627,'','MANUAL12'),(627,'','MANUAL13'),(627,'','MANUAL14'),(627,'','MANUAL15'),(627,'','MANUAL16'),(627,'','MANUAL17'),(627,'','MANUAL18'),(627,'','MANUAL19'),(627,'','MANUAL20'),(628,'1. 생강과 마늘을 잘게 다진다.','MANUAL01'),(628,'2. 코다리를 세척 후 다진마늘, 다진생강, 소금, 후추로 밑간한다.','MANUAL02'),(628,'3. 냄비에 다시멸치, 다시마를 넣고 끓여 육수를 우린 뒤 건져낸다.','MANUAL03'),(628,'4. 무, 대파, 양파, 연근, 우엉, 호박, 느타리버섯, 표고버섯, 청양고추를 깨끗이 씻어 먹기좋은 크기로 썬다.','MANUAL04'),(628,'5. 육수에 대파, 청양고추, 쑥갓을 뺀 야채를 넣고 끓이다가 들깨가루와 천일염을 넣어 간 한다.','MANUAL05'),(628,'6. 마지막으로 코다리를 넣고 거품을 걷어가며 끓인 뒤 대파, 청양고추, 쑥갓을 올린다.','MANUAL06'),(628,'','MANUAL07'),(628,'','MANUAL08'),(628,'','MANUAL09'),(628,'','MANUAL10'),(628,'','MANUAL11'),(628,'','MANUAL12'),(628,'','MANUAL13'),(628,'','MANUAL14'),(628,'','MANUAL15'),(628,'','MANUAL16'),(628,'','MANUAL17'),(628,'','MANUAL18'),(628,'','MANUAL19'),(628,'','MANUAL20'),(629,'1. 배추는 한입 크기로 썰고, 대파는 6cm 길이로 썰어 길게 2등분하고, 가자미는 먹기 좋은 크기로 자른다.','MANUAL01'),(629,'2. 가자미에 밑간을 고루 버무린 뒤 냉장실에서 20분간 재운다.','MANUAL02'),(629,'3. 찹쌀싸라기 재료를 고루 섞는다.','MANUAL03'),(629,'4. 재워둔 가자미에 찹쌀가루(5g)를 고루 바른 뒤 찹쌀싸라기를 촘촘히 입힌다.','MANUAL04'),(629,'5. 찜기에 배추와 대파를 깔고 가자미를 올린 뒤 12분간 찌고 불을 꺼 5분간 뜸 들인다.','MANUAL05'),(629,'6. 그릇에 담아 마무리한다.','MANUAL06'),(629,'','MANUAL07'),(629,'','MANUAL08'),(629,'','MANUAL09'),(629,'','MANUAL10'),(629,'','MANUAL11'),(629,'','MANUAL12'),(629,'','MANUAL13'),(629,'','MANUAL14'),(629,'','MANUAL15'),(629,'','MANUAL16'),(629,'','MANUAL17'),(629,'','MANUAL18'),(629,'','MANUAL19'),(629,'','MANUAL20'),(630,'1. 깻잎은 깨끗이 씻고, 청경채는 2등분하고, 새우는 머리를 제거한 뒤 껍질을 벗기고, 삼치는 밑간한다.','MANUAL01'),(630,'2. 냄비에 깻잎과 생크림, 올리브유(3㎖)를 넣어 끓어오르면 믹서에 넣어 곱게 간 뒤 체에 걸러 퓌레를 만든다.','MANUAL02'),(630,'3. 삶은 감자는 으깬 뒤 녹인 무염 버터와 설탕(3g),후춧가루(3g)를 고루 섞고 체에 한 번 걸러 우유를 섞어 매시드 포테이토를 만든다.','MANUAL03'),(630,'4. 손질한 새우에 튀김옷을 입혀 180℃로 달군 식용유(180㎖)에 3분간 튀겨 건지고, 마른 팬에 손질한 청경채를 볶은 뒤 토치로 불맛을 낸다.','MANUAL04'),(630,'5. 중간 불로 달군 팬에 식용유(5㎖)를 두른 뒤 밑간한 삼치를 5분간 앞뒤로 노릇하게 구워 꺼낸다.','MANUAL05'),(630,'6. 그릇에 깻잎퓌레 → 구운 삼치 → 매시드 포테이토 → 청경채 → 튀긴 새우 → 꽃잎 순으로 올린다.','MANUAL06'),(630,'','MANUAL07'),(630,'','MANUAL08'),(630,'','MANUAL09'),(630,'','MANUAL10'),(630,'','MANUAL11'),(630,'','MANUAL12'),(630,'','MANUAL13'),(630,'','MANUAL14'),(630,'','MANUAL15'),(630,'','MANUAL16'),(630,'','MANUAL17'),(630,'','MANUAL18'),(630,'','MANUAL19'),(630,'','MANUAL20'),(631,'1. 참나물은 얇게 썰고, 방울토마토는 2등분하고, 잣은 곱게 빻아 잣가루를 만든다.','MANUAL01'),(631,'2. 믹서에 참나물 페스토 재료를 넣고 갈아 페스토를 만든다.','MANUAL02'),(631,'3. 끓는 소금물(물 8컵과 소금 1g 비율)에 스파게티를 넣어 8분간 삶아 건진다.','MANUAL03'),(631,'4. 스파게티에 페스토를 넣어 버무린다.','MANUAL04'),(631,'5. 그릇에 스파게티를 담은 뒤 손질한 참나물을 올리고 올리브유, 잣가루를 뿌린다.','MANUAL05'),(631,'6. 손질한 방울토마토를 곁들여 마무리한다.','MANUAL06'),(631,'','MANUAL07'),(631,'','MANUAL08'),(631,'','MANUAL09'),(631,'','MANUAL10'),(631,'','MANUAL11'),(631,'','MANUAL12'),(631,'','MANUAL13'),(631,'','MANUAL14'),(631,'','MANUAL15'),(631,'','MANUAL16'),(631,'','MANUAL17'),(631,'','MANUAL18'),(631,'','MANUAL19'),(631,'','MANUAL20'),(632,'1. 방울토마토는 4등분하고, 아보카도는 얇게 모양대로 썰고, 로메인은 깨끗하게 씻어 물기를 제거하고, 양파, 대파, 미나리는 4cm 길이로 썰고, 마늘은 납작 썬다.','MANUAL01'),(632,'2. 중간 불로 달군 팬에 올리브유를 두른 뒤 납작 썬 마늘, 양파, 대파를 넣어 1분간 볶는다.','MANUAL02'),(632,'3. 대패삼겹살과 후춧가루를 넣어 겉면이 노릇해질 때까지 볶고, 미나리, 간장, 꿀을 넣어 1분 정도 볶고, 카레가루, 고운 고춧가루를 넣어 고루 섞으며 볶는다.','MANUAL03'),(632,'4. 허니요거트소스를 만든다.','MANUAL04'),(632,'5. 치아바타는 마른 팬에 안쪽 면을 노릇하게 구워 꺼내고, 빵 안쪽에 허니 요거트소스를 바른다.','MANUAL05'),(632,'6. 로메인, 삼겹살볶음, 허니요거트소스, 아보카도, 방울토마토, 후춧가루 순으로 올려 마무리한다.','MANUAL06'),(632,'','MANUAL07'),(632,'','MANUAL08'),(632,'','MANUAL09'),(632,'','MANUAL10'),(632,'','MANUAL11'),(632,'','MANUAL12'),(632,'','MANUAL13'),(632,'','MANUAL14'),(632,'','MANUAL15'),(632,'','MANUAL16'),(632,'','MANUAL17'),(632,'','MANUAL18'),(632,'','MANUAL19'),(632,'','MANUAL20'),(633,'1. 어린잎채소는 깨끗하게 씻어 물기를 제거하고, 견과류는 굵게 다진다.','MANUAL01'),(633,'2. 건두부는 끓는 물에 데쳐 건져낸 뒤 물기를 제거한다.','MANUAL02'),(633,'3. 건두부 위에 어린잎채소(3컵)를 올리고, 돌돌 말아 한입 크기로 썬다.','MANUAL03'),(633,'4. 남은 어린잎채소에 다진 견과류와 슈레드모차렐라치즈를 고루 섞는다.','MANUAL04'),(633,'5. 라임청의 라임을 얇게 다지고, 나머지 라임청드레싱 재료와 고루 섞는다.','MANUAL05'),(633,'6. 그릇에 건두부말이와 샐러드를 담고, 라임청 드레싱을 뿌려 마무리한다.','MANUAL06'),(633,'','MANUAL07'),(633,'','MANUAL08'),(633,'','MANUAL09'),(633,'','MANUAL10'),(633,'','MANUAL11'),(633,'','MANUAL12'),(633,'','MANUAL13'),(633,'','MANUAL14'),(633,'','MANUAL15'),(633,'','MANUAL16'),(633,'','MANUAL17'),(633,'','MANUAL18'),(633,'','MANUAL19'),(633,'','MANUAL20'),(634,'1. 오징어, 새우, 당근, 양파를 믹서에 갈아 달걀흰자를 넣어 치댄 후 완자를 만들어 160도로 예열한 식용유에 4분 정도 튀긴다.','MANUAL01'),(634,'2. 붉은 파프리카와 피망은 올리브유에 살짝 볶는다.','MANUAL02'),(634,'3. 양장피 면은 끓는 물에 5분간 데치고, 같은 냄비에 건목이버섯을 데친다.','MANUAL03'),(634,'4. 양장피 면이 서로 달라붙지 않게 참기름에 버무리고 돌돌 말아 접시 위에 올린다.','MANUAL04'),(634,'5. 크레미, 데친 건목이버섯, 달걀지단을 면 위에 올리고, 튀겨낸 완자, 딜, 볶은 파프리카와 피망을 올린다.','MANUAL05'),(634,'6. 콩국물을 붓고 볶음 소스를 곁들여 마무리한다.','MANUAL06'),(634,'','MANUAL07'),(634,'','MANUAL08'),(634,'','MANUAL09'),(634,'','MANUAL10'),(634,'','MANUAL11'),(634,'','MANUAL12'),(634,'','MANUAL13'),(634,'','MANUAL14'),(634,'','MANUAL15'),(634,'','MANUAL16'),(634,'','MANUAL17'),(634,'','MANUAL18'),(634,'','MANUAL19'),(634,'','MANUAL20'),(635,'1. 볼에 계란을 푼다.','MANUAL01'),(635,'2. 마늘을 다져 계란과 섞고 파마산치즈, 후추를 넣어 간을 맞춘다.','MANUAL02'),(635,'3. 양파는 채 썰고 브로콜리는 깍둑썰고 그린빈스는 2cm 길이로 자른다.','MANUAL03'),(635,'4. 3의 재료를 볶은 뒤 계란물과 섞는다.','MANUAL04'),(635,'5. 방울토마토를 반으로 잘라 4에 넣는다.','MANUAL05'),(635,'6. 그릇에 옮겨 담아 찐다.','MANUAL06'),(635,'','MANUAL07'),(635,'','MANUAL08'),(635,'','MANUAL09'),(635,'','MANUAL10'),(635,'','MANUAL11'),(635,'','MANUAL12'),(635,'','MANUAL13'),(635,'','MANUAL14'),(635,'','MANUAL15'),(635,'','MANUAL16'),(635,'','MANUAL17'),(635,'','MANUAL18'),(635,'','MANUAL19'),(635,'','MANUAL20'),(636,'1. 배 껍질을 벗긴다.','MANUAL01'),(636,'2. 껍질 벗긴 배를 깍둑썰기 한다.','MANUAL02'),(636,'3. 쪽파를 송송 썬다.','MANUAL03'),(636,'4. 마늘을 곱게 다진다.','MANUAL04'),(636,'5. 고춧가루, 액젓, 다진마늘, 쪽파를 섞어 양념을 만든다.','MANUAL05'),(636,'6. 깍둑썰기한 배와 양념을 버무린다.','MANUAL06'),(636,'','MANUAL07'),(636,'','MANUAL08'),(636,'','MANUAL09'),(636,'','MANUAL10'),(636,'','MANUAL11'),(636,'','MANUAL12'),(636,'','MANUAL13'),(636,'','MANUAL14'),(636,'','MANUAL15'),(636,'','MANUAL16'),(636,'','MANUAL17'),(636,'','MANUAL18'),(636,'','MANUAL19'),(636,'','MANUAL20'),(637,'1. 가시를 제거한 가자미와 양파, 대파는 다진다.','MANUAL01'),(637,'2. ①에 으깬두부와 후추를 넣어 동그랗게 완자를 만든다.','MANUAL02'),(637,'3. 무는 나박 썰기, 청?홍고추는 어슷썰기한다.','MANUAL03'),(637,'4. 바지락은 해감 후 무와 함께 끓인다.','MANUAL04'),(637,'5. 바지락 육수에 완자를 넣어 한소끔 끊인다.','MANUAL05'),(637,'6. 마지막에 쑥갓, 청홍고추, 팽이버섯을 넣어 마무리한다.','MANUAL06'),(637,'','MANUAL07'),(637,'','MANUAL08'),(637,'','MANUAL09'),(637,'','MANUAL10'),(637,'','MANUAL11'),(637,'','MANUAL12'),(637,'','MANUAL13'),(637,'','MANUAL14'),(637,'','MANUAL15'),(637,'','MANUAL16'),(637,'','MANUAL17'),(637,'','MANUAL18'),(637,'','MANUAL19'),(637,'','MANUAL20'),(638,'1. 배추는 손질하여 심심하게 절인다.','MANUAL01'),(638,'2. 국멸치, 건표고버섯으로 육수를 낸다.','MANUAL02'),(638,'3. 파프리카는 갈아서 즙을 짜서 준비한다.','MANUAL03'),(638,'4. 식힌 육수에 파프리카 즙과 무, 미나리, 양파를 채쳐서 넣고 저염 양념을 만든다.','MANUAL04'),(638,'5. 배, 대추, 밤, 당근은 마지막에 채쳐 섞는다.','MANUAL05'),(638,'6. 저염 양념에 ⑤를 섞어서 절인 배추에 켜켜로 바른다.','MANUAL06'),(638,'','MANUAL07'),(638,'','MANUAL08'),(638,'','MANUAL09'),(638,'','MANUAL10'),(638,'','MANUAL11'),(638,'','MANUAL12'),(638,'','MANUAL13'),(638,'','MANUAL14'),(638,'','MANUAL15'),(638,'','MANUAL16'),(638,'','MANUAL17'),(638,'','MANUAL18'),(638,'','MANUAL19'),(638,'','MANUAL20'),(639,'1. 크래비는 꼭 짜 물기를 제거하고, 새우살은 끓는 물에 1분간 데쳐 건진다.','MANUAL01'),(639,'2. 파프리카는 약한 불에 구워 껍질을 검게 태운 뒤 찬물에 씻어 탄 부분을 제거한다.','MANUAL02'),(639,'3. 구운 파프리카는 얇게 포를 뜨고, 아보카도와 크래비, 데친 새우살은 굵게 다진다.','MANUAL03'),(639,'4. 손질한 아보카도, 크래비, 새우살에 다진 파, 다진 마늘, 후춧가루, 간 파르메산치즈, 파프리카 피클을 넣어 고루 섞어 소를 만든다.','MANUAL04'),(639,'5. 비닐랩 위에 포 뜬 파프리카를 올린 뒤 가운데에 소를 넣어 돌돌 말아준다.','MANUAL05'),(639,'6. 그릇에 소스를 담고 비닐랩을 제거한 롤을 올린 뒤 홀그레인 머스터드와 절임 올리브를 올린다.','MANUAL06'),(639,'','MANUAL07'),(639,'','MANUAL08'),(639,'','MANUAL09'),(639,'','MANUAL10'),(639,'','MANUAL11'),(639,'','MANUAL12'),(639,'','MANUAL13'),(639,'','MANUAL14'),(639,'','MANUAL15'),(639,'','MANUAL16'),(639,'','MANUAL17'),(639,'','MANUAL18'),(639,'','MANUAL19'),(639,'','MANUAL20'),(640,'1. 게살은 잘게 찢고, 수박, 가지, 적채, 브로콜리는 5cm 길이로 채 썬다.','MANUAL01'),(640,'2. 끓는 물(5컵)에 손질한 브로콜리를 1분간 데쳐 찬물에 담가 체에 밭친다.','MANUAL02'),(640,'3. 중간 불로 달군 팬에 올리브유(5㎖)를 두른 뒤 가지를 2분간 볶는다.','MANUAL03'),(640,'4. 믹서에 콩국물소스 재료를 넣고 갈아 콩국물소스를 만든다.','MANUAL04'),(640,'5. 그릇에 수박 → 가지 → 브로콜리 → 적채 → 게살 순으로 쌓는다.','MANUAL05'),(640,'6. 콩국물소스를 부어 마무리한다.','MANUAL06'),(640,'','MANUAL07'),(640,'','MANUAL08'),(640,'','MANUAL09'),(640,'','MANUAL10'),(640,'','MANUAL11'),(640,'','MANUAL12'),(640,'','MANUAL13'),(640,'','MANUAL14'),(640,'','MANUAL15'),(640,'','MANUAL16'),(640,'','MANUAL17'),(640,'','MANUAL18'),(640,'','MANUAL19'),(640,'','MANUAL20'),(641,'1. 아스파라거스는 두꺼운 밑동을 잘라내고, 방아잎은 깨끗이 씻어 물기를 제거한다.','MANUAL01'),(641,'2. 믹서에 방아잎 페스토 재료를 넣어 곱게 갈고, 요거트 소스 재료를 모두 섞는다.','MANUAL02'),(641,'3. 닭다릿살을 넓게 편 뒤 방아잎 페스토 (4Ts)를 올리고, 파르메산 치즈를 올린 뒤 스테이크 시즈닝과 파슬리가루를 넣어 돌돌 말고, 풀리지 않도록 실로 묶는다.','MANUAL03'),(641,'4. 중간 불로 달군 팬에 식용유를 두르고, 돌돌 만 닭다릿살을 넣어 5분간 튀기듯 굽는다.','MANUAL04'),(641,'5. 같은 팬에 아스파라거스와 방울토마토를 넣어 2분간 볶는다.','MANUAL05'),(641,'6. 그릇에 구운 닭다릿살과 아스파라거스, 방울토마토를 올리고 요거트 소스를 곁들여 마무리한다.','MANUAL06'),(641,'','MANUAL07'),(641,'','MANUAL08'),(641,'','MANUAL09'),(641,'','MANUAL10'),(641,'','MANUAL11'),(641,'','MANUAL12'),(641,'','MANUAL13'),(641,'','MANUAL14'),(641,'','MANUAL15'),(641,'','MANUAL16'),(641,'','MANUAL17'),(641,'','MANUAL18'),(641,'','MANUAL19'),(641,'','MANUAL20'),(642,'1. 양파는 얇게 채 썰고, 토마토는 윗부분을 약간 자른 뒤 속을 파내고, 새우는 머리와 껍질을 제거한다.','MANUAL01'),(642,'2. 냄비에 물(3컵)과 육수 재료를 넣어 중간 불에 15분간 끓여 육수를 만든다.','MANUAL02'),(642,'3. 중간 불로 달군 팬에 식용유를 두르고, 양파와 다진 마늘을 넣어 양파가 갈색이 될 때까지 볶는다.','MANUAL03'),(642,'4. 토마토 속을 넣어 3분간 더 볶고, 쌀과 육수(2컵)를 넣어 끓으면 약한 불로 줄인 뒤 뚜껑을 덮어 15분간 더 끓인다.','MANUAL04'),(642,'5. 뚜껑을 열어 새우를 올리고, 뚜껑을 다시 덮어 5분간 더 끓이고, 불을 꺼 5분간 뜸을 들인다.','MANUAL05'),(642,'6. 파슬리가루와 후춧가루를 뿌려 마무리한다.','MANUAL06'),(642,'','MANUAL07'),(642,'','MANUAL08'),(642,'','MANUAL09'),(642,'','MANUAL10'),(642,'','MANUAL11'),(642,'','MANUAL12'),(642,'','MANUAL13'),(642,'','MANUAL14'),(642,'','MANUAL15'),(642,'','MANUAL16'),(642,'','MANUAL17'),(642,'','MANUAL18'),(642,'','MANUAL19'),(642,'','MANUAL20'),(643,'1. 오징어는 채 썰고, 마늘과 대파는 곱게 다진다.','MANUAL01'),(643,'2. 오징어, 대파, 마늘, 달걀노른자, 밀가루, 물(10g)을 섞어 반죽한 뒤 동그랗게 빚는다.','MANUAL02'),(643,'3. 가라아게를 180℃ 온도의 기름에서 튀긴다.','MANUAL03'),(643,'4. 토마토는 껍질을 제거한 뒤 잘게 다진다.','MANUAL04'),(643,'5. 냄비에 다진 토마토, 식초, 설탕, 물(50g), 고춧가루, 전분을 넣고 끓여 칠리소스를 만든다.','MANUAL05'),(643,'6. 오징어 가라아게에 칠리소스를 곁들여 마무리한다.','MANUAL06'),(643,'','MANUAL07'),(643,'','MANUAL08'),(643,'','MANUAL09'),(643,'','MANUAL10'),(643,'','MANUAL11'),(643,'','MANUAL12'),(643,'','MANUAL13'),(643,'','MANUAL14'),(643,'','MANUAL15'),(643,'','MANUAL16'),(643,'','MANUAL17'),(643,'','MANUAL18'),(643,'','MANUAL19'),(643,'','MANUAL20'),(644,'1. 껍질을 벗긴 토마토, 마늘, 파, 양파, 애호박, 느타리버섯, 팽이버섯을 다진다.','MANUAL01'),(644,'2. 팬에 올리브유(20g)를 두르고 마늘, 양파를 넣고 볶다가 토마토를 넣고 소금(4g), 후추(3g)로 간하고 졸여 토마토 소스를 만든다.','MANUAL02'),(644,'3. 믹서에 순두부, 올리브유(10g), 소금(4g), 레몬즙을 넣고 갈아 순두부크림 소스를 만든다.','MANUAL03'),(644,'4. 팬에 올리브유(5g)를 두르고 차돌박이를 구운 후, 같은 팬에 올리브유(15g)를 두르고 파, 애호박, 느타리버섯, 팽이버섯을 볶고 소금(7g)으로 간한다.','MANUAL04'),(644,'5. 가지를 얇게 잘라 팬에 가볍게 굽고 ④를 올리고 돌돌 말아준다.','MANUAL05'),(644,'6. 토마토 소스를 아래에 깔고 ⑤를 올리고, 순두부크림 소스를 올려 마무리한다.','MANUAL06'),(644,'','MANUAL07'),(644,'','MANUAL08'),(644,'','MANUAL09'),(644,'','MANUAL10'),(644,'','MANUAL11'),(644,'','MANUAL12'),(644,'','MANUAL13'),(644,'','MANUAL14'),(644,'','MANUAL15'),(644,'','MANUAL16'),(644,'','MANUAL17'),(644,'','MANUAL18'),(644,'','MANUAL19'),(644,'','MANUAL20'),(645,'1. 콜라비는 껍질을 벗긴 뒤 깍둑 썬다.','MANUAL01'),(645,'2. 손질한 콜라비에 천일염을 뿌려 1시간 동안 절인다.','MANUAL02'),(645,'3. 홍고추, 양파, 생강, 마늘을 믹서에 곱게 간다.','MANUAL03'),(645,'4. 갈아 낸 채소에 양념장 재료를 넣어 양념장을 만든다.','MANUAL04'),(645,'5. 절여 놓은 콜라비는 물기를 제거하고, 쪽파는 적당한 길이로 썬다.','MANUAL05'),(645,'6. 콜라비에 쪽파, 양념장을 넣고 버무려 하루 동안 숙성해 마무리한다.','MANUAL06'),(645,'','MANUAL07'),(645,'','MANUAL08'),(645,'','MANUAL09'),(645,'','MANUAL10'),(645,'','MANUAL11'),(645,'','MANUAL12'),(645,'','MANUAL13'),(645,'','MANUAL14'),(645,'','MANUAL15'),(645,'','MANUAL16'),(645,'','MANUAL17'),(645,'','MANUAL18'),(645,'','MANUAL19'),(645,'','MANUAL20'),(646,'1. 오이와 무를 필러로 길게 슬라이스 한다.','MANUAL01'),(646,'2. 설탕물을 만들어 무가 잘 구부러질 때 까지 재운 뒤 씻어낸다.','MANUAL02'),(646,'3. 당근과 홍고추, 파프리카는 5cm 길이로 채 썬다.','MANUAL03'),(646,'4. 미나리를 데쳐 식힌 뒤 한 줄씩 찢는다.','MANUAL04'),(646,'5. 오이, 무를 겹쳐 채 썬 재료를 넣고 말아준 뒤 데친 미나리로 묶는다.','MANUAL05'),(646,'6. 배를 갈아 물, 식초, 고춧가루와 섞어 양념장을 만든 뒤 5를 넣고 재운다.','MANUAL06'),(646,'','MANUAL07'),(646,'','MANUAL08'),(646,'','MANUAL09'),(646,'','MANUAL10'),(646,'','MANUAL11'),(646,'','MANUAL12'),(646,'','MANUAL13'),(646,'','MANUAL14'),(646,'','MANUAL15'),(646,'','MANUAL16'),(646,'','MANUAL17'),(646,'','MANUAL18'),(646,'','MANUAL19'),(646,'','MANUAL20'),(647,'1. 미역을 물에 불리고 건져내 물기를 제거한다.','MANUAL01'),(647,'2. 감자는 껍질을 제거하고 한입 크기로 자른다.','MANUAL02'),(647,'3. 냄비에 참기름을 두르고 미역을 볶다가 물을 부어 끓인다.','MANUAL03'),(647,'4. 국물이 우러나면 감자를 넣고 익을 때까지 끓인다.','MANUAL04'),(647,'5. 국간장을 넣어 간을 맞춘다.','MANUAL05'),(647,'6. 다진마늘을 넣고 한소끔 더 끓여서 완성한다.','MANUAL06'),(647,'','MANUAL07'),(647,'','MANUAL08'),(647,'','MANUAL09'),(647,'','MANUAL10'),(647,'','MANUAL11'),(647,'','MANUAL12'),(647,'','MANUAL13'),(647,'','MANUAL14'),(647,'','MANUAL15'),(647,'','MANUAL16'),(647,'','MANUAL17'),(647,'','MANUAL18'),(647,'','MANUAL19'),(647,'','MANUAL20'),(648,'1. 청경채는 반으로 자른 후 줄기 부분에 칼집을 넣는다.','MANUAL01'),(648,'2. 청경채에 소금을 뿌려 30~40분 정도 절인다.','MANUAL02'),(648,'3. 배는 껍질을 벗긴 후 강판에 갈아 즙을 만든다.','MANUAL03'),(648,'4. 냄비에 물(30g)과 찹쌀가루를 넣고 끓여 찹쌀풀을 만들고, 충분히 식힌다.','MANUAL04'),(648,'5. 볼에 식힌 찹쌀풀, 배즙, 양념장 재료를 넣고 고루 섞어 양념장을 만든다.','MANUAL05'),(648,'6. 절인 청경채의 물기를 제거하고, 양념장을 버무려 마무리한다.','MANUAL06'),(648,'','MANUAL07'),(648,'','MANUAL08'),(648,'','MANUAL09'),(648,'','MANUAL10'),(648,'','MANUAL11'),(648,'','MANUAL12'),(648,'','MANUAL13'),(648,'','MANUAL14'),(648,'','MANUAL15'),(648,'','MANUAL16'),(648,'','MANUAL17'),(648,'','MANUAL18'),(648,'','MANUAL19'),(648,'','MANUAL20'),(649,'1. 두부는 물기를 제거한 뒤 칼등으로 으깨고, 새우와 양파는 잘게 다지고, 새송이버섯은 한입 크기로 썬다.','MANUAL01'),(649,'2. 으깬 두부와 잘게 다진 새우, 양파는 밑간해 고루 버무린 뒤 적당량(25g)씩 떼어 동그랗게 빚는다.','MANUAL02'),(649,'3. 중간 불로 달군 팬에 식용유(25㎖)를 둘러 10~15분간 두부새우볼을 골고루 익혀 꺼낸다.','MANUAL03'),(649,'4. 같은 팬에 새송이버섯을 5분간 볶아 꺼낸다.','MANUAL04'),(649,'5. 약한 불로 줄인 뒤 같은 팬에 버터와 밀가루를 넣고 3~5분간 볶아 블론드 루를 만들고 우유를 부은 뒤 10분간 끓인다.','MANUAL05'),(649,'6. 구운 두부새우볼과 버섯, 소금(1g), 후춧가루(1g)를 넣은 뒤 그릇에 담고 파슬리가루(2g)를 뿌린다.','MANUAL06'),(649,'','MANUAL07'),(649,'','MANUAL08'),(649,'','MANUAL09'),(649,'','MANUAL10'),(649,'','MANUAL11'),(649,'','MANUAL12'),(649,'','MANUAL13'),(649,'','MANUAL14'),(649,'','MANUAL15'),(649,'','MANUAL16'),(649,'','MANUAL17'),(649,'','MANUAL18'),(649,'','MANUAL19'),(649,'','MANUAL20'),(650,'1. 부챗살은 3mm로 썰어 후춧가루를 뿌려 버무리고, 쪽파, 홍고추, 익힌 전복내장은 잘게 다진다.','MANUAL01'),(650,'2. 밀가루에 다진 건새우를 섞은 뒤, 부챗살에 밀가루 → 달걀물 순으로 입힌다.','MANUAL02'),(650,'3. 다진 쪽파, 홍고추, 익힌 전복내장에 초간장 재료를 섞어 전복내장소스를 만든다.','MANUAL03'),(650,'4. 중간 불로 달군 팬에 식용유(10㎖)를 두른 뒤 옷을 입힌 부챗살을 앞뒤로 4분간 굽는다.','MANUAL04'),(650,'5. 그릇에 구운 부챗살을 담고 전복내장소스를 곁들인다.','MANUAL05'),(650,'','MANUAL06'),(650,'','MANUAL07'),(650,'','MANUAL08'),(650,'','MANUAL09'),(650,'','MANUAL10'),(650,'','MANUAL11'),(650,'','MANUAL12'),(650,'','MANUAL13'),(650,'','MANUAL14'),(650,'','MANUAL15'),(650,'','MANUAL16'),(650,'','MANUAL17'),(650,'','MANUAL18'),(650,'','MANUAL19'),(650,'','MANUAL20'),(651,'1. 다진 돼지고기(300g)에 밑간한 뒤 얼음물(¼컵)을 넣어 찰기가 생길 때까지 치대 소시지 반죽을 만든다.','MANUAL01'),(651,'2. 남은 다진 돼지고기(300g)에 양념과 얼음물(¼컵)을 넣고 고루 섞어 치대 다른 소시지 반죽을 만든다.','MANUAL02'),(651,'3. 두 가지 소시지 반죽은 짤주머니에 각각 담아 냉장실에서 30분간 숙성한다.','MANUAL03'),(651,'4. 라이스페이퍼 양면에 물을 약간 묻히고, 소시지 반죽을 일정하게 짠 뒤 돌돌 말아 소시지를 만든다.','MANUAL04'),(651,'5. 약한 불로 달군 팬에 식용유를 두르고, 소시지를 돌려가며 5분간 골고루 익힌다.','MANUAL05'),(651,'6. 센 불로 올려 1분간 더 익혀 마무리한다.','MANUAL06'),(651,'','MANUAL07'),(651,'','MANUAL08'),(651,'','MANUAL09'),(651,'','MANUAL10'),(651,'','MANUAL11'),(651,'','MANUAL12'),(651,'','MANUAL13'),(651,'','MANUAL14'),(651,'','MANUAL15'),(651,'','MANUAL16'),(651,'','MANUAL17'),(651,'','MANUAL18'),(651,'','MANUAL19'),(651,'','MANUAL20'),(652,'1. 새송이버섯, 양파, 토마토는 굵게 다지고, 가지는 모양대로 길게 썰고, 돼지고기는 한입 크기로 썬다.','MANUAL01'),(652,'2. 중간 불로 달군 마른 팬에 가지를 올려 앞뒤로 노릇하게 굽는다.','MANUAL02'),(652,'3. 같은 팬에 올리브유를 두르고 다진 마늘을 넣어 노릇하게 볶고, 양파와 새송이버섯을 넣어 양파가 투명해질 때까지 볶는다.','MANUAL03'),(652,'4. 중간 불로 올린 뒤 목살을 넣어 겉면의 색이 변할 때까지 볶고, 토마토를 넣어 으깬다.','MANUAL04'),(652,'5. 쌈장과 파프리카가루를 넣어 고루 섞고, 토마토 국물이 배어 나오면 바질을 손으로 뜯어 넣은 뒤 국물이 자작해질 때까지 끓인다.','MANUAL05'),(652,'6. 그릇에 ⑤의 재료를 담은 뒤 가지를 엇갈려 올리고, 치즈를 얹은 뒤 전자레인지에 넣어 모차렐라치즈가 녹을 때까지 조리해 마무리한다.','MANUAL06'),(652,'','MANUAL07'),(652,'','MANUAL08'),(652,'','MANUAL09'),(652,'','MANUAL10'),(652,'','MANUAL11'),(652,'','MANUAL12'),(652,'','MANUAL13'),(652,'','MANUAL14'),(652,'','MANUAL15'),(652,'','MANUAL16'),(652,'','MANUAL17'),(652,'','MANUAL18'),(652,'','MANUAL19'),(652,'','MANUAL20'),(653,'1. 묵은지는 흐르는 물에 헹군 뒤 찬물에 30분간 담가둔다.','MANUAL01'),(653,'2. 배추, 깻잎, 소고기, 묵은지 순으로 층층이 쌓는다.','MANUAL02'),(653,'3. 쌓은 재료를 3~4cm 크기로 자른다.','MANUAL03'),(653,'4. 냄비에 재료를 둘러 담고, 가운데에 콩나물과 북어채를 담는다.','MANUAL04'),(653,'5. 물(3컵)을 넣는다.','MANUAL05'),(653,'6. 중간 불로 10분간 끓여 마무리한다.','MANUAL06'),(653,'','MANUAL07'),(653,'','MANUAL08'),(653,'','MANUAL09'),(653,'','MANUAL10'),(653,'','MANUAL11'),(653,'','MANUAL12'),(653,'','MANUAL13'),(653,'','MANUAL14'),(653,'','MANUAL15'),(653,'','MANUAL16'),(653,'','MANUAL17'),(653,'','MANUAL18'),(653,'','MANUAL19'),(653,'','MANUAL20'),(654,'1. 명태포는 키친타월에 올려 물기를 제거한다.','MANUAL01'),(654,'2. 후춧가루와 레몬즙을 뿌려 비린내를 제거한다.','MANUAL02'),(654,'3. 볼에 튀김가루와 달걀, 식용유, 물을 섞어 튀김옷을 만든다','MANUAL03'),(654,'4. 명태포에 튀김옷을 입힌 뒤 170℃ 기름에서 두 번 튀긴다.','MANUAL04'),(654,'5. 삶은 달걀, 홍고추, 청양고추, 양파를 다져 볼에 섞은 뒤 마요네즈와 레몬즙, 후춧가루를 섞어 소스를 만든다','MANUAL05'),(654,'6. 생선까스에 타르타르소스를 곁들여 담는다.','MANUAL06'),(654,'','MANUAL07'),(654,'','MANUAL08'),(654,'','MANUAL09'),(654,'','MANUAL10'),(654,'','MANUAL11'),(654,'','MANUAL12'),(654,'','MANUAL13'),(654,'','MANUAL14'),(654,'','MANUAL15'),(654,'','MANUAL16'),(654,'','MANUAL17'),(654,'','MANUAL18'),(654,'','MANUAL19'),(654,'','MANUAL20'),(655,'1. 감자로 만든 옹심이 반죽을 숟가락의 절반 크기로 동그랗게 모양을 만든다.','MANUAL01'),(655,'2. 180도로 예열한 에어프라이어에 홍새우 튀김을 15분 동안 익힌다.','MANUAL02'),(655,'3. 팬에 식용유를 두르고 양파를 채 썰어 넣고 갈색이 나도록 볶는다.','MANUAL03'),(655,'4. 컬리플라워, 감자튀김, 불린 미역을 넣고 3분 동안 더 볶는다.','MANUAL04'),(655,'5. 커리 소스, 물(1/2컵=100g), 옹심이를 넣고 3분 동안 끓인다.','MANUAL05'),(655,'6. 접시에 담고 홍새우 튀김을 올려 마무리한다.','MANUAL06'),(655,'','MANUAL07'),(655,'','MANUAL08'),(655,'','MANUAL09'),(655,'','MANUAL10'),(655,'','MANUAL11'),(655,'','MANUAL12'),(655,'','MANUAL13'),(655,'','MANUAL14'),(655,'','MANUAL15'),(655,'','MANUAL16'),(655,'','MANUAL17'),(655,'','MANUAL18'),(655,'','MANUAL19'),(655,'','MANUAL20'),(656,'1. 곤약과 감자는 2cm ? 2cm 크기로 썰고 풋고추와 홍고추는 송송 썰어 씨를 제거한다.','MANUAL01'),(656,'2. 물(200g)에 다시마를 넣고 끓여 육수를 만든 뒤 다시마를 건진다.','MANUAL02'),(656,'3. 육수에 간장, 설탕, 미림을 섞어 조림장을 만든다.','MANUAL03'),(656,'4. 곤약과 감자를 끓는 물에 넣고 80% 정도 익힌 뒤 건져 식힌다.','MANUAL04'),(656,'5. 4에 조림장 50g을 넣고 살짝 졸인다.','MANUAL05'),(656,'6. 불을 끄고 참기름을 섞는다.','MANUAL06'),(656,'','MANUAL07'),(656,'','MANUAL08'),(656,'','MANUAL09'),(656,'','MANUAL10'),(656,'','MANUAL11'),(656,'','MANUAL12'),(656,'','MANUAL13'),(656,'','MANUAL14'),(656,'','MANUAL15'),(656,'','MANUAL16'),(656,'','MANUAL17'),(656,'','MANUAL18'),(656,'','MANUAL19'),(656,'','MANUAL20'),(657,'1. 배추, 양파, 두부는 한입 크기로 썰고 대파와 청양고추는 어슷썰어 준비한다.','MANUAL01'),(657,'2. 전처리 후 남은 양파껍질, 대파뿌리와 다시멸치를 넣고 육수를 우린 후 거른다.','MANUAL02'),(657,'3. 두부는 끓는 물에 10분정도 넣어서 염분기를 빼준다.','MANUAL03'),(657,'4. 냄비에 참기름과 배추를 넣어 볶다가 쌀뜨물과 육수를 넣어 끓인다.','MANUAL04'),(657,'5. 두부와 양파, 대파, 고추를 넣는다.','MANUAL05'),(657,'6. 된장, 간마늘, 생강즙을 넣어 간을 맞춘다.','MANUAL06'),(657,'','MANUAL07'),(657,'','MANUAL08'),(657,'','MANUAL09'),(657,'','MANUAL10'),(657,'','MANUAL11'),(657,'','MANUAL12'),(657,'','MANUAL13'),(657,'','MANUAL14'),(657,'','MANUAL15'),(657,'','MANUAL16'),(657,'','MANUAL17'),(657,'','MANUAL18'),(657,'','MANUAL19'),(657,'','MANUAL20'),(658,'1. 쇠고기 등심은 큐브 모양으로 썰어 소금, 후추 간을 하고 밀가루를 묻힌다.','MANUAL01'),(658,'2. 감자, 토마토는 한 입 크기로 썰고, 마늘은 편썰기, 파프리카는 채썰기, 양파는 다진다.','MANUAL02'),(658,'3. 팬에 버터와 올리브유를 넣고 양파, 마늘을 볶다가 쇠고기를 넣어 볶는다.','MANUAL03'),(658,'4. 쇠고기가 익으면 감자, 토마토, 파프리카를 넣는다.','MANUAL04'),(658,'5. 토마토 페이스트, 케찹을 넣어 볶다가 물과 월계수잎을 넣어 끓인다.','MANUAL05'),(658,'6. 소금, 후추로 간을 하고 푹 익혀준다.','MANUAL06'),(658,'','MANUAL07'),(658,'','MANUAL08'),(658,'','MANUAL09'),(658,'','MANUAL10'),(658,'','MANUAL11'),(658,'','MANUAL12'),(658,'','MANUAL13'),(658,'','MANUAL14'),(658,'','MANUAL15'),(658,'','MANUAL16'),(658,'','MANUAL17'),(658,'','MANUAL18'),(658,'','MANUAL19'),(658,'','MANUAL20'),(659,'1. 순무는 2.5*2.5*0.3 cm 크기로 나박 모양으로 썬다.','MANUAL01'),(659,'2. 고운 고춧가루, 굵은 고춧가루, 다진마늘, 소금, 요거트를 섞어 양념장을 만든다.','MANUAL02'),(659,'3. 쪽파는 0.2cm 크기로 송송 썰어 준비한다.','MANUAL03'),(659,'4. 순무에 양념장을 넣고 버무려 준다.','MANUAL04'),(659,'5. 양념된 순무를 하루 정도 냉장보관하여 숙성시킨다.','MANUAL05'),(659,'6. 숙성된 순무김치에 쪽파를 고명으로 얹어 제공한다.','MANUAL06'),(659,'','MANUAL07'),(659,'','MANUAL08'),(659,'','MANUAL09'),(659,'','MANUAL10'),(659,'','MANUAL11'),(659,'','MANUAL12'),(659,'','MANUAL13'),(659,'','MANUAL14'),(659,'','MANUAL15'),(659,'','MANUAL16'),(659,'','MANUAL17'),(659,'','MANUAL18'),(659,'','MANUAL19'),(659,'','MANUAL20'),(660,'1. 양파와 당근, 양송이버섯, 불린 함초는 잘게 다진다.','MANUAL01'),(660,'2. 으깬 두부는 물기를 제거한 뒤 닭가슴살과 믹서에 넣어 곱게 갈고 다진 양파(20g), 당근(10g), 함초(7.5g), 달걀, 빵가루, 함초소금(0.25g)을 넣어 버무린다.','MANUAL02'),(660,'3. 두부 반죽은 동그랗게 만들어 중간 불로 달군 팬에 식용유(10㎖)를 두른 뒤 4분간 앞뒤로 노릇하게 구워 꺼낸다.','MANUAL03'),(660,'4. 약한 불로 달군 냄비에 밀가루, 버터를 넣어 루를 만들고 우유, 강황가루, 다진 양파(10g)와 당근(10g), 양송이버섯, 다진 마늘(5g)을 넣어 섞은 뒤 저염 간장(3g), 함초소금(0.25g)으로 간한다.','MANUAL04'),(660,'5. 믹서에 소스와 다진 함초(7.5g)를 넣어 곱게 간다.','MANUAL05'),(660,'6. 그릇에 함초두부스테이크를 올리고 소스를 뿌린다.','MANUAL06'),(660,'','MANUAL07'),(660,'','MANUAL08'),(660,'','MANUAL09'),(660,'','MANUAL10'),(660,'','MANUAL11'),(660,'','MANUAL12'),(660,'','MANUAL13'),(660,'','MANUAL14'),(660,'','MANUAL15'),(660,'','MANUAL16'),(660,'','MANUAL17'),(660,'','MANUAL18'),(660,'','MANUAL19'),(660,'','MANUAL20'),(661,'1. 등갈비는 찬물(5컵)에 담가 1시간 이상 핏물을 제거한다.','MANUAL01'),(661,'2. 등갈비는 한 쪽씩 썬다.','MANUAL02'),(661,'3. 손질한 등갈비는 밑간한 뒤 마늘, 로즈메리와 함께 버무려 30분 정도 재운다.','MANUAL03'),(661,'4. 재운 등갈비는 190℃로 예열한 오븐에 40분간 굽고, 뒤집어서 같은 온도에 30분간 더 굽는다.','MANUAL04'),(661,'5. 디핑소스를 만든다.','MANUAL05'),(661,'6. 그릇에 등갈비구이를 담은 뒤 레몬을 짜 즙을 뿌리고, 디핑 소스를 곁들여 마무리한다.','MANUAL06'),(661,'','MANUAL07'),(661,'','MANUAL08'),(661,'','MANUAL09'),(661,'','MANUAL10'),(661,'','MANUAL11'),(661,'','MANUAL12'),(661,'','MANUAL13'),(661,'','MANUAL14'),(661,'','MANUAL15'),(661,'','MANUAL16'),(661,'','MANUAL17'),(661,'','MANUAL18'),(661,'','MANUAL19'),(661,'','MANUAL20'),(662,'1. 표고버섯, 양파, 마늘은 다지고, 끓는 물에 배추, 숙주, 청경채를 데친다. 토마토는 껍질을 벗기고, 소고기는 키친타월로 핏물을 제거하고 두부는 물기를 제거한다.','MANUAL01'),(662,'2. 팬에 올리브유(20g)를 두르고 손질한 표고버섯, 양파(15g), 마늘을 볶은 뒤 간장(15g), 들깨가루, 우유를 넣어 덕셀을 만들고 식힌다.','MANUAL02'),(662,'3. 양파(20g)를 볶은 뒤 물을 붓고 다시마, 새송이버섯, 백목이버섯, 토마토를 넣고 중약 불에서 15분 동안 끓여 갈고 간장(15g), 소금(3g)으로 간해 브라운 소스를 만든다.','MANUAL03'),(662,'4. 소고기에 머스타드, 덕셀을 바르고 깻잎, 두부, 숙주, 청경채를 넣어 감싸준 후 소금(5g), 후추를 뿌리고, 팬에 올리브유(20g)를 두르고 소고기를 굽고, 로즈메리를 넣는다.','MANUAL04'),(662,'5. 종이 포일에 올리브유(20g)를 뿌리고, 데친 배추를 올린 후 위에 구운 고기와 덕셀(30g)을 올리고 돌돌 말아 에어프라이어에 200도, 10분간 굽는다.','MANUAL05'),(662,'6. 접시에 웰링턴을 담고 여분의 덕셀, 브라운 소스를 올리고 마무리한다.','MANUAL06'),(662,'','MANUAL07'),(662,'','MANUAL08'),(662,'','MANUAL09'),(662,'','MANUAL10'),(662,'','MANUAL11'),(662,'','MANUAL12'),(662,'','MANUAL13'),(662,'','MANUAL14'),(662,'','MANUAL15'),(662,'','MANUAL16'),(662,'','MANUAL17'),(662,'','MANUAL18'),(662,'','MANUAL19'),(662,'','MANUAL20'),(663,'1. 닭다리의 살만 발라내 4cm ? 1cm 크기로 썬다.','MANUAL01'),(663,'2. 1에 소금, 후추로 밑간한 뒤 청주를 넣어 재운다.','MANUAL02'),(663,'3. 포도알은 2등분하고 사과, 파인애플은 한 입 크기로 썬다.','MANUAL03'),(663,'4. 2에 녹말을 입혀 기름에 2번 튀긴다.','MANUAL04'),(663,'5. 팬에 물, 설탕, 레몬즙을 넣고 한소끔 끓인다.','MANUAL05'),(663,'6. 소스에 물전분을 넣어 농도를 맞추고 썰어둔 과일을 넣는다.','MANUAL06'),(663,'','MANUAL07'),(663,'','MANUAL08'),(663,'','MANUAL09'),(663,'','MANUAL10'),(663,'','MANUAL11'),(663,'','MANUAL12'),(663,'','MANUAL13'),(663,'','MANUAL14'),(663,'','MANUAL15'),(663,'','MANUAL16'),(663,'','MANUAL17'),(663,'','MANUAL18'),(663,'','MANUAL19'),(663,'','MANUAL20'),(664,'1. 디포리를 살짝 볶아 물, 양파, 무를 넣고 육수를 낸다.','MANUAL01'),(664,'2. 건새우를 볶아서 건표고버섯과 함께 곱게 간다.','MANUAL02'),(664,'3. 콜리플라워는 먹기 좋은 크기로 썰어 볶는다.','MANUAL03'),(664,'4. 냄비에 불려서 손질해 놓은 미역과 참기름을 넣어 볶는다.','MANUAL04'),(664,'5. 육수를 넣고 푹 끓이다가 ②와 저염간장으로 간을 맞춘다.','MANUAL05'),(664,'6. 마지막으로 콜리플라워를 넣어 완성한다.','MANUAL06'),(664,'','MANUAL07'),(664,'','MANUAL08'),(664,'','MANUAL09'),(664,'','MANUAL10'),(664,'','MANUAL11'),(664,'','MANUAL12'),(664,'','MANUAL13'),(664,'','MANUAL14'),(664,'','MANUAL15'),(664,'','MANUAL16'),(664,'','MANUAL17'),(664,'','MANUAL18'),(664,'','MANUAL19'),(664,'','MANUAL20'),(665,'1. 한돈은 사태로 준비하여 깍둑썰기하여 세척한다.','MANUAL01'),(665,'2. 양파, 파, 다시마, 표고버섯, 마늘은 깨끗이 세척 후 적당한 크기로 자르고, 당근, 곤약은 깍뚝썰기하여 준비한다.','MANUAL02'),(665,'3. 냄비에 물과 저염간장을 2:1 비율로 조림장을 준비한다.','MANUAL03'),(665,'4. 조림장에 구기자 및 양파, 파, 다시마, 표고버섯, 마늘을 넣고 끓인다.','MANUAL04'),(665,'5. 조림장이 끓으면 사태, 메추리알, 당근, 곤약을 넣고 조린다.','MANUAL05'),(665,'6. 접시에 담아서 완성한다.','MANUAL06'),(665,'','MANUAL07'),(665,'','MANUAL08'),(665,'','MANUAL09'),(665,'','MANUAL10'),(665,'','MANUAL11'),(665,'','MANUAL12'),(665,'','MANUAL13'),(665,'','MANUAL14'),(665,'','MANUAL15'),(665,'','MANUAL16'),(665,'','MANUAL17'),(665,'','MANUAL18'),(665,'','MANUAL19'),(665,'','MANUAL20'),(666,'1. 배추, 콜라비, 오이, 당근을 나박모양으로 썬다.','MANUAL01'),(666,'2. 레몬은 은행잎썰기, 홍고추는 어슷썰기, 실파는 1.5cm 길이로 썬다.','MANUAL02'),(666,'3. 식초, 설탕, 오미자청으로 단촛물을 만든다.','MANUAL03'),(666,'4. 단촛물에 야채, 레몬, 고추, 실파를 넣고 숙성시킨다.','MANUAL04'),(666,'5. 숙성 후 색을 보고 오미자청을 더 첨가한다.','MANUAL05'),(666,'6. 숙성된 오미자 나박김치를 그릇에 담아준다.','MANUAL06'),(666,'','MANUAL07'),(666,'','MANUAL08'),(666,'','MANUAL09'),(666,'','MANUAL10'),(666,'','MANUAL11'),(666,'','MANUAL12'),(666,'','MANUAL13'),(666,'','MANUAL14'),(666,'','MANUAL15'),(666,'','MANUAL16'),(666,'','MANUAL17'),(666,'','MANUAL18'),(666,'','MANUAL19'),(666,'','MANUAL20'),(667,'1. 양상추는 한입 크기로 찢고, 당근은 채 썰고, 방울토마토는 4등분한다.','MANUAL01'),(667,'2. 끓는 물(2컵)에 닭가슴살을 넣어 10분간 익힌 뒤 건져 결대로 찢는다.','MANUAL02'),(667,'3. 끓는 물(2컵)에 메밀면을 넣어 5분간 삶아 건진 뒤 찬물에 헹궈 체에 밭쳐 물기를 제거한다.','MANUAL03'),(667,'4. 유자오리엔탈소스를 만든다.','MANUAL04'),(667,'5. 그릇에 준비한 재료와 어린잎채소를 담고 유자오리엔탈소스를 뿌린다.','MANUAL05'),(667,'','MANUAL06'),(667,'','MANUAL07'),(667,'','MANUAL08'),(667,'','MANUAL09'),(667,'','MANUAL10'),(667,'','MANUAL11'),(667,'','MANUAL12'),(667,'','MANUAL13'),(667,'','MANUAL14'),(667,'','MANUAL15'),(667,'','MANUAL16'),(667,'','MANUAL17'),(667,'','MANUAL18'),(667,'','MANUAL19'),(667,'','MANUAL20'),(668,'1. 고구마는 끓는 물(2컵)에 4분간 삶아 껍질을 제거한 뒤 곱게 으깬다.','MANUAL01'),(668,'2. 호두는 굵게 부순다.','MANUAL02'),(668,'3. 으깬 고구마에 호두, 우유를 넣어 고루 섞는다.','MANUAL03'),(668,'4. 키친타월을 이용해 두부의 물기를 제거한 뒤 곱게 으깨고 빵가루(15g)를 넣어 섞는다.','MANUAL04'),(668,'5. 두부를 얇게 편 뒤 고구마와 모차렐라치즈를 넣어 동그랗게 빚는다.','MANUAL05'),(668,'6. 두부를 얇게 편 뒤 고구마와 모차렐라치즈를 넣어 동그랗게 빚는다.','MANUAL06'),(668,'','MANUAL07'),(668,'','MANUAL08'),(668,'','MANUAL09'),(668,'','MANUAL10'),(668,'','MANUAL11'),(668,'','MANUAL12'),(668,'','MANUAL13'),(668,'','MANUAL14'),(668,'','MANUAL15'),(668,'','MANUAL16'),(668,'','MANUAL17'),(668,'','MANUAL18'),(668,'','MANUAL19'),(668,'','MANUAL20'),(669,'1. 가지, 주키니호박, 토마토는 0.3mm 두께로 썬다.','MANUAL01'),(669,'2. 단호박은 전자레인지에 5분간 돌리고, 익으면 윗부분을 약간 잘라낸 뒤 씨를 제거한다.','MANUAL02'),(669,'3. 중간 불로 달군 팬에 훈제오리와 마늘을 넣어 고루 볶은 뒤 단호박 속에 채운다.','MANUAL03'),(669,'4. 팬에 올리브유를 두른 뒤 약한 불로 올리고, 라타투이 소스 재료, 소금, 후춧가루를 넣어 10분간 볶아 라타투이 소스를 만든다.','MANUAL04'),(669,'5. 높이가 낮은 냄비에 라타투이 소스를 넓게 깔고, 손질한 채소를 둘러 담는다.','MANUAL05'),(669,'6. 오리로 채운 단호박을 가운데 올린 뒤 6~8등분하여 펼치고, 중간 불로 15분간 쪄 마무리한다.','MANUAL06'),(669,'','MANUAL07'),(669,'','MANUAL08'),(669,'','MANUAL09'),(669,'','MANUAL10'),(669,'','MANUAL11'),(669,'','MANUAL12'),(669,'','MANUAL13'),(669,'','MANUAL14'),(669,'','MANUAL15'),(669,'','MANUAL16'),(669,'','MANUAL17'),(669,'','MANUAL18'),(669,'','MANUAL19'),(669,'','MANUAL20'),(670,'1. 느타리버섯은 밑동을 자르고 가닥가닥 찢어 데쳐서 찬물에 헹궈 물기를 제거한다.','MANUAL01'),(670,'2. 파프리카와 청피망은 채 썰고, 크래미는 잘게 찢는다.','MANUAL02'),(670,'3. 팬에 기름을 두르고 손질한 파프리카와 피망을 넣어 볶는다.','MANUAL03'),(670,'4. 느타리버섯을 넣어 볶는다.','MANUAL04'),(670,'5. 게살을 넣어 볶다가 간장으로 색을 낸다.','MANUAL05'),(670,'6. 소금과 후추로 마무리한다.','MANUAL06'),(670,'','MANUAL07'),(670,'','MANUAL08'),(670,'','MANUAL09'),(670,'','MANUAL10'),(670,'','MANUAL11'),(670,'','MANUAL12'),(670,'','MANUAL13'),(670,'','MANUAL14'),(670,'','MANUAL15'),(670,'','MANUAL16'),(670,'','MANUAL17'),(670,'','MANUAL18'),(670,'','MANUAL19'),(670,'','MANUAL20'),(671,'1. 닭가슴살은 3cm 주사위모양으로 썰고 식용유와 이탈리안 시즈닝으로 양념한다.','MANUAL01'),(671,'2. 홍피망, 노랑파프리카, 양파는 3cm 크기로 썰고 양송이버섯은 반으로 썬다.','MANUAL02'),(671,'3. 소스 재료를 넣고 끓인다.','MANUAL03'),(671,'4. 닭가슴살은 구워서 반만 익히고 꼬치에 채소와 함께 꽂는다.','MANUAL04'),(671,'5. 그릴에서 완전히 굽는다.','MANUAL05'),(671,'6. 소스를 끼얹어 낸다.','MANUAL06'),(671,'','MANUAL07'),(671,'','MANUAL08'),(671,'','MANUAL09'),(671,'','MANUAL10'),(671,'','MANUAL11'),(671,'','MANUAL12'),(671,'','MANUAL13'),(671,'','MANUAL14'),(671,'','MANUAL15'),(671,'','MANUAL16'),(671,'','MANUAL17'),(671,'','MANUAL18'),(671,'','MANUAL19'),(671,'','MANUAL20'),(672,'1. 오븐을 175℃로 예열한다.','MANUAL01'),(672,'2. 닭고기 밑간 양념으로 30분정도 재운다.','MANUAL02'),(672,'3. 재워 놓은 닭고기를 175℃의 오븐에서 15분 굽는다.','MANUAL03'),(672,'4. 조림장을 모두 넣고 끓인다.','MANUAL04'),(672,'5. 닭고기 구운 것을 넣고 10~15분 간 졸인다.','MANUAL05'),(672,'6. 닭고기를 먹기 좋게 잘라 남은 소스를 얹어 낸다.','MANUAL06'),(672,'','MANUAL07'),(672,'','MANUAL08'),(672,'','MANUAL09'),(672,'','MANUAL10'),(672,'','MANUAL11'),(672,'','MANUAL12'),(672,'','MANUAL13'),(672,'','MANUAL14'),(672,'','MANUAL15'),(672,'','MANUAL16'),(672,'','MANUAL17'),(672,'','MANUAL18'),(672,'','MANUAL19'),(672,'','MANUAL20'),(673,'1. 돼지고기는 간장, 물엿, 다진마늘, 후춧가루로 밑간 한다.','MANUAL01'),(673,'2. 레디쉬, 깻잎, 대파는 채썬다.','MANUAL02'),(673,'3. 소스 재료들은 모두 믹서에 간다.','MANUAL03'),(673,'4. 돼지고기에 찹쌀가루를 두 번 입힌다.','MANUAL04'),(673,'5. 가열된 팬에 옷입힌 돼지고기를 지진다.','MANUAL05'),(673,'6. 구운 돼지고기에 썰어둔 채소를 얹은 후 고기를 말아 소스와 곁들인다.','MANUAL06'),(673,'','MANUAL07'),(673,'','MANUAL08'),(673,'','MANUAL09'),(673,'','MANUAL10'),(673,'','MANUAL11'),(673,'','MANUAL12'),(673,'','MANUAL13'),(673,'','MANUAL14'),(673,'','MANUAL15'),(673,'','MANUAL16'),(673,'','MANUAL17'),(673,'','MANUAL18'),(673,'','MANUAL19'),(673,'','MANUAL20'),(674,'1. 소고기등심은 손질하여 칼등으로 부드럽게 두드린 뒤 4cm 길이로 썰어서 재움장에 30분 정도 재운다.','MANUAL01'),(674,'2. 오이는 0.2cm 두께로 동그랗게 썰어 소금에 살짝 절였다 짠다.','MANUAL02'),(674,'3. 배는 껍질과 씨를 제거하고 반달모양으로 0.2cm 두께로 썬다.','MANUAL03'),(674,'4. 팬에 식용유를 두르고 오이는 센불에서 살짝 볶고 배는 노릇하게 지진다.','MANUAL04'),(674,'5. 팬에 재워둔 소고기등심을 지지고 초간장소스를 만든다.','MANUAL05'),(674,'6. 노릇하게 지진 배에 소고기등심을 오이, 잣가루를 얹고 가볍게 싸서 저나트륨 초간장에 찍어 먹는다.','MANUAL06'),(674,'','MANUAL07'),(674,'','MANUAL08'),(674,'','MANUAL09'),(674,'','MANUAL10'),(674,'','MANUAL11'),(674,'','MANUAL12'),(674,'','MANUAL13'),(674,'','MANUAL14'),(674,'','MANUAL15'),(674,'','MANUAL16'),(674,'','MANUAL17'),(674,'','MANUAL18'),(674,'','MANUAL19'),(674,'','MANUAL20'),(675,'1. 양송이버섯과 표고버섯은 얇게 썰고 애느타리버섯은 잘게 찢어 놓는다.','MANUAL01'),(675,'2. 썰어놓은 돼지고기는 후춧가루와 밀가루로 밑간한다.','MANUAL02'),(675,'3. 가열된 팬에 식용유를 넣고 고기를 굽는다.','MANUAL03'),(675,'4. 고기를 한쪽으로 밀어두고 버섯들을 넣어 볶다가 화이트와인과 물을 넣고 끓인다. 반쯤 졸아지면 고기를 꺼낸다.','MANUAL04'),(675,'5. 팬에 버터를 넣어 소스의 농도를 맞추고 다진 파슬리를 뿌려 소스를 완성한다.','MANUAL05'),(675,'6. 고기에 소스를 얹어 낸다.','MANUAL06'),(675,'','MANUAL07'),(675,'','MANUAL08'),(675,'','MANUAL09'),(675,'','MANUAL10'),(675,'','MANUAL11'),(675,'','MANUAL12'),(675,'','MANUAL13'),(675,'','MANUAL14'),(675,'','MANUAL15'),(675,'','MANUAL16'),(675,'','MANUAL17'),(675,'','MANUAL18'),(675,'','MANUAL19'),(675,'','MANUAL20'),(676,'1. 감자는 껍질을 벗겨 반으로 갈라편편하게 놓일 수 있도록 밑면을 다듬는다.','MANUAL01'),(676,'2. 숟가락으로 감자 윗면을 파낸다.','MANUAL02'),(676,'3. 다진 소고기는 분량의 재료를 넣고 양념한다.','MANUAL03'),(676,'4. 파낸 감자 안에 녹말을 묻히고 양념한 소고기를 채운다.','MANUAL04'),(676,'5. 감자가 잠길 정도로 육수를 붓고 끓인다.','MANUAL05'),(676,'6. 찜이 완성되면 물녹말을 부어 걸쭉하게 만든다.','MANUAL06'),(676,'','MANUAL07'),(676,'','MANUAL08'),(676,'','MANUAL09'),(676,'','MANUAL10'),(676,'','MANUAL11'),(676,'','MANUAL12'),(676,'','MANUAL13'),(676,'','MANUAL14'),(676,'','MANUAL15'),(676,'','MANUAL16'),(676,'','MANUAL17'),(676,'','MANUAL18'),(676,'','MANUAL19'),(676,'','MANUAL20'),(677,'1. 유리볼에 고기를 담고 로즈마리, 통후추 으깬 것, 양송이버섯 썬 것, 월계수잎, 포도주스를 넣고 절인다.','MANUAL01'),(677,'2. 작은 유리볼에 토마토소스와 소고기육수, 바질, 오레가노, 설탕, 마늘가루를 넣고 섞는다.','MANUAL02'),(677,'3. 재워둔 고기를 꺼내 가열된 팬에 앞 뒷면을 익힌다.','MANUAL03'),(677,'4. 고기를 구웠던 팬에 1의 남은 국물과 2의 토마토소스를 붓는다.','MANUAL04'),(677,'5. 팬에 붙은 고기 조각들을 긁어내 함께 중불에서 끓여 양송이버섯 소스를 만든다.','MANUAL05'),(677,'6. 스테이크를 썰어 그릇에 담고 양송이버섯 소스를 끼얹는다.','MANUAL06'),(677,'','MANUAL07'),(677,'','MANUAL08'),(677,'','MANUAL09'),(677,'','MANUAL10'),(677,'','MANUAL11'),(677,'','MANUAL12'),(677,'','MANUAL13'),(677,'','MANUAL14'),(677,'','MANUAL15'),(677,'','MANUAL16'),(677,'','MANUAL17'),(677,'','MANUAL18'),(677,'','MANUAL19'),(677,'','MANUAL20'),(678,'','MANUAL01'),(678,'','MANUAL02'),(678,'','MANUAL03'),(678,'','MANUAL04'),(678,'','MANUAL05'),(678,'','MANUAL06'),(678,'','MANUAL07'),(678,'','MANUAL08'),(678,'','MANUAL09'),(678,'','MANUAL10'),(678,'','MANUAL11'),(678,'','MANUAL12'),(678,'','MANUAL13'),(678,'','MANUAL14'),(678,'','MANUAL15'),(678,'','MANUAL16'),(678,'','MANUAL17'),(678,'','MANUAL18'),(678,'','MANUAL19'),(678,'','MANUAL20'),(679,'1. 다시마로 육수를 낸다.','MANUAL01'),(679,'2. 새우살은 데치고 토마토는 칼집을 내어 데친 후 껍질을 벗긴다.','MANUAL02'),(679,'3. 토마토, 양파, 당근, 호박은 먹기 좋은 크기로 썬다.','MANUAL03'),(679,'4. 새우살과 당근, 호박을 버터에 볶아 준다.','MANUAL04'),(679,'5. 기름을 두른 팬에 토마토와 양파를 넣고 조린다.','MANUAL05'),(679,'6. ⑤에 ④와 육수, 케첩을 넣고 끓인 후 후추를 넣고 소금으로 간을 하여 마무리한다.','MANUAL06'),(679,'','MANUAL07'),(679,'','MANUAL08'),(679,'','MANUAL09'),(679,'','MANUAL10'),(679,'','MANUAL11'),(679,'','MANUAL12'),(679,'','MANUAL13'),(679,'','MANUAL14'),(679,'','MANUAL15'),(679,'','MANUAL16'),(679,'','MANUAL17'),(679,'','MANUAL18'),(679,'','MANUAL19'),(679,'','MANUAL20'),(680,'1. 삶은 문어, 배, 호두, 아몬드는 작게 자르고, 파와 마늘은 다진다.','MANUAL01'),(680,'2. 대추는 돌려 깍기 하여 돌돌 말아 자른다.','MANUAL02'),(680,'3. 돈민찌, 우민찌는 잘 섞어주고 ①재료와 참기름, 후추, 찹쌀가루를 넣어 치대어 준다.','MANUAL03'),(680,'4. 데쳐서 익힌 떡에 밀가루를 얇게 입히고 ③의 반죽을 붙혀 떡갈비를 만든다.','MANUAL04'),(680,'5. 떡갈비를 팬에 올려 속이 익을 때까지 굽는다.','MANUAL05'),(680,'6. 잘라놓은 대추와 잣을 고명으로 올려 완성한다.','MANUAL06'),(680,'','MANUAL07'),(680,'','MANUAL08'),(680,'','MANUAL09'),(680,'','MANUAL10'),(680,'','MANUAL11'),(680,'','MANUAL12'),(680,'','MANUAL13'),(680,'','MANUAL14'),(680,'','MANUAL15'),(680,'','MANUAL16'),(680,'','MANUAL17'),(680,'','MANUAL18'),(680,'','MANUAL19'),(680,'','MANUAL20'),(681,'1. 감자를 삶아 물과 함께 갈아 감자풀을 만든다.','MANUAL01'),(681,'2. 배는 나박썬다.','MANUAL02'),(681,'3. 청홍고추는 어슷썬다.','MANUAL03'),(681,'4. 미나리는 고추와 비슷한 크기로 썰어준다.','MANUAL04'),(681,'5. 준비된 재료에 감자 전분물, 설탕, 마늘, 생강을 넣고 섞어 물김치를 만든다.','MANUAL05'),(681,'6. 하루 정도 숙성시킨 다음 먹는다.','MANUAL06'),(681,'','MANUAL07'),(681,'','MANUAL08'),(681,'','MANUAL09'),(681,'','MANUAL10'),(681,'','MANUAL11'),(681,'','MANUAL12'),(681,'','MANUAL13'),(681,'','MANUAL14'),(681,'','MANUAL15'),(681,'','MANUAL16'),(681,'','MANUAL17'),(681,'','MANUAL18'),(681,'','MANUAL19'),(681,'','MANUAL20'),(682,'1. 참외는 껍질과 속을 제거하고 먹기 좋은 크기로 썬다.','MANUAL01'),(682,'2. 배와 마늘은 편 썰기, 양파와 대파는 채썰기, 홍고추와 생강은 다진다.','MANUAL02'),(682,'3. 물에 식초, 설탕, 누룩소금을 넣어 국물을 만든다.','MANUAL03'),(682,'4. 만들어 놓은 국물에 참외, 배, 양파를 넣어 잘 섞어 준다.','MANUAL04'),(682,'5. 마지막으로 마늘, 홍고추, 생강을 넣어 섞어 준다.','MANUAL05'),(682,'6. 동치미를 그릇에 담아 완성한다.','MANUAL06'),(682,'','MANUAL07'),(682,'','MANUAL08'),(682,'','MANUAL09'),(682,'','MANUAL10'),(682,'','MANUAL11'),(682,'','MANUAL12'),(682,'','MANUAL13'),(682,'','MANUAL14'),(682,'','MANUAL15'),(682,'','MANUAL16'),(682,'','MANUAL17'),(682,'','MANUAL18'),(682,'','MANUAL19'),(682,'','MANUAL20'),(683,'1. 저염 간장, 식초, 물(10㎖)을 섞은 뒤 얇게 채 썬 적양파를 넣어 30분간 숙성해 양파장아찌를 만든다.','MANUAL01'),(683,'2. 두부와 생새우, 팽이버섯, 당근, 깻잎, 파프리카는 믹서에 넣어 곱게 간다.','MANUAL02'),(683,'3. 중간 불로 달군 팬에 다진 소고기를 살짝 볶은 뒤 곱게 간 재료와 감자전분(45g), 달걀흰자와 섞어 소를 만든다.','MANUAL03'),(683,'4. 애호박은 양끝을 자른 뒤 속을 파내고 안쪽에 감자전분(5g)을 고루 묻힌다.','MANUAL04'),(683,'5. 애호박에 소를 채운 뒤 찜기에 넣어 8분간 찐다.','MANUAL05'),(683,'6. 애호박 순대를 1cm 두께로 썰어 그릇에 담고 양파장아찌를 올린다.','MANUAL06'),(683,'','MANUAL07'),(683,'','MANUAL08'),(683,'','MANUAL09'),(683,'','MANUAL10'),(683,'','MANUAL11'),(683,'','MANUAL12'),(683,'','MANUAL13'),(683,'','MANUAL14'),(683,'','MANUAL15'),(683,'','MANUAL16'),(683,'','MANUAL17'),(683,'','MANUAL18'),(683,'','MANUAL19'),(683,'','MANUAL20'),(684,'1. 양파, 당근, 토마토, 파프리카는 한입 크기로 썰고, 닭고기는 한입 크기로 썬다.','MANUAL01'),(684,'2. 닭고기는 요거트(1컵), 가람마살라(1Ts), 코리앤더파우더(1Ts), 커민파우더(1Ts), 다진 마늘(1Ts), 파프리카가루(1Ts), 소금(0.5ts)에 버무려 15분간 재운다.','MANUAL02'),(684,'3. 중간 불로 달군 팬에 버터(2Ts)를 녹이고, 다진 마늘(1Ts), 양파, 당근, 토마토를 넣어 5분간 볶는다.','MANUAL03'),(684,'4. 물(⅓컵), 육수 재료, 생크림을 넣어 끓이고, 당근이 익으면 핸드 믹서로 곱게 간 뒤 체로 거른다.','MANUAL04'),(684,'5. 갈아 낸 카레를 냄비에 붓고, 가람마살라 (1Ts), 코리앤더파우더(1Ts), 커민파우더, (1Ts), 다진 마늘(1Ts), 파프리카가루(1Ts), 소금(0.5ts)을 넣어 걸쭉하게 끓인다.','MANUAL05'),(684,'6. 꼬치에 파프리카와 닭을 번갈아 끼운 뒤 중간 불로 달군 팬에 닭이 익을 때까지 굽고, 그릇에 카레를 담은 뒤 닭꼬치와 바게트를 곁들여 마무리한다.','MANUAL06'),(684,'','MANUAL07'),(684,'','MANUAL08'),(684,'','MANUAL09'),(684,'','MANUAL10'),(684,'','MANUAL11'),(684,'','MANUAL12'),(684,'','MANUAL13'),(684,'','MANUAL14'),(684,'','MANUAL15'),(684,'','MANUAL16'),(684,'','MANUAL17'),(684,'','MANUAL18'),(684,'','MANUAL19'),(684,'','MANUAL20'),(685,'1. 팽이버섯과 느타리버섯은 밑동을 잘라 낱낱이 가르고, 알배추는 한입 크기로 썰고, 쑥갓과 쪽파는 한입 크기로 썬다.','MANUAL01'),(685,'2. 가지와 당근은 어슷 썰고, 단호박은 씨 제거 후 7~8쪽으로 썰고, 표고버섯은 별모양 칼집을 내고, 새우는 깨끗하게 씻고, 관자는 한입 크기로 썬다.','MANUAL02'),(685,'3. 믹서에 삶은 검은콩과 물(1컵)을 넣어 갈고, 볼에 담은 뒤 검은콩 수제비 반죽 재료와 고루 섞어 치대고, 냉장실에서 30분간 숙성한다.','MANUAL03'),(685,'4. 불고기용 소고기를 펼치고, 팽이버섯과 쪽파를 위에 올려 돌돌 만다.','MANUAL04'),(685,'5. 대나무 찜기에 손질한 채소, 해산물,  숙주 순으로 깔아준다.','MANUAL05'),(685,'6. 그 위에 고기 버섯말이를 올려 중간 불에서 10분간 쪄내고, 달걀노른자와 양념장을 곁들여 마무리한다.','MANUAL06'),(685,'','MANUAL07'),(685,'','MANUAL08'),(685,'','MANUAL09'),(685,'','MANUAL10'),(685,'','MANUAL11'),(685,'','MANUAL12'),(685,'','MANUAL13'),(685,'','MANUAL14'),(685,'','MANUAL15'),(685,'','MANUAL16'),(685,'','MANUAL17'),(685,'','MANUAL18'),(685,'','MANUAL19'),(685,'','MANUAL20'),(686,'1. 식용유를 제외한 모든 향신료를 섞어준다.','MANUAL01'),(686,'2. 닭가슴살에 식용유를 바른다.','MANUAL02'),(686,'3. 1의 향신료를 닭가슴살의 한면에만 잘 발라준다.','MANUAL03'),(686,'4. 가열된 식용유를 두르고 닭가슴살의 향신료 묻는 면이 팬에 닿도록 놓는다.','MANUAL04'),(686,'5. 앞 뒷면이 노릇하게 되도록 구워준다.','MANUAL05'),(686,'6. 그릇에 담아 마무리 한다.','MANUAL06'),(686,'','MANUAL07'),(686,'','MANUAL08'),(686,'','MANUAL09'),(686,'','MANUAL10'),(686,'','MANUAL11'),(686,'','MANUAL12'),(686,'','MANUAL13'),(686,'','MANUAL14'),(686,'','MANUAL15'),(686,'','MANUAL16'),(686,'','MANUAL17'),(686,'','MANUAL18'),(686,'','MANUAL19'),(686,'','MANUAL20'),(687,'1. 작은 불에 양념 재료를 넣고 섞어 절반은 돼지고기에 밑간한다.','MANUAL01'),(687,'2. 달라붙지 않는 팬을 중간불고 가열한다.','MANUAL02'),(687,'3. 양념한 돼지고기의 앞·뒷면을 익혀 고기의 중간이 핑크빛이 날 때까지 익히고 그릇에 옮겨담아 뚜껑을 덮어둔다.','MANUAL03'),(687,'4. 강한불에 팬을 놓고 물 1컵을 부어 팬 바닥에 남아 있는 성분들을 녹여 2분정도 끓인다.','MANUAL04'),(687,'5. 물이 1/4컵으로 줄어들면 불을 낮추고 사워크림을 넣고 거품기로 저으면서 끓지 않게 2~3분 간 조리한다.','MANUAL05'),(687,'6. 접시에 돼지고기 폭찹을 담고 스푼으로 소스를 위에 얹고 실파를 뿌려준다.','MANUAL06'),(687,'','MANUAL07'),(687,'','MANUAL08'),(687,'','MANUAL09'),(687,'','MANUAL10'),(687,'','MANUAL11'),(687,'','MANUAL12'),(687,'','MANUAL13'),(687,'','MANUAL14'),(687,'','MANUAL15'),(687,'','MANUAL16'),(687,'','MANUAL17'),(687,'','MANUAL18'),(687,'','MANUAL19'),(687,'','MANUAL20'),(688,'1. 닭가슴살을 170℃의 오븐에서 20분간 구운 후 잘게 찢는다.','MANUAL01'),(688,'2. 양상추는 한 잎 크기로 뜯어 차가운 물에 담갔다가 물기를 뺀다.','MANUAL02'),(688,'3. 방울토마토는 꼭지를 뗀 후 반으로 가른다.','MANUAL03'),(688,'4. 브로콜리는 송이송이 떼어 끓는 물에 데친다.','MANUAL04'),(688,'5. 저나트륨 과일드레싱 재료를 믹서에 넣고 곱게 간다.','MANUAL05'),(688,'6. 준비된 재료를 한데 섞고 저나트륨 과일드레싱을 곁들인다.','MANUAL06'),(688,'','MANUAL07'),(688,'','MANUAL08'),(688,'','MANUAL09'),(688,'','MANUAL10'),(688,'','MANUAL11'),(688,'','MANUAL12'),(688,'','MANUAL13'),(688,'','MANUAL14'),(688,'','MANUAL15'),(688,'','MANUAL16'),(688,'','MANUAL17'),(688,'','MANUAL18'),(688,'','MANUAL19'),(688,'','MANUAL20'),(689,'1. 돼지고기는 덩어리로 준비해 충분히 무르도록 대파, 마늘, 생강, 통후추를 넣어 삶는다.','MANUAL01'),(689,'2. 부추와 양파는 3cm 길이로 썰어 매운 소스 양념에 가볍게 무친다.','MANUAL02'),(689,'3. 무는 채썰어 소금, 설탕, 식초에 절였다가 꼭 짠다.','MANUAL03'),(689,'4. 삶은 돼지고기를 건져 얇게 저민다.','MANUAL04'),(689,'5. 저민 돼지고기와 양념한 부추, 무를 곁들여 접시에 담는다.','MANUAL05'),(689,'6. 두부를 곱게 다져 분량의 소스 재료와 섞어 저나트륨 두부 된장소스를 만들어 수육과 함께 낸다.','MANUAL06'),(689,'','MANUAL07'),(689,'','MANUAL08'),(689,'','MANUAL09'),(689,'','MANUAL10'),(689,'','MANUAL11'),(689,'','MANUAL12'),(689,'','MANUAL13'),(689,'','MANUAL14'),(689,'','MANUAL15'),(689,'','MANUAL16'),(689,'','MANUAL17'),(689,'','MANUAL18'),(689,'','MANUAL19'),(689,'','MANUAL20'),(690,'1. 소고기는 굵게 채썬다.','MANUAL01'),(690,'2. 채썬 소고기에 전분과 달걀을 넣고 밑간을 한다.','MANUAL02'),(690,'3. 버섯과 채소는 씻은 후 0.3cm 두께로 채 썬다.','MANUAL03'),(690,'4. 후라이팬에 소고기를 넣고 볶는다.','MANUAL04'),(690,'5. 채소와 버섯을 넣고 한번 더 볶는다.','MANUAL05'),(690,'6. 육수에 간장, 정종, 후춧가루를 넣고 끓이다가 마지막에 참기름을 넣어 낸다.','MANUAL06'),(690,'','MANUAL07'),(690,'','MANUAL08'),(690,'','MANUAL09'),(690,'','MANUAL10'),(690,'','MANUAL11'),(690,'','MANUAL12'),(690,'','MANUAL13'),(690,'','MANUAL14'),(690,'','MANUAL15'),(690,'','MANUAL16'),(690,'','MANUAL17'),(690,'','MANUAL18'),(690,'','MANUAL19'),(690,'','MANUAL20'),(691,'1. 낙지와 쭈꾸미는 각각 소금물에 씻어 손질한다.','MANUAL01'),(691,'2. 낙지는 5cm 길이로 자른다.','MANUAL02'),(691,'3. 채소들은 각각 10cm 길이로 얇게 채 썬다.','MANUAL03'),(691,'4. 소스를 만든다.','MANUAL04'),(691,'5. 생면은 끓는 물에 데친다.','MANUAL05'),(691,'6. 가열된 팬에 식용유를 넣고 채소를 볶다가 면과 소스를 넣고 충분히 볶는다.','MANUAL06'),(691,'','MANUAL07'),(691,'','MANUAL08'),(691,'','MANUAL09'),(691,'','MANUAL10'),(691,'','MANUAL11'),(691,'','MANUAL12'),(691,'','MANUAL13'),(691,'','MANUAL14'),(691,'','MANUAL15'),(691,'','MANUAL16'),(691,'','MANUAL17'),(691,'','MANUAL18'),(691,'','MANUAL19'),(691,'','MANUAL20'),(692,'1. 도미에 후춧가루와 밀가루를 묻혀 놓는다.','MANUAL01'),(692,'2. 토마토는 껍질을 벗겨 썰고 올리브는 0.8cm 주사위모양으로 썬다.','MANUAL02'),(692,'3. 팬에 식용유를 넣고 도미를 넣어 익히다가 화이트와인을 넣는다.','MANUAL03'),(692,'4. 소스 재료들과 물을 넣어 끓이면서 반으로 졸인다.','MANUAL04'),(692,'5. 도미는 건져내고 팬에 남은 소스에 다진 파슬리가루를 뿌린다.','MANUAL05'),(692,'6. 접시에 도미와 소스를 함께 곁들여 낸다.','MANUAL06'),(692,'','MANUAL07'),(692,'','MANUAL08'),(692,'','MANUAL09'),(692,'','MANUAL10'),(692,'','MANUAL11'),(692,'','MANUAL12'),(692,'','MANUAL13'),(692,'','MANUAL14'),(692,'','MANUAL15'),(692,'','MANUAL16'),(692,'','MANUAL17'),(692,'','MANUAL18'),(692,'','MANUAL19'),(692,'','MANUAL20'),(693,'1. 새우는 내장을 제거하고 오징어는 껍질을 벗겨 안쪽에 대각선으로 칼집을 넣어 5x6cm로 썬다.','MANUAL01'),(693,'2. 굴은 소금물에 흔들어 씻고 패주는 3등분 하고 모시조개는 소금물에 담가 해감시킨다.','MANUAL02'),(693,'3. 곤약은 2x4cm로 썰어 가운데 칼집을 넣어 꼬아주고 버섯들은 찢어 준비한다.','MANUAL03'),(693,'4. 쑥갓, 셀러리, 당귀잎은 잎만 뜯어 준비하고 배추잎은 저며 썬다.','MANUAL04'),(693,'5. 통깨를 갈고 그 밖에 재료들은 모두 섞어 가는 체에 내려 땅콩 소스를 만든다.','MANUAL05'),(693,'6. 냄비에 다시마 국물을 붓고 소금으로 약하게 간을 한 다음 해산물과 채소를 번갈아 가면서 익혀 소스에 찍어 먹는다.','MANUAL06'),(693,'','MANUAL07'),(693,'','MANUAL08'),(693,'','MANUAL09'),(693,'','MANUAL10'),(693,'','MANUAL11'),(693,'','MANUAL12'),(693,'','MANUAL13'),(693,'','MANUAL14'),(693,'','MANUAL15'),(693,'','MANUAL16'),(693,'','MANUAL17'),(693,'','MANUAL18'),(693,'','MANUAL19'),(693,'','MANUAL20'),(694,'1. 손질된 고등어는 5cm 길이로 토막낸 뒤 껍질에 칼집을 넣는다.','MANUAL01'),(694,'2. 칼집 낸 고등어에 밀가루를 묻힌다.','MANUAL02'),(694,'3. 오븐을 200℃로 예열한다.','MANUAL03'),(694,'4. 간장, 올리브오일, 발사믹식초, 꿀을 섞어 소스를 완성한다.','MANUAL04'),(694,'5. 고등어를 팬에 넣어 오븐에 굽는다.','MANUAL05'),(694,'6. 저나트륨발사믹소스와 구운 고등어를 함께 제공한다.','MANUAL06'),(694,'','MANUAL07'),(694,'','MANUAL08'),(694,'','MANUAL09'),(694,'','MANUAL10'),(694,'','MANUAL11'),(694,'','MANUAL12'),(694,'','MANUAL13'),(694,'','MANUAL14'),(694,'','MANUAL15'),(694,'','MANUAL16'),(694,'','MANUAL17'),(694,'','MANUAL18'),(694,'','MANUAL19'),(694,'','MANUAL20'),(695,'1. 양파와 대파는 채 썰고 오이는 반달썰기한다.','MANUAL01'),(695,'2. 미나리와 깻잎은 다지듯 썬다.','MANUAL02'),(695,'3. 골뱅이는 물기를 제거하고 한 입 크기로 썬다.','MANUAL03'),(695,'4. 대파 채는 얼음물에 담가 둔다.','MANUAL04'),(695,'5. 저나트륨 초고추장소스를 만든다.','MANUAL05'),(695,'6. 내기 직전에 무친 후 완성한다.','MANUAL06'),(695,'','MANUAL07'),(695,'','MANUAL08'),(695,'','MANUAL09'),(695,'','MANUAL10'),(695,'','MANUAL11'),(695,'','MANUAL12'),(695,'','MANUAL13'),(695,'','MANUAL14'),(695,'','MANUAL15'),(695,'','MANUAL16'),(695,'','MANUAL17'),(695,'','MANUAL18'),(695,'','MANUAL19'),(695,'','MANUAL20'),(696,'1. 굴은 소금으로 깨끗이 씻어 물기를 뺀다.','MANUAL01'),(696,'2. 두부는 2x2x1cm 크기로 썰고, 실파는 2cm 길이로 자른다.','MANUAL02'),(696,'3. 김은 구워서 잘게 찢거나 가위로 자른다.','MANUAL03'),(696,'4. 고추는 채썰어 씨를 제거한다.','MANUAL04'),(696,'5. 다시마 육수를 끓이다가 두부와 굴을 넣고 뭉근히 끓인 뒤 새우젓과 다진 마늘을 넣고 한소끔 끓인다.','MANUAL05'),(696,'6. 실파와 홍고추를 넣고 마지막에 김과 참기름을 넣는다.','MANUAL06'),(696,'','MANUAL07'),(696,'','MANUAL08'),(696,'','MANUAL09'),(696,'','MANUAL10'),(696,'','MANUAL11'),(696,'','MANUAL12'),(696,'','MANUAL13'),(696,'','MANUAL14'),(696,'','MANUAL15'),(696,'','MANUAL16'),(696,'','MANUAL17'),(696,'','MANUAL18'),(696,'','MANUAL19'),(696,'','MANUAL20'),(697,'1. 도라지, 사과, 배, 연근은 갈아서 뭉근하게 조려 퓨레를 만든다.','MANUAL01'),(697,'2. 연근, 토마토, 양파, 양송이버섯, 당근, 청피망 등 모든 채소는 곱게 다진다.','MANUAL02'),(697,'3. 고기에 퓨레, 달걀, 후추, 생강, 빵가루를 넣어 찰지게 반죽하고 납작하게 빚어서 오븐에 굽는다.','MANUAL03'),(697,'4. 소스제조를 위해 밀가루, 버터를 볶아 루를 만든다.','MANUAL04'),(697,'5. ④에 ②에서 다져놓은 야채를 넣어 끓이고, 소금간과 레몬즙을 뿌려준다.','MANUAL05'),(697,'6. 구운 수제함박스테이크에 새싹채소-파인애플-방울토마토 순으로 장식하고 소스와 함께 제공한다.','MANUAL06'),(697,'','MANUAL07'),(697,'','MANUAL08'),(697,'','MANUAL09'),(697,'','MANUAL10'),(697,'','MANUAL11'),(697,'','MANUAL12'),(697,'','MANUAL13'),(697,'','MANUAL14'),(697,'','MANUAL15'),(697,'','MANUAL16'),(697,'','MANUAL17'),(697,'','MANUAL18'),(697,'','MANUAL19'),(697,'','MANUAL20'),(698,'1. 배와 참외는 1~1.5cm 크기로 깍둑 썬다.','MANUAL01'),(698,'2. 무는 1~1.5cm 크기로 깍둑 썬다.','MANUAL02'),(698,'3. 실파는 1cm 길이로 썬다.','MANUAL03'),(698,'4. 새우젓, 마늘, 생강은 곱게 다진다.','MANUAL04'),(698,'5. 고춧가루, 새우젓, 마늘, 생강, 통깨를 버무려 양념장을 만든다.','MANUAL05'),(698,'6. 배, 참외, 무, 실파에 양념장을 넣어 버무린다.','MANUAL06'),(698,'','MANUAL07'),(698,'','MANUAL08'),(698,'','MANUAL09'),(698,'','MANUAL10'),(698,'','MANUAL11'),(698,'','MANUAL12'),(698,'','MANUAL13'),(698,'','MANUAL14'),(698,'','MANUAL15'),(698,'','MANUAL16'),(698,'','MANUAL17'),(698,'','MANUAL18'),(698,'','MANUAL19'),(698,'','MANUAL20'),(699,'1. 믹서에 비트소스 재료를 넣어 곱게 갈아 삶은 스파게티에 넣어 버무린다.','MANUAL01'),(699,'2. 미니 단호박은 잘게 자른 뒤 끓는 물에 3분간 익혀 건진다.','MANUAL02'),(699,'3. 익힌 미니 단호박은 믹서에 곱게 간 뒤 생크림으로 농도를 맞추고 설탕으로 간하여 단호박소스를 만든다.','MANUAL03'),(699,'4. 감자는 얇게 모양대로 썬다.','MANUAL04'),(699,'5. 중간 불로 달군 팬에 얇게 썬 감자를 2분간 볶아 바삭하게 만들어 잘게 부순다.','MANUAL05'),(699,'6. 그릇에 단호박소스를 붓고, 비트소스를 버무린 스파게티를 담은 뒤 어린잎채소, 파르메산 치즈가루, 잘게 부순 감자를 올려 마무리한다.','MANUAL06'),(699,'','MANUAL07'),(699,'','MANUAL08'),(699,'','MANUAL09'),(699,'','MANUAL10'),(699,'','MANUAL11'),(699,'','MANUAL12'),(699,'','MANUAL13'),(699,'','MANUAL14'),(699,'','MANUAL15'),(699,'','MANUAL16'),(699,'','MANUAL17'),(699,'','MANUAL18'),(699,'','MANUAL19'),(699,'','MANUAL20'),(700,'1. 오이, 양파, 파프리카는 같은 길이로 채 썰고, 도토리묵은 2~3cm 두께로 채 썬다.','MANUAL01'),(700,'2. 양파는 찬물에 5분간 담가 매운맛을 제거하고, 해조국수는 찬물에 헹궈 건진다.','MANUAL02'),(700,'3. 양념장을 만든다.','MANUAL03'),(700,'4. 그릇에 해조국수를 가운데 담고, 손질한 채소와 묵을 올린다.','MANUAL04'),(700,'5. 양념장을 곁들여 마무리한다.','MANUAL05'),(700,'','MANUAL06'),(700,'','MANUAL07'),(700,'','MANUAL08'),(700,'','MANUAL09'),(700,'','MANUAL10'),(700,'','MANUAL11'),(700,'','MANUAL12'),(700,'','MANUAL13'),(700,'','MANUAL14'),(700,'','MANUAL15'),(700,'','MANUAL16'),(700,'','MANUAL17'),(700,'','MANUAL18'),(700,'','MANUAL19'),(700,'','MANUAL20'),(701,'1. 양파와 마늘은 다지고, 감자, 파프리카, 당근은 한입 크기로 썰고, 브로콜리는 송이만 떼어낸다.','MANUAL01'),(701,'2. 닭봉은 밑간해 15분간 재운다.','MANUAL02'),(701,'3. 중간 불로 달군 팬에 올리브유를 두르고, 다진 양파와 마늘을 넣어 양파가 갈색이 될 때까지 볶고, 화이트와인을 넣어 자작해질 때까지 볶고, 월계수잎과 홀토마토를 넣어 으깬 뒤 5분간 끓인다.','MANUAL03'),(701,'4. 강황, 코리앤더가루, 커민, 레드크러쉬드 페퍼, 바질가루, 오레가노 가루를 넣어 섞고, 한 김 식힌 뒤 믹서에 곱게 갈아 토마토소스를 만든다.','MANUAL04'),(701,'5. 밑간한 닭봉은 중간 불로 달군 팬에 버터를 둘러 앞뒤로 노릇하게 익혀 꺼낸다.','MANUAL05'),(701,'6. 같은 팬에 손질한 채소를 넣어 볶다가 구운 닭봉, 토마토소스를 넣어 10분간 끓이고, 생크림과 파르메산 치즈가루를 넣어 자작해질 때까지 졸여 마무리한다.','MANUAL06'),(701,'','MANUAL07'),(701,'','MANUAL08'),(701,'','MANUAL09'),(701,'','MANUAL10'),(701,'','MANUAL11'),(701,'','MANUAL12'),(701,'','MANUAL13'),(701,'','MANUAL14'),(701,'','MANUAL15'),(701,'','MANUAL16'),(701,'','MANUAL17'),(701,'','MANUAL18'),(701,'','MANUAL19'),(701,'','MANUAL20'),(702,'1. 양파와 깻잎은 곱게 다지고, 칵테일새우는 깨끗하게 씻은 뒤 곱게 다진다.','MANUAL01'),(702,'2. 다진 양파, 깻잎, 새우에 양념을 넣어 고루 섞은 뒤 치대 새우반죽을 만든다.','MANUAL02'),(702,'3. 뜨거운 물(4컵)에 라이스페이퍼를 살짝 담갔다 꺼내 식용유를 바른 도마 위에 올린다.','MANUAL03'),(702,'4. 지퍼백에 새우반죽을 넣은 뒤 가위로 끝부분을 잘라 라이스페이퍼 위에 반죽을 짜 올리고, 돌돌 말아 새우소시지를 만든다.','MANUAL04'),(702,'5. 중간 불로 달군 팬에 식용유를 둘러 새우소시지를 올린 뒤 겉면이 하얗게 변할 때까지 노릇하게 굽는다.','MANUAL05'),(702,'6. 그릇에 담고 마늘소스를 윗면에 발라 마무리한다.','MANUAL06'),(702,'','MANUAL07'),(702,'','MANUAL08'),(702,'','MANUAL09'),(702,'','MANUAL10'),(702,'','MANUAL11'),(702,'','MANUAL12'),(702,'','MANUAL13'),(702,'','MANUAL14'),(702,'','MANUAL15'),(702,'','MANUAL16'),(702,'','MANUAL17'),(702,'','MANUAL18'),(702,'','MANUAL19'),(702,'','MANUAL20'),(703,'1. 금태는 아가미와 내장을 제거 한 후 몸통에 어슷하게 칼집을 넣어 소금, 흰후추, 청주, 생강즙으로 밑간을 해둔다.','MANUAL01'),(703,'2. 밑간 한 금태의 수분을 닦고 녹말가루를 고루 묻힌다.','MANUAL02'),(703,'3. 콩나물은 머리와 꼬리를 떼고 미나리는 7cm 길이로 썰고 느타리버섯은 굵게 찢고 홍고추, 대파, 당근, 무는 채썬다.','MANUAL03'),(703,'4. 다시마 국물에 간장, 맛술, 식초를 섞어 찜소스를 만든다.','MANUAL04'),(703,'5. 찜그릇에 무, 당근 채썬 것을 놓고 녹말 입힌 도미와 찜소스를 얹어 찐다.','MANUAL05'),(703,'6. 중간 중간 소스를 뿌려 주고 느타리버섯, 미나리, 홍고추, 콩나물, 채썬 대파를 얹어 찐다.','MANUAL06'),(703,'','MANUAL07'),(703,'','MANUAL08'),(703,'','MANUAL09'),(703,'','MANUAL10'),(703,'','MANUAL11'),(703,'','MANUAL12'),(703,'','MANUAL13'),(703,'','MANUAL14'),(703,'','MANUAL15'),(703,'','MANUAL16'),(703,'','MANUAL17'),(703,'','MANUAL18'),(703,'','MANUAL19'),(703,'','MANUAL20'),(704,'1. 김은 티를 골라낸다.','MANUAL01'),(704,'2. 홍고추, 마늘, 생강은 곱게 채썬다.','MANUAL02'),(704,'3. 간장소스의 양념들은 모두 합하여 20분 가량 낮은 불에서 끓여서 식힌다.','MANUAL03'),(704,'4. 김은 먹기 좋은 크기로 12~18등분으로 자른다.','MANUAL04'),(704,'5. 양념간장에 마늘, 생강, 홍고추채를 섞는다.','MANUAL05'),(704,'6. 김을 차곡차곡 쌓은 뒤 양념간장을 위에 부어준다.','MANUAL06'),(704,'','MANUAL07'),(704,'','MANUAL08'),(704,'','MANUAL09'),(704,'','MANUAL10'),(704,'','MANUAL11'),(704,'','MANUAL12'),(704,'','MANUAL13'),(704,'','MANUAL14'),(704,'','MANUAL15'),(704,'','MANUAL16'),(704,'','MANUAL17'),(704,'','MANUAL18'),(704,'','MANUAL19'),(704,'','MANUAL20'),(705,'1. 꽁치는 머리와 내장을 제거해 손질하고 칼집을 낸다.','MANUAL01'),(705,'2. 손질한 꽁치에 후춧가루와 청주를 뿌려 밑간해 둔다.','MANUAL02'),(705,'3. 밑간해 둔 꽁치의 수분을 제거하고 밀가루를 묻힌다.','MANUAL03'),(705,'4. 밀가루 묻힌 꽁치를 팬에서 노릇하게 굽는다.','MANUAL04'),(705,'5. 팬에 저나트륨 고추장소스 재료를 넣고 살짝 졸인다.','MANUAL05'),(705,'6. 구워진 꽁치에 소스를 뿌려낸다.','MANUAL06'),(705,'','MANUAL07'),(705,'','MANUAL08'),(705,'','MANUAL09'),(705,'','MANUAL10'),(705,'','MANUAL11'),(705,'','MANUAL12'),(705,'','MANUAL13'),(705,'','MANUAL14'),(705,'','MANUAL15'),(705,'','MANUAL16'),(705,'','MANUAL17'),(705,'','MANUAL18'),(705,'','MANUAL19'),(705,'','MANUAL20'),(706,'1. 꽃게를 잘 손질한다.','MANUAL01'),(706,'2. 손질한 꽃게에 생강즙과 후춧가루로 간을 한다.','MANUAL02'),(706,'3. 청·홍고추는 사방 0.7cm로 썰고 생강은 다진다.','MANUAL03'),(706,'4. 매운 고추소스의 재료들을 모두 섞고 냄비에 넣어 끓이다가 준비해둔 채소들을 넣고 한소큼 끓여준다.','MANUAL04'),(706,'5. 꽃게에 찹쌀가루를 묻혀 튀긴다.','MANUAL05'),(706,'6. 4의 소스에 넣고 섞는다.','MANUAL06'),(706,'','MANUAL07'),(706,'','MANUAL08'),(706,'','MANUAL09'),(706,'','MANUAL10'),(706,'','MANUAL11'),(706,'','MANUAL12'),(706,'','MANUAL13'),(706,'','MANUAL14'),(706,'','MANUAL15'),(706,'','MANUAL16'),(706,'','MANUAL17'),(706,'','MANUAL18'),(706,'','MANUAL19'),(706,'','MANUAL20'),(707,'1. 낙지는 내장을 손질하고 밀가루로 비벼 씻는다.','MANUAL01'),(707,'2. 씻어낸 낙지는 끓는 소금물에 살짝 데쳐서 다리를 하나씩 떼어 낸다.','MANUAL02'),(707,'3. 실파는 데치고 불린 미역과 다시마도 데쳐서 알맞게 자른다.','MANUAL03'),(707,'4. 당근은 채썰어 준비해 둔다.','MANUAL04'),(707,'5. 데친 낙지를 절반씩 실파와 미역, 다시마로 감는다.','MANUAL05'),(707,'6. 저나트륨 고추장소스를 만들어 곁들인다.','MANUAL06'),(707,'','MANUAL07'),(707,'','MANUAL08'),(707,'','MANUAL09'),(707,'','MANUAL10'),(707,'','MANUAL11'),(707,'','MANUAL12'),(707,'','MANUAL13'),(707,'','MANUAL14'),(707,'','MANUAL15'),(707,'','MANUAL16'),(707,'','MANUAL17'),(707,'','MANUAL18'),(707,'','MANUAL19'),(707,'','MANUAL20'),(708,'1. 낙지는 밀가루를 넣어 주물러 미끈거리는 것을 씻어내고 흐르는 물에 헹군다.','MANUAL01'),(708,'2. 끓는 물에 데쳐 한 입 크기로 썬다.','MANUAL02'),(708,'3. 오이는 가운데 씨를 잘라낸 뒤 눈썹 모양으로 썰고 홍피망과 미나리는 5cm 길이로 썬다.','MANUAL03'),(708,'4. 배는 굵게 채 썰고 밤은 얇게 썬다.','MANUAL04'),(708,'5. 잣은 곱게 다져 분마기에 넣고 배즙을 조금씩 넣어가며 뽀얗게 즙을 내고 레몬즙과 흰후춧가루, 소금을 넣어준다.','MANUAL05'),(708,'6. 준비된 재료를 잣소스에 버무린다.','MANUAL06'),(708,'','MANUAL07'),(708,'','MANUAL08'),(708,'','MANUAL09'),(708,'','MANUAL10'),(708,'','MANUAL11'),(708,'','MANUAL12'),(708,'','MANUAL13'),(708,'','MANUAL14'),(708,'','MANUAL15'),(708,'','MANUAL16'),(708,'','MANUAL17'),(708,'','MANUAL18'),(708,'','MANUAL19'),(708,'','MANUAL20'),(709,'1. 두부는 4x1.5x1cm 크기로 썬 후 소금을 뿌려 물기를 제거한다.','MANUAL01'),(709,'2. 소라살은 내장을 뺀 뒤 반으로 가르고 패주는 주위의 지저분한 막을 벗겨 깨끗이 손질한 뒤 2~3등분 한다.','MANUAL02'),(709,'3. 바질 잎은 다진다.','MANUAL03'),(709,'4. 볼에 다진 마늘을 담고 소금 간을 한 뒤 올리브유를 조금씩 넣으면서 한 방향으로 젓다가 다진 바질을 넣어 마늘 올리브유 소스를 만든다.','MANUAL04'),(709,'5. 두부와 해산물을 차례로 꼬치에 끼워 붓으로 소스를 고루 바른다.','MANUAL05'),(709,'6. 예열된 250℃ 오븐이나 그릴에서 노릇하게 구워낸다.','MANUAL06'),(709,'','MANUAL07'),(709,'','MANUAL08'),(709,'','MANUAL09'),(709,'','MANUAL10'),(709,'','MANUAL11'),(709,'','MANUAL12'),(709,'','MANUAL13'),(709,'','MANUAL14'),(709,'','MANUAL15'),(709,'','MANUAL16'),(709,'','MANUAL17'),(709,'','MANUAL18'),(709,'','MANUAL19'),(709,'','MANUAL20'),(710,'1. 두부는 소창에 싸서 으깬다.','MANUAL01'),(710,'2. 마는 껍질을 벗기고 강판에 간다.','MANUAL02'),(710,'3. 홍고추는 다지고 표고버섯은 물에 불린 후 잘게 다진다. 오징어도 손질하여 잘게 다진다.','MANUAL03'),(710,'4. 두부와 마, 다진 재료들을 모두 섞어 소금, 후춧가루로 간한다.','MANUAL04'),(710,'5. 반죽을 한 스푼씩 떠 식용유를 넣은 팬에 노릇하게 구워낸다.','MANUAL05'),(710,'6. 재료를 섞어 양념장을 만들어 함께 낸다','MANUAL06'),(710,'','MANUAL07'),(710,'','MANUAL08'),(710,'','MANUAL09'),(710,'','MANUAL10'),(710,'','MANUAL11'),(710,'','MANUAL12'),(710,'','MANUAL13'),(710,'','MANUAL14'),(710,'','MANUAL15'),(710,'','MANUAL16'),(710,'','MANUAL17'),(710,'','MANUAL18'),(710,'','MANUAL19'),(710,'','MANUAL20'),(711,'1. 멸치는 티를 골라내어 선별해 두고 실파는 썬다.','MANUAL01'),(711,'2. 팬에 식용유를 두르고 소스의 양념들을 넣어 최대한 낮은 불에서 서서히 졸여 농도를 낸다.','MANUAL02'),(711,'3. 찹쌀가루 중 1/3분량만 묽게 풀을 쑤어 식힌다.','MANUAL03'),(711,'4. 멸치에 풀을 가볍게 익히고 남은 찹쌀가루를 묻힌다.','MANUAL04'),(711,'5. 튀김기름의 온도를 170~180℃에 맞추어 4의 멸치를 재빨리 튀겨낸다.','MANUAL05'),(711,'6. 식은 후에 (2)의 소스에 버무리거나 끼얹어 낸다.','MANUAL06'),(711,'','MANUAL07'),(711,'','MANUAL08'),(711,'','MANUAL09'),(711,'','MANUAL10'),(711,'','MANUAL11'),(711,'','MANUAL12'),(711,'','MANUAL13'),(711,'','MANUAL14'),(711,'','MANUAL15'),(711,'','MANUAL16'),(711,'','MANUAL17'),(711,'','MANUAL18'),(711,'','MANUAL19'),(711,'','MANUAL20'),(712,'1. 연두부는 작은 숟가락으로 떠 놓는다.','MANUAL01'),(712,'2. 불린 미역은 4cm 길이로 썬다.','MANUAL02'),(712,'3. 오징어는 껍질을 벗기고 칼집을 넣어 데친다.','MANUAL03'),(712,'4. 데친 오징어는 솔방울 모양으로 자른다.','MANUAL04'),(712,'5. 꽈리고추는 데친다.','MANUAL05'),(712,'6. 재료를 보기좋게 담고 양념장을 곁들여 낸다.','MANUAL06'),(712,'','MANUAL07'),(712,'','MANUAL08'),(712,'','MANUAL09'),(712,'','MANUAL10'),(712,'','MANUAL11'),(712,'','MANUAL12'),(712,'','MANUAL13'),(712,'','MANUAL14'),(712,'','MANUAL15'),(712,'','MANUAL16'),(712,'','MANUAL17'),(712,'','MANUAL18'),(712,'','MANUAL19'),(712,'','MANUAL20'),(713,'1. 조갯살은 연한 소금물로 헹구어 물기를 뺀다.','MANUAL01'),(713,'2. 부추는 2~3cm 길이로 썰고 당근은 짧게 채 썬다.','MANUAL02'),(713,'3. 냄비에 분량의 조림장 재료를 전부 넣고 한소큼 끓어 오르면 조갯살을 넣어 살짝 데쳐 건져둔다.','MANUAL03'),(713,'4. 3의 냄비에 물 3컵을 더 넣고 당근을 넣어 조림장 분량이 2/3정도가 될 때까지 졸인다.','MANUAL04'),(713,'5. 다른 팬에 기름을 두르지 않고 콩비지를 넣어 보슬보슬해질 때 까지 볶는다.','MANUAL05'),(713,'6. 5에 4를 전부 붓고 채썬 부추와 데친 조갯살도 넣어 간이 고루 들도록 저어가며 볶는다.','MANUAL06'),(713,'','MANUAL07'),(713,'','MANUAL08'),(713,'','MANUAL09'),(713,'','MANUAL10'),(713,'','MANUAL11'),(713,'','MANUAL12'),(713,'','MANUAL13'),(713,'','MANUAL14'),(713,'','MANUAL15'),(713,'','MANUAL16'),(713,'','MANUAL17'),(713,'','MANUAL18'),(713,'','MANUAL19'),(713,'','MANUAL20'),(714,'1. 연어는 주사위모양으로 썬다.','MANUAL01'),(714,'2. 흰후춧가루를 살짝 뿌린 후 녹말가루를 묻힌다.','MANUAL02'),(714,'3. 녹말을 묻힌 연어는 김 오른 찜통에 찌고 식혀둔다.','MANUAL03'),(714,'4. 오이, 래디쉬, 셀러리, 배는 곱게 채썰어 냉수에 담갔다가 건진다.','MANUAL04'),(714,'5. 캔 파인애플을 잘게 썰어 분량의 재료들과 함께 믹서기에 곱게 간다.','MANUAL05'),(714,'6. 접시에 준비된 채소와 찐 연어를 담고 소스를 곁들인다.','MANUAL06'),(714,'','MANUAL07'),(714,'','MANUAL08'),(714,'','MANUAL09'),(714,'','MANUAL10'),(714,'','MANUAL11'),(714,'','MANUAL12'),(714,'','MANUAL13'),(714,'','MANUAL14'),(714,'','MANUAL15'),(714,'','MANUAL16'),(714,'','MANUAL17'),(714,'','MANUAL18'),(714,'','MANUAL19'),(714,'','MANUAL20'),(715,'1. 오징어는 껍질을 벗긴 후 안쪽에 대각선으로 칼집을 넣어 데친다.','MANUAL01'),(715,'2. 당근, 시금치, 불린 표고버섯은 0.5cm 두께로 썬다.','MANUAL02'),(715,'3. 시금치는 끓는 물에 데쳐 찬물에 헹군 뒤 물기를 제거한다.','MANUAL03'),(715,'4. 달걀은 잘 풀어 도톰하게 달걀말이를 만 후 당근처럼 썬다.','MANUAL04'),(715,'5. 오징어의 물기를 제거하고 밀가루를 살짝 뿌린후 2, 3의 재료를 모두 넣어 김밥 말듯이 돌돌말아 꼬치로 두군데를 고정시킨다.','MANUAL05'),(715,'6. 토마토케첩소스의 재료를 섞어 팬에서 졸이다가 4의 오징어를 넣고 소스를 끼얹어가며 졸여 1.5cm의 두께로 썬다.','MANUAL06'),(715,'','MANUAL07'),(715,'','MANUAL08'),(715,'','MANUAL09'),(715,'','MANUAL10'),(715,'','MANUAL11'),(715,'','MANUAL12'),(715,'','MANUAL13'),(715,'','MANUAL14'),(715,'','MANUAL15'),(715,'','MANUAL16'),(715,'','MANUAL17'),(715,'','MANUAL18'),(715,'','MANUAL19'),(715,'','MANUAL20'),(716,'1. 오징어는 반으로 갈라 껍질을 제거하고 몸통 안쪽에 대각선으로 칼집을 넣는다.','MANUAL01'),(716,'2. 칼집 낸 오징어를 끓는 물에 데친다.','MANUAL02'),(716,'3. 데친 오징어는 한 입 크기로 썬다.','MANUAL03'),(716,'4. 오이는 돌려 깎아 3cm 길이로 채썰고 당근도 4cm 길이로 얇게 채썬다.','MANUAL04'),(716,'5. 드레싱에 들어갈 양파, 청·홍고추는 잘게 다져 분량의 재료와 섞어 저나트륨 된장소스를 만든다.','MANUAL05'),(716,'6. 상추에 준비된 오징어와 오이, 당근, 저나트륨 된장소스를 기호에 맞게 곁들여 먹는다.','MANUAL06'),(716,'','MANUAL07'),(716,'','MANUAL08'),(716,'','MANUAL09'),(716,'','MANUAL10'),(716,'','MANUAL11'),(716,'','MANUAL12'),(716,'','MANUAL13'),(716,'','MANUAL14'),(716,'','MANUAL15'),(716,'','MANUAL16'),(716,'','MANUAL17'),(716,'','MANUAL18'),(716,'','MANUAL19'),(716,'','MANUAL20'),(717,'1. 새우는 손질하여 물기를 제거한다.','MANUAL01'),(717,'2. 달걀, 녹말가루, 밀가루로 튀김옷을 만들어 새우에 묻힌다.','MANUAL02'),(717,'3. 튀김옷을 입힌 새우를 170℃ 식용유에 두 번 튀겨낸다.','MANUAL03'),(717,'4. 대파, 마늘, 생강은 다진다.','MANUAL04'),(717,'5. 팬에 고추기름을 두르고 2를 넣고 볶다가 청주, 두반장, 케첩을 첨가하여 볶은 후 물을 넣고 설탕, 식초로 간을 맞춘다.','MANUAL05'),(717,'6. 살짝 졸인 뒤 튀긴 새우와 완두콩을 넣고 물녹말로 농도를 맞추고 마지막으로 참기름을 넣는다.','MANUAL06'),(717,'','MANUAL07'),(717,'','MANUAL08'),(717,'','MANUAL09'),(717,'','MANUAL10'),(717,'','MANUAL11'),(717,'','MANUAL12'),(717,'','MANUAL13'),(717,'','MANUAL14'),(717,'','MANUAL15'),(717,'','MANUAL16'),(717,'','MANUAL17'),(717,'','MANUAL18'),(717,'','MANUAL19'),(717,'','MANUAL20'),(718,'1. 연근은 세척 후 껍질을 벗긴다.','MANUAL01'),(718,'2. 연근을 슬라이스 한다.','MANUAL02'),(718,'3. 물에 식초를 넣고 끓으면 연근을 데친다.','MANUAL03'),(718,'4. 레몬즙을 짠다.','MANUAL04'),(718,'5. 흑임자, 마요네즈, 플레인요거트를 믹서 하여 흑임자 소스를 만든다.','MANUAL05'),(718,'6. 연근에 흑임자소스를 곁들여 담는다.','MANUAL06'),(718,'','MANUAL07'),(718,'','MANUAL08'),(718,'','MANUAL09'),(718,'','MANUAL10'),(718,'','MANUAL11'),(718,'','MANUAL12'),(718,'','MANUAL13'),(718,'','MANUAL14'),(718,'','MANUAL15'),(718,'','MANUAL16'),(718,'','MANUAL17'),(718,'','MANUAL18'),(718,'','MANUAL19'),(718,'','MANUAL20'),(719,'1. 단호박은 쪄서 속을 파내고, 우유와 올리고당을 넣고 끓여 소스를 만든다.','MANUAL01'),(719,'2. 소고기, 돼지고기, 양파, 마늘, 당근은 모두 잘게 다진다.','MANUAL02'),(719,'3. ②에 빵가루, 달걀, 소금, 후추를 넣고 치댄다.','MANUAL03'),(719,'4. 치댄 반죽을 둥글고 납작하게 만들어 준다.','MANUAL04'),(719,'5. 팬에 기름을 두르고 노릇하게 굽는다.','MANUAL05'),(719,'6. 함박스테이크에 단호박 크림소스를 부어 제공한다.','MANUAL06'),(719,'','MANUAL07'),(719,'','MANUAL08'),(719,'','MANUAL09'),(719,'','MANUAL10'),(719,'','MANUAL11'),(719,'','MANUAL12'),(719,'','MANUAL13'),(719,'','MANUAL14'),(719,'','MANUAL15'),(719,'','MANUAL16'),(719,'','MANUAL17'),(719,'','MANUAL18'),(719,'','MANUAL19'),(719,'','MANUAL20'),(720,'1. 배는 껍질을 벗긴다.','MANUAL01'),(720,'2. 껍질 벗긴 배를 깍뚝썰기 한다.','MANUAL02'),(720,'3. 부추는 먹기 좋은 길이로 썬다.','MANUAL03'),(720,'4. 배와 부추에 고춧가루를 버무려 색이 베이도록 한다.','MANUAL04'),(720,'5. 매실청과 설탕을 넣어 새콤달콤하게 버무린다.','MANUAL05'),(720,'6. 참깨를 뿌려 완성한다.','MANUAL06'),(720,'','MANUAL07'),(720,'','MANUAL08'),(720,'','MANUAL09'),(720,'','MANUAL10'),(720,'','MANUAL11'),(720,'','MANUAL12'),(720,'','MANUAL13'),(720,'','MANUAL14'),(720,'','MANUAL15'),(720,'','MANUAL16'),(720,'','MANUAL17'),(720,'','MANUAL18'),(720,'','MANUAL19'),(720,'','MANUAL20'),(721,'1. 방울토마토, 양파, 파프리카, 할라피뇨, 훈제 닭가슴살은 작게 깍둑썬다.','MANUAL01'),(721,'2. 손질한 재료에 양념을 고루 섞는다.','MANUAL02'),(721,'3. 찰깨빵의 윗부분 1cm를 도려낸다.','MANUAL03'),(721,'4. 빵 안에 버무린 재료를 채운 뒤 모차렐라치즈를 올린다.','MANUAL04'),(721,'5. 180℃로 예열한 오븐에 속을 채운 빵을 넣고 5분간 구워 꺼낸다.','MANUAL05'),(721,'6. 그릇에 구운 빵을 올린 뒤 파슬리가루를 뿌린다.','MANUAL06'),(721,'','MANUAL07'),(721,'','MANUAL08'),(721,'','MANUAL09'),(721,'','MANUAL10'),(721,'','MANUAL11'),(721,'','MANUAL12'),(721,'','MANUAL13'),(721,'','MANUAL14'),(721,'','MANUAL15'),(721,'','MANUAL16'),(721,'','MANUAL17'),(721,'','MANUAL18'),(721,'','MANUAL19'),(721,'','MANUAL20'),(722,'1. 브로콜리는 송이만 떼어내고, 애호박과 레몬은 4mm 두께로 둥글게 썰고, 양파와 노랑 파프리카는 한입 크기로 썰고, 방울토마토는 4등분하고, 마늘은 꼭지를 제거한다.','MANUAL01'),(722,'2. 볼에 레몬즙을 넣고 올리브유를 조금씩 부어가며 거품기로 골고루 섞는다.','MANUAL02'),(722,'3. 올리브유를 섞은 레몬즙에 소금, 후춧가루, 다진 양파를 넣고 고루 섞어 레몬소스를 만든 뒤 연어에 버무려 15분간 재운다.','MANUAL03'),(722,'4. 종이포일에 애호박, 연어, 레몬, 로즈메리 순으로 깔고, 손질한 채소를 올린다.','MANUAL04'),(722,'5. 올리브유(1Ts)를 뿌리고 종이포일 양끝을 돌돌 만 뒤 작은 구멍을 2~3개 낸다.','MANUAL05'),(722,'6. 찜기에 김이 오르면 연어를 넣고, 뚜껑을 덮어 센 불로 25분간 익혀 마무리한다.','MANUAL06'),(722,'','MANUAL07'),(722,'','MANUAL08'),(722,'','MANUAL09'),(722,'','MANUAL10'),(722,'','MANUAL11'),(722,'','MANUAL12'),(722,'','MANUAL13'),(722,'','MANUAL14'),(722,'','MANUAL15'),(722,'','MANUAL16'),(722,'','MANUAL17'),(722,'','MANUAL18'),(722,'','MANUAL19'),(722,'','MANUAL20'),(723,'1. 떡볶이 떡은 끓는 물에 데쳐 건진다.','MANUAL01'),(723,'2. 꼬치에 데친 떡을 꽂는다.','MANUAL02'),(723,'3. 파와 양파는 다진다.','MANUAL03'),(723,'4. 양념장 재료에 다진 양파와 파를 섞어 양념장을 만든다.','MANUAL04'),(723,'5. 팬에 식용유를 두른 뒤 양념장을 볶는다.','MANUAL05'),(723,'6. 양념장을 떡꼬치에 묻힌 뒤 통깨를 뿌려 마무리한다.','MANUAL06'),(723,'','MANUAL07'),(723,'','MANUAL08'),(723,'','MANUAL09'),(723,'','MANUAL10'),(723,'','MANUAL11'),(723,'','MANUAL12'),(723,'','MANUAL13'),(723,'','MANUAL14'),(723,'','MANUAL15'),(723,'','MANUAL16'),(723,'','MANUAL17'),(723,'','MANUAL18'),(723,'','MANUAL19'),(723,'','MANUAL20'),(724,'1. 아보카도는 검은 빛이 돌면서 윤기가 흐르는 것을 골라 세로로 칼날을 넣어 칼날이 씨에 닿으면 한바퀴 돌린다.','MANUAL01'),(724,'2. 양손으로 아보카도 양 끝을 잡고 비틀면서 반으로 나누고 칼날 안쪽 모서리로 씨를 찔러서 빼낸다.','MANUAL02'),(724,'3. 아보카도 과육을 5cm 두께로 썬다.','MANUAL03'),(724,'4. 냉동 게살은 하룻밤 전에 냉장고로 옮겨 놓거나, 실온에서 해동시킨 후 잘게 찢는다. 양파는 얇게 채썰고 민트도 잘게 썬다.','MANUAL04'),(724,'5. 고추냉이 드레싱 재료를 섞는다.','MANUAL05'),(724,'6. 두부는 원형틀로 찍어두고 양파와 게살, 아보카도를 곁들이고 민트를 올린 뒤 드레싱을 뿌린다.','MANUAL06'),(724,'','MANUAL07'),(724,'','MANUAL08'),(724,'','MANUAL09'),(724,'','MANUAL10'),(724,'','MANUAL11'),(724,'','MANUAL12'),(724,'','MANUAL13'),(724,'','MANUAL14'),(724,'','MANUAL15'),(724,'','MANUAL16'),(724,'','MANUAL17'),(724,'','MANUAL18'),(724,'','MANUAL19'),(724,'','MANUAL20'),(725,'1. 젤라틴을 물에 불려 놓는다.','MANUAL01'),(725,'2. 자몽주스에 설탕을 넣고 가열한다.','MANUAL02'),(725,'3. 불린 젤라틴을 넣어 약한 불에서 젤라틴을 녹인다.','MANUAL03'),(725,'4. 틀에 귤과 파인애플, 체리를 넣는다.','MANUAL04'),(725,'5. 틀에 젤라틴을 녹인 자몽주스를 넣는다.','MANUAL05'),(725,'6. 냉장고에서 식혀 완성한다.','MANUAL06'),(725,'','MANUAL07'),(725,'','MANUAL08'),(725,'','MANUAL09'),(725,'','MANUAL10'),(725,'','MANUAL11'),(725,'','MANUAL12'),(725,'','MANUAL13'),(725,'','MANUAL14'),(725,'','MANUAL15'),(725,'','MANUAL16'),(725,'','MANUAL17'),(725,'','MANUAL18'),(725,'','MANUAL19'),(725,'','MANUAL20'),(726,'1. 복숭아는 반으로 갈라 씨를 발라내고 두께 0.5cm가량만 남기고 속을 파낸다.','MANUAL01'),(726,'2. 복숭아와 식혜, 설탕시럽을 넣고 믹서기에 굵게 간다.','MANUAL02'),(726,'3. 2를 냉동실에서 4~5시간 정도 얼리면서 1시간마다 숟가락으로 긁어 샤벳을 만든다.','MANUAL03'),(726,'4. 속을 파낸 복숭아도 냉동실에서 얼려 샤벳 그릇으로 사용한다.','MANUAL04'),(726,'5. 3의 복숭아 식혜 샤벳을 떠서 얼린 복숭아 그릇에 담는다.','MANUAL05'),(726,'6. 민트로 장식하여 완성한다.','MANUAL06'),(726,'','MANUAL07'),(726,'','MANUAL08'),(726,'','MANUAL09'),(726,'','MANUAL10'),(726,'','MANUAL11'),(726,'','MANUAL12'),(726,'','MANUAL13'),(726,'','MANUAL14'),(726,'','MANUAL15'),(726,'','MANUAL16'),(726,'','MANUAL17'),(726,'','MANUAL18'),(726,'','MANUAL19'),(726,'','MANUAL20'),(727,'1. 천도복숭아는 반으로 잘라 씨를 제거하고 각각 2등분하고 자두는 반으로 갈라 씨를 제거한다.','MANUAL01'),(727,'2. 사과는 8등분하여 씨를 제거한다.','MANUAL02'),(727,'3. 포도는 알알이 떼어내고 체리는 꼭지를 떼어내고 블루베리와 산딸기는 분량대로 준비한다.','MANUAL03'),(727,'4. 냄비에 포도주스와 설탕, 준비한 과일을 넣고 약한불에서 끓인다.','MANUAL04'),(727,'5. 천도복숭아가 부드러워지고 포도주스에 농도가 생기면 불을 끈다.','MANUAL05'),(727,'6. 접시에 졸인 과일과 주스를 함께 담는다.','MANUAL06'),(727,'','MANUAL07'),(727,'','MANUAL08'),(727,'','MANUAL09'),(727,'','MANUAL10'),(727,'','MANUAL11'),(727,'','MANUAL12'),(727,'','MANUAL13'),(727,'','MANUAL14'),(727,'','MANUAL15'),(727,'','MANUAL16'),(727,'','MANUAL17'),(727,'','MANUAL18'),(727,'','MANUAL19'),(727,'','MANUAL20'),(728,'1. 마늘은 다지고, 양파, 청피망, 가지, 애호박, 양송이는 1cm 주사위모양으로 썬다.','MANUAL01'),(728,'2. 토마토는 끓는 물에 데쳐 껍질을 벗긴 뒤 씨를 제거하고 야채들과 같은 크기로 자른다.','MANUAL02'),(728,'3. 감자는 껍질을 벗겨 큼직하게 썰어 삶은 뒤 완전히 익으면 오븐서 수분을 제거하고 으깨 우유, 생크림, 소금, 후추를 넣는다.','MANUAL03'),(728,'4. 팬에 기름을 두르고 양파를 투명해질 때까지 볶은 뒤 마늘, 토마토 페이스트를 넣고 볶다가 청피망, 가지, 호박, 양송이, 토마토를 넣어 볶는다.','MANUAL04'),(728,'5. 야채가 부드러워지면 닭육수를 넣어 한번 더 끓이고 소금, 후추로 간 한다.','MANUAL05'),(728,'6. 접시에 완성된 으깬 감자를 깔고 그 위에 야채 스튜를 올려낸다.','MANUAL06'),(728,'','MANUAL07'),(728,'','MANUAL08'),(728,'','MANUAL09'),(728,'','MANUAL10'),(728,'','MANUAL11'),(728,'','MANUAL12'),(728,'','MANUAL13'),(728,'','MANUAL14'),(728,'','MANUAL15'),(728,'','MANUAL16'),(728,'','MANUAL17'),(728,'','MANUAL18'),(728,'','MANUAL19'),(728,'','MANUAL20'),(729,'1. 고구마는 1cm의 주사위모양으로 썰어 놓는다.','MANUAL01'),(729,'2. 물에 씻은 김치를 송송 썰어서 참기름을 두른 팬에 볶다가 마늘과 소금을 넣어 볶은 뒤 깨소긂으로 마무리한다.','MANUAL02'),(729,'3. 냄비에 불린 쌀과 고구마, 볶은 김치를 넣고 고슬고슬하게 밥을 짓는다.','MANUAL03'),(729,'4. 사과의 꼭지 부분을 자른 뒤 속을 파내고 밥을 채운다.','MANUAL04'),(729,'5.  160℃로 예열된 오븐에 밥을 채운 사과를 넣고 사과가 익을 정도로 구워준다.','MANUAL05'),(729,'6. 양념장 재료를 섞어 양념장을 만들고 밥과 곁들여 낸다.','MANUAL06'),(729,'','MANUAL07'),(729,'','MANUAL08'),(729,'','MANUAL09'),(729,'','MANUAL10'),(729,'','MANUAL11'),(729,'','MANUAL12'),(729,'','MANUAL13'),(729,'','MANUAL14'),(729,'','MANUAL15'),(729,'','MANUAL16'),(729,'','MANUAL17'),(729,'','MANUAL18'),(729,'','MANUAL19'),(729,'','MANUAL20'),(730,'1. 돼지고기를 흐르는 물에 담궈 핏물을 제거한다.','MANUAL01'),(730,'2. 파인애플 일부는 먹기 좋은 크기로 썰고 나머지는 믹서에 간다.','MANUAL02'),(730,'3. 간 파인애플과 양념을 섞어 양념장을 만든다.','MANUAL03'),(730,'4. 핏물을 제거한 돼지고기에 양념장을 섞어 재운다.','MANUAL04'),(730,'5. 프라이팬에 기름을 두르고 양념한 돼지고기와 한 입 크기로 썬 채소를 볶는다.','MANUAL05'),(730,'6. 썰어둔 파인애플을 넣는다.','MANUAL06'),(730,'','MANUAL07'),(730,'','MANUAL08'),(730,'','MANUAL09'),(730,'','MANUAL10'),(730,'','MANUAL11'),(730,'','MANUAL12'),(730,'','MANUAL13'),(730,'','MANUAL14'),(730,'','MANUAL15'),(730,'','MANUAL16'),(730,'','MANUAL17'),(730,'','MANUAL18'),(730,'','MANUAL19'),(730,'','MANUAL20'),(731,'1. 비름나물을 적당한 길이로 잘라 다시마육수에 데친 뒤 찬물에 헹궈 물기를 뺀다.','MANUAL01'),(731,'2. 양파는 2mm 두께로 채 썰고 생강과 마늘은 곱게 다진다.','MANUAL02'),(731,'3. 된장을 곱게 다진 뒤 구멍이 큰 체에 걸러 식감을 살리고 고추장, 마요네즈, 고춧가루와 섞는다.','MANUAL03'),(731,'4. 양념장에 다진 생강, 마늘을 섞는다.','MANUAL04'),(731,'5. 비름나물에 양파, 양념장을 넣고 골고루 무친다.','MANUAL05'),(731,'6. 참기름을 둘러 가볍게 섞은 뒤 깨를 뿌려 마무리한다.','MANUAL06'),(731,'','MANUAL07'),(731,'','MANUAL08'),(731,'','MANUAL09'),(731,'','MANUAL10'),(731,'','MANUAL11'),(731,'','MANUAL12'),(731,'','MANUAL13'),(731,'','MANUAL14'),(731,'','MANUAL15'),(731,'','MANUAL16'),(731,'','MANUAL17'),(731,'','MANUAL18'),(731,'','MANUAL19'),(731,'','MANUAL20'),(732,'1. 양지를 찬물에 담가 핏물을 제거한다.','MANUAL01'),(732,'2. 양지와 무를 냄비에 끓인 뒤 양지를 건진다.','MANUAL02'),(732,'3. 알토란은 쌀뜨물에 1시간 정도 담근 뒤 소금물에 삶아 아린 맛을 제거한다.','MANUAL03'),(732,'4. 각종 채소를 손질하고 건져낸 양지를 찢는다.','MANUAL04'),(732,'5. 육수에 손질한 야채와 양지를 넣고 끓인다.','MANUAL05'),(732,'6. 고춧가루와 들깨가루를 넣고 끓인다.','MANUAL06'),(732,'','MANUAL07'),(732,'','MANUAL08'),(732,'','MANUAL09'),(732,'','MANUAL10'),(732,'','MANUAL11'),(732,'','MANUAL12'),(732,'','MANUAL13'),(732,'','MANUAL14'),(732,'','MANUAL15'),(732,'','MANUAL16'),(732,'','MANUAL17'),(732,'','MANUAL18'),(732,'','MANUAL19'),(732,'','MANUAL20'),(733,'1. 삼겹살은 덩어리로 준비하여 삶아낸다.','MANUAL01'),(733,'2. 배, 사과, 파인애플, 양파, 깐마늘, 깐생강은 갈아서 체에 거르고 간장과 함께 끓인다.','MANUAL02'),(733,'3. ②에 삶아낸 삼겹살을 넣어 윤기 나게 조린다.','MANUAL03'),(733,'4. 대파는 가늘게 채 썰고, 새싹채소는 깨끗하게 씻는다.','MANUAL04'),(733,'5. 레몬즙, 식초, 설탕, 국간장, 고춧가루를 넣어 만든 소스를 야채에 버무린다.','MANUAL05'),(733,'6. 한입 크기로 썬 삼겹살과 ⑤를 곁들여 낸다.','MANUAL06'),(733,'','MANUAL07'),(733,'','MANUAL08'),(733,'','MANUAL09'),(733,'','MANUAL10'),(733,'','MANUAL11'),(733,'','MANUAL12'),(733,'','MANUAL13'),(733,'','MANUAL14'),(733,'','MANUAL15'),(733,'','MANUAL16'),(733,'','MANUAL17'),(733,'','MANUAL18'),(733,'','MANUAL19'),(733,'','MANUAL20'),(734,'1. 곤약은 얇게 편으로 썰어 데친 뒤, 백김치 국물에 절인다.','MANUAL01'),(734,'2. 끓는 물에 식초를 넣고 오징어를 질기지 않게 살짝 삶는다.','MANUAL02'),(734,'3. 파프리카는 채썰어 준다.','MANUAL03'),(734,'4. 백김치는 물기를 제거한다.','MANUAL04'),(734,'5. 곤약을 깔고 오징어, 파프리카를 얹어 백김치로 말아준다.','MANUAL05'),(734,'6. 데쳐낸 부추로 풀어지지 않게 매듭을 짓는다.','MANUAL06'),(734,'','MANUAL07'),(734,'','MANUAL08'),(734,'','MANUAL09'),(734,'','MANUAL10'),(734,'','MANUAL11'),(734,'','MANUAL12'),(734,'','MANUAL13'),(734,'','MANUAL14'),(734,'','MANUAL15'),(734,'','MANUAL16'),(734,'','MANUAL17'),(734,'','MANUAL18'),(734,'','MANUAL19'),(734,'','MANUAL20'),(735,'1. 꽈리고추, 양파, 건고추는 3cm 길이로 썰고, 마늘은 2등분하고, 대파는 송송 썬다.','MANUAL01'),(735,'2. 닭다릿살은 4×4cm 크기로 썰고, 백후춧가루에 버무린 뒤 튀김옷 재료를 입힌다.','MANUAL02'),(735,'3. 약한 불로 달군 팬에 식용유를 두른 뒤 손질한 건고추, 마늘, 대파를 넣고 볶아 기름을 낸다.','MANUAL03'),(735,'4. 튀김옷을 입힌 닭다릿살을 넣어 노릇해 질 때까지 튀기듯 볶고, 양파를 넣어 투명해질 때까지 볶는다.','MANUAL04'),(735,'5. 센 불로 올린 뒤 양념장을 넣어 재빠르게 볶고, 꽈리고추를 넣어 10초간 볶아 꺼낸다.','MANUAL05'),(735,'6. 참깨를 뿌려 마무리한다.','MANUAL06'),(735,'','MANUAL07'),(735,'','MANUAL08'),(735,'','MANUAL09'),(735,'','MANUAL10'),(735,'','MANUAL11'),(735,'','MANUAL12'),(735,'','MANUAL13'),(735,'','MANUAL14'),(735,'','MANUAL15'),(735,'','MANUAL16'),(735,'','MANUAL17'),(735,'','MANUAL18'),(735,'','MANUAL19'),(735,'','MANUAL20'),(736,'1. 큰 볼에 두부를 담은 뒤 물이 담긴 무거운 그릇을 3분간 올려 수분을 제거한다.','MANUAL01'),(736,'2. 두부 속을 사각형 모양으로 파내고, 파낸 두부 속은 물기를 꼭 짜 으깬다.','MANUAL02'),(736,'3. 파프리카와 깻잎은 잘게 썬다.','MANUAL03'),(736,'4. 통조림 참치는 체에 밭친 뒤, 뜨거운 물을 부어 기름과 염분을 제거한다.','MANUAL04'),(736,'5. 볼에 으깬 두부, 손질한 채소, 잡곡밥, 참치를 넣은 뒤 양념해 고루 섞는다.','MANUAL05'),(736,'6. 주먹밥을 동그랗게 만들고, 속을 판 두부 속에 넣어 마무리한다.','MANUAL06'),(736,'','MANUAL07'),(736,'','MANUAL08'),(736,'','MANUAL09'),(736,'','MANUAL10'),(736,'','MANUAL11'),(736,'','MANUAL12'),(736,'','MANUAL13'),(736,'','MANUAL14'),(736,'','MANUAL15'),(736,'','MANUAL16'),(736,'','MANUAL17'),(736,'','MANUAL18'),(736,'','MANUAL19'),(736,'','MANUAL20'),(737,'1. 양파, 청피망, 마늘, 고추는 다지고, 대구살은 굵직하게 썬다.','MANUAL01'),(737,'2. 토마토는 데친 뒤 껍질을 벗기고 씨를 제거해 과육만 썬다.','MANUAL02'),(737,'3. 기름을 두른 팬에 양파, 고추를 넣고 볶다가 마늘을 넣고 볶는다.','MANUAL03'),(737,'4. 생크림과 땅콩버터를 넣은 후 토마토, 파프리카, 새우 순서대로 넣어 끓인다.','MANUAL04'),(737,'5. 썰어둔 대구살을 넣는다.','MANUAL05'),(737,'6. 소금, 후추로 간을 한다.','MANUAL06'),(737,'','MANUAL07'),(737,'','MANUAL08'),(737,'','MANUAL09'),(737,'','MANUAL10'),(737,'','MANUAL11'),(737,'','MANUAL12'),(737,'','MANUAL13'),(737,'','MANUAL14'),(737,'','MANUAL15'),(737,'','MANUAL16'),(737,'','MANUAL17'),(737,'','MANUAL18'),(737,'','MANUAL19'),(737,'','MANUAL20'),(738,'1. 좁쌀을 씻어 불린다.','MANUAL01'),(738,'2. 대추와 깐 밤을 냄비에 넣고 물 4컵을 넣고 대추가 무르도록 삶는다.','MANUAL02'),(738,'3. 삶은 대추를 손으로 주물러 대추 속살이 나오도록 한 뒤 밤과 함께 체에 거른다.','MANUAL03'),(738,'4. 좁쌀은 5배의 물을 부어 저어가면서 익힌다.','MANUAL04'),(738,'5. 3을 4에 넣어 잘 섞은 뒤 찹쌀물을 넣어 농도가 나도록 끓인다.','MANUAL05'),(738,'6. 소금으로 간을 맞추고 준비한 그릇에 담아낸다.','MANUAL06'),(738,'','MANUAL07'),(738,'','MANUAL08'),(738,'','MANUAL09'),(738,'','MANUAL10'),(738,'','MANUAL11'),(738,'','MANUAL12'),(738,'','MANUAL13'),(738,'','MANUAL14'),(738,'','MANUAL15'),(738,'','MANUAL16'),(738,'','MANUAL17'),(738,'','MANUAL18'),(738,'','MANUAL19'),(738,'','MANUAL20'),(739,'1. 돼지고기는 깨끗이 손질한 뒤 잘게다진다.','MANUAL01'),(739,'2. 두부는 1cm 정사각형 모양으로 썬다','MANUAL02'),(739,'3. 토마토는 껍질과 씨를 제거한 뒤 두부와 같은 크기로 썬다.','MANUAL03'),(739,'4. 기름을 두른 팬에 파와 생강을 넣고 볶아 향이 나면 1을 넣고 볶은 뒤 따로 담아둔다.','MANUAL04'),(739,'5. 기름을 두른 팬에 토마토, 두부, 고기를 넣고 볶다가 육수를 자작하게 부은 뒤 간장, 소금으로 간을 한다.','MANUAL05'),(739,'6. 소스가 졸아들면 두부를 넣고 물 전분을 넣어 소스 농도를 맞춘다.','MANUAL06'),(739,'','MANUAL07'),(739,'','MANUAL08'),(739,'','MANUAL09'),(739,'','MANUAL10'),(739,'','MANUAL11'),(739,'','MANUAL12'),(739,'','MANUAL13'),(739,'','MANUAL14'),(739,'','MANUAL15'),(739,'','MANUAL16'),(739,'','MANUAL17'),(739,'','MANUAL18'),(739,'','MANUAL19'),(739,'','MANUAL20'),(740,'1. 메론은 적당한 크기로 잘라 믹서에 간다.','MANUAL01'),(740,'2. 오렌지와 레몬은 과육만 잘라내 믹서에 각각 갈아 주스형태로 만든다.','MANUAL02'),(740,'3. 2에 탄산수, 오렌지껍질, 레몬껍질을 넣어 향이 우러나도록 끓인다.','MANUAL03'),(740,'4. 3에 전분을 넣어 농도를 맞춘 뒤 덩어리지지 않게 체에 걸러 차갑게 식힌다.','MANUAL04'),(740,'5. 1에 4를 넣고 잘 섞은 뒤 설탕으로 맛을 낸다.','MANUAL05'),(740,'6. 생크림을 휘핑해 올리고 자두, 메론, 민트로 장식한다.','MANUAL06'),(740,'','MANUAL07'),(740,'','MANUAL08'),(740,'','MANUAL09'),(740,'','MANUAL10'),(740,'','MANUAL11'),(740,'','MANUAL12'),(740,'','MANUAL13'),(740,'','MANUAL14'),(740,'','MANUAL15'),(740,'','MANUAL16'),(740,'','MANUAL17'),(740,'','MANUAL18'),(740,'','MANUAL19'),(740,'','MANUAL20'),(741,'1. 바질과 양파, 브로콜리, 당근은 곱게 다진다.','MANUAL01'),(741,'2. 소고기와 돼지고기는 곱게 간다.','MANUAL02'),(741,'3. 2를 1:1 비율로 섞고 1과 달걀, 케첩, 후추, 빵가루와 섞어 패티를 만든다.','MANUAL03'),(741,'4. 미니버거빵의 안쪽 면에 버터를 바른 후 팬에서 살짝 구워준다.','MANUAL04'),(741,'5. 3을 팬에서 갈색이 나도록 익혀준다.','MANUAL05'),(741,'6. 4에 마요네즈를 바르고 양상추, 패티, 케첩, 토마토, 양상추 순으로 올리고 마요네즈를 바른 빵으로 덮는다.','MANUAL06'),(741,'','MANUAL07'),(741,'','MANUAL08'),(741,'','MANUAL09'),(741,'','MANUAL10'),(741,'','MANUAL11'),(741,'','MANUAL12'),(741,'','MANUAL13'),(741,'','MANUAL14'),(741,'','MANUAL15'),(741,'','MANUAL16'),(741,'','MANUAL17'),(741,'','MANUAL18'),(741,'','MANUAL19'),(741,'','MANUAL20'),(742,'1. 시금치와 바질을 팬에서 볶다가 소금, 후추로 간한 뒤 모짜렐라 치즈를 넣어 식히고 고구마는 삶아 껍질을 벗긴 뒤 1cm 주사위 모양으로 자른다.','MANUAL01'),(742,'2. 소스팬에 물 2컵반을 넣고 끓이다가 찬물 1컵에 소금을 넣고 섞은 옥수수 가루를 천천히 넣어준다.','MANUAL02'),(742,'3. 다시 끓어오를 때까지 천천히 젓다가 낮은 온도에서 아주 되직해질 때까지 익힌 뒤 파마산 치즈를 넣고 섞는다.','MANUAL03'),(742,'4. 버터를 바른 사기그릇에 3을 절반가량 넣고 그위에 1과 2를 올리고, 남은 반죽을 올려 그릇을 채워 냉장고에서 식힌다.','MANUAL04'),(742,'5. 4가 완전히 굳으면 176℃의 오븐에서 윗면에 갈색이 나도록 40분정도 굽는다.','MANUAL05'),(742,'6. 5를 적당한 크기로 잘라 접시에 담고 기호에 따라 토마토케첩을 곁들여 낸다.','MANUAL06'),(742,'','MANUAL07'),(742,'','MANUAL08'),(742,'','MANUAL09'),(742,'','MANUAL10'),(742,'','MANUAL11'),(742,'','MANUAL12'),(742,'','MANUAL13'),(742,'','MANUAL14'),(742,'','MANUAL15'),(742,'','MANUAL16'),(742,'','MANUAL17'),(742,'','MANUAL18'),(742,'','MANUAL19'),(742,'','MANUAL20'),(743,'1. 당근, 양파, 청피망, 홍피망, 햄은 곱게 다진다.','MANUAL01'),(743,'2. 달군 팬에 1을 넣고 볶는다.','MANUAL02'),(743,'3. 2에 밥을 넣고 볶으면서 카레가루와 소금, 후춧가루로 간을 맞춘다.','MANUAL03'),(743,'4. 치즈는 적당한 크기로 잘라준다.','MANUAL04'),(743,'5. 춘권피에 3과 4를 넣고 스틱 모양으로 만든다.','MANUAL05'),(743,'6. 팬에 기름을 넉넉히 두르고 5를 튀겨준다','MANUAL06'),(743,'','MANUAL07'),(743,'','MANUAL08'),(743,'','MANUAL09'),(743,'','MANUAL10'),(743,'','MANUAL11'),(743,'','MANUAL12'),(743,'','MANUAL13'),(743,'','MANUAL14'),(743,'','MANUAL15'),(743,'','MANUAL16'),(743,'','MANUAL17'),(743,'','MANUAL18'),(743,'','MANUAL19'),(743,'','MANUAL20'),(744,'1. 마늘은 잘게 다지고 양송이 버섯은 2mm 두께로 썬다.','MANUAL01'),(744,'2. 팬에 기름을 두르고 다진 마늘을 볶다가 양송이버섯을 넣고 볶아 접시에 담아둔다.','MANUAL02'),(744,'3. 2의 팬에 쌀을 넣고 볶는다.','MANUAL03'),(744,'4. 3에 닭육수를 넣고 수분을 흡수 할 때까지 잘 젓는다.','MANUAL04'),(744,'5. 쌀이 어느 정도 익으면 2를 넣고 쌀이 완전히 익을 때까지 조리한다.','MANUAL05'),(744,'6. 파마산치즈, 소금, 후추, 다진 타임, 다진 파슬리를 넣는다.','MANUAL06'),(744,'','MANUAL07'),(744,'','MANUAL08'),(744,'','MANUAL09'),(744,'','MANUAL10'),(744,'','MANUAL11'),(744,'','MANUAL12'),(744,'','MANUAL13'),(744,'','MANUAL14'),(744,'','MANUAL15'),(744,'','MANUAL16'),(744,'','MANUAL17'),(744,'','MANUAL18'),(744,'','MANUAL19'),(744,'','MANUAL20'),(745,'1. 불린 쌀은 믹서나 절구를 이용하여 간다.','MANUAL01'),(745,'2. 참치 살, 표고버섯, 무, 양파는 곱게 다진다.','MANUAL02'),(745,'3. 팬에 참기름을 두르고 1과 다진 표고버섯, 무, 양파를 볶는다.','MANUAL03'),(745,'4. 3에 물을 넣어 무른 밥을 짓는다.','MANUAL04'),(745,'5. 4의 밥이 끓어오르면 다진 참치 살을 넣고 저어가며 끓인다.','MANUAL05'),(745,'6. 참치 살이 다 익으면 통깨를 뿌린다.','MANUAL06'),(745,'','MANUAL07'),(745,'','MANUAL08'),(745,'','MANUAL09'),(745,'','MANUAL10'),(745,'','MANUAL11'),(745,'','MANUAL12'),(745,'','MANUAL13'),(745,'','MANUAL14'),(745,'','MANUAL15'),(745,'','MANUAL16'),(745,'','MANUAL17'),(745,'','MANUAL18'),(745,'','MANUAL19'),(745,'','MANUAL20'),(746,'1. 쌀은 깨끗하게 씻어 불린다.','MANUAL01'),(746,'2. 1을 분쇄기로 살짝 간다.','MANUAL02'),(746,'3. 양송이버섯과 채소를 잘게 다진다.','MANUAL03'),(746,'4. 마른 미역은 30분 정도 불렸다가 잘게 다진다.','MANUAL04'),(746,'5. 냄비에 참기름을 두르고 2를 볶다가 3, 4를 넣고 한번 더 볶는다.','MANUAL05'),(746,'6. 5에 물을 넣은 뒤 쌀알이 퍼지도록 끓인다.','MANUAL06'),(746,'','MANUAL07'),(746,'','MANUAL08'),(746,'','MANUAL09'),(746,'','MANUAL10'),(746,'','MANUAL11'),(746,'','MANUAL12'),(746,'','MANUAL13'),(746,'','MANUAL14'),(746,'','MANUAL15'),(746,'','MANUAL16'),(746,'','MANUAL17'),(746,'','MANUAL18'),(746,'','MANUAL19'),(746,'','MANUAL20'),(747,'1. 쌀은 깨끗하게 씻어 불린다.','MANUAL01'),(747,'2. 2를 믹서나 절구로 곱게 갈아 냄비에 물과 함께 넣고 끓인다.','MANUAL02'),(747,'3. 배는 껍질과 씨를 제거하고 강판에 간다.','MANUAL03'),(747,'4. 시금치는 끓는 물에 데친 후 물기를 꼭 짜서 곱게 다진다.','MANUAL04'),(747,'5. 2가 끓어오르면 3,4를 넣고 끓인다.','MANUAL05'),(747,'6. 입맛에 맞게 꿀로 간한다.','MANUAL06'),(747,'','MANUAL07'),(747,'','MANUAL08'),(747,'','MANUAL09'),(747,'','MANUAL10'),(747,'','MANUAL11'),(747,'','MANUAL12'),(747,'','MANUAL13'),(747,'','MANUAL14'),(747,'','MANUAL15'),(747,'','MANUAL16'),(747,'','MANUAL17'),(747,'','MANUAL18'),(747,'','MANUAL19'),(747,'','MANUAL20'),(748,'1. 초대리 재료를 분량대로 섞어 설탕, 소금이 녹을 정도로만 가열해 초대리를 만들어 고슬고슬하게 지은 따듯한 밥에 넣고 섞어 식힌다.','MANUAL01'),(748,'2. 달걀은 삶아 흰자와 노른자로 따로 체에 내려 가루를 만들어 놓는다.','MANUAL02'),(748,'3. 햄, 치즈는 원하는 모양틀로 찍는다.','MANUAL03'),(748,'4. 기름을 제거한 참치에 다진 양파와 셀러리, 마요네즈를 섞는다.','MANUAL04'),(748,'5. 칵테일 새우는 데쳐서 식힌다.','MANUAL05'),(748,'6. 모양틀에 밥을 찍어내고 그 위에 준비한 재료들을 올려 완성한다.','MANUAL06'),(748,'','MANUAL07'),(748,'','MANUAL08'),(748,'','MANUAL09'),(748,'','MANUAL10'),(748,'','MANUAL11'),(748,'','MANUAL12'),(748,'','MANUAL13'),(748,'','MANUAL14'),(748,'','MANUAL15'),(748,'','MANUAL16'),(748,'','MANUAL17'),(748,'','MANUAL18'),(748,'','MANUAL19'),(748,'','MANUAL20'),(749,'1. 바닥이 두꺼운 팬의 표면에 마늘을 문질러 마늘 즙을 골고루 묻힌다.','MANUAL01'),(749,'2. 1을 가열한 뒤 버터를 녹인다.','MANUAL02'),(749,'3. 팬에 닭육수와 물전분을 넣고 약한 불에서 덩어리가 생기지 않도록 저어가며 끓인다.','MANUAL03'),(749,'4. 자른 에멘탈치즈를 넣고 나무 주걱을 이용하여 한 방향으로 젓는다.','MANUAL04'),(749,'5. 치즈가 다 녹으면 기호에 맞게 넉맥, 소금, 후추를 넣는다.','MANUAL05'),(749,'6. 바케트, 방울토마토, 키위 등을 적당한 크기로 잘라 꼬치에 꼿아 곁들인다.','MANUAL06'),(749,'','MANUAL07'),(749,'','MANUAL08'),(749,'','MANUAL09'),(749,'','MANUAL10'),(749,'','MANUAL11'),(749,'','MANUAL12'),(749,'','MANUAL13'),(749,'','MANUAL14'),(749,'','MANUAL15'),(749,'','MANUAL16'),(749,'','MANUAL17'),(749,'','MANUAL18'),(749,'','MANUAL19'),(749,'','MANUAL20'),(750,'1. 두부를 1.5cm 두께로 잘라 물기를 뺀다.','MANUAL01'),(750,'2. 프라이팬에 올리브유를 두르고 두부를 굽는다.','MANUAL02'),(750,'3. 느타리버섯을 먹기 좋은 크기로 찢는다.','MANUAL03'),(750,'4. 느타리버섯을 올리브유에 살짝 볶는다.','MANUAL04'),(750,'5. 4에 발사믹크림, 올리고당을 넣어 졸인다.','MANUAL05'),(750,'6. 두부구이 위에 소스를 올린다.','MANUAL06'),(750,'','MANUAL07'),(750,'','MANUAL08'),(750,'','MANUAL09'),(750,'','MANUAL10'),(750,'','MANUAL11'),(750,'','MANUAL12'),(750,'','MANUAL13'),(750,'','MANUAL14'),(750,'','MANUAL15'),(750,'','MANUAL16'),(750,'','MANUAL17'),(750,'','MANUAL18'),(750,'','MANUAL19'),(750,'','MANUAL20'),(751,'1. 고구마를 먹기 좋은 크기로 썬다.','MANUAL01'),(751,'2. 고구마를 젓갈에 절인다.','MANUAL02'),(751,'3. 미나리, 홍고추를 먹기 좋은 크기로 썬다.','MANUAL03'),(751,'4. 양념 재료를 모두 섞는다.','MANUAL04'),(751,'5. 절인 고구마와 썰어둔 미나리, 홍고추, 양념을 섞어 무친다.','MANUAL05'),(751,'6. 참깨를 뿌려 마무리한다.','MANUAL06'),(751,'','MANUAL07'),(751,'','MANUAL08'),(751,'','MANUAL09'),(751,'','MANUAL10'),(751,'','MANUAL11'),(751,'','MANUAL12'),(751,'','MANUAL13'),(751,'','MANUAL14'),(751,'','MANUAL15'),(751,'','MANUAL16'),(751,'','MANUAL17'),(751,'','MANUAL18'),(751,'','MANUAL19'),(751,'','MANUAL20'),(752,'1. 분쇄 우육과 돈육은 해동 후 핏물을 제거한다.','MANUAL01'),(752,'2. 두부는 끓는 물에 데쳐낸 후 으깬다.','MANUAL02'),(752,'3. 우육, 돈육, 다진양파, 다진대파, 으깬 두부(15g)에 간장과 설탕으로 간을 한 후 여러번 치댄다.','MANUAL03'),(752,'4. 점성이 생긴 고기를 동그랗게 성형한 후 팬에 구워낸다.','MANUAL04'),(752,'5. 쌈장에 으깬 두부(15g)와 해바라기 씨를 넣어 섞는다.','MANUAL05'),(752,'6. 떡갈비와 양념장, 야채쌈을 함께 제공한다.','MANUAL06'),(752,'','MANUAL07'),(752,'','MANUAL08'),(752,'','MANUAL09'),(752,'','MANUAL10'),(752,'','MANUAL11'),(752,'','MANUAL12'),(752,'','MANUAL13'),(752,'','MANUAL14'),(752,'','MANUAL15'),(752,'','MANUAL16'),(752,'','MANUAL17'),(752,'','MANUAL18'),(752,'','MANUAL19'),(752,'','MANUAL20'),(753,'1. 단감의 껍질과 씨를 제거한다.','MANUAL01'),(753,'2. 단감을 깍둑썰기 한다.','MANUAL02'),(753,'3. 식초와 설탕과 물을 섞어 단촛물을 만든다.','MANUAL03'),(753,'4. 단촛물을 끓인다.','MANUAL04'),(753,'5. 단촛물을 식혀 단감에 부워 절인다.','MANUAL05'),(753,'6. 30분 정도 숙성시켜 완성한다.','MANUAL06'),(753,'','MANUAL07'),(753,'','MANUAL08'),(753,'','MANUAL09'),(753,'','MANUAL10'),(753,'','MANUAL11'),(753,'','MANUAL12'),(753,'','MANUAL13'),(753,'','MANUAL14'),(753,'','MANUAL15'),(753,'','MANUAL16'),(753,'','MANUAL17'),(753,'','MANUAL18'),(753,'','MANUAL19'),(753,'','MANUAL20'),(754,'1. 닭은 우유에 담가 20분간 재운다.','MANUAL01'),(754,'2. 냄비에 물(1.5L)과 닭, 삼계탕 티백, 소금을 넣어 30분간 삶아 건진 뒤 살을 발라 한입 크기로 찢는다.','MANUAL02'),(754,'3. 끓는 삼계탕 육수(800㎖)에 메밀면을 4분간 삶아 건져 얼음에 비벼 식힌 뒤 돌돌 말아준다.','MANUAL03'),(754,'4. 끓는 물(500㎖)에 깻잎을 넣어 1분간 살짝 데쳐 건진 뒤 펼쳐 찢은 닭고기, 들깨소스, 바질을 얹어 돌돌 말아준다.','MANUAL04'),(754,'5. 믹서에 국물 재료를 넣어 간 뒤 체에 거른다.','MANUAL05'),(754,'6. 그릇에 메밀면과 깻잎말이를 담은 뒤 국물을 부어 마무리한다.','MANUAL06'),(754,'','MANUAL07'),(754,'','MANUAL08'),(754,'','MANUAL09'),(754,'','MANUAL10'),(754,'','MANUAL11'),(754,'','MANUAL12'),(754,'','MANUAL13'),(754,'','MANUAL14'),(754,'','MANUAL15'),(754,'','MANUAL16'),(754,'','MANUAL17'),(754,'','MANUAL18'),(754,'','MANUAL19'),(754,'','MANUAL20'),(755,'1. 양파는 도톰하게 모양대로 썰고, 대파는 2등분하고, 마늘은 꼭지를 제거하고, 알배추는 깨끗하게 씻는다.','MANUAL01'),(755,'2. 통조림 골뱅이는 체에 밭쳐 국물을 거르고, 끓는 물에 30초간 데쳐 건진 뒤 찬물에 헹군다.','MANUAL02'),(755,'3. 냄비에 양파, 대파를 깔고, 통마늘, 삼겹살, 월계수잎, 맛술을 넣어 센 불로 끓인다.','MANUAL03'),(755,'4. 채즙이 나오면 약한 불로 줄여 45분간 고기를 삶는다.','MANUAL04'),(755,'5. 파채에 데친 골뱅이와 양념장을 넣어 골고루 버무린다.','MANUAL05'),(755,'6. 삶은 수육은 한 김 식힌 뒤 한입 크기로 썰고, 알배추, 골뱅이무침을 곁들여 마무리한다.','MANUAL06'),(755,'','MANUAL07'),(755,'','MANUAL08'),(755,'','MANUAL09'),(755,'','MANUAL10'),(755,'','MANUAL11'),(755,'','MANUAL12'),(755,'','MANUAL13'),(755,'','MANUAL14'),(755,'','MANUAL15'),(755,'','MANUAL16'),(755,'','MANUAL17'),(755,'','MANUAL18'),(755,'','MANUAL19'),(755,'','MANUAL20'),(756,'1. 양파와 셀러리는 다지고, 베이컨은 적당한 크기로 자른다.','MANUAL01'),(756,'2. 팬에 베이컨을 넣고 볶다가 양파, 셀러리를 넣고 색이 나지 않게 볶는다.','MANUAL02'),(756,'3. 야채가 볶아지면 완두콩을 넣고 충분히 볶아준다.','MANUAL03'),(756,'4. 완두콩이 반 정도 익으면 육수를 넣고 푹 끓여준다.','MANUAL04'),(756,'5. 완두콩이 다 익으면 믹서에 간 뒤 체에 걸러낸다.','MANUAL05'),(756,'6. 5를 냄비에 옮기고 기호에 맞게 소금, 후춧가루, 생크림을 넣는다.','MANUAL06'),(756,'','MANUAL07'),(756,'','MANUAL08'),(756,'','MANUAL09'),(756,'','MANUAL10'),(756,'','MANUAL11'),(756,'','MANUAL12'),(756,'','MANUAL13'),(756,'','MANUAL14'),(756,'','MANUAL15'),(756,'','MANUAL16'),(756,'','MANUAL17'),(756,'','MANUAL18'),(756,'','MANUAL19'),(756,'','MANUAL20'),(757,'1. 유부는 윗면을 살짝 잘라 내고 입을 벌려 주머니를 만든 뒤 끓는 물에 데쳐 냉수에 헹구고 미나리는 잎을 떼고 데쳐 냉수에 헹군다.','MANUAL01'),(757,'2. 두부는 면보에 물기를 짠 뒤 곱게 으깨고 닭고기는 껍질을 제거하여 곱게 다진다.','MANUAL02'),(757,'3. 양파와 당근, 불린 표고버섯은 곱게 채썰고 시금치는 끓는 물에 데쳐 물기를 짜고 2cm 길이로 썬다.','MANUAL03'),(757,'4. 볼에 2, 3을 담고 소금, 흰 후춧가루, 깨소금과 참기름을 넣고 양념하여 만두소를 만든다.','MANUAL04'),(757,'5. 준비한 유부주머니에 만두소를 넣고 미나리로 묶어 김 오른 찜통에 10분 정도 찐다.','MANUAL05'),(757,'6. 초간장을 곁들여 낸다.','MANUAL06'),(757,'','MANUAL07'),(757,'','MANUAL08'),(757,'','MANUAL09'),(757,'','MANUAL10'),(757,'','MANUAL11'),(757,'','MANUAL12'),(757,'','MANUAL13'),(757,'','MANUAL14'),(757,'','MANUAL15'),(757,'','MANUAL16'),(757,'','MANUAL17'),(757,'','MANUAL18'),(757,'','MANUAL19'),(757,'','MANUAL20'),(758,'1. 펜네 파스타를 끓는 소금물에 기름을 약간 넣고 10분정도 삶아 체에 밭쳐 물기를 뺀다.','MANUAL01'),(758,'2. 청피망, 홍피망, 양파는 펜네 파스타 길이로 썰고, 완두콩은 끓는 물에 데쳐서 찬물에 헹군 뒤 물기를 뺀다.','MANUAL02'),(758,'3. 아스파라거스도 펜네 파스타 길이로 썰어 끓는 소금물에 데쳐 찬물에 식힌 뒤 물기를 뺀다.','MANUAL03'),(758,'4. 블랙올리브를 링 형태로 썬다.','MANUAL04'),(758,'5. 볼에 1과 바질 페스토, 소금을 넣고 섞는다.','MANUAL05'),(758,'6. 5와 나머지 야채들을 같이 섞어 접시에 담는다.','MANUAL06'),(758,'','MANUAL07'),(758,'','MANUAL08'),(758,'','MANUAL09'),(758,'','MANUAL10'),(758,'','MANUAL11'),(758,'','MANUAL12'),(758,'','MANUAL13'),(758,'','MANUAL14'),(758,'','MANUAL15'),(758,'','MANUAL16'),(758,'','MANUAL17'),(758,'','MANUAL18'),(758,'','MANUAL19'),(758,'','MANUAL20'),(759,'1. 새우는 껍질과 내장을 제거하고 바지락은 살짝 데쳐 입이 열리면 살을 발라낸다.','MANUAL01'),(759,'2. 해산물은 0.5cm 크기로 썰고 실파는 송송 썬다.','MANUAL02'),(759,'3. 토마토는 껍질을 벗겨 햄과 비슷한 크기로 썰고 바질은 굵게 채썬다.','MANUAL03'),(759,'4. 팬에 올리브오일은 두르고 햄, 옥수수를 넣어 볶다가 풀어둔 달걀을 넣고 스크램블을 만든다.','MANUAL04'),(759,'5. 4가 반 정도 익었을 때 해산물, 토마토, 바질을 넣고 홍고추로 장식하고 다 익으면 오븐용 용기에 담는다.','MANUAL05'),(759,'6. 5에 치즈를 0.5cm 넓이로 잘라 격자로 올리고 오븐에서 굽는다.','MANUAL06'),(759,'','MANUAL07'),(759,'','MANUAL08'),(759,'','MANUAL09'),(759,'','MANUAL10'),(759,'','MANUAL11'),(759,'','MANUAL12'),(759,'','MANUAL13'),(759,'','MANUAL14'),(759,'','MANUAL15'),(759,'','MANUAL16'),(759,'','MANUAL17'),(759,'','MANUAL18'),(759,'','MANUAL19'),(759,'','MANUAL20'),(760,'1. 닭고기를 깍둑썰기한다.','MANUAL01'),(760,'2. 감자, 오이는 깍둑썰기 하고 목이버섯은 물에 불린다.','MANUAL02'),(760,'3. 기름을 두른 팬에 1을 넣고 볶다가 닭 육수를 넣는다.','MANUAL03'),(760,'4. 닭고기가 익으면 감자, 목이버섯을 넣고 끓인 뒤 건진다.','MANUAL04'),(760,'5. 깨끗한 팬에 기름을 두르고 밥과 송송 썬 파를 넣고 볶는다.','MANUAL05'),(760,'6. 5에 오이와 익힌 닭고기, 목이버섯, 소금을 넣어 볶는다.','MANUAL06'),(760,'','MANUAL07'),(760,'','MANUAL08'),(760,'','MANUAL09'),(760,'','MANUAL10'),(760,'','MANUAL11'),(760,'','MANUAL12'),(760,'','MANUAL13'),(760,'','MANUAL14'),(760,'','MANUAL15'),(760,'','MANUAL16'),(760,'','MANUAL17'),(760,'','MANUAL18'),(760,'','MANUAL19'),(760,'','MANUAL20'),(761,'1. 쌀을 씻어 불린 뒤 믹서나 절구에 넣고 곱게 간다.','MANUAL01'),(761,'2. 두부를 곱게 으깬다.','MANUAL02'),(761,'3. 검은깨를 물에 넣어 돌맹이가 없도록 거른다.','MANUAL03'),(761,'4. 3의 물기를 빼고 볶은 뒤 동량의 물을 넣고 곱게 간다.','MANUAL04'),(761,'5. 냄비에 쌀과 두부, 적당량의 물을 넣고 센불에서 끓인다.','MANUAL05'),(761,'6. 불을 줄여 쌀이 퍼지면 2의 검은깨를 넣고 더 끓여 소금으로 간한다.','MANUAL06'),(761,'','MANUAL07'),(761,'','MANUAL08'),(761,'','MANUAL09'),(761,'','MANUAL10'),(761,'','MANUAL11'),(761,'','MANUAL12'),(761,'','MANUAL13'),(761,'','MANUAL14'),(761,'','MANUAL15'),(761,'','MANUAL16'),(761,'','MANUAL17'),(761,'','MANUAL18'),(761,'','MANUAL19'),(761,'','MANUAL20'),(762,'1. 메론의 껍질을 벗기고 2cm 정도의 주사위모양으로 썬다.','MANUAL01'),(762,'2. 사과는 껍질을 벗기고 메론과 같은 크기로 썬다.','MANUAL02'),(762,'3. 바나나도 껍질을 벗기고 같은 크기로 썬다.','MANUAL03'),(762,'4. 오렌지는 칼로 껍질을 도려내고 속살만 자른다.','MANUAL04'),(762,'5. 플레인 요구르트와 레몬주스, 오렌지주스를 섞어 드레싱을 만든다.','MANUAL05'),(762,'6. 볼에 과일을 한데 섞고 드래싱으로 버무려 완성한다.','MANUAL06'),(762,'','MANUAL07'),(762,'','MANUAL08'),(762,'','MANUAL09'),(762,'','MANUAL10'),(762,'','MANUAL11'),(762,'','MANUAL12'),(762,'','MANUAL13'),(762,'','MANUAL14'),(762,'','MANUAL15'),(762,'','MANUAL16'),(762,'','MANUAL17'),(762,'','MANUAL18'),(762,'','MANUAL19'),(762,'','MANUAL20'),(763,'1. 냄비에 버터를 녹인 후 마늘, 양파, 셀러리, 생강을 넣고 볶는다.','MANUAL01'),(763,'2. 양파와 셀러리가 부드러워지면 닭육수를 넣는다.','MANUAL02'),(763,'3. 2에 단호박, 고구마를 넣고 단호박이 부드러워질 때까지 약한불로 끓인다.','MANUAL03'),(763,'4. 단호박이 다 익으면 믹서에 부드러운 상태가 되도록 간다.','MANUAL04'),(763,'5. 4를 다시 냄비에 넣고 중간불로 끓인다.','MANUAL05'),(763,'6. 5에 우유, 라임주스, 소금, 후추, 크림을 넣어 마무리한다.','MANUAL06'),(763,'','MANUAL07'),(763,'','MANUAL08'),(763,'','MANUAL09'),(763,'','MANUAL10'),(763,'','MANUAL11'),(763,'','MANUAL12'),(763,'','MANUAL13'),(763,'','MANUAL14'),(763,'','MANUAL15'),(763,'','MANUAL16'),(763,'','MANUAL17'),(763,'','MANUAL18'),(763,'','MANUAL19'),(763,'','MANUAL20'),(764,'1. 곱게 다진 새우살에 소금, 흰 후춧가루로 밑간한다.','MANUAL01'),(764,'2. 1에 달걀흰자, 전분을 넣어 치댄후 지름 2cm 정도의 완자를 만든다.','MANUAL02'),(764,'3. 불린 당면, 팽이버섯, 부추는 5cm 길이로 자르고 홍고추는 2cm 길이로 채썬다.','MANUAL03'),(764,'4. 냄비에 다시마 육수를 넣어 끓으면 2의 완자를 넣고 불을 줄인다.','MANUAL04'),(764,'5. 완자가 떠오르면 불린 당면, 팽이버섯, 부추, 홍고추 순으로 넣는다.','MANUAL05'),(764,'6. 다진마늘, 국간장, 소금으로 간한다.','MANUAL06'),(764,'','MANUAL07'),(764,'','MANUAL08'),(764,'','MANUAL09'),(764,'','MANUAL10'),(764,'','MANUAL11'),(764,'','MANUAL12'),(764,'','MANUAL13'),(764,'','MANUAL14'),(764,'','MANUAL15'),(764,'','MANUAL16'),(764,'','MANUAL17'),(764,'','MANUAL18'),(764,'','MANUAL19'),(764,'','MANUAL20'),(765,'1. 고구마를 삶아 껍질을 제거하고 오븐에 넣어 수분을 제거한다.','MANUAL01'),(765,'2. 생강을 편으로 썰어 생크림과 섞어 생강향이 우러나도록 살짝 끓인 후 체에 거른다.','MANUAL02'),(765,'3. 볼에 1을 넣고 으깬다.','MANUAL03'),(765,'4. 3에 2를 넣고 골고루 섞어준다.','MANUAL04'),(765,'5. 버터, 꿀, 소금, 후추를 넣어 맛을 내고 원하는 모양으로 빚는다.','MANUAL05'),(765,'6. 5에 밀가루, 달걀물, 빵가루 순으로 묻혀 180℃ 기름에 튀긴다.','MANUAL06'),(765,'','MANUAL07'),(765,'','MANUAL08'),(765,'','MANUAL09'),(765,'','MANUAL10'),(765,'','MANUAL11'),(765,'','MANUAL12'),(765,'','MANUAL13'),(765,'','MANUAL14'),(765,'','MANUAL15'),(765,'','MANUAL16'),(765,'','MANUAL17'),(765,'','MANUAL18'),(765,'','MANUAL19'),(765,'','MANUAL20'),(766,'1. 냄비에 기름을 두르고 중간불로 열을 가열한다.','MANUAL01'),(766,'2. 1에 양파, 셀러리, 당근을 넣고 색이 나지 않도록 부드러워 질 때까지 볶는다.','MANUAL02'),(766,'3. 야채가 익을 때 쯤 마늘을 넣고 볶는다.','MANUAL03'),(766,'4. 3에 닭육수, 후추, 월계수잎을 넣고 끓인다.','MANUAL04'),(766,'5. 중간불로 줄이고 35분 정도 은근하게 끓인다.','MANUAL05'),(766,'6. 여기에 알파벳 파스타를 넣고 약 10분간 저어주며 끓인다.','MANUAL06'),(766,'','MANUAL07'),(766,'','MANUAL08'),(766,'','MANUAL09'),(766,'','MANUAL10'),(766,'','MANUAL11'),(766,'','MANUAL12'),(766,'','MANUAL13'),(766,'','MANUAL14'),(766,'','MANUAL15'),(766,'','MANUAL16'),(766,'','MANUAL17'),(766,'','MANUAL18'),(766,'','MANUAL19'),(766,'','MANUAL20'),(767,'1. 냄비 전체에 작은 돌을 깔고 돌이 뜨거워질 때까지 불에 올려놓는다.','MANUAL01'),(767,'2. 단호박, 고구마, 오렌지를 0.5cm 두께로 자른다.','MANUAL02'),(767,'3. 2의 표면에 소금을 살짝 뿌린다.','MANUAL03'),(767,'4. 뜨거워진 돌 위에 3을 올린다.','MANUAL04'),(767,'5. 뚜껑을 닫고 약한 불에서 속이 익을 때 까지 굽는다.','MANUAL05'),(767,'6. 소금, 된장소스, 참깨소스 등 취향에 맞는 소스를 골라 찍어 먹는다.','MANUAL06'),(767,'','MANUAL07'),(767,'','MANUAL08'),(767,'','MANUAL09'),(767,'','MANUAL10'),(767,'','MANUAL11'),(767,'','MANUAL12'),(767,'','MANUAL13'),(767,'','MANUAL14'),(767,'','MANUAL15'),(767,'','MANUAL16'),(767,'','MANUAL17'),(767,'','MANUAL18'),(767,'','MANUAL19'),(767,'','MANUAL20'),(768,'1. 당근과 감자를 2cm 주사위모양으로 자르고 버섯은 4등분한다.','MANUAL01'),(768,'2. 산마를 끓는 물에 데친다.','MANUAL02'),(768,'3. 기름을 두른 팬을 가열한 후 당근, 감자, 데친 마를 넣고 볶은 뒤 육수를 넣는다','MANUAL03'),(768,'4. 육수가 끓으면 양송이버섯과 목이버섯을 넣고 소금으로 간한다.','MANUAL04'),(768,'5. 물 전분을 넣어 농도를 맞춘다.','MANUAL05'),(768,'6. 참기름을 넣어 향을 낸다.','MANUAL06'),(768,'','MANUAL07'),(768,'','MANUAL08'),(768,'','MANUAL09'),(768,'','MANUAL10'),(768,'','MANUAL11'),(768,'','MANUAL12'),(768,'','MANUAL13'),(768,'','MANUAL14'),(768,'','MANUAL15'),(768,'','MANUAL16'),(768,'','MANUAL17'),(768,'','MANUAL18'),(768,'','MANUAL19'),(768,'','MANUAL20'),(769,'1. 밀가루와 베이킹파우더를 섞어 체에 내린다.','MANUAL01'),(769,'2. 녹인 버터에 달걀, 소금, 설탕을 넣고 1을 넣어 골고루 섞는다.','MANUAL02'),(769,'3. 당근, 양파는 0.5cm 주사위모양으로 썰어 데친다.','MANUAL03'),(769,'4. 옥수수, 완두콩을 물에 헹군다.','MANUAL04'),(769,'5. 2에 당근, 양파, 옥수수, 완두콩, 우유를 넣고 섞는다.','MANUAL05'),(769,'6. 모양 틀에 넣어 김이 오른 찜통에서 10분간 찐다.','MANUAL06'),(769,'','MANUAL07'),(769,'','MANUAL08'),(769,'','MANUAL09'),(769,'','MANUAL10'),(769,'','MANUAL11'),(769,'','MANUAL12'),(769,'','MANUAL13'),(769,'','MANUAL14'),(769,'','MANUAL15'),(769,'','MANUAL16'),(769,'','MANUAL17'),(769,'','MANUAL18'),(769,'','MANUAL19'),(769,'','MANUAL20'),(770,'1. 죽순은 빗살을 살려 썰고 밤은 껍질을 벗겨 4등분한다.','MANUAL01'),(770,'2. 찐 어묵은 얇게 썰고 표고버섯은 미지근한 물에 불려 어슷하게 4등분 한다.','MANUAL02'),(770,'3. 볼에 달걀 풀고 달걀 부피의 2.5배의 멸치 육수를 넣고 소금으로 간을 한 뒤 거품기로 잘 풀어 체에 내린다.','MANUAL03'),(770,'4. 끓는 물에 은행, 죽순, 밤, 새우 순으로 데친다.','MANUAL04'),(770,'5. 데쳐 낸 은행은 껍질을 벗기고 새우는 머리와 껍질을 제거한다.','MANUAL05'),(770,'6. 찜 용기에 준비한 속 재료들을 담고 준비한 달걀 물을 부어 찜통에서 약 12분간 찐다.','MANUAL06'),(770,'','MANUAL07'),(770,'','MANUAL08'),(770,'','MANUAL09'),(770,'','MANUAL10'),(770,'','MANUAL11'),(770,'','MANUAL12'),(770,'','MANUAL13'),(770,'','MANUAL14'),(770,'','MANUAL15'),(770,'','MANUAL16'),(770,'','MANUAL17'),(770,'','MANUAL18'),(770,'','MANUAL19'),(770,'','MANUAL20'),(771,'1. 유부는 윗면을 잘라 내고 입을 벌려서 주머니를 만든다.','MANUAL01'),(771,'2. 1을 끓는 물에 데친 뒤 냉수에 헹군다.','MANUAL02'),(771,'3. 달걀을 그릇에 풀고 다진 당근과 소금을 넣고 섞는다.','MANUAL03'),(771,'4. 2에 3을 넣어 꼬지로 주름을 잡아 끝부분을 마무리한다.','MANUAL04'),(771,'5. 냄비에 멸치 육수와 간장, 설탕, 소금을 넣는다.','MANUAL05'),(771,'6. 5에 4를 넣어 10분정도 끓인다.','MANUAL06'),(771,'','MANUAL07'),(771,'','MANUAL08'),(771,'','MANUAL09'),(771,'','MANUAL10'),(771,'','MANUAL11'),(771,'','MANUAL12'),(771,'','MANUAL13'),(771,'','MANUAL14'),(771,'','MANUAL15'),(771,'','MANUAL16'),(771,'','MANUAL17'),(771,'','MANUAL18'),(771,'','MANUAL19'),(771,'','MANUAL20'),(772,'1. 찰어묵을 2cm 두께로 썬 후 가운데 칼집을 넣는다.','MANUAL01'),(772,'2. 새우살을 입자있게 다진다.','MANUAL02'),(772,'3. 2에 양념재료를 넣고 잘 버무린다','MANUAL03'),(772,'4. 찰어묵의 칼집 사이에 전분을 묻힌다.','MANUAL04'),(772,'5. 칼집 사이에 3를 끼워 넣는다.','MANUAL05'),(772,'6. 김이 오른 찜통에 10분간 찐다.','MANUAL06'),(772,'','MANUAL07'),(772,'','MANUAL08'),(772,'','MANUAL09'),(772,'','MANUAL10'),(772,'','MANUAL11'),(772,'','MANUAL12'),(772,'','MANUAL13'),(772,'','MANUAL14'),(772,'','MANUAL15'),(772,'','MANUAL16'),(772,'','MANUAL17'),(772,'','MANUAL18'),(772,'','MANUAL19'),(772,'','MANUAL20'),(773,'1. 우엉을 깨끗이 씻어 채 썬다.','MANUAL01'),(773,'2. 양파와 당근을 채 썬다.','MANUAL02'),(773,'3. 간장과 양념들을 넣고 채 썬 우엉을 졸인다.','MANUAL03'),(773,'4. 3이 80% 정도 졸았을 대 채 썬 양파와 당근을 넣는다.','MANUAL04'),(773,'5. 거의 다 졸여지면 채 썬 유부를 넣는다.','MANUAL05'),(773,'6. 참깨를 뿌려 마무리한다.','MANUAL06'),(773,'','MANUAL07'),(773,'','MANUAL08'),(773,'','MANUAL09'),(773,'','MANUAL10'),(773,'','MANUAL11'),(773,'','MANUAL12'),(773,'','MANUAL13'),(773,'','MANUAL14'),(773,'','MANUAL15'),(773,'','MANUAL16'),(773,'','MANUAL17'),(773,'','MANUAL18'),(773,'','MANUAL19'),(773,'','MANUAL20'),(774,'1. 유자청을 잘게 다진 뒤 저염간장, 식초, 올리브유, 레몬즙을 섞어 드레싱을 만든다.','MANUAL01'),(774,'2. 두부는 2cm 크기로 깍둑썰기 한다.','MANUAL02'),(774,'3. 까망베르치즈도 깍둑썰기 한다.','MANUAL03'),(774,'4. 새싹채소는 세척 후 건져 물기를 제거한다.','MANUAL04'),(774,'5. 그릇에 새싹채소를 담고 두부, 치즈를 얹는다.','MANUAL05'),(774,'6. 드레싱과 아몬드를 뿌린다.','MANUAL06'),(774,'','MANUAL07'),(774,'','MANUAL08'),(774,'','MANUAL09'),(774,'','MANUAL10'),(774,'','MANUAL11'),(774,'','MANUAL12'),(774,'','MANUAL13'),(774,'','MANUAL14'),(774,'','MANUAL15'),(774,'','MANUAL16'),(774,'','MANUAL17'),(774,'','MANUAL18'),(774,'','MANUAL19'),(774,'','MANUAL20'),(775,'1. 돼지고기 앞다리 살에 칼집을 낸다.','MANUAL01'),(775,'2. 돼지고기에 된장, 생강가루, 다진마늘, 통후추, 월계수잎을 입혀 숙성시킨다.','MANUAL02'),(775,'3. 파와 대파는 큼지막하게 썰어 준비한다.','MANUAL03'),(775,'4. 냄비 혹은 오븐용기의 밑 부분에 양파와 대파를 놓아준다.','MANUAL04'),(775,'5. ④에 숙성시킨 돼지고기를 올려 약 50분 정도 가열하여 완전히 익혀준다.','MANUAL05'),(775,'6. 0.5cm 두께로 썰어서 제공한다.','MANUAL06'),(775,'','MANUAL07'),(775,'','MANUAL08'),(775,'','MANUAL09'),(775,'','MANUAL10'),(775,'','MANUAL11'),(775,'','MANUAL12'),(775,'','MANUAL13'),(775,'','MANUAL14'),(775,'','MANUAL15'),(775,'','MANUAL16'),(775,'','MANUAL17'),(775,'','MANUAL18'),(775,'','MANUAL19'),(775,'','MANUAL20'),(776,'1. 오이를 3등분하여 속을 파낸다.','MANUAL01'),(776,'2. 피망 및 파프리카는 U모양으로 휘어지게 썰어준다.','MANUAL02'),(776,'3. 배를 채 썰어 준다.','MANUAL03'),(776,'4. 오이 중앙에 파프리카와 배를 채워 넣는다.','MANUAL04'),(776,'5. 물, 식초, 설탕, 피클링 스파이스를 넣어 피클물을 만든다.','MANUAL05'),(776,'6. ④에 피클물을 넣고 30분 정도 숙성시킨다.','MANUAL06'),(776,'','MANUAL07'),(776,'','MANUAL08'),(776,'','MANUAL09'),(776,'','MANUAL10'),(776,'','MANUAL11'),(776,'','MANUAL12'),(776,'','MANUAL13'),(776,'','MANUAL14'),(776,'','MANUAL15'),(776,'','MANUAL16'),(776,'','MANUAL17'),(776,'','MANUAL18'),(776,'','MANUAL19'),(776,'','MANUAL20'),(777,'1. 건취나물과 건표고버섯은 뜨거운 물(200㎖)에 담가 30분간 불린다.','MANUAL01'),(777,'2. 밥솥에 불린 쌀과 곤약쌀, 불린 건취나물, 물(100㎖)을 넣어 취사 버튼을 눌러 밥을 짓는다.','MANUAL02'),(777,'3. 불린 표고버섯은 잘게 다져 중간 불로 달군 팬에 넣고 다진 돼지고기, 간장(5g), 참기름(2g)을 넣어 3분간 볶아 꺼낸다.','MANUAL03'),(777,'4. 중간 불로 달군 다른 팬에 식용유(3㎖)를 두른 뒤 달걀을 넣어 스크램블드에그를 만든다.','MANUAL04'),(777,'5. 끓는 물(300㎖)에 참나물을 넣고 1분간 데쳐 찬물에 헹군 뒤 소금(1g), 간장(2g), 참기름(1g)을 넣어 버무린다.','MANUAL05'),(777,'6. 그릇에 취나물 곤약밥을 담은 뒤 볶은 버섯과 고기, 스크램블드에그, 양념한 참나물을 얹는다.','MANUAL06'),(777,'','MANUAL07'),(777,'','MANUAL08'),(777,'','MANUAL09'),(777,'','MANUAL10'),(777,'','MANUAL11'),(777,'','MANUAL12'),(777,'','MANUAL13'),(777,'','MANUAL14'),(777,'','MANUAL15'),(777,'','MANUAL16'),(777,'','MANUAL17'),(777,'','MANUAL18'),(777,'','MANUAL19'),(777,'','MANUAL20'),(778,'1. 닭은 깨끗하게 씻어 준비하고, 양파와 대파는 4등분한다.','MANUAL01'),(778,'2. 새송이버섯은 모양대로 두툼하게 썰고, 팽이버섯은 밑동을 자른 뒤 낱낱이 가르고, 미나리는 한입 크기로 썬다.','MANUAL02'),(778,'3. 냄비에 닭을 넣고 잠길 만큼 물을 붓고, 양파, 대파, 미나리(½분량), 마늘을 넣어 센 불로 올린 뒤 닭이 익을 때까지 끓인다.','MANUAL03'),(778,'4. 닭, 양파, 미나리를 건져내 한 김 식히고, 닭은 살을 발라낸다.','MANUAL04'),(778,'5. 닭고기, 양파, 남은 미나리, 달걀, 전분을 고루 섞어 닭볼을 만든다.','MANUAL05'),(778,'6. 육수에 닭볼, 새송이버섯, 팽이버섯, 양송이버섯, 남은 미나리를 넣고, 양념으로 간한 뒤 한소끔 끓여 마무리한다.','MANUAL06'),(778,'','MANUAL07'),(778,'','MANUAL08'),(778,'','MANUAL09'),(778,'','MANUAL10'),(778,'','MANUAL11'),(778,'','MANUAL12'),(778,'','MANUAL13'),(778,'','MANUAL14'),(778,'','MANUAL15'),(778,'','MANUAL16'),(778,'','MANUAL17'),(778,'','MANUAL18'),(778,'','MANUAL19'),(778,'','MANUAL20'),(779,'1. 양상추는 채 썰고, 사과는 모양대로 얇게 썰고, 양파, 파프리카, 토마토, 할라피뇨 피클은 잘게 다진다.','MANUAL01'),(779,'2. 다진 양파, 파프리카, 토마토, 할라피뇨 피클에 나머지 살사소스 재료를 넣어 고루 섞는다.','MANUAL02'),(779,'3. 아보카도는 씨와 껍질을 제거하고, 골고루 으깬 뒤 나머지 과카몰레 재료와 고루 섞는다.','MANUAL03'),(779,'4. 갈릭요거트소스를 만든다.','MANUAL04'),(779,'5. 약한 불로 달군 마른 팬에 토르티야를 올려 1~2분간 구워 꺼내고, 맥주잔에 감아 모양을 잡는다.','MANUAL05'),(779,'6. 토르티야에 채 썬 양상추, 사과, 슈레드 모차렐라치즈를 올리고 살사소스, 과카몰레, 갈릭요거트소스를 곁들여 마무리한다.','MANUAL06'),(779,'','MANUAL07'),(779,'','MANUAL08'),(779,'','MANUAL09'),(779,'','MANUAL10'),(779,'','MANUAL11'),(779,'','MANUAL12'),(779,'','MANUAL13'),(779,'','MANUAL14'),(779,'','MANUAL15'),(779,'','MANUAL16'),(779,'','MANUAL17'),(779,'','MANUAL18'),(779,'','MANUAL19'),(779,'','MANUAL20'),(780,'1. 그릇에 다진고기, 파, 생강, 소금, 물 전분을 넣어 골고루 버무린 뒤 케첩을 넣는다.','MANUAL01'),(780,'2. 1을 한 방향으로 치댄 뒤 고기에 양념이 베도록 둔다.','MANUAL02'),(780,'3. 청경채는 1cm 정사각형 모양으로 썬다.','MANUAL03'),(780,'4. 2에 끈기가 생기도록 다시 치대준 뒤 지름 1.5cm의 완자 모양으로 빚는다.','MANUAL04'),(780,'5. 팬에 물을 넣고 끓으면 완자를 넣어 익힌다.','MANUAL05'),(780,'6. 청경채를 넣고 살짝 끓인 뒤 소금으로 간을 하고 소스가 약간 남도록 더 끓인다.','MANUAL06'),(780,'','MANUAL07'),(780,'','MANUAL08'),(780,'','MANUAL09'),(780,'','MANUAL10'),(780,'','MANUAL11'),(780,'','MANUAL12'),(780,'','MANUAL13'),(780,'','MANUAL14'),(780,'','MANUAL15'),(780,'','MANUAL16'),(780,'','MANUAL17'),(780,'','MANUAL18'),(780,'','MANUAL19'),(780,'','MANUAL20'),(781,'1. 홍시는 껍질을 제거하여 으깬다.','MANUAL01'),(781,'2. 바나나는 체에 내린다.','MANUAL02'),(781,'3. 1과 2를 잘 섞어준다.','MANUAL03'),(781,'4. 생밤은 납작납작하게 썬다.','MANUAL04'),(781,'5. 대추는 돌려 깎아 씨를 제거하고 채 썬다.','MANUAL05'),(781,'6. 3과 4, 5를 잘 무쳐 그릇에 담는다.','MANUAL06'),(781,'','MANUAL07'),(781,'','MANUAL08'),(781,'','MANUAL09'),(781,'','MANUAL10'),(781,'','MANUAL11'),(781,'','MANUAL12'),(781,'','MANUAL13'),(781,'','MANUAL14'),(781,'','MANUAL15'),(781,'','MANUAL16'),(781,'','MANUAL17'),(781,'','MANUAL18'),(781,'','MANUAL19'),(781,'','MANUAL20'),(782,'1. 고구마를 찜통에 찐다.','MANUAL01'),(782,'2. 고구마의 껍질을 벗기고 체에 곱게 내린다.','MANUAL02'),(782,'3. 카스텔라는 윗면의 갈색 부분을 잘라내고 믹서에 곱게 갈아 가루로 만든다.','MANUAL03'),(782,'4. 2에 우유와 버터, 꿀, 소금을 넣고 섞어 반죽한다.','MANUAL04'),(782,'5. 3의 반죽 속에 건포도를 1~2개 넣고 경단을 만든다.','MANUAL05'),(782,'6. 경단에 카스텔라 가루를 묻힌다.','MANUAL06'),(782,'','MANUAL07'),(782,'','MANUAL08'),(782,'','MANUAL09'),(782,'','MANUAL10'),(782,'','MANUAL11'),(782,'','MANUAL12'),(782,'','MANUAL13'),(782,'','MANUAL14'),(782,'','MANUAL15'),(782,'','MANUAL16'),(782,'','MANUAL17'),(782,'','MANUAL18'),(782,'','MANUAL19'),(782,'','MANUAL20'),(783,'1. 두부는 면보를 이용해 물기를 꼭 짠 후 곱게 으깬다.','MANUAL01'),(783,'2. 밀가루와 베이킹파우더를 섞어 체에 내린다.','MANUAL02'),(783,'3. 으깬 두부를 볼에 담고 설탕, 달걀, 검은깨를 넣고 거품기로 잘 저어준다.','MANUAL03'),(783,'4. 3에 채 썬 깻잎을 넣은 뒤 2의 밀가루를 넣어 반죽한다.','MANUAL04'),(783,'5. 도마에 밀가루를 살짝 뿌리고 4를 밀대로 2mm 두께로 민 뒤 너비 1cm, 길이 4cm의 직사각형으로 자른다.','MANUAL05'),(783,'6. 자른 반죽을 오븐팬에 올려 180℃로 예열된 오븐에 10분간 굽는다.','MANUAL06'),(783,'','MANUAL07'),(783,'','MANUAL08'),(783,'','MANUAL09'),(783,'','MANUAL10'),(783,'','MANUAL11'),(783,'','MANUAL12'),(783,'','MANUAL13'),(783,'','MANUAL14'),(783,'','MANUAL15'),(783,'','MANUAL16'),(783,'','MANUAL17'),(783,'','MANUAL18'),(783,'','MANUAL19'),(783,'','MANUAL20'),(784,'1. 치자를 따뜻한 물에 담궈 색을 우려내고, 백련초가루는 물에 푼다.','MANUAL01'),(784,'2. 두부는 면보에 물기를 짠 뒤 칼로 으깬다.','MANUAL02'),(784,'3. 두 개의 냄비에 한천을 필요량 만큼 넣고 1을 각각 넣고 30분 정도 불린다.','MANUAL03'),(784,'4. 3에 으깬 두부를 반씩 나누어 넣고 설탕을 넣은 뒤 골고루 섞는다.','MANUAL04'),(784,'5. 4를 모양 틀에 넣고 냉장고에서 굳힌다.','MANUAL05'),(784,'6. 양갱이 굳으면 틀 째 미지근한 물에 담궈 뒤집어 뺸다.','MANUAL06'),(784,'','MANUAL07'),(784,'','MANUAL08'),(784,'','MANUAL09'),(784,'','MANUAL10'),(784,'','MANUAL11'),(784,'','MANUAL12'),(784,'','MANUAL13'),(784,'','MANUAL14'),(784,'','MANUAL15'),(784,'','MANUAL16'),(784,'','MANUAL17'),(784,'','MANUAL18'),(784,'','MANUAL19'),(784,'','MANUAL20'),(785,'1. 잔멸치는 잡티를 제거하고 기름을 두르지 않은 팬에서 살짝 볶는다.','MANUAL01'),(785,'2. 고슬고슬하게 지은 밥에 1과 통깨, 설탕을 넣고 골고루 섞는다.','MANUAL02'),(785,'3. 사각 틀에 2를 넣고 랩을 씌워 밀대로 평평하게 민다.','MANUAL03'),(785,'4. 3을 바람이 잘 통하는 곳에서 건조 시킨다.','MANUAL04'),(785,'5. 175℃로 예열된 오븐에 4를 넣고 밥이 바삭해질 때 까지 굽는다.','MANUAL05'),(785,'6. 먹기 좋은 크기로 부숴 접시에 담고 설탕을 뿌린다.','MANUAL06'),(785,'','MANUAL07'),(785,'','MANUAL08'),(785,'','MANUAL09'),(785,'','MANUAL10'),(785,'','MANUAL11'),(785,'','MANUAL12'),(785,'','MANUAL13'),(785,'','MANUAL14'),(785,'','MANUAL15'),(785,'','MANUAL16'),(785,'','MANUAL17'),(785,'','MANUAL18'),(785,'','MANUAL19'),(785,'','MANUAL20'),(786,'1. 오미자에 7배의 물에 8시간 담궈 맛과 색이 우러나도록 한다.','MANUAL01'),(786,'2. 천도복숭아는 사방 0.5cm의 주사위모양으로 썰어 설탕을 뿌려 30분 정도 절인다.','MANUAL02'),(786,'3. 배를 모양 틀로 찍어 0.3cm 두께로 썰어 설탕에 절인다.','MANUAL03'),(786,'4. 오미자 국물을 면보에 거르고 시럽으로 단맛을 맞춘다.','MANUAL04'),(786,'5. 4에 복숭아와 배를 넣는다.','MANUAL05'),(786,'6. 5에 잣과 얼음을 띄운다.','MANUAL06'),(786,'','MANUAL07'),(786,'','MANUAL08'),(786,'','MANUAL09'),(786,'','MANUAL10'),(786,'','MANUAL11'),(786,'','MANUAL12'),(786,'','MANUAL13'),(786,'','MANUAL14'),(786,'','MANUAL15'),(786,'','MANUAL16'),(786,'','MANUAL17'),(786,'','MANUAL18'),(786,'','MANUAL19'),(786,'','MANUAL20'),(787,'1. 사과씨를 통째로 제거한다.','MANUAL01'),(787,'2. 1을 2cm 두께로 썬다.','MANUAL02'),(787,'3. 냄비에 사과와 포도주스를 넣고 중불에서 서서히 졸인다.','MANUAL03'),(787,'4. 졸여진 사과를 냉장고에 넣어 시원하게 한다.','MANUAL04'),(787,'5. 접시에 사과를 담고 계피가루를 뿌린다.','MANUAL05'),(787,'6. 5에 아이스크림을 떠서 위에 얹는다.','MANUAL06'),(787,'','MANUAL07'),(787,'','MANUAL08'),(787,'','MANUAL09'),(787,'','MANUAL10'),(787,'','MANUAL11'),(787,'','MANUAL12'),(787,'','MANUAL13'),(787,'','MANUAL14'),(787,'','MANUAL15'),(787,'','MANUAL16'),(787,'','MANUAL17'),(787,'','MANUAL18'),(787,'','MANUAL19'),(787,'','MANUAL20'),(788,'1. 냉동 홍시의 껍질을 벗기고 씨를 뺀다.','MANUAL01'),(788,'2. 1을 잘게 자른다.','MANUAL02'),(788,'3. 오미자를 7배의 물에 8시간 이상 우려 맛과 색이 우러나오도록 한다.','MANUAL03'),(788,'4. 믹서에 홍시, 오미자물, 꿀, 레몬즙을 넣어 함께 갈아준다.','MANUAL04'),(788,'5. 4를 컵에 담는다.','MANUAL05'),(788,'6. 민트로 장식한다.','MANUAL06'),(788,'','MANUAL07'),(788,'','MANUAL08'),(788,'','MANUAL09'),(788,'','MANUAL10'),(788,'','MANUAL11'),(788,'','MANUAL12'),(788,'','MANUAL13'),(788,'','MANUAL14'),(788,'','MANUAL15'),(788,'','MANUAL16'),(788,'','MANUAL17'),(788,'','MANUAL18'),(788,'','MANUAL19'),(788,'','MANUAL20'),(789,'1. 메밀가루, 밀가루, 찹쌀가루에 소금을 넣어 체에 내린 뒤 끓는 물을 넣어 익반죽한다.','MANUAL01'),(789,'2. 김치는 송송 썰고 오징어는 껍질을 벗겨 굵게 다진다.','MANUAL02'),(789,'3. 가열된 팬에 기름을 두르고 김치를 볶은 다음 오징어를 넣고 볶아 식힌다.','MANUAL03'),(789,'4. 반죽을 떼어 10cm 둥근 모양으로 빚은 다음 가운데에 3을 넣고 반달모양으로 접어 모양을 만든다.','MANUAL04'),(789,'5. 김이 오른 찜통에 면보를 깔고 14분간 찐 다음 5분 정도 뜸을 들인다.','MANUAL05'),(789,'6. 한 김 식힌 뒤 접시에 담아낸다.','MANUAL06'),(789,'','MANUAL07'),(789,'','MANUAL08'),(789,'','MANUAL09'),(789,'','MANUAL10'),(789,'','MANUAL11'),(789,'','MANUAL12'),(789,'','MANUAL13'),(789,'','MANUAL14'),(789,'','MANUAL15'),(789,'','MANUAL16'),(789,'','MANUAL17'),(789,'','MANUAL18'),(789,'','MANUAL19'),(789,'','MANUAL20'),(790,'1. 잡곡밥에 소량의 물을 넣고 밥알을 풀어준다.','MANUAL01'),(790,'2. 기름을 두르지 않은 팬에 1을 0.4cm두께로 노릇하게 양면을 굽는다.','MANUAL02'),(790,'3. 양파와 청, 홍피망, 햄은 적당한 크기로 썰고 캔 옥수수는 물기를 뺀다.','MANUAL03'),(790,'4. 냄비에 식용유를 두르고 다진 마늘과 다진 양파, 다진 소고기를 넣고 볶은 뒤 토마토 케첩과 물을 약간 넣어 졸이면서 설탕, 간장, 후춧가루로 간한다.','MANUAL04'),(790,'5. 누룽지에 4를 골고루 펴 바르고 그 위에 토핑 재료, 피자치즈, 송송 썬 실파를 뿌린다.','MANUAL05'),(790,'6. 5번을 예열된 오븐에 굽는다.','MANUAL06'),(790,'','MANUAL07'),(790,'','MANUAL08'),(790,'','MANUAL09'),(790,'','MANUAL10'),(790,'','MANUAL11'),(790,'','MANUAL12'),(790,'','MANUAL13'),(790,'','MANUAL14'),(790,'','MANUAL15'),(790,'','MANUAL16'),(790,'','MANUAL17'),(790,'','MANUAL18'),(790,'','MANUAL19'),(790,'','MANUAL20'),(791,'1. 단호박은 표면을 깨끗하게 씻어 물기를 제거하고 꼭지 부분의 윗면을 자르고 수저로 속을 파낸 후 소금을 뿌려 놓는다.','MANUAL01'),(791,'2. 새우살은 다지고 두부는 면보로 싸서 물기를 제거하고 곱게 으깨고 불린 건표고버섯과 청, 홍피망은 곱게 다지고 실파는 송송 썬다.','MANUAL02'),(791,'3. 2의 재료를 한 데 섞고 소금, 다진 마늘, 깨소금, 참기름, 흰 후춧가루를 넣고 양념하여 소를 만든다.','MANUAL03'),(791,'4. 1의 내부에 수분을 제거한다.','MANUAL04'),(791,'5. 4의 안쪽에 밀가루를 살짝 뿌리고 밀가루가 골고루 잘 묻도록 한다.','MANUAL05'),(791,'6. 준비된 소를 채운 후 잘라둔 꼭지 부분의 뚜껑을 덮어 김 오른 찜통에 20분가량 찐 뒤 4~6등분 하여 낸다.','MANUAL06'),(791,'','MANUAL07'),(791,'','MANUAL08'),(791,'','MANUAL09'),(791,'','MANUAL10'),(791,'','MANUAL11'),(791,'','MANUAL12'),(791,'','MANUAL13'),(791,'','MANUAL14'),(791,'','MANUAL15'),(791,'','MANUAL16'),(791,'','MANUAL17'),(791,'','MANUAL18'),(791,'','MANUAL19'),(791,'','MANUAL20'),(792,'1. 두부는 3cm 주사위모양으로 썰고 소금을 뿌려 간을 한다.','MANUAL01'),(792,'2. 과일은 5mm 주사위모양으로 썬 뒤 꿀을 넣고 버무린다.','MANUAL02'),(792,'3. 기름을 두른 팬에 1을 넣고 5면을 노릇하게 지진 뒤 종이타월로 기름기를 제거한다.','MANUAL03'),(792,'4. 3의 지지지 않은 한 쪽 면을 숟가락을 이용해 뚫리지 않게 조심스럼게 파낸다.','MANUAL04'),(792,'5. 속을 파낸 두부에 2를 채워 넣는다.','MANUAL05'),(792,'6. 민트로 장식한다','MANUAL06'),(792,'','MANUAL07'),(792,'','MANUAL08'),(792,'','MANUAL09'),(792,'','MANUAL10'),(792,'','MANUAL11'),(792,'','MANUAL12'),(792,'','MANUAL13'),(792,'','MANUAL14'),(792,'','MANUAL15'),(792,'','MANUAL16'),(792,'','MANUAL17'),(792,'','MANUAL18'),(792,'','MANUAL19'),(792,'','MANUAL20'),(793,'1. 새우는 끓는 물에 대친 뒤 찬물에 담궈 식히고 껍질을 벗긴다.','MANUAL01'),(793,'2. 홍피망은 얇게 채 썰고 팽이버섯은 밑동을 잘라 준비하고 숙주는 거두절미하여 끓는 물에 데친 뒤 찬물에 식혀서 물기를 빼고 상추는 채 썬다.','MANUAL02'),(793,'3. 쌀국수를 물에 불렸다가 끓는 물에 데친 뒤 찬물에 식혀 물기를 제거한다.','MANUAL03'),(793,'4. 따뜻한 물에 라이스페이퍼를 담궜다가 꺼내 면보 위에 놓고 물기를 살짝 제거하고 1, 2, 3을 올리고 조심스럽게 말아준다.','MANUAL04'),(793,'5. 마늘은 다지고 양파, 홍고추, 청고추는 0.3mm로 잘게 썬다.','MANUAL05'),(793,'6. 팬에 고추기름을 두르고 다진 마늘을 볶다가 양파를 넣고 청, 홍고추를 넣어 살짝 볶은 뒤 물, 식초, 설탕을 넣고 물전분으로 농도를 맞춘다.','MANUAL06'),(793,'','MANUAL07'),(793,'','MANUAL08'),(793,'','MANUAL09'),(793,'','MANUAL10'),(793,'','MANUAL11'),(793,'','MANUAL12'),(793,'','MANUAL13'),(793,'','MANUAL14'),(793,'','MANUAL15'),(793,'','MANUAL16'),(793,'','MANUAL17'),(793,'','MANUAL18'),(793,'','MANUAL19'),(793,'','MANUAL20'),(794,'1. 도미에는 소금과 후추로 밑간을 하고 마늘, 파슬리는 다진다.','MANUAL01'),(794,'2. 버터를 두른 팬에 다진 마늘을 넣고 마늘 향을 낸 버터물을 만든다.','MANUAL02'),(794,'3. 2에 빵가루를 섞어 믹싱볼로 옮겨 담는다.','MANUAL03'),(794,'4. 3에 다진 파슬리, 레몬주스, 레몬제스트, 소금, 후추를 넣고 고무주걱으로 잘 섞는다.','MANUAL04'),(794,'5. 도미를 양념하고 도미위에 4을 얹는다.','MANUAL05'),(794,'6. 5를 오븐에 굽는다.','MANUAL06'),(794,'','MANUAL07'),(794,'','MANUAL08'),(794,'','MANUAL09'),(794,'','MANUAL10'),(794,'','MANUAL11'),(794,'','MANUAL12'),(794,'','MANUAL13'),(794,'','MANUAL14'),(794,'','MANUAL15'),(794,'','MANUAL16'),(794,'','MANUAL17'),(794,'','MANUAL18'),(794,'','MANUAL19'),(794,'','MANUAL20'),(795,'1. 볼에 밀가루를 담고 가운데에 웅덩이를 만들어 따뜻한 물과 이스트를 넣어 녹인 후 소금을 넣고 밀가루를 조금씩 섞으며 반죽을 한다.','MANUAL01'),(795,'2. 반죽이 하나로 뭉쳐지면 랩으로 싸서 따뜻한 곳에서 30분 정도 발효시킨다.','MANUAL02'),(795,'3. 발효된 반죽을 밀대를 이용하여 넓게 편다.','MANUAL03'),(795,'4. 청, 홍피망은 꼭지부분을 썰어내고 링 모양으로 썰어 심지를 제거하고 베이컨, 양파, 양송이는 슬라이스 한다.','MANUAL04'),(795,'5. 3을 오븐용 팬에 옮긴 뒤 토마토소스를 바르고 준비된 재료들과 피자치즈를 올린다.','MANUAL05'),(795,'6. 반죽을 말아서 윗부분에 칼집을 넣은 뒤 175℃로 예열된 오븐에 굽는다.','MANUAL06'),(795,'','MANUAL07'),(795,'','MANUAL08'),(795,'','MANUAL09'),(795,'','MANUAL10'),(795,'','MANUAL11'),(795,'','MANUAL12'),(795,'','MANUAL13'),(795,'','MANUAL14'),(795,'','MANUAL15'),(795,'','MANUAL16'),(795,'','MANUAL17'),(795,'','MANUAL18'),(795,'','MANUAL19'),(795,'','MANUAL20'),(796,'1. 닭정육과 닭뼈를 깨끗이 씻어 물, 마늘, 대파, 다시마를 넣고 육수를 끓인다.','MANUAL01'),(796,'2. 닭 정육이 익으면 건져 잘게 찢는다.','MANUAL02'),(796,'3. 무는 나박썰기하고 대파와 홍고추, 청양고추는 어슷썰기 하고 양파와 마늘은 다진다.','MANUAL03'),(796,'4. 육수가 우러나면 체에 육수를 걸러낸다.','MANUAL04'),(796,'5. 냄비에 마늘을 볶다가 닭고기를 넣고 함께 볶은 뒤 육수와 손질한 채소를 넣어 푹 끓인다.','MANUAL05'),(796,'6. 후추로 간을 해 마무리한다.','MANUAL06'),(796,'','MANUAL07'),(796,'','MANUAL08'),(796,'','MANUAL09'),(796,'','MANUAL10'),(796,'','MANUAL11'),(796,'','MANUAL12'),(796,'','MANUAL13'),(796,'','MANUAL14'),(796,'','MANUAL15'),(796,'','MANUAL16'),(796,'','MANUAL17'),(796,'','MANUAL18'),(796,'','MANUAL19'),(796,'','MANUAL20'),(797,'1. 돈등심은 널찍하게 성형한다.','MANUAL01'),(797,'2. 새송이 버섯은 길게 채썰고, 미나리도 비슷한 사이즈로 썰어 준다.','MANUAL02'),(797,'3. 고기에 미나리, 새송이를 감싸 말아 찹쌀가루를 묻혀 굽는다.','MANUAL03'),(797,'4. 참나물, 취나물, 올리브오일, 땅콩, 마늘, 후추를 믹서에 갈아 소스를 만든다.','MANUAL04'),(797,'5. 소스에 파마산 치즈를 섞어준다.','MANUAL05'),(797,'6. 구워진 고기에 소스를 곁들여 낸다.','MANUAL06'),(797,'','MANUAL07'),(797,'','MANUAL08'),(797,'','MANUAL09'),(797,'','MANUAL10'),(797,'','MANUAL11'),(797,'','MANUAL12'),(797,'','MANUAL13'),(797,'','MANUAL14'),(797,'','MANUAL15'),(797,'','MANUAL16'),(797,'','MANUAL17'),(797,'','MANUAL18'),(797,'','MANUAL19'),(797,'','MANUAL20'),(798,'1. 오이는 굵은 소금으로 문질러 깨끗이 씻는다.','MANUAL01'),(798,'2. 오이를 적당한 두께로 썰고 4등분 한다.','MANUAL02'),(798,'3. 파프리카는 깨끗이 씻은 후 씨를 제거한다.','MANUAL03'),(798,'4. 파프리카를 적당한 크기로 썬다.','MANUAL04'),(798,'5. 식초, 설탕, 물을 섞어 단촛물을 만든다.','MANUAL05'),(798,'6. 단촛물에 오이, 파프리카를 버무린다.','MANUAL06'),(798,'','MANUAL07'),(798,'','MANUAL08'),(798,'','MANUAL09'),(798,'','MANUAL10'),(798,'','MANUAL11'),(798,'','MANUAL12'),(798,'','MANUAL13'),(798,'','MANUAL14'),(798,'','MANUAL15'),(798,'','MANUAL16'),(798,'','MANUAL17'),(798,'','MANUAL18'),(798,'','MANUAL19'),(798,'','MANUAL20'),(799,'1. 양상추는 깨끗이 씻어 먹기 좋은 크기로 썬다.','MANUAL01'),(799,'2. 당근과 적양배추는 곱게 채 썰고, 치커리는 잘게 썬다.','MANUAL02'),(799,'3. 사과는 껍질과 심을 제거한 뒤 한입 크기로 썬다.','MANUAL03'),(799,'4. 파인애플은 껍질과 심을 제거한 뒤 한입 크기로 썬다.','MANUAL04'),(799,'5. 손질한 과일과 레몬즙을 믹서에 넣어 곱게 갈아 드레싱을 만든다.','MANUAL05'),(799,'6. 양상추와 당근, 적양배추를 접시에 깔고 드레싱을 곁들여 마무리한다.','MANUAL06'),(799,'','MANUAL07'),(799,'','MANUAL08'),(799,'','MANUAL09'),(799,'','MANUAL10'),(799,'','MANUAL11'),(799,'','MANUAL12'),(799,'','MANUAL13'),(799,'','MANUAL14'),(799,'','MANUAL15'),(799,'','MANUAL16'),(799,'','MANUAL17'),(799,'','MANUAL18'),(799,'','MANUAL19'),(799,'','MANUAL20'),(800,'1. 파, 마늘은 다진다.','MANUAL01'),(800,'2. 냄비에 물과 소금을 넣고 끓인다.','MANUAL02'),(800,'3. 세척한 시금치를 데친다.','MANUAL03'),(800,'4. 데친 시금치는 찬물에 헹구어 물기를 짠 다음 먹기 좋게 썬다.','MANUAL04'),(800,'5. 시금치에 들깨가루, 파, 마늘, 통깨, 들기름을 넣고 무친다.','MANUAL05'),(800,'6. 접시에 담아서 완성한다.','MANUAL06'),(800,'','MANUAL07'),(800,'','MANUAL08'),(800,'','MANUAL09'),(800,'','MANUAL10'),(800,'','MANUAL11'),(800,'','MANUAL12'),(800,'','MANUAL13'),(800,'','MANUAL14'),(800,'','MANUAL15'),(800,'','MANUAL16'),(800,'','MANUAL17'),(800,'','MANUAL18'),(800,'','MANUAL19'),(800,'','MANUAL20'),(801,'1. 가지와 오이는 세로로 얇게 썬다.','MANUAL01'),(801,'2. 얇게 썬 오이는 소금(0.2ts)에 10분간 절인 뒤 물기를 꼭 짠다.','MANUAL02'),(801,'3. 얇게 썬 가지는 약한 불로 달군 마른 팬에 올려 앞뒤로 노릇하게 구워 꺼낸다.','MANUAL03'),(801,'4. 밥에 남은 양념을 넣어 고루 섞는다.','MANUAL04'),(801,'5. 소금에 절인 오이와 구운 가지 위에 밥을 한입 크기로 뭉쳐 올린다.','MANUAL05'),(801,'6. 돌돌 말아 그릇에 담아 마무리한다.','MANUAL06'),(801,'','MANUAL07'),(801,'','MANUAL08'),(801,'','MANUAL09'),(801,'','MANUAL10'),(801,'','MANUAL11'),(801,'','MANUAL12'),(801,'','MANUAL13'),(801,'','MANUAL14'),(801,'','MANUAL15'),(801,'','MANUAL16'),(801,'','MANUAL17'),(801,'','MANUAL18'),(801,'','MANUAL19'),(801,'','MANUAL20'),(802,'1. 소고기는 곱게 다진다.','MANUAL01'),(802,'2. 다진 소고기에 떡갈비 양념을 넣고 골고루 치대 양념한다.','MANUAL02'),(802,'3. 새송이버섯은 폭 1.5cm, 길이 6cm로 썰어 밀가루를 묻힌다.','MANUAL03'),(802,'4. 3에 2를 버섯 위, 아래로 1cm를 남기고 감싸듯이 부쳐 떡갈비를 만든다.','MANUAL04'),(802,'5. 팬에 앞뒤로 타지 않도록 굽는다.','MANUAL05'),(802,'6. 잣가루를 뿌린다.','MANUAL06'),(802,'','MANUAL07'),(802,'','MANUAL08'),(802,'','MANUAL09'),(802,'','MANUAL10'),(802,'','MANUAL11'),(802,'','MANUAL12'),(802,'','MANUAL13'),(802,'','MANUAL14'),(802,'','MANUAL15'),(802,'','MANUAL16'),(802,'','MANUAL17'),(802,'','MANUAL18'),(802,'','MANUAL19'),(802,'','MANUAL20'),(803,'1. 배추는 잎을 떼서 크게 썬 다음 3cm 길이로 결대로 찢는다.','MANUAL01'),(803,'2. 기름을 넣어 가열 된 팬에 배추를 넣고 살짝 볶아 낸 후 수분을 제거한다.','MANUAL02'),(803,'3. 달걀을 풀어 팬에 익힌다.','MANUAL03'),(803,'4. 채 썬 돼지고기를 팬에 볶고 파, 다진 생강, 간장을 넣고 다시 볶는다.','MANUAL04'),(803,'5. 4에 목이버섯, 배추, 달걀을 넣고 잘 섞는다.','MANUAL05'),(803,'6. 5에 육수, 소금, 물전분을 넣는다.','MANUAL06'),(803,'','MANUAL07'),(803,'','MANUAL08'),(803,'','MANUAL09'),(803,'','MANUAL10'),(803,'','MANUAL11'),(803,'','MANUAL12'),(803,'','MANUAL13'),(803,'','MANUAL14'),(803,'','MANUAL15'),(803,'','MANUAL16'),(803,'','MANUAL17'),(803,'','MANUAL18'),(803,'','MANUAL19'),(803,'','MANUAL20'),(804,'1. 돼지등심은 4cm 정도 두께로 썬다.','MANUAL01'),(804,'2. 볼에 건오레가노, 건바질, 소금, 통후추 간 것을 섞어 허브 믹스를 만들어 1에 골고루 묻힌다.','MANUAL02'),(804,'3. 팬을 가열하여 올리브오일을 두르고 등심의 양면이 갈색이 되게 구운 뒤 알루미늄 호일에 싸서 오븐에서 완전히 익힌다.','MANUAL03'),(804,'4. 양파는 슬라이스하고, 사과는 껍질과 씨를 제거한 후 얇게 슬라이스 한다.','MANUAL04'),(804,'5.  또 다른 팬에 기름을 두르고 고기가 완전히 익을 동안 양파와 사과를 옅은 갈색이 나도록 볶아준다.','MANUAL05'),(804,'6. 고기가 다 익었으면 꺼내서 적당한 두께로 썰고 볶은 양파와 사과를 곁들인다.','MANUAL06'),(804,'','MANUAL07'),(804,'','MANUAL08'),(804,'','MANUAL09'),(804,'','MANUAL10'),(804,'','MANUAL11'),(804,'','MANUAL12'),(804,'','MANUAL13'),(804,'','MANUAL14'),(804,'','MANUAL15'),(804,'','MANUAL16'),(804,'','MANUAL17'),(804,'','MANUAL18'),(804,'','MANUAL19'),(804,'','MANUAL20'),(805,'1. 새우는 잘게 다지고 흰자, 소금, 후추와 함께 섞어서 간이 배도록 한다.','MANUAL01'),(805,'2. 다진 물밤과 실파를 1과 섞어준 뒤 종이타월을 이용해서 물기를 제거한 리치의 속의 채운다.','MANUAL02'),(805,'3. 속이 채워진 리치에 전분을 묻혀 기름에 튀긴다.','MANUAL03'),(805,'4. 가열된 팬에 올리브오일을 두르고 양파, 마늘, 생강 다진 것을 살짝 볶는다.','MANUAL04'),(805,'5. 4에 물, 고추기름, 설탕, 소금, 후춧가루를 넣고 간을 한 뒤 물전분으로 농도를 맞춘다.','MANUAL05'),(805,'6. 감자는 껍질을 벗겨 채칼로 얇게 슬라이스 한 뒤 물에 담궈 전분을 빼고 튀겨 접시에 깔고 3, 4를 담는다.','MANUAL06'),(805,'','MANUAL07'),(805,'','MANUAL08'),(805,'','MANUAL09'),(805,'','MANUAL10'),(805,'','MANUAL11'),(805,'','MANUAL12'),(805,'','MANUAL13'),(805,'','MANUAL14'),(805,'','MANUAL15'),(805,'','MANUAL16'),(805,'','MANUAL17'),(805,'','MANUAL18'),(805,'','MANUAL19'),(805,'','MANUAL20'),(806,'1. 찹쌀을 깨끗이 씻어 40분 가량 치차 물에 불린 뒤 물기를 빼고 소금을 약간 넣어 버무리고 마른 면보로 옮겨 수분을 빼면서 반 정도 으깬다.','MANUAL01'),(806,'2. 시금치는 소금물에 데쳐 냉수에 헹군 뒤 물기를 짜서 다지고 당근도 잘게 다진다.','MANUAL02'),(806,'3. 흰 살 생선은 면보로 물기를 꼭 짠 다음 곱게 다지고 끈기가 생기도록 치대면서 생강즙, 소금, 후춧가루를 넣는다.','MANUAL03'),(806,'4. 3에 달걀 흰자, 전분을 첨가하여 계속 치대 끈기가 생기도록 한 뒤 다져놓은 시금치와 당근을 넣어 섞는다.','MANUAL04'),(806,'5. 4를 조금씩 떼어 생선 완자를 만든 뒤 1을 묻힌다.','MANUAL05'),(806,'6. 찜통에 젖은 면보를 깔고 생선 완자가 서로 붙지 않도록 놓고 20분 정도 찐다.','MANUAL06'),(806,'','MANUAL07'),(806,'','MANUAL08'),(806,'','MANUAL09'),(806,'','MANUAL10'),(806,'','MANUAL11'),(806,'','MANUAL12'),(806,'','MANUAL13'),(806,'','MANUAL14'),(806,'','MANUAL15'),(806,'','MANUAL16'),(806,'','MANUAL17'),(806,'','MANUAL18'),(806,'','MANUAL19'),(806,'','MANUAL20'),(807,'1. 아몬드는 기름 두르지 않은 팬에 옅은 갈색이 나도록 볶는다.','MANUAL01'),(807,'2. 사과는 껍질을 제거하고 주사위모양으로 썬다.','MANUAL02'),(807,'3. 바나나와 키위는 껍질을 제거하고 사과와 같은 크기로 썬다.','MANUAL03'),(807,'4. 볼에 꿀, 플레인 요거트, 우유를 넣고 잘 섞는다.','MANUAL04'),(807,'5. 깨끗한 볼에 오트밀을 담고 4를 넣어 잘 섞어준다.','MANUAL05'),(807,'6. 5에 준비된 과일과 아몬드, 건포도를 올리고 기호에 따라 계피가루를 뿌린다.','MANUAL06'),(807,'','MANUAL07'),(807,'','MANUAL08'),(807,'','MANUAL09'),(807,'','MANUAL10'),(807,'','MANUAL11'),(807,'','MANUAL12'),(807,'','MANUAL13'),(807,'','MANUAL14'),(807,'','MANUAL15'),(807,'','MANUAL16'),(807,'','MANUAL17'),(807,'','MANUAL18'),(807,'','MANUAL19'),(807,'','MANUAL20'),(808,'1. 양파, 할라피뇨는 잘게 다지고 토마토는 끓는 물에 데쳐 껍질과 씨를 제거하고 잘게 썰어 볶다가 간 소고기를 넣고 소금, 후추로 간한다.','MANUAL01'),(808,'2. 베이컨, 마늘, 양파는 잘게 썰고 강낭콩은 체에 받쳐 물기를 제거한다.','MANUAL02'),(808,'3. 팬에 베이컨을 볶아 기름을 제거하고 2의 마늘, 양파를 볶다가 강낭콩을 넣고 건바질 조금, 소금, 후추로 간을 한 뒤 믹서에 갈아 퓨레로 만든다.','MANUAL03'),(808,'4. 배, 오렌지를 1cm 주사위모양으로 썰고 레몬주스, 파프리카 가루와 섞어 살사를 만든다.','MANUAL04'),(808,'5. 기름 없는 팬에 또띠아를 살짝 구운 뒤 강낭콩 퓨레를 얇게 바르고 볶은 소기기, 채 썬 양상추, 아보카도, 베이컨, 토마토, 사워크림을 넣고 만다.','MANUAL05'),(808,'6. 5에 배, 오렌지 살사를 곁들인다.','MANUAL06'),(808,'','MANUAL07'),(808,'','MANUAL08'),(808,'','MANUAL09'),(808,'','MANUAL10'),(808,'','MANUAL11'),(808,'','MANUAL12'),(808,'','MANUAL13'),(808,'','MANUAL14'),(808,'','MANUAL15'),(808,'','MANUAL16'),(808,'','MANUAL17'),(808,'','MANUAL18'),(808,'','MANUAL19'),(808,'','MANUAL20'),(809,'1. 달걀을 완숙으로 삶아 찬물에 담궈 식혀 껍질을 벗긴 뒤 볼에 넣어 포크로 거칠게 으깬다.','MANUAL01'),(809,'2. 으깬 달걀에 머스타드, 레몬주스, 소금, 후춧가루, 마요네즈를 섞는다.','MANUAL02'),(809,'3. 아보카도는 껍질을 제거하고 얇게 슬라이스 한다.','MANUAL03'),(809,'4. 식빵은 노릇하게 양면을 굽는다.','MANUAL04'),(809,'5. 4에 아보카도를 얹고 그 위에 달걀 샐러드를 얹어 식빵으로 덮는다.','MANUAL05'),(809,'6. 샌드위치의 가장자리 부분은 잘라내고 원하는 적당한 크기로 자른다.','MANUAL06'),(809,'','MANUAL07'),(809,'','MANUAL08'),(809,'','MANUAL09'),(809,'','MANUAL10'),(809,'','MANUAL11'),(809,'','MANUAL12'),(809,'','MANUAL13'),(809,'','MANUAL14'),(809,'','MANUAL15'),(809,'','MANUAL16'),(809,'','MANUAL17'),(809,'','MANUAL18'),(809,'','MANUAL19'),(809,'','MANUAL20'),(810,'1. 시금치와 당근은 각각 믹서에 물을 넣고 간다.','MANUAL01'),(810,'2. 밀가루는 반으로 나눠 시금치 즙과 당근 즙을 넣고 소금을 넣어 각각 반죽 한다.','MANUAL02'),(810,'3. 2의 반죽을 직경 1.5cm 정도의 동그란 경단모양으로 빚는다.','MANUAL03'),(810,'4. 감자와 애호박은 1.5cm 주사위모양으로 자르고 실파는 2cm 길이로 썬다.','MANUAL04'),(810,'5. 멸치 육수에 감자, 수제비 경단, 애호박, 다진마늘, 실파 순서로 넣고 끓인다.','MANUAL05'),(810,'6. 5에 간장과 소금으로 간한다.','MANUAL06'),(810,'','MANUAL07'),(810,'','MANUAL08'),(810,'','MANUAL09'),(810,'','MANUAL10'),(810,'','MANUAL11'),(810,'','MANUAL12'),(810,'','MANUAL13'),(810,'','MANUAL14'),(810,'','MANUAL15'),(810,'','MANUAL16'),(810,'','MANUAL17'),(810,'','MANUAL18'),(810,'','MANUAL19'),(810,'','MANUAL20'),(811,'1. 양파, 마늘, 생강, 고추, 새우를 다진다.','MANUAL01'),(811,'2. 버터를 두른 팬에 양파, 생강, 마늘, 고추, 카레가루 순으로 볶는다.','MANUAL02'),(811,'3. 2에 토마토페이스트, 레몬즙, 새우를 넣고 볶는다.','MANUAL03'),(811,'4. 3에 육수를 약간 붓고 약한 불로 끓이면서 수분을 증발시킨 뒤 볼에 담아 식힌다.','MANUAL04'),(811,'5. 춘권피에 4를 적당히 넣고 끝부분에 달걀물을 발라 붙여 완성한다.','MANUAL05'),(811,'6. 겉면에 올리브 오일을 약간 발라 오븐 팬에 놓고 170℃ 오븐에서 바삭하게 굽는다.','MANUAL06'),(811,'','MANUAL07'),(811,'','MANUAL08'),(811,'','MANUAL09'),(811,'','MANUAL10'),(811,'','MANUAL11'),(811,'','MANUAL12'),(811,'','MANUAL13'),(811,'','MANUAL14'),(811,'','MANUAL15'),(811,'','MANUAL16'),(811,'','MANUAL17'),(811,'','MANUAL18'),(811,'','MANUAL19'),(811,'','MANUAL20'),(812,'1. 소스재료를 볼에 넣고 잘 섞는다.','MANUAL01'),(812,'2. 소스를 돼지갈비에 골고루 바른 뒤 6시간 이상 재운다.','MANUAL02'),(812,'3. 재운 돼지갈비를 호일로 감싼다.','MANUAL03'),(812,'4. 3을 170℃의 오븐에서 30분간 굽는다.','MANUAL04'),(812,'5. 구운 돼지갈비의 호일을 벗긴다.','MANUAL05'),(812,'6. 5의 갈비가 부드러워 질 때까지 약 30분간 소스를 골고루 발라가며 굽는다.','MANUAL06'),(812,'','MANUAL07'),(812,'','MANUAL08'),(812,'','MANUAL09'),(812,'','MANUAL10'),(812,'','MANUAL11'),(812,'','MANUAL12'),(812,'','MANUAL13'),(812,'','MANUAL14'),(812,'','MANUAL15'),(812,'','MANUAL16'),(812,'','MANUAL17'),(812,'','MANUAL18'),(812,'','MANUAL19'),(812,'','MANUAL20'),(813,'1. 메밀가루에 물을 섞어 메밀 반죽을 만든다.','MANUAL01'),(813,'2. 무를 채 썰어 다시마 육수에 삶는다.','MANUAL02'),(813,'3. 다진 파, 마늘을 볶은 뒤 무와 통깨, 참기름과 섞어 버무린다.','MANUAL03'),(813,'4. 전병을 부친 뒤 무를 넣어 만다.','MANUAL04'),(813,'5. 귤 즙을 조린 뒤 저염간장을 넣고 섞는다.','MANUAL05'),(813,'6. 접시에 담는다.','MANUAL06'),(813,'','MANUAL07'),(813,'','MANUAL08'),(813,'','MANUAL09'),(813,'','MANUAL10'),(813,'','MANUAL11'),(813,'','MANUAL12'),(813,'','MANUAL13'),(813,'','MANUAL14'),(813,'','MANUAL15'),(813,'','MANUAL16'),(813,'','MANUAL17'),(813,'','MANUAL18'),(813,'','MANUAL19'),(813,'','MANUAL20'),(814,'1. 고기는 곱게 다지고 야채는 껍질을 제거한다.','MANUAL01'),(814,'2. 배는 갈아 즙을 만들고 양파는 다진 뒤 기름을 두르지 않은 팬에 살짝 볶는다.','MANUAL02'),(814,'3. 마늘과 생강을 곱게 다져 배즙과 섞은 뒤 다진 고기에 넣어 치댄다.','MANUAL03'),(814,'4. 떡갈비 반죽에 저염간장, 참기름을 이용해 밑간을 하고 찹쌀가루를 넣어 찰기를 준다.','MANUAL04'),(814,'5. 둥근 모양으로 빚은 뒤 중간을 살짝 눌러 기름을 두른 팬에 굽는다.','MANUAL05'),(814,'6. 170℃ 오븐에 3분 정도 구워 속까지 익힌다.','MANUAL06'),(814,'','MANUAL07'),(814,'','MANUAL08'),(814,'','MANUAL09'),(814,'','MANUAL10'),(814,'','MANUAL11'),(814,'','MANUAL12'),(814,'','MANUAL13'),(814,'','MANUAL14'),(814,'','MANUAL15'),(814,'','MANUAL16'),(814,'','MANUAL17'),(814,'','MANUAL18'),(814,'','MANUAL19'),(814,'','MANUAL20'),(815,'1. 감자는 깨끗이 씻어 껍질째 한입 크기로 깍둑썰기 한 뒤 삶는다.','MANUAL01'),(815,'2. 마늘은 얇게 편으로 썬다.','MANUAL02'),(815,'3. 양파는 굵게 다진다.','MANUAL03'),(815,'4. 팬에 식용유를 두르고 다진양파를 볶은 뒤 마늘은 바삭하게 굽는다.','MANUAL04'),(815,'5. 마요네즈, 머스터드, 플레인요거트, 설탕을 섞어 드레싱을 만든다.','MANUAL05'),(815,'6. 감자와 볶은 양파, 드레싱을 골고루 버무리고 마늘칩과 파슬리를 뿌린다.','MANUAL06'),(815,'','MANUAL07'),(815,'','MANUAL08'),(815,'','MANUAL09'),(815,'','MANUAL10'),(815,'','MANUAL11'),(815,'','MANUAL12'),(815,'','MANUAL13'),(815,'','MANUAL14'),(815,'','MANUAL15'),(815,'','MANUAL16'),(815,'','MANUAL17'),(815,'','MANUAL18'),(815,'','MANUAL19'),(815,'','MANUAL20'),(816,'1. 닭고기는 부위별로 토막 내어 끓는 물에 살짝 데친다.','MANUAL01'),(816,'2. 데친 닭고기에 양념 재료를 섞어 30분 이상 재운다.','MANUAL02'),(816,'3. 무, 당근, 양파는 사각 썰고, 고추는 송송 썬다.','MANUAL03'),(816,'4. 무청시래기는 끓는 물에 한 번 더 살짝 데치고, 6cm 길이로 썬다.','MANUAL04'),(816,'5. 냄비에 물(30g)과 닭고기, 시래기를 넣고, 청홍고추를 제외한 손질한 채소를 넣어 조린다.','MANUAL05'),(816,'6. 홍고추와 청고추를 올려 마무리한다.','MANUAL06'),(816,'','MANUAL07'),(816,'','MANUAL08'),(816,'','MANUAL09'),(816,'','MANUAL10'),(816,'','MANUAL11'),(816,'','MANUAL12'),(816,'','MANUAL13'),(816,'','MANUAL14'),(816,'','MANUAL15'),(816,'','MANUAL16'),(816,'','MANUAL17'),(816,'','MANUAL18'),(816,'','MANUAL19'),(816,'','MANUAL20'),(817,'1. 두부는 2cm의 정사각형으로 썰어 전분과 계란물을 무쳐 기름에 튀긴다.','MANUAL01'),(817,'2. 무는 믹서기나 강판에 갈아준다.','MANUAL02'),(817,'3. 끓는 물에 가쓰오부시를 살짝 넣었다 빼내어 국물을 우려낸다.','MANUAL03'),(817,'4. 무와 가쓰오부시 국물에 설탕, 미향, 레몬즙, 식초, 저염간장을 넣고 섞어준다.','MANUAL04'),(817,'5. 깻잎은 곱게 채를 쳐준다.','MANUAL05'),(817,'6. 접시에 두부와 깻잎을 담고, 소스를 곁들여 낸다.','MANUAL06'),(817,'','MANUAL07'),(817,'','MANUAL08'),(817,'','MANUAL09'),(817,'','MANUAL10'),(817,'','MANUAL11'),(817,'','MANUAL12'),(817,'','MANUAL13'),(817,'','MANUAL14'),(817,'','MANUAL15'),(817,'','MANUAL16'),(817,'','MANUAL17'),(817,'','MANUAL18'),(817,'','MANUAL19'),(817,'','MANUAL20'),(818,'1. 오징어를 먹기 좋은 크기로 썬다.','MANUAL01'),(818,'2. 오징어를 살짝 데친 후 물기를 제거한다.','MANUAL02'),(818,'3. 밀가루에 물, 계란, 후추를 넣어 튀김반죽을 만든다.','MANUAL03'),(818,'4. 오징어에 튀김 반죽을 묻혀 식용유에 튀긴다.','MANUAL04'),(818,'5. 키친타올에 올려 기름을 제거한다.','MANUAL05'),(818,'6. 딸기잼과 같이 곁들여 낸다.','MANUAL06'),(818,'','MANUAL07'),(818,'','MANUAL08'),(818,'','MANUAL09'),(818,'','MANUAL10'),(818,'','MANUAL11'),(818,'','MANUAL12'),(818,'','MANUAL13'),(818,'','MANUAL14'),(818,'','MANUAL15'),(818,'','MANUAL16'),(818,'','MANUAL17'),(818,'','MANUAL18'),(818,'','MANUAL19'),(818,'','MANUAL20'),(819,'1. 감귤은 껍질을 제거하고 알을 분리하여 반을 갈라 준다.','MANUAL01'),(819,'2. 치커리는 한입크기로 썰어 준비한다.','MANUAL02'),(819,'3. 완두콩, 수수, 율무, 병아리콩은 하루 전에 물에 불린 후 삶아준다.','MANUAL03'),(819,'4. 삶은 콩은 체에 받쳐 물기를 제거한다.','MANUAL04'),(819,'5. 손질한 재료를 모두 섞는다.','MANUAL05'),(819,'6. 올리브오일과 유자청을 넣어 버무린다.','MANUAL06'),(819,'','MANUAL07'),(819,'','MANUAL08'),(819,'','MANUAL09'),(819,'','MANUAL10'),(819,'','MANUAL11'),(819,'','MANUAL12'),(819,'','MANUAL13'),(819,'','MANUAL14'),(819,'','MANUAL15'),(819,'','MANUAL16'),(819,'','MANUAL17'),(819,'','MANUAL18'),(819,'','MANUAL19'),(819,'','MANUAL20'),(820,'1. 반죽을 모두 섞어 30분 발효 후 punch 후 40분 발효한다.\n★punch는 가스를 빼는 과정을 얘기해요.','MANUAL01'),(820,'2. 150g으로 분할 후 중간발효 20분을 한다.','MANUAL02'),(820,'3. 찰 반죽 80g 분할 후 밀대로 얇게 펴서 크림치즈와 바질페스토를 섞은 속재료를 짜고 삶아 낸 고구마 다이스를 촘촘한 간격으로 올린 후 말아준다.','MANUAL03'),(820,'4. 중간발효를 마친 바게트 반죽은 최대한 기공을 살려 조심히 펴 준다. 펴준 반죽 위에 찰 반죽을 놓고 가볍게 환목모양으로 말아준다.','MANUAL04'),(820,'5. 반죽에 물을 뿌린 후 덧 가루를 묻혀 1시간 동안 2차 발효한다.','MANUAL05'),(820,'6. 빵이 터지지 않게 꾸쁘는 사선으로 세 번 내고 , 195℃의 컨벡션 오븐에 16분 스팀 8초 설정을 하여 굽는다.','MANUAL06'),(820,'','MANUAL07'),(820,'','MANUAL08'),(820,'','MANUAL09'),(820,'','MANUAL10'),(820,'','MANUAL11'),(820,'','MANUAL12'),(820,'','MANUAL13'),(820,'','MANUAL14'),(820,'','MANUAL15'),(820,'','MANUAL16'),(820,'','MANUAL17'),(820,'','MANUAL18'),(820,'','MANUAL19'),(820,'','MANUAL20'),(821,'1. 냄비에 물(500㎖)과 다시마(2g)를 넣어 3분간 끓이고 다시마는 건져 육수를 만든다.','MANUAL01'),(821,'2. 고등어는 에어프라이어에 넣어 180℃에서 10~15분간 굽는다.','MANUAL02'),(821,'3. 양파와 마늘, 양송이버섯, 청양고추는 잘게 다지고, 깻잎은 얇게 채 썬다.','MANUAL03'),(821,'4. 중간 불로 달군 팬에 식용유를 두른 뒤 다진 양파와 마늘, 양송이버섯, 간장을 넣어 2분간 볶은 뒤 불린 현미를 넣어 2분간 볶는다.','MANUAL04'),(821,'5. 다시마 육수(250㎖)를 2~3번에 나눠 넣어 현미를 익히다가 검은콩 두유를 넣어 졸이고 레몬즙과 다진 청양고추를 넣어 고루 섞는다.','MANUAL05'),(821,'6. 그릇에 현미 리소토를 담고 고등어구이 → 채 썬 깻잎 → 달걀노른자 순으로 올린다.','MANUAL06'),(821,'','MANUAL07'),(821,'','MANUAL08'),(821,'','MANUAL09'),(821,'','MANUAL10'),(821,'','MANUAL11'),(821,'','MANUAL12'),(821,'','MANUAL13'),(821,'','MANUAL14'),(821,'','MANUAL15'),(821,'','MANUAL16'),(821,'','MANUAL17'),(821,'','MANUAL18'),(821,'','MANUAL19'),(821,'','MANUAL20'),(822,'1. 물(3컵)에 육수 재료와 칵테일새우를 넣어 새우가 익을 때까지 데친 뒤 건진다.','MANUAL01'),(822,'2. 사과와 양파는 잘게 다지고, 당근은 길게 썬다.','MANUAL02'),(822,'3. 다진 사과와 양파, 채 썬 당근, 후춧가루, 레몬즙, 식초, 올리브유를 넣어 고루 섞는다.','MANUAL03'),(822,'4. 바게트 위에 버무린 재료를 올린다.','MANUAL04'),(822,'5. 데친 새우를 올리고, 다진 파슬리와 후춧가루를 뿌린 뒤 블루베리를 올린다.','MANUAL05'),(822,'6. 애플민트를 올려 마무리한다.','MANUAL06'),(822,'','MANUAL07'),(822,'','MANUAL08'),(822,'','MANUAL09'),(822,'','MANUAL10'),(822,'','MANUAL11'),(822,'','MANUAL12'),(822,'','MANUAL13'),(822,'','MANUAL14'),(822,'','MANUAL15'),(822,'','MANUAL16'),(822,'','MANUAL17'),(822,'','MANUAL18'),(822,'','MANUAL19'),(822,'','MANUAL20'),(823,'1. 상추는 깨끗하게 씻어 한입 크기로 뜯고, 레몬은 모양대로 얇게 썰고, 아보카도는 씨와 껍질을 제거한 뒤 한입 크기로 썬다.','MANUAL01'),(823,'2. 파프리카는 씨를 제거한 뒤 한입 크기로 썰고, 토마토는 한입 크기로 썬다.','MANUAL02'),(823,'3. 끓는 소금물(물4컵+소금0.2ts)에 식초를 넣은 뒤 달걀을 넣고 수란을 만든다.','MANUAL03'),(823,'4. 드레싱을 만든다.','MANUAL04'),(823,'5. 그릇에 손질한 채소를 담고 수란과 얇게 썬 레몬을 올려 마무리한다.','MANUAL05'),(823,'','MANUAL06'),(823,'','MANUAL07'),(823,'','MANUAL08'),(823,'','MANUAL09'),(823,'','MANUAL10'),(823,'','MANUAL11'),(823,'','MANUAL12'),(823,'','MANUAL13'),(823,'','MANUAL14'),(823,'','MANUAL15'),(823,'','MANUAL16'),(823,'','MANUAL17'),(823,'','MANUAL18'),(823,'','MANUAL19'),(823,'','MANUAL20'),(824,'1. 소고기는 길이 6cm, 넓이 2cm, 두께 0.5cm 정도의 직사각형 모양으로 썬 뒤 전분과 간장을 섞어 재운다.','MANUAL01'),(824,'2. 생강은 다지고 오렌지는 껍질을 벗겨 속만 잘라내고 파인애플은 껍질과 속심을 제거하고 0.5cm 크기의 주사위모양으로 자른다.','MANUAL02'),(824,'3. 오렌지주스, 굴소스, 꿀, 전분을 섞어 소스를 만든다.','MANUAL03'),(824,'4. 기름을 두르지 않은 팬에 깨를 볶은 뒤 식히고 팬에 기름을 두르고 재운 소고기를 앞뒤로 골고루 익힌다.','MANUAL04'),(824,'5. 4에 소스를 넣고 저어주면서 끓여 농도가 나기 시작하면 오렌지와 파인애플을 넣고 살짝 익힌다.','MANUAL05'),(824,'6. 접시에 5를 담고 제공하기 직전에 깨를 뿌린다.','MANUAL06'),(824,'','MANUAL07'),(824,'','MANUAL08'),(824,'','MANUAL09'),(824,'','MANUAL10'),(824,'','MANUAL11'),(824,'','MANUAL12'),(824,'','MANUAL13'),(824,'','MANUAL14'),(824,'','MANUAL15'),(824,'','MANUAL16'),(824,'','MANUAL17'),(824,'','MANUAL18'),(824,'','MANUAL19'),(824,'','MANUAL20'),(825,'1. 양파는 곱게 다지고 양송이는 0.5cm로 슬라이스 한다.','MANUAL01'),(825,'2. 팬에 버터를 넣고 녹으면 양파를 볶다가 양송이를 넣어 볶는다.','MANUAL02'),(825,'3. 생크림, 소금, 후추로 간을 하고 양송이에서 물이 빠져나오면 빵가루를 넣어 되직하게 농도를 맞춘 뒤 그릇에 옮겨 식힌다.','MANUAL03'),(825,'4. 차이브, 오레가노, 바질, 파슬리를 잘게 다진다.','MANUAL04'),(825,'5. 간 닭고기와 3, 4를 볼에 넣고 섞어 치대 찰지게 만든 뒤 지름 10cm 정도의 원형 모양이나 럭비공 모양으로 만든다.','MANUAL05'),(825,'6. 팬에 기름을 두른 뒤 치킨 스테이크를 익혀주거나 팬에서 색만 내고 오븐에서 익힌다.','MANUAL06'),(825,'','MANUAL07'),(825,'','MANUAL08'),(825,'','MANUAL09'),(825,'','MANUAL10'),(825,'','MANUAL11'),(825,'','MANUAL12'),(825,'','MANUAL13'),(825,'','MANUAL14'),(825,'','MANUAL15'),(825,'','MANUAL16'),(825,'','MANUAL17'),(825,'','MANUAL18'),(825,'','MANUAL19'),(825,'','MANUAL20'),(826,'1. 볼에 달걀을 푼다.','MANUAL01'),(826,'2. 달군 팬에 1을 볶아 스크램블을 만든다.','MANUAL02'),(826,'3. 파를 송송 썬다.','MANUAL03'),(826,'4. 기름을 두른 팬에 3을 먼저 볶아 향을 낸 뒤 토마토소스를 넣고 볶는다.','MANUAL04'),(826,'5. 4에 설탕, 소금, 2를 넣고 섞는다.','MANUAL05'),(826,'6. 참기름을 뿌려 마무리한다.','MANUAL06'),(826,'','MANUAL07'),(826,'','MANUAL08'),(826,'','MANUAL09'),(826,'','MANUAL10'),(826,'','MANUAL11'),(826,'','MANUAL12'),(826,'','MANUAL13'),(826,'','MANUAL14'),(826,'','MANUAL15'),(826,'','MANUAL16'),(826,'','MANUAL17'),(826,'','MANUAL18'),(826,'','MANUAL19'),(826,'','MANUAL20'),(827,'1. 양파와 당근은 잘게 다진다.','MANUAL01'),(827,'2. 시래기는 불려 물기를 꼭 짜낸다.','MANUAL02'),(827,'3. 2번의 시래기를 곱게 다진다.','MANUAL03'),(827,'4. 뜨거운 밥에 1, 3을 넣는다.','MANUAL04'),(827,'5. 4에 낫토, 카레가루, 다진 파를 넣고 골고루 섞는다.','MANUAL05'),(827,'6. 5에 소금, 후춧가루로 간한다.','MANUAL06'),(827,'','MANUAL07'),(827,'','MANUAL08'),(827,'','MANUAL09'),(827,'','MANUAL10'),(827,'','MANUAL11'),(827,'','MANUAL12'),(827,'','MANUAL13'),(827,'','MANUAL14'),(827,'','MANUAL15'),(827,'','MANUAL16'),(827,'','MANUAL17'),(827,'','MANUAL18'),(827,'','MANUAL19'),(827,'','MANUAL20'),(828,'1. 달걀은 완숙으로 삶아 껍질을 벗긴 뒤 세로로 4등분하고 완두콩은 끓는 물에 삶아 찬물에 헹군 뒤 물기를 제거한다.','MANUAL01'),(828,'2. 오이는 1cm 주사위모양으로 썰고 양파는 링으로 슬라이스 하고 로메인은 먹기 좋게 뜯어 찬물에 담군다.','MANUAL02'),(828,'3. 토마토는 달걀과 같은 모양으로 자르고 홍고추는 어슷하게 썰고 참치는 덩어리가 있게 기름기를 뺀다.','MANUAL03'),(828,'4. 바질은 슬라이스하고 마늘은 다진다.','MANUAL04'),(828,'5. 볼에 올리브오일과 레드와인식초, 머스타드, 설탕, 다진마늘을 섞어 드레싱을 만든다.','MANUAL05'),(828,'6. 다른 볼에 준비해둔 야채들과 달걀, 참치를 넣고 드래싱을 끼얹어 버무린다.','MANUAL06'),(828,'','MANUAL07'),(828,'','MANUAL08'),(828,'','MANUAL09'),(828,'','MANUAL10'),(828,'','MANUAL11'),(828,'','MANUAL12'),(828,'','MANUAL13'),(828,'','MANUAL14'),(828,'','MANUAL15'),(828,'','MANUAL16'),(828,'','MANUAL17'),(828,'','MANUAL18'),(828,'','MANUAL19'),(828,'','MANUAL20'),(829,'1. 냄비에 다시마가 잠길 정도의 물을 붓고 중불에서 삶아 10여분 두었다가 건져 찬물에 휑군 뒤 18cm 크기로 자른다.','MANUAL01'),(829,'2. 청, 홍고추는 씨를 빼 잘게 다지고 부추와 새우 살도 다진다.','MANUAL02'),(829,'3. 밀가루에 물과 소금을 넣고 반죽을 한 뒤 다진 채소들을 넣고 골고루 섞는다.','MANUAL03'),(829,'4. 3에 다시마를 넣어 반죽 물을 입히고 팬에 기름을 둘러 노릇하게 지진다.','MANUAL04'),(829,'5. 다시마전이 한 김 식은 후 돌돌 말아 자를 수 있도록 꼬치로 고정시킨다.','MANUAL05'),(829,'6. 5를 4cm 정도 길이로 자르고 멸치액젓소스를 곁들인다.','MANUAL06'),(829,'','MANUAL07'),(829,'','MANUAL08'),(829,'','MANUAL09'),(829,'','MANUAL10'),(829,'','MANUAL11'),(829,'','MANUAL12'),(829,'','MANUAL13'),(829,'','MANUAL14'),(829,'','MANUAL15'),(829,'','MANUAL16'),(829,'','MANUAL17'),(829,'','MANUAL18'),(829,'','MANUAL19'),(829,'','MANUAL20'),(830,'1. 청피망, 당근, 닭고기를 옥수수알 크기로 썬다.','MANUAL01'),(830,'2. 팬에 닭고기를 볶는다.','MANUAL02'),(830,'3. 2에 당근을 넣고 볶는다.','MANUAL03'),(830,'4. 3에 잣, 청피망, 옥수수를 넣고 볶는다.','MANUAL04'),(830,'5. 4에 간을 한다.','MANUAL05'),(830,'6. 물전분으로 농도를 맞춘다.','MANUAL06'),(830,'','MANUAL07'),(830,'','MANUAL08'),(830,'','MANUAL09'),(830,'','MANUAL10'),(830,'','MANUAL11'),(830,'','MANUAL12'),(830,'','MANUAL13'),(830,'','MANUAL14'),(830,'','MANUAL15'),(830,'','MANUAL16'),(830,'','MANUAL17'),(830,'','MANUAL18'),(830,'','MANUAL19'),(830,'','MANUAL20'),(831,'1. 끓는 물에 데친 느타리 버섯을 손으로 찢고 생 표고버섯은 데쳐서 물기를 짠 뒤 채썬다.','MANUAL01'),(831,'2. 팽이버섯은 밑동을 제거한 뒤 반으로 자르고 새송이버섯은 팽이버섯 크기로 자른다.','MANUAL02'),(831,'3. 조랭이떡은 물에 휑구고 우엉은 껍질을 벗겨 길이로 3등분 하여 어슷하게 썬 뒤 냉수에 여러번 휑구고 물기를 뺀다.','MANUAL03'),(831,'4. 들깨는 분무기를 이용하여 물을 조금씩 넣으면서 곱게 갈아 체에 밭쳐 들깨 물을 준비하고 찌꺼기는 버린다.','MANUAL04'),(831,'5. 냄비에 들기름을 두르고 우엉을 볶은 뒤 들깨 물을 부어 끓이다가 조랭이 떡을 넣고 끓인다.','MANUAL05'),(831,'6. 5의 떡이 둥둥 떠오르면 버섯을 넣고 한소끔 끓인 뒤 소금으로 간을 한다.','MANUAL06'),(831,'','MANUAL07'),(831,'','MANUAL08'),(831,'','MANUAL09'),(831,'','MANUAL10'),(831,'','MANUAL11'),(831,'','MANUAL12'),(831,'','MANUAL13'),(831,'','MANUAL14'),(831,'','MANUAL15'),(831,'','MANUAL16'),(831,'','MANUAL17'),(831,'','MANUAL18'),(831,'','MANUAL19'),(831,'','MANUAL20'),(832,'1. 비타민과 치커리는 한입 크기로 적당히 뜯어 찬물에 담궈 두었다가 먹기 전에 물기를 제거한다.','MANUAL01'),(832,'2. 믹서에 산마와 우유, 레몬주스, 오렌지주스, 호두, 소금을 넣고 곱게 갈아 드래싱을 만든다.','MANUAL02'),(832,'3. 배는 껍질을 제거하고 4등분 한 뒤 씨를 제거하고 4~5mm 정도의 두께로 슬라이스한다.','MANUAL03'),(832,'4. 팬에 포도주스를 붓고 슬라이스한 배를 넣어 배가 포도색이 되도록 졸인다.','MANUAL04'),(832,'5. 훈제오리가슴살을 얇게 슬라이스 한다.','MANUAL05'),(832,'6. 접시에 5와 4, 실곤약, 야채들을 보기 좋게 담고 드래싱을 끼얹는다.','MANUAL06'),(832,'','MANUAL07'),(832,'','MANUAL08'),(832,'','MANUAL09'),(832,'','MANUAL10'),(832,'','MANUAL11'),(832,'','MANUAL12'),(832,'','MANUAL13'),(832,'','MANUAL14'),(832,'','MANUAL15'),(832,'','MANUAL16'),(832,'','MANUAL17'),(832,'','MANUAL18'),(832,'','MANUAL19'),(832,'','MANUAL20'),(833,'1. 두부를 1cm 주사위모양으로 자른다.','MANUAL01'),(833,'2. 1을 뜨거운 물에 넣었다가 꺼내 물기를 제거한다.','MANUAL02'),(833,'3. 당근과 돼지고기를 잘게 다진다.','MANUAL03'),(833,'4. 팬에 고추기름을 두른 뒤 3을 넣고 볶는다.','MANUAL04'),(833,'5. 파, 다진생강, 물, 완두콩, 소금, 두부를 넣고 간이 들도록 졸인다.','MANUAL05'),(833,'6. 물 전분을 넣어 소스의 농도를 맞춘다.','MANUAL06'),(833,'','MANUAL07'),(833,'','MANUAL08'),(833,'','MANUAL09'),(833,'','MANUAL10'),(833,'','MANUAL11'),(833,'','MANUAL12'),(833,'','MANUAL13'),(833,'','MANUAL14'),(833,'','MANUAL15'),(833,'','MANUAL16'),(833,'','MANUAL17'),(833,'','MANUAL18'),(833,'','MANUAL19'),(833,'','MANUAL20'),(834,'1. 더덕은 껍질을 벗기고 0.3cm 두께로 편 썰어 소금물에 담궈 쓴 맛을 뺀 뒤 면보에 옮겨 밀대로 밀거나 두들겨 얇게 편다.','MANUAL01'),(834,'2. 찹쌀가루는 소금을 넣고 혼합하여 체에 내린다.','MANUAL02'),(834,'3. 2를 3등분 하여 가루녹차와 백년초가루를 각각 섞는다.','MANUAL03'),(834,'4. 3에 더덕을 각각 넣고 앞, 뒤로 꼭꼭 눌러 찹쌀가루를 묻힌다.','MANUAL04'),(834,'5. 170℃의 기름에 2번 튀긴 뒤 기름을 빼고 뜨거울 때 설탕을 약간 뿌린다.','MANUAL05'),(834,'6. 꿀을 곁들여 찍어 먹는다.','MANUAL06'),(834,'','MANUAL07'),(834,'','MANUAL08'),(834,'','MANUAL09'),(834,'','MANUAL10'),(834,'','MANUAL11'),(834,'','MANUAL12'),(834,'','MANUAL13'),(834,'','MANUAL14'),(834,'','MANUAL15'),(834,'','MANUAL16'),(834,'','MANUAL17'),(834,'','MANUAL18'),(834,'','MANUAL19'),(834,'','MANUAL20'),(835,'1. 돼지고기는 채 썬 뒤 소금, 물전분을 넣고 양념한다.','MANUAL01'),(835,'2. 양념한 고기를 기름 두른 팬에 볶으면서 달라붙지 않도록 저어준다.','MANUAL02'),(835,'3. 시금치와 부추를 4~5cm 가량으로 썬다.','MANUAL03'),(835,'4. 가열된 팬에 기름을 두르고 파, 생강, 팔각을 넣어 향을 낸다.','MANUAL04'),(835,'5. 4에 2와 간장을 넣고 볶는다.','MANUAL05'),(835,'6. 물 전분을 넣어 농도를 맞춘 뒤 마직막으로 부추, 시금치를 넣는다.','MANUAL06'),(835,'','MANUAL07'),(835,'','MANUAL08'),(835,'','MANUAL09'),(835,'','MANUAL10'),(835,'','MANUAL11'),(835,'','MANUAL12'),(835,'','MANUAL13'),(835,'','MANUAL14'),(835,'','MANUAL15'),(835,'','MANUAL16'),(835,'','MANUAL17'),(835,'','MANUAL18'),(835,'','MANUAL19'),(835,'','MANUAL20'),(836,'1. 단호박, 비트, 고구마, 당근은 껍질을 벗긴다.','MANUAL01'),(836,'2. 1을 자연스럽게 2~2.5cm 두께로 썬다.','MANUAL02'),(836,'3. 볼에 2와 발사믹 식초, 꿀, 로즈마리 잎을 넣고 버무린다.','MANUAL03'),(836,'4. 소금, 후추로 간을 한다.','MANUAL04'),(836,'5. 150℃의 예열된 오븐에서 익을 때까지 굽는다.','MANUAL05'),(836,'6. 중간에 뒤집어 주어 고루 익히도록 한다.','MANUAL06'),(836,'','MANUAL07'),(836,'','MANUAL08'),(836,'','MANUAL09'),(836,'','MANUAL10'),(836,'','MANUAL11'),(836,'','MANUAL12'),(836,'','MANUAL13'),(836,'','MANUAL14'),(836,'','MANUAL15'),(836,'','MANUAL16'),(836,'','MANUAL17'),(836,'','MANUAL18'),(836,'','MANUAL19'),(836,'','MANUAL20'),(837,'1. 도미살에 소금, 후추로 밑간한다.','MANUAL01'),(837,'2. 셀러리, 당근, 대파, 양파, 피망은 채 썰고 브로컬리는 작은 송이로 자르고 레몬 껍질은 얇게 제스트하고 팽이버섯은 밑동을 자른다.','MANUAL02'),(837,'3. 유산지는 반을 접었다가 편 뒤 안쪽에 부드러운 버터를 바른다.','MANUAL03'),(837,'4. 4의 버터를 바른 한 쪽 면에 셀러리, 당근, 대파, 팽이버섯, 양파, 피망, 레몬 제스트를 준비된 분량의 반 정도 놓고 밑간한 도미살을 올린다.','MANUAL04'),(837,'5. 다시 남은 야채들을 도미위에 올리고 유산지의 한 면으로 야채를 덮어주고, 모서리의 뚫린 곳을 접어 봉해준다.','MANUAL05'),(837,'6. 160℃로 예열된 오븐에서 익혀준다.','MANUAL06'),(837,'','MANUAL07'),(837,'','MANUAL08'),(837,'','MANUAL09'),(837,'','MANUAL10'),(837,'','MANUAL11'),(837,'','MANUAL12'),(837,'','MANUAL13'),(837,'','MANUAL14'),(837,'','MANUAL15'),(837,'','MANUAL16'),(837,'','MANUAL17'),(837,'','MANUAL18'),(837,'','MANUAL19'),(837,'','MANUAL20'),(838,'1. 알배추는 세척 후 먹기 좋은 크기로 잘라 물에 담군다.','MANUAL01'),(838,'2. 대파와 풋고추는 어슷썰고 양파는 굵게 채 썬다.','MANUAL02'),(838,'3. 마늘은 곱게 다지고 사과는 믹서에 간다.','MANUAL03'),(838,'4. 사과즙, 다진마늘, 고춧가루, 매실액, 식초를 섞어 겉절이 양념을 만든다.','MANUAL04'),(838,'5. 물에 담궈뒀던 알배추를 건져 물기를 뺀 뒤 넓은 볼에 담는다.','MANUAL05'),(838,'6. 알배추와 양파, 대파, 풋고추, 무청을 겉절이 양념에 골고루 버무린다.','MANUAL06'),(838,'','MANUAL07'),(838,'','MANUAL08'),(838,'','MANUAL09'),(838,'','MANUAL10'),(838,'','MANUAL11'),(838,'','MANUAL12'),(838,'','MANUAL13'),(838,'','MANUAL14'),(838,'','MANUAL15'),(838,'','MANUAL16'),(838,'','MANUAL17'),(838,'','MANUAL18'),(838,'','MANUAL19'),(838,'','MANUAL20'),(839,'1. 양파, 대파, 호두, 닭가슴살은 잘게 다진다.','MANUAL01'),(839,'2. ①에 물기를 제거한 두부와 생강, 마늘, 후추를 섞어 반죽한다.','MANUAL02'),(839,'3. 반죽을 쌀가루, 계란물, 빵가루 순으로 묻히고 튀겨 크로켓을 만든다.','MANUAL03'),(839,'4. 믹서에 두부, 두유를 넣고 갈아 두부 마요네즈를 만든다.','MANUAL04'),(839,'5. 순무와 양파는 다지고, 계란은 삶아 다져 준비한다.','MANUAL05'),(839,'6. 두부 마요네즈에 ⑤의 재료와 설탕, 레몬, 식초, 땅콩버터, 후추, 홀그레인, 파슬리가루를 넣어 타르소스를 만든다.','MANUAL06'),(839,'','MANUAL07'),(839,'','MANUAL08'),(839,'','MANUAL09'),(839,'','MANUAL10'),(839,'','MANUAL11'),(839,'','MANUAL12'),(839,'','MANUAL13'),(839,'','MANUAL14'),(839,'','MANUAL15'),(839,'','MANUAL16'),(839,'','MANUAL17'),(839,'','MANUAL18'),(839,'','MANUAL19'),(839,'','MANUAL20'),(840,'1. 로메인 상추를 한 입 크기로 썬다.','MANUAL01'),(840,'2. 파프리카는 사방 0.3cm 크기로 썬다.','MANUAL02'),(840,'3. 누룽지를 튀긴 후 으깬다.','MANUAL03'),(840,'4. 유자청, 레몬즙, 올리브유, 식초, 후추를 섞어 드레싱을 만든다.','MANUAL04'),(840,'5. 로메인 상추 위에 파프리카와 튀긴 누룽지를 고명으로 올린다.','MANUAL05'),(840,'6. 드레싱을 얹어 낸다.','MANUAL06'),(840,'','MANUAL07'),(840,'','MANUAL08'),(840,'','MANUAL09'),(840,'','MANUAL10'),(840,'','MANUAL11'),(840,'','MANUAL12'),(840,'','MANUAL13'),(840,'','MANUAL14'),(840,'','MANUAL15'),(840,'','MANUAL16'),(840,'','MANUAL17'),(840,'','MANUAL18'),(840,'','MANUAL19'),(840,'','MANUAL20'),(841,'1. (아몬드우유) 믹서기에 아몬드와 우유를 갈아 아몬드 우유를 만든다.','MANUAL01'),(841,'2. 밀가루, 미숫가루, 이스트, 소금, 달걀, 아몬드 우유를 넣어 손으로 반죽하다가 아몬드, 해바라기씨, 호박씨 넣고 반죽한다.','MANUAL02'),(841,'3. ②이 한 덩어리가 되면 무염버터를 넣어 반죽을 하고 마지막으로 건포도를 넣어 섞는다.','MANUAL03'),(841,'4. \"크기가 2.5배가 될 때까지 1차 발효하고 반죽을 접어 공기를 빼고 3등분으로 나눠 둥글리기 후 10분 정도 중간 발효한다.\n★반죽이 달라붙으면 덧가루를 뿌리면서 작업하면 수월해요.\"','MANUAL04'),(841,'5. 발효가 끝나면 다시 둥글리기를 해주고 반죽의 매끄러운 면이 위로 가도록 팬닝 후 40~50분 2차 발효 시킨다.','MANUAL05'),(841,'6. \"180℃ 오븐에서 20~25분 동안 구워서 완성시킨 뒤 위에 버터를 바르고 아몬드 슬라이스와 미숫가루로 토핑한다.\n★ 버터는 살짝 녹여 사용하세요.\"','MANUAL06'),(841,'','MANUAL07'),(841,'','MANUAL08'),(841,'','MANUAL09'),(841,'','MANUAL10'),(841,'','MANUAL11'),(841,'','MANUAL12'),(841,'','MANUAL13'),(841,'','MANUAL14'),(841,'','MANUAL15'),(841,'','MANUAL16'),(841,'','MANUAL17'),(841,'','MANUAL18'),(841,'','MANUAL19'),(841,'','MANUAL20'),(842,'1. 양파는 채 썰고, 쪽파는 송송 썰고, 레몬은 슬라이스하고, 마늘은 으깨고, 생강은 납작 썰고, 건고추는 굵게 부순다.','MANUAL01'),(842,'2. 중간 불로 달군 마른 팬에 멸치를 넣어 3분간 볶아 수분을 날린 뒤 건함초, 다시마와 함께 믹서에 넣어 곱게 간다.','MANUAL02'),(842,'3. 중간 불로 달군 팬에 식용유(20㎖)와 손질한 향신료를 넣고 3분간 볶아 향유를 만든다.','MANUAL03'),(842,'4. 향유에 참기름과 후춧가루, 곱게 간 멸치가루를 넣어 섞은 뒤 밥에 넣어 고루 섞는다.','MANUAL04'),(842,'5. 중간 불로 달군 팬에 남겨둔 향유(10g)를 두르고 꽈리고추와 돼지고기를 넣어 9분간 구운 뒤 돼지고기는 얇게 한입 크기로 썬다.','MANUAL05'),(842,'6. 그릇에 비빔밥, 구운 돼지고기와 꽈리고추, 손질한 양파, 쪽파, 레몬, 김가루, 고추냉이, 무순, 수란을 올린다.','MANUAL06'),(842,'','MANUAL07'),(842,'','MANUAL08'),(842,'','MANUAL09'),(842,'','MANUAL10'),(842,'','MANUAL11'),(842,'','MANUAL12'),(842,'','MANUAL13'),(842,'','MANUAL14'),(842,'','MANUAL15'),(842,'','MANUAL16'),(842,'','MANUAL17'),(842,'','MANUAL18'),(842,'','MANUAL19'),(842,'','MANUAL20'),(843,'1. 양상추는 채 썰고, 양파와 토마토는 작게 한입 크기로 썰고, 청양고추와 할라피뇨 피클은 잘게 다진다.','MANUAL01'),(843,'2. 냄비에 물(10컵), 닭가슴살, 닭가슴살 삶는 재료와 후춧가루(0.3ts)를 넣어 7분 정도 삶은 뒤 건져 얇게 찢는다.','MANUAL02'),(843,'3. 호박은 4조각으로 잘라 씨를 제거하고, 찜기에 물(1컵)을 넣어 쪄내고, 껍질을 벗긴 뒤 물(1컵)을 부어가며 으깬다.','MANUAL03'),(843,'4. 약한 불로 달군 팬에 으깬 단호박, 닭가슴살, 다진 청양고추, 카레가루, 후춧가루(0.2ts)를 넣어 수분이 날아갈 때까지 볶는다.','MANUAL04'),(843,'5. 팬에 식용유(2컵)를 부은 뒤 중간 불로 예열하고, 라이스페이퍼를 넣어 튀긴 뒤 바로 건져낸다.','MANUAL05'),(843,'6. 튀긴 라이스페이퍼에 단호박 볶음과 손질한 채소, 플레인 요거트를 올려 마무리한다.','MANUAL06'),(843,'','MANUAL07'),(843,'','MANUAL08'),(843,'','MANUAL09'),(843,'','MANUAL10'),(843,'','MANUAL11'),(843,'','MANUAL12'),(843,'','MANUAL13'),(843,'','MANUAL14'),(843,'','MANUAL15'),(843,'','MANUAL16'),(843,'','MANUAL17'),(843,'','MANUAL18'),(843,'','MANUAL19'),(843,'','MANUAL20'),(844,'1. 사과는 4등분하고 씨를 제거한다.','MANUAL01'),(844,'2. 1을 다시 4등분 한다.','MANUAL02'),(844,'3. 셀러리는 껍질을 제거하고 슬라이스 한다.','MANUAL03'),(844,'4. 마요네즈, 레몬주스, 식초, 소금을 섞어 드래싱을 만든다.','MANUAL04'),(844,'5. 볼에 사과, 셀러리, 호두, 건포도를 넣는다.','MANUAL05'),(844,'6. 5에 만들어 놓은 드래싱을 넣어 고루 섞는다.','MANUAL06'),(844,'','MANUAL07'),(844,'','MANUAL08'),(844,'','MANUAL09'),(844,'','MANUAL10'),(844,'','MANUAL11'),(844,'','MANUAL12'),(844,'','MANUAL13'),(844,'','MANUAL14'),(844,'','MANUAL15'),(844,'','MANUAL16'),(844,'','MANUAL17'),(844,'','MANUAL18'),(844,'','MANUAL19'),(844,'','MANUAL20'),(845,'1. 고구마는 껍질을 벗긴 후 큼직하게 썰어 찜통에 찐다.','MANUAL01'),(845,'2. 다 쪄진 고구마를 체에 곱게 내린다.','MANUAL02'),(845,'3. 2에 꿀과 계피가루를 넣어 섞는다.','MANUAL03'),(845,'4. 대추는 씨를 제거한 뒤 0.5mm  마름모꼴로 자른다.','MANUAL04'),(845,'5. 고구마를 조금씩 떼어 둥글게 빚는다.','MANUAL05'),(845,'6. 호박씨와 썰어둔 대추로 꼭지를 만든다.','MANUAL06'),(845,'','MANUAL07'),(845,'','MANUAL08'),(845,'','MANUAL09'),(845,'','MANUAL10'),(845,'','MANUAL11'),(845,'','MANUAL12'),(845,'','MANUAL13'),(845,'','MANUAL14'),(845,'','MANUAL15'),(845,'','MANUAL16'),(845,'','MANUAL17'),(845,'','MANUAL18'),(845,'','MANUAL19'),(845,'','MANUAL20'),(846,'1. 오렌지는 껍질을 벗긴 뒤 잘게 썰고 사과는 껍질 째 깨끗하게 씻어서 잘게 썬다.','MANUAL01'),(846,'2. 냄비에 오렌지와 사과를 각각 넣고 설탕을 넣어 중간 불에서 타지 않도록 졸인다.','MANUAL02'),(846,'3. 졸이는 도중에 과일에서 나온 물로 질척해지면 물전분을 넣어 농도를 맞춘 뒤 차게 식힌다.','MANUAL03'),(846,'4. 식빵은 가장자리를 잘라낸 다음 밀대로 납작하게 밀어 버터를 바른다.','MANUAL04'),(846,'5. 졸인 과일을 얹고 돌돌 만 다음 양끝을 포크로 눌러 붙인다.','MANUAL05'),(846,'6. 식빵의 표면에 버터를 얇게 바르고 170℃로 예열된 오븐에 넣어 노릇하게 굽는다.','MANUAL06'),(846,'','MANUAL07'),(846,'','MANUAL08'),(846,'','MANUAL09'),(846,'','MANUAL10'),(846,'','MANUAL11'),(846,'','MANUAL12'),(846,'','MANUAL13'),(846,'','MANUAL14'),(846,'','MANUAL15'),(846,'','MANUAL16'),(846,'','MANUAL17'),(846,'','MANUAL18'),(846,'','MANUAL19'),(846,'','MANUAL20'),(847,'1. 당근과 수삼을 깨끗하게 씻는다.','MANUAL01'),(847,'2. 1을 믹서에 넣고 곱게 간다.','MANUAL02'),(847,'3. 냄비에 2를 붓고 꿀을 넣어 졸인다.','MANUAL03'),(847,'4. 계피가루를 섞는다.','MANUAL04'),(847,'5. 빵이나 크래커를 준비한다.','MANUAL05'),(847,'6. 5의 위에 수삼 당근 정과를 올린다.','MANUAL06'),(847,'','MANUAL07'),(847,'','MANUAL08'),(847,'','MANUAL09'),(847,'','MANUAL10'),(847,'','MANUAL11'),(847,'','MANUAL12'),(847,'','MANUAL13'),(847,'','MANUAL14'),(847,'','MANUAL15'),(847,'','MANUAL16'),(847,'','MANUAL17'),(847,'','MANUAL18'),(847,'','MANUAL19'),(847,'','MANUAL20'),(848,'1. 팥을 깨끗하게 씻어 물을 부어 끓인 뒤 물을 버리고 다시 찬물을 부어 삶는다.','MANUAL01'),(848,'2. 부드럽게 삶아진 팥의 물기를 제거한 후 으깬다.','MANUAL02'),(848,'3. 찹쌀가루를 둘로 나누어 하나는 쑥가루를 넣고 하나는 맨 찹쌀가루에 뜨거운 물로 익반죽 하여 경단을 만든 뒤 끓는 물에 익힌다.','MANUAL03'),(848,'4. 익힌 경단을 바로 차가운 얼음물에 담궈 식힌다.','MANUAL04'),(848,'5. 식혜에 으깬 팥을 넣고 소금 간을 한 뒤 그릇에 담아 냉동실에 얼리면서 1시간 마다 공기가 들어가도록 포크로 저어준다.','MANUAL05'),(848,'6. 샤베트가 부드럽게 얼면 준비한 그릇에 경단과 함께 담는다.','MANUAL06'),(848,'','MANUAL07'),(848,'','MANUAL08'),(848,'','MANUAL09'),(848,'','MANUAL10'),(848,'','MANUAL11'),(848,'','MANUAL12'),(848,'','MANUAL13'),(848,'','MANUAL14'),(848,'','MANUAL15'),(848,'','MANUAL16'),(848,'','MANUAL17'),(848,'','MANUAL18'),(848,'','MANUAL19'),(848,'','MANUAL20'),(849,'1. 준비된 야채들을 깨끗이 씻는다.','MANUAL01'),(849,'2. 연근, 고구마, 감자, 단호박, 당근은 0.2cm 두께로 썬다.','MANUAL02'),(849,'3. 연근, 고구마, 감자는 물에 담궈 둔다.','MANUAL03'),(849,'4. 오븐 팬에 썰어 놓은 재료를 넣고 소량의 소금을 뿌린다.','MANUAL04'),(849,'5. 130~150℃로 예열한 오븐에 4를 굽는다.','MANUAL05'),(849,'6. 구워진 야채칩을 식혀 담는다.','MANUAL06'),(849,'','MANUAL07'),(849,'','MANUAL08'),(849,'','MANUAL09'),(849,'','MANUAL10'),(849,'','MANUAL11'),(849,'','MANUAL12'),(849,'','MANUAL13'),(849,'','MANUAL14'),(849,'','MANUAL15'),(849,'','MANUAL16'),(849,'','MANUAL17'),(849,'','MANUAL18'),(849,'','MANUAL19'),(849,'','MANUAL20'),(850,'1. 검은콩, 쌀, 메밀의 튀밥을 준비한다.','MANUAL01'),(850,'2. 물엿에 설탕, 물을 넣고 약한불에서 투명하게 녹인다.','MANUAL02'),(850,'3. 오목한 팬에 2를 넣는다.','MANUAL03'),(850,'4. 3의 팬에 1을 넣고 시럽에서 실이 생길 때 까지 불 위에서 젓는다.','MANUAL04'),(850,'5. 강정이 굳기 전에 타원형 모양으로 빚거나 밀대로 밀어 편다.','MANUAL05'),(850,'6. 밀어 편 강정을 마름모 모양으로 자른다.','MANUAL06'),(850,'','MANUAL07'),(850,'','MANUAL08'),(850,'','MANUAL09'),(850,'','MANUAL10'),(850,'','MANUAL11'),(850,'','MANUAL12'),(850,'','MANUAL13'),(850,'','MANUAL14'),(850,'','MANUAL15'),(850,'','MANUAL16'),(850,'','MANUAL17'),(850,'','MANUAL18'),(850,'','MANUAL19'),(850,'','MANUAL20'),(851,'1. 잣은 고깔을 떼어낸 뒤 젖은 행주로 문질러 먼지를 닦는다.','MANUAL01'),(851,'2. 호두는 미지근한 물에 불려 껍질을 제거한다.','MANUAL02'),(851,'3. 대추는 얇게 돌려 깎아 곱게 다진다.','MANUAL03'),(851,'4. 물엿과 설탕을 냄비에 담고 물을 조금 넣은 뒤 약한불에서 투명한 시럽으로 만든다.','MANUAL04'),(851,'5. 잣, 호두, 통깨에 다진 대추와 시럽을 넣고 덩어리지게 섞는다.','MANUAL05'),(851,'6. 살짝 뜨거울 때 손으로 동그랗게 뭉쳐준다.','MANUAL06'),(851,'','MANUAL07'),(851,'','MANUAL08'),(851,'','MANUAL09'),(851,'','MANUAL10'),(851,'','MANUAL11'),(851,'','MANUAL12'),(851,'','MANUAL13'),(851,'','MANUAL14'),(851,'','MANUAL15'),(851,'','MANUAL16'),(851,'','MANUAL17'),(851,'','MANUAL18'),(851,'','MANUAL19'),(851,'','MANUAL20'),(852,'1. 팥을 깨끗하게 씻어 끓인 뒤 물을 따라 버리고 다시 물을 부어 팥이 무르게 삶는다.','MANUAL01'),(852,'2. 당근을 1cm 주사위 모양으로 자른다.','MANUAL02'),(852,'3. 1, 2에 각각 설탕을 넣고 졸인다.','MANUAL03'),(852,'4. 볼에 현미가루, 밀가루, 우유를 넣고 덩어리가 생기지 않도록 잘 갠 뒤 30분간 둔다.','MANUAL04'),(852,'5. 가열된 팬에 참기름을 두르고 약한 불에서 4를 한 국자 정도 떠서 둥글게 부친 뒤 식힌다.','MANUAL05'),(852,'6. 크레이프를 펴고 각각 팥소와 당근조림을 각각 얹은 후 둥글게 만다.','MANUAL06'),(852,'','MANUAL07'),(852,'','MANUAL08'),(852,'','MANUAL09'),(852,'','MANUAL10'),(852,'','MANUAL11'),(852,'','MANUAL12'),(852,'','MANUAL13'),(852,'','MANUAL14'),(852,'','MANUAL15'),(852,'','MANUAL16'),(852,'','MANUAL17'),(852,'','MANUAL18'),(852,'','MANUAL19'),(852,'','MANUAL20'),(853,'1. 감자를 깨끗하게 씻어 찜통에 찐 뒤 껍질을 벗기고 체에 내린다.','MANUAL01'),(853,'2. 기름 두른 팬에 다진 당근을 볶으면서 소금 간을 하고 시금치는 손질하여 데친 뒤 냉수에 헹궈 물기를 짜고 잘게 다진다.','MANUAL02'),(853,'3. 잔멸치는 팬에 살짝 볶아서 굵직하게 다진다.','MANUAL03'),(853,'4. 볼에 1, 2, 3, 4를 넣고 소금과 흰 후춧가루, 참기름을 넣고 섞는다.','MANUAL04'),(853,'5. 삶은 달걀노른자를 체에 내린다.','MANUAL05'),(853,'6. 4를 원형 또는 삼각형으로 만들어 달걀 노른자와 검은깨, 흰깨에 골고루 굴려 묻힌다.','MANUAL06'),(853,'','MANUAL07'),(853,'','MANUAL08'),(853,'','MANUAL09'),(853,'','MANUAL10'),(853,'','MANUAL11'),(853,'','MANUAL12'),(853,'','MANUAL13'),(853,'','MANUAL14'),(853,'','MANUAL15'),(853,'','MANUAL16'),(853,'','MANUAL17'),(853,'','MANUAL18'),(853,'','MANUAL19'),(853,'','MANUAL20'),(854,'1. 돼지고기는 손질한 뒤 완두콩 크기로 썬다.','MANUAL01'),(854,'2. 완두콩을 믹서에 곱게 간다.','MANUAL02'),(854,'3. 기름을 두른 팬에 1을 넣고 달라붙지 않게 볶는다.','MANUAL03'),(854,'4. 2에 3과 설탕을 넣고 끓인다.','MANUAL04'),(854,'5. 4에 소금으로 간을 한다.','MANUAL05'),(854,'6. 물전분으로 소스의 농도를 맞춘다.','MANUAL06'),(854,'','MANUAL07'),(854,'','MANUAL08'),(854,'','MANUAL09'),(854,'','MANUAL10'),(854,'','MANUAL11'),(854,'','MANUAL12'),(854,'','MANUAL13'),(854,'','MANUAL14'),(854,'','MANUAL15'),(854,'','MANUAL16'),(854,'','MANUAL17'),(854,'','MANUAL18'),(854,'','MANUAL19'),(854,'','MANUAL20'),(855,'1. 팬에 기름을 두르고 홍고추와 마늘을 향이 날 때까지 볶는다.','MANUAL01'),(855,'2. 1에 달걀물을 넣고 달걀이 부드럽게 부풀어 오르도록 기다렸다가 반 정도 익었을 때 가볍게 젓는다.','MANUAL02'),(855,'3. 2에 닭고기, 새우, 양파를 넣고 볶는다.','MANUAL03'),(855,'4. 3에 준비된 스파게티면을 넣고 한 번 볶은 뒤 소야소스를 넣고 면에 간이 충분히 베이도록 볶는다.','MANUAL04'),(855,'5. 면이 볶아지면 청경채, 방울토마토를 넣고 살짝 볶는다.','MANUAL05'),(855,'6. 5에 차갑게 한 버터를 넣어 소스에 윤기와 농도가 나도록 한다.','MANUAL06'),(855,'','MANUAL07'),(855,'','MANUAL08'),(855,'','MANUAL09'),(855,'','MANUAL10'),(855,'','MANUAL11'),(855,'','MANUAL12'),(855,'','MANUAL13'),(855,'','MANUAL14'),(855,'','MANUAL15'),(855,'','MANUAL16'),(855,'','MANUAL17'),(855,'','MANUAL18'),(855,'','MANUAL19'),(855,'','MANUAL20'),(856,'1. 돼지갈비는 4cm 길이로 준비하여 기름기를 제거하고 찬물에 담가 핏물을 뺀다.','MANUAL01'),(856,'2. 1에 굵은 소금을 넣고 주물러 갈비를 연하게 한 뒤 소금을 씻어낸다.','MANUAL02'),(856,'3. 돼지갈비에 칼집을 넣은 뒤 대파, 마늘, 생강을 넣고 끓인 물에 데쳐서 헹군다.','MANUAL03'),(856,'4. 냄비에 기름을 두르고 데쳐낸 갈비를 볶다가 양념장을 붓고 뚜껑을 덮어 서서히 익히면서 볶는다.','MANUAL04'),(856,'5. 갈비에 간이 베이면 센불에서 저어주면서 윤기 나게 볶는다.','MANUAL05'),(856,'6. 접시에 얇게 썬 토마토를 깔고 볶아낸 돼지갈비를 담은 뒤 통깨를 뿌린다.','MANUAL06'),(856,'','MANUAL07'),(856,'','MANUAL08'),(856,'','MANUAL09'),(856,'','MANUAL10'),(856,'','MANUAL11'),(856,'','MANUAL12'),(856,'','MANUAL13'),(856,'','MANUAL14'),(856,'','MANUAL15'),(856,'','MANUAL16'),(856,'','MANUAL17'),(856,'','MANUAL18'),(856,'','MANUAL19'),(856,'','MANUAL20'),(857,'1. 껍질을 벗기지 않은 사과와 반을 잘라 껍질을 벗긴 참마를 0.7cm 주사위모양으로 썬다.','MANUAL01'),(857,'2. 사과에 레몬주스, 소금을 넣고 부드러워질 때 까지 익힌 뒤 참마를 넣고 살짝 끓인다.','MANUAL02'),(857,'3. 나머지 참마는 껍질을 벗긴 뒤 토막내 두유, 물엿, 밀가루, 올리브오일과 같이 믹서에 간다.','MANUAL03'),(857,'4. 3이 퓨레 상태가 되면 약 불에서 걸쭉하게 졸인다.','MANUAL04'),(857,'5. 2에 건포도를 섞은 뒤 틀에 담고 4를 펴서 얹고 그 위에 슬라이스 아몬드와 설탕을 뿌린다.','MANUAL05'),(857,'6. 200℃로 예열한 오븐에서 표면이 노릇해 질 때 까지 약 10분 간 굽는다.','MANUAL06'),(857,'','MANUAL07'),(857,'','MANUAL08'),(857,'','MANUAL09'),(857,'','MANUAL10'),(857,'','MANUAL11'),(857,'','MANUAL12'),(857,'','MANUAL13'),(857,'','MANUAL14'),(857,'','MANUAL15'),(857,'','MANUAL16'),(857,'','MANUAL17'),(857,'','MANUAL18'),(857,'','MANUAL19'),(857,'','MANUAL20'),(858,'1. 돼지고기(등심)을 고기망치로 두드려 1cm 정도 두께로 편다.','MANUAL01'),(858,'2. 돼지등심에 소금, 후추로 간을 한다.','MANUAL02'),(858,'3. 파마산치즈, 빵가루, 건바질, 타임을 섞어 허브 빵가루를 만든다.','MANUAL03'),(858,'4. 고기에 밀가루, 달걀물, 허브 빵가루 순으로 묻힌다.','MANUAL04'),(858,'5. 가열한 팬에 기름을 두르고 커틀렛을 익힌다.','MANUAL05'),(858,'6. 커틀렛이 익으면 기름을 빼고 그릇에 담는다.','MANUAL06'),(858,'','MANUAL07'),(858,'','MANUAL08'),(858,'','MANUAL09'),(858,'','MANUAL10'),(858,'','MANUAL11'),(858,'','MANUAL12'),(858,'','MANUAL13'),(858,'','MANUAL14'),(858,'','MANUAL15'),(858,'','MANUAL16'),(858,'','MANUAL17'),(858,'','MANUAL18'),(858,'','MANUAL19'),(858,'','MANUAL20'),(859,'1. 바지락살과 새우는 소금물에 흔들어 씻어 체에 받쳐 물기를 제거한다.','MANUAL01'),(859,'2. 대파, 청, 홍고추는 송송 썰고, 마늘, 생강은 다진다.','MANUAL02'),(859,'3. 끓는 물에 칼국수 면을 삶아 냉수에 헹군 뒤 참기름으로 버무린다.','MANUAL03'),(859,'4. 멸치 육수에 분량의 재료를 넣고 간장 소스를 만든다.','MANUAL04'),(859,'5. 팬에 식용유를 두르고 다진 마늘, 생강, 고추를 넣어 볶다가 센 불에서 바지락살과 새우, 청주를 넣어 볶은 뒤 간장소스를 넣고 끓인다.','MANUAL05'),(859,'6. 5가 반정도 졸면 칼국수 면을 넣어 볶으면서 물전분으로 농도를 맞춘 뒤 송송 썬 파와 참기름을 넣고 마무리한다.','MANUAL06'),(859,'','MANUAL07'),(859,'','MANUAL08'),(859,'','MANUAL09'),(859,'','MANUAL10'),(859,'','MANUAL11'),(859,'','MANUAL12'),(859,'','MANUAL13'),(859,'','MANUAL14'),(859,'','MANUAL15'),(859,'','MANUAL16'),(859,'','MANUAL17'),(859,'','MANUAL18'),(859,'','MANUAL19'),(859,'','MANUAL20'),(860,'1. 시금치는 데친 뒤 믹서에 곱게 갈고 치자는 따뜻한 물에 불린다.','MANUAL01'),(860,'2. 곱게 간 시금치에 데쳤던 물을 넣고 가열한 뒤 찹쌀가루 절반에 조금씩 부어 익반죽 한다.','MANUAL02'),(860,'3. 남은 절반의 찹쌀가루에 가열한 치자물을 조금씩 부어 익반죽 한다.','MANUAL03'),(860,'4. 30분 간 휴지시킨 뒤 팬에 기름을 두르고 적당한 크기로 빚은 화전을 지진다.','MANUAL04'),(860,'5. 한쪽 면을 익힐 때 위에 꽃을 올린 뒤 뒤집어 살짝만 지진다.','MANUAL05'),(860,'6. 꿀과 설탕, 물을 1:2:3 비율로 섞어 끓여 시럽을 만들어 화전 위에 끼얹고 타임으로 장식한다.','MANUAL06'),(860,'','MANUAL07'),(860,'','MANUAL08'),(860,'','MANUAL09'),(860,'','MANUAL10'),(860,'','MANUAL11'),(860,'','MANUAL12'),(860,'','MANUAL13'),(860,'','MANUAL14'),(860,'','MANUAL15'),(860,'','MANUAL16'),(860,'','MANUAL17'),(860,'','MANUAL18'),(860,'','MANUAL19'),(860,'','MANUAL20'),(861,'1. 연근은 얇게 썰어 찬물에 담가 전분기를 제거한다.','MANUAL01'),(861,'2. 건새우는 곱게 갈아준다.','MANUAL02'),(861,'3. 시금치, 비트는 각각 믹서기에 갈아 즙을 준비한다.','MANUAL03'),(861,'4. 튀김가루에 새우가루와 물을 넣어 반죽을 한다.','MANUAL04'),(861,'5. 반죽에 시금치, 카레, 비트를 각각 넣어 3가지 색의 반죽을 만든다.','MANUAL05'),(861,'6. 연근에 전분가루를 묻히고 튀김옷을 입혀 바삭하게 튀겨낸다.','MANUAL06'),(861,'','MANUAL07'),(861,'','MANUAL08'),(861,'','MANUAL09'),(861,'','MANUAL10'),(861,'','MANUAL11'),(861,'','MANUAL12'),(861,'','MANUAL13'),(861,'','MANUAL14'),(861,'','MANUAL15'),(861,'','MANUAL16'),(861,'','MANUAL17'),(861,'','MANUAL18'),(861,'','MANUAL19'),(861,'','MANUAL20'),(862,'1. 볼에 튀김가루, 계란 물을 섞어 반죽을 만든 후 얼음을 넣어 차갑게 한다.','MANUAL01'),(862,'2. 깻잎, 상추, 배추는 깨끗하게 씻어 준비한다.','MANUAL02'),(862,'3. 재료를 먹기 좋은 크기로 썬다.','MANUAL03'),(862,'4. 냄비에 콩기름을 부은 후 적당한 온도가 될 때까지 가열한다.','MANUAL04'),(862,'5. 야채에 반죽을 입힌다.','MANUAL05'),(862,'6. 노릇하게 튀긴다.','MANUAL06'),(862,'','MANUAL07'),(862,'','MANUAL08'),(862,'','MANUAL09'),(862,'','MANUAL10'),(862,'','MANUAL11'),(862,'','MANUAL12'),(862,'','MANUAL13'),(862,'','MANUAL14'),(862,'','MANUAL15'),(862,'','MANUAL16'),(862,'','MANUAL17'),(862,'','MANUAL18'),(862,'','MANUAL19'),(862,'','MANUAL20'),(863,'1. 포항초는 세척하고 3cm 크기로 자른다.','MANUAL01'),(863,'2. 당근은 얇게 채 썰어주고, 사과는 껍질 채로 채 썰어 설탕물에 담가 둔다.','MANUAL02'),(863,'3. 양파와 파프리카는 작은 큐브 모양으로 썬다.','MANUAL03'),(863,'4. 저염간장, 레몬즙, 설탕, 양파, 파프리카를 넣어 오리엔탈 드레싱을 만든다.','MANUAL04'),(863,'5. 포항초에 당근과 사과를 넣어 섞어준다.','MANUAL05'),(863,'6. 샐러드에 오리엔탈 드레싱을 곁들여 제공한다.','MANUAL06'),(863,'','MANUAL07'),(863,'','MANUAL08'),(863,'','MANUAL09'),(863,'','MANUAL10'),(863,'','MANUAL11'),(863,'','MANUAL12'),(863,'','MANUAL13'),(863,'','MANUAL14'),(863,'','MANUAL15'),(863,'','MANUAL16'),(863,'','MANUAL17'),(863,'','MANUAL18'),(863,'','MANUAL19'),(863,'','MANUAL20'),(864,'1. 양파, 파프리카는 채 썰고, 레몬은 얇게 썰고, 방울토마토는 2등분한다.','MANUAL01'),(864,'2. 손질된 흰살생선에 밑간한다.','MANUAL02'),(864,'3. 종이 포일에 채 썬 양파를 깐 뒤 밑간한 생선 → 손질한 파프리카 → 레몬 → 방울토마토 순으로 올린다.','MANUAL03'),(864,'4. 대하, 바지락, 월계수잎, 타임을 올린 뒤 화이트와인과 올리브유를 뿌린다.','MANUAL04'),(864,'5. 종이 포일로 감싸고 200℃로 예열한 오븐에 15~25분간 굽는다.','MANUAL05'),(864,'','MANUAL06'),(864,'','MANUAL07'),(864,'','MANUAL08'),(864,'','MANUAL09'),(864,'','MANUAL10'),(864,'','MANUAL11'),(864,'','MANUAL12'),(864,'','MANUAL13'),(864,'','MANUAL14'),(864,'','MANUAL15'),(864,'','MANUAL16'),(864,'','MANUAL17'),(864,'','MANUAL18'),(864,'','MANUAL19'),(864,'','MANUAL20'),(865,'1. 대파는 송송 썰고, 시금치는 깨끗하게 씻어 물기를 제거한다.','MANUAL01'),(865,'2. 약한 불로 달군 팬에 올리브유를 두른 뒤 불린 병아리콩을 넣고 3분간 볶는다.','MANUAL02'),(865,'3. 물(5컵)을 부어 중간 불로 삶고, 물이 졸아들면 우유를 넣은 뒤 양이 절반이 될 때까지 졸인다.','MANUAL03'),(865,'4. 끓는 소금물(물5컵+천일염0.5Ts)에 시금치를 넣어 5분간 데치고, 찬물에 담가 헹군 뒤 물기를 꼭 짠다.','MANUAL04'),(865,'5. 믹서에 병아리콩조림, 데친 시금치, 라임즙, 백후춧가루, 넛맥가루를 넣어 곱게 갈아 마무리한다.','MANUAL05'),(865,'','MANUAL06'),(865,'','MANUAL07'),(865,'','MANUAL08'),(865,'','MANUAL09'),(865,'','MANUAL10'),(865,'','MANUAL11'),(865,'','MANUAL12'),(865,'','MANUAL13'),(865,'','MANUAL14'),(865,'','MANUAL15'),(865,'','MANUAL16'),(865,'','MANUAL17'),(865,'','MANUAL18'),(865,'','MANUAL19'),(865,'','MANUAL20'),(866,'1. 냄비에 물 1컵 반과 국멸치를 넣고 끓여 멸치국물 1컵을 낸다.','MANUAL01'),(866,'2. 매생이는 물로 서너 번 헹궈 고운체에 받쳐 물기를 제거한다.','MANUAL02'),(866,'3. 굴에 소금을 넣고 으깨지지 않도록 살살 주무른 후 물로 서너 번 헹궈 체에 받친다.','MANUAL03'),(866,'4. 파는 얇게 어슷썰고, 마늘은 다진다.','MANUAL04'),(866,'5. 멸치국물에 조랭이떡, 매생이, 굴을 넣고 끓인다.','MANUAL05'),(866,'6.  파와 다진 마늘을 넣고 한소끔 끓이고, 국간장과 소금으로 간하여 마무리한다.','MANUAL06'),(866,'','MANUAL07'),(866,'','MANUAL08'),(866,'','MANUAL09'),(866,'','MANUAL10'),(866,'','MANUAL11'),(866,'','MANUAL12'),(866,'','MANUAL13'),(866,'','MANUAL14'),(866,'','MANUAL15'),(866,'','MANUAL16'),(866,'','MANUAL17'),(866,'','MANUAL18'),(866,'','MANUAL19'),(866,'','MANUAL20'),(867,'1. 손질한 문어를 데친다.','MANUAL01'),(867,'2. 양파와 감자를 적당한 크기로 자르고 톳과 당근은 잘게 다진다.','MANUAL02'),(867,'3. 데친 문어와 양파, 감자를 믹서기에 넣고 간다.','MANUAL03'),(867,'4. 2와 3에 우리밀가루, 다진 마늘, 후춧가루를 넣고 반죽을 치대 직사각형 모양을 만든다.','MANUAL04'),(867,'5. 팬에 현미유를 두르고 4의 문어를 넣고 지진 후 꼬치에 끼운다.','MANUAL05'),(867,'6. 토마토케첩과 허니머스터드소스를 곁들인다.','MANUAL06'),(867,'','MANUAL07'),(867,'','MANUAL08'),(867,'','MANUAL09'),(867,'','MANUAL10'),(867,'','MANUAL11'),(867,'','MANUAL12'),(867,'','MANUAL13'),(867,'','MANUAL14'),(867,'','MANUAL15'),(867,'','MANUAL16'),(867,'','MANUAL17'),(867,'','MANUAL18'),(867,'','MANUAL19'),(867,'','MANUAL20'),(868,'1. 과메기는 꼬리를 잘라낸다.','MANUAL01'),(868,'2. 다진 생강과 마늘즙을 내어 손질한 과메기 위에 뿌린다.','MANUAL02'),(868,'3. 고추장, 다진 마늘, 다진 파, 매실액, 고춧가루, 후춧가루, 물을 섞어 양념장을 만든다.','MANUAL03'),(868,'4. 매실장아찌는 채썬다.','MANUAL04'),(868,'5. 팬에 과메기를 놓고 고추장양념을 발라가며 살짝 굽는다.','MANUAL05'),(868,'6. 매실장아찌를 구운 과메기위에 올려 마무리한다.','MANUAL06'),(868,'','MANUAL07'),(868,'','MANUAL08'),(868,'','MANUAL09'),(868,'','MANUAL10'),(868,'','MANUAL11'),(868,'','MANUAL12'),(868,'','MANUAL13'),(868,'','MANUAL14'),(868,'','MANUAL15'),(868,'','MANUAL16'),(868,'','MANUAL17'),(868,'','MANUAL18'),(868,'','MANUAL19'),(868,'','MANUAL20'),(869,'1. 찹쌀을 3~5시간 불린 후 물기를 제거하고 믹서기에 간다.','MANUAL01'),(869,'2. 고구마는 껍질을 벗기고 작게 썰어 찜통에 넣고 찐 후 으깬다.','MANUAL02'),(869,'3. 검정깨는 믹서기에 갈고, 호두와 땅콩은 굵게 다지고 황설탕과 찹쌀가루를 함께 섞어 호떡소를 만든다.','MANUAL03'),(869,'4. 으깬 고구마에 찹쌀가루를 넣고 반죽을 한다.','MANUAL04'),(869,'5. 4의 반죽을 동그랗게 빚어 3의 호떡소를 넣고 둥글납작하게 만든다.','MANUAL05'),(869,'6. 팬에 현미유를 두르고 호떡을 눌러가며 앞뒤로 굽는다.','MANUAL06'),(869,'','MANUAL07'),(869,'','MANUAL08'),(869,'','MANUAL09'),(869,'','MANUAL10'),(869,'','MANUAL11'),(869,'','MANUAL12'),(869,'','MANUAL13'),(869,'','MANUAL14'),(869,'','MANUAL15'),(869,'','MANUAL16'),(869,'','MANUAL17'),(869,'','MANUAL18'),(869,'','MANUAL19'),(869,'','MANUAL20'),(870,'1. 김치, 양파, 버섯은 다진다.','MANUAL01'),(870,'2. 방울토마토는 4등분한다.','MANUAL02'),(870,'3. 팬에 올리브유를 두르고 김치, 양파, 버섯, 토마토를 볶는다.','MANUAL03'),(870,'4. 밥을 넣어 볶은 뒤 간장으로 간한다.','MANUAL04'),(870,'5. 3, 4를 그릇에 담고 피자치즈를 올려 전자렌지에 치즈가 녹을 정도로 익힌다.','MANUAL05'),(870,'6. 실파를 뿌려 마무리한다.','MANUAL06'),(870,'','MANUAL07'),(870,'','MANUAL08'),(870,'','MANUAL09'),(870,'','MANUAL10'),(870,'','MANUAL11'),(870,'','MANUAL12'),(870,'','MANUAL13'),(870,'','MANUAL14'),(870,'','MANUAL15'),(870,'','MANUAL16'),(870,'','MANUAL17'),(870,'','MANUAL18'),(870,'','MANUAL19'),(870,'','MANUAL20'),(871,'1. 굴은 소금물에 흔들어 씻어 굵게 다진다.','MANUAL01'),(871,'2. 부추는 씻어 송송 썬다.','MANUAL02'),(871,'3. 누룽지에 다시마국물을 넣고 2분간 불린 뒤 끓인다.','MANUAL03'),(871,'4. 누룽지가 거의 퍼졌을 때 굴을 넣고 살짝 끓인다.','MANUAL04'),(871,'5. 죽이 퍼지면 부추를 넣고 잠시 끓인다.','MANUAL05'),(871,'6. 그릇에 담고 구운 파래김을 부스러뜨려 얹어낸다.','MANUAL06'),(871,'','MANUAL07'),(871,'','MANUAL08'),(871,'','MANUAL09'),(871,'','MANUAL10'),(871,'','MANUAL11'),(871,'','MANUAL12'),(871,'','MANUAL13'),(871,'','MANUAL14'),(871,'','MANUAL15'),(871,'','MANUAL16'),(871,'','MANUAL17'),(871,'','MANUAL18'),(871,'','MANUAL19'),(871,'','MANUAL20'),(872,'1. 콩비지를 체에 받혀 물기를 제거한다.','MANUAL01'),(872,'2. 깍두기와 새우젓을 잘게 다진다.','MANUAL02'),(872,'3. 1에 다진 돼지고기, 깍두기, 새우젓, 계란, 전분, 후추, 파, 마늘을 넣고 치댄다.','MANUAL03'),(872,'4. 치댄 반죽을 한입 크기로 동그랗게 완자를 빚는다.','MANUAL04'),(872,'5. 냄비에 멸치다시마 국물을 넣고 끓으면 완자를 넣어 거품을 걷어가며 끓인다.','MANUAL05'),(872,'6. 완자가 익어서 떠오르면 청경채, 대파, 마늘을 넣고 살짝 끓여 국간장으로 간하여 불에서 내린다.','MANUAL06'),(872,'','MANUAL07'),(872,'','MANUAL08'),(872,'','MANUAL09'),(872,'','MANUAL10'),(872,'','MANUAL11'),(872,'','MANUAL12'),(872,'','MANUAL13'),(872,'','MANUAL14'),(872,'','MANUAL15'),(872,'','MANUAL16'),(872,'','MANUAL17'),(872,'','MANUAL18'),(872,'','MANUAL19'),(872,'','MANUAL20'),(873,'1. 냄비에 물을 넣고 된장을 풀어 대파, 생강을 넣고 끓인다.','MANUAL01'),(873,'2. 물이 끓으면 돼지갈비를 넣고 5분간 삶는다.','MANUAL02'),(873,'3. 백김치는 5cm 길이로 자른다.','MANUAL03'),(873,'4. 적포도주를 냄비에 넣고 불에 올려 알코올을 날려준 뒤 김치, 맛술, 꿀을 넣고 맛이 배도록 졸인다.','MANUAL04'),(873,'5. 삶아 낸 등갈비에 소금을 뿌리고 올리브유를 발라 팬에 구워낸다.','MANUAL05'),(873,'6. 구운 갈비에 백김치 와인조림을 곁들여 낸다.','MANUAL06'),(873,'','MANUAL07'),(873,'','MANUAL08'),(873,'','MANUAL09'),(873,'','MANUAL10'),(873,'','MANUAL11'),(873,'','MANUAL12'),(873,'','MANUAL13'),(873,'','MANUAL14'),(873,'','MANUAL15'),(873,'','MANUAL16'),(873,'','MANUAL17'),(873,'','MANUAL18'),(873,'','MANUAL19'),(873,'','MANUAL20'),(874,'1. 오징어는 다리를 떼 내서 내장과 눈을 제거하고, 데친 취나물은 물기를 짜내고 다진다.','MANUAL01'),(874,'2. 오곡밥에 다진 취나물, 간장, 마늘, 후추, 참기름을 넣어 고루 섞는다.','MANUAL02'),(874,'3. 오징어 몸통에 양념한 밥을 넣어 이쑤시개로 끝을 고정시킨다.','MANUAL03'),(874,'4. 김이 오른 찜통에 오징어를 넣고 3분간 쪄낸다.','MANUAL04'),(874,'5. 소스 재료를 섞어 취나물된장소스를 만든다.','MANUAL05'),(874,'6. 쪄낸 오징어순대를 썰어 접시에 담고 소스를 곁들여 낸다.','MANUAL06'),(874,'','MANUAL07'),(874,'','MANUAL08'),(874,'','MANUAL09'),(874,'','MANUAL10'),(874,'','MANUAL11'),(874,'','MANUAL12'),(874,'','MANUAL13'),(874,'','MANUAL14'),(874,'','MANUAL15'),(874,'','MANUAL16'),(874,'','MANUAL17'),(874,'','MANUAL18'),(874,'','MANUAL19'),(874,'','MANUAL20'),(875,'1. 코다리는 배를 갈라 길이로 2등분하여 뼈를 제거한다.','MANUAL01'),(875,'2. 손질한 코다리를 반으로 잘라 안쪽에 누룽지 가루를 묻힌다.','MANUAL02'),(875,'3. 분량의 재료를 섞어 양념장을 만든다.','MANUAL03'),(875,'4. 팬에 기름을 두르고 코다리를 굽는다.','MANUAL04'),(875,'5. 코다리에 양념장을 발라 다시 한번 살짝 굽는다.','MANUAL05'),(875,'6. 다진 홍고추와 실파를 뿌려 마무리한다.','MANUAL06'),(875,'','MANUAL07'),(875,'','MANUAL08'),(875,'','MANUAL09'),(875,'','MANUAL10'),(875,'','MANUAL11'),(875,'','MANUAL12'),(875,'','MANUAL13'),(875,'','MANUAL14'),(875,'','MANUAL15'),(875,'','MANUAL16'),(875,'','MANUAL17'),(875,'','MANUAL18'),(875,'','MANUAL19'),(875,'','MANUAL20'),(876,'1. 대구살에 소금, 흰후추를 뿌려 밑간 한 뒤 찹쌀가루를 가볍게 묻힌다. (a)','MANUAL01'),(876,'2. 버섯과 마늘을 얇게 썬다. (b)','MANUAL02'),(876,'3. 팬에 기름을 두르고 마늘을 볶아 향을 낸 뒤 마늘은 따로 건져두고 버섯을 굽는다. (c)','MANUAL03'),(876,'4. 팬에 기름을 두르고 1을 앞뒤로 노릇하게 굽는다. (d)','MANUAL04'),(876,'5. 분량의 재료를 섞어 소스를 만든다.','MANUAL05'),(876,'6. 접시에 대구, 버섯, 마늘을 켜켜이 담아 소스를 뿌리고 베이비채소를 곁들여 낸다.','MANUAL06'),(876,'','MANUAL07'),(876,'','MANUAL08'),(876,'','MANUAL09'),(876,'','MANUAL10'),(876,'','MANUAL11'),(876,'','MANUAL12'),(876,'','MANUAL13'),(876,'','MANUAL14'),(876,'','MANUAL15'),(876,'','MANUAL16'),(876,'','MANUAL17'),(876,'','MANUAL18'),(876,'','MANUAL19'),(876,'','MANUAL20'),(877,'1. 멸치를 마른팬에 넣고 볶는다.','MANUAL01'),(877,'2. 살짝 볶아낸 멸치에 올리브유와 맛술을 넣고 부드러워질 때까지 볶는다.','MANUAL02'),(877,'3. 땅콩을 찬물에 20분 담갔다 체에 건져 물기를 뺀다.','MANUAL03'),(877,'4. 건고추는 송송 썬다.','MANUAL04'),(877,'5. 팬에 올리브유, 참기름, 콩기름을 섞어 두르고 다진 마늘을 넣어 향을 낸 후 땅콩과 고추를 넣어 볶는다.','MANUAL05'),(877,'6. 볶은 멸치와 굴소스, 두반장, 물엿을 넣고 고루 섞은 다음 통깨를 뿌려낸다.','MANUAL06'),(877,'','MANUAL07'),(877,'','MANUAL08'),(877,'','MANUAL09'),(877,'','MANUAL10'),(877,'','MANUAL11'),(877,'','MANUAL12'),(877,'','MANUAL13'),(877,'','MANUAL14'),(877,'','MANUAL15'),(877,'','MANUAL16'),(877,'','MANUAL17'),(877,'','MANUAL18'),(877,'','MANUAL19'),(877,'','MANUAL20'),(878,'1. 맛살을 잘게 다져 마요네즈와 소금을 넣고 버무린다.','MANUAL01'),(878,'2. 오이는 다져서 소금을 뿌려 놓았다가 면보에 짜서 수분을 제거한 뒤 마요네즈에 버무린다.','MANUAL02'),(878,'3. 밥에 소금을 넣어 버무린다.','MANUAL03'),(878,'4. 네모난 플라스틱 통에 랩을 깐다.','MANUAL04'),(878,'5. 4에 밥, 치즈, 밥, 오이나 맛살, 밥 순서로 얹어 꼭꼭 누른다.','MANUAL05'),(878,'6. 랩을 통째로 꺼내 칼로 조심스럽게 썰어 검은깨로 장식한다.','MANUAL06'),(878,'','MANUAL07'),(878,'','MANUAL08'),(878,'','MANUAL09'),(878,'','MANUAL10'),(878,'','MANUAL11'),(878,'','MANUAL12'),(878,'','MANUAL13'),(878,'','MANUAL14'),(878,'','MANUAL15'),(878,'','MANUAL16'),(878,'','MANUAL17'),(878,'','MANUAL18'),(878,'','MANUAL19'),(878,'','MANUAL20'),(879,'1. 가지에 세로로 칼집을 넣어 소금을 뿌린다.','MANUAL01'),(879,'2. 표고버섯, 느타리버섯은 채 썰고 새송이버섯은 세로로 자른다.','MANUAL02'),(879,'3. 돼지고기를 곱게 다진 뒤 볶는다.','MANUAL03'),(879,'4. 팬에 버터를 넣어 녹으면 밀가루를 넣고 볶아서 루를 만든 뒤 우유를 넣어 화이트소스를 만든다.','MANUAL04'),(879,'5. 오븐용기에 화이트소스를 깔고 그 위에 가지를 올린 뒤 가지 사이에 버섯, 토마토소스, 화이트소스, 버섯을 넣는다.','MANUAL05'),(879,'6. 남은 화이트소스와 치즈, 빵가루 순으로 얹고 180℃로 예열된 오븐에서 윗면이 노릇한 색이 나도록 굽는다.','MANUAL06'),(879,'','MANUAL07'),(879,'','MANUAL08'),(879,'','MANUAL09'),(879,'','MANUAL10'),(879,'','MANUAL11'),(879,'','MANUAL12'),(879,'','MANUAL13'),(879,'','MANUAL14'),(879,'','MANUAL15'),(879,'','MANUAL16'),(879,'','MANUAL17'),(879,'','MANUAL18'),(879,'','MANUAL19'),(879,'','MANUAL20'),(880,'1. 흰 살 생선을 얇게 포를 떠서 소금과 흰 후춧가루로 밑간을 한 뒤 생선살의 물기를 제거한다.','MANUAL01'),(880,'2. 죽순은 5cm 길이로 채 썬 뒤 끓는 물에 데쳐 소금과 참기름으로 무치고 청, 홍피망은 같은 길이로 채썰어 팬에 볶으면서 소금 간 한다.','MANUAL02'),(880,'3. 건 표고버섯을 불려서 얇게 포를 떠 채 썬 뒤 소금과 참기름으로 무쳐서 볶고 슬라이스 치즈도 같은 길이로 채 썬다.','MANUAL03'),(880,'4. 1의 생선살을 2장씩 겹쳐 놓고 전분을 위에 뿌려 준비한 속 재료를 올려 돌돌 말아준 뒤 겉면에서 전분을 묻혀 찜통에서 8분간 찐다.','MANUAL04'),(880,'5. 믹서에 잣과 물, 설탕, 소금, 레몬즙, 간장을 넣고 뽀얗게 즙이 나도록 소스를 만든다.','MANUAL05'),(880,'6. 완성된 찜에 소스를 곁들여 낸다.','MANUAL06'),(880,'','MANUAL07'),(880,'','MANUAL08'),(880,'','MANUAL09'),(880,'','MANUAL10'),(880,'','MANUAL11'),(880,'','MANUAL12'),(880,'','MANUAL13'),(880,'','MANUAL14'),(880,'','MANUAL15'),(880,'','MANUAL16'),(880,'','MANUAL17'),(880,'','MANUAL18'),(880,'','MANUAL19'),(880,'','MANUAL20'),(881,'1. 소고기는 살코기로 손바닥 크기로 얇게 저며 양념에 재운다.','MANUAL01'),(881,'2. 당근과 양파는 채 썰어 팬에 볶으면서 소금으로 간한다.','MANUAL02'),(881,'3. 오이피클은 물기를 제거하여 채 썰고 깻잎은 깨끗이 씻어 물기를 뺀다.','MANUAL03'),(881,'4. 밥을 고슬고슬하게 지어 밑간을 하고 준비한 당근과 양파, 오이피클을 넣고 잘 섞어 한 입 크기로 뭉쳐 놓는다.','MANUAL04'),(881,'5. 밑간한 소고기를 넓게 펴고 전분을 뿌린 뒤 깻잎을 깔고 준비한 밥을 올려 싼다.','MANUAL05'),(881,'6. 팬에 식용유를 두르고 말아놓은 쌈밥을 굴려가며 소고기가 익을 때 까지 익힌다.','MANUAL06'),(881,'','MANUAL07'),(881,'','MANUAL08'),(881,'','MANUAL09'),(881,'','MANUAL10'),(881,'','MANUAL11'),(881,'','MANUAL12'),(881,'','MANUAL13'),(881,'','MANUAL14'),(881,'','MANUAL15'),(881,'','MANUAL16'),(881,'','MANUAL17'),(881,'','MANUAL18'),(881,'','MANUAL19'),(881,'','MANUAL20'),(882,'1. 소고기등심에 소금, 후추로 간하고 팬에서 기호에 따라 굽는다. (스테이크 굽기 정도는 기호에 따라 조절한다.)','MANUAL01'),(882,'2. 양파는 얇게 링으로 썰고 로메인은 적당한 크기로 찢고 래디쉬도 얇게 썰어 찬 물에 담궈둔다.','MANUAL02'),(882,'3. 발사믹 식초에 올리브오일, 소금, 후추를 넣고 소스를 만든다. (기호에 따라 양파 다진 것 등을 첨가할 수 있다.)','MANUAL03'),(882,'4. 2를 건져내 물기를 제거하고 소금, 후추로 간을 한다.','MANUAL04'),(882,'5. 스테이크를 슬라이스 하여 접시에 앞 쪽에 담는다.','MANUAL05'),(882,'6. 준비된 야채에 드래싱을 넣고 섞은 뒤 스테이크 옆에 담는다.','MANUAL06'),(882,'','MANUAL07'),(882,'','MANUAL08'),(882,'','MANUAL09'),(882,'','MANUAL10'),(882,'','MANUAL11'),(882,'','MANUAL12'),(882,'','MANUAL13'),(882,'','MANUAL14'),(882,'','MANUAL15'),(882,'','MANUAL16'),(882,'','MANUAL17'),(882,'','MANUAL18'),(882,'','MANUAL19'),(882,'','MANUAL20'),(883,'1. 쌀을 깨끗이 씻어 5시간 정도 불린다.','MANUAL01'),(883,'2. 불린 쌀을 절구에 넣어 쌀알이 반 정도 부서지도록 간다.','MANUAL02'),(883,'3. 참깨, 아몬드, 땅콩, 호박씨를 믹서기에 간다.','MANUAL03'),(883,'4. 냄비에 쌀과 물을 넣고 끓인다.','MANUAL04'),(883,'5. 쌀알이 익으면 3의 씨앗가루를 넣고 끓인다.','MANUAL05'),(883,'6. 소금간을 하고 준비한 그릇에 담아낸다.','MANUAL06'),(883,'','MANUAL07'),(883,'','MANUAL08'),(883,'','MANUAL09'),(883,'','MANUAL10'),(883,'','MANUAL11'),(883,'','MANUAL12'),(883,'','MANUAL13'),(883,'','MANUAL14'),(883,'','MANUAL15'),(883,'','MANUAL16'),(883,'','MANUAL17'),(883,'','MANUAL18'),(883,'','MANUAL19'),(883,'','MANUAL20'),(884,'1. 또띠아는 6등분 한다.','MANUAL01'),(884,'2. 양파, 할라피뇨, 마늘을 잘게 다진다.','MANUAL02'),(884,'3. 아보카도는 껍질을 제거하고 토마토는 씨를 제거하여 각각 1cm 주사위모양으로 자른다.','MANUAL03'),(884,'4. 170℃로 예열한 오븐에 또띠아를 넣어 바삭하게 굽는다.','MANUAL04'),(884,'5. 볼에 2를 넣고 잘 섞어 페이스트를 만들다가 아보카도를 함께 넣고 으깬 후 토마토를 넣고 라임주스, 소금으로 맛을 낸다.','MANUAL05'),(884,'6. 구워 낸 또띠아 칩을 찍어 먹을 수 있도록 아보카도딥을 작은 그릇에 담아낸다.','MANUAL06'),(884,'','MANUAL07'),(884,'','MANUAL08'),(884,'','MANUAL09'),(884,'','MANUAL10'),(884,'','MANUAL11'),(884,'','MANUAL12'),(884,'','MANUAL13'),(884,'','MANUAL14'),(884,'','MANUAL15'),(884,'','MANUAL16'),(884,'','MANUAL17'),(884,'','MANUAL18'),(884,'','MANUAL19'),(884,'','MANUAL20'),(885,'1. 소고기는 소금, 후추로 밑간을 하고 실파는 송송 썬다.','MANUAL01'),(885,'2. 참치는 기름을 제거하고 양파, 셀러리, 마요네즈, 소금, 후추, 설탕을 넣고 양념한다.','MANUAL02'),(885,'3. 상추는 작게 다듬어 얼음물에 담근다.','MANUAL03'),(885,'4. 팬에 기름을 두르고 다진 마늘을 넣고 볶다가 밑간한 소고기를 넣고 볶는다.','MANUAL04'),(885,'5. 4에 기호에 맞게 참기름과 실파를 넣는다.','MANUAL05'),(885,'6. 물기를 제거한 상추에 밥 한 숟가락을 놓고 볶은 소고기, 참치, 마요네즈, 소스 순으로 얹는다.','MANUAL06'),(885,'','MANUAL07'),(885,'','MANUAL08'),(885,'','MANUAL09'),(885,'','MANUAL10'),(885,'','MANUAL11'),(885,'','MANUAL12'),(885,'','MANUAL13'),(885,'','MANUAL14'),(885,'','MANUAL15'),(885,'','MANUAL16'),(885,'','MANUAL17'),(885,'','MANUAL18'),(885,'','MANUAL19'),(885,'','MANUAL20'),(886,'1. 닭가슴살과 소고기안심을 먹기 좋은 크기로 자른다.','MANUAL01'),(886,'2. 간장, 카레가루, 땅콩버서, 참기름, 올리브오일, 설탕, 다진 생강을 섞어 소스를 만든다.','MANUAL02'),(886,'3. 꼬치에 1을 번갈아 끼운다.','MANUAL03'),(886,'4. 고기를 끼운 꼬치에 2의 소스를 바른다.','MANUAL04'),(886,'5. 오븐을 176℃로 예열한다.','MANUAL05'),(886,'6. 예열된 오븐에 소스를 바른 꼬치를 구워준다.','MANUAL06'),(886,'','MANUAL07'),(886,'','MANUAL08'),(886,'','MANUAL09'),(886,'','MANUAL10'),(886,'','MANUAL11'),(886,'','MANUAL12'),(886,'','MANUAL13'),(886,'','MANUAL14'),(886,'','MANUAL15'),(886,'','MANUAL16'),(886,'','MANUAL17'),(886,'','MANUAL18'),(886,'','MANUAL19'),(886,'','MANUAL20'),(887,'1. 닭가슴살에 소금, 후추로 간을 한다.','MANUAL01'),(887,'2. 팬에 기름을 두르고 닭가슴살을 굽는다.','MANUAL02'),(887,'3. 구워 낸 닭가슴살을 다져서 볼에 담는다.','MANUAL03'),(887,'4. 올리브오일, 카레가루, 레몬주스, 건포도, 아몬드, 마요네즈를 3에 넣고 섞는다.','MANUAL04'),(887,'5. 식빵을 팬에 바삭하게 굽는다.','MANUAL05'),(887,'6. 식빵에 치킨 샐러드를 얹은 뒤 남은 식빵으로 덮고, 사방을 잘라낸다.','MANUAL06'),(887,'','