. 손질한 멍게에 참기름을 넣어 가볍게 버무린다.','MANUAL05'),(894,'6. 그릇에 밥을 담고 부추, 무순, 멍게, 김, 통깨를 올리고 양념장을 넣어 비벼 먹는다.','MANUAL06'),(894,'','MANUAL07'),(894,'','MANUAL08'),(894,'','MANUAL09'),(894,'','MANUAL10'),(894,'','MANUAL11'),(894,'','MANUAL12'),(894,'','MANUAL13'),(894,'','MANUAL14'),(894,'','MANUAL15'),(894,'','MANUAL16'),(894,'','MANUAL17'),(894,'','MANUAL18'),(894,'','MANUAL19'),(894,'','MANUAL20'),(895,'1. 냄비에 물, 건다시마, 대파를 넣고 약불에서 30분간 맛이 우러나게 끓인다.','MANUAL01'),(895,'2. 체에 걸러 다시마 국물을 만든다.','MANUAL02'),(895,'3. 키조개 관자를 얇게 자른다.','MANUAL03'),(895,'4. 당근은 껍질을 벗기고 채소와 버섯은 깨끗이 씻어 한입 크기로 자른다.','MANUAL04'),(895,'5. 소스 재료를 냄비에 넣고 약불에서 5분간 끓여 양념장을 만든다.','MANUAL05'),(895,'6. 샤브샤브 냄비에 1을 넣고 끓으면 키조개 관자, 채소, 버섯을 넣고 살짝 익혀 소스에 찍어 먹는다.','MANUAL06'),(895,'','MANUAL07'),(895,'','MANUAL08'),(895,'','MANUAL09'),(895,'','MANUAL10'),(895,'','MANUAL11'),(895,'','MANUAL12'),(895,'','MANUAL13'),(895,'','MANUAL14'),(895,'','MANUAL15'),(895,'','MANUAL16'),(895,'','MANUAL17'),(895,'','MANUAL18'),(895,'','MANUAL19'),(895,'','MANUAL20'),(896,'1. 가자미는 비늘, 내장, 지느러미를 제거하고 3등분 한다.','MANUAL01'),(896,'2. 물에 된장을 풀어 끓인다.','MANUAL02'),(896,'3. 가자미와 모시조개를 넣고 20분 더 끓인다.','MANUAL03'),(896,'4. 쑥을 넣고 5분간 팔팔 끓인다.','MANUAL04'),(896,'5. 대파와 들깨가루를 넣어 살짝 끓여낸다.','MANUAL05'),(896,'6. 그릇에 가자미, 쑥을 우선 담고 국믈을 곁에 부어주며 담아낸다.','MANUAL06'),(896,'','MANUAL07'),(896,'','MANUAL08'),(896,'','MANUAL09'),(896,'','MANUAL10'),(896,'','MANUAL11'),(896,'','MANUAL12'),(896,'','MANUAL13'),(896,'','MANUAL14'),(896,'','MANUAL15'),(896,'','MANUAL16'),(896,'','MANUAL17'),(896,'','MANUAL18'),(896,'','MANUAL19'),(896,'','MANUAL20'),(897,'1. 달래를 3cm 길이로 썬다.','MANUAL01'),(897,'2. 양념장 재료를 모두 섞어 양념장을 만든다.','MANUAL02'),(897,'3. 소고기에 달래와 양념장을 넣고 간이 배도록 잘 주무른다.','MANUAL03'),(897,'4. 기름 두른 팬에 양념한 고기를 한 덩이씩 떼서 모양을 잡아준다.','MANUAL04'),(897,'5. 뭉친 고기는 앞뒤로 고루 익혀낸다.','MANUAL05'),(897,'6. 그릇에 담아 마무리 한다.','MANUAL06'),(897,'','MANUAL07'),(897,'','MANUAL08'),(897,'','MANUAL09'),(897,'','MANUAL10'),(897,'','MANUAL11'),(897,'','MANUAL12'),(897,'','MANUAL13'),(897,'','MAN