어 양념장을 준비한다.','MANUAL04'),(901,'5. 볼에 취나물을 담고 양념장을 넣어 조물조물 무쳐낸다.','MANUAL05'),(901,'6. 무쳐낸 나물을 그릇에 담아 마무리한다.','MANUAL06'),(901,'','MANUAL07'),(901,'','MANUAL08'),(901,'','MANUAL09'),(901,'','MANUAL10'),(901,'','MANUAL11'),(901,'','MANUAL12'),(901,'','MANUAL13'),(901,'','MANUAL14'),(901,'','MANUAL15'),(901,'','MANUAL16'),(901,'','MANUAL17'),(901,'','MANUAL18'),(901,'','MANUAL19'),(901,'','MANUAL20'),(902,'1. 재료를 깨끗이 씻어낸다.','MANUAL01'),(902,'2. 토마토는 끝이 떨어지지 않게 6등분 한다.','MANUAL02'),(902,'3. 영양부추는 1cm 길이로 썬다.','MANUAL03'),(902,'4. 적양파는 곱게 채 썬다.','MANUAL04'),(902,'5. 영양부추와 적양파에 양념을 넣고 버무려 소를 만든다.','MANUAL05'),(902,'6. 토마토에 소를 넣어 30분 정도 냉장고에 두었다가 먹는다.','MANUAL06'),(902,'','MANUAL07'),(902,'','MANUAL08'),(902,'','MANUAL09'),(902,'','MANUAL10'),(902,'','MANUAL11'),(902,'','MANUAL12'),(902,'','MANUAL13'),(902,'','MANUAL14'),(902,'','MANUAL15'),(902,'','MANUAL16'),(902,'','MANUAL17'),(902,'','MANUAL18'),(902,'','MANUAL19'),(902,'','MANUAL20'),(903,'1. 풋마늘을 깨끗이 씻어 5cm 길이로 썬다.','MANUAL01'),(903,'2. 물에 풋마늘을 30분 정도 담가 매운맛을 뺀다.','MANUAL02'),(903,'3. 오징어를 1cm x 5cm 크기로 썬다.','MANUAL03'),(903,'4. 밀가루와 물을 섞어 약불에서 풀을 쑤어 차게 식힌다.','MANUAL04'),(903,'5. 풀에 나머지 양념장 재료를 모두 넣어 섞는다.','MANUAL05'),(903,'6. 풋마늘과 오징어에 양념장을 넣고 버무려 즉석에서 먹거나 살짝 익혀 먹는다.','MANUAL06'),(903,'','MANUAL07'),(903,'','MANUAL08'),(903,'','MANUAL09'),(903,'','MANUAL10'),(903,'','MANUAL11'),(903,'','MANUAL12'),(903,'','MANUAL13'),(903,'','MANUAL14'),(903,'','MANUAL15'),(903,'','MANUAL16'),(903,'','MANUAL17'),(903,'','MANUAL18'),(903,'','MANUAL19'),(903,'','MANUAL20'),(904,'1. 거피녹두를 깨끗이 씻는다.','MANUAL01'),(904,'2. 씻은 녹두에 물을 넣고 푹 삶아낸다.','MANUAL02'),(904,'3. 삶아 낸 녹두를 체에 밭쳐 물기를 제거하고 으깬다.','MANUAL03'),(904,'4. 마른 팬에 녹두 소를 넣어 살짝 볶아 수분을 날린 다음 설탕, 소금으로 간한다.','MANUAL04'),(904,'5. 절편을 5cm 길이로 잘라 밀대로 얇게 민다.','MANUAL05'),(904,'6. 절편에 녹두소와 호두를 넣고 돌돌 말아 진달래를 붙인다.','MANUAL06'),(904,'','MANUAL07'),(904,'','MANUAL08'),(904,'','MANUAL09'),(904,'','MANUAL10'),(904,'','MANUAL11'),(904,'','MANUAL12'),(904,'','MANUAL13'),(904,'','MANUAL14'),(904,'','MANUAL15'),(904,'','MANUAL16'),(904,'','MANUAL17'),(904,'','MANUAL18'),(904,'','MANUAL19'),(904,'','MANUAL20'),(905,'1. 가지를 깨끗하게 씻는다.','MANUAL01'),(905,'2. 가지를 1x1x4cm 크기로 자른다.','MANUAL02'),(905,'3. 생강을 곱게 다진다.','MANUAL03'),(905,'4. 다진 생강과 고추장, 물엿, 통깨를 섞어 양념장을 만든다.','MANUAL04'),(905,'5. 팬에 들기름을 넣고 센불에서 가지를 볶는다.','MANUAL05'),(905,'6. 가지가 다 볶아지면 양념장을 넣고 섞일 정도로만 볶는다.','MANUAL06'),(905,'','MANUAL07'),(905,'','MANUAL08'),(905,'','MANUAL09'),(905,'','MANUAL10'),(905,'','MANUAL11'),(905,'','MANUAL12'),(905,'','MANUAL13'),(905,'','MANUAL14'),(905,'','MANUAL15'),(905,'','MANUAL16'),(905,'','MANUAL17'),(905,'','MANUAL18'),(905,'','MANUAL19'),(905,'','MANUAL20'),(906,'1. 고등어는 머리를 자른 뒤 내장을 빼고 잘 씻어 물기를 제거한다.','MANUAL01'),(906,'2. 1의 살만 포를 떠서 한입 크기로 자른 뒤 청주, 생강즙, 소금, 후춧가루를 뿌려 밑간 한다.','MANUAL02'),(906,'3. 전분을 앞, 뒤로 묻혀 170℃ 튀김 기름에 2번 바삭하게 튀긴다.','MANUAL03'),(906,'4. 땅콩은 껍질을 벗긴 뒤 비닐봉지에 담아 밀대로 찧어 굵게 다진다.','MANUAL04'),(906,'5. 냄비에 간장, 고추장, 설탕, 물엿을 넣고 끓여 조림장을 만든다.','MANUAL05'),(906,'6. 조림장이 반으로 졸아들면 튀긴 고등어와 땅콩을 넣고 살살 뒤집어가며 윤기나게 버무린다.','MANUAL06'),(906,'','MANUAL07'),(906,'','MANUAL08'),(906,'','MANUAL09'),(906,'','MANUAL10'),(906,'','MANUAL11'),(906,'','MANUAL12'),(906,'','MANUAL13'),(906,'','MANUAL14'),(906,'','MANUAL15'),(906,'','MANUAL16'),(906,'','MANUAL17'),(906,'','MANUAL18'),(906,'','MANUAL19'),(906,'','MANUAL20'),(907,'1. 솔을 이용해 게를 깨끗이 씻어 물기를 뺀 뒤 등딱지를 떼고 먹기 좋은 크기로 토막내 소금, 후춧가루, 청주로 밑간 한다.','MANUAL01'),(907,'2. 전분을 묻힌 뒤 찜통에 찐다.','MANUAL02'),(907,'3. 마늘, 생강은 얇게 편썰고 실파는 3cm 길이로 썰고 건 고추는 어슷하게 썬다.','MANUAL03'),(907,'4. 팬에 기름을 두르고 마늘, 생강, 건고추를 넣고 볶는다.','MANUAL04'),(907,'5. 매콤한 향이 나면 양념장을 넣고 살짝 볶으면서 찐 게를 넣어 맛이 베이도록 뒤적이며 볶는다.','MANUAL05'),(907,'6. 마지막에 실파를 넣고 참기름으로 향을 낸다.','MANUAL06'),(907,'','MANUAL07'),(907,'','MANUAL08'),(907,'','MANUAL09'),(907,'','MANUAL10'),(907,'','MANUAL11'),(907,'','MANUAL12'),(907,'','MANUAL13'),(907,'','MANUAL14'),(907,'','MANUAL15'),(907,'','MANUAL16'),(907,'','MANUAL17'),(907,'','MANUAL18'),(907,'','MANUAL19'),(907,'','MANUAL20'),(908,'1. 다시마를 젖은 행주로 깨끗하게 닦는다.','MANUAL01'),(908,'2. 다시마를 4x5cm 크기로 자른다.','MANUAL02'),(908,'3. 자른 다시마를 파이팬에 올린다.','MANUAL03'),(908,'4. 예열된 오븐에서 다시마를 굽는다.','MANUAL04'),(908,'5. 구운 다시마에 꿀을 묻힌다.','MANUAL05'),(908,'6. 참깨나 오트밀을 묻힌다.','MANUAL06'),(908,'','MANUAL07'),(908,'','MANUAL08'),(908,'','MANUAL09'),(908,'','MANUAL10'),(908,'','MANUAL11'),(908,'','MANUAL12'),(908,'','MANUAL13'),(908,'','MANUAL14'),(908,'','MANUAL15'),(908,'','MANUAL16'),(908,'','MANUAL17'),(908,'','MANUAL18'),(908,'','MANUAL19'),(908,'','MANUAL20'),(909,'1. 브로콜리는 소금물에 담궜다가 씻는다.','MANUAL01'),(909,'2. 브로콜리를 작은 송이로 자른 뒤 기름, 소금을 넣은 물에 데쳐 찬물에 헹군다.','MANUAL02'),(909,'3. 생강과 당근, 마늘, 소고기를 얇게 슬라이스 한다.','MANUAL03'),(909,'4. 소고기를 밑간 한 뒤 10분 정도 재웠다가 기름을 두르고 살짝 익힌다.','MANUAL04'),(909,'5. 마늘, 생강, 당근, 익혀둔 소고기를 팬에 넣고 브로콜리를 넣어 볶는다.','MANUAL05'),(909,'6. 물 전분을 이용해 소스의 농도를 맞춘다.','MANUAL06'),(909,'','MANUAL07'),(909,'','MANUAL08'),(909,'','MANUAL09'),(909,'','MANUAL10'),(909,'','MANUAL11'),(909,'','MANUAL12'),(909,'','MANUAL13'),(909,'','MANUAL14'),(909,'','MANUAL15'),(909,'','MANUAL16'),(909,'','MANUAL17'),(909,'','MANUAL18'),(909,'','MANUAL19'),(909,'','MANUAL20'),(910,'1. 새우살을 다져서 양념한다.','MANUAL01'),(910,'2. 두부는 4x3cm로 썰어 한 쪽 면은 속을 파내고 간이 된 새우살을 채운 뒤 전분을 묻혀 지진다.','MANUAL02'),(910,'3. 당근, 양파, 돼지호박은 1.5x1.5x0.2cm 크기로 썬다.','MANUAL03'),(910,'4. 팬에 참기름을 두르고 3을 타지 않도록 잘 볶은 뒤 생강, 다진 마늘을 넣고 볶다가 닭육수를 넣어 끓인다.','MANUAL04'),(910,'5. 육수에 간장과 굴소스로 간을 맞춘다.','MANUAL05'),(910,'6. 그릇에 지져낸 새우살을 채운 두부를 넣고 끓인 미네스트로네를 담는다.','MANUAL06'),(910,'','MANUAL07'),(910,'','MANUAL08'),(910,'','MANUAL09'),(910,'','MANUAL10'),(910,'','MANUAL11'),(910,'','MANUAL12'),(910,'','MANUAL13'),(910,'','MANUAL14'),(910,'','MANUAL15'),(910,'','MANUAL16'),(910,'','MANUAL17'),(910,'','MANUAL18'),(910,'','MANUAL19'),(910,'','MANUAL20'),(911,'1. 상추 잎을 떼내어 잘 씻은 다음 물기를 제거하고 적당한 크기로 잘라 냉장고에서 보관한다.','MANUAL01'),(911,'2. 크루통을 만들고 서빙하기 전까지 따로 보관한다.','MANUAL02'),(911,'3. 마늘, 앤초비, 소금, 후추를 넣고 페이스트를 만든 뒤 달걀 노른자, 레몬주스를 넣고 섞는다.','MANUAL03'),(911,'4. 3에 올리브오일을 넣어 진한 농도가 나도록 한 뒤 파마산치즈를 넣고 상추를 넣어 잘 섞는다.','MANUAL04'),(911,'5. 도미살을 손가락 길이로 썰어 소금, 후추로 간을 하고 밀가루, 달걀물, 빵가루 순으로 묻혀 170℃ 정도의 기름에서 튀긴다.','MANUAL05'),(911,'6. 차가운 접시에 4, 5를 담고 크루통을 뿌린다.','MANUAL06'),(911,'','MANUAL07'),(911,'','MANUAL08'),(911,'','MANUAL09'),(911,'','MANUAL10'),(911,'','MANUAL11'),(911,'','MANUAL12'),(911,'','MANUAL13'),(911,'','MANUAL14'),(911,'','MANUAL15'),(911,'','MANUAL16'),(911,'','MANUAL17'),(911,'','MANUAL18'),(911,'','MANUAL19'),(911,'','MANUAL20'),(912,'1. 무순의 잡티를 제거한 뒤 물에 흔들어 씻어 물기를 뺀다.','MANUAL01'),(912,'2. 연두부는 적당한 크기로 나눈다.','MANUAL02'),(912,'3. 다시마 육수에 분량의 재료를 섞어 냉국 국물을 만든 뒤 냉장고에 넣어 차갑게 만든다.','MANUAL03'),(912,'4. 청, 홍고추, 대파는 2cm 길이로 곱게 채 썬다.','MANUAL04'),(912,'5. 냉국 그릇에 2의 연두부를 담고 무순, 채썬 대파, 청, 홍고추를 가지런히 올린다.','MANUAL05'),(912,'6. 5의 연두부에 차게 준비한 냉국 국물을 붓고 쑥갓을 얹은 뒤 통깨를 뿌린다.','MANUAL06'),(912,'','MANUAL07'),(912,'','MANUAL08'),(912,'','MANUAL09'),(912,'','MANUAL10'),(912,'','MANUAL11'),(912,'','MANUAL12'),(912,'','MANUAL13'),(912,'','MANUAL14'),(912,'','MANUAL15'),(912,'','MANUAL16'),(912,'','MANUAL17'),(912,'','MANUAL18'),(912,'','MANUAL19'),(912,'','MANUAL20'),(913,'1. 버터를 녹인 냄비에 양파, 생강, 마늘 다진 것을 넣고 양파가 반투명해 질 때까지 볶는다.','MANUAL01'),(913,'2. 1에 얇게 썬 당근을 넣고 볶는다.','MANUAL02'),(913,'3. 2에 야채육수, 오렌지주스를 넣고 당근이 익을 때까지 끓인다.','MANUAL03'),(913,'4. 믹서에 3을 넣고 갈아준 뒤 차갑게 한다.','MANUAL04'),(913,'5. 제공하기 직전에 크림을 넣어 섞은 뒤 당근주스를 넣는다.','MANUAL05'),(913,'6. 소금, 후추로 마지막 간을 하고 차가운 볼에 담는다.','MANUAL06'),(913,'','MANUAL07'),(913,'','MANUAL08'),(913,'','MANUAL09'),(913,'','MANUAL10'),(913,'','MANUAL11'),(913,'','MANUAL12'),(913,'','MANUAL13'),(913,'','MANUAL14'),(913,'','MANUAL15'),(913,'','MANUAL16'),(913,'','MANUAL17'),(913,'','MANUAL18'),(913,'','MANUAL19'),(913,'','MANUAL20'),(914,'1. 소고기는 불고기용으로 손질하여 소금, 후추로 밑간한다.','MANUAL01'),(914,'2. 애호박, 토마토, 가지, 양파, 새송이버섯을 채 썬 뒤 볶는다.','MANUAL02'),(914,'3. 밑간해 둔 소고기를 굽는다.','MANUAL03'),(914,'4. 접시에 밥을 깔고 그 위에 그린샐러드를 올린 뒤 익혀놓은 고기와 볶아놓은 야채들을 올린다.','MANUAL04'),(914,'5. 마지막으로 드래싱을 뿌린다.','MANUAL05'),(914,'','MANUAL06'),(914,'','MANUAL07'),(914,'','MANUAL08'),(914,'','MANUAL09'),(914,'','MANUAL10'),(914,'','MANUAL11'),(914,'','MANUAL12'),(914,'','MANUAL13'),(914,'','MANUAL14'),(914,'','MANUAL15'),(914,'','MANUAL16'),(914,'','MANUAL17'),(914,'','MANUAL18'),(914,'','MANUAL19'),(914,'','MANUAL20'),(915,'1. 팽이버섯은 밑동을 제거하고 4cm 길이로 자른다.','MANUAL01'),(915,'2. 청경채는 겉잎을 떼어낸 뒤 반으로 가른 뒤 팽이버섯과 같은 길이로 자른다.','MANUAL02'),(915,'3. 썰어 놓은 팽이버섯과 청경채를 끓는 물에 데친다.','MANUAL03'),(915,'4. 기름을 두른 팬에 팽이버섯과 청경채를 볶는다.','MANUAL04'),(915,'5. 물 전분을 넣어 농도를 맞춘다.','MANUAL05'),(915,'6. 참기름을 뿌려 완성한다.','MANUAL06'),(915,'','MANUAL07'),(915,'','MANUAL08'),(915,'','MANUAL09'),(915,'','MANUAL10'),(915,'','MANUAL11'),(915,'','MANUAL12'),(915,'','MANUAL13'),(915,'','MANUAL14'),(915,'','MANUAL15'),(915,'','MANUAL16'),(915,'','MANUAL17'),(915,'','MANUAL18'),(915,'','MANUAL19'),(915,'','MANUAL20'),(916,'1. 딸기를 깨끗이 씻는다.','MANUAL01'),(916,'2. 딸기의 꼭지를 뗀다.','MANUAL02'),(916,'3. 딸기, 바나나를 잘게 썰어 믹서에 넣는다.','MANUAL03'),(916,'4. 연두부를 믹서에 넣고 함께 간다.','MANUAL04'),(916,'5. 올리고당을 넣는다.','MANUAL05'),(916,'6. 컵에 담아 완성한다.','MANUAL06'),(916,'','MANUAL07'),(916,'','MANUAL08'),(916,'','MANUAL09'),(916,'','MANUAL10'),(916,'','MANUAL11'),(916,'','MANUAL12'),(916,'','MANUAL13'),(916,'','MANUAL14'),(916,'','MANUAL15'),(916,'','MANUAL16'),(916,'','MANUAL17'),(916,'','MANUAL18'),(916,'','MANUAL19'),(916,'','MANUAL20'),(917,'1. 봄동과 깻잎은 데친 뒤 체에 밭쳐 물기를 제거한다.','MANUAL01'),(917,'2. 데친 꼬막살은 물기를 제거하고 다져 올리브유로 양념한 밥에 참께와 함께 버무린 후 한입 크기로 주먹밥을 만든다.','MANUAL02'),(917,'3. 낙지 다리는 데처 찬물에 담가 식힌 뒤 참기름(3g)에 양념하고, 두릅은 데쳐 물기를 제거한 뒤 올리브유로 양념한다.','MANUAL03'),(917,'4. 봄동에 꼬막밥을 넣고 만 뒤 껫잎으로 싸고 데친 미나리로 묶어 봄주먹밥을 만든다.','MANUAL04'),(917,'5. 냄비에 참기름을 두르고 양파, 당근, 애호박을 볶은 뒤 물, 된장, 고춧가루, 다진마늘, 붉은고추, 청양고추, 두부를 넣고 조려 두부강된장을 만든다.','MANUAL05'),(917,'6. 봄주먹밥에 낙지와 두릅, 두부강된장을 곁들여 마무리한다.','MANUAL06'),(917,'','MANUAL07'),(917,'','MANUAL08'),(917,'','MANUAL09'),(917,'','MANUAL10'),(917,'','MANUAL11'),(917,'','MANUAL12'),(917,'','MANUAL13'),(917,'','MANUAL14'),(917,'','MANUAL15'),(917,'','MANUAL16'),(917,'','MANUAL17'),(917,'','MANUAL18'),(917,'','MANUAL19'),(917,'','MANUAL20'),(918,'1. 현미로 밥을 지은 뒤 밥 밑간을 넣고 섞는다.','MANUAL01'),(918,'2. 톳에 톳 무침양념을 넣고 버무린다.','MANUAL02'),(918,'3. 밥에 톳을 넣고 버무린다.','MANUAL03'),(918,'4. 밥을 먹기 좋은 크기로 둥글게 뭉친 뒤 부순 생김을 골고루 묻힌다.','MANUAL04'),(918,'5. 주먹밥을 달걀물을 입힌다.','MANUAL05'),(918,'6. 팬에 구워 마무리한다.','MANUAL06'),(918,'','MANUAL07'),(918,'','MANUAL08'),(918,'','MANUAL09'),(918,'','MANUAL10'),(918,'','MANUAL11'),(918,'','MANUAL12'),(918,'','MANUAL13'),(918,'','MANUAL14'),(918,'','MANUAL15'),(918,'','MANUAL16'),(918,'','MANUAL17'),(918,'','MANUAL18'),(918,'','MANUAL19'),(918,'','MANUAL20'),(919,'1. 쌀을 씻어 밥을 지은 뒤 밥 밑간을 한다.','MANUAL01'),(919,'2. 양파, 피클, 삶은 달걀은 다진 뒤 마요네즈에 섞어 허브타르타르드레싱을 만든다.','MANUAL02'),(919,'3. 김 위에 밥을 펴고 허브타르타르드레싱을 위에 올리 후 만다.','MANUAL03'),(919,'4. 깻잎장아찌를 바닥에 깔고 말아놓은 롤을 올린 후 한 번 더 만다.','MANUAL04'),(919,'5. 머스트드소스를 만든다.','MANUAL05'),(919,'6. 한입 크기로 롤을 썬 뒤 새싹과 소스를 곁들여 마무리한다.','MANUAL06'),(919,'','MANUAL07'),(919,'','MANUAL08'),(919,'','MANUAL09'),(919,'','MANUAL10'),(919,'','MANUAL11'),(919,'','MANUAL12'),(919,'','MANUAL13'),(919,'','MANUAL14'),(919,'','MANUAL15'),(919,'','MANUAL16'),(919,'','MANUAL17'),(919,'','MANUAL18'),(919,'','MANUAL19'),(919,'','MANUAL20'),(920,'1. 닭은 살을 발라낸다.','MANUAL01'),(920,'2. 남은 뼈는 파, 마늘을 넣고 육수를 만든다.','MANUAL02'),(920,'3. 마와 단호박은 1x1x5cm로 썬다.','MANUAL03'),(920,'4. 마늘, 아스파라거스, 영콘은 굽는다.','MANUAL04'),(920,'5. 닭에 마, 대추, 쌀, 단호박, 은행을 넣고 랩으로 감싸 만다.','MANUAL05'),(920,'6. 곁들일 단호박과 찜통에 찐다.','MANUAL06'),(920,'','MANUAL07'),(920,'','MANUAL08'),(920,'','MANUAL09'),(920,'','MANUAL10'),(920,'','MANUAL11'),(920,'','MANUAL12'),(920,'','MANUAL13'),(920,'','MANUAL14'),(920,'','MANUAL15'),(920,'','MANUAL16'),(920,'','MANUAL17'),(920,'','MANUAL18'),(920,'','MANUAL19'),(920,'','MANUAL20'),(921,'1. 소고기는 핏물을 제거한 뒤 양파, 마늘을 넣고 물(300g)을 부어 1시간 이상 끓인 뒤 면포에 걸러 육수를 만든다.','MANUAL01'),(921,'2. 삶은 소고기는 건져내 결 반대 방향으로 썬다.','MANUAL02'),(921,'3. 배추, 무, 느타리버섯, 표고버섯은 먹기 좋은 크기로 썬다.','MANUAL03'),(921,'4. 전복은 깨끗이 손질한다.','MANUAL04'),(921,'5. 육수를 끓인 뒤 끓어오르면 무를 넣어 반투명해지면 배추, 버섯, 전복을 넣는다.','MANUAL05'),(921,'6. 전복이 익으면 소고기를 넣고 저염간장으로 간을 해 마무리한다.','MANUAL06'),(921,'','MANUAL07'),(921,'','MANUAL08'),(921,'','MANUAL09'),(921,'','MANUAL10'),(921,'','MANUAL11'),(921,'','MANUAL12'),(921,'','MANUAL13'),(921,'','MANUAL14'),(921,'','MANUAL15'),(921,'','MANUAL16'),(921,'','MANUAL17'),(921,'','MANUAL18'),(921,'','MANUAL19'),(921,'','MANUAL20'),(922,'1. 양파는 잘게 썰고 청양고추는 어슷썰기를 한다.','MANUAL01'),(922,'2. 마늘은 편으로 썰고 마른 홍고추도 둥글게 썰어 준비한다.','MANUAL02'),(922,'3. 조개는 흐르는 물에 여러 번 씻어 해감을 시킨 후 물기를 제거한다.','MANUAL03'),(922,'4. 달궈진 팬에 올리브오일을 두르고 마늘, 마른홍고추, 양파를 넣어 볶아 향을 낸 후, 센불로 불을 키우고 모시조개를 넣는다.','MANUAL04'),(922,'5. 조개가 입을 벌리면 바질과 화이트와인을 넣어 잡내를 없앤다.','MANUAL05'),(922,'6. 한소끔 끓여낸 후 붕간 불로 줄이고 저염치즈, 청양고추, 후추를 넣어 칼칼한 맛을 낸다.','MANUAL06'),(922,'','MANUAL07'),(922,'','MANUAL08'),(922,'','MANUAL09'),(922,'','MANUAL10'),(922,'','MANUAL11'),(922,'','MANUAL12'),(922,'','MANUAL13'),(922,'','MANUAL14'),(922,'','MANUAL15'),(922,'','MANUAL16'),(922,'','MANUAL17'),(922,'','MANUAL18'),(922,'','MANUAL19'),(922,'','MANUAL20'),(923,'1. 고구마는 껍질을 벗겨 1cm 크기로 깍둑썰기 한 뒤 삶는다.','MANUAL01'),(923,'2. 양송이버섯과 양파는 굵게 다지고 느타리버섯은 데친다.','MANUAL02'),(923,'3. 냄비에 식용유를 넣어 양파, 고구마, 양송이버섯 순으로 볶는다.','MANUAL03'),(923,'4. 현미 1/2공기와 물 1/2컵을 넣어 믹서에 굵게 간다.','MANUAL04'),(923,'5. 3에 4와 나머지 우유를 넣어 끓인다.','MANUAL05'),(923,'6. 5를 그릇에 담고 고구마, 데친 느타리버섯을 가운데 담는다.','MANUAL06'),(923,'','MANUAL07'),(923,'','MANUAL08'),(923,'','MANUAL09'),(923,'','MANUAL10'),(923,'','MANUAL11'),(923,'','MANUAL12'),(923,'','MANUAL13'),(923,'','MANUAL14'),(923,'','MANUAL15'),(923,'','MANUAL16'),(923,'','MANUAL17'),(923,'','MANUAL18'),(923,'','MANUAL19'),(923,'','MANUAL20'),(924,'1. 두부는 으깨서 소창을 이용하여 물기를 짠다.','MANUAL01'),(924,'2. 후라이팬에 납작하게 펴서 노릇하게 굽는다.','MANUAL02'),(924,'3. 구워진 두부를 대충 부서뜨린 후 간장을 넣어서 볶는다.','MANUAL03'),(924,'4. 당근, 감자, 피망, 애호박, 불린 표고버섯, 오이는 작은 정육면체로 썰어 각각 소금간 해서 볶는다.','MANUAL04'),(924,'5. 팬에 감자, 표고버섯, 두부, 밥을 넣고 볶다가 나머지 채소를 넣어 볶는다.','MANUAL05'),(924,'6. 양념장을 만들어 함께 낸다.','MANUAL06'),(924,'','MANUAL07'),(924,'','MANUAL08'),(924,'','MANUAL09'),(924,'','MANUAL10'),(924,'','MANUAL11'),(924,'','MANUAL12'),(924,'','MANUAL13'),(924,'','MANUAL14'),(924,'','MANUAL15'),(924,'','MANUAL16'),(924,'','MANUAL17'),(924,'','MANUAL18'),(924,'','MANUAL19'),(924,'','MANUAL20'),(925,'1. 마늘은 꼭지를 떼고 찜통에 무르도록 찐다.','MANUAL01'),(925,'2. 쪄 낸 마늘을 손절구에 곱게 으깬다','MANUAL02'),(925,'3. 잣은 고깔을 떼고 겉면을 깨끗하게 닦은 뒤 가루를 만든다.','MANUAL03'),(925,'4. 2에 꿀, 검은깨, 잣가루를 넣고 잘 혼합한다.','MANUAL04'),(925,'5. 4에 카스텔라 가루를 넣어 농도를 맞춘다.','MANUAL05'),(925,'6. 반죽을 조금씩 떼어 동그랗게 굴려 꿀환을 만든다.','MANUAL06'),(925,'','MANUAL07'),(925,'','MANUAL08'),(925,'','MANUAL09'),(925,'','MANUAL10'),(925,'','MANUAL11'),(925,'','MANUAL12'),(925,'','MANUAL13'),(925,'','MANUAL14'),(925,'','MANUAL15'),(925,'','MANUAL16'),(925,'','MANUAL17'),(925,'','MANUAL18'),(925,'','MANUAL19'),(925,'','MANUAL20'),(926,'1. 자몽은 껍질을 벗겨내고 과육만 0.5cm 주사위모양으로 자른다.','MANUAL01'),(926,'2. 오렌지는 껍질을 벗겨내고 과육만 자몽과 같은 크기로 자른다.','MANUAL02'),(926,'3. 키위도 껍질을 벗겨내고 자몽과 같은 크기로 자른다.','MANUAL03'),(926,'4. 썰어 둔 과일에 플레인 요거트, 꿀을 넣고 버무린다.','MANUAL04'),(926,'5. 또띠아를 반으로 자른다.','MANUAL05'),(926,'6. 버무린 과일을 넣고 말아준다.','MANUAL06'),(926,'','MANUAL07'),(926,'','MANUAL08'),(926,'','MANUAL09'),(926,'','MANUAL10'),(926,'','MANUAL11'),(926,'','MANUAL12'),(926,'','MANUAL13'),(926,'','MANUAL14'),(926,'','MANUAL15'),(926,'','MANUAL16'),(926,'','MANUAL17'),(926,'','MANUAL18'),(926,'','MANUAL19'),(926,'','MANUAL20'),(927,'1. 찹쌀가루에 뜨거운 물을 넣어 익반죽을 한다.','MANUAL01'),(927,'2. 찹쌀 반죽을 동그랗게 빚는다.','MANUAL02'),(927,'3. 찹쌀 경단을 끓는 물에 삶은 뒤 차갑게 식힌다.','MANUAL03'),(927,'4. 수박은 씨를 제거한 뒤 곱게 갈아 차갑게 식힌다.','MANUAL04'),(927,'5. 그릇에 3과 4를 넣는다.','MANUAL05'),(927,'6. 기호에 따라 팥을 삶아 설탕에 졸여 넣는다.','MANUAL06'),(927,'','MANUAL07'),(927,'','MANUAL08'),(927,'','MANUAL09'),(927,'','MANUAL10'),(927,'','MANUAL11'),(927,'','MANUAL12'),(927,'','MANUAL13'),(927,'','MANUAL14'),(927,'','MANUAL15'),(927,'','MANUAL16'),(927,'','MANUAL17'),(927,'','MANUAL18'),(927,'','MANUAL19'),(927,'','MANUAL20'),(928,'1. 생강을 깨끗이 씻는다.','MANUAL01'),(928,'2. 생강을 강판에 곱게 간다.','MANUAL02'),(928,'3. 냄비에 우유와 간 생강을 넣고 끓인다.','MANUAL03'),(928,'4. 가장자리가 보글보글 끓어 오르면 불에서 내린다.','MANUAL04'),(928,'5. 믹서에 4를 붓고 깨소금, 꿀을 넣어 간다.','MANUAL05'),(928,'6. 컵에 5를 붓고 계피가루를 살짝 뿌린다.','MANUAL06'),(928,'','MANUAL07'),(928,'','MANUAL08'),(928,'','MANUAL09'),(928,'','MANUAL10'),(928,'','MANUAL11'),(928,'','MANUAL12'),(928,'','MANUAL13'),(928,'','MANUAL14'),(928,'','MANUAL15'),(928,'','MANUAL16'),(928,'','MANUAL17'),(928,'','MANUAL18'),(928,'','MANUAL19'),(928,'','MANUAL20'),(929,'1. 들깨가루, 검은깨, 두유, 레몬즙, 꿀, 물, 참기름을 섞어 레몬 들깨 소스를 만든다.','MANUAL01'),(929,'2. 떡 군데군데 꼬챙이로 찌르거나 칼집을 넣는다.','MANUAL02'),(929,'3. 팬에 기름을 두르고 160℃ 정도에서 기름이 튀지 않도록 주의하며 떡을 튀긴다.','MANUAL03'),(929,'4. 꼭지를 땐 잣과 호두를 굵게 다진다.','MANUAL04'),(929,'5. 떡은 꼬치에 꽂아 접시에 담는다.','MANUAL05'),(929,'6. 레몬 들깨소스를 바르고 잣, 호두를 고명으로 뿌린다.','MANUAL06'),(929,'','MANUAL07'),(929,'','MANUAL08'),(929,'','MANUAL09'),(929,'','MANUAL10'),(929,'','MANUAL11'),(929,'','MANUAL12'),(929,'','MANUAL13'),(929,'','MANUAL14'),(929,'','MANUAL15'),(929,'','MANUAL16'),(929,'','MANUAL17'),(929,'','MANUAL18'),(929,'','MANUAL19'),(929,'','MANUAL20'),(930,'1. 프라이팬에 밥을 얇게 펴 약한 불에서 뚜껑을 덮어 굽는다.','MANUAL01'),(930,'2. 노릇하게 누룽지가 되면 식혀서 굵게 부순다.','MANUAL02'),(930,'3. 오렌지는 깨끗이 씻어 껍질을 벗긴 뒤 먹기 좋은 크기로 자른다.','MANUAL03'),(930,'4. 사과를 깨끗이 씻어 물기를 제거하고 굵게 자른다.','MANUAL04'),(930,'5. 컵에 요거트-오렌지-요거트-누룽지-요거트-사과-요거트-누룽지 순으로 담는다.','MANUAL05'),(930,'6. 마지막에 누룽지와 블루베리로 장식한다.','MANUAL06'),(930,'','MANUAL07'),(930,'','MANUAL08'),(930,'','MANUAL09'),(930,'','MANUAL10'),(930,'','MANUAL11'),(930,'','MANUAL12'),(930,'','MANUAL13'),(930,'','MANUAL14'),(930,'','MANUAL15'),(930,'','MANUAL16'),(930,'','MANUAL17'),(930,'','MANUAL18'),(930,'','MANUAL19'),(930,'','MANUAL20'),(931,'1. 찹쌀을 3-5시간 불려둔 뒤 물기를 제거하고 믹서기에 간다.','MANUAL01'),(931,'2. 고구마는 껍질을 벗기고 작게 썰어 찜통에 찐 뒤 말랑말랑해지면 잘 으깨어 반죽하기 편할 정도로 만든다.','MANUAL02'),(931,'3. 검정깨는 믹서기에 곱게 갈고 호두와 땅콩은 잘게 다진 뒤 황설탕과 섞어 호떡소를 만든다.','MANUAL03'),(931,'4. 으깬 고구마에 찹쌀가루를 넣은 뒤 호떡 반죽을 만든다.','MANUAL04'),(931,'5. 완성된 반죽을 적당량 떼어내 동그랗게 빚어 준비해둔 호떡소를 적당량 넣고 봉합한 뒤 납작하게 누른다.','MANUAL05'),(931,'6. 팬에 현미유를 두르고 호떡을 살짝 눌러가면서 앞뒤로 노릇노릇하게 굽는다.','MANUAL06'),(931,'','MANUAL07'),(931,'','MANUAL08'),(931,'','MANUAL09'),(931,'','MANUAL10'),(931,'','MANUAL11'),(931,'','MANUAL12'),(931,'','MANUAL13'),(931,'','MANUAL14'),(931,'','MANUAL15'),(931,'','MANUAL16'),(931,'','MANUAL17'),(931,'','MANUAL18'),(931,'','MANUAL19'),(931,'','MANUAL20'),(932,'1. 멸치와 무, 양파 절반, 사과를\n끓여 육수를 만든다.','MANUAL01'),(932,'2. 남은 양파와 돼지고기는 곱게\n다진다.','MANUAL02'),(932,'3. 청국장에 육수, 다진 양파,\n돼지고기를 넣고 볶는다.','MANUAL03'),(932,'4. 케일은 끓는 물에 살짝 데친 뒤\n식히고 물기를 없앤다.','MANUAL04'),(932,'5. 밥에 청국장 지짐을 비빈 뒤\n케일로 돌돌 말아 반을 자른다.','MANUAL05'),(932,'6. 그릇에 담고 어슷썬 홍고추로\n장식한다.','MANUAL06'),(932,'','MANUAL07'),(932,'','MANUAL08'),(932,'','MANUAL09'),(932,'','MANUAL10'),(932,'','MANUAL11'),(932,'','MANUAL12'),(932,'','MANUAL13'),(932,'','MANUAL14'),(932,'','MANUAL15'),(932,'','MANUAL16'),(932,'','MANUAL17'),(932,'','MANUAL18'),(932,'','MANUAL19'),(932,'','MANUAL20'),(933,'1. 쌀은 깨끗이 씻고 불려 밥을\n짓는다.','MANUAL01'),(933,'2. 소고기는 핏기를 제거하고 버섯,\n당근, 양파, 대파는 한 입 크기로\n썰어서 준비한다.','MANUAL02'),(933,'3. 절반의 마늘과 진간장, 양파, 배,\n후춧가루를 넣고 믹서에 갈아\n양념을 만든다.','MANUAL03'),(933,'4. 핏기를 제거한 소고기에 3번의\n양념을 넣고 섞는다.','MANUAL04'),(933,'5. 나머지 마늘은 얇게 편썰어\n기름에 튀겨 마늘 칩을 만든다.','MANUAL05'),(933,'6. 숙성 시킨 불고기를 팬에 볶고,\n그릇에 담은 밥 위에 올리고 마늘\n칩으로 장식한다.','MANUAL06'),(933,'','MANUAL07'),(933,'','MANUAL08'),(933,'','MANUAL09'),(933,'','MANUAL10'),(933,'','MANUAL11'),(933,'','MANUAL12'),(933,'','MANUAL13'),(933,'','MANUAL14'),(933,'','MANUAL15'),(933,'','MANUAL16'),(933,'','MANUAL17'),(933,'','MANUAL18'),(933,'','MANUAL19'),(933,'','MANUAL20'),(934,'1. 잡곡과 찹쌀은 물에 씻어 불린 뒤\n소금을 넣고 밥을 짓는다.','MANUAL01'),(934,'2. 호두는 껍질을 제거하고 굵게\n부숴 마른 팬에 볶는다.','MANUAL02'),(934,'3. 은행은 기름에 볶아 껍질을\n제거하고 4등분 한다','MANUAL03'),(934,'4. 생밤은 껍질을 벗기고 작은\n주사위 모양으로 자른 뒤 기름에\n굽는다.','MANUAL04'),(934,'5. 물 40g에 간장, 대추고, 꿀을 넣고\n끓인 뒤 2,3,4번을 넣고 잘 섞는다.','MANUAL05'),(934,'6. 잡곡밥을 넓게 펼친 뒤 5번을\n넣고 돌돌 만다.','MANUAL06'),(934,'','MANUAL07'),(934,'','MANUAL08'),(934,'','MANUAL09'),(934,'','MANUAL10'),(934,'','MANUAL11'),(934,'','MANUAL12'),(934,'','MANUAL13'),(934,'','MANUAL14'),(934,'','MANUAL15'),(934,'','MANUAL16'),(934,'','MANUAL17'),(934,'','MANUAL18'),(934,'','MANUAL19'),(934,'','MANUAL20'),(935,'1. 소고기, 돼지고기, 가래떡, 양파,\n새송이버섯, 파는 잘게 다진다','MANUAL01'),(935,'2. 사과와 배는 믹서에 간 뒤 간장,\n청주, 다진 마늘, 후춧가루를 넣고\n양념장을 만든다.','MANUAL02'),(935,'3. 다진 고기와 양념장을 섞은 뒤\n다진 재료를 넣고 잘 치대어 먹기\n좋은 크기로 만든다.','MANUAL03'),(935,'4. 팬에 기름을 두르고\n함박스테이크를 굽는다.','MANUAL04'),(935,'5. 파프리카는 다지고, 사과, 배는\n갈아서 고추장, 간장, 다진 마늘을\n섞은 뒤 끓여 소스를 만든다.','MANUAL05'),(935,'6. 밥에 참기름을 넣고\n함박스테이크를 담은 뒤 소스를\n올려 완성한다.','MANUAL06'),(935,'','MANUAL07'),(935,'','MANUAL08'),(935,'','MANUAL09'),(935,'','MANUAL10'),(935,'','MANUAL11'),(935,'','MANUAL12'),(935,'','MANUAL13'),(935,'','MANUAL14'),(935,'','MANUAL15'),(935,'','MANUAL16'),(935,'','MANUAL17'),(935,'','MANUAL18'),(935,'','MANUAL19'),(935,'','MANUAL20'),(936,'1. 곤드레나물에 들기름, 간장으로\n양념하고 쌀, 찹쌀, 흑미와 밥을\n지은 뒤 참기름, 소금 간 한다.','MANUAL01'),(936,'2. 식초와 식초2배의 물을 넣고\n끓이다가 사과를 한 입 크기로\n썰어 끓인다.','MANUAL02'),(936,'3. 감자를 삶아 으깨고, 다진 양파,\n호두, 밀가루를 넣고 섞은 뒤 겉에\n빵가루를 묻혀 팬에 굽는다.','MANUAL03'),(936,'4. 파프리카는 잘게 채 썬다.','MANUAL04'),(936,'5. 마요네즈, 깻잎, 바나나, 된장을\n믹서에 갈아 소스를 만들고\n피클을 다져 넣는다.','MANUAL05'),(936,'6. 종이호일을 깔고 중간중간\n소스를 뿌리면서 김-양상추-\n패티-파프리카-양상추-밥\n순으로 얹어 버거를 만든다.','MANUAL06'),(936,'','MANUAL07'),(936,'','MANUAL08'),(936,'','MANUAL09'),(936,'','MANUAL10'),(936,'','MANUAL11'),(936,'','MANUAL12'),(936,'','MANUAL13'),(936,'','MANUAL14'),(936,'','MANUAL15'),(936,'','MANUAL16'),(936,'','MANUAL17'),(936,'','MANUAL18'),(936,'','MANUAL19'),(936,'','MANUAL20'),(937,'1. 쌀을 씻어 밥을 짓는다.','MANUAL01'),(937,'2. 양파, 표고버섯, 당근, 피망은\n입자있게 다지고 대추는 씨를\n제거한 뒤 다진다.','MANUAL02'),(937,'3. 닭가슴살은 먹기 좋은 크기로\n썬다.','MANUAL03'),(937,'4. 팬에 기름을 두르고 다진 마늘을\n볶은 뒤 닭가슴살을 볶는다','MANUAL04'),(937,'5. 닭가슴살이 다 익으면 손질한\n채소를 넣고 볶다가 밥, 우유,\n치즈, 대추를 넣고 끓인다.','MANUAL05'),(937,'6. 우유가 반으로 졸아들면 불을\n줄이고 소금, 후추로 간한다.','MANUAL06'),(937,'','MANUAL07'),(937,'','MANUAL08'),(937,'','MANUAL09'),(937,'','MANUAL10'),(937,'','MANUAL11'),(937,'','MANUAL12'),(937,'','MANUAL13'),(937,'','MANUAL14'),(937,'','MANUAL15'),(937,'','MANUAL16'),(937,'','MANUAL17'),(937,'','MANUAL18'),(937,'','MANUAL19'),(937,'','MANUAL20'),(938,'1. 카레가루를 미지근한 물에 개어\n쌀을 넣고 밥을 한다.','MANUAL01'),(938,'2. 묵은지는 헹궈서 다지고 양파도\n다진다.','MANUAL02'),(938,'3. 참치의 기름을 빼고 묵은지,\n양파를 넣고 마요네즈에\n버무린다.','MANUAL03'),(938,'4. 3번을 넣고 카레밥으로 주먹밥을 만든다.','MANUAL04'),(938,'5. 주먹밥을 배 모양으로 만든다.','MANUAL05'),(938,'6. 애호박과 가지 껍질로 배 꼭지와\n잎을 만들어 장식한다.','MANUAL06'),(938,'','MANUAL07'),(938,'','MANUAL08'),(938,'','MANUAL09'),(938,'','MANUAL10'),(938,'','MANUAL11'),(938,'','MANUAL12'),(938,'','MANUAL13'),(938,'','MANUAL14'),(938,'','MANUAL15'),(938,'','MANUAL16'),(938,'','MANUAL17'),(938,'','MANUAL18'),(938,'','MANUAL19'),(938,'','MANUAL20'),(939,'1. 쌀과 곤약은 깨끗이 씻어 밥을\n짓는다.','MANUAL01'),(939,'2. 시금치는 데쳐 잘게 다지고\n당근은 잘게 다져 팬에 볶고,\n달걀은 삶아 노른자만 체에\n거른다.','MANUAL02'),(939,'3. 소고기는 간장, 참기름, 대파,\n마늘, 물엿, 후춧가루를 버무려\n볶는다.','MANUAL03'),(939,'4. 멸치는 올리고당으로 볶고 밥은\n소금과 참기름으로 밑간한다.','MANUAL04'),(939,'5. 밥과 멸치, 밥과 소고기를 각각\n버무려 동그랗게 빚는다.','MANUAL05'),(939,'6. 동그랗게 빚은 밥은 시금치, 당근,\n달걀노른자에 각각 굴린다.','MANUAL06'),(939,'','MANUAL07'),(939,'','MANUAL08'),(939,'','MANUAL09'),(939,'','MANUAL10'),(939,'','MANUAL11'),(939,'','MANUAL12'),(939,'','MANUAL13'),(939,'','MANUAL14'),(939,'','MANUAL15'),(939,'','MANUAL16'),(939,'','MANUAL17'),(939,'','MANUAL18'),(939,'','MANUAL19'),(939,'','MANUAL20'),(940,'1. 양배추는 손질하여 찜통에 10분간\n찐 후 식힌다.','MANUAL01'),(940,'2. 참치는 체에 받쳐 기름을 빼고, 두부는 물기를 제거한 뒤 으깬다','MANUAL02'),(940,'3. 양파와 파, 마늘은 잘게 다진다','MANUAL03'),(940,'4. 팬에 된장, 고추장, 매실청, 다진 \n양파, 파, 마늘, 물을 넣고 섞어\n끓이다가 참치, 두부를 넣고 볶은\n뒤 참기름, 깨를 넣는다.','MANUAL04'),(940,'5. 찐 양배추에 밥을 얹어 돌돌 만다.','MANUAL05'),(940,'6. 양배추롤을 적당한 크기로 썰고\n참치두부쌈장을 올린다.','MANUAL06'),(940,'','MANUAL07'),(940,'','MANUAL08'),(940,'','MANUAL09'),(940,'','MANUAL10'),(940,'','MANUAL11'),(940,'','MANUAL12'),(940,'','MANUAL13'),(940,'','MANUAL14'),(940,'','MANUAL15'),(940,'','MANUAL16'),(940,'','MANUAL17'),(940,'','MANUAL18'),(940,'','MANUAL19'),(940,'','MANUAL20'),(941,'1. 양파, 마늘, 새우살, 게살을 다진다. 팬에 마늘과 양파를 볶다가 새우살과 게살을 넣고 볶아 식힌다.','MANUAL01'),(941,'2. 시금치는 데친 뒤 믹서에 갈아 즙을 내고, 비트도 갈아 체에 걸러 즙을 낸 뒤 밀가루, 달걀과 섞어 라비올리 반죽을 색깔별로 만든다.','MANUAL02'),(941,'3. 라비올리 반죽을 0.1mm 두께로 밀어 편다.','MANUAL03'),(941,'4. 반죽을 5X5cm크기로 자른 후 볶아둔 새우살 등의 속을 가운데 놓고 삼각형으로 반을 접어 모서리를 봉한다.','MANUAL04'),(941,'5. 끓는 물에 라비올리를 삶는다.','MANUAL05'),(941,'6. 팬에 식용유를 넣고 다진 양파를 볶다가 크림을 넣고 졸인 뒤 라비올리, 파마산치즈, 비트를 넣는다.','MANUAL06'),(941,'','MANUAL07'),(941,'','MANUAL08'),(941,'','MANUAL09'),(941,'','MANUAL10'),(941,'','MANUAL11'),(941,'','MANUAL12'),(941,'','MANUAL13'),(941,'','MANUAL14'),(941,'','MANUAL15'),(941,'','MANUAL16'),(941,'','MANUAL17'),(941,'','MANUAL18'),(941,'','MANUAL19'),(941,'','MANUAL20'),(942,'1. 반죽 재료를 섞어 라비올리 반죽을 만든 뒤 냉장고에 휴지 시킨다.','MANUAL01'),(942,'2. 우유가 끓이다 레몬즙을 넣고 응어리가 생기면 면보에 걸러 응고시킨다.','MANUAL02'),(942,'3. 우유가 차갑게 식으면 차이브와 파마산 치즈를 섞어 리코타치즈를 만든다.','MANUAL03'),(942,'4. 냉장 휴지시킨 라비올리 반죽을 1mm두께로 민 뒤 4x4cm 크기로 잘라 리코타치즈로 속을 채워 끎는 물에 삶는다.','MANUAL04'),(942,'5. 양파,당근,토마토은 슬라이스하고 셀러리와 마늘은 잘게 다져 냄비에 바질, 오레가노, 로즈마리, 물, 설탕과 함께 끓여 토마토소스를 만든다.','MANUAL05'),(942,'6. 라비올리와 토마토소스를 곁들여낸다.','MANUAL06'),(942,'','MANUAL07'),(942,'','MANUAL08'),(942,'','MANUAL09'),(942,'','MANUAL10'),(942,'','MANUAL11'),(942,'','MANUAL12'),(942,'','MANUAL13'),(942,'','MANUAL14'),(942,'','MANUAL15'),(942,'','MANUAL16'),(942,'','MANUAL17'),(942,'','MANUAL18'),(942,'','MANUAL19'),(942,'','MANUAL20'),(943,'1. 마른 미역은 물에 담가 불린 후 먹기 좋은 크기로 썬다.','MANUAL01'),(943,'2. 우엉은 연필깍기 하여 냉수에 여러 번 주물러 씻어 쓴맛을 뺀다.','MANUAL02'),(943,'3. 들깨는 믹서기에 물을 넣어 곱게 갈아 준비한다.','MANUAL03'),(943,'4. 냄비에 들기름을 넣고 우엉을 넣어 부드럽게 볶다가 미역을 넣어 함께 볶는다.','MANUAL04'),(943,'5. 4에 들깨물을 넣어 미역이 부드러우질 때까지 끓인다.','MANUAL05'),(943,'6. 들깨 미역국이 부드러워지면 조랭이 떡을 넣고 다진 마늘을 넣어 떡국을 끓여낸다.','MANUAL06'),(943,'','MANUAL07'),(943,'','MANUAL08'),(943,'','MANUAL09'),(943,'','MANUAL10'),(943,'','MANUAL11'),(943,'','MANUAL12'),(943,'','MANUAL13'),(943,'','MANUAL14'),(943,'','MANUAL15'),(943,'','MANUAL16'),(943,'','MANUAL17'),(943,'','MANUAL18'),(943,'','MANUAL19'),(943,'','MANUAL20'),(944,'1. 기름을 두른 팬에 다진 마늘을 넣고 볶는다.','MANUAL01'),(944,'2. 2mm 두께로 썬 양송이버섯을 넣고 볶아준 뒤 접시에 담는다.','MANUAL02'),(944,'3. 버섯을 볶은 팬에 쌀을 넣고 볶는다.','MANUAL03'),(944,'4. 볶은 쌀에 닭육수를 넣고 수분이 흡수 될 때까지 잘 저어가며 조리한다.','MANUAL04'),(944,'5. 쌀이 어느 정도 익으면 볶아놓은 버섯을 넣고 쌀이 완전히 익을 때까지 조리한다.','MANUAL05'),(944,'6. 파마산치즈, 소금, 후추, 타임 다진것, 다진 파슬리를 넣어 마무리한다.','MANUAL06'),(944,'','MANUAL07'),(944,'','MANUAL08'),(944,'','MANUAL09'),(944,'','MANUAL10'),(944,'','MANUAL11'),(944,'','MANUAL12'),(944,'','MANUAL13'),(944,'','MANUAL14'),(944,'','MANUAL15'),(944,'','MANUAL16'),(944,'','MANUAL17'),(944,'','MANUAL18'),(944,'','MANUAL19'),(944,'','MANUAL20'),(945,'1. 서리태를 씻어 물에 충분히 불리고 오이는 곱게 채썬다','MANUAL01'),(945,'2. 냄비에 서리태를 넣고 자작하게 물을 부어 한소끔 끓고 나면 불을 끄고 삶아진 서리태를 차가운 물에 헹구면서 껍질을 벗긴다.','MANUAL02'),(945,'3. 믹서에 서리태와 잣을 넣고 물을 넣어 곱게 간다.','MANUAL03'),(945,'4. 밀가루에 소금을 소량 넣어 반죽 한다.','MANUAL04'),(945,'5. 반죽을 가늘고 얇게 국수로 만들어 끓는 물에 넣고 삶는다.','MANUAL05'),(945,'6. 그릇에 국수를 담고 잣, 콩물을 부은 후 채썬 오이와 반 가른 체리토마토를 얹고 흑임자를 뿌려 완성한다.','MANUAL06'),(945,'','MANUAL07'),(945,'','MANUAL08'),(945,'','MANUAL09'),(945,'','MANUAL10'),(945,'','MANUAL11'),(945,'','MANUAL12'),(945,'','MANUAL13'),(945,'','MANUAL14'),(945,'','MANUAL15'),(945,'','MANUAL16'),(945,'','MANUAL17'),(945,'','MANUAL18'),(945,'','MANUAL19'),(945,'','MANUAL20'),(946,'1. 고슬고슬하게 지은밥에 참기름을 섞고 다진 소고기는 후춧가루, 참기름에 무친 뒤 볶아서 밥과 섞어 주먹밥을 만든다.','MANUAL01'),(946,'2. 근대는 데친 뒤 소금, 다진 마늘, 참기름으로 무친다.','MANUAL02'),(946,'3. 쌈다시마는 물에 헹군 뒤 끓는 물에 파랗게 데쳐 6cm폭으로 자른다.','MANUAL03'),(946,'4. 케일, 앤다이브는 씻어서 물기를 빼고 깻잎은 저나트륨 양념간장에 재운다.','MANUAL04'),(946,'5. 미나리와 오징어는 손질하여 살짝 데치고 오징어는 얇게 저며 썬다.','MANUAL05'),(946,'6. 1의 주먹밥을 준비한 각각의 재료로 말아 싼 다음 쌈장, 저나트륨 초고추장을 올려 마무리 한다.','MANUAL06'),(946,'','MANUAL07'),(946,'','MANUAL08'),(946,'','MANUAL09'),(946,'','MANUAL10'),(946,'','MANUAL11'),(946,'','MANUAL12'),(946,'','MANUAL13'),(946,'','MANUAL14'),(946,'','MANUAL15'),(946,'','MANUAL16'),(946,'','MANUAL17'),(946,'','MANUAL18'),(946,'','MANUAL19'),(946,'','MANUAL20'),(947,'1. 쌀과 현미찹쌀을 씻어 불린다.','MANUAL01'),(947,'2. 표고버섯, 당근은 은행크기로 썬다','MANUAL02'),(947,'3. 대추도 돌려깍아 은행크기로 썬다.','MANUAL03'),(947,'4. 1에 표고버섯, 당근, 대추와 은행, 밤을 고루 섞어 솥에 담는다.','MANUAL04'),(947,'5. 다시마 육수를 평상시 밥물보다 적게 넣고 밥을 짓는다.','MANUAL05'),(947,'6. 밥이 뜸이 들면 간장양념과 함께 제공한다.','MANUAL06'),(947,'','MANUAL07'),(947,'','MANUAL08'),(947,'','MANUAL09'),(947,'','MANUAL10'),(947,'','MANUAL11'),(947,'','MANUAL12'),(947,'','MANUAL13'),(947,'','MANUAL14'),(947,'','MANUAL15'),(947,'','MANUAL16'),(947,'','MANUAL17'),(947,'','MANUAL18'),(947,'','MANUAL19'),(947,'','MANUAL20'),(948,'1. 찹쌀을 씻어 불린다.','MANUAL01'),(948,'2. 팥을 씻어서 건진 후 잠길 만큼 물을 붓고 끓인다.','MANUAL02'),(948,'3. 검붉은 물이 우러나오면 제거하고 팥 분량의 3배 정도 물을 넣어서 완전히 뭉그러질 때까지 끓인다.','MANUAL03'),(948,'4. 찹쌀가루는 끓는 물로 익반죽하여 1.5cm 가량의 찹쌀경단을 빚는다.','MANUAL04'),(948,'5. 삶은 팥을 손으로 주무른 다음 체에 거르고 앙금을 가라앉도록 하여 웃물을 먼저 끓으면 불린 찹쌀을 넣고 퍼질 때 까지 끓인다.','MANUAL05'),(948,'6. 앙금과 찹쌀경단을 차례로 넣고 끓인 뒤 경단이 떠오르면 2~3분 더 끓여 완성한다.(설탕이나 꿀은 기호에 따라 사용한다.)','MANUAL06'),(948,'','MANUAL07'),(948,'','MANUAL08'),(948,'','MANUAL09'),(948,'','MANUAL10'),(948,'','MANUAL11'),(948,'','MANUAL12'),(948,'','MANUAL13'),(948,'','MANUAL14'),(948,'','MANUAL15'),(948,'','MANUAL16'),(948,'','MANUAL17'),(948,'','MANUAL18'),(948,'','MANUAL19'),(948,'','MANUAL20'),(949,'1. 호박은 채썰어 굵게 다진 뒤 소금을 뿌렸다가 물기를 제거하고 센불에 충분히 볶아 식힌다.','MANUAL01'),(949,'2. 표고버섯은 불려서 꼭지를 떼고 두꺼운 것은 포를 뜬 뒤 채썰어 들기름을 넣고 무쳐 센불에 볶고 청고추는 다진 뒤 살짝 볶는다.','MANUAL02'),(949,'3. 볶은 호박과 고추, 버섯이 완전히 식으면 섞어서 통깨, 후춧가루, 참기름에 무친다.','MANUAL03'),(949,'4. 분량의 밀가루와 물을 섞어 반죽을 만든 뒤 0.2cm 두께로 밀어 지름 7~8cm 정도의 동그란 틀을 이용해 찍어 만두피를 만든다.','MANUAL04'),(949,'5. 만두피에 만두소를 넣어 만두를 만든다.','MANUAL05'),(949,'6. 김이 오른 찜통에 젖은 소창을 깔고 만두를 넣어 찌거나 끓는 물에 소금을 약간 넣고 터지지 않게 삶는다.','MANUAL06'),(949,'','MANUAL07'),(949,'','MANUAL08'),(949,'','MANUAL09'),(949,'','MANUAL10'),(949,'','MANUAL11'),(949,'','MANUAL12'),(949,'','MANUAL13'),(949,'','MANUAL14'),(949,'','MANUAL15'),(949,'','MANUAL16'),(949,'','MANUAL17'),(949,'','MANUAL18'),(949,'','MANUAL19'),(949,'','MANUAL20'),(950,'1. 감자는 껍질을 벗긴 후 곱게 채썰어 식초를 살짝 탄 물에 담가 갈변을 방지한다.','MANUAL01'),(950,'2. 달걀흰자에 밀가루, 베이킹 파우더를 넣어 덩어리 지지 않게 푼다.','MANUAL02'),(950,'3. 마늘가루, 후춧가루를 넣어 잘 섞어 반죽을 만든다.','MANUAL03'),(950,'4. 썰어 둔 감자를 체에 받쳐 물기를 뺀 후 키친타올을 이용해 완전히 물기를 제거한 후 만들어 둔 반죽에 넣어 섞는다.','MANUAL04'),(950,'5. 팬에 식용유를 넣고 반죽을 부어 지름 6cm 정도로 둥글게 편 뒤 양면을 노릇하게 굽는다.','MANUAL05'),(950,'6. 체리, 사과, 청포도 등의 제철 과일을 설탕물에 졸여 팬케익에 곁들인다.','MANUAL06'),(950,'','MANUAL07'),(950,'','MANUAL08'),(950,'','MANUAL09'),(950,'','MANUAL10'),(950,'','MANUAL11'),(950,'','MANUAL12'),(950,'','MANUAL13'),(950,'','MANUAL14'),(950,'','MANUAL15'),(950,'','MANUAL16'),(950,'','MANUAL17'),(950,'','MANUAL18'),(950,'','MANUAL19'),(950,'','MANUAL20'),(951,'1. 단호박은 속을 숟가락으로 깨끗하게 긁어낸다.','MANUAL01'),(951,'2. 껍질을 군데군데 깎은 후 작은 토막으로 잘라 물에 넣어 삶는다.','MANUAL02'),(951,'3. 식힌 단호박과 두부를 믹서에 넣고 간다.','MANUAL03'),(951,'4. 단호박 크기가 작아지면 멈추었다가 두유를 넣고 한번 더 간다.','MANUAL04'),(951,'5. 냄비에 넣고 다시마 국물을 조금씩 부어가며 잘 풀어주면서 약한 불에서 뭉근하게 끓인다.','MANUAL05'),(951,'6. 소금, 후춧가루로 간한다.','MANUAL06'),(951,'','MANUAL07'),(951,'','MANUAL08'),(951,'','MANUAL09'),(951,'','MANUAL10'),(951,'','MANUAL11'),(951,'','MANUAL12'),(951,'','MANUAL13'),(951,'','MANUAL14'),(951,'','MANUAL15'),(951,'','MANUAL16'),(951,'','MANUAL17'),(951,'','MANUAL18'),(951,'','MANUAL19'),(951,'','MANUAL20'),(952,'1. 서리태를 2시간 정도 물에 불려둔다.','MANUAL01'),(952,'2. 셀러리, 양파, 청피망, 토마토를 굵게 다지고 베이컨은 얇게 채썬다.','MANUAL02'),(952,'3. 팬에 식용유를 두르고 다진 마늘을 넣어 볶아 향을 낸 뒤 다진 소고기를 넣어 볶는다.','MANUAL03'),(952,'4. 팬에 식용유를 두르고 베이컨, 양파, 셀러리, 토마토, 청피망 순으로 넣어 볶는다.','MANUAL04'),(952,'5. 냄비에 현미, 볶은 소고기, 닭육수를 넣어 현미가 반쯤 익도록 끓인다.','MANUAL05'),(952,'6. 불린 서리태, 볶은 채소, 월계수잎, 타임, 카엔페퍼를 넣고 현미와 서리태가 완전히 익도록  낮은불에서 은근히 끓인다.','MANUAL06'),(952,'','MANUAL07'),(952,'','MANUAL08'),(952,'','MANUAL09'),(952,'','MANUAL10'),(952,'','MANUAL11'),(952,'','MANUAL12'),(952,'','MANUAL13'),(952,'','MANUAL14'),(952,'','MANUAL15'),(952,'','MANUAL16'),(952,'','MANUAL17'),(952,'','MANUAL18'),(952,'','MANUAL19'),(952,'','MANUAL20'),(953,'1. 브로콜리는 작은 송이로 나누고 실파와 그린빈은 0.8cm의 정육면체로 썬 뒤 브로콜리와 그린빈은 끓는 물에 데친다.','MANUAL01'),(953,'2. 당근, 양배추, 홍파프리카, 양파, 청고추는 0.8cm의 정육면체로 썰고 파슬리를 곱게 다진다.','MANUAL02'),(953,'3. 볼에 밀가루, 우유, 달걀, 버터, 다진 파슬리를 넣고 잘 섞는다.','MANUAL03'),(953,'4. 팬에 식용유를 두르고 브로콜리와 그린빈을 뺀 나머지 재료를 볶다가 커리파우더를 넣고 섞는다.','MANUAL04'),(953,'5. 닭육수를 넣어 재료가 익을 때까지 끓인 뒤 물이 자작하게 줄어들면 브로콜리와 그린빈을 넣어 섞는다.','MANUAL05'),(953,'6. 팬에 식용유를 살짝 두르고 국자로 반죽을 떠 넣어 지름 10cm 정도의 얇은 팬케익을 부친다','MANUAL06'),(953,'','MANUAL07'),(953,'','MANUAL08'),(953,'','MANUAL09'),(953,'','MANUAL10'),(953,'','MANUAL11'),(953,'','MANUAL12'),(953,'','MANUAL13'),(953,'','MANUAL14'),(953,'','MANUAL15'),(953,'','MANUAL16'),(953,'','MANUAL17'),(953,'','MANUAL18'),(953,'','MANUAL19'),(953,'','MANUAL20'),(954,'1. 메밀가루, 달걀, 우유, 밀가루, 설탕을 믹서에 갈아 놓는다.','MANUAL01'),(954,'2. 양송이버섯과 양파는 얇게 썬다. 감자는 1cm 정육면체로 잘라서 삶아 놓는다.','MANUAL02'),(954,'3. 팬에 식용유를 두르고 다진 마늘과 로즈마리, 파슬리, 감자를 볶는다.','MANUAL03'),(954,'4. 또 다른 팬에서는 양파를 볶다가 양송이버섯을 넣고 볶아둔다.','MANUAL04'),(954,'5. 팬에 1의 반죽을 얇게 부친 뒤 뒤집어 볶은 양송이버섯과 3의 감자, 달걀을 올린다.','MANUAL05'),(954,'6. 에멘탈 치즈를 고루 뿌리고 반을 접어 완성한다.','MANUAL06'),(954,'','MANUAL07'),(954,'','MANUAL08'),(954,'','MANUAL09'),(954,'','MANUAL10'),(954,'','MANUAL11'),(954,'','MANUAL12'),(954,'','MANUAL13'),(954,'','MANUAL14'),(954,'','MANUAL15'),(954,'','MANUAL16'),(954,'','MANUAL17'),(954,'','MANUAL18'),(954,'','MANUAL19'),(954,'','MANUAL20'),(955,'1. 파인애플은 7cm로 자르고\n남은 자투리와 파, 마늘, 양파,\n표고버섯은 곱게 다진다.','MANUAL01'),(955,'2. 갈빗살은 곱게 다져 간장,\n설탕, 파, 마늘, 참기름, 추후로\n양념한다.','MANUAL02'),(955,'3. 다진 파인애플, 양파, 표고버섯은\n볶아 수분을 제거한다.','MANUAL03'),(955,'4. 전분 일부와 갈빗살, 다진\n파인애플, 양파, 표고버섯을 섞고\n치댄다.','MANUAL04'),(955,'5. 잘라둔 파인애플에 남은 전분을\n묻힌 뒤 고기반죽으로 감싼다.','MANUAL05'),(955,'6. 팬 또는 오븐(180℃, 15분)에\n노릇하게 굽는다.','MANUAL06'),(955,'','MANUAL07'),(955,'','MANUAL08'),(955,'','MANUAL09'),(955,'','MANUAL10'),(955,'','MANUAL11'),(955,'','MANUAL12'),(955,'','MANUAL13'),(955,'','MANUAL14'),(955,'','MANUAL15'),(955,'','MANUAL16'),(955,'','MANUAL17'),(955,'','MANUAL18'),(955,'','MANUAL19'),(955,'','MANUAL20'),(956,'1. 가지는 길이대로 얇게\n슬라이스한 뒤 살짝 굽는다.','MANUAL01'),(956,'2. 파프리카, 당근, 사과는 얇게\n채썬다.','MANUAL02'),(956,'3. 단호박은 속을 파내고 쪄서\n으깬다.','MANUAL03'),(956,'4. 참깨에 마요네즈, 꿀, 간 배를\n넣고 섞어 참깨마요소스를\n만든다.','MANUAL04'),(956,'5. 구운 가지에 단호박을 얇게 \n바르고 야채들을 넣고 돌돌 만다.','MANUAL05'),(956,'6. 참깨마요소스를 올린다.','MANUAL06'),(956,'','MANUAL07'),(956,'','MANUAL08'),(956,'','MANUAL09'),(956,'','MANUAL10'),(956,'','MANUAL11'),(956,'','MANUAL12'),(956,'','MANUAL13'),(956,'','MANUAL14'),(956,'','MANUAL15'),(956,'','MANUAL16'),(956,'','MANUAL17'),(956,'','MANUAL18'),(956,'','MANUAL19'),(956,'','MANUAL20'),(957,'1. 당근, 새송이버섯, 소고기, 양파는\n가늘게 채 썰어 간장, 꿀, 생강가루,\n다진 마늘로 양념한 뒤 볶는다.','MANUAL01'),(957,'2. 두부는 반으로 잘라 속에 칼집을 \n낸 뒤 소금을 뿌려 수분을\n제거한다.','MANUAL02'),(957,'3. 두부에 전분을 골고루 묻힌다.','MANUAL03'),(957,'4. 볶은 야채와 고기를 두부 사이에\n넣는다.','MANUAL04'),(957,'5. 튀김가루, 전분, 차가운 맥주를\n섞어 튀김 반죽을 만든 뒤 두부에\n입혀 170℃기름에 튀긴다.','MANUAL05'),(957,'6. 고추장, 케첩, 올리고당을 섞고\n냄비에 졸여 소스를 만들고 튀긴\n두부를 지진다.','MANUAL06'),(957,'','MANUAL07'),(957,'','MANUAL08'),(957,'','MANUAL09'),(957,'','MANUAL10'),(957,'','MANUAL11'),(957,'','MANUAL12'),(957,'','MANUAL13'),(957,'','MANUAL14'),(957,'','MANUAL15'),(957,'','MANUAL16'),(957,'','MANUAL17'),(957,'','MANUAL18'),(957,'','MANUAL19'),(957,'','MANUAL20'),(958,'1. 곤약은 얇게 편으로 썰어 데친 뒤\n백김치 국물에 절인다.','MANUAL01'),(958,'2. 물에 월계수잎, 통후추, 청주를\n넣고 오징어를 질기지 않게 살짝\n삶는다.','MANUAL02'),(958,'3. 파프리카는 채썰고 백김치는\n물기를 제거한다.','MANUAL03'),(958,'4. 곤약을 깔고 백김치, 오징어,\n파프리카를 얹어 말아준다.','MANUAL04'),(958,'5. 부추로 풀어지지 않게 단단히\n매듭을 짓는다.','MANUAL05'),(958,'6. 아랫부분을 정리하고 접시에\n담는다.','MANUAL06'),(958,'','MANUAL07'),(958,'','MANUAL08'),(958,'','MANUAL09'),(958,'','MANUAL10'),(958,'','MANUAL11'),(958,'','MANUAL12'),(958,'','MANUAL13'),(958,'','MANUAL14'),(958,'','MANUAL15'),(958,'','MANUAL16'),(958,'','MANUAL17'),(958,'','MANUAL18'),(958,'','MANUAL19'),(958,'','MANUAL20'),(959,'1. 소고기는 올리브오일, 매실액,\n레몬즙, 소금, 후춧가루로\n밑간한다.','MANUAL01'),(959,'2. 묵은지는 흐르는 물에 헹궈\n양념을 제거한다.','MANUAL02'),(959,'3. 팽이버섯은 굵은 가닥으로\n분리하고 아스파라거스는\n밑기둥을 제거한다.','MANUAL03'),(959,'4. 빨강, 노랑, 주황 파프리카는\n막대모양으로 썬다.','MANUAL04'),(959,'5. 묵은지 위에 달걀 흰자를 바르고\n소고기를 펼치고 전분을 묻힌 뒤\n야채를 넣고 돌돌 만다.','MANUAL05'),(959,'6. 200℃로 예열한 오븐에 넣고\n15분간 굽는다.','MANUAL06'),(959,'','MANUAL07'),(959,'','MANUAL08'),(959,'','MANUAL09'),(959,'','MANUAL10'),(959,'','MANUAL11'),(959,'','MANUAL12'),(959,'','MANUAL13'),(959,'','MANUAL14'),(959,'','MANUAL15'),(959,'','MANUAL16'),(959,'','MANUAL17'),(959,'','MANUAL18'),(959,'','MANUAL19'),(959,'','MANUAL20'),(960,'1. 달걀을 흰자와 노른자로\n분리한다.','MANUAL01'),(960,'2. 흰자와 노른자를 각각 풀어\n전분과 소금을 넣는다.','MANUAL02'),(960,'3. 팬에 식용유를 두르고 노른자를\n부어 반정도 익힌다.','MANUAL03'),(960,'4. 바나나를 넣고 말아준다.','MANUAL04'),(960,'5. 흰자를 부어 4번을 감싸 \n말아준다.','MANUAL05'),(960,'6. 먹기 좋은 크기로 자른다.','MANUAL06'),(960,'','MANUAL07'),(960,'','MANUAL08'),(960,'','MANUAL09'),(960,'','MANUAL10'),(960,'','MANUAL11'),(960,'','MANUAL12'),(960,'','MANUAL13'),(960,'','MANUAL14'),(960,'','MANUAL15'),(960,'','MANUAL16'),(960,'','MANUAL17'),(960,'','MANUAL18'),(960,'','MANUAL19'),(960,'','MANUAL20'),(961,'1. 마늘은 입자있게 다진다.','MANUAL01'),(961,'2. 닭가슴살, 당근, 가지, 양송이\n버섯은 먹기 좋은 크기로 자른다.','MANUAL02'),(961,'3. 팬에 기름을 두르고 마늘을\n볶다가 가지, 당근, 양송이버섯\n순으로 넣고 볶는다.','MANUAL03'),(961,'4. 그린커리 페이스트를 넣고\n볶는다.','MANUAL04'),(961,'5. 4번에 레몬그라스, 물 한 컵과\n코코넛밀크 2/3를 넣고 끓인다.','MANUAL05'),(961,'6. 코코넛밀크로 농도를 조절하여\n완성한다.','MANUAL06'),(961,'','MANUAL07'),(961,'','MANUAL08'),(961,'','MANUAL09'),(961,'','MANUAL10'),(961,'','MANUAL11'),(961,'','MANUAL12'),(961,'','MANUAL13'),(961,'','MANUAL14'),(961,'','MANUAL15'),(961,'','MANUAL16'),(961,'','MANUAL17'),(961,'','MANUAL18'),(961,'','MANUAL19'),(961,'','MANUAL20'),(962,'1. 고구마는 삶아서 식힌 후 으깬다.','MANUAL01'),(962,'2. 새송이버섯, 양파, 당근은 다진\n후 후춧가루와 소금을 넣고 팬에\n볶는다.','MANUAL02'),(962,'3. 야채가 익으면 현미밥을 넣어\n볶은 후 식힌다.','MANUAL03'),(962,'4. 볶은 현미밥은 속에 고구마를\n채우고 동그란 모양을 만든다.','MANUAL04'),(962,'5. 밀가루, 달걀물, 빵가루 순으로 \n묻힌다.','MANUAL05'),(962,'6. 170~180℃ 기름에 튀긴다.','MANUAL06'),(962,'','MANUAL07'),(962,'','MANUAL08'),(962,'','MANUAL09'),(962,'','MANUAL10'),(962,'','MANUAL11'),(962,'','MANUAL12'),(962,'','MANUAL13'),(962,'','MANUAL14'),(962,'','MANUAL15'),(962,'','MANUAL16'),(962,'','MANUAL17'),(962,'','MANUAL18'),(962,'','MANUAL19'),(962,'','MANUAL20'),(963,'1. 닭가슴살을 슬라이스하여 소금,\n후춧가루로 밑간을 하고 다진\n생강을 발라 잡냄새를 제거한다.','MANUAL01'),(963,'2. 밑간한 닭가슴살에 찹쌀가루를\n묻힌다.','MANUAL02'),(963,'3. 녹말, 식용유, 물을 섞어 반죽을\n만든다.','MANUAL03'),(963,'4. 2번에 반죽을 골고루 묻혀 170℃\n기름에서 튀긴다.','MANUAL04'),(963,'5. 식초와 유자청을 넣고 끓인 후\n간장으로 간을 맞추고 전분을\n풀어 농도를 맞춘다.','MANUAL05'),(963,'6. 튀긴 꿔바로우를 소스에 넣고\n버무린다.','MANUAL06'),(963,'','MANUAL07'),(963,'','MANUAL08'),(963,'','MANUAL09'),(963,'','MANUAL10'),(963,'','MANUAL11'),(963,'','MANUAL12'),(963,'','MANUAL13'),(963,'','MANUAL14'),(963,'','MANUAL15'),(963,'','MANUAL16'),(963,'','MANUAL17'),(963,'','MANUAL18'),(963,'','MANUAL19'),(963,'','MANUAL20'),(964,'1. 참나물은 데친 뒤 잘게 다진다.','MANUAL01'),(964,'2. 양파와 당근은 잘게 다진 뒤\n볶는다.','MANUAL02'),(964,'3. 단호박을 찐 뒤 으깨고 다진\n참나물, 볶은 양파, 당근을 넣고\n소금, 후춧가루로 밑간한다.','MANUAL03'),(964,'4. 빵가루를 조금 넣고 섞어 되직한\n반죽을 만든다.','MANUAL04'),(964,'5. 반죽에 모짜렐라치즈를 넣고\n한입 크기로 빚은 뒤 달걀, 빵가루\n순으로 옷을 입힌다.','MANUAL05'),(964,'6.  170℃ 기름에 튀긴다.','MANUAL06'),(964,'','MANUAL07'),(964,'','MANUAL08'),(964,'','MANUAL09'),(964,'','MANUAL10'),(964,'','MANUAL11'),(964,'','MANUAL12'),(964,'','MANUAL13'),(964,'','MANUAL14'),(964,'','MANUAL15'),(964,'','MANUAL16'),(964,'','MANUAL17'),(964,'','MANUAL18'),(964,'','MANUAL19'),(964,'','MANUAL20'),(965,'1. 냄비에 물 한 컵을 넣고 끓으면\n소금을 조금 넣고 쌀을 넣어\n끓인다.','MANUAL01'),(965,'2. 쌀이 물을 흡수하면 버터를 넣고\n골고루 섞은 뒤 파마산치즈가루를\n넣고 섞어 접시에 펼쳐 식힌다.','MANUAL02'),(965,'3. 방울토마토는 굵게 다진 뒤\n물기를 제거하고 바질은 얇게 채\n썬다.','MANUAL03'),(965,'4. 모짜렐라치즈는 손으로 작게\n뜯어 반은 바질, 토마토와 섞어\n소금과 올리브오일로 간을 하고,\n나머지는 옥수수와 섞는다.','MANUAL04'),(965,'5. 식은 밥에 4번의 소를 각각 넣고\n동그랗게 빚는다.','MANUAL05'),(965,'6. 달걀물, 빵가루 순으로 묻혀\n170℃ 기름에서 튀긴다.','MANUAL06'),(965,'','MANUAL07'),(965,'','MANUAL08'),(965,'','MANUAL09'),(965,'','MANUAL10'),(965,'','MANUAL11'),(965,'','MANUAL12'),(965,'','MANUAL13'),(965,'','MANUAL14'),(965,'','MANUAL15'),(965,'','MANUAL16'),(965,'','MANUAL17'),(965,'','MANUAL18'),(965,'','MANUAL19'),(965,'','MANUAL20'),(966,'1. 양파 40g, 마늘 20g, 대추 2알, 배,\n생강, 간장, 물 70g을 넣고 졸여\n소스를 만든다.','MANUAL01'),(966,'2. 소고기, 돼지고기는 다진 뒤 소금,\n후추, 참기름, 깨, 간장 15g을\n넣어 밑간한다.','MANUAL02'),(966,'3. 양파, 마늘, 대추를 다진 뒤\n밀가루, 식용유와 함께 2번에\n넣고 치댄다.','MANUAL03'),(966,'4. 3번의 반죽을 동그란 모양으로\n빚는다.','MANUAL04'),(966,'5. 팬에 기름을 두르고 미트볼을\n굽는다.','MANUAL05'),(966,'6. 팬에 소스를 부어가며 졸인 뒤\n쪽파, 현미튀밥을 올린다.','MANUAL06'),(966,'','MANUAL07'),(966,'','MANUAL08'),(966,'','MANUAL09'),(966,'','MANUAL10'),(966,'','MANUAL11'),(966,'','MANUAL12'),(966,'','MANUAL13'),(966,'','MANUAL14'),(966,'','MANUAL15'),(966,'','MANUAL16'),(966,'','MANUAL17'),(966,'','MANUAL18'),(966,'','MANUAL19'),(966,'','MANUAL20'),(967,'1. 미지근한 물에 쌀국수 면을\n부드러워질 때까지 불린다.','MANUAL01'),(967,'2. 새우는 소금, 청주, 달걀 흰자,\n전분물로 반죽한 뒤 튀긴다.','MANUAL02'),(967,'3.  팬에 메추리알을 부친다.','MANUAL03'),(967,'4. 팬에 올리브오일과 고추기름을\n두르고 마늘을 살짝 볶은 뒤\n튀긴새우와 쌀국수 면을 넣는다.','MANUAL04'),(967,'5. 굴소스와 식초로 간을 하고\n재료가 다 익어갈 때 시금치를\n넣고 불을 끈다.','MANUAL05'),(967,'6. 땅콩가루와 메추리알을 올려\n마무리한다.','MANUAL06'),(967,'','MANUAL07'),(967,'','MANUAL08'),(967,'','MANUAL09'),(967,'','MANUAL10'),(967,'','MANUAL11'),(967,'','MANUAL12'),(967,'','MANUAL13'),(967,'','MANUAL14'),(967,'','MANUAL15'),(967,'','MANUAL16'),(967,'','MANUAL17'),(967,'','MANUAL18'),(967,'','MANUAL19'),(967,'','MANUAL20'),(968,'1. 새우는 꼬리와 껍질을 제거한 뒤 \n후추로 밑간한다.','MANUAL01'),(968,'2. 단호박은 찜기에 찐다','MANUAL02'),(968,'3. 대파와 양배추는 4cm 길이로\n썬다.','MANUAL03'),(968,'4. 찐단호박을 4cm 길이로 썬다.','MANUAL04'),(968,'5. 프라이팬에 새우, 단호박, 대파, \n양배추, 방울토마토를 굽는다..','MANUAL05'),(968,'6. 꼬지에 보기 좋게 끼운다.','MANUAL06'),(968,'','MANUAL07'),(968,'','MANUAL08'),(968,'','MANUAL09'),(968,'','MANUAL10'),(968,'','MANUAL11'),(968,'','MANUAL12'),(968,'','MANUAL13'),(968,'','MANUAL14'),(968,'','MANUAL15'),(968,'','MANUAL16'),(968,'','MANUAL17'),(968,'','MANUAL18'),(968,'','MANUAL19'),(968,'','MANUAL20'),(969,'1. 닭가슴살은 10cm 길이로 얇게\n자른다.','MANUAL01'),(969,'2. 닭가슴살에 소금, 후춧가루로\n밑간을 한다.','MANUAL02'),(969,'3. 아몬드슬라이스를 잘게 다지고\n흑임자, 참깨와 섞는다.','MANUAL03'),(969,'4. 닭가슴살에 3번을 묻힌다.','MANUAL04'),(969,'5. 팬에 식용유를 두르고 4번을 \n노릇하게 굽는다.','MANUAL05'),(969,'6. 꼬지에 꽂는다.','MANUAL06'),(969,'','MANUAL07'),(969,'','MANUAL08'),(969,'','MANUAL09'),(969,'','MANUAL10'),(969,'','MANUAL11'),(969,'','MANUAL12'),(969,'','MANUAL13'),(969,'','MANUAL14'),(969,'','MANUAL15'),(969,'','MANUAL16'),(969,'','MANUAL17'),(969,'','MANUAL18'),(969,'','MANUAL19'),(969,'','MANUAL20'),(970,'1. 바게트는 1cm 두께로 잘라 한쪽\n면에 다진 마늘과 올리브오일을\n발라 팬에 굽고 식힌다.','MANUAL01'),(970,'2. 방울토마토는 씨를 제거하고\n다진 뒤 물기를 빼주고 바질은\n얇게 슬라이스 한다.','MANUAL02'),(970,'3. 생모짜렐라치즈를 잘게 찢고\n방울토마토, 바질과 함께 소금,\n올리브오일에 섞는다.','MANUAL03'),(970,'4. 새송이버섯, 표고버섯, 마늘은\n잘게 다진다.','MANUAL04'),(970,'5. 팬에 올리브오일을 두르고 다진 \n마늘을 볶다가 표고버섯과\n새송이버섯을 넣어 볶는다.','MANUAL05'),(970,'6. 바게트에 각각 소를 얹는다.','MANUAL06'),(970,'','MANUAL07'),(970,'','MANUAL08'),(970,'','MANUAL09'),(970,'','MANUAL10'),(970,'','MANUAL11'),(970,'','MANUAL12'),(970,'','MANUAL13'),(970,'','MANUAL14'),(970,'','MANUAL15'),(970,'','MANUAL16'),(970,'','MANUAL17'),(970,'','MANUAL18'),(970,'','MANUAL19'),(970,'','MANUAL20'),(971,'1. 연근, 우엉은 껍질을 벗겨 0.2cm\n두게로 슬라이스한 뒤 식촛물에\n담군다.','MANUAL01'),(971,'2. 레디쉬는 얇게 슬라이스하여\n얼음물에 담그고 오렌지는\n껍질을 벗겨 과육만 분리한다.','MANUAL02'),(971,'3. 우엉과 연근을 끓는 물에 데친\n뒤 얼음물에 담궈 열기를 식히고\n물기를 뺀다.','MANUAL03'),(971,'4. 요거트와 머스터드를 섞어\n소스를 만들고 땅콩, 호두는 잘게\n부순다.','MANUAL04'),(971,'5. 연근, 우엉, 레디쉬, 오렌지, 땅콩, \n호두를 만들어둔 소스와 함께\n버무린다.','MANUAL05'),(971,'6. 그릇에 담고 크랜베리를 올린다.','MANUAL06'),(971,'','MANUAL07'),(971,'','MANUAL08'),(971,'','MANUAL09'),(971,'','MANUAL10'),(971,'','MANUAL11'),(971,'','MANUAL12'),(971,'','MANUAL13'),(971,'','MANUAL14'),(971,'','MANUAL15'),(971,'','MANUAL16'),(971,'','MANUAL17'),(971,'','MANUAL18'),(971,'','MANUAL19'),(971,'','MANUAL20'),(972,'1. 당근, 돼지호박은 큼직하게 썬다.','MANUAL01'),(972,'2. 셀러리와 양파는 곱게 다진다.','MANUAL02'),(972,'3. 믹서에 당근, 돼지호박, 저지방우유, 달걀, 중력분, 머스터드 파우더, 저나트륨 베이킹 파우더, 후춧가루를 넣고 간다.','MANUAL03'),(972,'4. 3을 그릇에 붓고 셀러리와 양파를 섞는다.','MANUAL04'),(972,'5. 팬에 식용유를 넣고 팬케이크를 부친다.','MANUAL05'),(972,'6. 메이플시럽을 곁들여 낸다.','MANUAL06'),(972,'','MANUAL07'),(972,'','MANUAL08'),(972,'','MANUAL09'),(972,'','MANUAL10'),(972,'','MANUAL11'),(972,'','MANUAL12'),(972,'','MANUAL13'),(972,'','MANUAL14'),(972,'','MANUAL15'),(972,'','MANUAL16'),(972,'','MANUAL17'),(972,'','MANUAL18'),(972,'','MANUAL19'),(972,'','MANUAL20'),(973,'1. 찬밥에 달걀흰자, 밀가루를 넣고 되직하게 반죽한다.','MANUAL01'),(973,'2. 1cm두께로 민 뒤 둥근 모양 또는 하트 모양으로 만든다.','MANUAL02'),(973,'3. 땅콩, 호두는 잘게 다진다.','MANUAL03'),(973,'4. 팬에 식용유를 넣고 빚어 놓은 밥을 앞, 뒤로 노릇하게 굽는다.','MANUAL04'),(973,'5. 구워진 밥 과자 윗면에 딸기잼을 바른다.','MANUAL05'),(973,'6. 건포도, 호두, 땅콩을 고루 얹어준다.','MANUAL06'),(973,'','MANUAL07'),(973,'','MANUAL08'),(973,'','MANUAL09'),(973,'','MANUAL10'),(973,'','MANUAL11'),(973,'','MANUAL12'),(973,'','MANUAL13'),(973,'','MANUAL14'),(973,'','MANUAL15'),(973,'','MANUAL16'),(973,'','MANUAL17'),(973,'','MANUAL18'),(973,'','MANUAL19'),(973,'','MANUAL20'),(974,'1. 카스텔라는 굵게 떼어 믹서기에 곱게간다.','MANUAL01'),(974,'2. 단호박은 깨끗이 씻어 찜통에 넣고 쪄낸 뒤 껍질을 제거하고 뜨거울 때 체에 내린다.','MANUAL02'),(974,'3. 찹쌀가루에 소금을 넣고 뜨거운 물을 조금씩 부으면서 익반죽 하다가 2의 으깬 단호박을 넣고 되직해질 때까지 반죽한다.','MANUAL03'),(974,'4. 3의 반죽을 떼어내 손바닥으로 동그랗게 굴려서 가운데 잣을 하나씩 넣고 동그랗게 빚는다.','MANUAL04'),(974,'5. 끓는 물에 4의 경단을 넣고 삶아 둥둥 떠오르면  잠시 두었다 건져 차가운 물에 헹군다.','MANUAL05'),(974,'6. 경단에 카스텔라 가루를 1/3가량 뭍하고 건포도와 호박씨로 장식한다.','MANUAL06'),(974,'','MANUAL07'),(974,'','MANUAL08'),(974,'','MANUAL09'),(974,'','MANUAL10'),(974,'','MANUAL11'),(974,'','MANUAL12'),(974,'','MANUAL13'),(974,'','MANUAL14'),(974,'','MANUAL15'),(974,'','MANUAL16'),(974,'','MANUAL17'),(974,'','MANUAL18'),(974,'','MANUAL19'),(974,'','MANUAL20'),(975,'1. 표고버섯은 불려서 기둥을 떼고 끓는 물에 삶은 다음 물기를 제거한다.','MANUAL01'),(975,'2. 손질한 표고버섯은 간장, 다진마늘, 참기름으로 양념한다.','MANUAL02'),(975,'3. 연근은 껍질을 벗기고 깍둑 썰기하여 식초 물에 담근다.','MANUAL03'),(975,'4. 파프리카는 마름모 형태로 썰고 브로콜리는 한 입 크기의 송이로 자른다.','MANUAL04'),(975,'5. 준비한 재료에 녹말가루를 충분히 묻혀서 170℃ 정도의 식용유에서 튀겨낸다.','MANUAL05'),(975,'6. 레드와인, 간장, 식초, 설탕을 넣고 20분가량 끓여 졸인다음 녹말과 물을 섞은 물녹말로 농도를 맞추어 4에 끼얹어 낸다','MANUAL06'),(975,'','MANUAL07'),(975,'','MANUAL08'),(975,'','MANUAL09'),(975,'','MANUAL10'),(975,'','MANUAL11'),(975,'','MANUAL12'),(975,'','MANUAL13'),(975,'','MANUAL14'),(975,'','MANUAL15'),(975,'','MANUAL16'),(975,'','MANUAL17'),(975,'','MANUAL18'),(975,'','MANUAL19'),(975,'','MANUAL20'),(976,'1. 새싹과 무순은 씻어 물기를 제거한다.','MANUAL01'),(976,'2. 셀러리는 껍질을 벗겨 3cm로 어슷썬다.','MANUAL02'),(976,'3. 쑥갓은 3cm로 썰고, 래디쉬는 채썬다.','MANUAL03'),(976,'4. 다진 소고기는 고기양념을 한다.','MANUAL04'),(976,'5. 팬에 식용유를 소량 넣고 양념한 소고기를 볶다가 분량의 소스 재료를 넣고 볶아 저나트륨 볶음고추장을 만든다.','MANUAL05'),(976,'6. 그릇에 밥을 담고 준비된 새싹과 채소를 돌려담고 저나트륨 볶음고추장을 곁들인다.','MANUAL06'),(976,'','MANUAL07'),(976,'','MANUAL08'),(976,'','MANUAL09'),(976,'','MANUAL10'),(976,'','MANUAL11'),(976,'','MANUAL12'),(976,'','MANUAL13'),(976,'','MANUAL14'),(976,'','MANUAL15'),(976,'','MANUAL16'),(976,'','MANUAL17'),(976,'','MANUAL18'),(976,'','MANUAL19'),(976,'','MANUAL20'),(977,'1. 가지를 깨끗하게 씻어 1x1x4cm로 썬다.','MANUAL01'),(977,'2. 생강을 곱게 다진다.','MANUAL02'),(977,'3. 고추장, 물엿, 통깨와 섞어 양념장을 만든다.','MANUAL03'),(977,'4. 팬에 들기름을 넣고 센불에서 가지를 볶는다.','MANUAL04'),(977,'5. 가지가 다 볶아지면 양념장을 넣어 양념장이 섞일 정도로만 볶는다.','MANUAL05'),(977,'6. 접시에 담는다.','MANUAL06'),(977,'','MANUAL07'),(977,'','MANUAL08'),(977,'','MANUAL09'),(977,'','MANUAL10'),(977,'','MANUAL11'),(977,'','MANUAL12'),(977,'','MANUAL13'),(977,'','MANUAL14'),(977,'','MANUAL15'),(977,'','MANUAL16'),(977,'','MANUAL17'),(977,'','MANUAL18'),(977,'','MANUAL19'),(977,'','MANUAL20'),(978,'1. 감자는 껍질을 벗긴다.','MANUAL01'),(978,'2. 감자는 0.3x0.2x7cm로 채썬다.','MANUAL02'),(978,'3. 오이는 씻어 0.3x0.2x7cm로 채썬다.','MANUAL03'),(978,'4. 래디쉬는 씻어 0.3x0.2x2cm로 채썬다.','MANUAL04'),(978,'5. 단촛물을 감자, 오이, 래디쉬를 각각 담궜다가 물기를 뺀다.','MANUAL05'),(978,'6. 채소를 차게 두었다가 겨자초장을 곁들인다.','MANUAL06'),(978,'','MANUAL07'),(978,'','MANUAL08'),(978,'','MANUAL09'),(978,'','MANUAL10'),(978,'','MANUAL11'),(978,'','MANUAL12'),(978,'','MANUAL13'),(978,'','MANUAL14'),(978,'','MANUAL15'),(978,'','MANUAL16'),(978,'','MANUAL17'),(978,'','MANUAL18'),(978,'','MANUAL19'),(978,'','MANUAL20'),(979,'1. 고추는 반으로 갈라 속을 제거한다.','MANUAL01'),(979,'2. 손질한 고추는 3cm 길이로 채썬다.','MANUAL02'),(979,'3. 죽순, 표고버섯, 대파, 생강을 채썬다.','MANUAL03'),(979,'4. 돼지고기는 얇게 저민 후 0.3x5cm 길이로 곱게 채썰어 밑간 한다.','MANUAL04'),(979,'5. 밑간 한 돼지고기를 달걀흰자, 녹말가루에 묻혀 놓는다.','MANUAL05'),(979,'6. 팬에 식용유를 넣고 생강을 볶아 향을 내고 채소, 고기를 넣어 볶다가 간을 한 다음 참기름을 두르고 굽는다.','MANUAL06'),(979,'','MANUAL07'),(979,'','MANUAL08'),(979,'','MANUAL09'),(979,'','MANUAL10'),(979,'','MANUAL11'),(979,'','MANUAL12'),(979,'','MANUAL13'),(979,'','MANUAL14'),(979,'','MANUAL15'),(979,'','MANUAL16'),(979,'','MANUAL17'),(979,'','MANUAL18'),(979,'','MANUAL19'),(979,'','MANUAL20'),(980,'1. 배추, 무는 2x2cm로 나박썬다.','MANUAL01'),(980,'2. 썰어논 배추, 무는 소금에 살짝 절여둔다.','MANUAL02'),(980,'3. 당근은 모양을 내어 썰고 실파, 미나리도 2cm로 썰어둔다.','MANUAL03'),(980,'4. 마늘과 생강, 홍고추는 채썰고 수삼은 어슷하게 썬다.','MANUAL04'),(980,'5. 물을 끓여 식힌 후 소창에 고춧가루를 싸서 김치국물을 만든다.','MANUAL05'),(980,'6. 무와 배추가 절여지며 준비한 재료들에 김치국물을 부어 완성한다.','MANUAL06'),(980,'','MANUAL07'),(980,'','MANUAL08'),(980,'','MANUAL09'),(980,'','MANUAL10'),(980,'','MANUAL11'),(980,'','MANUAL12'),(980,'','MANUAL13'),(980,'','MANUAL14'),(980,'','MANUAL15'),(980,'','MANUAL16'),(980,'','MANUAL17'),(980,'','MANUAL18'),(980,'','MANUAL19'),(980,'','MANUAL20'),(981,'1. 당면은 물에 불렸다가 끓는 물에 충분히 삶아 부드러워지면 차가운 물에 헹구어 물기를 뺀다.','MANUAL01'),(981,'2. 표고버섯은 불려 꼭 짜 채썬다.','MANUAL02'),(981,'3. 표교버섯은 간장, 들기름에 무쳐 팬에 볶는다.','MANUAL03'),(981,'4. 양배추, 오이, 당근, 깻잎, 상추, 피망, 파프리카는 곱게 채썬다.','MANUAL04'),(981,'5. 배를 강판에 갈아 간장, 소금, 식초, 겨자, 설탕을 넣어 잡채 양념을 만든다.','MANUAL05'),(981,'6. 큰 접시에 준비된 채소를 예쁘게 돌려 담고 가운데 당면을 놓은 후 양념을 부어준다.','MANUAL06'),(981,'','MANUAL07'),(981,'','MANUAL08'),(981,'','MANUAL09'),(981,'','MANUAL10'),(981,'','MANUAL11'),(981,'','MANUAL12'),(981,'','MANUAL13'),(981,'','MANUAL14'),(981,'','MANUAL15'),(981,'','MANUAL16'),(981,'','MANUAL17'),(981,'','MANUAL18'),(981,'','MANUAL19'),(981,'','MANUAL20'),(982,'1. 단호박은 깨끗이 씻어 반을 갈라 씨를 제거하고 찜통에서 쪄낸다.','MANUAL01'),(982,'2. 식힌 단호박은 껍질을 제거하고 한 입 크기로 썬다.','MANUAL02'),(982,'3. 두부는 1.5cm 정육면체로 썰어 데친다.','MANUAL03'),(982,'4. 마늘은 편으로 썰고 청고추는 송송 썰어 팬에 볶는다.','MANUAL04'),(982,'5. 간장에 분량의 재료를 한데 섞어 살짝 끓여 식힌다.','MANUAL05'),(982,'6. 준비된 재료를 담고 소스를 뿌린다.','MANUAL06'),(982,'','MANUAL07'),(982,'','MANUAL08'),(982,'','MANUAL09'),(982,'','MANUAL10'),(982,'','MANUAL11'),(982,'','MANUAL12'),(982,'','MANUAL13'),(982,'','MANUAL14'),(982,'','MANUAL15'),(982,'','MANUAL16'),(982,'','MANUAL17'),(982,'','MANUAL18'),(982,'','MANUAL19'),(982,'','MANUAL20'),(983,'1. 단호박은 껍질을 벗겨 속살은 그대로 두고 씨만 털어 낸다.','MANUAL01'),(983,'2. 속살은 숟가락으로 긁어내어 다진다.','MANUAL02'),(983,'3. 나머지 부분은 채썰어 2~3번 다진 후 소금을 조금 넣고 살짝 절인다.','MANUAL03'),(983,'4. 호박에 물기가 생기면 밀가루를 넣어 되직하게 반죽한다.','MANUAL04'),(983,'5. 팬이 가열되면 식용유를 넣고 한 숟가락씩 떠넣어 얇게 펴서 부친다.','MANUAL05'),(983,'6. 앞뒤로 노릇하게 부치고 접시에 담아 완성한다.','MANUAL06'),(983,'','MANUAL07'),(983,'','MANUAL08'),(983,'','MANUAL09'),(983,'','MANUAL10'),(983,'','MANUAL11'),(983,'','MANUAL12'),(983,'','MANUAL13'),(983,'','MANUAL14'),(983,'','MANUAL15'),(983,'','MANUAL16'),(983,'','MANUAL17'),(983,'','MANUAL18'),(983,'','MANUAL19'),(983,'','MANUAL20'),(984,'1. 통 도라지는 껍질을 벗기고 0.3cm 두께로 썬다.','MANUAL01'),(984,'2. 손질한 도라지는 옅은 소름물에 잠시 담가 쓴맛을 없애고 차가운 물에 헹궈 물기를 닦는다. (3% 소금물)','MANUAL02'),(984,'3. 그릇에 찹쌀가루와 튀김가루를 넣어 걸쭉한 농도가 되도록 물을 부어 튀김옷의 농도를 맞춘다.','MANUAL03'),(984,'4. 농도를 맞춘 튀김옷 반죽에 검은깨를 섞는다.','MANUAL04'),(984,'5. 손질한 도라지에 튀김옷을 입혀 170℃의 식용유에 튀긴다.','MANUAL05'),(984,'6. 저나트륨 간장소스를 곁들인다.','MANUAL06'),(984,'','MANUAL07'),(984,'','MANUAL08'),(984,'','MANUAL09'),(984,'','MANUAL10'),(984,'','MANUAL11'),(984,'','MANUAL12'),(984,'','MANUAL13'),(984,'','MANUAL14'),(984,'','MANUAL15'),(984,'','MANUAL16'),(984,'','MANUAL17'),(984,'','MANUAL18'),(984,'','MANUAL19'),(984,'','MANUAL20'),(985,'1. 브로콜리와 컬리플라워는 한 입 크기로 손질한다.','MANUAL01'),(985,'2. 당근, 돼지호박, 양파는 5cm 길이로 가늘게 채썬다.','MANUAL02'),(985,'3. 가지는 길게 썬다.','MANUAL03'),(985,'4. 브로콜리, 컬리플라워, 당근을 끓는 물에 데친 후 냉수에 헹궈낸다.','MANUAL04'),(985,'5. 발사믹소스를 만든다.','MANUAL05'),(985,'6. 준비한 채소들을 발사믹소스에 절인다.','MANUAL06'),(985,'','MANUAL07'),(985,'','MANUAL08'),(985,'','MANUAL09'),(985,'','MANUAL10'),(985,'','MANUAL11'),(985,'','MANUAL12'),(985,'','MANUAL13'),(985,'','MANUAL14'),(985,'','MANUAL15'),(985,'','MANUAL16'),(985,'','MANUAL17'),(985,'','MANUAL18'),(985,'','MANUAL19'),(985,'','MANUAL20'),(986,'1. 버섯들은 잘 씻어 건진다.','MANUAL01'),(986,'2. 팬에 식용유를 두르고 버섯을 넣어 175℃ 오븐에서 5분 가열한다.','MANUAL02'),(986,'3. 소스 양념을 모두 섞어 끓인다.','MANUAL03'),(986,'4. 오븐에 구운 버섯에 3의 소스를 뿌린다.','MANUAL04'),(986,'5. 부추를 버섯크기와 비슷하게 썬다.','MANUAL05'),(986,'6. 썬 부추나 실파로 장식한다.','MANUAL06'),(986,'','MANUAL07'),(986,'','MANUAL08'),(986,'','MANUAL09'),(986,'','MANUAL10'),(986,'','MANUAL11'),(986,'','MANUAL12'),(986,'','MANUAL13'),(986,'','MANUAL14'),(986,'','MANUAL15'),(986,'','MANUAL16'),(986,'','MANUAL17'),(986,'','MANUAL18'),(986,'','MANUAL19'),(986,'','MANUAL20'),(987,'1. 비트는 물에 삶아 80%를 익힌다.','MANUAL01'),(987,'2. 껍질을 벗기고 모양내어 썬다.','MANUAL02'),(987,'3. 비트는 분량에 맞게 양념한다.','MANUAL03'),(987,'4. 양념한비트는 175℃ 오븐에서 굽는다.','MANUAL04'),(987,'5. 호두캐러멜을 만든다. (펜에 설탕과 물을 녹이고 계피, 넉맷을 넣은 뒤 호두를 넣는다.)','MANUAL05'),(987,'6. 그릇에 비트와 호두캐러멜을 담고 사워크림과 다진 파슬리로 장식한다.','MANUAL06'),(987,'','MANUAL07'),(987,'','MANUAL08'),(987,'','MANUAL09'),(987,'','MANUAL10'),(987,'','MANUAL11'),(987,'','MANUAL12'),(987,'','MANUAL13'),(987,'','MANUAL14'),(987,'','MANUAL15'),(987,'','MANUAL16'),(987,'','MANUAL17'),(987,'','MANUAL18'),(987,'','MANUAL19'),(987,'','MANUAL20'),(988,'1. 상추를 깨끗하게 씻어 물기를 뺀 후 먹기 좋게 자른다.','MANUAL01'),(988,'2. 영양부추는 3cm 길이로 썰고, 양파는 3cm 길이로 얇게 채썬다.','MANUAL02'),(988,'3. 홍고추도 3cm 길이로 얄게 채썬다.','MANUAL03'),(988,'4. 모든 채소들을 차가운 물에 담갔다가 물기를 빼서 준비해둔다.','MANUAL04'),(988,'5. 간장에 물, 매실농축액, 고춧가루, 통깨, 식초를 넣어 겉절이 양념을 만든다.','MANUAL05'),(988,'6. 상추에 양념을 넣고 젓가락으로 섞어준다.','MANUAL06'),(988,'','MANUAL07'),(988,'','MANUAL08'),(988,'','MANUAL09'),(988,'','MANUAL10'),(988,'','MANUAL11'),(988,'','MANUAL12'),(988,'','MANUAL13'),(988,'','MANUAL14'),(988,'','MANUAL15'),(988,'','MANUAL16'),(988,'','MANUAL17'),(988,'','MANUAL18'),(988,'','MANUAL19'),(988,'','MANUAL20'),(989,'1. 연근 껍질을 제거하고 0.5cm\n두께로 끓는 물에 소금, 식초를\n넣어 살짝 데친다.','MANUAL01'),(989,'2. 고구마는 껍질을 제거하고 삶아\n으깬다.','MANUAL02'),(989,'3. 견과류는 잘게 다져 삶은\n고구마에 섞어 동그랑땡\n모양으로 만든다.','MANUAL03'),(989,'4. 튀김가루, 달걀, 소금을 넣고 튀김\n반죽을 만든다.(백년초가루로\n2가지 색의 반죽을 만든다)','MANUAL04'),(989,'5. 연근 사이에 으깬 고구마를\n넣는다.','MANUAL05'),(989,'6. 연근 샌드위치를 만들어 170℃\n기름에 튀긴다.','MANUAL06'),(989,'','MANUAL07'),(989,'','MANUAL08'),(989,'','MANUAL09'),(989,'','MANUAL10'),(989,'','MANUAL11'),(989,'','MANUAL12'),(989,'','MANUAL13'),(989,'','MANUAL14'),(989,'','MANUAL15'),(989,'','MANUAL16'),(989,'','MANUAL17'),(989,'','MANUAL18'),(989,'','MANUAL19'),(989,'','MANUAL20'),(990,'1. 무를 깍둑썰기하여 소금에 30분 \n간 절인다.','MANUAL01'),(990,'2. 실파를 잘게 다진다.','MANUAL02'),(990,'3. 파프리카, 사과, 멸치액젓,\n올리고당을 믹서에 넣고 간다.','MANUAL03'),(990,'4. 멸치로 다시물을 만들고\n현미밥과 다시물을 1:1로 넣어\n끓인 후 현미풀을 만든다.','MANUAL04'),(990,'5. 3번에 실파, 현미풀, 다진 마늘을\n넣고 양념을 만든다.','MANUAL05'),(990,'6. 절인 무를 체에 받쳐 소금물을\n제거하고 양념을 넣어 버무린다.','MANUAL06'),(990,'','MANUAL07'),(990,'','MANUAL08'),(990,'','MANUAL09'),(990,'','MANUAL10'),(990,'','MANUAL11'),(990,'','MANUAL12'),(990,'','MANUAL13'),(990,'','MANUAL14'),(990,'','MANUAL15'),(990,'','MANUAL16'),(990,'','MANUAL17'),(990,'','MANUAL18'),(990,'','MANUAL19'),(990,'','MANUAL20'),(991,'1. 토마토는 십자로 칼집을 내고\n끓는 물에 살짝 데쳐 껍질을\n벗긴다.','MANUAL01'),(991,'2. 사과, 복숭아는 깍둑썰고 소금에 \n10분 정도 절인다.','MANUAL02'),(991,'3. 배를 강판에 갈고, 마늘은 다진다.','MANUAL03'),(991,'4. 갈아둔 배에 고춧가루, 다진 마늘,\n깨, 참기름을 섞어 양념을 만든다.','MANUAL04'),(991,'5.  절여둔 과일을 양념과 섞는다.','MANUAL05'),(991,'6. 치커리를 넣고 섞는다.','MANUAL06'),(991,'','MANUAL07'),(991,'','MANUAL08'),(991,'','MANUAL09'),(991,'','MANUAL10'),(991,'','MANUAL11'),(991,'','MANUAL12'),(991,'','MANUAL13'),(991,'','MANUAL14'),(991,'','MANUAL15'),(991,'','MANUAL16'),(991,'','MANUAL17'),(991,'','MANUAL18'),(991,'','MANUAL19'),(991,'','MANUAL20'),(992,'1. 오이를 끓는 소금물에 넣고\n돌맹이로 누른다.','MANUAL01'),(992,'2. 오이 색이 노랗게 변하면 썰어서 \n물기를 완전히 제거한다.','MANUAL02'),(992,'3. 파, 마늘을 다진다.','MANUAL03'),(992,'4. 양파, 고춧가루, 매실액을 믹서에\n넣고 간다.','MANUAL04'),(992,'5. 4번에 참깨, 다진 파, 마늘, \n참기름을 섞어 양념을 만든다.','MANUAL05'),(992,'6. 오이에 양념을 넣고 잘 버무린다.','MANUAL06'),(992,'','MANUAL07'),(992,'','MANUAL08'),(992,'','MANUAL09'),(992,'','MANUAL10'),(992,'','MANUAL11'),(992,'','MANUAL12'),(992,'','MANUAL13'),(992,'','MANUAL14'),(992,'','MANUAL15'),(992,'','MANUAL16'),(992,'','MANUAL17'),(992,'','MANUAL18'),(992,'','MANUAL19'),(992,'','MANUAL20'),(993,'1. 무와 배추를 1x4x1cm 크기로 \n자른다.','MANUAL01'),(993,'2. 비트는 2x4x0.3cm로 자른다.','MANUAL02'),(993,'3. 당근은 모양내어 자른다.','MANUAL03'),(993,'4. 껍질 벗긴 사과와 물을 1:1 비율로\n넣고 갈아 체에 내려 건더기를\n제거한다.','MANUAL04'),(993,'5. 4번에 식초를 2:1 비율로 넣고\n월계수잎, 통후추를 넣고\n끓여준다.','MANUAL05'),(993,'6. 손질한 무, 배추, 비트, 당근을\n넣고 식혀준다.','MANUAL06'),(993,'','MANUAL07'),(993,'','MANUAL08'),(993,'','MANUAL09'),(993,'','MANUAL10'),(993,'','MANUAL11'),(993,'','MANUAL12'),(993,'','MANUAL13'),(993,'','MANUAL14'),(993,'','MANUAL15'),(993,'','MANUAL16'),(993,'','MANUAL17'),(993,'','MANUAL18'),(993,'','MANUAL19'),(993,'','MANUAL20'),(994,'1. 진미채는 미지근한 물에 불린 뒤\n물기를 뺀다.','MANUAL01'),(994,'2. 물기 뺀 진미채를 따끈해질 \n때까지 마른 팬에 살짝 볶는다.','MANUAL02'),(994,'3. 유자청은 잘게 다진다.','MANUAL03'),(994,'4. 유자청에 마요네즈, 와사비,\n레몬즙을 섞어 양념을 만든다.','MANUAL04'),(994,'5. 진미채에 양념을 소량씩 \n넣으면서 버무린다.','MANUAL05'),(994,'6. 깨를 뿌려 마무리한다.','MANUAL06'),(994,'','MANUAL07'),(994,'','MANUAL08'),(994,'','MANUAL09'),(994,'','MANUAL10'),(994,'','MANUAL11'),(994,'','MANUAL12'),(994,'','MANUAL13'),(994,'','MANUAL14'),(994,'','MANUAL15'),(994,'','MANUAL16'),(994,'','MANUAL17'),(994,'','MANUAL18'),(994,'','MANUAL19'),(994,'','MANUAL20'),(995,'1. 강력분, 꿀, 달걀, 이스트, 소금,\n탈지분유, 제빵개량제, 물을\n믹서에 넣고 섞는다.','MANUAL01'),(995,'2. 가루가 모두 녹아 섞이면 버터를\n넣고 완전히 섞은 뒤 세 덩어리로\n나눈다.','MANUAL02'),(995,'3. 60분 간 1차 발효 후 40g씩\n분할하여 둥글리기하고 15분 간\n중간 발효 한다.','MANUAL03'),(995,'4. 반죽을 손으로 굴려 뭉툭한 원뿔\n모양을 만들고 밀대로 밀어 긴\n삼각형 모양을 만든다.','MANUAL04'),(995,'5. 각 반죽에 홍시/호두, 곶감/대추,\n블루베리/크랜베리를 넣고\n버터롤을 모양을 만든다.','MANUAL05'),(995,'6. 40분 간 2차 발효 후 210℃\n오븐에서 10분 간 굽는다.','MANUAL06'),(995,'','MANUAL07'),(995,'','MANUAL08'),(995,'','MANUAL09'),(995,'','MANUAL10'),(995,'','MANUAL11'),(995,'','MANUAL12'),(995,'','MANUAL13'),(995,'','MANUAL14'),(995,'','MANUAL15'),(995,'','MANUAL16'),(995,'','MANUAL17'),(995,'','MANUAL18'),(995,'','MANUAL19'),(995,'','MANUAL20'),(996,'1. 고구마는 껍질을 벗기고 적당한\n크기로 썰어 삶은 뒤 50g은\n으깨고 25g은 작게 자른다.','MANUAL01'),(996,'2. 으깬 고구마에 달걀노른자,\n우유를 넣고 섞는다.','MANUAL02'),(996,'3. 달걀흰자는 머랭을 만들어\n2번과 섞은 뒤 크랜베리, 잘라둔\n고구마와 살살 섞는다.','MANUAL03'),(996,'4. 유리용기 안쪽에 올리브오일을\n바르고 잘게 부순 아몬드와 호두를\n뿌린 뒤 3번을 담고 전자레인지로\n7분 간 가열한다.','MANUAL04'),(996,'5. 제철과일을 중불에서 10분 간 끓인\n뒤 올리고당을 넣고 한소끔 끓이고,\n레몬즙을 넣고 다시 한소끔 끓여\n저당 과일잼을 만든다.','MANUAL05'),(996,'6. 4번을 접시에 뒤집어 담고 저당\n과일잼을 곁들인다.','MANUAL06'),(996,'','MANUAL07'),(996,'','MANUAL08'),(996,'','MANUAL09'),(996,'','MANUAL10'),(996,'','MANUAL11'),(996,'','MANUAL12'),(996,'','MANUAL13'),(996,'','MANUAL14'),(996,'','MANUAL15'),(996,'','MANUAL16'),(996,'','MANUAL17'),(996,'','MANUAL18'),(996,'','MANUAL19'),(996,'','MANUAL20'),(997,'1. 고구마는 삶은 뒤 껍질을\n제거한다.','MANUAL01'),(997,'2. 쌀가루, 보릿가루, 밀가루는 체에\n내린다.','MANUAL02'),(997,'3. 체에 내린 가루에 삶은 고구마,\n감말랭이, 냉동딸기, 흑임자를\n넣고 믹서에 간다.','MANUAL03'),(997,'4. 믹서에 간 반죽을 10cm 길이의 \n스틱모양으로 성형한다.','MANUAL04'),(997,'5. 170℃ 기름에 반죽을 튀긴다.','MANUAL05'),(997,'6. 기름을 제거하고 그릇에 담는다.','MANUAL06'),(997,'','MANUAL07'),(997,'','MANUAL08'),(997,'','MANUAL09'),(997,'','MANUAL10'),(997,'','MANUAL11'),(997,'','MANUAL12'),(997,'','MANUAL13'),(997,'','MANUAL14'),(997,'','MANUAL15'),(997,'','MANUAL16'),(997,'','MANUAL17'),(997,'','MANUAL18'),(997,'','MANUAL19'),(997,'','MANUAL20'),(998,'1. 달걀노른자, 밀가루,\n베이킹파우더, 우유, 소금을 섞어\n반죽을 만든다.','MANUAL01'),(998,'2. 바나나 절반은 0.5cm 두께로\n자르고 나머지는 잘게 다진다.','MANUAL02'),(998,'3. 타르트팬에 버터를 바른 뒤\n반죽을 얇게 깔고 그 위에\n바나나를 담고 소금을 조금\n뿌린다.','MANUAL03'),(998,'4. 3번에 달걀흰자로 만든 머랭을\n올린다.','MANUAL04'),(998,'5. 머랭 가운데 바나나 1조각을\n올리고 노른자 물을 바른다.','MANUAL05'),(998,'6. 달군 팬에 물을 넣고 타르트팬\n채로 넣은 뒤 약불에서 15분 간\n익힌다.','MANUAL06'),(998,'','MANUAL07'),(998,'','MANUAL08'),(998,'','MANUAL09'),(998,'','MANUAL10'),(998,'','MANUAL11'),(998,'','MANUAL12'),(998,'','MANUAL13'),(998,'','MANUAL14'),(998,'','MANUAL15'),(998,'','MANUAL16'),(998,'','MANUAL17'),(998,'','MANUAL18'),(998,'','MANUAL19'),(998,'','MANUAL20'),(999,'1. 두부를 칼등으로 곱게 으깬 후\n면포에 싸서 물기를 짠다.','MANUAL01'),(999,'2. 식빵은 믹서에 갈아 빵가루를\n만들고, 포도는 믹서에 간 뒤 걸러\n포도즙을 만든다.','MANUAL02'),(999,'3. 냄비에 포도즙, 꿀, 물, 소금을\n넣고 끓으면 불을 끄고 식용유를\n넣고 섞는다.','MANUAL03'),(999,'4. 밀가루에 계피가루, 으깬 두부,\n검은깨, 다진 호두를 넣고\n반죽한다.','MANUAL04'),(999,'5. 짤주머니에 반죽을 넣고 15cm\n길이로 팬에 짠다.','MANUAL05'),(999,'6. 반죽표면에 3번을 바르고 180℃\n오븐에 15분 간 굽는다.','MANUAL06'),(999,'','MANUAL07'),(999,'','MANUAL08'),(999,'','MANUAL09'),(999,'','MANUAL10'),(999,'','MANUAL11'),(999,'','MANUAL12'),(999,'','MANUAL13'),(999,'','MANUAL14'),(999,'','MANUAL15'),(999,'','MANUAL16'),(999,'','MANUAL17'),(999,'','MANUAL18'),(999,'','MANUAL19'),(999,'','MANUAL20'),(1000,'1. 차가운 버터에 박력분,\n아몬드가루, 소금을 넣어\n으깨가면서 섞는다.','MANUAL01'),(1000,'2. 달걀과 물을 넣고 섞어 반죽을\n만들어 휴지시킨다.','MANUAL02'),(1000,'3. 휴지시킨 반죽을 밀대로 밀어\n커터로 모양을 찍은 뒤 180℃\n오븐에 굽는다.','MANUAL03'),(1000,'4. 땅콩호박을 삶아 체에 걸러 으깬\n뒤 사과즙, 달걀을 넣고 중탕하여\n섞는다.','MANUAL04'),(1000,'5. 4번에 전분을 조금씩 넣으면서\n농도를 맞춘 뒤 요거트를 넣는다.','MANUAL05'),(1000,'6. 5번을 짤주머니에 담은 뒤 3번\n위에 굵게 짜주고 다진 호두를\n뿌린다.','MANUAL06'),(1000,'','MANUAL07'),(1000,'','MANUAL08'),(1000,'','MANUAL09'),(1000,'','MANUAL10'),(1000,'','MANUAL11'),(1000,'','MANUAL12'),(1000,'','MANUAL13'),(1000,'','MANUAL14'),(1000,'','MANUAL15'),(1000,'','MANUAL16'),(1000,'','MANUAL17'),(1000,'','MANUAL18'),(1000,'','MANUAL19'),(1000,'','MANUAL20');
